INSERT INTO `documento` VALUES (1,'DESARROLLO DE UNA APLICACIN WEB QUE PERMITE DETECTAR SIMILITUDES ENTRE DOCUMENTOS DIGITALES.','{}','2008-11-03','Similitud, originalidad, copia, plagio, comparacin, semejanza, cotejo, documentos, tcnica Check.',2,1,1,1,1,'2013-09-17 08:20:51','2013-09-17 08:20:51','Documento_1.pdf','application/pdf',2945441,'2013-09-17 08:20:51',20,0,107,'COMPLETO'),(2,'ESTUDIO DE LA BIODEGRADACIN DEL CRUDO GUAFITA 1X EN DOS SUELOS DE DIFERENTE TEXTURA Y COMPOSICIN MINERALGICA','Se estudi la biodegradacin de un crudo liviano, durante 90 das, en dos suelos de diferente textura y composicin mineralgica. El proceso se evalu en base a: la disminucin de la cantidad de crudo extrado en intervalos de tiempo establecidos, los cambios en la composicin SARA y la variacin de los biomarcadores presentes en la fraccin de hidrocarburos saturados del crudo durante el tiempo de estudio. Para ello se tomaron dos suelos de diferente textura y composicin mineralgica: un suelo arenoso compuesto por cuarzo e ilita, y un suelo franco- arcillo- arenoso, compuesto por cuarzo y caolinita. Ambos suelos fueron estudiados con y sin un agente estructurante constituido por hojarasca (hojas secas de diferentes rboles cadas en el suelo). Las muestras se dividieron en cuatro grupos de la siguiente manera:- GRUPO 1: Suelo arenoso- GRUPO 2: Suelo franco-arcillo-arenoso- GRUPO 3: Suelo arenoso con agente estructurante- GRUPO 4: Suelo franco-arcillo-arenoso con agente estructuranteEn cada uno de los grupos se tomo el suelo determinado y se contamin con un crudo liviano (Guafita 1X) a una concentracin de aproximadamente 5%, seguidamente se aadi fertilizantes, y de manera peridica se ajust la humedad y el nivel de oxgeno, mediante aireacin, mezclando la muestra con un rastrillo. A los 1 y 30 das de avance de la biodegradacin se realiz una extraccin sohxlet del crudo presente en el suelo a una muestra de 3g de cada uno de los grupos, empleando como solvente diclorometano. Seguidamente se realiz la separacin de asfaltenos, mediante la adicin de n- heptano en una proporcin 40:1 (n-heptano: extracto), la determinacin de la composicin SAR (saturados, aromticos y resinas) mediante cromatografa de adsorcin en columna y por ltimo la determinacin de los biomarcadores presentes en la fraccin de hidrocarburos saturados mediante cromatografa de gases acoplada a espectrometra de masas. Las variaciones mas significativas se observaron en el suelo con predominio de grano fino y en presencia de un agente estructurante; lo cual permiti concluir que en este tipo de suelos el proceso de biodegradacin se lleva a cabo de manera mas efectiva que en suelos compuestos por mayores tamaos de grano y que la presencia de un agente estructurante favorece el proceso de biodegradacin.','2008-09-17','Suelo',4,1,1,1,1,'2013-09-17 08:20:52','2013-09-17 08:20:52','Documento_2.pdf','application/pdf',2381589,'2013-09-17 08:20:52',20,0,94,'COMPLETO'),(3,'CARACTERIZACIN DE LOS BIOMARCADORES PRESENTES EN EL NCLEO 26D-2X (GRUPO COGOLLO-PARTE BASAL DE LA Fm. LA LUNA), PROVENIENTE DE LA REGIN NOROCCIDENTAL DE LA CUENCA DEL LAGO DE MARACAIBO, VENEZUELA','Se estudiaron los biomarcadores y marcadores presentes en las fracciones dehidrocarburos saturados y aromticos, asociados al bitumen proveniente del ncleo26D-2X, con la finalidad de ampliar la informacin geoqumica asociada a las distintasformaciones del Grupo Cogollo y la parte basal de la Formacin La Luna. Para tal fin, seanalizaron 10 muestras del ncleo 26D-2X (Campo La Villa, NW Cuenca Lago deMaracaibo) que corresponden a las formaciones La Luna, Maraca, Lisure y Apn, yabarcan profundidades entre 9957 pies (3034,89 m) y 11940 pies (3639,31 m). Losmaltenos provenientes de tales muestras, fueron separados mediante cromatografa deadsorcin por columna, para obtener los hidrocarburos saturados y aromticos, loscuales fueron analizados utilizando CG/EM con el fin de identificar tanto losbiomarcadores como los marcadores asociados a ambas fracciones.A partir de los resultados obtenidos considerando los biomarcadores analizados(n-alcanos, Pristano, Fitano, terpanos tricclicos, esteranos regulares), se pudoestablecer aporte de materia orgnica tanto marina como continental, con intensidadvariable en aporte de materia orgnica continental. Tal variacin en el tipo de materiaorgnica sedimentada en la cuenca, condujo a la formacin de quergenos tipo II-III ytipo III. Adicionalmente, las condiciones redox desarrolladas durante la sedimentacinde las formaciones estudiadas, fueron inferidas a partir de los marcadores (DBT/P) y delos biomarcadores (P/F, Ts/Ts+Tm, ndice hopanos) presentes en las fraccionesanalizadas. En este sentido, se pudo observar una variacin cclica de las condiciones,dndose una alternancia de ambientes oxidantes y reductores, como consecuencia delas fluctuaciones en el nivel del mar, durante el perodo de sedimentacin, que a su vezafect el aporte de materia orgnica en la cuenca. Por ltimo, se determin que lasmuestras analizadas se encuentran en una etapa de madurez trmica que va detemprana a intermedia (entrando a \"ventana de petrleo\") de acuerdo a laisomerizacin de los hopanos y esteranos y a la relacin de terpanos triaromticos. Deacuerdo a estos parmetros, se desprende que las muestras correspondientes a laFormacin La Luna, poseen una menor evolucin trmica que aquellas asociadas a laFormacin Apn.Para finalizar, de acuerdo a los resultados obtenidos se concluye que elpotencial generador de hidrocarburos asociado a la Formacin La Luna, es mayor queel correspondiente al Grupo Cogollo, debido a las caractersticas de la materia orgnicaacumulada en ambas formaciones, las condiciones paleoambientales desarrolladasdurante su sedimentacin y la madurez trmica alcanzada por ambas dentro de lasecuencia estudiada.','2008-09-16','Grupo Cogollo, Formacin La Luna, Biomarcadores, Cuenca Lago de Maracaibo.',4,1,1,1,1,'2013-09-17 08:20:54','2013-09-17 08:20:54','Documento_3.pdf','application/pdf',3641357,'2013-09-17 08:20:54',20,0,98,'COMPLETO'),(4,'POLARIZABILIDAD E HIPERPOLARIZABILIDADES ESTTICAS DE ALGUNOS COMPUESTOS HETEROCCLICOS DE CUATROS MIEMBROS:EFECTO DE LOS SUSTITUYENTES Y DEL PLANO MOLECULAR.','En este Trabajo Especial de Grado (TEG) se realizaron clculos qumicocunticos de la polarizabilidad e hiperpolarizabilidades elctricas estticas de unaserie de molculas heterocclicas de cuatro miembros, con diferentes gruposdonantes y aceptores de electrones enlazados directamente al anillo. Inicialmente, seconsider la conformacin plana del anillo y, posteriormente, se tomaron en cuentadiferentes conformaciones caracterizadas por tener distintos valores del ngulorespecto al plano molecular. Esto ltimo, con la finalidad de establecer el efecto delas variaciones del ngulo del plano molecular en la polarizabilidad ehiperpolarizabilidades calculadas. Para calcular los valores promedio de <m>, <a>,<b> y <g> se emplearon mtodos ab initio y semiempricos. Los clculos ab initio serealizaron a nivel Hartree-Fock empleando los conjuntos base 6-31G, 6-31G(d,p) y 6-31+G(p, d), para lo cual se uso el paquete computacional GAUSSIAN 03 y GAMESS07. A nivel semiemprico, los clculos se realizaron con los mtodos PM3 y PM6utilizando la versin reciente MOPAC 07.Nuestros resultados HF y semiempricos, aunque en muchos casos sondiferentes cuantivamente y cualitativamente, indican que dependen fuertemente delngulo f, especialmente las hiperpolarizabilidades (b) y (g). Por otra parte,encontramos que las cantidades <m>, <a>, <b> y <g> son sensibles a la naturalezaqumica de los heterociclos caracterizada por los sustituyentes X y Y, observndoselos mayores efectos para las hiperpolarizabilidades (b) y (g).','2008-10-31','Initio',6,1,1,1,1,'2013-09-17 08:20:55','2013-09-17 08:20:55','Documento_4.pdf','application/pdf',1391723,'2013-09-17 08:20:55',20,0,165,'COMPLETO'),(5,'DETERMINACIN DE As, Ba, Cd, Hg, La, Mo y V EN TEJIDOS BLANDOS Y CONCHAS DE MOLUSCOS BIVALVOS EN EL ESTADO NUEVA ESPARTA','El presente estudio abarca la determinacin de As, Ba, Cd, Hg, La, Mo y V en tejidos blandos y conchasde moluscos bivalvos colectados en el estado Nueva Esparta. Los bivalvos analizados fueron Atrinaseminuda, Arca zebra, Brachiodontes modiolus, Crassostrea rhizophorae, Modiolus sp., Pinctadaimbricata, Perna perna y Perna viridis, recolectados en La Laguna de La Restinga, La Laguna de LasMarites, Isla de Coche, Isla de Cubagua, Punta de Piedras, Bella Vista y la baha de La Galera. Lasmuestras, tanto conchas como tejidos blandos, fueron secadas a 50C, pulverizadas y sometidas atratamiento qumico mediante una extraccin secuencial con HCl 4M y luego con Agua Regia. En cadaextracto fue realizada la determinacin de los elementos, a travs de ICP-OES para As, Ba, Cd, La, Mo yV. El Hg fue determinado por espectrometra de absorcin atmica.La concentracin de As, Ba, Cd, Hg, La y Mo en los tejidos blandos de bivalvos fueron: 4,7-28 g/g; 1,5-3 g/g; 0,2-38 g/g; 0,002-0,28 g/g; 1,3-8,1 g/g; 0,7- 6,3 g/g respectivamente. La concentracin de Vestuvo por debajo del lmite de deteccin de la tcnica analtica utilizada. Las concentraciones de Ba, Mo,Hg y V en los tejidos blandos de bivalvos no presentan diferencias notables entre las especies analizadasni entre las localidades muestreadas. Los bivalvos colectados en la localidad de Coche presentaronconcentraciones de As y Cd en sus tejidos blandos significativamente mayores al resto de las localidadesestudiadas. Las concentraciones de Cd diferencian entre especies de los bivalvos analizados, siendo lasque presentan las menores concentraciones las C. rhizophorae, P. perna y P. viridis, concentracionesintermedias las A. zebra y las mayores concentraciones son encontradas en P. imbricata. La mayorconcentracin de La fue encontrada en los mejillones P. viridis, Atrina s. y Modiolus sp. La concentracinde Ba, Cd, La, Mo y V en las conchas de bivalvos colectados en el estado Nueva Esparta fueron: 9-15 g/g; 0,04- 0,3 g/g; 6,7-16 g/g; 0,9-2,6 g/g; 3,3-5 g/ g respectivamente. La concentracin de As y Hgestuvieron por debajo del lmite de deteccin de la tcnica analtica utilizada. La concentracin de As, Ba,Cd, Mo y V en las conchas de bivalvos no permite diferenciar ni entre especies ni entre localidades. Lasconchas de las diferentes especies de bivalvos analizados contienen entre el 26% y el 41% de CO2, lo queimplica que las conchas de los bivalvos estn compuestas CaCO3 entre 59 y 93%.. El peso seco promediode los bivalvos analizados present el siguiente orden: Atrina seminuda (3,9 g) > Arca zebra (2,4 g) > P.perna (1,5 g) > P. viridis (1,1 g), P. imbricata (1,0 g) > C. rhizophorae (0,5 g), Modiolus sp. (0,6 g) > B.modiolus (0,2 g).','2008-09-19','S/I',4,1,1,1,1,'2013-09-17 08:20:56','2013-09-17 08:20:56','Documento_5.pdf','application/pdf',4646966,'2013-09-17 08:20:56',19,0,115,'COMPLETO'),(6,'ACTIVIDAD DE NANOCATALIZADORES DE W Y CoW SOPORTADOS SOBRE SiO2 Y y-Al2O3 MODIFICADOS EN LA REACCIN DE HDT DE HVGO.','La modificacin del soporte es una de las principales estrategias utilizadas,para obtener catalizadores ms activos y selectivos en la rama del HDT, es por elloque esta investigacin se enfoc en la modificacin de SiO2 y g-Al2O3, con g-aminopropiltrietoxisilano (GAPS) y la obtencin de nanocatalizadores de sulfuros deCoW y W, por un mtodo de preparacin que incluy la formacin de un complejodel Co2+ con los grupos aminos presentes en el soporte modificado, la formacin declorohidratos y el intercambio inico de los iones cloruros con la especie de W6+utilizada y por ltimo la sulfuracin con H2S. Se sintetizaron dos series decatalizadores de diferente composicin de metales para cada soporte, utilizando dossales de W el (NH4)2WS4 y el Na2WO4. La obtencin de una superficie carboncea esposible utilizando este mtodo de preparacin; esta superficie carboncea actocomo soporte de los metales, mejorando la dispersin de los mismos y evit a suvez la interaccin directa con el SiO2 y la g-Al2O3. La modificacin con GAPS de lossoportes hace posible soportar hasta un 4% de carga metlica, siendo este valormenor al valor de carga metlica que poseen los catalizadores comercialesexistentes actualmente. La caracterizacin de los catalizadores sintetizados serealiz mediante las tcnicas: Anlisis Textural, IR-TF, Anlisis Termogravimtrico yReflectancia Difusa.La actividad de los catalizadores sintetizados se determin por la reaccin deHDS en la fraccin de HVGO de un crudo pesado, los resultados obtenidos en lasactividades establecieron que: el soporte utilizado no afecta la actividad de loscatalizadores, mientras que la sal de W utilizada si afecta la actividad. Loscatalizadores sintetizados no mostraron actividad en la reaccin de HDN del HVGO.','2008-09-17','S/I',6,1,1,1,1,'2013-09-17 08:20:57','2013-09-17 08:20:57','Documento_6.pdf','application/pdf',2302992,'2013-09-17 08:20:57',19,0,1,'COMPLETO'),(7,'SNTESIS DE DERIVADOS DE ERGOSTEROL COMO POSIBLES DROGAS CON ACTIVIDAD ANTIPROTOZOARIOS (Trypanosoma cruzi))','El objetivo principal de esta tesis es sintetizar derivados de ergosterol comoposibles drogas con actividad antiprotozoarios, especficamente contra Trypanosomacruzi, agente etiolgico de la enfermedad de Chagas. Basndose en el hecho que elergosterol forma parte de la membrana celular de estos protorozoarios, la modificacinde ergosterol realizando su oxidacin y utilizando reactivos de Girard nos genera unava para introducir a estos microorganismos compuestos tipo azoles, los cuales seconsideran como un tipo de drogas de uso teraputico que han presentado actividadcontra Trypanosoma cruzi tanto in vitro como in vivo en distintos modelos de laenfermedad de Chagas.Para lograr esto se sigui la siguiente metodologa: se realizo la oxidacin deergosterol utilizando el reactivo de Jones, resultando como producto, ergosta-7,22-dieno-5-ol-3,6-diona (ergosterona) con un rendimiento del 54%. Se sintetizarondiferentes reactivos del tipo Girard (GX): GI (58%), GTr (67%) y GTc (68%) y luego seobtuvieron las hidrazonas respectivas a partir de ergosterona y los distintos reactivos deGirard. Tambin se utiliz Girard-P y Girard-T, los cuales son de procedencia comercial. Las hidrazonas obtenidas a partir de ergosterona y los distintos reactivos deGirard fueron: ergosterona- GT2 (84%), ergosterona-GP (91%), ergosterona-GP2 (84%),ergosterona-GI (85%), ergosterona-GTc (83%), ergosterona-GTr (91%).','2008-10-23','S/I',6,1,1,1,1,'2013-09-17 08:20:58','2013-09-17 08:20:58','Documento_7.pdf','application/pdf',1236531,'2013-09-17 08:20:58',20,0,140,'COMPLETO'),(8,'OPTIMIZACIN DE UN MTODO DE PRECONCENTRACIN DE PLOMO CON EXTRACCIN EN FASE SLIDA (SPE) Y DETECCIN POR ESPECTROMETRA DE ABSORCIN ATMICA EN LLAMA (F- AAS).','El presente trabajo, evala el mtodo de extraccin en fase slida para la preconcentracin de Pb y su deteccin por espectrometra de absorcin atmica en llama, para ello se estudi la capacidad de retencin y elucin del plomo de los slidos sorbentes otadecilsilano (C18) y teflon (PTFE) y con la ayuda de los solventes etanol y metil isobutil cetona (MIBK).Se encuentra que con el cartucho de C18 se produce una fuerte retencin del complejo de plomo, lo que no permite su elucin con bajos volmenes de etanol, entre 6 y 10 mLEn el caso del PTFE se logra su elucin con volmenes de MIBK entre 5 y 7 obteniendo asi un factor de preconcentracin de 5, para una masa de sorbente de 0.6 g. El lmite de deteccin obtenido es de 19.3 mg/L y una RSD de 7 %.Estos resultados perfilan al mtodo de SPE con la sensibilidad y RSD adecuada para el anlisis de Pb en muestras biolgicas y medioambientales.','2008-11-10','S/I',6,1,1,1,1,'2013-09-17 08:20:59','2013-09-17 08:20:59','Documento_8.pdf','application/pdf',1525719,'2013-09-17 08:20:59',17,0,85,'COMPLETO'),(9,'DETERMINACIN DE MINERALES Y CIDO FTICO POR HPLC-RI EN CEREALES INFANTILES','El cido ftico se encuentra en las semillas de cereales, leguminosas,oleaginosas y frutos secos. Desde el punto de vista nutricional, es necesario manteneruna dieta equilibrada, variada y completa para garantizar el desarrollo saludable de laspersonas, especialmente en los nios. De esta manera, los cereales son esenciales enla alimentacin infantil ya que proporcionan al infante protenas, minerales, vitaminas,etc, sin embargo, el cido ftico presente en los mismos inhibe la absorcin del hierro,calcio y zinc al formar complejos insolubles, lo que hace necesario el consumomoderado de los cereales en la alimentacin infantil.Por otra parte, algunos investigadores han planteado que los bajos porcentajesde recuperacin en el anlisis de cido ftico en cereales infantiles por la tcnica deHPLC-RI estn atribuidos al alto contenido de metales en los mismos, a diferencia delos cereales sin procesar, sin embargo, tambin se ha presentado bajos porcentaje derecuperacin para esta tcnica con el uso de metodologas deficientes en el tratamientode muestras.El propsito de esta investigacin fue determinar si los problemas en lacuantificacin del cido ftico en cereales infantiles por la tcnica HPLC-RI estnasociados a las etapas de pretratamiento de muestras o a la presencia de altocontenido de metales tpicos de estas muestras, para ello se realiz el estudio de cidoftico en algunos cereales de bebe por HPLC-RI empleando la metodologa planteadapor Hernndez. Adems se determin las concentraciones de hierro, calcio y zinc de loscereales seleccionados por EAA, para realizar la correlacin de metal-fitato conrespecto a sus efectos en el % recuperacin del fitato.Se encontr que los % de recuperacin para el anlisis de IP6 en cerealesinfantiles por el mtodo propuesto son muy bajos (47- 57) %, y que estos valores nosolo estn relacionados con un alto contenido mineral en el cereal, sino que paramuestras como el trigo partido # 1 donde el contenido de metales es bajo, tambin seencuentra un bajo % de recuperacin (70%). La diferencia de este ultimo trigo con elestudiado por Hernndez, el cual obtuvo % de recuperacin entre 90-92%, fue sumenor contenido de IP6 y su tamao de grano partido mucho ms pequeo, lo querequiere el uso de un paso adicional de filtracin tanto en esta muestra como en la delos cereales infantiles.Estos resultados demuestran que el mtodo HPLC-RI no puede ser utilizado parael anlisis de cido ftico en cereales infantiles, an cuando algunos autores lo siguenusando libremente.','2008-10-31','S/I',6,1,1,1,1,'2013-09-17 08:21:01','2013-09-17 08:21:01','Documento_9.pdf','application/pdf',2933932,'2013-09-17 08:21:01',20,0,124,'COMPLETO'),(10,'IMPLICACIONES DEL GRADO DE CONTAMINACIN POR CRUDO EN LA MINERALIZACIN POTENCIAL DE NITRGENO EN SUELOS DE DIFERENTES TEXTURAS, COLECTADOS EN EL SUR DEL ESTADO ANZOTEGUI','Los HC y sus derivados son sustancias de alto peso molecular, mayormente insolubles en agua, que resultan muy txicas para los organismos vivos. La mayora de los microorganismos del suelo no pueden crecer en presencia de hidrocarburos y mueren. Entre estos microorganismos afectados estn varios de importancia ecolgica, como las bacterias fijadoras de N (Ach y Fontrbel, 2000). La magnitud de afectacin por petrleo en la actividad biolgica del suelo, va a depender de la concentracin del contaminante y de las caractersticas fsico-qumicas del suelo, por tanto al estudiar el impacto de este contaminante en la actividad biolgica del suelo, se debe evaluar la textura.Dentro del marco del proyecto Orinoco-Magna Reserva, la industria petrolera tiene planificado realizar actividades de explotacin al sur del estado Anzotegui. En esa zona se encuentran ecosistemas de altsima fragilidad como morichales y bosques ribereos, los cuales se encuentran ocupando suelos de textura variada (Chacn et al., 2007). Tomando en cuenta este aspecto el objetivo principal de este estudio fue evaluar los cambios en la mineralizacin de N cuando suelos de diferentes texturas estn siendo impactados con concentraciones basales de crudo. La informacin aqu obtenida se espera que contribuya a disear estrategias de recuperacin de reas degradadas por actividades de la industria petrolera.En este trabajo se determin que independientemente del tipo de textura de suelo la adicin de niveles basales de crudo condujo a un decrecimiento en la mineralizacin neta de N en el suelo, pero no en el No. En el suelo arcilloso la k tambin decreci a consecuencia de la adicin de crudo. En la zona de estudio los morichales se encuentran sobre suelos de textura arcillosa, por lo que el ciclaje de N en el suelo en este tipo de ecosistema se vera altamente afectado ante una posible contingencia de un derrame de crudo; por otro lado se obtuvo que el Nm disminuy al aumentar la proporcin de crudo empleado, y se determinaron altas y positivas correlaciones en parmetros determinados como Nm y %CT.','2008-09-18','mineralizacin, nitrgeno, crudo, suelo, textura.',4,1,1,1,1,'2013-09-17 08:21:03','2013-09-17 08:21:03','Documento_10.pdf','application/pdf',829747,'2013-09-17 08:21:03',18,0,63,'COMPLETO'),(11,'ESPECTROSCOPA DE RESONANCIA MAGNTICA NUCLEAR PARA ESTUDIAR EL USO DE EMULSIONES ASFLTICAS COMO ENMIENDAS MEJORADAS DE SUELOS CIDOS DE SABANA.','La baja presencia de materia orgnica y el alto contenido de elementosparamagnticos en suelos cidos de sabana, dificultan su estudio por RMN yprovoca que sean sistemas de baja fertilidad. Con el objeto de identificar lanaturaleza de los componentes de la materia orgnica de estos suelos, as comotambin reconocer la naturaleza de las emulsiones asflticas e interpretar el efectode estas emulsiones en el suelo, se realizaron estudios de RMN de 1H y 13C en lasemulsiones, en el suelo sin tratamiento (S) y en suelos tratados con diferentes dosisde emulsin catinica (SEC) y aninica (SEA). A la muestra SEA tambin se le tomun espectro de 31P. Para lograr la obtencin de dichos espectros fue necesariorealizar la extraccin de la materia orgnica del suelo y la eliminacin de loselementos paramagnticos como el Fe, a travs de una modificacin delprocedimiento utilizado por Briceo et al en el 2006. Este nuevo procedimientopermiti obtener espectros de RMN 1H y 13C de alta resolucin y, por primera vez, unespectro RMN de 31P.El anlisis de los espectros de RMN para las emulsionesmuestra presencia de CH3 terminales, cadenas largas de CH2 y carbonosaromticos. Una nueva seal en 3,63 ppm correspondiente a protones se asign auna estructura de tipo CH3 - N- y es lo que diferencia la emulsin catinica de laaninica. Los protones integrables del espectro se usaron para determinar larelacin H-Ar/H-Ali = 0,07, la cual indica mayor contenido de protones alifticos quede protones en anillos aromticos, lo que puede estar indicando la presencia decarbonos aromticos sustituidos o estructuras de anillos policclicos.El anlisis de los espectros de RMN de la materia orgnica del suelo permiteproponer un fuerte carcter aromtico y una mezcla de estructuras complejas.Losanlisis realizados para los tratamientos de suelo y su posterior interpretacinpermiten observar una mayor interaccin entre el suelo y la emulsin catinica(SEC), que contribuye a un aumento en las formas orgnicas del suelo, mientraspara el caso del suelo con emulsin aninica (SEA) no se observa una interaccindirecta sino un posible aumento en el tamao de los agregados del suelo.','2008-10-28','s/i',6,1,1,1,1,'2013-09-17 08:21:04','2013-09-17 08:21:04','Documento_11.pdf','application/pdf',13782367,'2013-09-17 08:21:04',20,0,141,'COMPLETO'),(12,'MODIFICACIN ESTRUCTURAL DE HESPERIDINA Y NARINGINA (FLAVONOIDES) Y ESTUDIO DE SU ACTIVIDAD BIOLGICA SOBRE LA ENZIMA GLUCOSA-6-FOSFATASA','Se realiz la transformacin estructural de dos flavanonas (hesperidina y naringina) para la obtencin de otros tipos de flavonoides.Mediante la hidrlisis cida de la hesperidina se obtuvo el hesperetin-7-glucosa; al tratar ambas flavanonas en medio bsico se lograron obtener las respectivas chalconas; a partir de dichas chalconas, usando NBS y siguiendo un tratamiento posterior se lograron obtener las flavonas tanto de la naringina como de la hesperidina. Otras reacciones que se intentaron pero no se logr el producto deseado fueron la hidrogenacin cataltica de la chalcona y la oxidacin con perxido de hidrgeno de las flavanonas.A todos los compuestos obtenidos se determin su actividad biolgica sobre la enzima glucosa-6-fosfatasa. Los resultados indican que estos flavonoides inhiben la enzima y que actan de manera ms efectiva sobre el transportador T1 que sobre la subunidad cataltica.','2008-10-29','S/I',6,1,1,1,1,'2013-09-17 08:21:06','2013-09-17 08:21:06','Documento_12.pdf','application/pdf',840840,'2013-09-17 08:21:06',17,0,72,'COMPLETO'),(13,'ESTUDIO DE LA REACTIVIDAD EN HIDRODESCLORINACIN CATALTICA DE BIFENILOS POLICLORADOS (Aroclor 1260) EMPLEANDO FASES MIXTAS DE CARBUROS Y NITRUROS DE M- Mo (M=Co, Ni).','La hidrodesclorinacin cataltica (HDCl) es un proceso econmico, eficiente yambientalmente seguro, para la eliminacin de compuestos organoclorados, entreellos los bifenilos policlorados (BPCs); los cuales son compuestos altamente txicosy persistentes en el medio ambiente. En el presente trabajo de grado, realizoSntesis, caracterizacin y estudio de la reactividad de catalizadores msicos de Co-Mo y Ni-Mo es sus fases: carburada y nitrada, empleados en la reaccin dehidrodesclorinacin de bifenilos policlorados (Aroclor 1260).Esta reaccion fue estudiada en un reactor de flujo continuo a presinatmosfrica y a una temperatura de 200 C, donde se trat una solucin de 500ppmen cloro. Los catalizadores msicos de nquel-molibdeno y cobalto- molibdeno, ensus estados carburado y nitrurado, fueron sintetizados por el mtodo de reduccin atemperatura programada con relaciones metlicas de: 0.25, 0.33, 0.50 y 0.75 (tomoNi/tomos totales). Todos estos catalizadores fueron presulfurados empleando CS2 yseguidamente, se realiz la reaccin de hidrodesclorinacin de BPCs, en flujo deHidrogeno.Los resultados indican que los nitruros son ms activos que los carburos y losxidos correspondientes, los carburos de metales de transicin, as como los nitrurospresentan diferencias superficiales entre ellos. Mientras el carbono se difunde a altastemperaturas para formar el carburo, el nitrgeno puede permanecer en la superficie[39]. Este nitrgeno superficial podra ser responsable de la disminucin aun masimportante de rea de los nitruros bimetlicos estudiados. Los slidos fueroncomparados con un catalizador comercial (AERO HDS-3A) dando como resultadoque los nitruros son mas activos que el catalizador comercial.','2008-10-29','s/i',6,1,1,1,1,'2013-09-17 08:21:08','2013-09-17 08:21:08','Documento_13.pdf','application/pdf',5732003,'2013-09-17 08:21:08',18,0,67,'COMPLETO'),(14,'CARACTERSTICAS GEOLGICAS Y GEOQUMICAS DE LAS DOLOMAS PRESENTES EN LOS NCLEOS MPN- 1X Y OBl- 3X DEL MIEMBRO O DE LA FORMACIN ESCANDALOSA, CUENCA BARINAS - APURE, VENEZUELA.','En este trabajo, se llev a cabo el estudio mineralgico y geoqumico de lasdolomas presentes en los ncleos MPN - 1X y OBI - 3X, pertenecientes alMiembro O de la Formacin Escandalosa, en la Cuenca de Barinas - Apure, conel fin de determinar el posible ambiente de dolomitizacin de los minerales deCaCO3 y los posibles cambios de facies, laterales y verticales, entre los dosncleos. Se escogi doce muestras por cada ncleo. Se eligi seis muestras decada ncleo para su anlisis mineralgico por Difraccin de Rayos - X; se verificla presencia de los minerales dolomita y cuarzo en todas las muestras y el mineralcalcita en zonas intermedias de ambos ncleos. El anlisis geoqumico consistien determinar la concentracin de los elementos mayoritarios, Ca y Mg y losminoritarios y traza, Ba, Fe, K, Mn, Na, Sr y Zn, mediante la tcnica deEspectrometra de Emisin ptica Inductivamente Acoplado a Plasma (ICP),aplicada a la totalidad de las muestras. Los resultados qumicos proporcionaroninformacin en cuanto al grado de dolomitizacin sufrido por los minerales deCaCO3 y revelaron la influencia de fluidos ricos en Fe y Mn que actuaron ensoterramiento, en una etapa de diagnesis tarda, posiblemente produciendo lasalida de los elementos Ba, K, Na, Sr y Zn. De acuerdo a la estequiometra de lasdolomitas promedio de cada ncleo, se dedujo que el proceso de dolomitizacinfue ms avanzado en la zona correspondiente al ncleo OBI - 3X que en la zonadel ncleo MPN - 1X, debido posiblemente a un rgimen menos rido en esteltimo, evidenciado por un alto contenido de clsticos terrgenos presentes en estazona.','2008-09-17','s/i',4,1,1,1,1,'2013-09-17 08:21:10','2013-09-17 08:21:10','Documento_14.pdf','application/pdf',5400780,'2013-09-17 08:21:10',18,0,99,'COMPLETO'),(15,'EFECTO DE DIFERENTES TIPOS DE EMULSIONES ASFLTICAS (aninica y catinica) DE ROMPIMIENTO LENTO SOBRE LA ADSORCIN DE FSFORO EN CAOLINITA','Con anterioridad se han realizado investigaciones con el objetivo de encontraralternativas de manejo agroecolgico viables desde la perspectiva ecolgica yeconmica, mediante el incremento de la fraccin de fsforo biodisponible, lo cual es deespecial prioridad en los suelos altamente meteorizados de las regiones tropicales,particularmente en las sabanas de Los Llanos de Venezuela. En el presente trabajo seevaluaron los efectos de diferentes tipos de emulsiones asflticas (aninica y catinica)sobre la adsorcin de fsforo en un mineral de carga permanente, la caolinita, siendo unmineral secundario ampliamente extendido en los suelos de sabanas. Durante laexperimentacin, se evalu la competencia inica que se establece entre el in fosfato ylas emulsiones asflticas, para lo cual se establecieron cuatro variantes experimentales.La primera, corresponde a la introduccin del in fosfato al sistema despus de laadsorcin de la emulsin por la caolinita (IE- P), la segunda, la introduccin del fosfatoantes de la adsorcin de la emulsin (IP-E), la tercera, la introduccin de fosfato alsistema luego de haber agregado la emulsin y dejarla interactuando con el mineraldurante un periodo de incubacin de 10 das (IEIn-P) y la ltima, la introduccinsimultanea del fosfato y la emulsin (IPE). Adicionalmente, fue determinado el pH encada caso luego de alcanzarse el equilibrio de adsorcin. Los resultados fueroninterpretados empleando isotermas de adsorcin, siendo comparadas con una\"isoterma control\" en la que fue representada la cantidad de fsforo adsorbido por lacaolinita en ausencia de emulsin asfltica, observndose una disminucin apreciablede la adsorcin de P bajo las diferentes condiciones de trabajo con excepcin de lacorrespondiente (IP-E), lo cual pudo ser validado aplicando los modelos tericomatemticosde Langmuir y Freundlich. Las determinaciones de pH hechas a lassoluciones permitieron plantear los posibles mecanismos de intercambio inicoinvolucrados en estas reacciones.','2008-10-09','S/I',6,1,1,1,1,'2013-09-17 08:21:11','2013-09-17 08:21:11','Documento_15.pdf','application/pdf',4828699,'2013-09-17 08:21:11',19,0,155,'COMPLETO'),(16,'SNTESIS YCARACTERIZACIN DEL 2,3,4,5-TETRAMETOXITOLUENO COMO PRECURSOR EN LA SNTESIS DE LA COENZIMA Q10','En el siguiente Trabajo Especial de Grado se presenta una nueva metodologa sinttica que permiti obtener el 2,3,4,5-tetrametoxitolueno. Este compuesto es una molcula muy sencilla y a la vez muy importante, ya que es el precursor en la sntesis total de la Coenzima Q10, compuesto que actualmente posee un gran nmero de aplicaciones clnicas, como por ejemplo, su utilizacin como suplemento alimenticio y su recomendacin para el tratamiento de personas con enfermedades cardacas. Por estas razones se convierte en una de las sustancias ms comercializadas a nivel mundial.La sntesis del 2,3,4,5-tetrametoxitolueno consta de cuatro pasos sintticos. Se utiliz como materia prima el 2,3,4- trimetoxibenzaldehdo, el cual est disponible comercialmente. A travs de una reaccin de Dakin, una formilacin, hidrogenacin cataltica y por ltimo una metilacin se logr obtener el compuesto deseado con un rendimiento moderado.','2008-10-22','s/i',6,1,1,1,1,'2013-09-17 08:21:12','2013-09-17 08:21:12','Documento_16.pdf','application/pdf',352521,'2013-09-17 08:21:12',18,0,56,'COMPLETO'),(17,'CARACTERSTICAS GEOLGICAS Y GEOQUMICAS DE DOLOMITAS, DOLOMIAS Y OTRAS FACIES CALCREAS DEL CRETACICO Y HOLOCENO EN VENEZUELA','En este trabajo de investigacin se realiz el estudio de diversas facies de sedimentoscalcreos recientes del archipilago Los Roques con el propsito de determinar la posibleformacin de una facies denominada protodolomita o facies de sedimento calcreoenriquecido en magnesio por procesos diagenticos superficiales en ambientes de sabkha ylagunas hipersalinas localizados al nor- este del archipilago. Igualmente, se determin elorigen y ambiente sedimentario de unas facies de dolomas del Grupo Cogollo pertenecientesa los miembros Machiques y Pich de la Formacin Apn y se realiz una comparacin entrelas facies estudiadas pertenecientes al Holoceno y al Cretcico con el propsito de determinarlas diferencias en la composicin qumica entre facies calcreas de distintas edades y susposibles modelos de origen y sedimentacin.Para el cumplimiento de los objetivos planteados se estudiaron muestras de sedimentos delarchipilago Los Roques, pertenecientes a ambientes hipersalinos supramareales, sabkhas,lneas de playa y planos arrecifales, as como muestras de facies de dolomas de los ncleosALPUF 6 y VLA 711 ubicados en la cuenca de Maracaibo. Se realiz, tanto para las muestrasde sedimento como de ncleo, la determinacin de la composicin mineralgica por medio dedifraccin de rayos X, y la determinacin de la concentracin de los elementos Ca, Mg, Sr,Ba, Na, K, Fe, Mn y Zn por medio de espectrometra de emisin atmica inductivamenteacoplado a plasma (ICP).El anlisis de los resultados obtenidos permite afirmar que en los ambientes de lagunashipersalinas y sabkha del archipilago Los Roques, actualmente hay formacin por procesosdiagenticos de una facies enriquecida en magnesio a partir de una mineraloga inicial dearagonito y calcita magnesiana, originando un estado previo a la dolomita que se hadenominado protodolomita. Este enriquecimiento est relacionado con una alta evaporacinen los fluidos y la formacin temprana de minerales de evaporitas, permitiendo el aumento dela relacin Mg/Ca. Para las dolomas del Grupo Cogollo, mediante la comparacin entre lasconcentraciones de los elementos determinados en las muestras obtenidas de los ncleos, ascomo su posicin estratigrfica a lo largo de la cuenca, se concluye que son facies formadasen ambientes superficiales de lagunas hipersalinas y sabkhas locales a partir de sedimentoscalcreos no litificados, con procesos muy similares a los analizados en los sedimentos de LosRoques. Posteriormente por procesos diagenticos durante el soterramiento, han continuadoexperimentando cambios que han modificado parcialmente la concentracin tanto de loselementos mayoritarios, minoritarios y traza.','2008-09-17','Sin informacion',4,1,1,1,1,'2013-09-17 08:21:13','2013-09-17 08:21:13','Documento_17.pdf','application/pdf',3969901,'2013-09-17 08:21:13',20,0,155,'COMPLETO'),(18,'SNTESIS Y CARACTERIZACIN DE DIFOSFINAS QUIRALES ANLOGAS AL DIOP, CON Si, Ge Y Sn','La sntesis de difosfinas quirales ha experimentado un gran auge en los ltimos aos debido a las diversas aplicaciones que se han encontrado, entre las cuales se puede mencionar la hidrogenacin cataltica de olefinas proquirales, que ha permitido la elaboracin de frmacos, agroqumicos, saborizantes y fragancias enantiomricamente puras, entre otras no menos importantes.En este trabajo se realiz la sntesis de difosfinas quirales anlogas al DIOP, a partir de la hidrlisis del anillo 1,3 - dioxolano del (DIOP) para obtener el (-) - 2,3- dihidroxi- 1,4-bis(difenilfosfino) butano. Este compuesto se hizo reaccionar posteriormente con dimetildiclorosilano, dimetildiclorogermano y dimetildicloroestao para obtener los compuestos:(a)(-) -1,3 - O - dimetilsilil - 1,4-bis(difenilfosfino)butano(b)(-) -1,3 - O - dimetigermil- 1,4-bis (difenilfosfino)butano(c)(-) -1,3 - O - dimetilestannil - 1,4 -bis (difenilfosfino)butanoDe las sntesis realizadas, slo se obtuvieron con xito las difosfinas quirales anlogas del DIOP con Si y Sn, estos compuestos se caracterizaron empleando las tcnicas espectroscpicas de RMN de 1H, 13C, y 31P; IRTF y masas.','2008-10-31','S/I',6,1,1,1,1,'2013-09-17 08:21:14','2013-09-17 08:21:14','Documento_18.pdf','application/pdf',2245407,'2013-09-17 08:21:14',19,0,149,'COMPLETO'),(19,'DETERMINACIN DE Mn, Fe, Cr, Ni, Co, V y Pt EN SEDIMENTOS DE LA CUENCA DEL RO CUIRA.','En la cuenca del ro Cuira fueron recolectadas 26 muestras de sedimentos en dos salidas de campo, dichas muestras fueron tamizadas a travs de 10, 18, 35 y 60 mallas en campo y a travs de 120, 230 y 325 mallas en el laboratorio. De las fracciones tamizadas en campo, fueron tomadas muestras a las cuales les fue medida la humedad para recalcular el peso seco de las fracciones en cada punto. Los datos obtenidos permitieron determinar la distribucin granulomtrica, obtenindose que la zona de estudio est dominada por las arenas muy gruesas y gruesas. La fraccin mayor a diez mallas no fue considerada para este proyecto. A las siete fracciones granulomtricas de nueve de los puntos les fue determinada la concentracin de Co, Cr, Mn, Ni, Mg y V y Pt con la finalidad de identificar la fraccin ms adecuada para el estudio de esos elementos en la zona. Los resultados indican que para el rea no existe una fraccin de tamao de grano en la cual los elementos estn siendo concentrados significativamente. Los 26 puntos de muestreo fueron analizados empleando la fraccin < 325 mallas con el objeto de establecer la relacin espacial de Mn, Fe, Cr, Ni, Co, y V los resultados obtenidos muestran que las mayores concentraciones de Fe, Cr, Ni, Co, y V estn relacionadas con sedimentos provenientes del Complejo Ultramfico de Apa, mientras que el Mn no presenta diferencias significativas de concentracin en la zona. No obstante el, Cr es, del grupo de los elementos estudiados, el que permite hacer mejor diferenciacin entre el Complejo de Ultramfico de Apa y el resto de las litologas presentes. El elemento Pt est por debajo del lmite de deteccin del mtodo empleado, su concentracin en las muestras analizadas es menor a 20 ng/g.','2008-09-17','S/I',4,1,1,1,1,'2013-09-17 08:21:15','2013-09-17 08:21:15','Documento_19.pdf','application/pdf',3567536,'2013-09-17 08:21:15',18,0,76,'COMPLETO'),(20,'COMPLEJOS DE VANADIO (V). SISTEMA VO2+- ACETILACETONA(KCl 3.0 M, 25C)','Los bifenilos policlorados (BPCs) son compuestos qumicos altamente txicos queposeen la capacidad de bioacumularse, ser inertes qumicamente, ser persitentes,pirorresistentes y mutagnicos. Debido a sus mltiples aplicaciones, los BPCs seencuentran altamente dispersos en el ambiente, por lo que el desecho de losmismos representa un grave problema ambiental. Entre los diversos mtodosaplicados para la eliminacin definitiva de los bifenilos policlorados, se encuentra laHidrodesclorinacin Cataltica, la cual emplea catalizadores y corrientes dehidrgeno para lograr la desclorinacin sucesiva de los compuestos organocloradosy degradarlos en compuestos menos txicos, adems de tener la ventaja de nogenerar residuos txicos. El mecanismo a travs del cual se produce lahidrodesclorinacin, an no est bien definido, por lo que el inters de este trabajoestuvo enfocado hacia el estudio de dicho mecanismo.Para el estudio se emple catalizadores de Ni, Mo y NiMo soportados sobre g-almina los cuales fueron caracterizados por XPS, DRX y se les realiz anlisis derea especfica por el mtodo BET. Se utiliz el clorobenceno por su estructurasencilla y con los resultados obtenidos de su hidrodesclorinacin, se trat depredecir el comportamiento del decaclorobifenilo en la reaccin. Se obtuvo comoproductos de la reaccin del clorobenceno; el benceno y bifenilo; mientras que parael caso de la reaccin del decaclorobifenilo se obtuvieron el ciclohexilbenceno,bifenilo, ismeros de terfenilos e ismeros de cuaterfenilos. La formacin delbenceno pudo haberse dado por un mecanismo inico donde el in hidruro ( - H )ataca a la molcula de clorobenceno adsorbida, generando un anin fenlico queacepta luego un protn; o a travs de un mecanismo va radicales libres, donde segeneran radicales fenilos que bien pueden interactuar con radicales de hidrgenoadsorbidos en la superficie del catalizador y formar el benceno o reagruparse entreellos y formar el bifenilo, los ismeros de terfenilo y de cuaterfenilo. Se propuso steultimo mecanismo como el mecanismo factible para la formacin de las especiespoliaromticas que se obtuvieron como resultado.','2008-06-06','S/I',6,1,1,1,1,'2013-09-17 08:21:18','2013-09-17 08:21:18','Documento_20.pdf','application/pdf',1365218,'2013-09-17 08:21:18',20,0,112,'COMPLETO'),(21,'GEOLOGA Y GEOQUMICA DE LAS DOLOMAS DEL MIEMBRO O DE LA FORMACIN ESCANDALOSA DE LA CUENCA DE BARINAS, VENEZUELA. NCLEO DEL POZO BOR 12X','En el siguiente trabajo de investigacin se llev a cabo un estudio sobre la geologa y geoqumica de las dolomas del Miembro O de la Formacin Escandalosa. Estas dolomas son provenientes de un ncleo extrado por el pozo BOR 12X de la cuenca de Barinas, Venezuela. A travs de este estudio, se determino el origen de formacin de estas rocas, ya sea en superficie o soterramiento. Para cumplir con los objetivos planteados se seleccionaron 21 muestras de dolomas. A estas muestras se le realiz la descripcin macroscpica de algunas secciones del ncleo, anlisis de Difraccin de Rayos X para la muestra total y residuos, y por ltimo, el anlisis qumico para determinar la concentracin de los elementos Ca, Mg, Fe, Mn, K, Na, Ba, Sr y Zn. Para el anlisis qumico previamente se efectu el tratamiento con cido clorhdrico para obtener la fase carbontica en solucin y el residuo insoluble (fase siliciclstica); a esta ltima fase no se le llev a cabo ninguna determinacin elemental, slo se analiz la mineraloga presente.Las dolomas del Miembro O son del tipo magnesianas, con un valor promedio en sus relaciones estequiomtricas Ca 0.98 Mg 1.02 (CO3)2. Las concentraciones de Fe y Mn indican un aumento durante los eventos en la diagnesis tarda, donde ocurren procesos de purificacin y recristalizacin de las dolomas. Las concentraciones de K, Na, Ba y Sr indican que posiblemente las dolomas se formaron durante la diagnesis temprana y que luego de los eventos durante el soterramiento profundo, ocurri una disminucin en las concentraciones originales de estos elementos, sin embargo, an se conservan las relaciones que tuvieron originalmente cuando se formaron, durante la diagnesis temprana.Para la formacin de las dolomas del Miembro O, existen 6 modelos generales de dolomitizacin que pudieron haber interactuado durante la diagnesis temprana y la diagnesis tarda. Estos modelos son: 1. Lagunas hipersalinas o sabkha, 2. Modelo de flujo y reflujo de aguas enriquecidas en magnesio, 3. Dolomitizacin por capilaridad, 4. Dolomitizacin por la reaccin entre las aguas intersticiales y las calizas a elevadas temperaturas y presiones, 5. Dolomitizacin en profundidad por compactacin de arcillas y expulsin de fluidos ricos en magnesio, 6. Dolomitizacin por bacterias sulfato reductoras. Estos modelos fueron propuestos en base a los resultados obtenidos.','2008-09-17','s/i',4,1,1,1,1,'2013-09-17 08:21:19','2013-09-17 08:21:19','Documento_21.pdf','application/pdf',3872249,'2013-09-17 08:21:19',19,0,98,'COMPLETO'),(22,'AISLAMIENTO DE LOS METABOLITOS SECUNDARIOS PRESENTES EN LA Bauhinia variegata L..BIODIRIGIDO POR ENSAYOS DE INHIBICIN SOBRE LA ENZIMA GLUCOSA-6-FOSFATASA\".','En actualidad continan siendo numerosos los aportes de compuestosaislados de fuentes naturales para ensayar su actividad sobre enzimas quecontrolen alguna funcin en el organismo, por ejemplo la regulacin de la liberacinde glucosa es importante en el control de la diabetes.En este trabajo se realiz un estudio fitoquimco y biolgico que permitieraseparar fracciones y/o compuestos de la especie Bauhinia variegata L, paraposteriormente ensayar su actividad en la inhibicin de la enzima glucosa-6-fosfatasa, que es la enzima catalizadora del paso final en los mecanismos deglucogenolisis y gluconeogenesis, que se conocen son los responsables de laliberacin de glucosa al torrente sanguneo, en perodos de ayuna.Para ello se realiz el tratamiento del material vegetal de la Bauhinia variegataL. directamente con metanol, y luego ste extracto resultante se someti a particincon una mezcla metanol-agua 1:1, seguidamente de particin con acetona, tantopara la fraccin soluble e insoluble correspondientes a la mezcla de solventes. Deesta doble particin se obtienen cuatro fracciones, A-D (A: i metanol-agua i acetona,B: i metanol-agua s acetona, C: s metanol-agua i acetona, D: s metanol-agua sacetona) a las que se les evalu la actividad inhibitoria sobre la enzima Glucosa-6-fosfatasa. La fraccin que present mayor actividad inhibitoria sobre el transportadorT1 fue la D (79,4 %), por esta razn fue seleccionada para la separacin con losmtodos cromatogrficos disponibles (cromatografa en contracorriente, seguida porTLC, y cromatografa en columna). A las fracciones obtenidas de la separacin porcromatografa en mayor cantidad se les realiz el anlisis qumico de suscomponentes con las tcnicas espectroscpicas de RMN 1H, y RMN 13C, con esto sepudo definir la estructura de dos compuestos puros aislados no reportados hasta lafecha en la planta: un flavonoide 1, isoquercetina y una ionona 2, ([(+)-(6S,9R)-9-O- -D-glucosido-6-hidroxi-3-oxo- - ionol].Adicionalmente, se obtuvieron diversas fracciones cuya composicin no selogro definir en su totalidad por la poca separacin de sus componentes que sealcanz, sin embargo se logr detectar la presencia de un compuesto que pudieraser una estructura tipo flavonoidal, y no se logr la elucidacin de la estructura de elporque perteneca a una mezcla y por la poca cantidad que se obtuvo para realizarotros experimentos adicionales, que permitieran su caracterizacin.Es interesante resaltar el hecho de que la mayora de los compuestosreportados en el genero Bauhinia con actividad hipoglicemiante, correspondan aestructuras de tipo flavonoidal, y en este trabajo se logr aislar de la BauhiniaVariegata una ionona 2 que present mayor actividad inhibitoria sobre la enzima G-6-Pasa, que el otro compuesto aislado de estructura flavonoidal 1.','2008-10-22','s/i',6,1,1,1,1,'2013-09-17 08:21:21','2013-09-17 08:21:21','Documento_22.pdf','application/pdf',6477272,'2013-09-17 08:21:21',18,0,100,'COMPLETO'),(23,'FRACCIONAMIENTO DE FSFORO EN UN SUELO CIDO DE SABANA INCUBADO CON EMULSIN ASFLTICA','el este del pas, poseen caractersticas muy particulares tales como rpido drenajeinterno, pH acido, moderada precipitacin y con ello un lavado constante de lossuelos, lo que trae como consecuencia la prdida de macronutrientes esencialespara el crecimiento y desarrollo de los cultivos. Uno de los elementos esenciales quese pierden es el fosforo (P), lo que produce una limitante en la fertilidad de estossuelos. Aunque se ha demostrado que las enmiendas orgnicas, as como las rocasfosfricas mejoran las condiciones de los mismos, nuevas enmiendas se quierenincorporar al sistema de mejoramiento de la fertilidad del suelo.En este trabajo se pretende investigar las llamadas emulsiones asflticas y suinfluencia sobre el suelo, que si bien, an no se conoce su estructura qumica(debido a su complejidad), se sabe que son de fcil obtencin, (provienen delpetrleo); y que da resultados favorables en cuanto a fenmenos fsico-qumicos y almejoramiento de las propiedades fsicas del suelo.Tomando en cuenta las abundantes interrogantes que se tienen acerca delefecto de las emulsiones sobre el suelo, se presenta este trabajo; en el cual serealiza un fraccionamiento secuencial de P a un suelo de sabana del estadoAnzotegui, proveniente del Hato Rancho Grande, que permite obtener resultadosacerca del comportamiento del P sobre las distintas fracciones existentes en elsuelo. Esto se evalu para dos experimentos: uno, en el que se indaga el efecto delas emulsiones sobre las cantidades de P en el suelo (incubacin 60 das) y otro,que permite conocer el mismo efecto, pero empleando como variante, la RocaFosfrica (RF) (incubacin 15 das).Los resultados para el primer experimento, indican que la emulsin no tuvoefecto sobre las fracciones de P; mientras que en el segundo, si se observamovilidad de P en el suelo, inducido por la adicin de la RF y de las emulsiones enconjunto. Por otra parte la fraccin de PNaoH fue la que ms contribuy al reservorioIVde P orgnico total. Este ltimo (POT) fue estimado por dos metodologas: Saundersand Williams y por Hedley et al. El primer mtodo, aunque provoc unasobreestimacin del PO no present diferencias con respecto al segundo.Adems, los valores de MO para este suelo Ultisol fueron bajos y no huboefecto alguno de las emulsiones sobre la misma. Cuando el valor de C fuerelacionado con el valor de PO se obtuvieron valores C/PO<= 200, lo que indicprocesos de mineralizacin en ambos experimentos, incrementndose la velocidadde los mismos, slo cuando las emulsiones son aadidas a suelos con roca. Porltimo, se realiz el anlisis de varianza ANOVA en el que se compararon lostratamientos de ambos experimentos y las diferentes metodologas empleadas.','2008-11-07','S/I',6,1,1,1,1,'2013-09-17 08:21:22','2013-09-17 08:21:22','Documento_23.pdf','application/pdf',1193842,'2013-09-17 08:21:22',20,0,113,'COMPLETO'),(24,'ESTUDIO TERICO DE LA PARTICIPACIN DEL DOBLE ENLACE OLEFNICO COMO GRUPO VECINO EN LA ELIMINACIN UNIMOLECULAR Y HOMOGNEA DE ALGUNOS CLORUROS DE ALQUENILO EN FASE GAS','Se realiz un estudio terico de la pirlisis en fase gas de una serie de cloruros dealquenilo; CH2=CH(CH2)nCH2Cl, donde n=1, 2 y 3; con el fin de obtener informacinacerca de la participacin del doble enlace olefnico en el mecanismo de eliminacin deestos compuestos.Los clculos se llevaron a cabo utilizando mtodos ab initio: RHF y MP2; y teorafuncional de densidad (DFT): B3PW91, PBEPBE Y MPW1PW91, y empleando losconjuntos base 6-31G(d), 6-31G(d,p) y 6-31+G(d,p).Los resultados de esta investigacin arrojaron que las eliminaciones en fase gas del4-cloro-1-buteno, 5-cloro-1-penteno y 6-cloro-1- hexeno, proceden a travs demecanismos concertados, no sincrnicos, con un carcter polar del estado detransicin. Adems se determin, que el sustituyente vinlico no participaanquimericamente en el mecanismo de estas reacciones.Los resultados que mejor se ajustaron a los parmetros obtenidos anteriormente enestudios experimentales, correspondieron a los derivados de los funcionales B3PW91 yPBEPBE, utilizando como conjuntos base: 6-31G(d,p) y 6-31+G (d,p)','2008-11-03','S/I',6,1,1,1,1,'2013-09-17 08:21:23','2013-09-17 08:21:23','Documento_24.pdf','application/pdf',3995041,'2013-09-17 08:21:23',20,0,124,'COMPLETO'),(25,'EVALUACIN DE LA PRESIN Y LA TEMPERATURA SOBRE LA DESPOLIMERIZACIN DE CARBONES BITUMINOSOS VENEZOLANOS EN SISTEMAS DE SALES FUNDIDAS','Fue evaluado el efecto de la presin y la temperatura sobre la despolimerizacin demuestras de carbones de Guasare, pertenecientes a la Formacin Marcelina(Paleoceno) en diferentes sistemas de sales de composicin eutctica. Para tal finse realiz un diseo experimental empleando dos temperaturas (220 y 300 0C)durante cuatro horas a condiciones de presin atmosfrica as como tambin acondiciones de mayor presin generada en un reactor. De igual manera, con el finde estudiar la composicin del material obtenido, ste fue fraccionado utilizandocomo solvente piridina por medio del empleo de ultrasonido. Los rendimientos dedespolimerizacin obtenidos oscilan en un rango de 3% hasta 65%, dependiendo delconjunto de sales y las condiciones de trabajo. Los rendimientos ms bajos fueronobtenidos a condiciones de presin elevada para la mezcla de sales FeCl3-KCl-LiCl(7-3%) con conversiones de solubles en piridina menores de 50%; en contraste losmayores rendimientos fueron exhibidos por los sistemas AlCl3-KCl-LiCl (61-65%)bajo condiciones de mayor presin con conversiones de solubles en piridinamayores del 50%. De acuerdo a los resultados no fue posible establecer unatendencia general sobre la influencia de la presin y la temperatura sobre el proceso,ya que cada sistema ensayado fue afectado de manera diferente. El rendimiento,composicin de los extractos y efecto generado por presin y temperatura dependendirectamente no slo de la naturaleza e identidad de sales sino tambin de lacombinacin que se realice de las mismas, destacando sus caractersticas comocidos de Lewis y posibles catalizadores de la reaccin','2008-07-25','S/I',6,1,1,1,1,'2013-09-17 08:21:24','2013-09-17 08:21:24','Documento_25.pdf','application/pdf',1922748,'2013-09-17 08:21:24',20,0,93,'COMPLETO'),(26,'ESTUDIO DEL CONTENIDO DE METALES PESADOS EN AGUAS Y PECES DEL EMBALSE SUATA- EDO. ARAGUA','En este trabajo se determin la concentracin de metales pesados en muestras de agua, tejido e hgado de peces, dichas muestras fueron recolectadas en el embalse Suata, con el objeto de aportar informacin sobre el estado ambiental de este embalse.El muestreo fue realizado mensualmente, durante los meses de noviembre 2007 y abril 2008, por el Laboratorio del Limnologa del Instituto de Biologa Experimental de la Fac. de Ciencias, UCV. Las muestras de agua fueron recolectadas en dos estaciones del embalse, donde adicionalmente, se midieron los parmetros temperatura, pH, conductividad y oxgeno disuelto. Una vez recolectadas, fueron llevadas a pH<2 con cido ntrico y refrigeradas hasta su anlisis. Las muestras de tejido e hgado se obtuvieron de peces capturados durante el muestreo por pescadores de la zona. Estas muestras fueron extradas mediante la diseccin de los peces, mantenindose congeladas hasta su liofilizacin y posterior digestin cida asistida con horno microondas. En total se analizaron 24 muestras de agua y 17 muestras de tejido y de hgado de peces. La determinacin de los elementos Cd, Cu, Cr, Ni y Pb se realiz mediante espectrometra de absorcin atmica con atomizacin electrotrmica (ETAAS), mientras que el Hg fue determinado mediante espectrometra de absorcin atmica con generacin de vapor frio (CV AAS). Las metodologas de anlisis empleadas fueron validadas empleando muestras certificadas apropiadas: muestra de agua TM-26, muestra de agua NIST 1441d, tejido de ostra NIST-1566b e hgado de bovino BCR-185R. Los datos obtenidos fueron tratados empleando el paquete Statgraphic version 5.0 para Windows.El anlisis de los datos mostr que la temperatura del embalse present cambios durante el muestreo de acuerdo a la estacin climtica, estacin y profundidad del muestreo. La estacin E1 present las menores temperaturas atribuibles a fuentes cercanas de entrada de agua del canal aductor y de laquebrada El Mamn. Asimismo se observ el mezclado de las aguas y la consiguiente homogeneidad de la temperatura para el mes de febrero. El pH de las aguas y su aumento durante el muestreo indicaron que el embalse se encuentra sometido a un proceso de eutrofizacin como consecuencia de la concentracin de nutrientes, proveniente de la actividad humana en la zona y de la disminucin del volumen del cuerpo de agua producto de la poca de sequa.Los resultados obtenidos indicaron que la concentracin de los metales en el agua no exceden los valores mximos permitidos por el Decreto 883 y por la norma EPA para aguas dulces (fresh water) por lo que no representan un riesgo para el destino que tienen dichas aguas (riego y recreacin). Igualmente, las concentraciones de los metales en las muestras de tejido de peces no alcanzaron los valores lmites permitidos segn las normas COVENIN 1776:1995 y 1087:1998 para atn y sardinas, respectivamente, y el Codex Alimentarius (2007) para Cd y Hgorg. En las muestras de hgado, las concentraciones de los metales fueron superiores a las obtenidas en el tejido de los mismos peces, mientras que la concentracin de Cu fue superior que el nivel mximo permitido en tejido, segn las mismas normas COVENIN. Por otra parte, se encontraron correlaciones significativas entre la concentracin de Cu con la talla y peso de los peces, as como entre la concentracin de los elementos Hg y Ni con la talla de los mismos, lo cual apunta a un proceso de bioacumulacin.Estos resultados concuerdan con los obtenidos en un anlisis ambiental realizado recientemente en sedimentos provenientes del mismo embalse, recolectados durante la misma fecha, los cuales indicaron que dichos sedimentos no representan un riesgo ambiental para el cuerpo de aguas, ya que las condiciones fisicoqumicas no favorecen la liberacin de los elementos intercambiables-extrables de los mismos.','2008-10-23','S/I',6,1,1,1,1,'2013-09-17 08:21:25','2013-09-17 08:21:25','Documento_26.pdf','application/pdf',1429599,'2013-09-17 08:21:25',20,0,89,'COMPLETO'),(27,'MODELADO GEOQUMICO 2D EN EL SUR DE LA CUENCA DE MARACAIBO','El objetivo del presente trabajo es la realizacin de un modelado 2D en el surde la Cuenca de Maracaibo, con la utilizacin de los datos de 21 pozos y 6pozos virtuales. Estos datos fueron obtenidos por Llanos en el ao 2000. Elmodelado fue realizado haciendo uno de un programa denominado Basinmod2D proporcionado por la Platte Rivers Associates, y a su vez para larealizacin de mapas fue usado Basinview.La estratigrafa fue reconstruida con la finalidad de poder establecer la seccintransversal a modelar, con base a los pozos que poseen la mayor cantidad deinformacin: litolgica (% de lutitas, limolitas, areniscas, caliza, dolomita),geoqumica (% Madurez (%Ro), carbono orgnico total (%COT)) e historiageolgica de la zona. A travs del proceso de calibracin utilizando los datosde madurez, se estableci el flujo de calor para la zona de estudio 30 mW/m2A partir de la integracin de los resultados obtenidos por el modelo y lainterpretacin geolgica de la zona, fue determinada la madurez de la rocamadre, comparando resultados obtenidos de pozos ubicados a una baja y altaprofundidad, as como tambin la etapa de mayor generacin de hidrocarburosy la edad de expulsin.Las tendencias de las diferentes vas de migracin de los hidrocarburos fueronestablecidas a diferentes profundidades, para las distintas facies del petrleo.','2008-09-17','S/I',4,1,1,1,1,'2013-09-17 08:21:28','2013-09-17 08:21:28','Documento_27.pdf','application/pdf',8630211,'2013-09-17 08:21:28',19,0,149,'COMPLETO'),(28,'EFECTO DEL MTODO DE LAVADO EN LA DETERMINACIN DE METALES EN MUESTRAS DE CABELLO POR ICP OES','Primero se valid de la metodologa utilizada para la determinacin de elementos trazas en muestras cabello por espectrometra de emisin ptica con plasma inductivamente acoplado. Luego se determin la cantidad de metal adsorbida por el cabello para ello se impregn el cabello con sudor artificial y posteriormente, se realiz el estudio de remocin con los diferentes agentes de lavado estudiados, para determinar la cantidad de metal que es removido por los diferentes agentes de lavado. Los agentes de lavado estudiados fueron el EDTA (1-7%), acetona, agua, etanol, ter, y hexano.Se encontr que, el EDTA a concentraciones mayores al 5% ataca el contenido endgeno del cabello. Para los lavados de cabello, utilizando solventes orgnicos se hall que solo algunos de los metales estudiados son removidos, y se obtuvo una capacidad de remocin similar, el solvente orgnico con que se encontr una capacidad de remocin ligeramente mejor fue con la mezcla hexano-etanol. Adems se estudiaron, lavados de cabello utilizando la combinacin EDTA / Solventes orgnicos / Agua, con la cual se obtuvo mejores resultados (mayor poder de remocin) que al utilizar cualquier solvente, por lo que se puede concluir que la formar ms eficiente para remover el contenido exgeno del cabello es utilizando cualquiera de las combinaciones propuestas.Finalmente se determin el contenido de elementos trazas en muestras de cabello para habitantes de la ciudad de Los Teques, son similares con los niveles normales reportados en otros estudios.','2008-10-23','S/I',6,1,1,1,1,'2013-09-17 08:21:29','2013-09-17 08:21:29','Documento_28.pdf','application/pdf',1016090,'2013-09-17 08:21:29',17,0,86,'COMPLETO'),(29,'ESTUDIO GEOQUMICO DE METALES PESADOS EN SEDIMENTOS DE FONDO DEL GOLFETE DE CUARE, ESTADO FALCN.','Este trabajo consisti en estudiar geoqumicamente los sedimentos de fondo del Golfete de Cuare, estado Falcn, para determinar la concentracin y distribucin de Fe, Mn, Ca, Mg, Zn, Cu, Ni, Pb, Cr, Cd y Hg, en el sedimento. Los resultados obtenidos indicaron que las concentraciones de los elementos mayoritarios como Fe, Ca, Mg, y algunos trazas como Mn, estn controladas por diversos factores, entre los cuales se puede mencionar: la litologa (lutitas calcreas, areniscas y calizas preferentemente) que se encuentra alrededor de la zona de estudio, por donde drenan diversos afluentes (ro Tocuyo, el cao El Estero y Dieguito), procesos de erosin, cambios en el patrn de sedimentacin, influencia del agua de mar y relieve. Para el resto de los elementos los factores antes mencionados pueden estar operando sin embargo otro factor no menos importante como lo es el antrpico puede estar controlando la presencia de elementos como Cu, Cd Pb, Ni, Cr Zn y Hg en la zona.Por otra parte fue establecida la distribucin de los elementos en las distintas fases (iones dbilmente adsorbidos, carbonatos, oxihidrxidos y solubles en cidos fuertes) que componen la fraccin lodo de los sedimentos de fondo, mediante un proceso de extraccin parcial. Los resultados indican que los elementos Ca y Mg, presentaron una buena afinidad en el extract de HCl, lo cual sugiri que parte de estos elementos estn siendo aportados al sistema por actividad biolgica y procesos de erosin.La distribucin espacial de las arenas y la fraccin ms fina de los sedimentos (lodo), en el sector estudiado del Golfete de Cuare, indican que las arenas gruesas fueron las ms abundantes en los primeros centmetros (0-5) cm de profundidad de los sedimentos estudiados. Luego dicha fraccin diminuye en los siguientes 10 cm restantes, aumentando a su vez los porcentajes de arena fina y muy fina. Posiblemente por un cambio en el patrn de sedimentacin de los ltimos aos.','2008-10-28','S/I',6,1,1,1,1,'2013-09-17 08:21:32','2013-09-17 08:21:32','Documento_29.pdf','application/pdf',5545127,'2013-09-17 08:21:32',17,0,148,'COMPLETO'),(30,'SNTESIS Y USO DE CATALIZADORES NO CONVENCIONALES EN REACCIONES DE HIDROTRATAMIENTO.','La generacin de nuevos catalizadores para hidrotratamiento ha tomado mayorauge debido a las restricciones ambientales cada vez ms exigentes que inducen a ladisminucin de contaminantes, como heterotomos y metales pesados, quegeneralmente se encuentran asociados a crudos y cortes de petrleo. Para Venezuela,como pas productor de petrleo con una de las mayores reservas de crudos pesados yextrapesados a nivel mundial, es de vital importancia el desarrollo de catalizadorescapaces de procesar altos contenidos de macromolculas con presencia de azufre, lascuales estn presentes en dichos crudos.Los slidos tipo hidrotalcita (HTLCs) constituyen materiales con propiedadesmuy interesantes que los hacen atractivos para la formulacin de nuevos catalizadorescon mejores desempeos catalticos. El fenmeno de intercambio inico exhibido porestos slidos ofrece la posibilidad de incorporar a dichas estructuras especies de Mo yNiMo que luego puedan generar catalizadores con elevadas cargas metlicas (mayoresque las alcanzadas por los catalizadores convencionales) y altamente dispersos.En la presente investigacin se hizo un estudio de la preparacin decatalizadores sulfurados monometlicos (NiS y MoS2) y bimetlicos (NiMoS) partiendode polioxometalatos intercalados en los HTLCs, y fueron evaluados en lahidrodesulfuracin de tiofeno. Los resultados obtenidos muestran que, aparentemente,se lograron altas dispersiones y que al colapsar el arreglo laminar de los precursorespor efecto de la temperatura se obtuvieron fases metlicas recubiertas que mostraronbajas actividades catalticas.','2008-10-23','S/I',6,1,1,1,1,'2013-09-17 08:21:42','2013-09-17 08:21:42','Documento_30.pdf','application/pdf',3933600,'2013-09-17 08:21:42',20,0,177,'COMPLETO'),(31,'ADSORCIN DE FSFORO EN SUELOS DE DIFERENTES TEXTURAS: EFECTO DEL GRADO DE CONTAMINACIN POR CRUDO','El principal objetivo de este estudio fue determinar la influencia de diferentestexturas del suelo y el grado de contaminacin por crudo en la adsorcin de fsforo (P)sobre suelos colectados al sur del estado Anzotegui. Con este estudio se pretendeentonces generar informacin que permita disear estrategias de recuperacin de reasafectadas por la actividad de la industria petrolera. El estudio de adsorcin de P fuerealizado siguiendo la metodologa de Walbridge et al. (1991), aplicado a cuatro suelosde diferente textura y contaminados a dos proporciones 3% y 6% de crudo pesado. Lasrplicas fueron equilibradas con una solucin de KH2PO4/CaCl2 con un rango deconcentracin de 0; 10; 50; 80; 100 mg/L P suelo arenoso y areno-francoso, 0; 10; 50;100; 200 mg/L P suelo franco-arenoso y 0; 10; 50; 100, 200; 300 mg/L P suelo arcilloso.Los datos de adsorcin de P se ajustaron satisfactoriamente al modelo lineal deLangmuir. En los suelos con alta proporcin de arena como el franco- arenoso, arenofrancosoy arenoso fue observada una tendencia a disminuir la capacidad de adsorcinde PO43- al incrementar la proporcin de crudo aadido, lo que sugiere que el crudo muyprobablemente est compitiendo con los iones fosfatos por los sitios de adsorcin en elsuelo; mientras que en el suelo arcilloso el mximo de adsorcin no varisignificativamente entre tratamientos (SC, MSC3% y MSC6%) por lo que sugiere que laalta proporcin de arcilla en este suelo no conduce a que exista competencia por lossitios de adsorcin entre el crudo y los iones PO43-. La clase textural del suelo influyeen la capacidad de adsorcin de P en presencia de crudo, obtenindose que la texturafina obedece a los mayores mximos de adsorcin y las texturas gruesas mostraron losmenores valores.','2008-09-17','S/I',4,1,1,1,1,'2013-09-17 08:21:44','2013-09-17 08:21:44','Documento_31.pdf','application/pdf',3100155,'2013-09-17 08:21:44',20,0,109,'COMPLETO'),(32,'CATALIZADORES NANOESTRUCTURADOS EN BASE A Ni, Ca Y Co PARA LA REFORMACIN DE METANO CON VAPOR','En el presente trabajo se estudi el comportamiento cataltico de una serie de catalizadores de nquel soportados para la reaccin de reformacin de metano con vapor de agua. Se sintetizaron dos catalizadores de referencia de nquel (10% p/p) soportados sobre almina y slice por el mtodo de impregnacin incipiente. Asimismo, se sintetizaron dos catalizadores de nquel soportados sobre almina, utilizando un complejo de nquel- etilendiamina, por dos mtodos diferentes: impregnacin por humedad incipiente del complejo y sntesis y deposicin de este en presencia del soporte. Finalmente se prepararon catalizadores bimetlicos, promovidos con calcio y cobalto, partiendo del catalizador de nquel preparado por sntesis y deposicin del complejo nquel- etilendiamina en presencia del soporte. Los slidos precursores fueron caracterizados mediante anlisis qumico, DRX, RTP, rea B.E.T., ATG-ATD y Microscopia Electrnica de Transmisin MET. La actividad cataltica fue evaluada con la reaccin de Reformacin de metano con vapor de agua.Los resultados indicaron que de los catalizadores de referencia, el catalizador soportado sobre slice no mostr actividad hacia la reaccin de reformacin de metano, mientras que el catalizador soportado sobre almina fue el que mostr el mejor comportamiento cataltico bajo las condiciones de estudio; el hecho de que la especie predominante en este catalizador sea el NiAl2O4, podra implicar que este sea el precursor de la fase activa. Los resultados obtenidos con los catalizadores preparados a partir del complejo Ni-etilendiamina sugieren que la utilizacin de sales precursoras de gran tamao conduce a la obtencin de partculas pequeas; de los dos catalizadores preparados, el que dio mayor conversin de metano y mayor estabilidad, fue el preparado formando el complejo Ni-en in-situ, debido posiblemente a la mejor dispersin de las partculas metlicas sobre el soporte y a la menor relacin NiO/NiAl2O4 que este presenta. Por otra parte, de los catalizadores promovidos con calcio, el catalizador preparado por impregnaciones sucesivas dio como resultado una mayor conversin y estabilidad en la reaccin de reformacin con vapor, mientras que el catalizador preparado por co-impregnacin no mostr variaciones en la conversin, resultado que se puede justificar partiendo de que la relacin NiO/ NiAl2O4 en este ltimo es mayor. El catalizador promovido con cobalto produjo un ligero aumento en la conversin de metano; igualmente, este resultado puede ser vinculado con la relacin NiO/NiAl2O4 que en este slido es menor que en el catalizador Ni(en), sin embargo, no puede descartarse que la incorporacin de un segundo metal catalticamente activo hacia la misma reaccin, da lugar, en general, a la formacin de una cantidad mayor de sitios activos.','2008-11-03','S/I',6,1,1,1,1,'2013-09-17 08:21:45','2013-09-17 08:21:45','Documento_32.pdf','application/pdf',2050692,'2013-09-17 08:21:45',20,0,146,'COMPLETO'),(33,'TRANSFORMACIN DE LIMONENO SOBRE SBA-15 Y MCM-41 CONTENIENDO ALUMINIO:EFECTO DEL SOLVENTE.','El limoneno en un terpeno que se obtiene de la extraccin de las conchas denaranjas y limones; es utilizado ampliamente en las industrias farmacuticas y deperfumes como materia prima para la obtencin de productos como el terpinol.Actualmente la transformacin del limoneno se lleva a cabo por medio de lacatlisis homognea con la utilizacin de cidos minerales como el acido sulfrico comocatalizador, estas reacciones presentan serios problemas ambientales ya que producensubproductos nocivos que son difciles de separar y tratar. Es por ello que se vienenestudiando alternativas para esta reaccin. Una manera viable de eliminar estosproblemas es la implementacin de catalizadores heterogneos que son reutilizables yno presentan subproductos contaminantes.En este estudio se utilizaron para la transformacin del limoneno dos slidosmeso porosos: MCM-41 y SBA-15, incorporndoles Al tanto por sntesis directa comoindirecta y con dos relaciones molar Si/Al (15 y 30). Los slidos se caracterizaron pordifraccin de rayos X (DRX), fisisorcin de nitrgeno, microscopia electrnica de barrido(MEB) e ICP para comprobar las propiedades texturales de los mismos as comotambin la incorporacin del Al en sus estructuras. Las pruebas cataliticas se realizaronen un reactor por carga de vidrio provisto de reflujo y agitacin mecnica. Se fijaron lassiguientes condiciones: agua/terpeno = 74 molar, agua/co-solvente = 3,2 molar, 1 gramode catalizador y 6 gramos de Limoneno; se utiliz dos co-solventes (acetona y 2- propanol), para cada sistema se trabaj a la temperatura de ebullicin de los cosolventes(55 C para la acetona y 95 C para el 2-propanol). Se tomaron muestras a las48 horas de reaccin y se analizaron por cromatografa de gases.Los slidos que presentaron mejores conversiones y rendimiento hacia laformacin del terpinol fueron el Al-MCM-41 (30) que fue sintetizado de forma directa y elAl/SBA-15 (30) que fue sintetizado de forma indirecta (impregnacin humeda). Con loque se puede inferir que el menor contenido de Aluminio en los slidos de alta reaespecifica favorece la dispersin del mismo y mejora las propiedades cidas.El Al/SBA-15 (30) mostr niveles de conversin del Limoneno y selectividad haciala formacin del terpinol ms altas que el Al-MCM-41 (30) lo que puede atribuirse a queel slido impregnado posee sitios cidos de tipo Brnsted que estn en mayor nmero yson de mayor fuerza que en el material Al- MCM-41 (30).Se realiz una experiencia con una zeolita Mordenita (Si/Al 30) bajo las mismascondiciones de reaccin de nuestros mejores slidos (Al-MCM-41 30 y Al/SBA-15 30),presentando resultados de casi el doble de conversin del Limoneno y mas del doble deporcentaje de rendimiento hacia el terpinol. Esto se explica en trminos de la acidez, yaque la Mordenita presenta un valor de acidez total mucho mayor que el de nuestrosslidos.Se realiz una experiencia reduciendo la cantidad de agua en la mezcla dereaccin sobre los catalizadores Al-MCM-41 (30) y Al/SBA-15 (30). Los resultadosindicaron que la presencia del agua no cera problemas difusionales ni compromete lamayora de los sitios activos de nuestros slidos.Se realiz una experiencia con los slidos antes mencionados sin el uso de cosolventesobteniendo como resultado que la conversin del Limoneno aumentsignificativamente. Adems, el porcentaje de rendimiento hacia el terpinol para el Al-MCM-41 (30) y Al/SBA-15 (30) se incremento en ms del 300 % respecto a los sistemassin co-solvente, por lo que el uso de un co-solvente no fue necesario para llevar a cabola reaccin de hidratacin del Limoneno sobre tamices moleculares meso porosos conaluminio, mientras que para la Mordenita si bien se increment considerablemente laconversin del Limoneno el porcentaje de rendimiento hacia el terpinol disminuy por loque la presencia del co-solvente para este tipo de slidos seria necesaria para facilitar elcontacto con los dems reactivos (agua y Limoneno) para llevar a cabo la hidratacin.','2008-07-14','S/I',6,1,1,1,1,'2013-09-17 08:21:47','2013-09-17 08:21:47','Documento_33.pdf','application/pdf',3437938,'2013-09-17 08:21:47',19,0,87,'COMPLETO'),(34,'ESTUDIO DE LA INTERACCIN ENTRE SURFACTANTES CATINICOS PRESENTES EN EMULSIONES ASFLTICAS Y ROCAS DE DIFERENTES REGIONES DEL TERRITORIO VENEZOLANO','A nivel mundial muchos pases han implementado la tcnica de Emulsiones Asflticasdebido a su evolucin, desarrollo y aplicacin en obras de pavimentacin. Estasrepresentan una alternativa con bajos costos de fabricacin, aplicacin y consumo deenerga; as como la ventaja de ser amigable al medio ambiente por tratarse demezclas a base agua, aplicadas totalmente en fro. A pesar que Venezuela cuenta consuficiente materia prima para la aplicacin de las tcnicas de asfaltado tradicionales, noha tenido suficiente experiencia en la aplicacin de Emulsiones Asflticas.Una Emulsin Asfltica, contiene una molcula qumica (surfactante catinico), quepermite mantener estable una dispersin de finas gotas de asfalto en agua a travs deun equilibrio electroqumico. Estas son obtenidas a partir de un proceso de cizallamientoque ocurre dentro de un molino coloidal, donde el emulsificante puede ocasionar unadisminucin o incremento en las propiedades de adherencia y cohesin, adems de lacapacidad de cubrir los minerales presentes en las rocas, caractersticas de granimportancia en la aplicacin de tratamiento superficial o Slurry Seal.Debido a lo antes expuesto, surge el presente trabajo con el propsito de desarrollar yevaluar el comportamiento de emulsiones asflticas utilizando varios SurfactantesCatinicos de la Lnea Emulsiv de Clariant. Mediante la fabricacin de mezclasasflticas en fro con seis tipos de rocas (silicios - calcreos) en cinco zonas deVenezuela.De acuerdo a los resultados obtenidos en este trabajo de investigacin, puedesealarse que existe un alto grado de confiabilidad al surfactante Emulsiv M1785 derompimiento lento, ya que present excelente interaccin con los distintos tipos derocas en las mezclas asflticas. Fue observado que la roca Cal. - Emp., de la zona delestado Aragua, present el mejor comportamiento de cubrimiento, cohesin yadhesin. Mientras que la roca Aren. - Falcn de la zona del estado Falcn, presentuna baja interaccin con los distintos surfactantes evaluados. En conclusin losresultados obtenidos, ayudaran a contribuir con el xito en la aplicacin de la tcnicade Emu','2008-07-23','S/I',4,1,1,1,1,'2013-09-17 08:21:50','2013-09-17 08:21:50','Documento_34.pdf','application/pdf',7892773,'2013-09-17 08:21:50',20,0,156,'COMPLETO'),(35,'EVALUACIN DEL EFECTO DE LOS IONES MAYORITARIOS PRESENTES EN EL AGUA DE FORMACIN SOBRE EL DESEMPEO DE UN SISTEMA GELIFICANTE DE BAJA CONSISTENCIA (MULTIGEL) DENTRO DEL MEDIO POROSO.','El empleo de sistemas gelificantes polimricos para el control de la excesiva produccinde agua y/o gas, constituye uno de los mtodos ms aplicados en los yacimientospetroleros. Sin embargo, aun se tiene un conocimiento limitado en relacin alcomportamiento de estos sistemas dentro del medio poroso, cuando son expuestos adiferentes condiciones de salinidad. En este sentido se evalu el comportamiento delsistema gelificante Multigel ULT, mediante la realizacin de pruebas fuera (de botella)y dentro del medio poroso (de desplazamiento) a 60 C y 200 psi, cuando entra encontacto con soluciones de los iones sodio y calcio, a concentraciones de 100 y 10.000ppm. En las pruebas fuera del medio poroso tambin se evalu la influencia del el inHCO3-. Otro aspecto evaluado en las pruebas fuera del medio poroso, fue la influenciadel pH en los tiempos de gelificacin, encontrndose que a medida que el pH de lasolucin gelificante aumenta, se produce un incremento en los tiempos de gelificacin.Adems se evalu el grado de hinchamiento del gel, encontrndose que la mayorabsorcin de agua es producida por los iones HCO3-, mientras que la menor absorcinde agua es generada por los iones Ca+2. Las pruebas realizadas dentro del medioporoso sugieren que el sistema Multigel ULT causa una disminucin considerable de lapermeabilidad efectiva al agua en mayor o menor medida, dependiendo de laconcentracin y del in implcito. Los diferenciales de presin ms altos fueronobtenidos para el caso de la inyeccin de agua de Intequim, la cual es el agua base depreparacin de los geles.','2008-11-03','S/i',6,1,1,1,1,'2013-09-17 08:21:54','2013-09-17 08:21:54','Documento_35.pdf','application/pdf',1374158,'2013-09-17 08:21:54',18,0,167,'COMPLETO'),(36,'ALCOHOLES SUPERIORES A PARTIR DE GAS DE SNTESIS:CATALIZADORES NANOESTRUTURADOS EN BASE A RUTENIO Y MOLIBDENO SOPORTADOS.','El enfoque de este trabajo ha sido la produccin selectiva de alcoholes superiores, utilizando la reaccin de hidrogenacin de monxido de carbono conocida como Sntesis Fischer Tropsch (SFT) con presiones de 750 psi y temperaturas entre 275- 300C. Empleando catalizadores de rutenio nanoestruturados y rutenio promovidos con molibdeno soportados sobre slice y almina (Ru/Mo). Se utilizaron tres mtodos en la preparacin de los mencionados catalizadores; 1) impregnacin por humedad incipiente para obtener los catalizadores de referencia (RuCl3), 2) mtodo (n1) que consisti en la descomposicin suave de complejos organometlicos, 3) mtodo (n2), que consisti en la impregnacin de complejos organometlicos de Ru de tipo Ru(COD) (COT) [(COD= e4-cicloota-1,5-dieno; COT= e6-cicloota-1,3,5,trieno)] \"RuCODCOT n2\" y Ru(acac)3 (acac = acetilacetonato). Los catalizadores de Ru y Ru/Mo fueron caracterizados por diferentes tcnicas entre las cuales destacan difraccin de rayos x (DRX) el cual mostr que la fase metlica presente fue la del cristal del oxido de rutenio. Los resultados de rea especfica arrojaron que los catalizadores preparados sobre alumina obtuvieron mayor rea que los preparados sobre slice. Los resultados obtenidos por reduccin a temperatura programada (RTP) mostraron en el caso de los catalizadores convencionales una disminucin de la temperatura de reduccin empleando el pretratamiento con N2 y en los catalizadores nanoestructurados un aumento de esta temperatura debido a la mayor interaccin de las partculas metlicas con el soporte. Anlisis termogravimtrico (TGA) mostro en el caso de los catalizadores convencionales la descomposicin completa de la sal precursora. Ambos mtodos tanto n1 como n2 generaron catalizadores nanoestructurados, evidenciado por los resultados de MET obtenindose un tamao de particula promedio entre 8-10 nm. Tambin mostraron actividad hacia la SFT produciendo en su mayora hidrocarburos entre C2-C5. Al incorporar el molibdeno al catalizador de \"RuCODCOT n1\", el cual result ser el ms activo con respecto a la conversin del CO/H2, se observ una mejora de laselectividad hacia la formacin de alcoholes superiores debido a la interaccin entre el rutenio y el molibdeno que gener sitios activos capaces de aumentar el rendimiento de los alcoholes superiores (C2OH+) en comparacin a los catalizadores sin promover con Mo. Sin embargo, el metanol y el etanol fueron los alcoholes que se produjeron en mayor proporcin.','2008-10-30','S/I',6,1,1,1,1,'2013-09-17 08:21:55','2013-09-17 08:21:55','Documento_36.pdf','application/pdf',1482146,'2013-09-17 08:21:55',20,0,116,'COMPLETO'),(37,'SEMISNTESIS DE DERIVADOS DE CLERODANOS COMO POSIBLES AGENTES ANTIBACTERIALES.','En este Trabajo Especial de Grado se aisl de las fracciones FM y FD delextracto metanlico de la esponja Agelas clathrodes, el metabolito principal AgelasinaB, y se realiz la caracterizacin de este compuesto mediante tcnicasespectroscpicas de RMN 1H y 13C.Se ensayaron una serie de modificaciones sintticas sobre la unidad declerodano de Agelasina B, especficamente sobre los carbonos olefnicos, a fin degenerar una serie de dervados semisinteticos de este metabolito con la finalidad deevaluar sus actividades antivirales contra la fiebre amarilla.Se utiliz al colesterol como modelo a fin de estudiar las condiciones dereacciones que posteriormente se realizaron sobre Agelasina B.Las modificaciones consistieron bsicamente en bromacin al doble enlace,hidroxilacin allica y epoxidacin. En algunos casos se variaron las condiciones dereaccin, como, reactivos, solventes, tiempo, etc., a fin de obtener el mejor rendimiento.Todos los productos fueron caracterizados espectroscpicamente por RMN 1H,13C y espectrometra de masa mediante la tcnica de Ionizacin por Electrospray (ESI).','2008-10-31','S/I',6,1,1,1,1,'2013-09-17 08:21:58','2013-09-17 08:21:58','Documento_37.pdf','application/pdf',5302511,'2013-09-17 08:21:58',19,0,91,'COMPLETO'),(38,'SNTESIS Y CARACTERIZACIN DE NUEVOS AGREGADOS CARBONLICOS DE RENIO Y OSMIO CON LIGANDOS POLIPIRIDNICOS.','En este trabajo se estudi la reactividad de los agregados lbiles de renio, Re2(CO)8(CH3CN)2 y de Osmio [Os3(CO)10(CH3CN)2] con los ligandos polipiridnicos, 3,5,6-tris(2-piridil)-1,2,4-triazina (2TPT); 3-(3-piridil)- 5,6-bis(2-piridil)-1,2,4-triazina (3TPT), 3-(4-piridil)-5,6,-bis(2-piridil)- 1,2,4-triazina (4TPT) y 2,3,5,6-tetra-(2-piridil)-1,2-pirazina (TPP), con la finalidad de obtener sistemas de alta nuclearidad y evaluar nuevas formas de coordinacin. Con el ligando 3,5,6-tris(2-piridil)-1,2,4-triazina se obtuvieron dos complejos dinucleares de renio identificados como a1 y a2 los cuales tienen formula molecular [Re2(CO)8(2:2-C18H12N6)] y [{Re(CO)3OH}{Re(CO)4}{Re(CO)3}(1: 2: 2:2:2:2:2-C18H12N6O)] respectivamente. Los mismos fueron caracterizados por las tcnicas espectroscpicas de RMN 1H, IRTF y anlisis de difraccin de rayos X para ambos complejos. Con el ligando 3-(3-piridil)-5,6-bis(2-piridil)-1,2,4- triazina se obtiene los complejos de renio etiquetados como b1, b2 y b3, de frmulas moleculares [Re2(CO)8(2:2:2-C18H12N6)Re(CO)4]2, [Re2(CO)8(2- C18H12N6)2] y [Re2(CO)8(2:2-C18H12N6)] respectivamente, y los complejos de osmio identificados como b4 y b5, ambos con frmula [Os3(m:H)(CO)10(1:2- C18H11N6)] y que fueron caracterizados por las tcnicas espectroscpicas de IRTF y RMN 1H.El ligando 3-(4-piridil)-5,6,-bis(2-piridil)-1,2,4-triazina da lugar a tres complejos de renio g1, [Re2(CO)8(2:2:2-C18H12N6)Re(CO)4]2; g2, [Re2(CO)8(2-C18H12N6)2] y g3 [Re2(CO)8(2:2-C18H12N6)] adems de otro complejo de osmio g4 [Os3(m:H)(CO)10(1:2-C18H11N6)] los cuales fueron caracterizados por espectroscopa de IRTF y RMN1H. El ligando 2,3,5,6-tetra-(2-piridil)-1,2- pirazina da lugar al complejo d1 de frmula molecular [Re2(CO)8(e2:e2- C24H20N6)] el cual fue caracterizado por espectroscopia de IRTF, RMN 1H y por difraccin rayos X. Los complejos presentanprincipalmente coordinacin tipo quelato, formando de esta manera metalociclos de cinco miembros aunque tambin se obtuvieron complejos con coordinaciones monodentadas.','2008-10-28','S/I',6,1,1,1,1,'2013-09-17 08:22:00','2013-09-17 08:22:00','Documento_38.pdf','application/pdf',3398108,'2013-09-17 08:22:00',20,0,143,'COMPLETO'),(39,'EFECTO DE LA MADURACIN DE LA TURBA SOBRE SU CAPACIDAD DE ADSORCIN DE METALES PESADOS','Este trabajo tiene como objetivo principal la evaluacin de la capacidad de adsorcin de laturba de manglar (turbas de Morrocoy, estado Falcn) a medida que es madurada artificialmentecon la tcnica de hidropirlisis, utilizando como adsorbato soluciones de Cd2+, Zn2+ y Cu2+.Se compar la capacidad de adsorcin de dos sustratos carbonceos denominados turbaoriginal y turba madurada (producto madurado) para los cationes anteriormente mencionados, ensistemas simples de agitacin de las soluciones con el adsorbente en un rango de pH entre 5 y 6 ya una temperatura de 25 C.Los datos de adsorcin de la turba se ajustaron al modelo de Langmuir y de Freundlich,logrndose una mejor correlacin con el primer modelo (mejores coeficientes de regresin). Laisoterma de Langmuir result bastante apropiada para ajustar los datos de adsorcin del productomadurado (adsorcin en monocapa).El orden de afinidad de los cationes a ambos materiales carbonceos fue de Cu2+ > Zn2+>Cd2+. El primero de los cationes presenta una configuracin d9 convirtindolo en una especiebastante reactiva frente a los otros cationes que presentan una configuracin d10, adems formacomplejos estables con la materia orgnica lo cual explica su mayor afinidad por el adsorbente.Los resultados arrojaron que la turba posee 12, 14 y 29 veces mayor capacidad deadsorcin para Cu2+, Zn2+ y Cd2+, respectivamente que el material madurado. Este fenmeno seatribuy a la prdida de grupos funcionales (reduccin de la polaridad) y a la compactacindurante la maduracin de la materia orgnica, disminuyendo los sitos activos disponibles para queocurra la adsorcin.Los principales mecanismos que se proponen para explicar la adsorcin de los cationes alos sustratos usados, son la quelatacin (especialmente para el Cu2+) y el intercambio inico, yaque a los valores de pH trabajados, los cidos carboxlicos - principales responsables de laadsorcin- se encuentran desprotonados, constituyendo la especie ms activa para la remocin delos cationes en solucin.','2008-09-17','S/I',4,1,1,1,1,'2013-09-17 08:22:03','2013-09-17 08:22:03','Documento_39.pdf','application/pdf',2708796,'2013-09-17 08:22:03',20,0,94,'COMPLETO'),(40,'DESARROLLO DE UNA HERRAMIENTA PARA EL MONITOREO DE EVENTOS Y ACTIVIDADES DE USUARIOS EN APLICACIONES Web.','La finalidad del presente Trabajo Especial de Grado consiste en el desarrollode una herramienta con la capacidad de: realizar el monitoreo de eventos yacciones de usuarios, durante su interaccin con aplicaciones y sitios Web, ygenerar informacin que pueda ser utilizada posteriormente, con mltiplespropsitos. Para ello, se aplic una adaptacin del modelo de desarrollo en cascada,bajo una metodologa Ad hoc, la cual se realiz en cinco fases: descripcin derequerimientos, anlisis, diseo, implementacin y, finalmente, la fase de pruebasde la herramienta desarrollada. Como resultado final se obtuvo una herramienta defcil integracin, con la capacidad de realizar el proceso de grabacin de eventos yacciones relevantes de los usuarios, llevar a cabo reproducciones automticas dedichas grabaciones y generar reportes con informacin de utilidad acerca de lasactividades registradas por los usuarios de cualquier aplicacin Web.','2008-10-30','Monitoreo de usuarios, reproduccin automtica, eventos, grabacin, JavaScript,Page Tagging, Document Object Model (DOM).',2,1,1,1,1,'2013-09-17 08:22:04','2013-09-17 08:22:04','Documento_40.pdf','application/pdf',1536249,'2013-09-17 08:22:04',20,0,101,'COMPLETO'),(41,'IMPLEMENTACIN DEL PROTOCOLO SECURE NEIGHBOR DISCOVERY (SEND).','El protocolo IPv6 define la interaccin entre los nodos que residen en un mismoenlace a travs del proceso de descubrimiento de vecinos (Neighbor Discovery). Losmensajes intercambiados durante este descubrimiento incluyen informacinimportante acerca de la red y pueden dar lugar a diversos ataques quecomprometen el correcto funcionamiento de los nodos del enlace.En este Trabajo Especial de Grado se desarroll una aplicacin que permiteasegurar los mensajes enviados por los nodos durante el proceso dedescubrimiento de vecinos al utilizar el protocolo SEND. Adems, se desarroll unaherramienta que permite generar y verificar direcciones CGA (CryptographicallyGenerated Addresses).El trabajo se realiz en base a las teoras sobre los protocolos y mecanismos deseguridad que garantizan la proteccin de los mensajes de Neighbor Discovery.Durante la implementacin de la aplicacin, se utiliz la metodologa de desarrollode software llamada enfoque en cascada que contempla las fases de: anlisis,desarrollo, implementacin y pruebas necesarias para comprobar el funcionamientode la aplicacin SEND desarrollada.Es de hacer notar que el alcance de esta implementacin de SEND slo abarc elintercambio de mensajes entre los hosts del enlace, es decir que no involucra eldescubrimiento de los routers que puedan estar presentes. Sin embargo, podrservir como referente terico a futuros trabajos en el rea, en la cual puedan incluirel proceso de Router Discovery y otras funcionalidades que vayan surgiendo.Como producto final se incluyeron el cdigo fuente, la documentacin de laaplicacin y el manual de usuario, necesarios para comprender el correctofuncionamiento de la aplicacin SEND, as como un virtual appliance que facilita laejecucin de pruebas para un posterior anlisis.','2008-11-05','IPv6, Neighbor Discovery, Criptografa, Firma Digital, Seguridad,CGA.',2,1,1,1,1,'2013-09-17 08:22:05','2013-09-17 08:22:05','Documento_41.pdf','application/pdf',6801724,'2013-09-17 08:22:05',19,0,105,'COMPLETO'),(42,'SISTEMA DE INFORMACIN PARA LA PLANIFICACIN DE PROYECTOS.','Este Trabajo Especial de Grado contempla el desarrollo de un Sistema de Informacinpara la Planificacin de Proyectos siguiendo el estndar de la gua del PMBOK (ProjectManagemet Body of Knowledge, Gua de Fundamentos de la Direccin de Proyectos). Para llevar a cabo este desarrollo se utiliz el mtodo de investigacin de proyectofactible, el cual, en una de sus etapas, permite analizar y seleccionar las herramientas quese encuentran en el rea de conocimiento de Alcance de la gua del PMBOK. El mtodo dedesarrollo utilizado consiste en entrega por etapas, el cual facilita el anlisis, diseo eimplementacin del sistema propuesto. Se propuso un mtodo de programacin queconsiste en un estndar para organizar la estructura del cdigo del sistema. Se analizan las herramientas y tcnicas correspondientes al rea de Alcance paraseleccionar aquellas que se implementarn en el sistema mencionado. Una vezseleccionadas se lleva a cabo la implementacin de las mismas y las pruebas necesariaspara comprobar su correcto funcionamiento.','2008-10-17','PMBOK (ProjectManagemet Body of Knowledge, Gua de Fundamentos de la Direccin de Proyectos).',2,1,1,1,1,'2013-09-17 08:22:08','2013-09-17 08:22:08','Documento_42.pdf','application/pdf',32079286,'2013-09-17 08:22:08',20,0,189,'COMPLETO'),(43,'Soporte Didctico para la enseanzadel uso del Navegador y el Correo Electrnico','El objetivo general del Trabajo Especial de Grado fue disear ydesarrollar un Soporte Didctico para la enseanza del uso del Navegador y elCorreo Electrnico (NaVEcO), que permitiera de una manera sencilla ydinmica lograr que usuarios con pocos conocimientos de computacinaprendan la utilizacin de estas herramientas informticas.NaVEcO en un principio surge como un proyecto cuyo dominio deaplicacin es ensear el uso del Navegador; sin embargo, se pudo agregar eltema del Correo Electrnico, siendo as una aplicacin que impartaconocimientos de dos temas importantes para usuarios no expertos en el usode las de las tecnologas Internet.Para la implantacin de NaVEcO, se utiliz el lenguaje de programacinVisual Basic 6 para la elaboracin de sistemas stand-alone (independientes,autnomos) y elaboracin de instaladores (Wizards de instalacin). Tambin seutiliz Macromedia Flash Mx 2004 para la creacin de animaciones. En general,la conjuncin de herramientas de software permiti desarrollar un soportedidctico con un alto grado de interactividad, permitiendo al usuario hacerpeticiones y que stas sean respondidas mediante interfaces amigables y defcil uso.Se incorpor al Ciclo de Desarrollo de Software la definicin de Patronesde Interaccin con el fin de obtener soluciones en el diseo de las interfaces deusuario de NaVEcO. Esto constituye un valioso aporte para otrosdesarrolladores que pudieran encontrarse en la necesidad de resolverproblemas similares.La solucin que provee NaVEcO presenta ciertas limitaciones en cuantola leccin prctica del Correo Electrnico, ya que actualmente el Soporte paraesta leccin es un enlace va Web a un proveedor de cuentas de CorreoElectrnico; por lo tanto, se podra pensar en incorporar una solucin similar ala leccin prctica del Navegador, simulando en una versin un poco ms bsica, una interfaz con funcionalidades propias del Correo Electrnico,dejndose sta como posible recomendacin para actualizaciones futuras delSoporte Didctico.','2008-06-04','Soporte Didctico para la enseanzadel uso del Navegador y el Correo Electrnico NaVEcO',2,1,1,1,1,'2013-09-17 08:22:10','2013-09-17 08:22:10','Documento_43.pdf','application/pdf',1540229,'2013-09-17 08:22:10',15,0,86,'COMPLETO'),(44,'SISTEMA DE AUTENTICACIN SIGILOSA CON TERMINAL DE ADMINISTRACIN.','El propsito de este trabajo es implementar un sistema de autenticacinsigilosa basndose en la premisa de seguridad en profundidad (tambin conocidacomo seguridad en capas). Dicha solucin se basar en agregar una capa deautenticacin sigilosa a los esquemas existentes, ya que de esta manera se puedereducir drsticamente los riesgos a los cuales estn expuestos los servidores.','2008-09-24','Seguridad, Capas',2,1,1,1,1,'2013-09-17 08:22:10','2013-09-17 08:22:10','Documento_44.pdf','application/pdf',1235412,'2013-09-17 08:22:10',20,0,83,'COMPLETO'),(45,'DESARROLLO DE UNA HERRAMIENTA PARA LA INTERPRETACIN SIMBLICA DE MQUINAS DE SOPORTE VECTORIAL ENTRENADAS.','Las mquinas de soporte vectorial (SVM) son sistemas de aprendizaje diseadas sobre la teora del aprendizaje estadstico (Vapnik, 1998), las cuales han demostrado poseer una buena capacidad de generalizacin sobre datos reales. Sin embargo, ellas generan modelos caja negra, es decir, el conocimiento que adquieren durante el aprendizaje es difcil de interpretar desde el punto de vista del usuario. En este trabajo se presenta una herramienta para la interpretacin simblica de mquinas de soporte vectorial entrenadas basada en al algoritmo TREPAN, el cual permite la extraccin de rboles de decisin a partir de estas mquinas de aprendizaje. Las pruebas realizadas muestran que los rboles de decisin generados por la herramienta, poseen un alto grado de fidelidad con el modelo aprendido por la mquina de soporte vectorial.','2008-10-28','mquinas de soporte vectorial, extraccin de reglas, rboles de decisin, TREPAN.',2,1,1,1,1,'2013-09-17 08:22:11','2013-09-17 08:22:11','Documento_45.pdf','application/pdf',1184713,'2013-09-17 08:22:11',20,0,66,'COMPLETO'),(46,'HERRAMIENTA PARA LA EXTRACCIN AUTOMTICA DE CARACTERSTICAS MORFOLGICAS DE ESPERMATOZOIDES HUMANOS A PARTIR DE IMGENES.','El Anlisis de Lquido Seminal (ALS) o Espermograma es un procedimiento diagnstico importante para la salud ya que se constituye en un medio de evaluacin de la fertilidad masculina. Por otra parte, permite estimar el funcionamiento de diferentes estructuras del aparato reproductivo, lo que resulta conveniente para dar seguimiento a intervenciones mdicas como la vasectoma, as como otros chequeos pre y post operatorios.En el ALS se realizan dos grupos de pruebas (macroscpicas y microscpicas). La evaluacin morfolgica es una subprueba microscpica que demanda altos costes en trminos de pericia, tiempo y esfuerzo, adems de ser un procedimiento vulnerable a varias fuentes de error.A partir de la vigencia, utilidad e importancia de la evaluacin morfolgica as como de las dificultades asociadas a este examen, el propsito de esta investigacin fue construir una herramienta que apoye al experto en la prueba. Para tal fin, se defini un modelo de procesamiento de imgenes digitales microscpicas del lquido seminal, que identifica y extrae las caractersticas a los espermatozoides presentes en la escena.Luego del desarrollo y definicin del modelo, se realizaron pruebas con una muestra de 89 imgenes tomadas en condiciones similares al ambiente de trabajo del experto. Los resultados indican una tasa de error de segmentacin de 7,69% confundiendo elementos de las imgenes con espermatozoides, 6,69% de omisiones de espermatozoides presentes y 7,53% de error en la extraccin de caractersticas producto de la identificacin errnea de las estructuras del espermatozoide.El desarrollo del proyecto constituye un aporte que demuestra la factibilidad de desarrollar este tipo de tecnologas en el pas. Sin embargo, mostr ser una actividad compleja, que debe ser llevada a cabo con precaucin, controlando las fuentes de error. Requiere de creatividad e innovacin as como del dominio de los aspectos tcnicos relacionados a la eficiencia en la ejecucin de programas en el computador.','2008-10-29','Morfologa Espermtica, Inteligencia Artificial, Procesamiento Digital de Imgenes.',2,1,1,1,1,'2013-09-17 08:22:13','2013-09-17 08:22:13','Documento_46.pdf','application/pdf',1516487,'2013-09-17 08:22:13',20,0,61,'COMPLETO'),(47,'EASY EXTRACTOR: UN SISTEMA DE CLASIFICACIN DE INFORMACIN DE LA WEB UTILIZANDO TCNICAS DE EXTRACCIN DE DATOS.','La informacin en la Web se encuentra en cambio constante y sujeta ala volatilidad de la red, por lo que una pgina puede existir hoy pero nomaana o encontrarla con un contenido distinto. De esta manera surge lanecesidad de extraer, almacenar y clasificar informacin que el usuarioconsidere importante en la Web. En la actualidad existen algunasherramientas que han solucionado dicha problemtica, entre las cualesmencionamos Solvent y Google Bloc de notas. Sin embargo pueden nosatisfacer las necesidades de algunos usuarios. El sistema Easy Extractor, se crea como una herramienta distinta queno slo engloba funcionalidades de otras aplicaciones, sino que ofrece nuevasposibilidades a los usuarios. En el proceso de desarrollo de esta aplicacin serealiz una adaptacin de la metodologa eXtreme Programming (XP). Dentrode las cualidades con las que cuenta este sistema son: compartir informacincon otros usuarios, exportar la informacin a formato PDF para sualmacenaje local, intercambiar comentarios e ideas con otros usuarios,demarcado y almacenaje de informacin e imgenes para su posteriorrecuperacin, entre otras.','2008-10-23','Mozilla, XUL, WEB, Aplicacin, Servicios Web.',2,1,1,1,1,'2013-09-17 08:22:14','2013-09-17 08:22:14','Documento_47.pdf','application/pdf',0,'2013-09-17 08:22:14',20,0,0,'INCOMPLETO'),(48,'INSTANCIACIN DE UNA SOLUCIN ERP CDIGO ABIERTO PARA EL SECTOR SALUD- AMBULATORIO.','En este trabajo se presenta para el sector salud ambulatorio la adaptacin de un sistema Enterprise Resource Planning (ERP) porque se crea una plataforma integrada de toda la organizacin para coordinar los procesos internos clave de la empresa. Se decidi adaptar un ERP para integrar los procesos del ambulatorio en un solo sistema de software y que esa informacin pueda fluir a travs de la organizacin mejorando la coordinacin, eficiencia y toma de decisiones. Los ERP pueden ayudar a crear una organizacin ms uniforme en la que todo el mundo utilice procesos e informacin similares y evale su trabajo en trminos de estndares de desempeo de toda la organizacin. Los ERP son muy difciles de implementar con xito. Requieren un cambio organizacional extenso, el uso de tecnologas complicadas precisa altos costos iniciales para obtener beneficios a largo plazo difciles de cuantificar pero una vez implementados, es muy difcil cambiar los sistemas empresariales. (Laudon y Laudon, 2001).La digitalizacin de la historia clnica (HC) se ha convertido durante los ltimos aos en el objetivo de la mayor parte de los trabajos de la Informtica Mdica. La sustitucin de la HC tradicional en soporte de papel, por una historia clnica digital (HCD), responde a las necesidades de resolver los dos problemas clsicos de los archivos de HC, como lo son en primer lugar el crecimiento continuo del volumen almacenado, que llega a crear graves problemas de espacio fsico, y el inevitable trasiego de documentos originales, con riesgo de prdida y de su deterioro, y en segundo lugar permitir la transferencia rpida de la informacin clnica existente de un paciente a puntos lejanos, unificando as de hecho la HC por encima de los lmites de las instituciones asistenciales. Adems este trabajo sirve para poner a disposicin de los investigadores y de los planificadores sanitarios esta informacin clnica, de forma fcilmente accesible y tratable.','2008-10-28','Historia Clnica Digital, ERP (Enterprise Resource Planning), Software Libre.',2,1,1,1,1,'2013-09-17 08:22:15','2013-09-17 08:22:15','Documento_48.pdf','application/pdf',2302726,'2013-09-17 08:22:15',17,0,105,'COMPLETO'),(49,'DISEO Y DESARROLLO DE UNA NUEVA APLICACIN WEB PARA LA ESCUELA DE COMPUTACIN DE LA UNIVERSIDAD CENTRAL DE VENEZUELA CON TECNOLOGA RUBY ON RAILS.','Este trabajo de la Facultad de Ciencias de la Universidad Central de Venezuela tiene como objetivo eldesarrollo de una aplicacin Web para la Escuela de Computacin que sirva como medio de difusin deinformacin institucional, acadmica y de investigacin, accesible y de fcil navegacin, usandoestndares de diseo Web actuales y que cuente con funcionalidades que faciliten la actualizacin de sucontenido. Debido a la naturaleza de la aplicacin, donde unas funcionalidades deben ser del dominiopblico y otras slo disponibles para usuarios autorizados, se sugierieron dos subsistemas denominados:subsistema pblico y subsistema administrativo.Para llevar a cabo este objetivo se aplicaron herramientas y tecnologas de desarrollo Web tal como Rubyon Rails, Hojas de estilo en cascada, Lenguaje Extensible de Marcado de Hipertexto, en el caso de lasfuncionalidades se uso la metodologa de desarrollo Proceso Unificado gil adaptada a las necesidadesde la aplicacin, y para el diseo se siguieron aquellos estndares actuales de diseo Web, lineamientosde usabilidad y patrones de interaccin, considerados ms importantes.','2008-10-17','UCV, Escuela de Computacin, Aplicacin Web, tecnologas de desarrollo Web, Rubyon Rails, Modelado gil. Metodologa de desarrollo AUP, estndares de diseo Web, usabilidad, patronesde interaccin.',2,1,1,1,1,'2013-09-17 08:22:18','2013-09-17 08:22:18','Documento_49.pdf','application/pdf',4532234,'2013-09-17 08:22:18',20,0,254,'COMPLETO'),(50,'VISIN ARTIFICIAL PARA DETECCIN Y UBICACIN ESPACIAL DE OBJETOS EN UNA ESCENA.','El Centro de Computacin Grfica (CCG) en conjunto con el Instituto de CirugaExperimental (ICE) de la Facultad de Medicina de la Universidad Central de Venezuela (UCV)y el Instituto Nacional de Bioingeniera (INABIO) estn desarrollando un simulador virtualpara entrenamiento en ciruga laparoscpica, en el marco del proyecto LAPAROS.Actualmente, el componente de hardware del simulador est conformado por un simuladormecnico y un subsistema de rastreo. El subsistema de rastreo est basado en un dispositivocomercial llamado ISOTRAK II, el cual enva al computador la posicin de la pinza cuandoesta se encuentra en la cavidad del simulador mecnico. Sin embargo, el CCG cuenta solamentecon un equipo, el cual es de alto costo y presenta limitaciones en cuanto a la cantidad derastreos simultneos y la forma de interactuar con los instrumentos. Es por ello, que en esteTrabajo Especial de Grado se presenta un sistema basado en Visin Artificial con un enfoquems general capaz de reconocer cualquier objeto en base a su color y ubicarlo en un ambientetridimensional, presentando una manera alterna de interaccin econmica, portable einnovadora. El sistema propuesto utiliza un conjunto de cmaras digitales para capturar laimagen del objeto de inters. Estas imgenes son sometidas a un procesamiento que permitedetectar y obtener las caractersticas relevantes del objeto de inters. Luego, estascaractersticas son la entrada de varios algoritmos que permiten calcular la posicin del objeto ysu ubicacin en el espacio.','2008-10-28','ISOTRAK II',2,1,1,1,1,'2013-09-17 08:22:22','2013-09-17 08:22:22','Documento_50.pdf','application/pdf',0,'2013-09-17 08:22:22',20,0,0,'INCOMPLETO'),(51,'REINGENIERA DE UN SISTEMA DE SEGUNDA OPININ MDICA PARA EL PROYECTO SOS TELEMEDICINA PARA VENEZUELA.','Uno de los servicios fundamentales en Telemedicina es el de segunda opini n m dica. Como partedel proyecto SOS Telemedicina UCV llevado a cabo por el Centro de An lisis de Im genes Biom di-cas Computarizadas se desarroll  una aplicaci n Web que permite a los m dicos especialistas de lospostgrados de la Facultad de Medicina de la Universidad Central de Venezuela atender consultas deSegunda Opini n M dica generadas por los m dicos rurales de diversas regiones del pa  De estamanera se puede mejorar la prestaci n de servicios de salud mediante la consulta especializada remo-ta, lo que permite abaratar costos y reducir tiempos de respuesta en casos complejos. El sistema deSegunda Opini n M dica tiene las siguientes funcionalidades: a) captura de la historia cl pacientes; b) transmisi n de la informaci n textual y multimedia para soporte de los casos (videos,im genes y audio); c) asignaci n de los casos de acuerdo a la especialidad o dificultad de los mismos;d) seguimiento de los casos por parte de los m dicos rurales y de los especialistas; e) intercambio deinformaci n entre m dicos, y preparaci n de casos para posterior publicaci n. El sistema est  desa-rrollado siguiendo una Arquitectura Basada en Servicios (SOA) y herramientas de Software Libre, loque permite la reutilizaci n de los componentes para otras aplicaciones desarrolladas en la UCV. Enla actualidad existe una prueba piloto en los centros asistenciales de Juan Griego, Salamanca y Coche,todos en el Estado Nueva Esparta, y un centro de triaje en el Instituto de Medicina Tropical de laUCV. El objetivo de este trabajo es presentar el dise  o de la arquitectura, un prototipo funcional, ylas discusiones del uso del sistema por parte de los m dicos rurales.','2008-10-30','Aplicaciones Web. Telemedicina. Segunda Opinion M edica.',2,1,1,1,1,'2013-09-17 08:22:22','2013-09-17 08:22:22','Documento_51.pdf','application/pdf',5865298,'2013-09-17 08:22:22',19,0,129,'COMPLETO'),(52,'ELABORACIN DE UN PROTOTIPO DE BUSCADOR DE DOCUMENTOS ACADMICOS DE LA FACULTAD DE CIENCIAS.','El presente Trabajo Especial de Grado aborda el tema de la localizacin de documentoselectrnicos con la informacin solicitada por los usuarios. En el marco conceptual seinvestig acerca de la manera en que funcionan los grandes buscadores de Internet, los buscadoresmas especficos que operan en una sola computadora y los formatos de documentoselectrnicos que stos manejan. En el marco aplicativo se desarroll un repositorio y unbuscador Web de documentos electrnicos, los cuales estn diseados para albergar a lostrabajos producidos por los estudiantes de la Facultad de Ciencias de la Universidad Centralde Venezuela.El sistema desarrollado en el marco aplicativo se llama BUSCONEST, el cual es a su vezun subsistema de CONEST dedicado exclusivamente a los documentos digitales relacionadoscon trabajos acadmicos. Durante el desarrollo de la aplicacin se emplearon planteamientosy soluciones innovadoras para los requerimientos especficos. Entre los principales aspectosdel desarrollo de BUSCONEST tenemos el algoritmo de ordenamiento, la implementacindel manejo de la persistencia, la ejecucin de las consultas, la integracin con CONEST yla incrementabilidad del sistema entre otros.','2008-02-01','BUSCONEST, CONEST, Biblioteca, Ruby on Rails',2,1,1,1,1,'2013-09-17 08:22:24','2013-09-17 08:22:24','Documento_52.pdf','application/pdf',2307218,'2013-09-17 08:22:24',20,0,99,'COMPLETO'),(53,'ADMIN UCV NGN: APLICACIN DE CDIGO ABIERTO PARA LA CONFIGURACIN Y LA ADMINISTRACIN DE REDES DE PRXIMA GENERACIN.','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicacin denominada AdminUCV NGN para la administracin y la configuracin de redes con soporte para IPv4 e IPv6. AdminUCV NGN est basada en el protocolo SNMP y provee un conjunto de herramientas que permiten monitorizar y conocer el estado de la red, facilitando la labor del administrador.El trabajo se inicia con un estudio terico de los aspectos ms relevantes que se deben tomar en cuenta para la creacin de un sistema para administracin de redes y un anlisis de cada uno de los protocolos sobre los que se fundamenta. Durante la implementacin de la aplicacin, se utiliz una metodologa iterativa basada en las nuevas tendencias del modelo de desarrollo gil que plantea la creacin de cada una de las herramientas de la aplicacin en una iteracin del proceso que abarca las fases de Anlisis, Diseo, Implementacin y Pruebas.AdminUCV NGN brinda soporte para SNMP versin 1 y 2c mediante un manager SNMP que complementa las primitivas del protocolo con operaciones avanzadas tales como Walk (para recorrer un subrbol de la MIB) y Table view (para visualizar los datos de una tabla SNMP ordenados por columnas). Adicionalmente permite importar MIBs, recibir traps y generar grficas basadas en variables SNMP.AdminUCV NGN incorpora tambin un conjunto de utilidades administrativas como ping, tracert, un sniffer y un escner de puertos TCP, donde cada una de ellas provee soporte para IPv4 e IPv6.El producto final junto a la documentacin de la investigacin est publicada como una aplicacin con licencia GNU GPL a travs de SourceForge.net (un sitio Web que permite el hospedaje y distribucin de software libre y sistemas de cdigo abierto) en el siguiente enlace: http://adminucvngn.sourceforge.net.','2008-07-14','Administracin de redes, IPv4, IPv6, SNMP, MIB, GNU.',2,1,1,1,1,'2013-09-17 08:22:25','2013-09-17 08:22:25','Documento_53.pdf','application/pdf',0,'2013-09-17 08:22:25',20,0,0,'INCOMPLETO'),(54,'BIBLIOTECA PARA LA ADMINISTRACIN DE REDES BASADAS EN TCP/IP MEDIANTE LA UTILIZACIN DEL PROTOCOLO SNMP v1/v2c PARA EL LENGUAJE DE PROGRAMACIN PHP.','BIBLIOTECA PARA LA ADMINISTRACIN DE REDES BASADAS EN TCP/IP MEDIANTE LA UTILIZACIN DEL PROTOCOLO SNMP v1/v2c PARA EL LENGUAJE DE PROGRAMACIN PHP.','2008-11-03','BIBLIOTECA PARA LA ADMINISTRACIN DE REDES BASADAS EN TCP/IP MEDIANTE LA UTILIZACIN DEL PROTOCOLO SNMP v1/v2c PARA EL LENGUAJE DE PROGRAMACIN PHP.',2,1,1,1,1,'2013-09-17 08:22:26','2013-09-17 08:22:26','Documento_54.pdf','application/pdf',0,'2013-09-17 08:22:26',20,0,0,'INCOMPLETO'),(55,'GENERADOR GRFICO DE CONSULTAS PARA LA RECUPERACIN DE DATOS INTEGRADO EN ECLIPSE.','En la actualidad, la mayora de los sistemas de software almacenan suinformacin haciendo uso de bases de datos. Cada uno de los Sistemas Manejadoresde Bases de Datos, manejan esta informacin de diferentes maneras; lo cual hace quela recuperacin de los datos dependa en gran parte del Sistema Manejador de Basesde Datos que se utilice.El presente Trabajo Especial de Grado, ofrece realizar una herramienta quepermita a los usuarios inexpertos en la manipulacin de consultas de recuperacin dedatos (SQL). La construccin de una consulta se realizar de forma grfica,permitiendo hacer abstraccin del SMBD utilizado.Esta herramienta grfica de creacin consultas de recuperacin de datos, seimplant como un plug-in del entorno de desarrollo Eclipse, debido a que las consultasde recuperacin de datos SQL son utilizadas en mayor parte en el momento en que sedesarrollan los sistemas de software.Para llevar a cabo la solucin al problema, y desarrollar una herramienta degeneracin de consultas SQL independiente del SMBD y de su sintaxis SQL, se realizlo siguiente:Se defini un proceso de desarrollo basado en Programacin Extrema (XP) ytomando prcticas y principios de la metodologa Modelacin gil (AM).Como la herramienta debe permitir generar una sintaxis SQL para diferentesSMBD, se hizo que la misma fuera extensible mediante archivos deconfiguracin basados en XML, en los cuales se especifican las caractersticas decada base de datos. Las soportadas por el plug-in actualmente son MySQL 4.1,Postgres 8.1 y Oracle 9i.Se cre un mdulo de base de datos genrico que permite establecercomunicacin con los diferentes SMBD relacionales; adems de poder obtenerel diccionario de datos que en estos se encuentran.Se crearon interfaces de manejos de proyectos, que aplica los patrones deinterfaces a las del entorno de desarrollo ECLIPSE.','2008-05-22','Plug-in, Eclipse, SQL, Base de datos.',2,1,1,1,1,'2013-09-17 08:22:27','2013-09-17 08:22:27','Documento_55.pdf','application/pdf',8903064,'2013-09-17 08:22:27',20,0,142,'COMPLETO'),(56,'GENERADOR GRFICO DE CONSULTAS PARA LA RECUPERACIN DE DATOS INTEGRADO EN ECLIPSE.','En la actualidad, la mayora de los sistemas de software almacenan suinformacin haciendo uso de bases de datos. Cada uno de los Sistemas Manejadoresde Bases de Datos, manejan esta informacin de diferentes maneras; lo cual hace quela recuperacin de los datos dependa en gran parte del Sistema Manejador de Basesde Datos que se utilice.El presente Trabajo Especial de Grado, ofrece realizar una herramienta quepermita a los usuarios inexpertos en la manipulacin de consultas de recuperacin dedatos (SQL). La construccin de una consulta se realizar de forma grfica,permitiendo hacer abstraccin del SMBD utilizado.Esta herramienta grfica de creacin consultas de recuperacin de datos, seimplant como un plug-in del entorno de desarrollo Eclipse, debido a que las consultasde recuperacin de datos SQL son utilizadas en mayor parte en el momento en que sedesarrollan los sistemas de software.Para llevar a cabo la solucin al problema, y desarrollar una herramienta degeneracin de consultas SQL independiente del SMBD y de su sintaxis SQL, se realizlo siguiente:Se defini un proceso de desarrollo basado en Programacin Extrema (XP) ytomando prcticas y principios de la metodologa Modelacin gil (AM).Como la herramienta debe permitir generar una sintaxis SQL para diferentesSMBD, se hizo que la misma fuera extensible mediante archivos deconfiguracin basados en XML, en los cuales se especifican las caractersticas decada base de datos. Las soportadas por el plug-in actualmente son MySQL 4.1,Postgres 8.1 y Oracle 9i.Se cre un mdulo de base de datos genrico que permite establecercomunicacin con los diferentes SMBD relacionales; adems de poder obtenerel diccionario de datos que en estos se encuentran.Se crearon interfaces de manejos de proyectos, que aplica los patrones deinterfaces a las del entorno de desarrollo ECLIPSE.','2008-05-22','Plug-in, Eclipse, SQL, Base de datos.',2,1,1,1,1,'2013-09-17 08:22:28','2013-09-17 08:22:28','Documento_56.pdf','application/pdf',0,'2013-09-17 08:22:28',20,0,0,'INCOMPLETO'),(57,'ACTUALIZACIN TECNOLGICA PARA EL INSTITUTO NACIONAL DE TRNSITO Y TRANSPORTE TERRESTRE. CASO DE ESTUDIO: SISTEMA DE INVENTARIO DE PLACAS.','El INTTT pretende incorporar la nueva forma de identificacin de vehculos amediados del 2008 (cdigos de placas de 7 dgitos) para suplantar el viejo sistema(cdigos de placas de 6 dgitos), se ha sugerido la descentralizacin del sistemaactual de almacenamiento de identificaciones ya que el INTTT cuenta con 69oficinas distribuidas a lo largo del pas, por lo tanto, el nuevo sistema deidentificacin de vehculos pudiera masificarse en todo el pas de manera rpida yefectiva.Se propone el desarrollo de una plataforma de software aplicando un mtodo dedesarrollo gil en un contexto de trabajo real bajo una arquitectura cliente-servidorcon una propuesta de migracin hacia una arquitectura orientada a servicios, quesea accesible y fcil de usar, de manera tal, que pueda implantarse en cada una delas oficinas del INTTT y que permita agilizar la masificacin de la nueva forma deidentificacin vehicular.','2008-10-24','ACTUALIZACIN TECNOLGICA PARA EL INSTITUTO NACIONAL DE TRNSITO Y TRANSPORTE TERRESTRE. CASO DE ESTUDIO: SISTEMA DE INVENTARIO DE PLACAS. INTTT',2,1,1,1,1,'2013-09-17 08:22:29','2013-09-17 08:22:29','Documento_57.pdf','application/pdf',2946780,'2013-09-17 08:22:29',19,0,144,'COMPLETO'),(58,'DESARROLLO DE UN GENERADOR DE SITIOS WEB PARA LA VISUALIZACIN DE ONTOLOGAS.','En el presente trabajo de investigacin se propone el diseo, desarrollo e implementacin de una herramienta que permita la generacin de Sitios Web para la visualizacin de ontologas y contenidos relacionados a la misma. Dicha herramienta estar basada en una arquitectura cliente/servidor. La herramienta propuesta tiene como base o punto de partida los siguientes trabajos de investigacin: \"Ontologa en ambiente Web para el dominio del Anlisis de Lquido Seminal Humano\" (Pereira, 2006), \"Visualizador de una Ontologa de Insectos Acuticos\" (Labrador, 2007) y \"Desarrollo de una Aplicacin en Ambiente Web para la visualizacin de una Ontologa para el dominio del Anlisis de Semen Humano\" (Reyes, 2008); los trabajos mencionados anteriormente, permiten visualizar una ontologa bajo un esquema cliente/ servidor. Sin embargo, estos visualizadores tienen la limitante de trabajar con un dominio y ontologa especifica. El generador de Sitios Web para la visualizacin de ontologas permite solucionar dicha limitante a travs de un mdulo visualizador generalizado para ontologas OWL-DL.','2008-10-28','Ontologa, Sitios Web, visualizacin de ontologas, OWL-DL, visualizador generalizado.',2,1,1,1,1,'2013-09-17 08:22:30','2013-09-17 08:22:30','Documento_58.pdf','application/pdf',3029238,'2013-09-17 08:22:30',19,0,142,'COMPLETO'),(59,'DESARROLLO DE UN PORTAL WEB PARA APOYAR EL APRENDIZAJE CONTINUO TECNOLGICO.','Este trabajo (enmarcado dentro del proyecto FONACIT Nro. 2005000166) muestra eldesarrollo de un portal que proporciona elementos comunicacionales para promover elaprendizaje colaborativo y organizacional. Se establece una infraestructura que brinda elsoporte necesario para que las personas alfabetizadas tecnolgicamente y sus facilitadores,puedan distribuir conocimiento tecnolgico bien sea, para reforzar lo aprendido o paraactualizarse, dando continuidad al proceso de enseanza-aprendizaje.La infraestructura permite que los usuarios puedan incorporar y distribuir conocimiento endiferentes modalidades de comunicacin (foros, noticias y artculos), as como proveemecanismos para la incorporacin de nuevos componentes comunicacionales que facilitenque mejoren la comunicacin entre los usuarios.La solucin propuesta incluye como paso inicial el modelado de negocio, para lo cual seutiliza la notacin BPM (Business Process Model), identificando los procesos principalesque deben ser implantados a travs del portal. En el desarrollo del portal se utiliza laherramienta Joomla (solucin de software libre), esta provee funcionales para laconstruccin \"rpida\" de portales, debido a esto, se propone un mtodo de desarrollobasado en el Modelado gil (MA), especificando como artefactos principales: el modelo decasos de uso y actividades (utilizando la notacin UML - Unified Modeling Language),Patrones de Interaccin propuestos por Welie (soluciones a problemas especficos deinteraccin) y como arquitectura de software la propuesta por Joomla.La experiencia logra establecer dos conexiones importantes, la primera, tiene que ver conlas teoras de aprendizajes y cmo stas pueden ser implantadas a travs de unainfraestructura tecnolgica; la segunda, establece la relacin que existe entre unaherramienta para la construccin rpida de portales y el proceso de desarrollo gil.','2008-07-18','Aprendizaje Colaborativo, Aprendizaje Organizacional, AlfabetizacinTecnolgica, Aprendizaje Continuo Tecnolgico, Modelado gil, Proceso de Desarrollo.',2,1,1,1,1,'2013-09-17 08:22:33','2013-09-17 08:22:33','Documento_59.pdf','application/pdf',0,'2013-09-17 08:22:33',19,0,0,'INCOMPLETO'),(60,'DESARROLLO DE UN SISTEMA WEB DE GESTIN, CONTROL E INSCRIPCIN DE ACTIVIDADES EXTRACURRICULARES PARA EL C.E.A.P.U.C.V.','Hoy en da el uso de las Tecnologas de Informacin y Comunicacin, para lograrun sistema automatizado, son un recurso indispensable para obtener un mejordesempeo en todas las reas de trabajo a nivel mundial, ya que estas permitendejar a un lado los mtodos manuales para as llevar a cabo sus tareas de unaforma ms rpida y eficiente.Este hecho es el punto de partida para el desarrollo de este trabajo deinvestigacin en el cual se desarrollar un Sistema para la automatizar la gestine Inscripcin online de actividades extracurriculares del Centro Educativo de laAsociacin de Profesores de la U.C.V. (C.E.A.P.U.C.V.), en el cual se utilizarnherramientas de cdigo abierto para su desarrollo, como : el sistema manejadorde Base de Datos MySQL, el cual permite entre otras cosas, un bajo costo enrequerimientos para la elaboracin de bases de datos, ya que debido a su bajoconsumo de procesamiento , puede ser ejecutado en una mquina con pocosrequerimientos de memoria y procesador sin ningn problema; otra herramientade cdigo abierto utilizada es el Lenguaje Hypertext Pre-Processor PHP, el cualbrinda diferentes ventajas a la hora de desarrollar programas, una de lasprincipales es que es un lenguaje interpretado el cual no necesita compilacin ni14la utilizacin de ninguna mquina virtual para su funcionamiento, aparte de esto,es uno de los lenguajes ms populares que se utilizan actualmente en elmercado, dado que su costo para el hospedaje y mantenimiento de sitios Webses mnimo.Otro punto importante en la investigacin fue la seleccin de la metodologa, lacual deba estar adaptada al desarrollo, en torno a esto se realiz unainvestigacin entre las metodologas ms utilizadas, entre las cuales figuran:Proceso Racional Unificado (RUP),Programacin Extrema (XP) y DesarrolloBasado en Funcionalidades (FDD), para llegar a la conclusin de utilizar estaltima nombrada, ya que por tratarse de una aplicacin Web de pequea escala,con pocos integrantes y en la cual las funcionalidades era su principal objetivo,esta metodologa con procesos giles la cual provee documentacin, era la msapropiada para comenzar el desarrollo; la documentacin necesaria aplicada enesta metodologa para esta aplicacin sern: diagramas de objetos, diagrama deentidad Relacin, diagramas de secuencias y por ltimo, aunque no se planteadentro de la metodologa, se utiliz la recoleccin de datos, para poderesquematizar esto se realizarn los diagramas de Casos de Uso.El objetivo principal de este desarrollo, es ofrecer al colegio C.E.A.P.U.C.V., laoportunidad de obtener una ventana a la tecnologa de hoy en da para aplicarlade forma eficiente en el desarrollo de sus actividades dentro del mbito de lasactividades extracurriculares dadas en esta institucin, para que as puedanobtener un gran nmero de ventajas dentro del mbito acadmico y econmico.','2008-10-29','DESARROLLO DE UN SISTEMA WEB DE GESTIN, CONTROL E INSCRIPCIN DE ACTIVIDADES EXTRACURRICULARES PARA EL C.E.A.P.U.C.V.',2,1,1,1,1,'2013-09-17 08:22:33','2013-09-17 08:22:33','Documento_60.pdf','application/pdf',1723089,'2013-09-17 08:22:33',20,0,129,'COMPLETO'),(61,'SISTEMA AUTOMATIZADO PARA LA GESTIN DE SOLICITUDES EN TECNOLOGIAS DE INFORMACIN','El acelerado avance en tecnologas de informacin ha trado como consecuenciael crecimiento exponencial de las redes de datos, aumentando considerablementela cantidad de dispositivos de interconexin y de usuarios en las mismas, lo queha originado que la tarea de mantenimiento, atencin y soporte a usuarios en lasorganizaciones sea cada vez ms compleja y costosa, an contando con elconocimiento y las herramientas apropiadas. En este Trabajo Especial de Grado sepresenta un Sistema automatizado, que permite llevar la gestin de solicitudes deservicio, gestin de inventario de plataforma tecnolgica y de activos de red deuna forma integrada, a fin de: Mejorar la productividad de los usuarios de laorganizacin, controlar y monitorizar los procesos de servicio, optimizar el uso delos recursos disponibles, reducir el impacto de las incidencias sobre laorganizacin, detectar las condiciones de la red organizativa de datos, detectarproblemas de flujo y conectividad de datos por malos diseos de la red, entreotros.Los resultados obtenidos al realizar las pruebas del Sistema muestran el impactofavorable sobre la organizacin, basado en la reduccin de los tiempos derespuesta en la solucin de las incidencias, en un 34,55%, el aumento en laproductividad del personal del departamento de atencin de usuarios y eficienciaen la gestin de activos.Con este Trabajo Especial de Grado se deja ver la manera en que es posibleintegrar un conjunto de herramientas basadas en Software Libre, enfocadas enautomatizar la gestin de solicitudes en tecnologas de informacin, permitiendouna adecuada gestin de incidencias e inventario de activos y dispositivosconectados a la red. Adems, es novedoso, orientado al Web, seguro y robusto,gracias a que ofrece un diseo completamente modular, si la operacin de unmdulo falla el Sistema no deja de funcionar. Est pensado para ser escalable yfcil de adaptar, pese a ser una solucin pensada para la empresa Ingedigit C.A.,puede correr bajo cualquier ambiente, sin importar las dimensiones de la red, lacantidad de dispositivos conectados a ella y la dinmica de la organizacn.','2008-10-23','SISTEMA AUTOMATIZADO PARA LA GESTIN DE SOLICITUDES EN TECNOLOGIAS DE INFORMACIN',2,1,1,1,1,'2013-09-17 08:22:35','2013-09-17 08:22:35','Documento_61.pdf','application/pdf',0,'2013-09-17 08:22:35',20,0,0,'INCOMPLETO'),(62,'DISEO Y DESARROLLO DE PLATAFORMA INTEGRADA GSM-SMPP PARA LA ADMINISTRACIN DE MENSAJES DE TEXTO SMS Y PUBLICACIN Web.','El objetivo del presente Trabajo Especial de Grado consiste en la implementacinde una plataforma capaz de proveer, a empresas que prestan servicios de valor agregadomediante la mensajera corta de texto, el control de todos sus envos, as como lasrespectivas respuestas de los mismos, adems de ser configurable para cualquier tipo deoperadora, no slo a nivel nacional sino tambin internacional. Este desarrollo fuemotivado por la necesidad de la empresa ALS Comunicaciones, quin presta este tipo deservicios, con el fin de ampliar su plataforma y poder brindar un mejorar servicio a susclientes; haciendo uso de las especificaciones del protocolo estndar de clase mundialSMPP (Short Message Peer-to-Peer), la implementacin fue llevada a cabo en lenguajeJava y como manejador de base de datos MySQL.','2008-10-21','SMPP, Short Message Peer to Peer, SMS, Short Messaging System, Mensajera de texto.',2,1,1,1,1,'2013-09-17 08:22:36','2013-09-17 08:22:36','Documento_62.pdf','application/pdf',2671616,'2013-09-17 08:22:36',19,0,0,'INCOMPLETO'),(63,'Clculo de la Cohomologa de De Rham de los Espacios Proyectivos por medio de la Sucesin de Gysin','El objetivo central del trabajo es calcular la Cohomologa de De Rham de los Espacios Proyectivos Complejos a travs de una herramienta de la topologa algebrica conocida como la Sucesin de Gysin. En la primera parte se introducen los conceptos bsicos previos como: variedades diferenciables, aplicaciones diferenciables, particiones de la unidad diferenciables, fibrados, fibrado tangente, fibrado de formas, k-formas diferenciables, integracin de formas.Luego se define la Cohomologa de De Rham y los principales resultados algebricos conocidos de esta teora como: el lema de los cinco, lema de la serpiente, sucesin de Mayer-Vietoris, cohomologa de De Rham de la Esfera Unitaria. Finalmente se construye la Sucesin de Gysin, estudiando en detalle sus operadores y se aplica a los espacios proyectivos complejos para calcular su cohomologa.','2009-04-28','Cohomologa de De Rham. Sucesin de Gysin. Espacio Proyectivo Complejo.',5,1,1,1,1,'2013-09-17 08:22:37','2013-09-17 08:22:37','Documento_63.pdf','application/pdf',5380428,'2013-09-17 08:22:37',20,0,156,'COMPLETO'),(64,'EVALUACIN DE FRAMEWORKS WEB USANDO TCNICAS DE MEDICIN DE RENDIMIENTO Y MTRICAS DE SOFTWARE APLICADAS SOBRE COMPONENTES DEL MDULO DE ADMINISTRACIN DEL SERVICIO COMUNITARIO. CASO DE ESTUDIO: JAVA SERVER FACES Y STRUTS 2','Este trabajo abarca los siguientes tpicos: frameworks, mtricas de software y de rendimiento, y as como los pasos o estrategias llevadas a cabo para implementar un conjunto de herramientas que permitan evaluar componentes de software. Los componentes evaluados forman parte del Mdulo de Administracin de Informacin del Servicio Comunitario de la Facultad de Ciencias, la cual se desarroll, en el mismo tenor, en los frameworks Java estudiados en ste trabajo: Java Server Faces (JSF) y Struts 2. Se tom especial consideracin que incluyeran las mismas funcionalidades y se desarrollaran usando la misma lgica de programacin. Todo esto con la finalidad de dar respuesta a las siguientes preguntas qu framework es ms eficaz o ventajoso, cuando se implementa una aplicacin relacionadas con entornos Web de Java? En nuestro trabajo se tom en cuenta el framework Struts 2, el cual posee un controlador que viene inserto como un Servlet interno de Struts 2, este ltimo se us para dirigir la relacin existente entre las acciones, la interfaz y los Beans con la finalidad de trabajar la lgica de negocio; simultneamente las etiquetas de Struts ayudaron a construir la vista y las interfaces en conjuncin con la tecnologa Ajax. Otro framework considerado es Java Server Faces, el cual se us de manera anloga al anterior, para ejecutar la lgica de negocio o acciones del mismo modelo y en el que se contemplaron la interfaz grfica de usuario, los eventos y sus componentes como si fuesen una aplicacin web estndar para disear las diferentes interfaces o vistas que luego son mostradas al usuario. Luego se describe en detalle el subconjunto de mtricas seleccionadas, el ambiente y estrategias para realizar la medicin y las pruebas de rendimiento y el analisis, diseo e implementacin de los componentes de la herramienta Web, de nuestra propia autora, para el Servicio Comunitario La evaluacin se realiz de dos maneras. Las mtricas de software se calcularon por medio de un agregado de software instalado sobre el entorno de desarrollo Eclipse, Metrics 1.3.6, que permiti al usuario exportar los datos obtenidos en un archivo de texto para su posterior procesamiento y visualizacin. Las mtricas de rendimiento fueron obtenidas mediante la herramienta Httperf v9, para plataformas Linux, la cual someti a stress a los componentes seleccionados como caso de estudio y arroj una serie de resultados sobre el rendimiento. Finalmente los resultados capturados son mostrados en una herramienta, llamada Visor, que permite visualizar de manera grfica los valores de las mtricas previamente obtenidas.','2009-04-27','MTRICAS STRUTS2 JAVA SERVER FACES SERVICIO COMUNITARIO',2,1,1,1,1,'2013-09-17 08:22:41','2013-09-17 08:22:41','Documento_64.pdf','application/pdf',3095908,'2013-09-17 08:22:41',20,0,110,'COMPLETO'),(65,'Tetraedrizacin de Intervalos de Volumen mediante modificacin de Cubos Marchantes.','Los dos mtodos principales para la visualizacin de datos volumtricos consisten en la visualizacin directa de volmenes y la extraccin de isosuperficies. El primer mtodo ofrece la ventaja de mostrar todo el volumen en contexto, mientras que el segundo mtodo slo muestra una parte del volumen fuera de contexto. Sin embargo, la extraccin de isosuperficies requiere menos poder de cmputo en comparacin con la visualizacin directa de volumen. Otro mtodo para la visualizacin de datos volumtricos consiste en un hbrido entre ambas tcnicas, el cual reconstruye y muestra subvolmenes del volumen mediante el uso de mallados tetradricos y tcnicas de visualizacin directa de volmenes para el despliegue. Adicionalmente, se puede almacenar el isovalor en cada vrtice del mallado obtenido, lo que permite el uso de dichos mallados para realizar simulaciones mediante el uso de elementos finitos. En la actualidad, los algoritmos existentes para la extraccin de intervalos de volumen son complicados o generan una alta cantidad de primitivas. En este trabajo se propone un algoritmo basado en la adaptacin de cubos marchantes para extraer intervalos de volumen en lugar de isosuperficies, el cual tiene un tiempo de respuesta inferior a los algoritmos existentes y genera un mallado final con una menor cantidad de primitivas sin necesidad de recurrir a algoritmos complejos durante la extraccin del intervalo de cada celda del volumen.','2009-04-27','Datos Volumtricos, Isosuperficies, Intervalos de Volumen',2,1,1,1,1,'2013-09-17 08:22:42','2013-09-17 08:22:42','Documento_65.pdf','application/pdf',0,'2013-09-17 08:22:42',20,0,0,'INCOMPLETO'),(66,'Preparacin y caracterizacin preliminar de una muestra compuesta representativa de la Cuenca de Falcn, Venezuela','En la mayora de los anlisis geoqumicos y geolgicos, es necesaria la presencia de una muestra que sirva de referencia y validacin para los estudios realizados. En Geoqumica estas muestras son conocidas como materiales de referencia, siendo los ms comunes: \"North American Shale Composite\" y \"Post Arquean Australian Shale\"((Asiedu,, 22000000)). A pesar que estas muestras han dado buenos resultados, como en todo anlisis qumico lo que se busca es la mayor cercana entre la muestra de referencia a utilizar y el objeto de estudio, por lo que no constituyen una comparacin idnea, pues corresponden a mbitos geolgicos y geoqumicos, diferentes al venezolano ((Gromet,, L..,,11998844)). Por tanto sera mejor si se contara con un material de referencias con caractersticas geolgica y geoqumicas venezolanas, problema a travs del cual surge el objetivo principal de este trabajo y que se encuentra delimitado como la elaboracin y caracterizacin preliminar de un material de referencia, hasta ahora intralaboratorio, a partir de muestras de arcillitas de la Cuenca Central de Falcn, para su uso en futuros anlisis geoqumicos en Venezuela, con una connotacin geolgica que la favorece.Para ello, fueron colectadas las rocas arcillitas de las unidades sedimentarias oligo-miocnicas, de la Cuenca de Falcn y fueron pulverizadas, tamizadas (malla 220 (65m)); y homogenizadas por un proceso de cuarteo para llegar a lo que ser la Muestra Compuesta de Arcillitas de Falcn (MCAF), con aproximadamente 22 kilos de material disponible para su anlisis.Dicho anlisis fue realizado segn los criterios establecidos por institutos especializados en la certificacin de materiales de referencia ((Kane,, 11999977)): Homogeneidad y Trazabilidad, especficamente homogeneidad para este estudio, separada en homogeneidad fsica y qumica ((Bernal et al.. 22000044)) y cuyos valores propuestos son los que siguen a continuacin: para la homogeneidad fsica fue determinada la distribucin granulomtrica de la muestra mediante el mtodo del pipeteo (Galehouse,, 11997711en Carver,, 11997711), para lo cual se obtiene que 89 %20% en peso de la muestra se encuentra entre 62,5-7,8 m (limo grueso a limo fino). La homogeneidad qumica esta representada en funcin de cada uno de los anlisis realizados a la muestra, para esta ocasin: Humedad (H2O+) (Potts,, 22000055) con un valor del 3,05%0,08%, prdida al rojo con un 10,3 0,2% y fsforo en base seca (P2O5) de 0,16%  0,01%.Todos los valores reportados han sido evaluados mediante las pruebas estadsticas Shapiro-Wilks, F de una cola y Kolmogorov-Smirnov ((Davis,, 11997733)), para un intervalo de confianza del 99%, lo que permite decir que la muestra MCAF es fsicamente homognea y qumicamente homogenea para los atributos analizados, y por tanto puede ser utilizado como un material de referencia intralaboratorio para anlisis geoqumicos futuros.','2009-02-17','muestra compuesta, cuenca de falcn, material de referencia, arcillitas',4,1,1,1,1,'2013-09-17 08:22:43','2013-09-17 08:22:43','Documento_66.pdf','application/pdf',1984896,'2013-09-17 08:22:43',20,0,127,'COMPLETO'),(67,'ESTUDIO DE LOS COMPLEJOS DE VANADIO ((IV)) Y METIONINA POR MEDIO DE MEDIDAS DE EMF((H)) ((KCl 33..00M,, 2255 C))','Se estudi el sistema H+ - V(IV) - metionina (HC) por medio de medidas de emf(H) en KCl 3.0 M a 25 C. El anlisis de los datos empleando el programa computacional de mnimos cuadrados generalizados LETAGROP indica la formacin de las especies [HVOC]2+, [VOC]+, [H2VOC2]2+ y VOC2, cuyas constantes de estabilidad fueron determinadas.','2009-04-15','Formacin de complejos, metionina, Vanadio (IV), medidas de emf(H), qumica de coordinacin',6,1,1,1,1,'2013-09-17 08:22:46','2013-09-17 08:22:46','Documento_67.pdf','application/pdf',7296088,'2013-09-17 08:22:46',20,0,137,'COMPLETO'),(68,'Estudio de los complejos de Vanadio ((V)) con la Valina,, empleando medidas de fuerzas electromotrices ((2255 C,, KCl 33..00 M))','En el presente trabajo se estudiaron los sistemas:H+ - valina (HC) H+ - VO2+ - HCmediante medidas de fuerzas electromotrices emf(H) a 25C y en KCl 3.0 M como medio inico inerte.El anlisis de los datos experimentales de cada sistema se realiz mediante el programa de mnimos cuadrados LETAGROP, obtenindose los siguientes valores de pKa para la valina y las constantes de estabilidad bPqrde los complejos (P, q, r), segn las siguientes reacciones generales: Sistema H++ -- valina Reaccinnlogbp00rHC + H+ DH2C+2.71(4)HCD C- + H+-9.97(5)s (thc)0.042ReaccinnpKaHC + H+ DH2C+2.71(4)HCD C- + H+9.97(5) Sistema H++ -- VO22++ -- valinapH+ + q VO2++ r C- D Hp ( VO2)q (C)rq-r+p Especiebp,,q,,rLog bp,,q,,r [HVO2C] +1,1,111.7(3)11.8(2)11.8(2)11.8(3)VO2C0,1,110.23(3)10.26(4)10.30 (4)10.31(4)thB 0.036 thC 0.019 thBf 0.054 thCf 0.11','2009-04-23','VanadioAminoacidoComplejosValina',6,1,1,1,1,'2013-09-17 08:22:49','2013-09-17 08:22:49','Documento_68.pdf','application/pdf',0,'2013-09-17 08:22:49',18,0,0,'INCOMPLETO'),(69,'Anlisis de biomarcadores en intervalos lutticos del nccleo QG--2299S de edad Terciaria,, DE LA Cuenca Oriental de Venezuela','RESUMENEl presente estudio correspondi al anlisis de biomarcadores en muestras pertenecientes a la Cuenca Oriental de Venezuela, especficamente el pozo QG-29S, entre las profundidades 3761,9 a 3794,5 metros (12343 a 12449 pies), ya que stas posean la concentracin de carbono orgnico total (COT) necesario para ser consideradas como posibles rocas fuente (>2%). Por lo tanto se realiz este estudio para determinar otros factores necesarios para que una roca pueda generar hidrocarburos, como lo son el tipo de materia orgnica y la etapa de madurez que ha alcanzado dicha roca. De esta manera se realiz la extraccin del bitumen; posteriormente se separaron las distintas fracciones por el mtodo de separacin SARA y por ltimo se llev a cabo el anlisis de biomarcadores y marcadores aromticos por medio del anlisis de CG-EM. Las muestras estudiadas pueden ser divididas en dos grupos, en funcin de su litologa; teniendo as 4 lutitas (7,21,22,23,27) y 2 areniscas intercalas con lutitas (13 y 17). Los resultados obtenidos indican que el tipo de materia orgnica presente en todas las muestras es del tipo transicional con mayor aporte marino, por lo que se tiene un quergeno tipo II en stas. Mientras que la materia orgnica presente en las areniscas intercalas con lutitas es el producto tanto del bitumen presente en las fracciones lutticas como, de la materia orgnica soluble (MOS) acumulada en las fracciones arenosas, producto de la migracin del bitumen. En cuanto a las condiciones paleoambientales de sedimentacin en la mayoria de las muestras analizadas se infiere que fueron entre subxicas a disxicas, excepto por una muestra donde las condiciones fueron ms reductoras (21). Por ltimo el grado de madurez en que se encuentran las muestras corresponde a etapas temprana de catagnesis, donde hay generacin de hidrocarburos pero en muy baja proporcin (Ro 0,7-0.8%). En funcin de lo mencionado se concluye que los intervalos lutticos estudiados poseen tanto la cantidad necesaria de carbono orgnico, como el tipo de materia orgnica y la madurez necesaria para ser considerados como rocas fuente del petrleo que se encuentra activas. Mientras que las areniscas tienen la capacidad de acumular los hidrocarburos generados por los intervalos lutticos.','2009-02-17','Biomarcadores, Rocas fuente, Rocas madre, terciario, Cuenca Oriental',4,1,1,1,1,'2013-09-17 08:22:50','2013-09-17 08:22:50','Documento_69.pdf','application/pdf',2962074,'2013-09-17 08:22:50',17,0,136,'COMPLETO'),(70,'Estudio del contenido de elementos traza en cabello y orina de nios con Sndrome de Espectro Autista.','Se determin la concentracin de elementos traza (Zn, Cu, Cr, Se, Pb, Cd y Hg) en muestras de cabello y orina de nios con Sndrome de Espectro Autista, con edades comprendidas entre 2 y 15 aos, pertenecientes al Centro Integral para la Estimulacin Cognitiva y Comunicativa (CIPECC). Previo al anlisis de las muestras, se optimiz la concentracin del agente reductor (NaBH4) y la influencia de diferentes cidos transportadores (HNO3  HCl), para la determinacin de Hg total por CV-AAS. Los resultados obtenidos arrojaron que la concentracin ptima de reductor fue 0,2% p/v de NaBH4 y que el empleo de HCl como cido transportador produce un aumento en la sensibilidad de la tcnica. Tambin se optimizaron los tiempos de lavado de las muestras de cabello con acetona y EDTA para la determinacin de Cd y Hg, obtenindose finalmente, porcentajes de remocin de aproximadamente 76% y 82% para Cd y Hg, respectivamente. Por tal motivo, los datos que deriven del anlisis de estos elementos en cabello, incluirn un error adicional que dependern de la exposicin del individuo a estos metales. Asimismo, se estudiaron posibles problemas de adsorcin de Hg al utilizar material de plstico para el anlisis de cabello, encontrndose que stos no adsorben mercurio y pueden ser utilizados de manera confiable. En total se analizaron 29 muestras de orina y 31 muestras de cabello de nios autistas. La determinacin de los elementos Zn, Cu, Cr, Se, Pb y Cd, se realiz mediante espectrometra de emisin atmica con plasma inductivamente acoplado (ICP-OES) y la concentracin de Hg total fue determinada por espectrometra de absorcin atmica con generacin de vapor fro (CV-AAS). Las metodologas de anlisis empleadas fueron validadas empleando para algunos elementos el factor de recuperacin, partiendo de estndares puros de cada elemento, y para otros se utiliz material certificado apropiado. Los datos obtenidos fueron tratados empleando el paquete Statgraphic version 5.0 para Windows. Para las muestras de orina, las concentraciones de Zn y Cr en nios de Espectro Autista mostraron niveles de normales a bajos, para Cu y Se, las medianas presentaron niveles normales. Metales txicos como Pb, Cd y Hg, se mantuvieron siempre por debajo de los valores umbrales. Se compar la carga metlica, liberadas por va urinaria, del grupo autista con la poblacin control, encontrndose que existe cierta tendencia por parte de los primeros a excretar cantidades menores de Zn, Cr y Se. En el caso del Hg, la tendencia es inversa, los nios sanos lo liberan en mayores proporciones, adems, en nios autistas se observ que la liberacin de Hg aumenta a medida que disminuye la severidad del Sndrome. Se hallaron adems, correlaciones positivas para la excrecin de metales en orina, entre ellas: Pb-Se, Pb-Zn, Hg-Zn, Cu-Zn, Cu-Se y Cu-Pb; que pueden estar indicando la existencia de procesos metablicos o enzimticos afectados en el organismo de nios con autismo, capaces de generar dficits de Zn y retencin de Hg. As como tambin, indicios de que el Se presenta una funcin protectora hacia elementos como Cu y Pb que puede estar favoreciendo la formacin de complejos Se-Pb y Se-Cu que no son excretados por el cuerpo, generando as una menor liberacin de Pb por parte de nios de Espectro Autista. Los resultados obtenidos por el anlisis de orina, concuerdan con teoras propuestas en estudios previos, que asocian la menor excrecin de Hg y Pb en nios de Espectro autista a dos posibles causas, afecciones en protenas encargadas de la detoxificacin del organismo y la capacidad del Se para formar complejos con Cu, Pb y/o Hg. En el caso del cabello, la informacin adquirida fue muy limitada, observndose niveles relativamente normales para todos los elementos analizados.','2009-04-22','Autismo, metales, cabello, orina',6,1,1,1,1,'2013-09-17 08:22:51','2013-09-17 08:22:51','Documento_70.pdf','application/pdf',0,'2013-09-17 08:22:51',20,0,0,'INCOMPLETO'),(71,'Anlisis y algoritmos para el tratamiento de datos de olas.','{}','2009-04-28','MATLAB, WAFO, OLAS, ALGORITMOS, CDIP.',5,1,1,1,1,'2013-09-17 08:22:53','2013-09-17 08:22:53','Documento_71.pdf','application/pdf',2278169,'2013-09-17 08:22:53',20,0,118,'COMPLETO'),(72,'Determinacin de torio y uranio por espectrometra gamma en minerales pesados de sedimentos del ro Arizo, estado Bolvar, Venezuela','{}','2009-04-28','{}',4,1,1,1,1,'2013-09-17 08:22:55','2013-09-17 08:22:55','Documento_72.pdf','application/pdf',0,'2013-09-17 08:22:55',20,0,0,'INCOMPLETO'),(73,'ESTUDIO DE LA GENERACINN DE COLOR CARAMELO EN SISTEMAS GLUCOSA--FRUCTOSA Y AMONAACO','El color caramelo es un colorante aplicable en bebidas malteadas. El objetivo de este proyecto es el estudio de los factores que afectan la formacin de color tales como aw, RM sacarosa/nitrgeno, pH y temperatura, para ello se optimiz la formacin de azcares reductoras, se medi HMF y 4-metil-imidazol. Se determin la concentracin de nitrgeno libre, determinacin de pesos moleculares y aislamiento de compuestos aromticos la metodologa fue: para la formacin de color se hicieron medidas de absorbancia y el factor respuesta fue intensidad de color EBC, se hizo un seguimiento del precursor HMF, 4- metilimidazol y optimizacin de azcares reductoras por CLAR, pesos moleculares por electroforesis y los compuestos aromticos por GM, los resultados fueron los siguientes: Mayor porcentaje de azcares reductoras a los diez minutos de inversin. La aw dio un efecto significativo para las tres condiciones de pH de estudio (10,650,07, 7,060,08 y 5,060,05), se obtuvo un mximo de VCm mientras se vari la aw del sistema, a menor pH la mayor VCm se encontr a mayor aw La intensidad de oscurecimiento para aquellas reacciones con aw >= a la optima fueron aumentando progresivamente, mientras que para aquellas reacciones con aw < a la optima la formacin de color parece detenerse luego de las primeras horas de reaccin. Para sistemas de pH 7,060,08 y 5,060,05, se observ una solidificacin despus de 7 horas de reaccin. Solo en sistemas de pH 10,650,07 se obtuvieron altos valores de intensidad de color. La VCm es mayor para pHs 7,060,08 y 5,060,05. En los sistemas de pH 7,060,08 y 5,060,05 se obtiene una mayor Vawm. A mayor RM sacarosa/nitrgeno la intensidad de color es mayor. Disminuir la RM sacarosa/nitrgeno a condiciones de pHs 7,060,08 y 5,060,05 conduce a una formacin de slidos en un mayor tiempo de reaccin, al igual que disminuir la temperatura. La Vawm para diferentes RM sacarosa/nitrgeno a pH 10,650,07 es diferente, mientras que. La Vawm para diferentes RM sacarosa/nitrgeno a pH 7,060,08 y 5,060,05 es igual. Una mayor temperatura produce mayor intensidad de color, para 15C aumentados a condiciones de pH 10,650,07 se obtuvo una intensidad de color 3 veces mayor y para condiciones de pH 7,060,08 y 5,060,05 se obtuvo una intensidad de color 4 veces mayor. Una mayor temperatura bajo las condiciones de estudio conlleva a una Vawm entre 2 y 3 veces mayor. A condiciones de pH 7,060,08 y 5,060,05 el consumo de nitrgeno es incompleto. La formacin de HMF se favorece a pHs bajos. La formacin de 4-metilImidazol se favorece a condiciones de pH bsico. El compuesto 4-metilimidazol se produce en las primeras horas de reaccin hasta llegar a un mximo luego del cual comienza a consumirse y disminuye en el tiempo. Los pesos moleculares tienen un rango de 10.000 y 75.000Da, el compuesto furfural es mayoritario a pHs menores, mientras que compuesto como c. actico, 1-hidroxi-acetona y el 2-acetil furano, aumentan con el pH, el 2-metil-benzofurano disminuye.','2009-04-21','Color caramelo, reaccin de Maillard, caramelizacin',6,1,1,1,1,'2013-09-17 08:22:56','2013-09-17 08:22:56','Documento_73.pdf','application/pdf',933863,'2013-09-17 08:22:56',19,0,90,'COMPLETO'),(74,'DISEOO DE UNA METODOLOGAA DE DETERMINACINN DE LA CLOROFILA ``A EN MUESTRAS DE AGUA,, MEDIANTE LA TCCNICA DE EXTRACCINN EN FASE SLLIDA Y FLUORESCENCIA MOLECULAR','En el siguiente estudio, se realiz una evaluacin preliminar en la aplicacin de la tcnica de extraccin en fase slida (SPE) y la fluorescencia molecular para la determinacin de clorofila ``a en muestras de agua, en la bsqueda de una metodologa alterna a la empleada rutinariamente. En una primera fase del estudio, se ensambl un prototipo de analizador de fluorescencia molecular con los siguientes componentes: un diodo de emisin de luz (LED) de longitud de onda de 410 nm, como fuente de excitacin, un espejo cncavo, una cubeta rectangular de vidrio de 1 cm de camino ptico, como contenedor de muestra y un fibra ptica multimodo para colectar y transportar la radiacin emitida. Para la deteccin de la seal analtica, se utiliz un espectrmetro compacto de deteccin simultnea, constituido por una red de difraccin de echelle como sistema dispersivo y un detector de estado slido (CCD). Se escogieron como condiciones ptimas del analizador, aquellas que suministraron el mximo valor de la seal de fluorescencia logrado desde la medicin de una disolucin estndar de clorofila ``a, obtenindose una intensidad de fluorescencia 3,9 veces mayor al colocar el espejo cncavo en equipo. El sistema ensamblado, es compacto y robusto. En una segunda fase del estudio, se evalu el dispositivo construido mediante el clculo de la figuras de merito analticas y un anlisis de reproducibilidad, obtenindose lmites de deteccin y cuantificacin de (0,0240,001) y (0,0800,004) mgL-1 respectivamente, y un coeficiente de variacin de 2% al medir tres dasconsecutivo. En esta etapa, se explor el uso de la extraccin en fase slida (SPE), para extraer y para pre-concentrar el analito en muestras de agua, para ello se evalu y se optimiz el volumen muestra a cargar en el cartuchos de SPE de fase estacionaria C-8 (octil), y el volumen etanol para su posterior elusin. Finalmente se realiz la cuantificacin de la clorofila ``a, mediante los mtodos de adicin estndar (ads). Los resultados obtenidos fueron comparados estadsticamente con los suministrados al utilizar protocolos estndar de determinacin de clorofila ``a','2009-04-16','CLOROFILA ``A,, EXTRACCINN EN FASE SLLIDA,, FLUORESCENCIA MOLECULAR',6,1,1,1,1,'2013-09-17 08:22:57','2013-09-17 08:22:57','Documento_74.pdf','application/pdf',0,'2013-09-17 08:22:57',19,0,0,'INCOMPLETO'),(75,'Desarrollo de un Sistema de Gestin Escolar usando elementos de Aplicaciones Web Enriquecidas','Para el desarrollo del Sistema de Gestin Escolar del C.E.A.P.U.C.V es indispensable el uso de herramientas que ayuden de manera verstil y eficaz en la construccin de esta aplicacin. Adicionalmente, se quiere que esta aplicacin tenga una interaccin con el usuario de la forma mas fluida posible, para ello se utilizaron elementos de Aplicaciones Web Enriquecidas ms especficamente el enfoque AJAX y todas las bondades que este ofrece.','2009-04-27','AJAX, Sistema, Web, Gestin Escolar, CEAPUCV',2,1,1,1,1,'2013-09-17 08:22:58','2013-09-17 08:22:58','Documento_75.pdf','application/pdf',437309,'2013-09-17 08:22:58',18,0,75,'COMPLETO'),(76,'Estudio de la transferencia de energa entre nanopartculas de oro generadas por ablacin lser y molculas fluorforas','Las nanopartculas de oro poseen propiedades nicas que han motivado el desarrollo de numerosos estudios que buscan implementar su uso para lograr mejoras en la deteccin de un gran nmero de enfermedades, clulas cancergenas, protenas y una amplia gama de biomolculas. Gracias a que presentan resonancia de plasmn superficial, son capaces de incrementar o disminuir la fluorescencia de molculas fluorforas que puedan estar en contacto con ellas. Esta caracterstica tiene potenciales aplicaciones en la deteccin de anticuerpos y antgenos. La generacin de nanopartculas de oro por ablacin lser es un mtodo fsico que permite obtener muestras de partculas en prcticamente cualquier solvente, sin modificar el entorno qumico del medio donde se estn generando, evitando as poner en peligro la estructura o actividad biolgica de las biomolculas que se deseen acoplar a ellas. En el presente trabajo se sintetizaron nanopartculas de oro utilizando la tcnica de generacin por ablacin lser en un medio estabilizante de SDS. Se vari la concentracin de estabilizante, la irradiancia utilizada y el tiempo de ablacin para estudiar su efecto sobre el dimetro, morfologa y el nmero de partculas. Se tomaron diferentes muestras de nanopartculas de oro y se pusieron en contacto con soluciones de fluorescena de diferentes concentraciones, observndose un fuerte quenching en la fluorescencia de dicha molcula. Se estudi la posibilidad de transferencia de energa nanopartcula-fluorforo y se estableci que el quenching observado es debido a la gran cercana entre las molculas de fluorforo y los ncleos metlicos de las nanopartculas de oro.','2009-04-24','Nanopartculas de oro, ablacin lser, fluorescencia, quenching, fluorescena',6,1,1,1,1,'2013-09-17 08:22:59','2013-09-17 08:22:59','Documento_76.pdf','application/pdf',2078832,'2013-09-17 08:22:59',20,0,101,'COMPLETO'),(77,'DESARROLLO DE UNA METODOLOGA PARA LA DETERMINACIN DE ELEMENTOS MINORITARIOS EN MUESTRAS GEOLGICAS POR ABLACIN LSER-ESPECTROMETRA DE MASAS CON PLASMA INDUCTIVAMENTE ACOPLADO.','La quimioestratigrafa es una herramienta que tiene como finalidad la definicin y caracterizacin geoqumica de unidades estratigrficas, la cual requiere el anlisis elemental de una gran volumen de muestra y analitos que abarcan concentraciones que van desde mayoritarios a ultra-trazas en una gran diversidad de matrices inorgnicas. Entre estas matrices nos encontramos con las rocas silicatadas, las cuales requieren de rigurosos tratamientos de muestras para su anlisis por los sistemas ICP. La ablacin lser con espectrometra de masas con plasma inductivamente acoplado (LA-ICP-MS), es una tcnica analtica que se ha empleado para dar respuestas al anlisis de muestras de compleja disolucin, capaz de analizar una gran cantidad de ellas generando resultados confiables con tratamientos mnimos, disminuyendo los costos y los tiempos de respuesta, por ello en este trabajo experimental fue desarrollada una metodologa que permite determinar metales a niveles de ppm en este tipo de rocas utilizando LA como sistema de introduccin de muestra al ICP-MS. Para este desarrollo se utiliz un lser ND:YAG con longitud de onda de 266 nm, y tiempo de pulso de 6 ns, usando como nico tratamiento de muestra la formacin de vidrios por fusin. Se estudiaron distintas mezclas de fundentes para la obtencin del vidrio ms homogneo y se concluy que la mezcla tetraborato-metaborato de litio (90-10%), con una dilucin de muestra de 10 veces, es la que proporciona los mejores resultados. Se obtuvieron seales ms intensas cuando se trabajaron con energas de lser de 2,7 mJ, dimetros de crter de 400 mm, y flujos de gas de arrastre de 1,2 L min-1. Se observ la formacin de un plasma en expansin a densidades de potencia mayores a los 0,5 GW cm-1, lo que origin cadas en las seales. Se midieron 4 elementos: Cu63, Zn66, Y89 y Zr90 realizando curvas de calibracin con estndares de referencia logrndose lmites de deteccin en un rango de 0,03 - 0,08 mg Kg-1. El mtodo fue validado con patrones certificados de referencia de rocas silicatadas. No se encontraron diferencias estadsticamente significativas entre los valores medidos con las curvas y los propuestos por los patrones demostrando la exactitud de los resultados. Se tomaron 3 rplicas por muestra y se obtuvieron desviaciones estndares relativas (DER) por debajo a 5%, adems de errores absolutos menores a un 7%. Se realizaron estudios de repetibilidad y reproducibilidad obtenindose desviaciones estndares relativas de 2 y 5% respectivamente.','2009-04-27','Ablacin lserEspectrometra de masas Muestras geolgicas LA-ICP-MS',6,1,1,1,1,'2013-09-17 08:23:00','2013-09-17 08:23:00','Documento_77.pdf','application/pdf',5079876,'2013-09-17 08:23:00',20,0,114,'COMPLETO'),(78,'SNTESIS DE COMPUESTOS CON POTENCIAL ACTIVIDAD ANTICHAGSICA.','Se hizo un estudio sobre la sntesis de un grupo de compuestos los cuales presentan en comn un ncleo naftalnico sustituido en las posiciones 2 y 4 por el grupo etoxicarbonil  carboxilo y metoxi, respectivamente, y cuya diferencia radica en el sustituyente localizado en la posicin 8. Dichas caractersticas le podran conferir actividad de inhibicin selectiva sobre enzimas presentes en el parsito Trypanosoma Cruzi pues estudios previos as lo sugieren. La va sinttica escogida consisti en hacer reaccionar el o-metilbenzaldehido (o-tolualdehido) con el reactivo de Wittig, 1-etoxicarbonil-2-t-Butoxicarboniletilentrifenilfosforano para dar el dister olefnico derivado que por posterior hidrlisis selectiva del ster terbutlico llev al cido-ster correspondiente. ste, mediante una ciclacin, aparentemente a travs de un ceteno conjugado, provee el 2-etoxicarbonil-4- acetoxi-8-metilnaftaleno, el cual por hidrlisis cida selectiva del acetilo y metilacin del hidroxilo fenlico derivado condujo al 2-etoxicarbonil-4- metoxi-8-metilnaftaleno; ste por bromacin con N- bromosuccinimida (NBS) dio el 2-etoxicarbonil-4-metoxi-8-bromometilnaftaleno, obtenindose as uno de los compuestos objetivo. Los subsiguientes compuestos se sintetizaron a partir del anterior por desplazamiento nucleoflico del bromo con tiourea y posterior hidrlisis con NaHCO3 para obtener el tiol derivado y el dmero disulfuro por hidrlisis controlada con NaOH y oxidacin con O2contenido en el aire partiendo de la misma sal.','2009-04-15','SNTESIS DE NAFTALENOS, ENFERMEDAD DE CHAGAS',6,1,1,1,2,'2013-09-17 08:23:03','2013-09-17 08:23:03','Documento_78.pdf','application/pdf',3296913,'2013-09-17 08:23:03',20,0,85,'COMPLETO'),(79,'Desarrollo y evaluacin de un mtodo alternativo para la determinacin de resistencia genotpica a drogas antirretrovirales en pacientes venezolanos VIH- 1 positivos','El VIH-1 es el agente etiolgico causante del Sndrome de Inmunodeficiencia Adquirida (SIDA); veinticinco aos despus de su aislamiento se considera que la infeccin por este virus ha pasado de una condicin fatal a una enfermedad crnica clnicamente manejable. Sin embargo, la aparicin y transmisin de cepas resistentes a los diferentes esquemas de tratamientos antirretrovirales (TAR) representa un problema en la consecucin de terapias asertivas que mejoren la calidad de vida de los pacientes. La aplicacin de mtodos de genotipificacin basados en estuches comerciales eleva an ms el costoso tratamiento para VIH-1, por lo que es necesario contar con un mtodo alternativo que sea ms asequible al mdico tratante y al paciente para detectar mutaciones que confieran resistencia en las etapas iniciales del TAR, e inclusive antes de su aplicacin, pudiendo prevenir as las fallas teraputicas. El objetivo del presente estudio fue desarrollar, normalizar y evaluar un mtodo para la determinacin de resistencia genotpica a drogas antirretrovirales (DARV) en pacientes venezolanos VIH-1+. La tcnica PCR MedPol permiti detectar la presencia de mutaciones que causan tanto resistencia primaria, como resistencia secundaria a las principales DARV suministradas en el pas, de manera relativamente rpida y sencilla, simplificando el diagnstico a travs de una sola PCR, por lo que representa una alternativa ms econmica que los mtodos comerciales. La evaluacin del mtodo normalizado se llev a cabo en una poblacin de 171 pacientes venezolanos VIH-1+, principalmente de la regin del Distrito Capital. 63 de ellos nunca haban recibido TAR (pacientes no tratados) y 108 haban recibido o estaban bajo algn esquema de TAR al menos una vez desde el diagnstico inicial de la infeccin (pacientes tratados). La poblacin fue principalmente de sexo masculino, con una edad promedio de 36 aos y el entorno de transmisin predominante fue hombres que tienen sexo con otros hombres (HSH). El 38 % (24/63) de la poblacin no tratada present mutaciones relacionadas a DARV, el 11 % (7/63) mutaciones que confieren resistencia primaria al menos a una DARV y el 16 % (10/63) mutaciones secundarias a Inhibidores de la Proteasa (IP). De los 7 pacientes que exhibieron mutaciones que confieren resistencia primaria, 3 las presentaron a Inhibidores Nuclesidos de la Transcriptasa Reversa (INTR), 3 a Inhibidores No Nuclesidos de la TR (INNTR) y 1 a IP. La prevalencia de mutaciones que confieren resistencia primaria a DARV de los pacientes no tratados sugiri la transmisin de cepas resistentes en la epidemia local. Futuros estudios permitiran establecer el costo-beneficio de implantar un programa de vigilancia y determinacin de resistencia genotpica en este tipo de pacientes, para lograr la deteccin temprana de mutaciones que confieren resistencia primaria y establecer TAR asertivos en las etapas iniciales de la infeccin. La distribucin de mutaciones relacionadas a DARV en la poblacin de pacientes tratados fue: 76 % (82/108) mutaciones que confieren algn tipo de resistencia, 50 % (54/108) mutaciones primarias que confieren resistencia a IP, 65 % (70/108) a INTR y 39 % (42/108) a INNTR. El 69 % (75/108) present mutaciones secundarias a IP. El 33 % (36/108) mostr mutaciones que confieren resistencia a INTR e INNTR y el 18 % (19/108) mutaciones que confieren resistencia a los tres tipos de inhibidores. Estos datos enfatizaron la importancia del uso racional de las DARV y sugirieron la necesidad de una adecuada informacin e instruccin al paciente para el seguimiento del TAR. El anlisis filogentico confirm que el subtipo del VIH- 1 circulante en aislados de poblaciones venezolanas fue el B (100%, 171/171), indicando la presencia de una epidemia local estable que permitira realizar estudios ms amplios de subtipificacin viral y prevalencia de resistencia genotpica a DARV, a fin de obtener un mejor conocimiento de las caractersticas especficas de la infeccin por VIH en nuestro entorno.','2009-01-14','VIH-1, resistencia genotpica, antirretrovirales',1,1,1,1,1,'2013-09-17 08:23:04','2013-09-17 08:23:04','Documento_79.pdf','application/pdf',1664763,'2013-09-17 08:23:04',20,0,135,'COMPLETO'),(80,'Anlisis geoqumico de sismoturbiditas holocenas en sedimentos lacustres del paleolago Los Zerpa,, Estado Mrida','Una de las regiones de los Andes de Mrida donde se evidencia, de manera significativa el desplazamiento dextral de las trazas activas del sistema de fallas de Bocon, as como la influencia de procesos climticos, se ubica en la zona central, en el valle morrnico Los Zerpa, donde por efecto de la deglaciacin se dieron las condiciones para la formacin de un lago intramorrnico, que posteriormente fue drenado por el desplazamiento lateral de la falla lo que permiti que los sedimentos lacustres sirvieran como registro paleossmico de la regin. Las sismoturbiditas son identificadas por varios criterios que involucran propiedades fsicas; una de las caractersticas distintivas es la presencia de un nivel arcilloso homogneo desarrollado anormalmente, denominado homogenita. Estudios realizados identificaron la presencia de dichas sismoturbiditas as como otros efectos de los sismos, en secuencias deltaicas y fluviales. En el presente estudio se realiz la caracterizacin geoqumica de dos sismoturbiditas identificadas en los sedimentos lacustres del paleolago Los Zerpa y se compar con facies turbidticas producto de otros procesos (factores climticos). A travs de la quimioestratigrafa se estableci una huella qumica propia de las sismoturbiditas, de esta manera se pudo comprender los procesos geoqumicos involucrados en su sedimentacin. Para esto se tom un ncleo de pared o \"canaleta\" de un afloramiento de sedimentos lacustres, de donde las turbiditas fueron extradas y luego disectadas cada 2 mm en continuo. Los atributos qumicos entre mayoritarios y trazas (Al2O3, SiO2, TiO2, Fe2O3, MnO, CaO, MgO, K2O, Na2O, Ba, Cu, Cr, Sr, Zn y Zr), fueron determinados por medio de espectroscopia de emisin con fuente de plasma ptico inductivamente acoplado (ICP-OES). Las asociaciones elementales fueron establecidas a travs de la estadstica multivariada, as se identificaron dos grupos representativos de facies de clsticos limo-arcillosos y facies de clsticos arenosos, indicativo de la energa de sedimentacin bajo la cual se depositaron las subfacies constituyentes, definidas para efectos de este estudio como facies; para cada sismoturbidita y turbidita climtica. Los perfiles de concentracin en conjunto con las curvas de acumulacin porcentual marcaron cambios producto de la delimitacin de las facies, as como cambios drsticos intrafacies, lo cual se relaciona con el mecanismo de depositacin que involucran traccin y decantacin de partculas ms finas por aumento de la densidad, bajo la influencia de factores externos. El registro de concentraciones relativamente altas de elementos como Zr y Ti en conjunto con el Cu, permitieron dilucidar que durante la sedimentacin de la facies homognea ocurre la depositacin de fases minerales por efecto de la equivalencia hidrulica lo que constata que la homogeneidad fsica observada en perfiles de distribucin de tamao de grano (facies homognea granulometra promedio < 3,6 m), donde predomina la fraccin de las arcillas, no es discriminante de la composicin mineralgica. As mismo el anlisis de agrupamiento restringido estableci quimiofacies y subquimiofacies que correlacionan a las sismoturbiditas entre s, sin embargo cada una present particularidades. Por otra parte su comparacin con la turbidita climtica, constat que efectivamente hay diferencias entre ambos procesos de sedimentacin, lo que permiti concretar que las sismoturbiditas son depsitos vinculados con la actividad sismotectnica y su origen no corresponde a procesos climticos.','2009-04-20','Quimioestratigrafa, sismoturbiditas, homogenita, turbidita climtica, paleolago Los Zerpa.',4,1,1,1,1,'2013-09-17 08:23:11','2013-09-17 08:23:11','Documento_80.pdf','application/pdf',1319165,'2013-09-17 08:23:11',20,0,83,'COMPLETO'),(81,'Representacinn de operadores que entrelazan al operador de traslacinn..','El conmutante de un operador lineal (o de un conjunto de operadores lineales) es el conjunto formado por los operadores que conmutan con el operador dado (o con cada uno de los operadores en el conjunto dado).El poder determinar el conmutante de un operador es parte importante de su estudio.En algunos casos es posible caracterizar de manera muy precisa el conmutante de un operador, entre estos casos destaca el conmutantedel operador de traslacin (shift) S de L 2 (m) en L2(m), donde m es una medida no negativa definida en la circunferencia unitaria T. El conmutante de este operador es el conjunto de los operadores de multiplicacin.Si H1 y H2 son espacios de Hilbert, Sk : Hk -> Hk (k=1,2), y A: H1 -> H2 son operadores lineales acotados, se dice que A entrelaza a S1 y S2si A S1 = S2 A.Este ltimo concepto generaliza la nocin de conmutacin, ya que la contiene como caso particular cuando H1 = H2 y S1 = S2.El caracterizar operadores que entrelazan determinados operadores es una tcnica muy usada y que tiene diversas aplicaciones enanlisis funcional, teora de operadores y anlisis armnico.Sean m1y m2 dos medidas no negativas en la circunferencia unitaria y sean Sk: L2(mk) -> L2(mk) (k=1,2) los correspondientes operadores de traslacin. Mischa Cotlar y Alejandra Maestripieri en su libro \"Representaciones de Fourier,, factorizacinn de operadores triangulares y operadores diferenciales cannnicos\", caracterizan a los operadores que entrelazan a S1 y S2.La idea fundamental del Trabajo Especial de Grado es el estudio deeste resultado de caracterizacin.','2009-01-28','Operadores que entrelazan, Conmutante de un operador, Operador traslacin, Operador multiplicacin por una funcin',5,1,1,1,1,'2013-09-17 08:23:18','2013-09-17 08:23:18','Documento_81.pdf','application/pdf',5375401,'2013-09-17 08:23:18',20,0,97,'COMPLETO'),(82,'Aceleracin del mtodo de Cimmino por Gradientes Conjugados','{}','2009-03-20','Cimmino, Gradientes Conjugados, Saddle Point, MAP',5,1,1,1,1,'2013-09-17 08:23:19','2013-09-17 08:23:19','Documento_82.pdf','application/pdf',4149688,'2013-09-17 08:23:19',20,0,115,'COMPLETO'),(83,'Estudios de variables que afectan la viscosidad de los crudos de la Faja Petrolfera del Orinoco, Venezuela','{}','2009-02-17','Viscosidad, Faja Petrolfera del Orinoco, Crudos',4,1,1,1,1,'2013-09-17 08:23:20','2013-09-17 08:23:20','Documento_83.pdf','application/pdf',985081,'2013-09-17 08:23:20',19,0,67,'COMPLETO'),(84,'SNNTESIS DE COMPLEJOS TIPO DIIMINA DE HIERRO ((II)) Y SEMIMETALOCENO DE TITANIO ((IV)) PARA SER USADOS COMO SISTEMAS HIBRIDO Y SOPORTE EN ARCILLA MONTMORILLONITA CLLCICA,, PARA LA SNNTESIS DE POLMMEROS Y COPOLMMEROS NANOCOMPOSITOS DE ETILENO,, ESTIRENO Y METIL METACRILATO..','En el presente trabajo se procedi a la sntesis y soporte del complejo 2,6- diacetil-piridina-bis(o-isopropilfenilimino) Hierro (II) bicloruro, en arcilla montmorillonita clcica modificada con una sal de amonio, a fin de estudiar su actividad cataltica en la sntesis de polmeros y copolmeros nanocompositos de etileno y metilmetacrilato. Se compar la actividad cataltica del complejo soportado y el mismo en fase homognea, as como estudios comparativos en los anlisis trmicos e inflamabilidad realizados a los polmeros obtenidos en ambas fases. El complejo diimina de Fe present una mayor actividad en fase homognea tanto para las homopolimerizaciones como para la reaccin de copolimerizacin. Los polmeros: polimetilmetacrilato y polietileno sintetizados en fase heterognea fueron caracterizados mediante Microscopa electrnica de transmisin, determinndose una mezcla de los tres estados nanocompositos tactode, intercalado y exfoliado en cada uno de ellos. El polietileno nanocomposito result con mayor estabilidad trmica que el obtenido en fase homognea, determinado a travs de Anlisis Termogravimtrico, as como una estructura con mayor tendencia cristalina segn los resultados del anlisis por Calorimetra diferencial de barrido y espectroscopa de Infrarrojo. Por otra parte, se determin por medio de anlisis de Resonancia Magntica nuclear de portones estructura atctica del PMMA obtenido en fase homognea, quien a su vez present una degradacin trmica ms lenta que la del PMMA obtenido con el catalizador soportado, segn el anlisis Termogravimtrico, sin embargo, el ndice de inflamabilidad de este ltimo, result mucho menor, determinado mediante pruebas a la llama de lminas del polmero. El copolmero etileno-MMA, result con una estructura diversa entre fracciones estadsticas (por las inserciones de PMMA) y otras cristalinas, lo que se deriv del anlisis DSC. Se logr la homopolimerizacin de poliestireno sindiotctico con el complejo semimetaloceno sintetizado (pentametil)- ciclopentadienil Titanio (IV) tricloruro; donde la tacticidad fue determinada por los anlisis de Calormetra diferencial de barrido y Resonancia magntica nuclear de protones y carbono 13. Adems fue posible, la obtencin del copolmero estireno-metilmetacrilato mediante el uso del catalizador hbrido \"diimina de Fe (II)- semimetaloceno Ti (IV)\" previamente sintetizados, estudindose la influencia de la temperatura en la actividad del catalizador hbrido, resultando una desactivacin del complejo diimina de Fe a 50C, obteniendo menos MMA en el copolmero. El copolmero S-MMA que fue separado en dos fracciones, soluble e insoluble en hexano, en la fraccin insoluble se determin mayor insercin de MMA en su estructura, segn lo determinado por Resonancia magntica nuclear de protones y carbono 13, adems empleando como tcnica de anlisis Calorimetra diferencial de barrido se determinaron fragmentos de PS sindiotctico, mientras que para la fraccin soluble solo se determin PS atctico.','2009-04-30','Polmeros nanocompositos, polimetilmetacrilato, polietileno, arcilla montmorillonita clcica, catalizadores tipo diimina, catalizadores semimetalocenos, catalizadores hbridos, copolmero estireno-metilmetacrilato.',6,1,1,1,1,'2013-09-17 08:23:21','2013-09-17 08:23:21','Documento_84.pdf','application/pdf',0,'2013-09-17 08:23:21',19,0,0,'INCOMPLETO'),(85,'Generalizacin del mtodo de proyecciones alternantes oblicuas al caso de una variedad lineal.','El mtodo de proyecciones alternantes oblicuas fue propuesto por L.Hernandez (2000) para hallar la solucin aproximada de problemas de punto de ensilladura en el cual la parte g del vector del lado derecho del sistema conformado por dos vectores ( f g ) Tera igual a cero. En este trabajo se generaliza este estudio para el caso g distinto de cero y se reformula el mtodo PAO adaptado a este caso. Se realizaron experimentos con los mtodos Uzawa, Barzilai Borwein y una versin adaptada al gradiente conjugado del mtodo de Uzawa precondicionados y sin precondicionar utilizando problemas reales de aplicacin para comprobar la efectividad de este mtodo en la prctica.','2009-05-05','Mtodo de proyecciones alternantes, Problemas de punto de ensilladura, Proyecciones oblicuas alternantes.',5,1,1,1,1,'2013-09-17 08:23:22','2013-09-17 08:23:22','Documento_85.pdf','application/pdf',1953108,'2013-09-17 08:23:22',20,0,148,'COMPLETO'),(86,'Estudio de la respuesta de geles polimricos a la radiacin ionizante mediente simulacin de la alteracin de su estructura con modelos de gases reticulares','{}','2009-04-28','{}',3,1,1,1,2,'2013-09-17 08:23:29','2013-09-17 08:23:29','Documento_86.pdf','application/pdf',3025759,'2013-09-17 08:23:29',18,0,128,'COMPLETO'),(87,'\"\"Efecto del Tamaoo de Partcula en las Propiedades ppticas y Elctricas de Sistemas Fotoelectroqumicos\"\"','En el trabajo especial de grado se realiz un estudio fotoelectroqumico bajo condiciones controladas superficialmente. La formacin electroqumica de partculas de CuO a partir de a electrodeposicin del elemento metlico permite controlar el proceso de nucleacin y crecimiento del mismo, modificando parmetros como la densidad de numero de ncleos y el radio. El anlisis porcentual de la relacin de carga de oxidacin - electrodeposicin al variar el radio y la densidad de numero de ncleos arroj que la oxidacin electroqumica bajo las condiciones de doble pulso en medio acido y 0,6 V en medio bsico, es un proceso de oxidacin superficial, el cual viene limitado por la pasivacin de los ncleos de cobre metlico. Los semiconductores poseen la capacidad de convertir la radiacin incidente sobre su superficie en electricidad. Una sensitizacin de estos dispositivos permiten un aumento en la capacidad de recepcin lumnica, y mayor eficiencia de conversin. El Fast Green, sensitizador, presenta una posicin relativa de energa de los orbitales HOMO-LUMO adecuada con respecto a la energa de la banda de valencia y conduccin del CuO. A travs, de un estudio de la constante de equilibrio de adsorcin - desorcin para el sistema Fast Green-CuO y Fast Green-Carbono vtreo se encontr que KCuO/KCV = 6,5 x 103, reflejando una mayor adsorcin del CuO con respecto a la superficie de carbono vtreo. El semiconductor p-CuO en condicin de oscuridad presenta corrientes andicas que aumentan exponencialmente al modificar el potencial del sistema, estas corrientes presentan una tendencia al incremento con el tamao de las partculas; mientras que el EFB, potencial de banda plana, es independiente de dichas variaciones. Se obtuvo EFB = 0,769 V vs. ESC. Bajo condiciones de iluminacin son observados dos fenmenos: el origen de corrientes catdicas y presencia de oscilaciones al reducirse fotoquimicamente el CuO superficial.','2009-04-27','SemicondutorCeldas FotoelectroquimicasNucleacinAdsorcion',6,1,1,1,1,'2013-09-17 08:23:30','2013-09-17 08:23:30','Documento_87.pdf','application/pdf',1169461,'2013-09-17 08:23:30',20,0,66,'COMPLETO'),(88,'SNNTESIS,, CARACTERIZACINN Y ESTUDIO DE LA REACTIVIDAD EN HDCl DE BPCs DEL SISTEMA Ni--Mo//Carbnn Activado..','RESUMEN El presente Trabajo titulado SNNTESIS,, CARACTERIZACINN Y ESTUDIO DE LA REACTIVIDAD EN HDCl DE BPCs DEL SISTEMA Ni--Mo//Carbnn Activado,,plantea el estudio de la reaccin de HDCl sobre una mezcla de Bifenilos Policlorados (Aroclor 1260) en un reactor de lecho fijo empacado, empleando catalizadores de Ni-Mo soportados sobre carbn activado. Se realizaron estudios sobre las propiedades estructurales del soporte. Se realiz la hodrodeclorinacin de la solucin de Aroclor 1260, utilizando 500ppm en bifenilos policlorados, en heptano y en aceite mineral (originalmente libre de BPCs), en ambos casos se obtiene como nico producto de reaccin benceno, se observo la desactivacin de los catalizadores, al aumentar el contenido metlico esto ocurre con mayor rapidez. Las conversiones obtenidas se encuentran entre 74% y 14% para la mezcla de BPCs en heptano y el aceite contaminado respectivamente. Las condiciones de reaccin fueron, una presin de H2 de 35 atm de 350 C de temperatura y 0.3 gramos de catalizador.','2009-04-16','BPCs, hidrodesclorinacion, aceite mineral, catalizadores NiMo/Carbn activado',6,1,1,1,1,'2013-09-17 08:23:31','2013-09-17 08:23:31','Documento_88.pdf','application/pdf',2326147,'2013-09-17 08:23:31',16,0,109,'COMPLETO'),(89,'DESARROLLO DE LMMINAS FLEXIBLES DE PARCHITA ((Passiflora edulisf..flavicarpa Degener)) ENRIQUECIDAS CON CALCIO..','RESUMEN..El objetivo de la presente investigacin fue desarrollar lminas flexibles de parchita Passiflora edulis var. flavicarpa Degener enriquecidas con calcio. Para ello se preseleccionaron tres formulaciones con 15, 20 y 25% de fructosa del total de azcar agregado para 20 y 40 0Brix. Las lminas de parchita se deshidrataron a 60 0C. A estas se les determin humedad, slidos solubles, pH y acidez total titulable y evaluacin sensorial, para luego seleccionar la formulacin final. A dicha formulacin se le determin la curva de secado a 45 y 60 0C con un contenido de 20 y 40 0Brix. Las lminas se elaboraron deshidratndolas a 45 y 60 0C hasta obtener una humedad entre 10 y 11%. Se le determinaron slidos solubles, pH, acidez total titulable, humedad, azcares, cenizas, calcio, compuestos fenlicos totales, pectina, aw, color y textura. Se realiz, adems, evaluacin sensorial con consumidores no entrenados. En los cuatro tratamientos finales la humedad fluctu entre 10,7 y 10,95%; los slidos solubles entre 32,7 y 38,5 0Brix para lminas de 20 0Brix, y 59,8 y 67,3 0Brix para lminas de 40 0Brix; la acidez entre 0,11 y 0,12% para lminas de 20 0Brix, y 0,03 y 0,04% para lminas de 40 0Brix; pH entre 3,26 y 3,87; azcares reductores entre 9,04 y 16,61% para lminas de 20 0Brix, y 9,88 y 17,45% para lminas de 40 0Brix; azcares no reductores entre 19,17 y 19,68% para lminas de 20 0Brix, y 31,03 y 59,06% para lminas de 40 0Brix; el contenido de calcio entre 331,62 y 495,63 ppm; una baja aw entre 0,533 y 0,556 para lminas de 20 0Brix, y 0,625 y 0,667 para lminas de 40 0Brix, y adems, ausencia en el recuento microbiolgico. Sensorialmente, los tratamientos con alto contenido de azcar tuvieron una mejor aceptabilidad, con una aceptacin promedio de 3 en una escala hednica de 3 puntos. Es posible elaborar lminas flexibles de parchita, nutritivas y de excelente calidad microbiolgica, con agradables caractersticas sensoriales, destacndose el aporte del calcio como ingrediente funcional.','2009-02-17','Laminas de parchita,,Passiflora edulisf..flavicarpa Degener,,Calcio..',1,1,1,1,1,'2013-09-17 08:23:33','2013-09-17 08:23:33','Documento_89.pdf','application/pdf',10495517,'2013-09-17 08:23:33',18,0,110,'COMPLETO'),(90,'Aprenda Token Ring: Sistema Didactico para la enseanza de la arquitectura de red Token Ring','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicacindenominada Aprenda Token Ring, la cual ser utilizada como apoyo en los cursosbsicos de redes. Aprenda Token Ringest basada en el estndar IEEE 802.5 y provee un conjunto de herramientas que permiten a los estudiantes del rea deRedes y Comunicaciones conocer el funcionamiento de la arquitectura de redToken Ring mediante simulaciones que muestran los procesos que se llevan acabo en este tipo de redes dependiendo de un evento particular como lo es lainsercin de una nueva estacin, la eliminacin de una estacin, la eliminacin demonitor activo, el envo de tramas, etc.El trabajo se inicia con un estudio terico de los aspectos ms relevantes delestndar IEEE 802.5. Durante la implementacin de la aplicacin, se utiliz unametodologa iterativa basada en las nuevas tendencias del modelo de desarrollogil que plantea la creacin de cada una de las herramientas de la aplicacin enuna iteracin del proceso que abarca las fases de Anlisis, Diseo,Implementacin y Pruebas.Aprenda Token Ringincorpora tambin un conjunto de utilidades que permite que el estudiante se familiarice con el tema, como lo son un glosario de trminosdonde se da una breve explicacin de la terminologa ms usada, una ayudadonde se explica cmo usar la aplicacin, un mdulo de evaluacin donde se mideel aprendizaje del usuario.El producto final junto a la documentacin de la investigacin sern ofrecidos a laEscuela de Computacin de la Facultad de Ciencias de la UCV, para que seautilizado por los profesores del rea de Redes y Comunicaciones, como apoyo enla enseanza de las redes Token Ring.','2009-02-11','Token Ring, Sistema Didctico, Topologa de Anillo, Redes,Simulador',2,1,1,1,1,'2013-09-17 08:23:34','2013-09-17 08:23:34','Documento_90.pdf','application/pdf',1771962,'2013-09-17 08:23:34',18,0,105,'COMPLETO'),(91,'Distribucinn de metales pesados entre quebrada Quintero y Altamira--Caracas empleando lquenes y bromeliceas como biomonitores de contaminacinn atmosfrica','En esta investigacin fueron empleados dos organismos biolgicos diferentes, los lquenes Pyxine sp. y bromeliceas Tillandsia recurvata como biomonitores de contaminacin atmosfrica. Estos organismos fueron tomados a lo largo de una transecta comprendida entre El vila (cercanas a quebrada Quintero con altura de aproximadamente 1200 m) hasta Plaza Altamira (890 m de altitud). La metodologa aplicada en la determinacin de los elementos en ambos organismos consisti en la pulverizacin del biomaterial con nitrgeno lquido para posterior digestin con HNO3 concentrado para Pyxine sp. y HCL (18%):HNO3 (65%) para Tillandsia recurvata, en bloque digestor a 110 C por 8 horas, filtrando el lquido y enrasndolo a 25 mL, posteriormente analizndolo por ICP-OES. Permitiendo registrar las concentraciones de Cd, Cr, Cu, Ni, Pb, V y Zn, excepto para Cd que estuvo por debajo del lmite de deteccin del equipo. Por otra parte, fue realizada una comparacin de dos mtodos de disolucin para Tillandsias recurvata, en la que el mtodo con HNO3 y por microondas digestor result muy efectivo. Para clasificar, comparar y agrupar los resultados de los anlisis qumicos obtenidos, fueron utilizados los anlisis multivariados. En el Anlisis de Varianza de dos factores fueron encontradas diferencias estadsticamente significativas en la acumulacin de los elementos entre lquenes Pyxine sp.. y bromeliceas Tillandsia recurvata. El Anlisis de residuales mostr la variacin de las concentraciones de los elementos en cada localidad a lo largo de la transecta. El Anlisis de Componentes Principales y de Cluster mostraron que los lquenes Pyxine sp. son mas eficientes en la acumulacin de los elementos Ni, Pb y V, mientras que las Tillandsias recurvata para los elementos Cr y Zn. Adicionalmente los resultados indicaron un incremento de la concentracin de los elementos respecto a otros estudios.','2009-02-17','Lquenes, Bromeliceas, contaminacin atmosfrica, aire, metales pesados, biomonitores, Caracas, Venezuela',4,1,1,1,1,'2013-09-17 08:23:36','2013-09-17 08:23:36','Documento_91.pdf','application/pdf',19228603,'2013-09-17 08:23:36',19,0,234,'COMPLETO'),(92,'Minera de Datos para la prediccin en series de tiempo: unaaplicacin a datos de trfico de voz y trfico de datos.','{}','2009-04-28','Mineria de Datos, KDD, Prediccin, Trfico, Telecomunicaciones',5,1,1,1,1,'2013-09-17 08:23:37','2013-09-17 08:23:37','Documento_92.pdf','application/pdf',2567660,'2013-09-17 08:23:37',20,0,105,'COMPLETO'),(93,'Estudio preliminar de la aplicacin de la espectroscopia de emisin atmica en plasmas inducidos por lser en el anlisis de metales en crudos venezolanos','En el presente trabajo se realiz un estudio preliminar de la aplicacin de la tcnica de espectroscopia de emisin atmica en plasmas inducidos por lser, en el anlisis cuantitativo de Vanadio y Nquel en crudos pesados. Como fuente de excitacin se utiliz el lser Nd: Yag operando a las longitudes de onda de 1064 y 532nm. Se encontr que la radiacin de 532nm (segundo armnico) ofrece mejores resultados en cuanto a reproducibilidad que 1064nm (longitud de onda fundamental). Por otra parte se optimizaron ciertas variables operacionales con el propsito de obtener seales intensas y reproducibles, entre las que se encuentran: tiempos de deteccin (delays), energa del lser y modalidades de impacto sobre la muestra (punto fijo o barrido). Se estudiaron dos (2) estrategias de calibracin: (a) Curva de Calibracin Externa: empleando patrones preparados a partir de compuestos inorgnicos de los metales, utilizando KCl como aglomerante . (b) Mtodo de Adicin Estndar: usando compuestos organometlicos (porfirinas). La calibracin externa no permiti una adecuada cuantificacin de los analitos debido a las diferencias de ablacin y excitacin de patrones y muestra (efecto matriz). Mientras que por Adicin Estndar se encuentran lneas de alta intensidad de emisin y gran reproducibilidad, lo que permiti la cuantificacin. Se obtuvo una concentracin de Vanadio de (555  72) ppm, la cual fue comparada con la tcnica convencional de Espectroscopia de Absorcin Atmica de llamas (EAA), obtenindose una concentracin de (477  2) ppm. El Nquel no pudo ser cuantificado, por la irreproducibilidad de sus lneas en todas las regiones espectrales, tomando en cuenta ciertas variaciones propias del lser (energa, posicin de observacin de la fibra ptica entre otros) y de deteccin.','2009-04-16','Ablacion Laser',6,1,1,1,1,'2013-09-17 08:23:39','2013-09-17 08:23:39','Documento_93.pdf','application/pdf',35531450,'2013-09-17 08:23:39',20,0,180,'COMPLETO'),(94,'\"SINTESIS DE LA P-DIOXANONA UTILIZANDO CATALIZADORES DE CROMO Y COBRE SOPORTADOS SOBRE ZEOLITA Y POLIMERIZACION DE ESTE MONOMERO\"','{}','2009-04-29','p-Dioxanona, Zeolita. Faujasita, Cromita de Cobre, Catalizadores Cobre, Catlizadores Cromo',6,1,1,1,1,'2013-09-17 08:24:11','2013-09-17 08:24:11','Documento_94.pdf','application/pdf',319747,'2013-09-17 08:24:11',20,0,38,'COMPLETO'),(95,'HERRAMIENTA DE APOYO PARA LA FORMULACIN DE PROYECTOS SOCIO-PRODUCTIVOS COMUNALES','A travs de este Trabajo Especial de Grado se construye un producto de software ue apoya la formulacin de proyectos socio-productivos comunales. Esta erramienta permite a las usuarias y usuarios, luego de la fase de estudio y iagnstico de la realidad comunal, poder convertir sus Ideas-Proyectos, elacionadas con actividades productivas, en un proyecto socio-productivo en s. sto a travs de la aplicacin de una metodologa para la formulacin de royectos y la generacin del mismo en formato digital.Se tom como propuesta piloto la metodologa diseada por el Banco de esarrollo de la Mujer, para financiar proyectos socio-productivos a mujeres de uestro pueblo, proveyndolas, de esta manera, de un instrumento para el anejo de dicha metodologa.La herramienta desarrollada es una aplicacin Web a la que pueden acceder las suarias a fin de presentar sus proyectos ante la institucin. As como tambin uede ser utilizada por cualquier internauta que desee orientarla hacia otros estinos, ya sea para fines slo de proyectos como para la consecucin de inanciamientos a travs de otros entes con competencia en la materia.','2009-04-17','Proyectos socio-productivos, Gobierno electrnico, herramienta WEB.',2,1,1,1,1,'2013-09-17 08:24:12','2013-09-17 08:24:12','Documento_95.pdf','application/pdf',440629,'2013-09-17 08:24:12',18,0,74,'COMPLETO'),(96,'La Curva de Lorenz y Sistema de Pearson: Propiedades y Aplicacin','{}','2009-04-28','Curva de Lorenz, Indice de Gini, Formas Funcionales, Sistema de Pearson.',5,1,1,1,2,'2013-09-17 08:24:14','2013-09-17 08:24:14','Documento_96.pdf','application/pdf',1181474,'2013-09-17 08:24:14',20,0,106,'COMPLETO'),(97,'ESTUDIO DE LOS COMPLEJOS DE VANADIO ((V)) Y METIONINA ((KCl 33..00M;; 2255C))','En el presente trabajo se estudi el sistema conformado por el vanadio (V) y la metionina (H+- V(V) - Met) y el sistema H+ - Metionina usando medidas potenciomtricas (H), y utilizando como medio inico KCl a una concentracin de 3.0M y a una temperatura de 25C.Para el sistema H+ - Metionina, se procedi a buscar los valores de pKa del aminocido mediante el programa de mnimos cuadrados generalizados LETAGROP, minimizando la funcin U = S (h - H)2 obteniendo los valores de pKa de 2.57(2) y 9.55(1).Con estos resultados se procedi al estudio del sistema H+ - vanadio(V) - metionina de manera similar al sistema anterior usando el programa LETAGROP, donde se obtuvieron las especies [HVO2C]+ y VO2C y sus constantes de formacin son b=9.27(5) y b=6.80 (7) respectivamente.','2009-04-23','Vanadio(V), Metionina, Formacin de Complejos, Medidas de emf(H), Qumica de Coordinacin, Equilibrios en Solucin',6,1,1,1,1,'2013-09-17 08:24:15','2013-09-17 08:24:15','Documento_97.pdf','application/pdf',3791707,'2013-09-17 08:24:15',19,0,205,'COMPLETO'),(98,'Bencilacin de compuestos aromticos con cloruro de bencilo sobre slidos mesoporosos CoSBA-15','En este Trabajo Espacial de Grado se sintetizaron tres slidos mesoporosos CoSBA-15, dos de ellos mediante la tcnica de impregnacin por humedad incipiente con 15 y 25% p/p de Co en el soporte y el otro a travs de sntesis directa con un 25% en peso del metal. Estos slidos se caracterizaron mediante tcnicas fisicoqumicas tales como Fisisorcin de N2 e Isotermas de Adsorcin (rea BET), Espectroscopa de Absorcin en el Infrarrojo, Difraccin de Rayos X, Reduccin a Temperatura Programada y Anlisis Qumico Elemental, obtenindose valores de propiedades texturales y estructurales tpicas para este tipo de slidos segn datos de investigaciones previas.El rea superficial especfica del soporte SBA-15 sintetizado exhibi un valor de 594 m2/g, el cual disminuye a medida que aumenta la carga del metal incorporado, una distribucin de tamao de poros estrecha centrada en 44  y un volumen de poro de 0,52 cm3/ g; caractersticas estas que lo hacen un buen material para la adsorcin en catlisis, y un espesor de pared de 55  que lo hace resistente a tratamientos trmicos e hidrotrmicos fuertes. Los perfiles de Rayos X sealan una estructura morfolgicamente ordenada tanto para el soporte como para los slidos CoSBA-15, observndose la fase a-espinela de Co3O4 para los slidos con Co preparados mediante impregnacin.Las pruebas catalticas para estos slidos se llevaron a cabo mediante la alquilacin Friedel-Crafts de benceno, tolueno, anisol, nitrobenceno, naftaleno y 8-hidroxiquinolina, empleando cloruro de bencilo como agente alquilante. Se realiz una reaccin patrn con la slice SBA-15 para determinar su posible actividad determinndose que este slido no posee actividad cataltica haca la reaccin. Al emplear los slidos CoSBA-15 se pudo constatar actividad cataltica, lo que indica que el Co es el responsable de la aparicin de productos, es decir, es el sitio activo en la reaccin.En lneas generales, no se observ mucha diferencia entre el desempeo cataltico de los tres slidos, puesto que los rendimientos de la reaccin fueron similares. Sin embargo, en algunos casos el rendimiento aument ligeramente mientras mayor era la carga de Co en el catalizador.Los compuestos aromticos activados hacia la alquilacin (anisol, tolueno) fueron los que presentaron mayores rendimientos de reaccin (hasta 57% para la reaccin con anisol), mientras que los de mediana activacin (benceno, naftaleno) fueron inferiores al 1%, y el sustrato desactivado (nitrobenceno) no reaccion. El compuesto 8-hidroxiquinolina tampoco present rendimiento alguno inclusive despus de 18 horas de reaccin.Un resultado muy interesante se puede destacar al utilizar los slidos CoSBA-15 en algunas de estas reacciones, es en relacin a los productos obtenidos, los cuales fueron todos monoalquilados. Este hecho es de gran ventaja ya que como se sabe la polialquilacin es una de las grandes limitaciones prcticas que sufren las alquilaciones Friedel-Crafts. Este comportamiento seala a los catalizadores CoSBA-15 como altamente selectivos en determinadas alquilaciones.Finalmente se llevaron a cabo las seis alquilaciones antes mencionadas sobre el slido AlCl3, el cual es conocido en la literatura como elcatalizador por excelencia para estas reacciones. Si bien es cierto que los rendimientos en este caso fueron superiores a los obtenidos con los slidos CoSBA-15, el trabajo prctico involucrado en las reacciones en fase heterognea es mucho menos engorroso que para el caso de la catlisis en fase homognea. Ejemplo de ello lo tenemos en la manipulacin, aislamiento del los productos de reaccin, re-uso de los catalizadores, desechos de reaccin y cantidad de catalizador utilizado, todo ello hace de la catlisis heterognea una posibilidad ms atractiva.','2009-05-04','Co, SBA-15, CoSBA-15, Tamices Moleculares Mesoporosos, Sustitucin Electroflica Aromtica, Alquilacin Friedel-Crafts.',6,1,1,1,1,'2013-09-17 08:24:16','2013-09-17 08:24:16','Documento_98.pdf','application/pdf',475725,'2013-09-17 08:24:16',20,0,70,'COMPLETO'),(99,'ESTUDIO BIOGEOQUMICO DEL EMBALSE SUATA DE ACUERDO AL CONTENIDO DE METALES PESADOS EN SUS SEDIMENTOS, AGUAS Y PECES','{}','2009-03-17','Estudio ambiental, sedimentos, peces, aguas, embalses.',6,1,1,1,1,'2013-09-17 08:24:17','2013-09-17 08:24:17','Documento_99.pdf','application/pdf',1483020,'2013-09-17 08:24:17',20,0,163,'COMPLETO'),(100,'Sntesis de Ferrias Cu-Co prepraradas por el Mtodo de Combustin.','{}','2009-04-27','Sntesis por el Mtodo Combustin Ferritas',3,1,1,1,1,'2013-09-17 08:24:19','2013-09-17 08:24:19','Documento_100.pdf','application/pdf',0,'2013-09-17 08:24:19',18,0,0,'INCOMPLETO'),(101,'Sntesis de Ferritas Ni-Co preparadas por Combustin','{}','2009-04-27','Sntesis por Combustn',3,1,1,1,1,'2013-09-17 08:24:20','2013-09-17 08:24:20','Documento_101.pdf','application/pdf',3194352,'2013-09-17 08:24:20',19,0,141,'COMPLETO'),(102,'DESPOLIMERIZACINN DE MEZCLA DE CARBONES VENEZOLANOS DE DISTINTO RANGO CON RESIDUOS PLSSTICOS EN PROPORCIONES VARIABLES ASISTIDA POR MEZCLAS DE SOLVENTES ORGNNICOS','A fin de evaluar el efecto de la adicin de polmeros sobre el rendimiento en la despolimerizacin de carbones de diferente rango en presencia de la mezcla NPM/Tetralina como solvente, se desarroll un diseo multifactorial que permiti corelacionar todas las variables presentes en la despolimerizacin. Se utilizaron dos carbones (Guasare y Cerro Pelado), dos polmeros (polipropileno y caucho), dosproporciones de mezcla (1:3 y 3:1). Adems, se ensay la presencia o no de una amina (m-fenilendiamina) como aditivo en el sistema. Se mantuvieron fijas la temperatura (250), el solvente (mezcla 1:1 v/v tetralina/ NMP) y el tiempo de ensayo (2 horas). Los resultados arrojaron que los mejores rendimientos de despolimerizacin se encontraban al emplear el sistema carbn de Cerro Pelado-caucho (41-51%). Todas las experiencias realizadas con polipropileno arrojaron rendimientos sustancialmente menores. Las mejores condiciones de despolimerizacin se presentan con el carbn de Cerro Pelado, utilizando caucho como polmero, en una proporcin 1:3, y en presencia de amina, de manera general, indicando que el rango de madurez del carbn est ejerciendo un efecto importante. Sin embargo, la tendencia observada para los sistemas carbn/polmero se mantuvo al emplear el carbn de Guasare. Dentro de los resultados se observa que el efecto de la proporcin empleada y la presencia de la amina estn regidos por el polmero empleado, siendo relevante la proporcin 1:3 carbn:polmero y la presencia de la amina al emplear el mejor polmero mencionado, caucho. De igual forma, al evaluar el efecto de sinergia del sistema carbn/polmero se obtuvo que la conjugacin carbn de Cerro Pelado/caucho es el sistema que mayor sinergia presenta (41-51%) en comparacin con los resultados tericos esperados (31-34%).','2008-12-12','Despolimerizacin de carbones, carbones venezolanos, residuos plsticos, solventes orgnicos',6,1,1,1,1,'2013-09-17 08:24:23','2013-09-17 08:24:23','Documento_102.pdf','application/pdf',571549,'2013-09-17 08:24:23',19,0,88,'COMPLETO'),(103,'COMPLEJOS DE VANADIO ((III)) Y FENILALANINA POR MEDIO DE MEDIDAS DE EMF ((H)) ((KCl 33..00 M,, 2255 C))','En el presente trabajo fueron estudiados los siguientes sistemas:  HH++ -- f-- alanina ((HC)) HH++ -- V33++ -- f--alanina por medio de medidas de fuerzas electromotrices emf(H) a 25 C y empleando KCl 3.0 M como medio inico inerte. Sistema H++--j--alanina El anlisis de los datos (empleando el programa LETAGROP) de este sistema arrojo los siguientes valores de pKa para la j-alanina. Valores de pKa de laj--alanina para este trabajo ((KCl 33..00 M,, 2255 C)).. EspeciespKaH2C+2.53(3)HC/ C-9.54(2)s(thC)0.031 Sistema H++-- V33++ --j-- alanina El anlisis de los datos de este sistema (empleando el programa LETAGROP y LETAGROP/FONDO) arrojo el siguiente modelo de especies con sus respectivas constantes de formacin. Constantes de equilibrio bpqr de los complejos ((p,, q,, r)) del sistema H++-- V33++ --j--alanina obtenidas en KCl 33..00 M a 2255 C,, segnn las reacciones p H++ ++ q V33++ ++ r C-- Hp++11((V))q((C))rp++q-- r EspeciesLog bpqr [HVC]3+15.18(7)15.15(5)15.19(5)15.18(5)[VC]2+10.4 (max= 10.8)10.6(2)10.1 (max= 10.8)10.5 (max= 10.8)[VC2]+17.7(2)17.4(1)17.7(2)17.7 (2)VC324.62(6)24.58(8)24.62(6)24.61(8)[H2VC3]2+34.28(5)34.16(6)34.29(5)34.27(7) [H3VC3]3+37.96(6)37.95(5)37.96(6)37.96(6)s(thB)0.113 s(thC) 0.028 s (thBf) 0.112 s(thcf) 0.050','2009-04-23','fenilalanina - vanadio III - complejos de vanadio - complejos de vanadio y fenilalanina',6,1,1,1,1,'2013-09-17 08:24:23','2013-09-17 08:24:23','Documento_103.pdf','application/pdf',2450968,'2013-09-17 08:24:23',18,0,130,'COMPLETO'),(104,'SNNTESIS DE POLMMEROS NANOCOMPOSITOS A PARTIR DE CATALIZADORES TIPO DIIMINA DE NIQUEL SOPORTADOS EN ARCILLA MONTMORILLONITA CLLCICA,, MODIFICADA CON UNA SAL DE AMINA CUATERNARIA..','Hoy en da, el objetivo de muchos laboratorios de investigacin contina siendo la sntesis de polmeros nanocomposito empleando diferentes catalizadores de metales de transicin tardos. En este trabajo se sintetiz el catalizador Diacetilbutil bis(2,4,6-trimetilfenil)imina de nquel (II) comparando su actividad cataltica con la del catalizador bis(acetil acetonato) nquel (II) comercial, en las homopolimerizaciones y copolimerizaciones del 1,3-butadieno y metilmetacrilato en fase homognea; adems se soportaron ambos catalizadores en una arcilla montmorillonita clcica, funcionalizada con una sal de amina cuaternaria, para comparar sus actividades en las homopolimerizaciones y copolimerizaciones de los mismos monmeros. Los resultados en fase homognea y heterognea muestran que ambos catalizadores presentaron mayor actividad cataltica al aumentar la relacin aluminio-nquel (Al/Ni); pero de igual forma al comparar ambos sistemas catalticos, el ms activo result ser el catalizador bis(acetil acetonato) nquel (II) comercial (en ambas fases). En la comparacin de los polmeros y copolmeros obtenidos, se observ que las propiedades trmicas (degradacin y temperatura de transicin vtrea) de los polmeros sintetizados en fase heterognea no mejoraron con respecto a la observada en los polmeros sintetizados en fase homognea; mientras que en la inflamabilidad el PMMA nanocomposito (fase heterognea) retard la inflamabilidad del material, con respecto al PMMA virgen (fase homognea). Por ltimo mediante difraccin de rayos X y microscopa electrnica de transmisin se logr confirmar la obtencin de nanocompositos de: polibutadieno, polimetilmetacrilato (con mezcla de exfoliacin e intercalacin) y de copolmero (BD:MMA) con mezcla de estados: tactode, intercalado y exfoliado.','2009-04-22','nanocompositos, montmorillonita, polibutadieno, polimetacrilato',6,1,1,1,1,'2013-09-17 08:24:24','2013-09-17 08:24:24','Documento_104.pdf','application/pdf',3227991,'2013-09-17 08:24:24',20,0,102,'COMPLETO'),(105,'Estudio de los elementos As, Cd, Cr, Hg, Pb asociados a laspartculas inhalables PM10, en el Valle de Caracas, Venezuela','El aumento de poblacin ha trado como consecuencia un incremento de actividades antropognicas que contribuyen con la produccin y emisin de partculas inhalables PM10, en este proyecto se usaron muestras de dichas partculas, que fueron recolectadas por el Ministerio del Ambiente entre los meses de abril a octubre de 2007 en las estaciones de Los Ruices, El Cementerio, Bello Campo y CORE 5 en la ciudad de Caracas con un equipo Partisol 2000H durante 24 horas en filtro de fibra de cuarzo (WHA), las cuales fueron analizadas empleando la norma COVENIN 2465 para Pb mediante la tcnica de espectroscopa de emisin atmica de plasma inductivamente acoplado de Argn (ICP/OES) y plasma de acoplamiento inductivo de masa (ICP/MS) para obtener concentraciones de As, Cd, Cr y Pb y para el Hg absorcin atmica con vapor fro (FIMS), la exactitud del mtodo del tratamiento de este tipo de muestras fueron evaluadas a traves del anlisis de estndares certificados de partculas atmosfricas (A3 SPEX CertiPerp y 2583 NIST) no encontrndose diferencias significativas, concluyendo que los resultados obtenidos con el anlisis de estas muestras de partculas PM10 estn por debajo de los lmites de concentracin permitidos por la NAAQS, EPA, 2008, inferindose que la fuente de emisin ms importantes es la densidad vehicular y en la poca de sequa los incendios en el parque nacional El vila.','2009-02-17','Partculas inhalables PM10 , PARTISOL 2000H, COVENIN 2465, elementos contaminantes',4,1,1,1,1,'2013-09-17 08:24:25','2013-09-17 08:24:25','Documento_105.pdf','application/pdf',2837797,'2013-09-17 08:24:25',18,0,130,'COMPLETO'),(106,'Generato: Generador de sitios Web administrativos basado en la ingeniera de reverso al modelo de datos','Generato es una aplicacin que recibe como entrada una base de datos, y a partir de esta, extrae sus metadatos. Con la informacin obtenida de los metadatos y junto con la informacin de configuracin del sitio suministrada por el usuario, se genera una aplicacin Web administrativa. El sistema construido, Generato, tiene como objetivo generar de forma automtica aplicaciones Web que se encarguen de gestionar la informacin contenida en una base de datos, contribuyendo as a minimizar el tiempo en el desarrollo de este tipo de aplicaciones. La gestin que realiza el sistema sobre las diferentes bases de datos incluye operaciones como: listar, buscar, insertar, modificar y eliminar cualquier informacin contenida en las tablas de la misma. En su versin inicial, DEUSWEB [Gonzlez, 2006], la creacin de los archivos fuentes del sitio generado es llevada a cabo por un solo motor implementado en la aplicacin: JSP / Servlets, el cual est constituido por un conjunto de procesadores. Para este trabajo especial de grado se propuso la implementacin y configuracin de un nuevo motor en la aplicacin de una forma fcil, y que sea de provecho en versiones sucesivas, as como la inclusin de nuevos Sistemas Manejadores de Base de Datos para gestionar las tablas que son generadas en el sitio web. El propsito de este Trabajo Especial de Grado consiste en desarrollar el sistema que permita la creacin de sitios web administrativos a partir de una base de datos existente, a travs del proceso de desarrollo de software: Scrum. El alcance de este desarrollo involucra generar cdigo PHP a partir de bases de datos MySQL, PostgreSQL, y Oracle, de igual forma combinando la generacin de cdigo JSP con ellas. Para la construccin de este sistema, se estudiaron herramientas que generan aplicaciones Web administrativas a partir de la ingeniera de reverso al modelo de datos, haciendo nfasis en la versin previa de la aplicacin. Del estudio de estas aplicaciones, surgieron las funcionalidades desarrolladas en el sistema. Sin embargo el sistema desarrollado incluye nuevas funcionalidades con respecto a los sistemas evaluados, por ejemplo: el manejo de las claves forneas y la manipulacin de los archivos almacenados en la base de datos, entre otros.','2009-04-30','Generador DEUSWEB Generato Aplicaciones Web Administrativas PHP JSP Ingenieria Reverso Modelo Base Datos Extensible Oracle Postgres MySQL Scrum Servlets Metadata Wizard Asistente',2,1,1,1,2,'2013-09-17 08:24:27','2013-09-17 08:24:27','Documento_106.pdf','application/pdf',0,'2013-09-17 08:24:27',20,0,0,'INCOMPLETO'),(107,'SISTEMA DE INFORMACION PARA LA MEDICIN Y ANLISIS DE LA PRESENCIA DE INFORMACIN EN LOS MEDIOS DE COMUNICACIN (APLICACIN: MEDIOS IMPRESOS)','El presente Trabajo Especial de grado tiene como finalidad organizar, acceder, procesar, recuperar y distribuir la informacin de un medio de comunicacin. Creando una herramienta tecnolgica que permita la medicin de la presentacin de la informacin suministrada por los distintos medios, para el subsecuente anlisis y comprensin de los cambios sociales, polticos y econmicos del entorno de inters.','2009-03-06','Comunicacin, Web, medios, prensa escrita, anlisis morfolgico, anlisis de contenido, investigar, organizar, analizar, ponderar, valorar.',2,1,1,1,1,'2013-09-17 08:24:27','2013-09-17 08:24:27','Documento_107.pdf','application/pdf',1231067,'2013-09-17 08:24:27',20,0,67,'COMPLETO'),(108,'ESTUDIO ESTADISTICO DE LAS FRECUENCIAS DE CONEXIONES PARA DECIDIR SI LAS REDES BIOLOGICAS SON LIBRES DE ESCALA','{}','2008-11-26','{}',5,1,1,1,1,'2013-09-17 08:24:28','2013-09-17 08:24:28','Documento_108.pdf','application/pdf',1335528,'2013-09-17 08:24:28',20,0,83,'COMPLETO'),(109,'Sntesis de 3-cianocumarinas sustituidas. Estudio de Modelaje Molecular.','En el siguiente trabajo se realiza la sntesis de 3-ciano-4-hidroxicumarina, este compuesto puede presentar equilibrio tautomrico donde se generan tres especies, una en su forma ceto y dos en forma enlica. Dicho equilibrio se estudi por mtodos computacionales de estructura electrnica con clculos semiempricos PM3 y la Teora de Funcional de Densidad (DFT) como mtodo, con funcionales B3LYP y mpw1pw91 con base de 6-31G (d), adems del estudio de algunas propiedades como cargas elctricas, densidad electrnica, potencial electrosttico, momento dipolar, energa de solvatacin, orbitales HOMO & LUMO, entre otras. Los clculos computacionales tambin se realizaron para los tautmeros sustituidos en la posicin 6 por un grupo amino y un grupo nitro. Se encontr que la formacin del diester cianoacetato de (2-acetil)fenilo necesario para la primera ruta se intent sintetizar por diferentes vas de esterificacin, notando que el peso del grupo acetil como atractor de electrones es bastante importante, por lo que la obtencin del compuesto de inters no fue satisfactoria. La transesterificacin del cianoacetato de etilo con el salicilato suministrando calor no produce la cumarina esperada, sin embargo se obtiene cido saliclico. En la segunda ruta de reaccin que se encuentra reportada en la literatura se obtiene un slido cuyo espectro de RMN 1H no satisfacen la estructura esperada. Los clculos computacionales muestran que el nivel de teora utilizado no es suficiente para determinar cual especie se encuentra preferentemente al calcular la constante de equilibrio, mientras que si se toma el calor de formacin para analizar la estabilidad los resultados se acercan ms a lo observado experimentalmente','2009-04-30','Cianocumarinas. Modelaje Molecular',6,1,1,1,1,'2013-09-17 08:24:29','2013-09-17 08:24:29','Documento_109.pdf','application/pdf',1100743,'2013-09-17 08:24:29',20,0,127,'COMPLETO'),(110,'ESTUDIO ANALITICO DEL COMPORTAMIENTO DE OSCILADORES ACOPLADOS Estudio Analtico delComportamiento de OsciladoresAcoplados','{}','2009-04-30','{}',5,1,1,1,1,'2013-09-17 08:24:31','2013-09-17 08:24:31','Documento_110.pdf','application/pdf',1571147,'2013-09-17 08:24:31',20,0,55,'COMPLETO'),(111,'Diseo y Evaluacin de un sistema colorimetrico para anlisis clnicos en celdas ELISA','La mayora de los anlisis clnicos que se realizan en la actualidad, se basan en ensayos colorimtricos, donde las propiedades pticas de la sustancia de inters, permiten su deteccin y posterior cuantificacin, mediante la aplicacin de la Ley de Beer. Para detectar la radiacin absorbida por el analito, suelen utilizarse espectrmetros sencillos, tales como fotocolormetros y/o equipos dispersivos altamente sofisticados, tales como espectrofotmetros o sistemas multicanal. Normalmente en este tipo de anlisis, se requiere procesar simultneamente una elevada cantidad de muestras, por tal razn se han desarrollado los denominados \"lectores de placas de ELISA\", que permiten medir en un solo paso hasta 96 muestras. Estos lectores presentan una alta sensibilidad y emplean sistemas mecnicos para desplazar la muestra y leer los 96 pozos uno a uno o en el mejor de los casos en grupos de 8. En el presente trabajo, se construy un analizador colorimtrico, para ser utilizado en la realizacin de algunos ensayos del tipo inmuno-enzimticos, ELISA. Este analizador tiene una fuente de radiacin que consiste de un arreglo plano de diodos de emisin de luz, leds, color blanco. El receptculo de la muestra es una placa ELISA de 96 micro-pozos y el sistema de deteccin es una cmara Web. El dispositivo se utiliz para determinar simultneamente la absorcin de luz sobre soluciones coloreadas, contenidas en los micro-pozos de la placa ELISA. Para el tratamiento de los datos, se dise un software que permite capturar las imgenes de la placa, digitalizarla y separarla en sus componentes RGB (rojo, verde y azul) e intensidad. De esta manera, se transforman las imgenes en superficies de respuesta de intensidades para cada color al que responde los filtros de la cmara, permitiendo de esta forma al compararlo con una referencia, calcular la absorbancia de un punto en particular de la imagen y as mediante una curva de calibracin obtener la concentracin de una determinada sustancia en ese punto. El sistema colorimtrico se compar con respecto a un espectrofotmetro convencional, se obtuvo una menor sensibilidad del primero respecto al segundo, no obstante los dems parmetros de calibracin, fueron similares en magnitud con lo cual se concluy que ambos sistemas presentaban una eficiencia analtica similar .Finalmente, se evalu la aplicacin del analizador, en la determinacin de las concentraciones de glucosa y de protenas en plasma de ratas. Se obtuvieron en los animales estudiados, niveles de glucosa en el intervalo de 750 a 3000 mg.L-1, mientras que para los protenas, los niveles fueron de 2.5 a 10 g/100 mL. Ambos resultados estn dentro de los niveles normales, para la glucosa 600 - 1000 mg.L-1 y para las protenas entre 6,4 - 8,3 g/100 mL-1, con estos valores los animales presentan ausencia en las patologas esperadas, esto es diabetes y enfermedades renales, respectivamente. Los resultados obtenidos fueron comparados con aquellos suministrados por un espectrmetro convencional, se encontr que los resultados no presentan diferencias significativas a un nivel de confianza del 95%, lo que indica una alta exactitud del sistema. Estos resultados permitieron validar la eficiencia del analizador diseado en la realizacin de estos anlisis clnicos en muestras reales. Por otro lado, se obtiene una precisin del 7-8% para el sistema colorimtrico y de 4-6% en el espectrmetro al determinar protenas; mientras que para la glucosa se obtuvo una precisin de 2-9% en el sistema propuesto.','2009-04-29','sistema colorimtrico, anlisis clnicos, celdas ELISA,muestras biologicas, glucosa, protenas.',6,1,1,1,1,'2013-09-17 08:24:31','2013-09-17 08:24:31','Documento_111.pdf','application/pdf',976505,'2013-09-17 08:24:31',20,0,75,'COMPLETO'),(112,'ESPECTROMETRAA GAMMA IN SITU DE ALTA RESOLUCINN SOBRE ZONAS PETROLERAS DEL ESTADO MONAGAS..','El siguiente trabajo presenta los resultados de una investigacin espectromtrica orientada a la posibilidad de verificar la existencia de anomalas en las concentraciones (actividad por unidad de masa) de radionclidos naturales pertenecientes a las series del U-238, Th-232 y el radionclido K-40 sobre zonas petroleras del estado Monagas, empleando para ello espectrometra gamma \"in situ\" con un detector de GeHp (Germanio hiperpuro). En primer lugar se verific la posibilidad de llevar a cabo la calibracin en eficiencia siguiendo la metodologa convencional desarrollada por Beck y cols. (Laboratorio de mediciones ambientales, Departamento de energa de los Estados Unidos), luego se verific la exactitud de las concentraciones determinadas con el programa ISOTOPIC en un campo de prueba comparndolas con las obtenidas mediante la calibracin en eficiencia (siguiendo la metodologa convencional) y el anlisis de muestras de suelo en laboratorio. Los sitios de medicin (estaciones) se ubicaron sobre una transecta de 40 puntos (separados por 250 m) que pasaba por dos pozos petroleros, uno productivo y el otro seco. Ambos pertenecientes al campo petrolero Amarilis. El tiempo de medicin en cada punto de la transecta fue de 1800 s. Se determin la variacin diurna en las tasas de conteo de los radionclidos de distintos radionclidos de las series del U-238, del Th-232 y el radionclido K-40, encontrando una tendencia a disminuir con la hora del da (variacin diurna en la tasa de conteo), no obstante dicha disminucin fue independiente de la energa del radionclido. Se determinaron las concentraciones de los radionclidos Pb-214 (lnea de 352 keV) y Bi-214 (lneas de 609 y 1765 keV) correspondientes a la serie del U-238, los radionclidos Pb-212 (lnea de 239 keV), Tl-208 (lnea de 2615 keV) y Ac-228 (lneas de 338 y 911 keV) correspondientes a la serie del Th-232 y el radionclido K-40 (1461 keV), para todos los puntos de la transecta. Se encontr que, de los radionclidos estudiados para la serie del U-238, slo la energa de 609 keV del Bi-214 present los menores valores de concentracin en las estaciones cercanas al pozo productivo, no obstante este resultado no necesariamente ha de ser atribuible a la presencia de hidrocarburos en el subsuelo. Se realiz un procedimiento denominado normalizacin al torio, con el fin de determinar la presencia o no de anomalas producidas por hidrocarburos en el subsuelo y suprimir cualquier efecto producido por la litologa de la superficie, la humedad del suelo, la presencia de vegetacin y la geometra de conteo. Los resultados obtenidos no mostraron el comportamiento esperado de acuerdo a la teora sobre la zona del pozo productivo (estacin 15), este resultado puede ser debido a las bajas concentraciones del radionclido K-40 observadas a lo largo de la transecta.','2009-04-27','Espectrometra gamma in situ, calibracin en eficiencia, normalizacin al torio',3,1,1,1,1,'2013-09-17 08:24:32','2013-09-17 08:24:32','Documento_112.pdf','application/pdf',2047505,'2013-09-17 08:24:32',20,0,116,'COMPLETO'),(113,'EFECTO DE LAS EMULSIONES ASFLTICAS Y LA ROCA FOSFRICA SOBRE LA ADSORCIN DE P EN SUELOS CIDOS DE SABANAS DE PEDOGNESIS CONTRASTANTES','En el presente trabajo se estableci un diseo experimental para estudiar los cambios de adsorcin de fsforo en presencia de roca fosfrica y emulsiones asflticas de rompimiento lento (catinica y aninica), en suelos cidos de pedognesis contrastantes ubicados en el estado Gurico (Estacin Experimental la Iguana). Se encontr que la presencia de las emulsiones afect notablemente la adsorcin de fosfato y este efecto dependi de la manera en la cual fue aadido el fosfato y la emulsin; sin embargo no se observaron diferencias en la disminucin de P, entre la emulsin catinica y la aninica. Por otra parte, la fertilizacin de los suelos junto a la aplicacin de las emulsiones con un perodo de incubacin de 10 das disminuyeron marcadamente la adsorcin de P, por la combinacin de efectos por parte de la roca fosfrica y las emulsiones. Es posible explicar las secuencias de adsorcin obtenidas tomando en consideracin que el efecto de la emulsin sobre la adsorcin del fosfato, no se debe a una simple competencia por los sitios activos de adsorcin, sino que hay en juego otros factores, como: el posible efecto bloqueador que ejercen los surfactantes cuando se desprenden de las emulsiones; el tiempo y la temperatura los cuales juegan un papel importante en el rompimiento de las emulsiones; la fertilizacin ya que por medio de ella se puede disminuir el aluminio y el hierro, los cuales retienen e inmovilizan el P que puede ser usado por las plantas. El fenmeno de adsorcin se estudi, obteniendo isotermas de adsorcin a partir de concentraciones bajas de P (0, 20, 40, 50, 60, 80 y 100) g/g. Al graficar la concentracin de P en el equilibrio contra el P adsorbido, la tendencia de los resultados experimentales se ajusto mejor al modelo de Langmuir, mostrando una disminucin en la cantidad de fsforo adsorbido con los tratamientos aplicados.','2009-04-14','Isotermas de adsorcin de Fosfro en suelos de pedognesis contrastantes. Emulsiones asflticas y roca fosfrica en suelos cidos de sabanas.',6,1,1,1,1,'2013-09-17 08:24:36','2013-09-17 08:24:36','Documento_113.pdf','application/pdf',2489996,'2013-09-17 08:24:36',20,0,149,'COMPLETO'),(114,'\"Activacin de Residuales y materiales carbonosos para promover la gasificacin cataltica\"','En el presente trabajo se estudia la posible activacin cataltica para gasificacin con vapor de agua de varios materiales carbonosos de bajo valor agregado que se obtienen en el circuito refinador de Venezuela. Se seleccionaron coques retardados identificados con P (coque Petrozuata) y A (coque Amuay), as como Flexicoque. Para el caso del Flexicoque, la muestra original se trat previamente para lograr la remocin selectiva de V y Ni, permitiendo una evaluacin del papel cataltico de estos metales por separado. Todas las muestras fueron sometidas a las diferentes reacciones parciales que conforman el proceso de gasificacin con vapor de agua, utilizado industrialmente a nivel mundial en pases como Estados Unidos, China, y Sudfrica, entre otros. Las reacciones estudiadas fueron: pirolisis, oxidacin, reaccin con dixido de carbono (reaccin de Bouduard), y propiamente la gasificacin con vapor de agua. Previamente, las muestras fueron caracterizadas mediante las tcnicas de ICP- OES, DRX, XPS y estudio textural, por medio de las cuales se obtuvo la composicin elemental de las muestras, distribucin de los metales en la superficie, y el rea superficial de microporo y volumen de poro. La interpretacin de los resultados analticos permiti alcanzar una correlacin fisicoqumica entre la composicin de los materiales carbonosos y la actividad. Las reacciones seleccionadas fueron llevadas a cabo principalmente en un termobalanza, utilizada como minireactor, acoplada a un cudruplo de masas, con la finalidad de monitorear los gases consumidos y producidos en el transcurso de las reacciones. Los productos gaseosos identificados fueron hidrgeno, metano, vapor de agua, monxido de carbono, oxgeno, y dixido de carbono. Los estudios permitieron demostrar la actividad cataltica de los metales presentes de manera indgena en las muestras carbonosas: vanadio para la reaccin de oxidacin y nquel en las reacciones de Bouduard y gasificacin con vapor de agua.','2009-03-20','cpque retardado, flexicoque, gasificacin, catalisis, vanadio y nquel.',6,1,1,1,1,'2013-09-17 08:24:38','2013-09-17 08:24:38','Documento_114.pdf','application/pdf',3306733,'2013-09-17 08:24:38',20,0,146,'COMPLETO'),(115,'DISEO DE UN EQUIPO DE DISPERSIN DINMICA DE LUZ PARA EL ESTUDIO DE LA AGREGACIN DE ASFALTENOS','En el presente trabajo especial de grado se dise, implement y optimiz un equipo de dispersin dinmica de luz para medir el tamao de nanopartculas y posteriormente se prob su funcionalidad en la deteccin del punto de floculacin y la medida de la cintica de agregacin de asfaltenos. Los resultados obtenidos demuestran que el equipo es capaz de monitorear la agregacin de los asfaltenos as como de medir su punto de floculacin. Es posible medir partculas que van desde los 50 nm hasta unos pocos mm. El equipo consta de un lser He-Ne (l = 632 nm) como fuente, un fotomultiplicador como detector, un amplificador de corriente, una tarjeta de adquisicin de datos, material ptico (espejos y polarizadores), una celda de 0,5 cm de espesor como contenedor de la muestra y un software creado para la adquisicin de los datos y clculo del tamao de las partculas. La optimizacin de las variables de medicin se realiz con partculas de Ltex cuyo dimetro nominal es de 150 nm. Las variables optimizadas fueron: Voltaje del fotomultiplicador, factor de ganancia del amplificador, frecuencia de muestreo, nmero de muestras e iteraciones. Se determin el dimetro de las partculas de ltex obtenindose un valor de tamao de partculas muy cercano al reportado por la compaa elaboradora de las mismas con un error relativo de 3,5%. Una vez optimizado el equipo se midieron soluciones de asfalteno Furrial en tolueno con distintos porcentajes de n-heptano, obtenindose que para una solucin de 500 ppm a un porcentaje de n-heptano de 75% aproximadamente se encuentra el punto de floculacin, mientras que para una solucin de 1000 ppm ste se encuentra entre 65-70% de n-heptano. Se midieron las soluciones de 500 ppm y 1000 ppm con un porcentaje de n-heptano igual 60% y 57% respectivamente en el tiempo, encontrndose un comportamiento similar a un tipo de agregacin conocida como \"agregacin limitada por reaccin\" para la solucin de 500 ppm, mientras que para la solucin de 1000 ppm se observ un comportamiento errtico el cual no puede describirse con ningn modelo reportado en la bibliografa.','2009-04-24','DLS , dispersin dinmica de luz, Floculacin, Asfaltenos, Cintica de agregacin, PCS, dynamic light scattering',6,1,1,1,1,'2013-09-17 08:24:39','2013-09-17 08:24:39','Documento_115.pdf','application/pdf',2591273,'2013-09-17 08:24:39',19,0,118,'COMPLETO'),(116,'Evaluar por medio de un mtodo qumico-enzimtico el efecto del consumo de carbohidratos simples y complejos sobre el contenido de glucosa, trehalosa y glucgeno en el gorgojo de arroz (Sitophilus oryzae)','En el presente trabajo, se estudi el efecto del consumo de carbohidratos complejos de diferente biodisponibilidad (almidn de maz y almidn de papa) y de un carbohidrato simple (glucosa), sobre el contenido de glucosa, trehalosa y glucgeno en el gorgojo de arroz (Sitophilus oryzae), mediante la utilizacin de un mtodo qumico-enzimtico. Adems se analiz cmo son afectadas las principales rutas metablicas en la presencia de estos carbohidratos, a travs de la composicin corporal. El mtodo-qumico enzimtico, permite cuantificar los niveles de glucosa, trehalosa y glucgeno en el gorgojo de arroz. Para la aplicacin del mtodo es necesario deshidratar y desgrasar a los insectos, con lo cual se asegura la inactivacin de las enzimas presentes en el homogeneizado. Se determin que cantidades de glucosa mayores a 0,11 mg, obtenidas por hidrlisis de trehalasa (0,1 U), deben ser diluidas para no subestimar el contenido de trehalosa y se requiere un mnimo 30 insectos. La ingesta de carbohidratos complejos (almidn de maz y almidn de papa), que difieren en su contenido de almidn resistente total, ocasionaron un aumento en el peso y en las reservas corporales (glucgeno y grasas), con relacin al control positivo (arveja). La ganancia fue mayor en insectos alimentados con almidn de maz (15,04  0,88 %; 0,233  0,032 % grasa y glucgeno, respectivamente). Indicando que el mayor contenido de almidn resistente total (almidn de papa), afecta la biodisponibilidad del almidn. El suministro de un carbohidrato simple (glucosa 5 %), disminuy el peso de los insectos un 5 % (respecto al control positivo), a pesar del acentuado decrecimiento en el contenido de grasa (8,83  1,63 %). Por otra parte, los resultados obtenidos para los insectos sometidos a ayuno y ayuno con suministro de agua, sugirieron que un incremento del agua corporal, parece favorecer al mejor aprovechamiento de las reservas del individuo. El contenido de glucosa y glucgeno en los insectos se vio influenciado por los diferentes carbohidratos suministrados. Sin embargo, no se altera el nivel de trehalosa en la hemolinfa del insecto. Esto podra indicar, que el mantenimiento de este disacrido es fundamental para el organismo. Los carbohidratos simples y complejos, promovieron la prdida de las protenas corporales con respecto al control positivo. Los anlisis estadsticos de correlaciones simples y de componentes principales, sealaron que el contenido de agua corporal presenta una correlacin negativa con el contenido de grasa corporal. Por otro lado, se obtuvo que las variables de glucosa, de glucgeno y de grasa presentaron correlaciones positivas entre ellas, siendo mayor para las dietas de almidn. Las variables de supervivencia, variacin de peso corporal y contenido de trehalosa, presentaron una correlacin positiva y las dietas de carbohidratos no influyen directamente sobre la variable trehalosa.','2009-04-28','Normal 0 MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso- padding-alt:0in 5.4pt 0in 5.4pt; mso-par',1,1,1,1,1,'2013-09-17 08:24:42','2013-09-17 08:24:42','Documento_116.pdf','application/pdf',2542359,'2013-09-17 08:24:42',20,0,124,'COMPLETO'),(117,'ESTUDIO DE LA INTERACCIN DEL ANTICUERPO FAB G17.12 CON LA MSP-119 DE PLASMODIUM VIVAX EMPLEANDO MODELADO MOLECULAR, SELECCIN Y SNTESIS DE LOS PPTIDOS INVOLUCRADOS EN LA INTERACCIN CON POSIBLE PROPIEDAD ANTIGNICA','En el presente Trabajo Especial de Grado se realiz un estudio de modelado molecular (Docking) del complejo de la protena MSP119 de P.vivax con la regin Fab del anticuerpo G17.12. Este complejo se construy a partir de la estructura cristalina del anticuerpo reportada por Pizarro y col.[38] para el complejo PfMSP119/FabG17.12 (pdb:1ob1) y la estructura de la MSP119 de P.vivax previamente modelada por homologa por Serrano y col.[36] El estudio docking se llev a cabo empleando el programa o software libre PatchDock, el cual realiza la aproximacin de cuerpo rgido para obtener las estructuras iniciales del complejo entre la PvMSP119 y el FabG17.12. Luego se emple el programa FireDock y RosettaDock para el refinamiento de las soluciones obtenidas. Este estudio revel que el complejo ms estable entre la PvMSP119 y el FabG17.12 tiene una energa de -336,33 KCal/mol, donde se establecen un total de ochenta y seis interacciones entre las especies involucradas. Basndonos en este modelo del complejo se determin que la regin de interaccin de la PvMSP119 se extiende desde Met 1 hasta Asp 9 y luego desde Asn 11 hasta Arg 20, en la regin N- Terminal; regin que tambin es similarmente reconocida en el complejo reportado para P.falciparum. Adicionalmente se observa otra regin de interaccin comprendida entre Ser 89 y Ser 91 y desde Glu 80 hasta Glu 84, en la regin C-Terminal. Dentro de las interacciones consideradas se enumeran las atractivas y repulsivas de van der Waals, la formacin de puentes de hidrgeno, solvatacin y un trmino que incluye la frecuencia estadstica de interaccin entre pares de aminocidos.De los fragmentos de interaccin determinados, se escogi para su sntesis un fragmento de diecisis aminocidos ubicado en la regin N-Terminal de la PvMSP119 que va desde la His 5 hasta la Arg 20 y que incluye un puente disulfuroentre la Cys 7 y la Cys 18 con la finalidad de obtener un pptido con una estructura tridimensional similar a la del fragmento correspondiente dentro de la protena. La sntesis se llev a cabo manualmente en fase slida por la estrategia Fmoc/tBu, empleando la resina cloruro de 2- clorotritilo y mezcla activante HOBT/ TBTU. El espectro de masas indic que la sntesis del pptido lineal se llev a cabo adecuadamente; sin embargo el proceso de oxidacin con yodo de las cistenas (protegidas con el grupo Acm) para dar lugar a la formacin del puente disulfuro, no ocurri como era esperado. Los resultados obtenidos en este trabajo nos permiten ampliar el estudio en la bsqueda de un antgeno o grupo de antgenos contra la infeccin causada por el Plasmodium vivax en pro de avanzar hacia una futura vacuna contra la Malaria.','2009-02-19','Malaria, PvMSP1(19), Plasmodium vivax, FabG17.12, Docking',6,1,1,1,1,'2013-09-17 08:24:42','2013-09-17 08:24:42','Documento_117.pdf','application/pdf',2353990,'2013-09-17 08:24:42',20,0,90,'COMPLETO'),(118,'El problema de Amplitud vs Offset como un polinomio de 5to grado','{}','2009-04-28','Reflexin y transmisin de ondas, problema de inversin, Ecuacin de Zoeppritz, AVO(Amplitud vs Offset)',5,1,1,1,1,'2013-09-17 08:24:43','2013-09-17 08:24:43','Documento_118.pdf','application/pdf',1589609,'2013-09-17 08:24:43',20,0,102,'COMPLETO'),(119,'DESARROLLO DE UNA METODOLOGA CROMATOGRFICA PARA DETERMINAR COMPUESTOS DE AZUFRE EN COMBUSTIBLES LIVIANOS EMPLEANDO HIDRGENO COMO GAS PORTADOR','La determinacin de azufre en combustibles livianos se ha venido realizando mediante el uso de tcnicas analticas tales como: Espectroscopia de Fluorescencia de rayos-X por onda dispersiva (ASTM D-2622) [3] y Espectroscopia de Fluorescencia Ultravioleta (ASTM D-5453)[2], sin embargo, stas metodologas slo permiten cuantificar el azufre total presente en el combustible. Desde hace varios aos en PDVSA-Intevep se emplea una metodologa capaz de determinar compuestos azufrados en combustibles livianos por cromatografa de gases con deteccin selectiva de azufre (adaptacin de la Norma ASTM D-5623) [4]. La misma proporciona la caracterizacin cromatogrfica de compuestos azufrados de hasta 15 tomos de carbono y no es capaz de identificar de manera individual las fracciones correspondientes a las familias de los tiofenos y benzotiofenos, debido a la poca separacin que presentan las huellas cromatogrficas en esta zona. El objetivo de este trabajo fue encontrar condiciones cromatogrficas que ofrecieran una resolucin y eficiencia tal que se puedieran identificar los constituyentes de las familias de los tiofenos y benzotiofenos. Para ello fue necesario sustituir el gas portador helio por hidrgeno , el cual, debido a sus propiedades fsicas, proporcion una mejor resolucin cromatogrfica. Esta modificacin permiti la identificacin de gran cantidad de componentes individuales mediante la comparacin con los tiempos de retencin de los patrones certificados de azufre en las familias, y, adicionalmente se ampli el nmero de compuestos identificados que eluyen de la columna. Aquellos compuestos de inters que no fue posible caracterizar mediante la comparacin con los tiempos de retencin de los patrones certificados, fueron estudiados a travs de la tcnica CG-EM, resultando un posible compuesto: el etil hexil sulfuro, asignado en una zona en especfico debido a la interferencia de los hidrocarburos, los cuales se encuentran en mayor proporcin que los compuestos azufrados, adems que dichas muestras contienen muchos compuestos azufrados que en muchos casos son ismeros. Al realizar el anlisis cuantitativo se demostr que los resultados obtenidos mediante el mtodo desarrollado son equivalentes a los obtenidos con las otras tcnicas (Espectroscopia de Fluorescencia de rayos-X por onda dispersiva[3] y Espectroscopia de Fluorescencia Ultravioleta [2] y azufre discriminado, que se lleva a cabo en PDVSA-Intevep).','2009-04-22','Cromatografa de gases, Quimiluminiscencia, Combustibles livianos, Nafta, Azufre',6,1,1,1,1,'2013-09-17 08:24:44','2013-09-17 08:24:44','Documento_119.pdf','application/pdf',2452072,'2013-09-17 08:24:44',20,0,157,'COMPLETO'),(120,'Estudio de los Complejos de Vanadio (III) y el Aminocido Leucina','{}','2009-04-29','Fuerzas ElectromotricesVanadio (III) LeucinaComplejosAminocido Equilibrios en Solucin',6,1,1,1,1,'2013-09-17 08:24:45','2013-09-17 08:24:45','Documento_120.pdf','application/pdf',1551038,'2013-09-17 08:24:45',19,0,93,'COMPLETO'),(121,'Determinacion de fenoles en agua por Cromatografa de Lquidos con preconcentracin en fase solida','UNIVERSIDAD CENTRAL DE VENEZUELAFACULTAD DE CIENCIASESCUELA DE QUIMICA \"DETERMINACIN DE FENOLES EN AGUA POR CROMATOGRAFA DE LQUIDOS CON PRECONCENTRACIN EN FASE SLIDA\"Trabajo Especial de Grado, para optar al Ttulo de Licenciado en Qumica. Autor: Cesar EspaolTutores: Dra. Nereida CarrinDr. Andrs Escalona RESUMEN En el desarrollo del estudio de los fenoles considerados por la EPA como contaminantes de remocin prioritaria en los cuerpos acuosos por Cromatografa de Lquidos de Alta Resolucin (HPLC) se determinaron las condiciones ptimas para la separacin, determinacin y cuantificacin de estos compuestos los cuales son elevadamente txicos. Adicionalmente se calcularon las figuras de mrito para la separacin cromatogrfica obteniendo resultados que permiten utilizar el mtodo cromatogrfico como una alternativa para la regulacin de lquidos que sean o vayan a ser descargados en forma directa o indirecta a ros, estuarios, lagos y embalses; y de esta forma realizar controles ambientales.Se realizaron estudios de la capacidad de adsorcin por alminas modificadas con surfactantes de estos fenoles utilizando este slido como material adsorbente en la extraccin en fase slida.La almina modificada fue evaluada con dos procedimientos para la adsorcin segn el volumen de solucin a utilizar encontrndose diferencias significativas entre ambos procedimientos. En el primer procedimiento se utilizaron jeringas para hacer pasar las soluciones por medio de presin positiva por el cartucho y en el segundo procedimiento se utiliz una bomba peristltica para este fin; siendo este ultimo procedimiento con el que se obtienen los resultados mas bajos de recuperacin (11%) comparados con las recuperaciones cercana al 100% encontradas en el primer procedimiento.Al no obtener los resultados esperados en las experiencias de preconcentracin se recomienda estudiar con mayor profundidad el segundo procedimiento con el fin de encontrar las condiciones de flujo que permitan una mayor adsorcin y recuperacin de los fenoles por el slido utilizado; y de esta forma encontrar las causas de la diferencia entre los resultados de ambos procedimientos utilizados en esta investigacin.','2009-04-28','Fenoles; Cromatograia de Liquidos (HPLC); alminas; Extraccion en fase slida',6,1,1,1,1,'2013-09-17 08:24:46','2013-09-17 08:24:46','Documento_121.pdf','application/pdf',2979219,'2013-09-17 08:24:46',20,0,146,'COMPLETO'),(122,'ESTUDIO FITOQUMICO DEL ALGA Penicillus capitatus Y EVALUACIN DE SU POSIBLE ACTIVIDAD ANTIINFLAMATORIA','Se realiz el estudi fotoqumico del alga verde Penicillus capitatus Lamarck, y la evaluacin de la actividad antiinflamatoria de los metabolitos secundarios aislados. Las tcnicas de separacin utilizadas fueron la cromatografa en capa fina y cromatografa en columna (utilizando slica gel y C18 como fases estacionarias). Para la identificacin de los metabolitos se utilizaron las tcnicas de resonancia magntica nuclear de 1H, 13C, DEPT, COSY y HSQC; espectrometra de masas y espectrometra de infrarrojo. A partir del extracto de hexano se lograron aislar, purificar e identificar 3 compuestos. Dos de ellos tipo sulfoquinovosil diacil glicerol (con cadenas lipdicas saturadas de 16 y 18 tomos de carbono), no reportados para algas verdes, y un compuesto nuevo tipo digalactoglicerolpido. Del extracto hidrometanlico se lograron aislar 2 compuestos: uno de tipo amino ster, y otro cuya data espectroscpica coincidi con los compuestos 3-hidroxi-propanoato de etilo y el cido 3-etoxi-propanico. El compuesto tipo sulfoquinovosil diacil glicerol con dos cadenas saturadas de 18 tomos de carbono, present una mayor actividad antiinflamatoria (IC50 = 43.62 mg/mL) debido a que inhibi la produccin de NO sin ser citotxico.','2009-04-28','Penicillus capitatus, Estudio Ftoqumico, Glicolpidos, Sulfoquinovosil diacil glicerol, digalactolpido, algas verdes',6,1,1,1,1,'2013-09-17 08:24:47','2013-09-17 08:24:47','Documento_122.pdf','application/pdf',0,'2013-09-17 08:24:47',19,0,0,'INCOMPLETO'),(123,'Caracterizacinn de Litofacies en el Pozo Saltarn 11A a travs de la determinacinn experimental de parmetros magnticos y su inferencia por medio de la tcnica de Redes Neuronales Difusas','RESUMEN En este trabajo, hemos estudiado el potencial del anlisis neuronal difuso en la inferencia de relaciones matemticas entre parmetros magnticos, tales como cociente S y susceptibilidad magntica. Hemos realizado medidas de susceptibilidad magntica (h) y del cociente S (S) en 134 muestras que abarcaron aproximadamente 670 metros de profundidad, en un pozo petrolero al este de Colombia, cuenca sedimentaria de los Llanos Orientales. Estas muestras contienen areniscas y limolitas de las formaciones Guayabo, Len y Carbonera (Mioceno Superior/Medio/Inferior y Plioceno Superior). El mtodo de redes neuronales difusas ha sido usado previamente para obtener otras propiedades petrofsicas, tales como permeabilidad a partir de valores experimentales de porosidad. Sin embargo, esta es la primera vez que esta tcnica se aplica a propiedades magnticas. Los resultados obtenidos de esta inferencia, fueron comparados e integrados con los valores experimentales. La diferencia entre los valores inferidos y los datos experimentales del cociente S, disminuye al alimentar la red neuronal difusa con datos previamente clasificados y agrupados segn: divisin operacional en campo, edades geolgicas (envolventes transgresivas) y por ambiente reductor. Esta tcnica adems nos ha permitido identificar cambios de las condiciones paleoambientales durante la formacin de la cuenca sedimentaria de los Llanos Orientales (Colombia).','2009-04-21','Palabras clave:: Redes neuronales difusas, susceptibilidad magntica, cociente S, magnetoestratigrafa, paleoambiente.',3,1,1,1,1,'2013-09-17 08:24:48','2013-09-17 08:24:48','Documento_123.pdf','application/pdf',4474200,'2013-09-17 08:24:48',20,0,169,'COMPLETO'),(124,'Una Introduccin a la Geometra Estocstica y losProcesos de Partculas Aleatorias.','{}','2008-10-30','Procesos de Partculas, Medida de Hausdorff, Procesos Puntuales, Caminatas aleatorias.',5,1,1,1,1,'2013-09-17 08:24:49','2013-09-17 08:24:49','Documento_124.pdf','application/pdf',439180,'2013-09-17 08:24:49',20,0,69,'COMPLETO'),(125,'SINTESIS DE ZSM-5 MEDIANTE CRISTALIZACIN DE GELES ALUMINOSILICATOS EN PRESENCIA DE SURFACTANTE','Con este trabajo se inicia una lnea de investigacin basada en la obtencin de un nuevo material denominado zeolita mesoporosa, en la cual se combinan las propiedades de la zeolita tipo ZSM-5 y el mesoporoso tipo Al-MCM-41, para obtener un slido que combine las ventajas de los anteriores. En este estudio se sintetizaron distintos grupos de slidos con Gomasil, Ludox y TEOS como fuentes de silicio. La obtencin de los mismos se realiz en un reactor tipo Parr bajo presin autgena, siguiendo la metodologa experimental propuesta en este trabajo. Los slidos obtenidos fueron caracterizados por distintas tcnicas: Difraccin de Rayos X (DRX), Fisisorcin de nitrgeno, Anlisis Qumico, Microscopia Electrnica de Barrido y Transmisin. La preparacin de los materiales zeoliticos se llev a cabo bajo dos condiciones de gel de sntesis. El correspondiente a la zeolita tipo ZSM-5, y el del mesoporoso Al-MCM-41. Para las fuentes de silicio estudiadas y bajo las condiciones de gel ZSM-5, los difractogramas obtenidos nos revelan la presencia de esta fase zeolitica aunque con Gomasil y TEOS se muestra una contaminacin con cuarzo y no se observa un efecto importante del periodo de envejecimiento. Estos slidos muestran valores de rea especfica de alrededor de 200 (m2/g). Para los slidos obtenidos con condiciones de gel bsico, los patrones de DRX muestran un efecto importante en cuanto a la secuencia de cristalizacin y la fuente de silicio utilizada. Con Gomasil se obtiene Mordenita como slido resultante, mientras que con Ludox ocurre una formacin parcial de la fase ZSM-5. El Tetraetilortosilicato (TEOS) result ser el ms adecuado para la obtencin de ZSM-5. El rea especfica para el material resultante Mordenita fue de 318 (m2/g), para los obtenidos con Ludox y TEOS 157 y 128 (m2/g) respectivamente. De acuerdo a los patrones de DRX para los tamices moleculares tipo Al-MCM-41, se observa que un aumento en la temperatura y el tiempo de sntesis tienden a mejorar el ordenamiento hexagonal. Las fuentes de silicio Gomasil y Ludox no resultaron efectivas para obtener un material tipo Al-MCM-41. Los valores de rea especfica tienden a aumentar con el aumento de la temperatura y el tiempo de sntesis, aumentando desde 812 (m2/g) hasta 1059 (m2/g) con un cambio de 90oC y 12 horas a 150oC y 48 horas. Para la sntesis de la zeolita mesoporosa (slido combinado) en condiciones de gel ZSM-5, los patrones de DRX a ngulos bajos, no indican la presencia de un ordenamiento hexagonal, sin embargo a ngulos altos para las fuentes de silicio Ludox y Gomasil se obtiene un DRX caracterstico de la zeolitas tipo ZSM-5, mientras que con TEOS se obtuvo una fase densa identificada como analcima. Los patrones de difraccin de rayos X a ngulos bajos para los slidos combinados sintetizados bajo condiciones de gel bsico, no muestran evidencia de un ordenamiento hexagonal. Observndose a ngulos altos la formacin incipiente de la fase ZSM-5. Sin embargo, las isotermas de adsorcin de N2 para algunos slidos combinados, son tpicas de materiales mesoporosos con una distribucin estrecha de tamao de poro. Mediante Microscopia Electrnica de Transmisin, se pudo comprobar la mesoporosidad y el ordenamiento espacial del material combinado.','2009-04-20','ZSM-5, Al-MCM-41, SLIDOS COMBINADOS, TEOS, GOMASIL,LUDOX',6,1,1,1,1,'2013-09-17 08:24:50','2013-09-17 08:24:50','Documento_125.pdf','application/pdf',0,'2013-09-17 08:24:50',20,0,0,'INCOMPLETO'),(126,'Patrones de distribucin, anlisis geo-espacial y determinacin de reas de endemismo de los mosquitos (Diptera:: Culicidae) de Venezuela.','La Familia Culicidae en Venezuela ha sido estudiada ampliamente debido a su importancia mdica, por incluir vectores de mltiples enfermedades que generan altas tasas de morbilidad y mortalidad tanto en animales como en humanos. Por lo tanto el conocimiento de la distribucin de este grupo y el anlisis de su biogeografa histrica permitira tener una idea acerca de su historia natural, de las razones geolgicas y ecolgicas, as como de la epidemiologa de las enfermedades de los cuales son vectores. Esto se puede obtener realizando anlisis de biogeografa histrica, en cuyos mtodos, se presume el previo conocimiento de las reas de Endemismo (AE), es por ello que la delimitacin de estas reas es uno de los pasos fundamentales, y uno de los ms problemticos en los anlisis biogeogrficos. (Crisci et al. (2000)) Se elaboraron mapas de distribucin, y se observ que los registros compilados de Familia Culicidae se distribuyen principalmente al Norte del pas, con distribuciones particulares para algunas taxa, hacia zonas montaosas exclusivamente o la regin del Pantepui, entre otras. Mediante anlisis de endemismo NDM y PAE, se propuso una delimitacin de cuatro reas de endemismo para mosquitos: denominadas 1.) Regin Norcentral, 2) Cordillera Andina, 3) Cordillera Oriental y 4) Macizo Guayans. Estas reas tambin fueron sealadas por Navarro et al.. 2007. Se recomienda intensificar los muestreos haca el Sur del pas, para disminuir el efecto de este sobre los patrones de distribucin, es decir homogenizar los registros; as como estandarizar la informacin final que se registre en las fichas de las colecciones e incluso en las planillas de campo.','2008-12-04','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:24:52','2013-09-17 08:24:52','Documento_126.pdf','application/pdf',1136396,'2013-09-17 08:24:52',20,0,127,'COMPLETO'),(127,'ESTUDIO DE LOS COMPLEJOS DE VANADIO (IV) Y TREONINA POR MEDIO DE MEDIDAS DE FUERZAS ELECTROMOTRICES (25 C, KCl 3.0 M)','En el presente trabajo fueron estudiados los siguientes sistemas:H+ - treonina (HC)H+ - VO2+ - treoninapor medio de medidas de fuerzas electromotrices, emf (H), en KCl 3.0 M y a 25 C .El anlisis de los datos mediante LETAGROP arroj los siguientes resultados: o Sistema H+H2C+ HC + H+ - treoninaHC C- + H+EspeciespKaH2C+2.56(2)HC9.41(3)s(thc)0.010 o Sistema H+ - VO2+Especies - treoninaLog bpqr(3s)[HVOC]2+10.7(2)10.93(9)10.8(1)11.06(6)10.6 (< 10.8) [VOC]+6.9 ( < 7.4)7.2 ( < 6.3)7.2 (7.4)(b = 0)7.2(1)[H2VOC2]+22.53(4)22.48 (7)22.47(3)22.7(2)22.58(4)[HVOC2]+18.66(6)18.5(2)18.54(7)18.4( < 19.0)18.46(6) [VOC2](b = 0)(b = 0)(b = 0)14.3( < 14.9)13.8(2)s(thB)0.050s(thc)0.008s (thBf)0.045s(thcf)0.361s(E) / mV0.45','2009-04-15','COMPLEJOS, SOLUCION ACUOSA, KCl 3M',6,1,1,1,1,'2013-09-17 08:24:53','2013-09-17 08:24:53','Documento_127.pdf','application/pdf',10649970,'2013-09-17 08:24:53',20,0,77,'COMPLETO'),(128,'Sobre Espacios Ramsey-Topolgicos','Teorema de Ellentuck es el resultado se inicia la teora topolgica de Ramsey, lacual est desarrolloda en el trabajo de S. Todorcevic.Esta teora estudia los espacios topolgicos en los que se puede demostrar el teorema deEllentuck, es decir, en el que la propiedad de Ramsey y la propiedad de Baire son equivalentes.Los espacios en los que esto es posible se conocen como espacios de Ramsey-Topolgicos.S. Todorcevic ha podido identificar y formalizar un conjunto de caractersticas que describen a dichos espacios.En este trabajo revisaremos los axiomas que conforman la caracterizacin dada porTodorcevic y mostraremos algunos ejemplos de espacios que los satisfacen. En particularestudiaremos el espacio de Ellentuck y el espacio de las matrices infinitodimensionales sobre un cuerpo finito. En este ltimo contexto, estudiaremos un resultado que se refiere a coloraciones de espacios vectoriales de dimensin infinita.','2009-04-30','Ramsey, Espacios Ramsey-Topolgicos, Teora de Ramsey, Teorema de Ellentuck, Matrices sobre un cuerpo finito.',5,1,1,1,1,'2013-09-17 08:24:54','2013-09-17 08:24:54','Documento_128.pdf','application/pdf',1521061,'2013-09-17 08:24:54',20,0,56,'COMPLETO'),(129,'\"\"Evaluacinn de las corrientes de generacinn de contaminantes sllidos,, lquidos y gaseosos de la Unidad de ((FCC)) de La Refinera de Puerto La Cruz ((PDVSA)),, Estado Anzotegui..\"\"','El trabajo realizado esta inscrito dentro de las reas de ambiente y qumica sostenible de aplicacin en una empresa nacional, dentro del que son aplicados conocimientos generados durante la carrera, como lo es la Evaluacin de procesos qumicos, prevencin de la contaminacin, reaprovechamiento de materiales y optimizacin de procesos. El objetivo con que fu realizado este trabajo especial de grado era el de realizar una evaluacin de las corrientes de contaminantes generadas por la Unidad de Craqueo Cataltico Fluidizado de la Refinera Puerto La Cruz de PDVSA, Dividiendo el proceso de la unidad en operaciones unitarias y evaluando el impacto generado por cada una de estas en varios aspectos para as poder identificar la operacin unitaria crtica de la Unidad, y poder enfocar el trabajo en esta para buscar soluciones a los problemas que present la misma, en base a las mejores tcnicas y prcticas ambientales disponibles, formulando a la vez un anlisis tcnico econmico para estas alternativas, que debe ser llevado a cabo por el personal especializado en cada aspecto, con la finalidad de solventar la problemtica existente referente a la disposicin y manejo de las corrientes generadas por esta Operacin, para conseguir as la adecuacin del proceso y el manejo del residuo segn las mejores prcticas disponibles en cumplimiento con la Legislacin Nacional vigente para cada aspecto. Se obtuvo como resultado que la Operacin Unitaria Crtica fue el Regenerador de la Unidad donde se analizaron dos de sus corrientes de contaminantes, el catalizador de equilibrio desalojado peridicamente y los gases de combustin donde se determin que para la primera corriente existe un uso factible en el proceso de produccin de cemento portland Puzlanico por sus caractersticas puzlanicas y se propuso promover el uso de este residuo en las empresas cementeras nacionales, para la segunda corriente se determin a travs de los anlisis fisicoqumicos realizados, que los niveles de Monxido de Carbono sobrepasan los lmites mximos permitidos por el Decreto 638 en su Artculo 10, por lo cual se propuso tres alternativas : Uso de Calderas de Monxido de Carbono, para el aprovechamiento del poder calorfico de esta corriente, Inclusin de Aditivos Qumicos promotores de combustin que favorezcan la combustin completa del coque a Dixido de Carbono antes de la salida de estos gases a la atmsfera, La ltima alternativa para esta corriente fue El Uso de Filtros al final del proceso. Para estas alternativas se Formul una Matriz de Anlisis Tcnico econmico que permitiese seleccionar la ms viable a implementar al evaluarlas por varios criterios.','2009-04-23','Desarrollo sustentable, Produccin Ms Limpia, PDVSA, Ambiente',6,1,1,1,1,'2013-09-17 08:24:56','2013-09-17 08:24:56','Documento_129.pdf','application/pdf',4621627,'2013-09-17 08:24:56',20,0,129,'COMPLETO'),(130,'Algunas conexiones entre dinmica topolgica y teora combinatoria.','El propsito de este trabajo es presentar algunos resultados que relacionan la TeoraCombinatoria con la Dinmica Topolgica. Ms precisamente, dado un Sistema Dinmico,mostraremos una caracterizacin de los puntos recurrentes, uniformemente recurrentes ypuntos prximos del sistema en trminos de ultrafiltros. Estos resultados permitirn presen-tar dos demostraciones del Teorema de Hindman','2008-12-02','Ultrafiltros sobre los nmeros naturales. puntos recurrentes, uniformemente recurrentes y puntos prximos de un sistema dinmico. Teorema de Hindman.',5,1,1,1,1,'2013-09-17 08:24:58','2013-09-17 08:24:58','Documento_130.pdf','application/pdf',9071455,'2013-09-17 08:24:58',20,0,174,'COMPLETO'),(131,'Conjuntos dbilmente Ramsey en espacios de Banach','Se trata del estudio y comprensin de la propiedad dbilmente Ramsey en subconjuntos del espacio B1(X) de suceciones bsicas de bloques normalizadas donde X es un espacio de Banach arbitrario. Estudios previos demuestran que la propiedad de Ramsey clsica no se verifica para ciertos subconjuntos de B1(X) considerando X como un espacio de banach X arbitrario. La propiedad dbil extiende esta nocin y podemos obtener resultados anlogos a la propiedad clsica pero considerando en este caso espacios de Banach arbitrarios. El trabajo est basado en el artculo titulado \"Weakly Ramsey sets in Banach Spaces\" de los profesores J. Bagaria y J. Lpez Abad. El ejemplo en concreto de subconjunto de B1(X) en que considerareos dicha propiedad son los subconjuntos abietos.','2008-12-04','Debilidad Ramsey, Conjuntos dbilmente Ramsey, Propiedad dbilmente Ramsey, Espacios de Banach.',5,1,1,1,1,'2013-09-17 08:24:59','2013-09-17 08:24:59','Documento_131.pdf','application/pdf',1906293,'2013-09-17 08:24:59',20,0,126,'COMPLETO'),(132,'Un Generador de Periddicos Comunales:: Llevando la Tecnologa de la Informacin a la comunidad','A lo largo de este Trabajo Especial de Grado se irn recorriendo todos los aspectos, desde el ms terico hasta el ms tcnico, que han permitido la produccin de la herramienta de software que en lo subsiguiente se denominar Generador de Peridicos Comunales  GEPECO. En el primer captulo se desarrollar el marco terico sobre el tema planteado para este Trabajo Especial de Grado. De todo este marco terico es importante resaltar los conceptos de peridico y periodismo comunal, ya que los mismos son piedra angular de este trabajo. Adicionalmente y para dar significado prctico a los anteriores conceptos se estudiar el proceso requerido para elaborar un peridico, haciendo un especial conexin entre las tareas que aplican especficamente para el caso del peridico comunal. Una vez establecido el marco terico se proceder a realizar un breve estudio sobre mtodos giles de desarrollo de software, para seleccionar uno en particular. Para la elaboracin del Generador de Peridicos Comunales, se escogi AgilUs, ya que el mismo introduce la evaluacin de la usabilidad del software desde el inicio hasta el fin de su ciclo de vida. La implementacin de las dos (2) primeras etapas de este mtodo se irn exponiendo a lo largo del segundo captulo. En la primera etapa, se defini el dominio de la aplicacin, el perfil del usuario y se gener la lista de requerimientos funcionales y no funcionales del sistema. En la segunda etapa se realiz el diseo de las funcionalidades de la aplicacin a travs de diagramas UML (casos de uso, modelo de objeto del dominio), se gener un prototipo en papel y finalmente se realiz la primera versin de los patrones de interaccin que describen la interfaz de usuario de la aplicacin. En el tercer captulo se ejecutaron las dos (2) ltimas etapas del mtodo AgilUs, prototipaje y entrega. En la etapa de prototipaje, se defini la gua de estilo de la aplicacin y se realiz la Evaluacin Heurstica, arrojando sta detalles de usabilidad que fueron corregidos por el equipo de desarrollo. En la ltima etapa se realizaron las pruebas de aceptacin de la aplicacin, utilizando como mtodo de prueba los cuestionarios. Finalmente en el ltimo captulo, se exponen y detallan todos los componentes que integran la plataforma tecnolgica que han permitido el desarrollo de la aplicacin del Generador de Peridicos Comunales. Adems se traducen estos componentes a un entorno de produccin, en el cual se describen distintos escenarios para algunas de las funcionalidades de esta aplicacin','2009-02-03','periodismo, peridico, periodismo comunal, peridico comunal, comunidad',2,1,1,1,1,'2013-09-17 08:25:01','2013-09-17 08:25:01','Documento_132.pdf','application/pdf',17117171,'2013-09-17 08:25:01',20,0,101,'COMPLETO'),(133,'Estudio Qumico del Coral Blando venezolano Pseudopterogorgia americana..','Este Trabajo Especial de Grado representa un aporte para la qumica de los Productos Naturales Marinos, a travs del estudio de algunos de los metabolitos secundarios presentes en el coral blando venezolano Pseudopterogorgia americana, colectado en el Parque Nacional Morrocoy, Edo. Falcn, Venezuela. Se realiz un estudio bio-dirigido del crudo metanlico del coralPseudopterogorgia americana, que condujo a la separacin y purificacin de dos metabolitos secundarios presentes en el extracto de hexano del mismo. Los compuestos fueron aislados y purificados empleando tcnicas cromatogrficas como: cromatografa de columna sobre silica gel y cromatografa de capa fina. Se caracterizaron usando tcnicas espectroscpicas de Resonancia Magntica Nuclear (RMN 1H y 13C) y espectrometra de masas de baja y alta resolucin. Los metabolitos encontrados fueron I y II, no han sido reportados hasta la fecha. La mezcla de compuestos I y IIpresent toxicidad moderada (46,4 %) a una concentracin de 1000 ppm de la mezcla de compuestos, para el ensayo de mortalidad de Artemia salina. En el ensayo de difusin en discos de papel se obtuvo que en la especie Pseudopterogorgia americana no se encuentran componentes con la capacidad de inhibir el crecimiento bacteriano de las bacterias Escherichia coli,, Klebsiella pneumoniae (bacterias gram negativas) y Bacillus subtilis,, Staphylococcus aureus,, (bacterias gram positivas). Y en el ensayo de inhibicin de la enzima glucosa-6-fosfatasa (G-6-Pasa) se obtuvo un porcentaje de inhibicin de la enzima de 65,0 % (0,014 nm Pi/h x mg protena) en microsomas intactos y de 13,6 % (0,19 nm Pi/h x mg protena) en microsomas rotos, con una latencia del 92,6 %','2009-05-05','Pseudopterogorgia americana, Mortalidad de Artemia salina, actividad antibacterial, sistema G-6-Pasa',6,1,1,1,1,'2013-09-17 08:25:02','2013-09-17 08:25:02','Documento_133.pdf','application/pdf',938346,'2013-09-17 08:25:02',19,0,85,'COMPLETO'),(134,'Un Generador de Peridicos Comunales: Llevando la Tecnologa de la Informacin a la comunidad','En la sociedad en la que nos desenvolvemos es tangible que un gran nmero de individuosdeciden asociarse bajo un modelo comunitario totalmente renovado. Este modelo deja atrsla comunidad pasiva y meramente simblica. Estas comunidades desean expresarse yabrirse al mundo, siendo una de las mejores vas para ello la publicacin de peridicoscomunales. Cualquier individuo de una comunidad puede ejercer el periodismo comunal, yaque las actividades comunicacionales son naturales en el ser humano. Sin embargo, lo queno es natural, pero es necesario, es hacer uso del computador para lograr el objetivo detransmitir informacin a travs de la publicacin del peridico comunal.Por este motivo el objetivo principal de este Trabajo Especial de Grado fue el desarrollo deuna herramienta de software que permitiera generar peridicos comunales. Adicionalmentese plantearon como objetivos especficos que esta herramienta fuera usable, gratuita, decdigo abierto y multiplataforma.En primera instancia para lograr que la aplicacin fuera usable se hizo uso del Mtodo AgilUscomo mtodo de desarrollo. ste realiza evaluaciones de usabilidad a lo largo de todo elciclo de vida del sistema, dando como resultado un producto de usable. A fin de obtener unaaplicacin multiplataforma se seleccion como lenguaje de programacin Java.Finalmente, el principal aporte de este Trabajo Especial de Grado fue darle al ciudadanocomn el poder mantener informada a su comunidad, de los distintos eventos y noticiasrelevantes para ellos que no son reseadas por los grandes medios de comunicacin. Por loque se considera necesario seguir realizando aplicaciones de este tipo que brinden a lascomunidades la oportunidad de facilitar sus tareas del da a da por medio de herramientastecnolgicas.','2009-02-03','Palabras Clave: Peridico, periodismo, comunidad, generador peridicos comunales.',2,1,1,1,1,'2013-09-17 08:25:04','2013-09-17 08:25:04','Documento_134.pdf','application/pdf',4483744,'2013-09-17 08:25:04',20,0,147,'COMPLETO'),(135,'La Curva de Lorenz y Sistema de Pearson: Propiedades y Aplicacin','{}','2009-04-28','Curva de Lorenz, Indice de Gini, Formas Funcionales, Sistema generador de Pearson.',5,1,1,1,2,'2013-09-17 08:25:06','2013-09-17 08:25:06','Documento_135.pdf','application/pdf',554956,'2013-09-17 08:25:06',20,0,63,'COMPLETO'),(136,'Sistema de Informacin para el Manejo de Correspondencia y Puntos de Cuenta','El objetivo del presente Trabajo Especial de Grado (TEG) es desarrollar un Sistema de Informacin Transaccional que permita el manejo de correspondencia de la presidencia y el seguimiento de puntos de cuenta aprobados en Junta Directiva del BANAVIH. El desarrollo de este sistema se apoya en las siguientes metodologas y herramientas: XP(Extreme Programming), los patrones MVC y Singleton, y el sistema de control de versiones Subversion. El enfoque XPpermiti al grupo de desarrollo acelerar la velocidad de construccin de la aplicacin, as como tambin, se involucr al representante del Banco en la elaboracin del sistema, por lo que tom confianza en el producto desde la primera iteracin. Por otro lado, a travs de la implementacin del patrn MVC, se intercambiaron los roles de trabajo entre iteraciones; de esta forma, los miembros del equipo de trabajo intervinieron en cada una de las capas de la arquitectura MVC, por lo tanto, cada uno pudo obtener una compresin integral de toda la estructura de la aplicacin. El sistema desarrollado permitir disminuir los tiempos requeridos para la realizacin de las tareas relacionadas con el manejo de la correspondencia y de los puntos de cuenta del BANAVIH.','2009-05-05','Sistemas de Informacin Transaccional, Workflow, Correspondencia, Punto de Cuenta, XP, MVC.',2,1,1,1,1,'2013-09-17 08:25:09','2013-09-17 08:25:09','Documento_136.pdf','application/pdf',3642902,'2013-09-17 08:25:09',17,0,139,'COMPLETO'),(137,'SISTEMA DE INFORMACION PARA LA MEDICIN Y ANLISIS DE LA PRESENCIA DE INFORMACIN EN LOS MEDIOS DE COMUNICACIN','El presente Trabajo Especial de grado tiene como finalidad organizar, acceder, procesar, recuperar y distribuir la informacin de un medio de comunicacin. Creando una herramienta tecnolgica que permita la medicin de la presentacin de la informacin suministrada por los distintos medios, para el subsecuente anlisis y comprensin de los cambios sociales, polticos y econmicos del entorno de inters.','2009-03-06','Comunicacin, Web, medios, prensa escrita, anlisis morfolgico, anlisis de contenido, investigar, organizar, analizar, ponderar, valorar.',2,1,1,1,1,'2013-09-17 08:25:10','2013-09-17 08:25:10','Documento_137.pdf','application/pdf',1150602,'2013-09-17 08:25:10',20,0,78,'COMPLETO'),(138,'Estudio del contenido de elementos traza en cabello y orina de nios con Sndrome de spectro Autista.','Se determin la concentracin de elementos traza (Zn, Cu, Cr, Se, Pb, Cd y Hg) en muestras de cabello y orina de nios con Sndrome de Espectro Autista, con edades comprendidas entre 2 y 15 aos, pertenecientes al Centro Integral para la Estimulacin Cognitiva y Comunicativa (CIPECC). Previo al anlisis de las muestras, se optimiz la concentracin del agente reductor (NaBH4) y la influencia de diferentes cidos transportadores (HNO3  HCl), para la determinacin de Hg total por CV-AAS. Los resultados obtenidos arrojaron que la concentracin ptima de reductor fue 0,2% p/v de NaBH4 y que el empleo de HCl como cido transportador produce un aumento en la sensibilidad de la tcnica. Tambin se optimizaron los tiempos de lavado de las muestras de cabello con acetona y EDTA para la determinacin de Cd y Hg, obtenindose finalmente, porcentajes de remocin de aproximadamente 76% y 82% para Cd y Hg, respectivamente. Por tal motivo, los datos que deriven del anlisis de estos elementos en cabello, incluirn un error adicional que dependern de la exposicin del individuo a estos metales. Asimismo, se estudiaron posibles problemas de adsorcin de Hg al utilizar material de plstico para el anlisis de cabello, encontrndose que stos no adsorben mercurio y pueden ser utilizados de manera confiable. En total se analizaron 29 muestras de orina y 31 muestras de cabello de nios autistas. La determinacin de los elementos Zn, Cu, Cr, Se, Pb y Cd, se realiz mediante espectrometra de emisin atmica con plasma inductivamente acoplado (ICP-OES) y la concentracin de Hg total fue determinada por espectrometra de absorcin atmica con generacin de vapor fro (CV-AAS). Las metodologas de anlisis empleadas fueron validadas empleando para algunos elementos el factor de recuperacin, partiendo de estndares puros de cada elemento, y para otros se utiliz material certificado apropiado. Los datos obtenidos fueron tratados empleando el paquete Statgraphic version 5.0 para Windows. Para las muestras de orina, las concentraciones de Zn y Cr en nios de Espectro Autista mostraron niveles de normales a bajos, para Cu y Se, las medianas presentaron niveles normales. Metales txicos como Pb, Cd y Hg, se mantuvieron siempre por debajo de los valores umbrales. Se compar la carga metlica, liberadas por va urinaria, del grupo autista con la poblacin control, encontrndose que existe cierta tendencia por parte de los primeros a excretar cantidades menores de Zn, Cr y Se. En el caso del Hg, la tendencia es inversa, los nios sanos lo liberan en mayores proporciones, adems, en nios autistas se observ que la liberacin de Hg aumenta a medida que disminuye la severidad del Sndrome. Se hallaron adems, correlaciones positivas para la excrecin de metales en orina, entre ellas: Pb-Se, Pb-Zn, Hg-Zn, Cu-Zn, Cu-Se y Cu-Pb; que pueden estar indicando la existencia de procesos metablicos o enzimticos afectados en el organismo de nios con autismo, capaces de generar dficits de Zn y retencin de Hg. As como tambin, indicios de que el Se presenta una funcin protectora hacia elementos como Cu y Pb que puede estar favoreciendo la formacin de complejos Se-Pb y Se-Cu que no son excretados por el cuerpo, generando as una menor liberacin de Pb por parte de nios de Espectro Autista. Los resultados obtenidos por el anlisis de orina, concuerdan con teoras propuestas en estudios previos, que asocian la menor excrecin de Hg y Pb en nios de Espectro autista a dos posibles causas, afecciones en protenas encargadas de la detoxificacin del organismo y la capacidad del Se para formar complejos con Cu, Pb y/o Hg. En el caso del cabello, la informacin adquirida fue muy limitada, observndose niveles relativamente normales para todos los elementos analizados.','2009-04-22','Cabello, Orina, Autismo, elementos traza, metales',6,1,1,1,1,'2013-09-17 08:25:11','2013-09-17 08:25:11','Documento_138.pdf','application/pdf',2731700,'2013-09-17 08:25:11',20,0,121,'COMPLETO'),(139,'Evolucin estratigrfica del comportamiento de los elementos mayoritarios, minoritarios y trazas durante el Cuaternario Tardo de la Laguna de Mucubaj, estado Mrida.','El presente trabajo de investigacin tuvo como objetivo reconocer la seal y patrones de distribucin de elementos mayoritarios, minoritarios y trazas, que puedan caracterizar el impacto de los efectos geoqumicos, sedimentarios y posiblemente climticos del Cuaternario reciente, a travs de los sedimentos de la Laguna de Mucubaj, estado Mrida. Se recolectaron ncleos en la Laguna de Mucubaj y se analiz el ncleo MUCL 02-02-04, del que se tomaron 91 muestras. El trabajo de laboratorio consisti en tratamiento y anlisis fsico (descripcin de las muestras, secado y pulverizado), anlisis qumicos y estadsticos multivariado. Los anlisis qumicos consistieron en la determinacin de elementos mayoritarios, minoritarios y trazas mediante la tcnica de EEO-IAP y determinacin de voltiles a travs de la tcnica de prdida al rojo. Para el anlisis estadstico se realiz un anlisis exploratorio de datos que incluy histogramas para determinar la normalidad de los datos y cajas grficas para detectar valores anmalos, tambin se realiz un anlisis multivariado por agrupamiento. Dentro de los resultados obtenidos en base a las caractersticas granulomtricas se determin una fase de Turbidita y una fase Lacustre, los anlisis de agrupamiento para ambas fases dieron como resultados dos quimiofacies. Para la turbidita una quimiofacies de homogenita y una base de turbidita y para la fase lacustre una quimiofacies de clsticos finos y otra de clsticos gruesos. Determinando dos eventos importantes dentro de la sedimentacin, una fase relacionada a sedimentacin climtica representada en la fase lacustre en la base de la secuencia y una fase turbidtica descrita a una sedimentacin sismotectnica.','2009-04-20','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; m',4,1,1,1,1,'2013-09-17 08:25:12','2013-09-17 08:25:12','Documento_139.pdf','application/pdf',6566621,'2013-09-17 08:25:12',19,0,116,'COMPLETO'),(140,'Evaluacin de la tcnica del glaseado incorporando hidrocoloides como alternativa en el empaque de lomo de atn (thunnus sp) congelado.','{}','2009-04-29','atun, hidrocoloides, carragenina, glaseado',1,1,1,1,1,'2013-09-17 08:25:14','2013-09-17 08:25:14','Documento_140.pdf','application/pdf',8690250,'2013-09-17 08:25:14',18,0,211,'COMPLETO'),(141,'ESTUDIO DE LA HIDRODESHALOGENACIN CATALTICA DE BIFENILOS POLICLORADOS','Los bifenilos policlorados forman una familia de compuestos orgnicos cuya estructura est constituida por dos anillos bencnicos unidos por un enlace simple los cuales presentan tomos de cloro como sustituyentes en un nmero que puede variar entre uno y diez. Estos compuestos representan una fuente de contaminacin ambiental debido a su carcter altamente txico y a que, por su escasa degradabilidad, el tiempo de residencia en suelos y cuerpos acuferos es apreciablemente prolongado. A partir de la prohibicin de su fabricacin y utilizacin surgi la necesidad de desarrollar metodologas seguras y confiables que permitisen su tratamiento y destruccin. Como una respuesta a esta necesidad se plante como objetivo del presente trabajo, la posibilidad de considerar la hidrodeshalogenacin cataltica como opcin de trabajo, utilizando sendos catalizadores comerciales fabricados a base de compuestos de nquel/molibdeno y cobalto/molibdeno en presencia de una amina como especie bsica.En el presente estudio se coloc una mezcla comercial de bifenilos policlorados en un reactor de vidrio al cual se incorpor el catalizador comercial de nquel/molibdeno o cobalto/molibdeno en proporcin cataltica, conjuntamente con una cantidad estequiomtrica de etilendiamina (0,6 moles etilendiamina/mol BPC), utilizando metanol como medio de reaccin. Este sistema se conect a un un condensador que permiti el reflujo, se someti a agitacin magntica y se le hizo circular una corriente de hidrgeno. El tiempo establecido para la reaccin se fij en 120 minutos. El cido clorhdrico generado se captur haciendolo burbujear dentro de una solucin de hidrxido de sodio de concentracin previamente conocida. El porcentaje de conversin alcanzado se estableci mediante la determinacin de la cantidad de cido clorhdrico generado, el cual se obtuvo mediante la valoracin del hidrxido de sodio remanente una vez finalizada la reaccin. Todas las experiencias se llevaron a cabo a presin atmosfrica. Bajo condiciones de presin atmosfrica y temperatura ambiente se obtuvo la conversin del bifenilo policlorado, determinndose la presencia de bifenilo como producto mayoritario, adems de molculas que presentaban entre 1 y 4 tomos de cloro como especies minoritarias. Se estableci que el catalizador a base de nquel-molibdeno como la primera opcin cataltica a considerar, por presentar conversiones del orden del 77 %. De manera similar el catalizador de cobalto-molibdeno se consider como segunda opcin cataltica por presentar conversiones del orden del 51 %. En ambos casos se sugiere que la amina presente en el sistema cataltico inhibe el envenenamiento del catalizador al neutralizar el cido clorhdrico a medida que este se genera en el proceso hidrotratamiento.','2009-01-26','BIFENILO POLICLORADO, BPCs, HIDROTRATAMIENTO, CONVERSIN, CATALIZADOR.',6,1,1,1,1,'2013-09-17 08:25:21','2013-09-17 08:25:21','Documento_141.pdf','application/pdf',6901547,'2013-09-17 08:25:21',0,0,88,'COMPLETO'),(142,'Implementacin de un sistema de seguridad para redes inalmbricas basado en la integracin del protocolo RADIUS y el protocolo LDAP','En la actualidad, la Facultad de Ciencias ofrece el servicio de conexin a la red interna, as como tambin acceso a internet, esto se hace mediante el uso de una red inalmbrica la cual carece de un mecanismo de seguridad que permita conocer quienes ingresan a la red y llevar un control de las actividades en la misma. Tomando en cuenta lo anteriormente planteado, se implement un sistema de control de acceso inalmbrico el cual representa una alternativa de seguridad como solucin a la problemtica de la red inalmbrica de la Facultad de Ciencias. Dicha solucin est basada en el uso de los protocolos RADIUS y LDAP, de manera tal que se pueda realizar un proceso de autenticacin al momento de ingresar a la red; dicho proceso es realizado por el servidor RADIUS el cual consultar la informacin contenida en el servidor LDAP y la comparar con la suministrada por los usuarios. Adems, el servidor RADIUS se encarga tambin de mantener un registro de las conexiones que se hayan realizado diariamente y de esta manera poder llevar un control de quienes han ingresado a la red, desde que equipo se realiz dicha conexin, as como tambin la fecha y hora de la misma. Por otra parte, para simplificar el proceso de autenticacin a los usuarios se configur un portal cautivo, el cual permite realizar dicho proceso mediante una pgina Web la cual se mostrar a los usuarios una vez se hayan conectado a la red inalmbrica.','2009-04-27','Red Inalmbrica, Autenticacin, RADIUS, LDAP, Portal Cautivo',2,1,1,1,1,'2013-09-17 08:25:22','2013-09-17 08:25:22','Documento_142.pdf','application/pdf',2882509,'2013-09-17 08:25:22',19,0,134,'COMPLETO'),(143,'Determinacion de mercurio por EAA con generacion de vapor y preconcentracion en fase solida','{}','2009-04-28','Mercurio, preconcentracion, arcilla',6,1,1,1,1,'2013-09-17 08:25:25','2013-09-17 08:25:25','Documento_143.pdf','application/pdf',8859998,'2013-09-17 08:25:25',19,0,72,'COMPLETO'),(144,'Estudio de los complejos de vanadio de valencia mixta(IV;V) con acido oxalico por medio de fuerzas electromotrices en medio ionico KCl 3 M a 25C.','En el presente trabajo fueron estudiados los siguientes sistemas: H+ - cido Oxlico (C2-) H+ - VO2+- VO2+- cido oxlico (C2-) Por medio de fuerzas electromotrices emf(H) a 25C y empleando KCl 3.0 M como medio inico inerte. El anlisis de los datos mediante LETAGROP arrojo los siguientes resultados: Sistema H+ - cido Oxlico (C2-) Reaccin pKa H2C HC- + H+ 1.27(1) HC- C2- + H+ 3.93(4) Sistema H+ - VO2+- VO2+- cido oxlico (C2-) Log bpqrs [HV2O3C]2+ 32.25(7) 32.27(7) [V2O3C]+ 30.80(5) 30.82(5) [(OH)V2O3C] 28.56(4) 28.58(4) [(OH)2V2O3C]- 25.53(4) 25.57(4) [ (OH)3V2O3C]2- 21.47(7) 21.50(7) [V2O3C2]- 37.5 (max = 37.8) 37.8(2) [V2O3C3]3- 45.1(2) 44.8(2) s(thC) 0.039 s(thCf) 0.039','2009-05-04','Valencia mixta vanadio(IV;V), medidas de fuerzas electromotrices,acido oxalico,equilibrios en solucion,estabilidad de complejos.',6,1,1,1,1,'2013-09-17 08:25:27','2013-09-17 08:25:27','Documento_144.pdf','application/pdf',1894702,'2013-09-17 08:25:27',17,0,112,'COMPLETO'),(145,'Determinacinn de especies txxicas de arsnico en muestras marinas,, mediante Extraccinn Acelerada con Solvente ((ASE)) y determinacinn por Plasma Inductivamente Acoplado--Espectrometra de Emisinn pptica((HG--ICP--OES))..','El arsnico es un elemento ampliamente distribuido en el ambiente, en el aire, el agua y el suelo, principalmente en estos dos ltimos. Este representa un gran riesgo para la salud debido a que puede concentrarse en alimentos que son cultivados en suelos contaminados con este elemento, y en el agua, donde se encuentran plantas y peces que pueden acumularlo con facilidad. A travs de estas vas, puede llegar al ser humano, causando enfermedades de gravedad, como cncer de pulmn, de vejiga, de rin, enfermedades cardacas, entre otras. De acuerdo con diversos estudios realizados, las especies arsnico que presentan mayor toxicidad son las inorgnicas As (III) y As (V), a diferencia de las orgnicas que presentan poca toxicidad. Por esta razn, fue planteado como objetivo principal del presente trabajo la determinacin de arsnico en muestras de alimentos marinos venezolanos. Para ello se emple una metodologa reproducible, como lo es el acoplamiento de cromatografa inica con generacin de hidruros, con un detector ICP-OES. Antes de poder determinar el arsnico presente, es necesaria la extraccin del mismo, donde fue utilizada la extraccin acelerada con solvente para tal fin. Las muestras estudiadas, especficamente algas, sardinas y pepitonas, no presentaron seal de arsnico dentro del rango de concentraciones empleado para este estudio. Tambin fue estudiada la eficiencia del mtodo de extraccin de las muestras, calculando para esto los factores de recuperacin de muestras contaminadas con un estndar primario de arsnico. Respecto a esto, el proceso de extraccin de este elemento en las muestras evaluadas fue bastante aceptable (aproximadamente 90 %).','2008-12-01','Arsnico, Plasma inductivamente acoplado, muestras marinas, generacion de hidruros, Extraccin acelerada con solvente',6,1,1,1,1,'2013-09-17 08:25:42','2013-09-17 08:25:42','Documento_145.pdf','application/pdf',0,'2013-09-17 08:25:42',19,0,0,'INCOMPLETO'),(146,'SINTESIS DE BENZOATO DE METILO SOBRE SISTEMAS HPAS--SBA--1155','La mayora de los procesos qumicos para la obtencin de compuestos orgnicos realizados en la industria emplean catalizadores homogneos, que adems de ser difciles de separar son contaminantes para el ambiente y potencialmente perjudiciales a la salud. Por esta razn, se busca reemplazar estos catalizadores por otros menos contaminantes con una eficiencia similar. Los catalizadores heterogneos tales como los slidos silcicos mesoporosos son algunos de los que se estudian para este reemplazo. En el presente trabajo se sintetizaron los slidos SBA-15 y el Al-SBA-15, este ltimo sintetizado con relaciones Si/Al de 30 y 60. A estos slidos se le incorpor un heteropoliacido de tungsteno (WHPA) por sntesis directa con un contenido del 10% p/p de WHPA y por sntesis indirecta con un contenido de WHPA del 10% y 20%. Los slidos obtenidos se caracterizaron por diferentes tcnicas analticas como lo fueron determinacin de propiedades texturales, anlisis qumico elemental, difraccin de rayos X y espectroscopa de absorcin en el infrarrojo. Se evaluaron en la reaccin de esterificacin del cido benzoico con metanol. El estudio de las propiedades texturales como la determinacin de rea especfica realizados al SBA-15 y al Al-SBA-15 con relaciones Si/Al=30 y 60, arrojaron valores de rea entre 700 y 800 m2/g y dimetro de poro entre 3 y 4 nm, valores stos similares a los reportados en la literatura, siendo los valores ms bajos de rea los obtenidos con los slidos que presentan incorporacin de heteropoliacido, con valores entre 300 y 500 m2/g, y por ende el valor ms alto de dimetro de poro. Para todos los slidos se presentaron isotermas de absorcin con histresis tipo IV, caractersticos de slidos mesoporosos regulares. Los resultados obtenidos de los anlisis qumicos realizados a los slidos sintetizados arrojaron que la cantidad de Al en la composicin de los mismos es muy baja para ser cuantificable (<0,05% p/p), esta baja cantidad de Al presente en los slidos se atribuy en parte a los equilibrios en solucin de las especies Si y Al al pH de sntesis (1,5). Tambin se observa una prdida de W cuando este se incorpora por sntesis directa a los silicatos debido a que en el proceso de sntesis el tungsteno queda en solucin y es desechado en las aguas de lavado. Este fenmeno se observa en menor proporcin con los aluminosilicatos, dado que este metal facilita el anclaje a la superficie. A travs de los resultados obtenidos por difraccin de rayos X se demostr que la incorporacin de heteropoliacido al slido modifica su ordenamiento espacial, deformando su arreglo hexagonal. La presencia de aluminio en los slidos mesoporosos le da mayor rigidez a su estructura hexagonal impidiendo que la incorporacin del heteropoliacido a estos afecte su ordenamiento espacial que, mediante los espectros de IR, se puede observar que la presencia de aluminio fortalece los enlaces de la estructura ya que no muestran corrimientos en las bandas por la presencia del WHPA. Los resultados obtenidos en la reaccin de esterificacin del cido benzoico con metanol utilizando los slidos sintetizados como catalizadores arrojaron que aquellos materiales que poseen mayor relacin Si/Al retienen mejor la molcula de heteropoliacido en la superficie del slido obtenindose una mayor conversin (79,3% de conversin con WHPA/Al-SBA-15, relacin Si/Al=60 y 20% p/p de WHPA), en comparacin con los slidos que poseen mayor cantidad de aluminio incorporado. Para el slido SBA-15 la presencia de heteropoliacido modifica su ordenamiento espacial generando conversiones bajas (cercanas al 70%) del producto deseado. Por ltimo, el aumento de la temperatura en la reaccin de esterificacin utilizando como catalizadores los slidos sintetizados, aumenta la conversin del acido benzoico entre 14% y 70%. Y se corresponden con aquellos cuyo comportamiento es similar al de un aluminosilicato con bajo contenido de aluminio (Si/Al=60) no importando el contenido de heteropoliacido depositado sobre el catalizador.','2009-03-20','Tamices moleculares, SBA-15, Slidos mesoporosos, Heteropolicidos, Esterificacin',6,1,1,1,1,'2013-09-17 08:25:42','2013-09-17 08:25:42','Documento_146.pdf','application/pdf',361431,'2013-09-17 08:25:42',19,0,52,'COMPLETO'),(147,'Evaluacin de una Celda para la Generacin de Vapor Fro de Cadmio y su determinacin en muestras de orina mediante Espectrometra de Absorcin Atmica','RESUMENEn este trabajo se evalu una celda de reaccin para la generacin de vapor fro de cadmio. Asimismo, se optimiz una metodologa aplicable a la determinacin de cadmio en muestras de orina mediante CV-AAS. Para ello, se optimizaron los parmetros fsicos correspondientes al diseo de la celda y su ensamblaje para la introduccin apropiada de la muestra y los reactivos. Los parmetros que intervienen en la formacin de la especie voltil de cadmio tambin fueron optimizados, tanto en muestras de orina como en soluciones acuosas, empleando dos aproximaciones: un diseo factorial multivariado Box Behnken de cuatro factores a dos niveles y un anlisis univariado. Los resultados obtenidos bajo las condiciones ptimas, en cada caso, fueron comparados en base al lmite de deteccin, porcentaje de recuperacin y valor de concentracin promedio. Asimismo, se determin la exactitud y la precisin de la metodologa. Bajo las condiciones optimizadas mediante el mtodo multivariado (2,78% m/v de cido clorhdrico, 3,5 mg L-1 de Co, 5,90 % m/ v tiourea y 7,0 % m/v del agente reductor) y mediante el mtodo univariado (2,8% m/v de cido clorhdrico, 2 mg L-1 de Co, 4 % m/v tiourea y 7,0 % m/v del agente reductor) se obtuvieron lmites de deteccin instrumental de 1,11 mg L- 1 y 0,96 mg L-1, respectivamente. El porcentaje de recuperacin instrumental obtenido mediante ambos procedimientos fue comparable y se encuentra dentro del intervalo del 91% y 98%. Tampoco se encontraron diferencias significativas (P=0,05) entre los valores de concentracin de Cd determinados en muestras de orina provenientes de donantes voluntarios. Los resultados de la concentracin de Cd obtenidos en una muestra control de orina, Lyphocheck Nivel 1 de Bio-rad, bajo las condiciones experimentales optimizadas mediante el modo multivariado, estuvieron de acuerdo con los valores establecidos por el fabricante, mostrando un coeficiente de variacin del 2,1% para tres rplicas. Los resultados obtenidos muestran que la celda diseada y operada bajo las condiciones de anlisis optimizadas, permite la obtencin del vapor metlico de cadmio y su determinacin en muestras de orina de manera cuantitativa y con una buena precisin. Los LOD obtenidos pueden ser mejorados realizando modificaciones adicionales dirigidas hacia la disminucin del volumen muerto que diluye el vapor metlico generado.','2009-04-24','Vapor Fro de CadmioEspectrometra de Absorcin AtmicaDeterminacin de Cadmio en muestras de orinaAnlisis univariado Anlisis multivariado',6,1,1,1,1,'2013-09-17 08:25:43','2013-09-17 08:25:43','Documento_147.pdf','application/pdf',16082371,'2013-09-17 08:25:43',20,0,178,'COMPLETO'),(148,'\"\"MODIFICACINN QUMMICA DE ALMIDNN DE YUCAMEDIANTE RADIACINN MICROONDAS\"\"','En el presente trabajo de investigacin se estudian las condiciones de reaccin en medio acuoso para la modificacin del almidn de yuca nativo con anhdrido 2-octenil-1-succnico (OSA) utilizando como medio de calentamiento la radiacin microondas, todo esto con el objeto de obtener un producto con caractersticas hidrofbicas. Los productos obtenidos fueron caracterizados estructuralmente por medio de espectroscopa infrarroja con transformada de Fourier (FT-IR) y espectroscopia de resonancia magntica nuclear (RMN) donde se identificaron bandas caractersticas de los grupos funcionales introducidos (grupo ster, cadena alqulica). La evaluacin de las condiciones de reaccin ideales se realizo tomando en cuenta diferentes aspectos: uso de acido esterico como catalizador de transferencia de fase (surfactante) y su influencia sobre el proceso de esterificacin, cantidades de los reactivos de partida (OSA, cido esterico), condiciones fisicoqumicas de los mismos (almidn activado, liofilizado o gelatinizado) y agitacin. Adems de la caracterizacin estructural tambin se realiz una evaluacin cuantitativa del grado de sustitucin del almidn modificado por una titulacin cido-base as como tambin por medio de RMN-1H. Adicionalmente, se procedi a la construccin de una curva de calibracin empleando datos de los espectros de RMN y FT-IR de cinco productos, observndose el mayor grado de sustitucin 0,051 para el producto obtenido a partir del denominado procedimiento C que consisti en un tratamiento previo de activacin del almidn nativo y del acido esterico con hidrxido de sodio, posteriormente someter al almidn activado a un proceso de gelatinizacin y liofilizacin antes de la esterificacin. Tambin se estudi la morfologa de varios de los productos por medio de microscopia electrnica de barrido (MEB) as como sus propiedades de solubilidad y adsorcin de humedad. En general se pudo apreciar que los derivados de almidn sintetizados ms hidrofbicos que el almidn de partida, lo cual conllevo a una disminucin de cerca del 20 % en la absorcin de humedad para el producto con el mayor grado de sustitucin (DS = 0,051).','2009-02-11','Almidon, yuca, plastico biodegradable, OSA',6,1,1,1,1,'2013-09-17 08:25:48','2013-09-17 08:25:48','Documento_148.pdf','application/pdf',323130,'2013-09-17 08:25:48',20,0,47,'COMPLETO'),(149,'Estudio geoqumico de la seaal paleoclimtica Holocena en sedimentos lacustres del paleolago Los Zerpa, estado Mrida.','Anlisis limnolgicos y paleolimnolgicos de cuencas lacustres andinas ubicadas entre 1100m a 3700m han demostrado que los minerales de arcilla y algunas caractersticas geoqumicas siguen patrones altitudinales definidos y que el registro paleoclimtico puede ser claramente observado a travs de los sedimentos lacustres (Weingarten et al..,,1991). En este sentido, los sedimentos lacustres del paleolago de los Zerpa han mostrado una importante seal climtica observada a travs de la granulometra y susceptibilidad magntica de alta resolucin (Carrillo, 2006). Este paleolago se encuentra en la regin central de los Andes de Mrida en el valle morrnico de Los Zerpa. El extremo norte del valle se encuentra controlado por la Falla de Bocon cuya actividad sismotectnica y ruptura superficial han controlado en gran medida la dinmica sedimentaria del valle intramorrnico (Giengengack y Grauch, 1976; Schubert, 1981; Carrillo et al., 2006), alterando con perodos ssmicos controlados exclusivamente por factores climticos. Este trabajo tiene como objetivo evaluar el comportamiento geoqumico de los sedimentos lacustres del paleolago de Los Zerpa depositados bajo control climtico y determinar la influencia de factores climticos que pudieran incidir en la dinmica de sedimentacin en la cordillera andina. Para realizar esto, se tom un ncleo de pared o canaleta de 50 cm de largo de un afloramiento de sedimentos lacustres donde se llev a cabo un muestreo sistemtico cada 5 mm para realizar anlisis de elementos mayoritarios, minoritarios y trazas por medio de espectrometra de emisin ptica inductivamente acoplado a plasma EEO-IAP (ICP-OES). La aplicacin de herramientas de estadstica multivariada, permiti establecer 2 asociaciones geoqumicamente distintas, (clstico grueso, clstico fino). De acuerdo al comportamiento de los atributos qumicos agrupados se identificaron 2 quimiofacies, relacionadas a las condiciones redox del paleoloago, utilizando como indicadores elementales el Fe y Mn, una fase posiblemente subxica, con concentraciones bajas de MnO2 (0,0474% - 0,1030) 6%, en la cual los perodos de sedimentacin fueron alternados por la actividad sismotectnica y perodos de sedimentacin climtica; Sin embargo, para concentraciones altas de MnO2 (0,1091% - 0,1616%)  6%, marca las condiciones xicas del paleolago y el comienzo de una sedimentacin exclusivamente climtica la cual se ve influenciada por patrones de sedimentacin cclicos, que posiblemente podran ser relacionados dentro de los perfiles quimioestratigraficos de Sc, SiO2 y ZrO2 a ciclos sedimentarios concernientes a los ciclos de Gleisbeerg de 80 - 90 aos referentes a la influencia de la actividad solar sobre la respuesta geoqumica de los sedimentos.','2009-04-20','UNIVERSIDAD CENTRAL DE VENEZUELA 12.00 Normal 0 21 false false false ES-VE X- NONE X-NONE MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-sty',4,1,1,1,1,'2013-09-17 08:25:49','2013-09-17 08:25:49','Documento_149.pdf','application/pdf',574745,'2013-09-17 08:25:49',19,0,88,'COMPLETO'),(150,'Sistema de Informacin para el Manejo de Correspondencia yPuntos de Cuenta.','El objetivo del presente Trabajo Especial de Grado (TEG) esdesarrollar un Sistema de Informacin Transaccional quepermita el manejo de correspondencia de la presidencia y elseguimiento de puntos de cuenta aprobados en Junta Directivadel BANAVIH. El desarrollo de este sistema se apoya en lassiguientes metodologas y herramientas: XP(ExtremeProgramming)),, los patrones MVC y Singleton,, y el sistema decontrol de versiones Subversion.. El enfoqueXPpermiti al grupo de desarrollo acelerar la velocidad de construccin de laaplicacin, as como tambin, se involucr al representante delBanco en la elaboracin del sistema, por lo que tom confianzaen el producto desde la primera iteracin. Por otro lado, atravs de la implementacin del patrn MVC, seintercambiaron los roles de trabajo entre iteraciones; de estaforma, los miembros del equipo de trabajo intervinieron encada una de las capas de la arquitectura MVC, por lo tanto,cada uno pudo obtener una compresin integral de toda laestructura de la aplicacin. El sistema desarrollado permitirdisminuir los tiempos requeridos para la realizacin de las tareasrelacionadas con el manejo de la correspondencia y de lospuntos de cuenta del BANAVIH.','2009-05-05','Sistemas de Informacin Transaccional, Workflow, Correspondencia, Punto de Cuenta, XP, MVC.',2,1,1,1,1,'2013-09-17 08:25:50','2013-09-17 08:25:50','Documento_150.pdf','application/pdf',5396005,'2013-09-17 08:25:50',17,0,103,'COMPLETO'),(151,'SISTEMA DE INFORMACINN PARA EL MANEJO DE CORRESPONDENCIA Y PUNTOS DE CUENTA..','El objetivo del presente Trabajo Especial de Grado ((TEG)) es desarrollar un Sistema de Informacinn Transaccional que permita el manejo de correspondencia de la presidencia y el seguimiento de puntos de cuenta aprobados en Junta Directiva del BANAVIH.. El desarrollo de este sistema se apoya en las siguientes metodologas y herramientas:: XP ((Extreme Programming)),, los patrones MVC y Singleton,, y el sistema de control de versiones Subversion.. El enfoque XP permiti al grupo de desarrollo acelerar la velocidad de construccinn de la aplicacinn,, as como tambin,, se involucr al representante del Banco en la elaboracinn del sistema,, por lo que tom confianza en el producto desde la primera iteracinn.. Por otro lado,, a travs de la implementacinn del patrnn MVC,, se intercambiaron los roles de trabajo entre iteraciones;; de esta forma,, los miembros del equipo de trabajo intervinieron en cada una de las capas de la arquitectura MVC,, por lo tanto,, cada uno pudo obtener una compresinn integral de toda la estructura de la aplicacinn.. El sistema desarrollado permitir disminuir los tiempos requeridos para la realizacinn de las tareas relacionadas con el manejo de la correspondencia y de los puntos de cuenta del BANAVIH..','2009-05-05','Sistemas de Informacinn Transaccional,, Workflow,, Correspondencia,, Punto de Cuenta,, XP,, MVC..',2,1,1,1,1,'2013-09-17 08:25:51','2013-09-17 08:25:51','Documento_151.pdf','application/pdf',4434778,'2013-09-17 08:25:51',17,0,161,'COMPLETO'),(152,'Obtencinn de un intermediario clave para la SNTESIS DE 44--AMINOQUINOLINAS SUSTITUIDAS EN LA POSICINN 88 Y CLLCULO DE las PROPIEDADES FISICOQUMICAS de 44--aminoquinolinas MEDIANTE MODELAJE MOLECULAR','En este trabajo se presenta la sntesis de 6 compuestos, con la forma general 3-carboxi -4-cloroquinolinas sustituidas en la posicin 8, y se determin las propiedades moleculares de las 4-aminoquinolinas como Log P, Energa HOMO-LUMO, Energa de solvatacin, Polaridad, Cargas y Potencial Electrosttico. La ruta sinttica empleada se indica a continuacin: Los compuestos se purificaron mediante cromatografa de columna y cuyas estructuras se verificaron por IR, RMN1H y RMN13C. Posteriormente se modelaron las 4-aminoqunolinas y se realiz la dinmica molecular utilizando el campo de fuerza MM2 implementado en el programa CAChe, para obtener la estructura de menor energa y se determinaron las propiedades termodinmicas mediante el mtodo semiemprico PM3 implementado en el programa Hyperchem 7.5 y Spartan v 2.0. Realizando el modelaje molecular se obtuvieron estructuras con geometras similares, slo con pequeas variaciones en la orientacin de la cadena aminoalqulica.En cuanto a la densidad de carga, se observ que la mayor densidad estaba centrada en el grupo carboetoxi y se logra una mayor separacin de cargas en el caso de sustituyentes atractores de electrones. Por su parte el nitrgeno N1 present valores de potencial cercanos a los valores reportados para compuestos activos, lo que resulta importante debido a que este grupo influye fuertemente en la interaccin con la hematina. Los orbitales HOMO estn centrados en el anillo quinolnico y se observan pequeas variaciones cuando se introducen sustituyentes dadores de electrones, donde el orbital se desplaza hacia el grupo ester. Al comparar algunos parmetros tales como: volumen molecular, polaridad, afinidad con el agua y deslocalizacin de carga, de los compuestos sintetizados y los reportados en la literatura que resultan ser activos, encontramos cierta similitud por lo que podra esperarse que las quinolinas sintetizadas pudiesen ser activas. Los resultados obtenidos complementan un estudio ms amplio donde se sintetizan 3-Carboetoxi-4-aminoquinolinas sustituidas en la posicin 6, 7 y 8, para realizar pruebas de citotoxicidad y de actividad contra parsitos. Adicionalmente, las propiedades y los descriptores calculados permiten ampliar una base de datos creada con el fin de realizar tanto correlaciones sencillas como mltiples con la actividad.','2009-03-23','{}',6,1,1,1,1,'2013-09-17 08:25:54','2013-09-17 08:25:54','Documento_152.pdf','application/pdf',0,'2013-09-17 08:25:54',19,0,0,'INCOMPLETO'),(153,'MODELADO TRIDIMENSIONAL DE LA ESTRUCTURA LITOSFRRICA DE LA REGINN NOR-- OCCIDENTAL DE VENEZUELA Y NORTE DE COLOMBIA CON BASE EN DATOS DE GRAVEDAD Y MAGNETISMO..','Por medio de mtodos estadsticos se realiz una inversin con base en datos de gravedad y magnetismo, para elaborar un modelo tridimensional de la corteza en la zona de interaccin de las placas Caribe y Suramericana. En nuestro mtodo asignamos a cada una de las distintas capas del modelo cortical, informacin estadstica previa sobre la estructura y estadsticas de las propiedades fsicas representadas: densidad y susceptibilidad magntica. Se estudi un modelo de siete y ocho capas, que incluye la subduccin de la placa del Caribe bajo la placa Suramericana. El trabajo tiene por objetivo evaluar el modelo geolgico en esta compleja regin de interaccin de placas. En los resultados obtenidos en las inversiones realizadas, se observa que el modelo explica con precisin las anomalas gravimtricas y magnticas. Nuestros resultados muestran una subduccin incipiente de la placa Caribe penetrando con un ngulo de inclinacin de aproximadamente 30 bajo la placa continental, con un alcance de al menos 200-250 km al sur del prisma de acreecin y alcanza una profundidad mxima de aproximadamente 160 km.','2009-01-22','Noroccidente de Venezuela, Norte de Colombia, Monte Carlo, Placa Caribe, Gravedad, Magnetismo, Subduccin, Prisma de acreecin.',3,1,1,1,1,'2013-09-17 08:25:55','2013-09-17 08:25:55','Documento_153.pdf','application/pdf',4149808,'2013-09-17 08:25:55',19,0,107,'COMPLETO'),(154,'Evolucin estratigrfica del comportamiento de los elementos mayoritarios, minoritarios y trazas durante el Cuaternario Tardo de la Laguna de Mucubaj, estado Mrida.','El presente trabajo de investigacin tuvo como objetivo reconocer la seal y patrones de distribucin de elementos mayoritarios, minoritarios y trazas, que puedan caracterizar el impacto de los efectos geoqumicos, sedimentarios y posiblemente climticos del Cuaternario reciente, a travs de los sedimentos de la Laguna de Mucubaj, estado Mrida. Se recolectaron ncleos en la Laguna de Mucubaj y se analiz el ncleo MUCL 02-02-04, del que se tomaron 91 muestras. El trabajo de laboratorio consisti en tratamiento y anlisis fsico (descripcin de las muestras, secado y pulverizado), anlisis qumicos y estadsticos multivariado. Los anlisis qumicos consistieron en la determinacin de elementos mayoritarios, minoritarios y trazas mediante la tcnica de EEO-IAP y determinacin de voltiles a travs de la tcnica de prdida al rojo. Para el anlisis estadstico se realiz un anlisis exploratorio de datos que incluy histogramas para determinar la normalidad de los datos y cajas grficas para detectar valores anmalos, tambin se realiz un anlisis multivariado por agrupamiento. Dentro de los resultados obtenidos en base a las caractersticas granulomtricas se determin una fase de Turbidita y una fase Lacustre, los anlisis de agrupamiento para ambas fases dieron como resultados dos quimiofacies. Para la turbidita una quimiofacies de homogenita y una base de turbidita y para la fase lacustre una quimiofacies de clsticos finos y otra de clsticos gruesos. Determinando dos eventos importantes dentro de la sedimentacin, una fase relacionada a sedimentacin climtica representada en la fase lacustre en la base de la secuencia y una fase turbidtica descrita a una sedimentacin sismotectnica.','2009-02-17','v:* {behavior:url(#default#VML);} o:* {behavior:url(#default#VML);} w:* {behavior:url(#default#VML);} .shape {behavior:url(#default#VML);} Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 st1:* {behavior:url(#ieooui) } /* Style',4,1,1,1,1,'2013-09-17 08:25:57','2013-09-17 08:25:57','Documento_154.pdf','application/pdf',976864,'2013-09-17 08:25:57',14,0,75,'COMPLETO'),(155,'Integracin del Repositorio de AMBAR con el Repositorio de Metadata a travs de la Capa de Servicios','El presente trabajo consiste en la integracin de la base de datos (BD) del SIG-AMBAR con el Repositorio de Metadata a travs de la Capa de Servicios Web, asociada slo a los Objetos de Aprendizaje.Actualmente, AMBAR es un proyecto que posee dos aplicaciones, donde cada aplicacin maneja informacin sobre el mismo recurso, el cual es llamado Objeto de Aprendizaje (OA). Por un lado, se tiene la base de datos (BD) del SIG-AMBAR que almacena OA, pero no posee una organizacin estructurada de los atributos que describen a estos, es decir, los metadatos. Y por otro lado, se tiene el repositorio de Metadata el cual posee toda una estructura estandarizada de los atributos que describen a los OA, por tanto, al integrar estas aplicaciones, se est facilitando la bsqueda, recuperacin, catalogacin y administracin de los OA.La definicin de los Servicios Web para el acceso a la BD del SIG-AMBAR mejora la interoperabilidad entre las diferentes aplicaciones que constituirn el sistema, ya que stos ofrecen una alternativa de software independiente en cuanto a la plataforma, basada en estndares para la integracin de aplicaciones, la automatizacin de procesos de negocio y la publicacin de la informacin de diversas fuentes. El contar con una infraestructura integrada, segura, escalable y disponible, disminuye los costos y permite compartir informacin de manera confiable.La integracin de los repositorios de metadata y de OA, proporciona un espacio para manipular OA que pueden ser almacenados y recuperados de manera eficiente. Los objetos ahora sern descritos a travs de una metadata que obedece a las especificaciones de un estndar mundial especializado para describirla, llamado Learning Object Metadata (LOM), que permite identificarlos para luego potenciar su bsqueda, evaluacin, obtencin y reutilizacin.Las tecnologas y herramientas utilizadas por ambas aplicaciones contribuyeron al desarrollo exitoso de la integracin. La tecnologa JSP, que permite generar contenido dinmico para ambiente Web con programacin en java, lenguaje orientado a objetos para el desarrollo de los Servicios Web; Servidor de Apache Tomcat, servidor que se utiliz como contenedor Web de la aplicacin; Axis y Axis2, implementacin de SOAP (Simple Object Access Protocol) que proporciona el entorno para la ejecucin y publicacin de los Servicios Web, entre otros.Es importante resaltar que el proceso de integracin se realizara nicamente sobre los Objetos de Aprendizaje debido a que el repositorio de metadata slo almacena informacin descriptiva sobre ellos y no informacin adicional.','2009-04-27','Objetos de aprendizaje (OA), Metadata, Repositorio de Objetos de Aprendizaje, Repositorio de Metadata, Servicios Web, LOM.',2,1,1,1,1,'2013-09-17 08:25:58','2013-09-17 08:25:58','Documento_155.pdf','application/pdf',3124001,'2013-09-17 08:25:58',20,0,177,'COMPLETO'),(156,'ESTUDIOS DE LOS COMPLEJOS DE VANDIO V Y ACIDO ASPARTICO POR MEDIO DE MEDIDAS DE FUERZA ELECTROMOTRIZ A 25 C KCL 3 M.','{}','2009-04-02','FUERZA ELECTROMOTRIZ, VANADIO V,ACIDO ASPARTICO,COMPLEJOS DEBILES Y FUERTES, LEY DE ACCION DE MASAS',6,1,1,1,1,'2013-09-17 08:26:00','2013-09-17 08:26:00','Documento_156.pdf','application/pdf',0,'2013-09-17 08:26:00',20,0,0,'INCOMPLETO'),(157,'Determinacion de Au, As, Al, Zn, Pb, Sb, Cu, y Mg en sedimentos de la cuenca del rio Cuira.','Muestras de sedimentos fluviales fueron recolectadas en la cuenca del rio Cuira, Parque Nacional Guatopo, con la finalidad de determinar su distribucion granulometrica y concentraciones de Au, Al, Mg, Cu, Pb, Zn, As y Sb a lo largo y ancho de la cuenca. Para ello fueron separados los sedimentos a traves de tamices de 10, 18, 35,60, 120,230 y 325 mallas de cada uno de los 26 puntos de muestreo, determinandose que la distribucion granulometrica es semejante en toda la cuenca, dominando las fracciones correspondientes a arenas gruesas y muy gruesas\nPara la determinacion de como se distribuyen las concentraciones de los elementos mencionados en la cuenca, fueron seleccionadas 9 muestras para realizarles analisis quimicos a los extractos obtenidos de la digestion con agua regia en cada una de las siete fracciones granulometricas, a traves de espectrometria de emision atomica inductivamente acoplado a plasma (ICP-AES), encontrando que los elementos trazas Cu y Zn mantienen una tendencia de enriquecerse a medida de que el grano es mas fino, es decir de menor concentracion en arenas gruesas a mayor concentracion en limo- arcilla.\nLa distribucion espacial de los elementos indica que el Al, Mg, se distribuyen homogeneamente en la cuenca, mientras que elementos como As y Sb tienden a estar enriquecidos en la subunidad de metatobas al este de la cuenca del rio Cuira, por su parte el Cu, Pb y Zn , presentan una dispersion heterogenea en la cuenca .','2009-02-17','{}',4,1,1,1,1,'2013-09-17 08:26:00','2013-09-17 08:26:00','Documento_157.pdf','application/pdf',0,'2013-09-17 08:26:00',17,0,0,'INCOMPLETO'),(158,'Clculo de la Cohomologa de De Rham de los Espacios Proyectivos por medio de la Sucesin de Gysin','{}','2009-04-28','Cohomologa de De Rham, Espacio Proyectivo Complejo, Sucesin de Gysin',5,1,1,1,1,'2013-09-17 08:26:01','2013-09-17 08:26:01','Documento_158.pdf','application/pdf',0,'2013-09-17 08:26:01',20,0,0,'INCOMPLETO'),(159,'AUTOMATIZACIN DE PROCESOS RELACIONADOS CON LAS SOLICITUDES ESTUDIANTILES Y ACTIVIDADES ADMINISTRATIVAS Y DE DOCENCIA DE LA FACULTAD DE CIENCIAS.','El objetivo del presente Trabajo Especial de Grado consiste en el desarrollo de unaaplicacin Web que automatice el conjunto de procesos relacionados con las diversassolicitudes estudiantiles y actividades que realizan las escuelas y dependencias de laFacultad de Ciencias, en relacin con la Divisin de Control de Estudios; dando soporteal personal involucrado, para aumentar as su satisfaccin, y al mismo tiempo optimizarlos costos y los tiempos de respuesta. Para ello, se aplic una adaptacin del mtodo deDesarrollo Rpido de Aplicaciones, donde se realiz la fase de Planeacin deRequerimientos para cada proceso, el Taller de Diseo el cul se divide en iteraciones yla Implementacin para la aplicacin de pruebas. Como producto final, se obtuvo unaintegracin de estos procesos con la aplicacin Web denominada CONEST, queactualmente representa el sistema de gestin acadmica de la Divisin de Control deEstudios de la Facultad de Ciencias en la Universidad Central de Venezuela.','2008-05-20','Tecnologas para el desarrollo de Aplicaciones Web, Modelo Vista Controlador (MVC),Ruby on Rails, Cliente/Servidor, Solicitudes Estudiantiles, Divisin de Control deEstudios, CONEST.',2,1,1,1,1,'2013-09-17 08:26:02','2013-09-17 08:26:02','Documento_159.pdf','application/pdf',4474200,'2013-09-17 08:26:02',20,0,169,'COMPLETO'),(160,'MODELADO TRIDIMENSIONAL DE LA ESTRUCTURA LITOSFRICA DE LA REGIN NOR- OCCIDENTAL DE VENEZUELA Y NORTE DE COLOMBIA CON BASE EN DATOS DE GRAVEDAD Y MAGNETISMO.','Por medio de mtodos estadsticos se realiz una inversin con base en datos de gravedad y magnetismo, para elaborar un modelo tridimensional de la corteza en la zona de interaccin de las placas Caribe y Suramericana. En nuestro mtodo asignamos a cada una de las distintas capas del modelo cortical, informacin estadstica previa sobre la estructura y estadsticas de las propiedades fsicas representadas: densidad y susceptibilidad magntica. Se estudi un modelo de siete y ocho capas, que incluye la subduccin de la placa del Caribe bajo la placa Suramericana. El trabajo tiene por objetivo evaluar el modelo geolgico en esta compleja regin de interaccin de placas. En los resultados obtenidos en las inversiones realizadas, se observa que el modelo explica con precisin las anomalas gravimtricas y magnticas. Nuestros resultados muestran una subduccin incipiente de la placa Caribe penetrando con un ngulo de inclinacin de aproximadamente 30 bajo la placa continental, con un alcance de al menos 200-250 km al sur del prisma de acreecin y alcanza una profundidad mxima de aproximadamente 160 km.','2009-01-22','Noroccidente de Venezuela, Norte de Colombia, Monte Carlo, Placa Caribe, Gravedad, Magnetismo, Subduccin, Prisma de acreecin.',3,1,1,1,1,'2013-09-17 08:26:03','2013-09-17 08:26:03','Documento_160.pdf','application/pdf',0,'2013-09-17 08:26:03',19,0,0,'INCOMPLETO'),(161,'Integracin del Repositorio de AMBAR con el Repositorio de Metadata a travs de la Capa de Servicios','El presente trabajo consiste en la integracin de la base de datos (BD) del SIG-AMBAR con el Repositorio de Metadata a travs de la Capa de Servicios Web, asociada slo a los Objetos de Aprendizaje.Actualmente, AMBAR es un proyecto que posee dos aplicaciones, donde cada aplicacin maneja informacin sobre el mismo recurso, el cual es llamado Objeto de Aprendizaje (OA). Por un lado, se tiene la base de datos (BD) del SIG-AMBAR que almacena OA, pero no posee una organizacin estructurada de los atributos que describen a estos, es decir, los metadatos. Y por otro lado, se tiene el repositorio de Metadata el cual posee toda una estructura estandarizada de los atributos que describen a los OA, por tanto, al integrar estas aplicaciones, se est facilitando la bsqueda, recuperacin, catalogacin y administracin de los OA.La definicin de los Servicios Web para el acceso a la BD del SIG-AMBAR mejora la interoperabilidad entre las diferentes aplicaciones que constituirn el sistema, ya que stos ofrecen una alternativa de software independiente en cuanto a la plataforma, basada en estndares para la integracin de aplicaciones, la automatizacin de procesos de negocio y la publicacin de la informacin de diversas fuentes. El contar con una infraestructura integrada, segura, escalable y disponible, disminuye los costos y permite compartir informacin de manera confiable.La integracin de los repositorios de metadata y de OA, proporciona un espacio para manipular OA que pueden ser almacenados y recuperados de manera eficiente. Los objetos ahora sern descritos a travs de una metadata que obedece a las especificaciones de un estndar mundial especializado para describirla, llamado Learning Object Metadata (LOM), que permite identificarlos para luego potenciar su bsqueda, evaluacin, obtencin y reutilizacin.Las tecnologas y herramientas utilizadas por ambas aplicaciones contribuyeron al desarrollo exitoso de la integracin. La tecnologa JSP, que permite generar contenido dinmico para ambiente Web con programacin en java, lenguaje orientado a objetos para el desarrollo de los Servicios Web; Servidor de Apache Tomcat, servidor que se utiliz como contenedor Web de la aplicacin; Axis y Axis2, implementacin de SOAP (Simple Object Access Protocol) que proporciona el entorno para la ejecucin y publicacin de los Servicios Web, entre otros.Es importante resaltar que el proceso de integracin se realizara nicamente sobre los Objetos de Aprendizaje debido a que el repositorio de metadata slo almacena informacin descriptiva sobre ellos y no informacin adicional.','2009-04-27','Objetos de aprendizaje (OA), Metadata, Repositorio de Objetos de Aprendizaje, Repositorio de Metadata, Servicios Web, LOM.',2,1,1,1,1,'2013-09-17 08:26:04','2013-09-17 08:26:04','Documento_161.pdf','application/pdf',4144360,'2013-09-17 08:26:04',20,0,116,'COMPLETO'),(162,'Integracin del Repositorio de AMBAR con el Repositorio de Metadata a travs de la Capa de Servicios','El presente trabajo consiste en la integracin de la base de datos (BD) del SIG-AMBAR con el Repositorio de Metadata a travs de la Capa de Servicios Web, asociada slo a los Objetos de Aprendizaje.Actualmente, AMBAR es un proyecto que posee dos aplicaciones, donde cada aplicacin maneja informacin sobre el mismo recurso, el cual es llamado Objeto de Aprendizaje (OA). Por un lado, se tiene la base de datos (BD) del SIG-AMBAR que almacena OA, pero no posee una organizacin estructurada de los atributos que describen a estos, es decir, los metadatos. Y por otro lado, se tiene el repositorio de Metadata el cual posee toda una estructura estandarizada de los atributos que describen a los OA, por tanto, al integrar estas aplicaciones, se est facilitando la bsqueda, recuperacin, catalogacin y administracin de los OA.La definicin de los Servicios Web para el acceso a la BD del SIG-AMBAR mejora la interoperabilidad entre las diferentes aplicaciones que constituirn el sistema, ya que stos ofrecen una alternativa de software independiente en cuanto a la plataforma, basada en estndares para la integracin de aplicaciones, la automatizacin de procesos de negocio y la publicacin de la informacin de diversas fuentes. El contar con una infraestructura integrada, segura, escalable y disponible, disminuye los costos y permite compartir informacin de manera confiable.La integracin de los repositorios de metadata y de OA, proporciona un espacio para manipular OA que pueden ser almacenados y recuperados de manera eficiente. Los objetos ahora sern descritos a travs de una metadata que obedece a las especificaciones de un estndar mundial especializado para describirla, llamado Learning Object Metadata (LOM), que permite identificarlos para luego potenciar su bsqueda, evaluacin, obtencin y reutilizacin.Las tecnologas y herramientas utilizadas por ambas aplicaciones contribuyeron al desarrollo exitoso de la integracin. La tecnologa JSP, que permite generar contenido dinmico para ambiente Web con programacin en java, lenguaje orientado a objetos para el desarrollo de los Servicios Web; Servidor de Apache Tomcat, servidor que seutiliz como contenedor Web de la aplicacin; Axis y Axis2, implementacin de SOAP (Simple Object Access Protocol) que proporciona el entorno para la ejecucin y publicacin de los Servicios Web, entre otros.Es importante resaltar que el proceso de integracin se realizara nicamente sobre los Objetos de Aprendizaje debido a que el repositorio de metadata slo almacena informacin descriptiva sobre ellos y no informacin adicional.','2009-04-27','Objetos de aprendizaje (OA), Metadata, Repositorio de Objetos de Aprendizaje, Repositorio de Metadata, Servicios Web, LOM.',2,1,1,1,1,'2013-09-17 08:26:06','2013-09-17 08:26:06','Documento_162.pdf','application/pdf',0,'2013-09-17 08:26:06',20,0,0,'INCOMPLETO'),(163,'Segmentacin Semiautomtica de Imgenes Digitales basada en GrabCut','En la actualidad la segmentacin de imgenes a tomado gran importancia debido al avance en el poder de computo y a la gran utilidad de la segmentacin, como el tratamiento de imgenes medica, y la extraccin de reas de inters para diversos campos de trabajo. Uno de las tcnicas mas novedosas y que provee mejores resultados con muy poca intervencin del usuario es la llamada GrabCut, la cual utilizando modelos estadsticos y algoritmos de grafos, permite obtener un objeto de inters dentro de una imagen digital.','2009-04-17','Segmentacin, Imagen, Digital, imgenes digitales, deteccin de bordes, siluetas, binario, computacin.',2,1,1,1,1,'2013-09-17 08:26:08','2013-09-17 08:26:08','Documento_163.pdf','application/pdf',5547432,'2013-09-17 08:26:08',20,0,0,'INCOMPLETO'),(164,'SISTEMA DE INFORMACION PARA LA MEDICIN Y ANLISIS DE LA PRESENCIA DE INFORMACIN EN LOS MEDIOS DE COMUNICACIN(APLICACIN: MEDIOS IMPRESOS)','El presente Trabajo Especial de grado tiene como finalidad organizar, acceder, procesar, recuperar y distribuir la informacin de un medio de comunicacin. Creando una herramienta tecnolgica que permita la medicin de la presentacin de la informacin suministrada por los distintos medios, para el subsecuente anlisis y comprensin de los cambios sociales, polticos y econmicos del entorno de inters.','2009-03-06','Comunicacin, Web, medios, prensa escrita, anlisis morfolgico, anlisis de contenido, investigar, organizar, analizar, ponderar, valorar.',2,1,1,1,1,'2013-09-17 08:26:09','2013-09-17 08:26:09','Documento_164.pdf','application/pdf',893048,'2013-09-17 08:26:09',20,0,82,'COMPLETO'),(165,'SISTEMA DE INFORMACION PARA LA MEDICIN Y ANLISIS DE LA PRESENCIA DE INFORMACIN EN LOS MEDIOS DE COMUNICACIN. (APLICACIN: MEDIOS IMPRESOS)','El presente Trabajo Especial de grado tiene como finalidad organizar, acceder, procesar, recuperar y distribuir la informacin de un medio de comunicacin. Creando una herramienta tecnolgica que permita la medicin de la presentacin de la informacin suministrada por los distintos medios, para el subsecuente anlisis y comprensin de los cambios sociales, polticos y econmicos del entorno de inters.','2009-03-06','Comunicacin, Web, medios, prensa escrita, anlisis morfolgico, anlisis de contenido, investigar, organizar, analizar, ponderar, valorar.',2,1,1,1,1,'2013-09-17 08:26:11','2013-09-17 08:26:11','Documento_165.pdf','application/pdf',980537,'2013-09-17 08:26:11',20,0,86,'COMPLETO'),(166,'Desarrollo de un Mdulo de generacin de reportes para el sistema CONEST de la Facultad de Ciencias.','Actualmente la Divisin de Control de Estudios de la Facultad de Ciencias de la Universidad Central de Venezuela dispone de una aplicacin Web denominada CONEST, la cual se encarga de automatizar sus procesos y a su vez almacena toda la informacin correspondiente a la gestin acadmica de la Facultad. Para los distintos procesos que lleva a cabo la Divisin de Control de Estudios es necesario emitir una serie de reportes, para los cuales no poseen una herramienta que les permita elaborarlos, adems actualmente el modelo de datos de este sistema posee alrededor de 140 tablas y esto dificulta la tarea de elaboracin de reportes. Dada esta situacin, en el presente Trabajo Especial de Grado se desarroll una aplicacin, la cual es a su vez un mdulo del sistema CONEST, que est dedicado exclusivamente a la generacin y administracin de reportes a partir de los datos almacenados en el repositorio de datos, todo esto basndose en el estudio de algunos generadores de reportes comerciales, analizando la forma como estos, a travs de secuencias ordenadas de pasos (wizards), apoyan al usuario en la tarea de elaboracin de reportes. Entre los aspectos de desarrollo de esta aplicacin tenemos el diseo del wizard que permite la creacin de los reportes de una forma ms sencilla, el desarrollo de los algoritmos de exportacin de datos a los formatos soportados, el anlisis del modelo de datos actual de CONEST, en base al cual se disearon un conjunto de vistas que faciliten el acceso a los datos y la integracin con el sistema CONEST.','2009-06-08','Reporte, Ruby on Rails, Wizard, MySQL, Vistas.',2,1,1,1,1,'2013-09-17 08:26:12','2013-09-17 08:26:12','Documento_166.pdf','application/pdf',2677157,'2013-09-17 08:26:12',20,0,0,'INCOMPLETO'),(167,'Estudio de desempeo en un ambiente \nde comunicacin Bluetooth. \nCaso de estudio Piconet y Scatternet.\n','La siguiente investigacin trata de presentar un mtodo que permita la interconexin de varias Piconets (una red de dispositivos que se conectan utilizando Bluetooth), estas agrupaciones son conocidas con el nombre de Scatternet y estudiaremos el impacto en el desempeo de la comunicacin extremo a extremo entre diversos dispositivos Bluetooth.\n	A pesar de la popularidad de la tecnologa Bluetooth para la interconexin inalmbrica de dispositivos electrnicos tales como: teclados, mouse, impresoras, telfonos mviles, auriculares, PDA (Asistente Digital Personal) y computadores; existen pocos trabajos de investigacin para la implementacin y medicin de desempeo de la topologa de comunicacin Scatternet Bluetooth. Adicionalmente, tanto la especificacin del grupo especial de investigacin SIG (special interest group) Bluetooth creadores de la tecnologa y el estndar de la IEEE 802.15.1 no definen un mecanismo para la creacin de esta topologa, lo que motiv el desarrollo de esta investigacin. \n	En esta investigacin se presenta una metodologa para la implementacin  de la estructura de comunicacin Scatternet, desarrollado sobre una plataforma Linux en particular la distribucin Ubuntu 8.04  Hardy Heron, adicionalmente se usaron los siguientes recursos: el perfil PAN (Personal Area Network), las bibliotecas y herramientas brindadas por Bluez (pila oficial de protocolos Bluetooth para Linux).\n	Se disearon un conjunto de escenarios con diversas topologas con el objeto de evaluar el desempeo en las comunicaciones con la tecnologa Bluetooth e identificar aquellos factores que lo degradan\n	El conjunto de medidas obtenidas a partir de las pruebas realizadas, mostraron un bajo desempeo en topologas con saltos o nodos intermedios y en topologas pobladas con trfico.\n','2009-06-23','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Table Normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',2,1,1,1,1,'2013-09-17 08:26:14','2013-09-17 08:26:14','Documento_167.pdf','application/pdf',736911,'2013-09-17 08:26:14',20,0,81,'COMPLETO'),(168,'Trabajo Especial de grado presentado ante la ilustre Universidad Central de Venezuela, por el Br. Julian Rueda, para optar por el ttulo de Licenciado en Qumica. \"\"ESTUDIO DE LA INCORPORACION DE NIQUEL EN LA SILICE MESOPOROSA SBA--1155 PARA LA REACCION DE ALQUILACION FRIEDEL--CRAFTS\"\"','En este Trabajo Especial de Grado se sintetizaron 3 slidos mesoporosos SBA-15 incorporando nquel, dos de ellos preparados mediante la tcnica de impregnacin por humedad incipiente con 15 y 25% p/p de carga del metal y el ultimo mediante sntesis directa con 25% de Ni. Los slidos fueron caracterizados mediante estudios de Fisisorcin de N2 e Isotermas de Adsorcin- Desorcin, anlisis BET, Espectroscopia IR, TGA, DRX, anlisis qumico elemental y TPR. Estos slidos se utilizaron como catalizadores en la reaccin de alquilacin Friedel-Crafts de benceno, tolueno, anisol, nitrobenceno, naftaleno y 8-hidroxiquinolina, empleando cloruro de bencilo como agente alquilante. Se pudo confirmar gracias a los anlisis de TGA, DRX, IR y BET que se obtuvieron los slidos mesoporosos SBA-15 satisfactoriamente, observndose sus caractersticas texturales y estructurales tpicas aun despus de la incorporacin del nquel. Los anlisis de TPR y de DRX reflejaron que la especie activa catalticamente de nquel se encontraba como NiO. Los sistemas de catalizadores NiO-SBA-15 presentaron bajas actividades con los sustratos utilizados para las alquilaciones Friedel-Crafts, esto atribuido a la baja acides Lewis de las especies de Ni+2. Los anlisisespectroscpicos indicaron que los productos obtenidos son compuestos monoalquilados, lo cual sugiere que estos catalizadores son altamente selectivos para productos monosustituidos. Adems, la alquilacin de nitrobenceno se llev a cabo sobre estos catalizadores.','2009-06-29','Catalisis, niquel, SBA-15, alquilacin, Friedel-Crafts',6,1,1,1,1,'2013-09-17 08:26:18','2013-09-17 08:26:18','Documento_168.pdf','application/pdf',1508968,'2013-09-17 08:26:18',18,0,86,'COMPLETO'),(169,'Implantacion de una Plataforma de Software Colaborativo que Permita Integrar Servicios Ofertados por la Facultad de Ciencias','En este trabajo se desarroll e implant una aplicacin que permita el acceso centralizado a un conjunto de servicios propios de la Facultad de Ciencias de la Universidad Central de Venezuela, como lo son: La solicitud y administracin de los soportes tcnicos, el acceso al sistema de reservacin de salas, el acceso a un cliente de mensajera instantnea y la integracin de un sistema de administracin de foros que permita mantener hilos de discusin entre los usuarios de la intranet.','2009-07-16','Intranet, Comunicacin, Centralizacin, Sistema Colaborativo, PHP, JavaScript.',2,1,1,1,2,'2013-09-17 08:26:19','2013-09-17 08:26:19','Documento_169.pdf','application/pdf',0,'2013-09-17 08:26:19',20,0,0,'INCOMPLETO'),(170,'Registro de imgenes mdicas multimodalidad.','En la actualidad es habitual realizar diferentes estudios al mismo paciente o espcimen, ya sea empleando imgenes adquiridas a lo largo del tiempo bajo la misma modalidad o bajo distintas modalidades. En la investigacin de ciertas enfermedades se contrastan incluso con imgenes pertenecientes a diferentes sujetos. Para comparar la informacin obtenida de los diferentes estudios es necesario corregir las diferencias de tamao, posicionamiento, orientacin o incluso distorsin espacial entre ellos. Se denomina registro al proceso de establecer la concordancia espacial punto a punto entre las diferentes imgenes, de manera que sea posible la comparacin directa entre ellas. Se propone una metodologa para el registro de imgenes mdicas bidimensionales y tridimensionales obtenidas bajo diferentes modalidades. Las imgenes a considerar son de resonancia magntica (MR), tomografa computarizada (CT) y tomografa por emisin de positrones (PET) del cerebro. Para realizar el registro se determina una transformacin espacial T que ponga en concordancia espacial a una imagen A, que se denominara imagen referencia, con otra imagen B, imagen a registrar. La aplicacin de la transformacin TT sobre la imagen B genera la imagen registrada B\'\'. Considerando las imgenes como matrices el problema se reduce a encontrar una matriz T cambio de base entre la imagen referencia y la imagen a registrar. La metodologa propuesta para el registro de imgenes comprende: pre-procesamiento, transformacin, comparacin y optimizacin. El pre- procesamiento corresponde a la aplicacin de diferentes tcnicas de procesamiento de imgenes para reducir el ruido, re-escalar y segmentar las imgenes de manera apropiada para la correspondencia. La trasformacin permite el clculo de los coeficientes de T para obtener la imagen registrada, establece la relacin entre los puntos del espacio de la imagen A y los del espacio de la imagen B. Se emplean transformaciones rgidas o afines, porque la aplicacin se delimita a imgenes cerebrales intra-sujeto donde la forma generalmente es constante. El proceso de comparacin permite cuantificar el nivel de alineamiento entre las imgenes Ay B\'\',, para ello se plantean como mtricas aplicables a diferentes tipos de registro el coeficiente de correlacin y la informacin mutua que es una mtrica basada en la teora de la informacin. El problema de registro generalmente se basa en determinar los parmetros de la transformacin que hacen que la mtrica de comparacin sea mxima, para ello es necesario encontrar el valor ptimo de esta medida definido por los grados de libertad de la transformacin TT. Se utiliza el mtodo simplex como proceso de optimizacin, que es un mtodo basado en bsqueda de direcciones, partiendo de un simplex inicial se realiza un proceso iterativo que evala las funciones en estos puntos encontrando el valor ms ptimo realizando una serie de transformaciones hasta cumplir con los criterios de paradas establecidos.','2009-07-08','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',5,1,1,1,1,'2013-09-17 08:26:20','2013-09-17 08:26:20','Documento_170.pdf','application/pdf',0,'2013-09-17 08:26:20',20,0,0,'INCOMPLETO'),(171,'ESTUDIO DE LA RESPUESTA DE GELES POLIMRICOS A LA RADIACIN IONIZANTE MEDIANTE SIMULACIN DE LA ALTERACIN DE SU ESTRUCTURA CON MODELOS DE GASES RETICULARES','{}','2009-04-28','Radiacin Ionizante, Geles, polmeros, Simulacin, modelo, automata',3,1,1,1,1,'2013-09-17 08:26:21','2013-09-17 08:26:21','Documento_171.pdf','application/pdf',969231,'2013-09-17 08:26:21',18,0,81,'COMPLETO'),(172,'Un compilador portable para una notacin Algortmica Bsica','Un compilador puede definirse como un traductor; puede traducir instrucciones a un \"idioma\" que entiende un computador. Este trabajo muestra la investigacin e implementacin que tom la construccin de un compilador que entiende cdigo escrito en un lenguaje natural y lo traduce a cdigo que entiende la maquina virtual de Java. La MV de Java tiene una arquitectura muy parecida a las maquinas fsicas de hoy en da, es portable y poderosa lo cual la hace una buena opcin para este compilador. Fue creado con herramientas que se consiguen en casi todas las plataformas para que pueda ser instalado en cualquier computadora. Estas herramientas son muy poderosas, pueden crear analizadores lexicogrficos y sintcticos, facilitan el manejo de errores y son fciles de entender. El resultado es un compilador Java de un lenguaje con conceptos bsicos de la programacin que tiene muchas posibilidades de extenderse, como aadir conceptos avanzados en investigaciones futuras.','2009-07-08','compilador java pseudoformal bison yacc flex lex portable traduccion',2,1,1,1,1,'2013-09-17 08:26:22','2013-09-17 08:26:22','Documento_172.pdf','application/pdf',1790887,'2013-09-17 08:26:22',20,0,101,'COMPLETO'),(173,'\"\"HIDROTRATAMIENTO DE UN RESIDUO DE REFINERAA,, EMPLEANDOCATALIZADORES EN BASE A Mo,, Ni--Mo y Co--Mo SOPORTADOS Y ACTIVADOSCON COMPUESTOS ORGNNICOS DE AZUFRE\"\"..','Debido a restricciones cada vez mayores en el campo ambiental, existe un intersespecial a nivel global en el desarrollo de catalizadores ms selectivos para el procesode hidrotratamiento (HDT) de combustibles fsiles. El mejoramiento de los catalizadorespara HDT considera el entendimiento de sus propiedades fsicas y qumicas las cualesse ven afectadas por el uso de distintos materiales como soportes y la interaccin de losmismos con las fases metlicas que constituyen los centros activos. En este aspectolos mtodos de preparacin de los precursores catalticos, incluyendo los procesos demodificacin, juegan un papel fundamental en favorecer la actividad para la remocinde compuestos sulfurados y nitrogenados.El siguiente trabajo de grado se enfoc en un mtodo de sntesis que implica lamodificacin de la superficie del soporte con g-aminopropiltrietoxisilano (GAPS) con el objetivo de sintetizar nanocatalizadores de sulfuros de CoMo, NiMo y Mo. Lamodificacin consiste en el anclaje de grupos organometlicos en la superficie de lasepiolita que luego es expuesta a la adsorcin de los iones Co2+, seguidos de la formacin de clorhidratos que permite el intercambio inico de los iones cloruros con laespecie de Mo6+ de la sal empleada. La modificacin del soporte permiti que hasta 4% de carga metlica fuera depositada en el soporte, siendo este valor menor que la cargametlica de los catalizadores comerciales utilizados actualmente en la industria yutilizados como referencia en este trabajo. El carbono formado in-situ, actu comosoporte, mejorando la dispersin de la fase metlica y evitando la interaccin directacon la sepiolita. Los precursores catalticos fueron activados con disulfuro de carbono(CS2) como agente sulfurante con una composicin definida de H2/CS2 a baja temperatura (- 18;-20C), proveyendo la composicin necesaria para la activacin delprecursor cataltico. Los mtodos empleados para la caracterizacin del soporte, los precursores catalticos,los catalizadores sintetizados y el gasleo proveniente de la destilacin al vaco (VGO)una vez hidrotratado, fueron establecidos por las siguientes tcnicas: rea Especfica,Espectroscopa de Infrarrojo (IR-TF) y Anlisis Termogravimtrico. Con este ltimo, sedetermin la cantidad total de carbono depositado sobre la superficie del catalizador,donde se pudo observar que en el catalizador NiMo se form menos capa carboncea,posiblemente por la tendencia hacia un mecanismo de reaccin que involucra lapresencia de H..proveniente de un proceso de spill--over, facilitado por NiS altamente disperso.La actividad de los catalizadores fue medida por un proceso de hidrotratamientoempleando un reactor por carga, bajo las mismas condiciones en la reaccin de HDSde un residuo de refinera. Los catalizadores bimtalicos diseados mostraron unamayor actividad con relacin al comercial, a pesar que este ltimo posee una cargametlica 3 veces superior. Esto pone en relieve el valor del mtodo de preparacin conGAPS para obtener catalizadores ms activos y contribuir al desarrollo de la industriade la refinacin petrolera venezolana, en uno de los principales de procesos como lo esel hidrotratamiento cataltico.','2009-06-23','{}',6,1,1,1,1,'2013-09-17 08:26:25','2013-09-17 08:26:25','Documento_173.pdf','application/pdf',0,'2013-09-17 08:26:25',20,0,0,'INCOMPLETO'),(174,'SINTESIS DE 1-BENZOIL-1,2-DIHIDROQUINOLINAS SUSTITUIDAS COMO POSIBLES INHIBIDORES DE LA POLIMERIZACION DE TUBULINA','El cancer es considerado como una enfermedad del ciclo celular, un proceso complejo que consta de cuatro fases: gap 1 (G1), sintesis de ADN (S), gap 2 (G2) y mitosis (M). Los quimioterapeuticos actuan sobre las diversas fases del ciclo celular; uno de sus modos de accion es la inhibicion de la mitosis celular por despolimerizacion de los microtubulos, evitando la formacion del huso mitotico, la segregacion cromosomica y la citocinesis. Entre los despolimerizadores de microtubulos estan: La colchicina y derivados, la esteganacina y las combretastatinas. Considerando las caracteristicas estructurales comunes presentes en estos compuestos, se diseo la sintesis de un grupo de 1-benzoil-1,2-dihidroquinolinas sustituidas con caracteristicas estructurales semejantes a los compuestos previos, entre las que destacan un anillo trimetoxibencenico y un anillo aromatico con dos sustituyentes oxigenados adyacentes. Los compuestos obtenidos fueron caracterizados usando las tecnicas espectroscopicas masas, IR, RMN 1H y 13C.','2009-06-30','1-benzoil-1,2-dihidroquinolinas, mitosis, microtubulos, tubulina, ciclo celular.',6,1,1,1,1,'2013-09-17 08:26:26','2013-09-17 08:26:26','Documento_174.pdf','application/pdf',0,'2013-09-17 08:26:26',18,0,0,'INCOMPLETO'),(175,'Anlisis Espectral al Registro de Alturas de Olas y Aplicaciones al Caribe del Sur','Se trata de un trabajo que explica el modelado de la superficie del mar como una superficie aleatoria y algunas tcnicas de Anlisis Espectral aplicadas a varios registros de alturas de olas tomados de una boya ubicada en el mar Caribe Sur.','2009-07-10','Clculo Estocstico, Anlisis Espectral, Olas, Superficie del Mar.',5,1,1,1,1,'2013-09-17 08:26:27','2013-09-17 08:26:27','Documento_175.pdf','application/pdf',1761668,'2013-09-17 08:26:27',20,0,77,'COMPLETO'),(176,'ABSORCINN INTESTINAL DE FLAVONOIDES PRESENTES EN LAS HOJAS DE Bauhinia megalandra Y SUSEFECTOS SOBRE LA ELIMINACINN URINARIADE GLUCOSA EN RATAS','Las investigaciones con respecto a los compuestos naturales de las plantas han tenido un gran auge en los ltimos tiempos, debido a que stos presentan diversas propiedades medicinales y farmacolgicas. Dentro de estos componentes naturales se encuentran los flavonoides, que son metabolitos secundarios aromticos presentes en los vegetales, frutas, y productos procesados, tales como: vinos, cervezas, t negro y verde, entre otros. El objetivo principal de este trabajo es demostrar la absorcin intestinal de algunos flavonoides contenidos en el extracto acuoso de hojas de la planta Bauhinia megalandra y sus efectos sobre la eliminacin urinaria de glucosa en ratas. De la orina se extrajeron los flavonoides y/o sus metabolitos, utilizando una modificacin del mtodo de Zhao y col. (2007). Los compuestos obtenidos fueron fraccionados, purificados e identificados, aplicando mtodos cromatogrficos (capa fina y de columna) y espectroscpicos (resonancia magntica nuclear de [1H] y de [13C] y espectrometra de masas); tambin se determin la cantidad de glucosa, por el mtodo enzimtico GOP/POD en orina y sangre. Al observarse los cromatogramas de las muestras biolgicas, se pudo visualizar un compuesto de color azul / grisceo en la orina experimental fraccionada con acetona, que no se visualiz ni en la orina control ni en el extracto acuoso de hojas de la planta, lo que sugiere que alguno de los flavonoides presentes, fue absorbido, metabolizado y excretado de una forma diferente. Se sugiri que dicho metabolito es un compuesto derivado del benceno orto-disustituido. Asimismo se encontr una mayor cantidad de glucosa en la muestra de orina de los animales que recibieron el extracto acuoso de hojas B.. megalandra (10,49  1.2 mg de glucosa/24 horas) en comparacin con el control (2,92  0.23 mg glucosa/24 horas), lo cual fue estadsticamente significativo a p < 0,005. Esto corresponde a un incremento de aproximadamente 3,6 veces de la cantidad de glucosa eliminada por la orina. Por otra parte se observ, una discreta disminucin de la glicemia (controles 77,31  5,11 mg glucosa/dl y experimentales 70,26  1,17 mg glucosa/dl), que tambin fue estadsticamente significativo a p < 0.01, representando una disminucin de alrededor del 9% de la glucosa sangunea. Puede sugerirse que la disminucin en la glicemia, se debe a la actividad hipoglicemiante de los extractos de la planta, cuyo efecto probablemente es similar al de otras especies de Bauhinia, tales como: B.. kalbreyeri Harms, B.. cheilandra, B.. forticata y B.. monandra Kurz, entre otras (Sousa y col., 2004; Almeida y col., 2006; Murillo y col., 2006; Sousa y col., 2007). Estos resultados sugieren que estamos en presencia de un proceso de glucosuria renal, probablemente debido a la inhibicin del SGLT1 (Sodium-- GlucoseTransporters 11)) de las clulas de los tbulos renales por flavonoides presentes en el extracto acuoso de Bauhinia megalandra que fueron absorbidos a nivel intestinal y por va sangunea alcanzan al rin. Este efecto, sera similar al observado por Gonzlez-Mujica y col. (2003), quienes demostraron que el extracto acuoso de las hojas de B.. megalandra inhibe la absorcin intestinal de glucosa, afectando al transportador SGLT1, posiblemente por flavonoides contenidos en el extracto acuoso de la misma planta. La glucosuria renal es una evidencia indirecta de la absorcin intestinal de flavonoides presentes en el extracto acuoso de hojas de B.. megalandra. Con esta investigacin se pudo demostrar la absorcin intestinal de algunos flavonoides contenidos en el extracto acuoso de hojas de la planta Bauhinia megalandra y sus efectos sobre la eliminacin urinaria de glucosa en ratas, todo con la finalidad de aportar una mayor informacin para la elaboracin de medicamentos orales a partir de los componentes activos presentes en los flavonoides del extracto, que permitan, combatir enfermedades como la Diabetes Mellitus.','2009-06-05','Bauhinia megalandra, absorcin intestinal,glucosuria renal',1,1,1,1,2,'2013-09-17 08:26:28','2013-09-17 08:26:28','Documento_176.pdf','application/pdf',4435190,'2013-09-17 08:26:28',20,0,116,'COMPLETO'),(177,'Estudio de las propiedades fsicas de espacio-tiempos cuasiesfricos','Se presenta el estudio de algunos espaciotiempos de Weyl como la mtrica M-- Q donde se calcul la aceleracin radial medida por un observador Lorentziano cerca del horizonte de eventos. Como lo predice el teorema de Israe l, se produjeron bifurcaciones respecto al caso esfricamente simtrico de Schwarzschild, las cuales se estudiaron en trminos del escalar de superenerga.','2009-07-17','teoremaisrael relatividad relatividadgeneral espaciotiempo cuasiesfrico weyl m-q superenerga',3,1,1,1,1,'2013-09-17 08:26:29','2013-09-17 08:26:29','Documento_177.pdf','application/pdf',5823679,'2013-09-17 08:26:29',18,0,0,'INCOMPLETO'),(178,'Desarrollo de un prototipo de aplicacinn web para automatizar y optimizar los procesos acadmicos de la Coordinacinn de Postgrado de la Facultad de Ciencias de la Universidad Central de Venezuela','En la unidad acadmica de la Coordinacin de Postgrado de la Facultad de Ciencias de la Universidad Central de Venezuela intervienen un determinado nmero de procesos donde se destaca su complejidad y flujo de informacin as mismo el como afectan de manera directa o indirecta el tiempo de respuesta para llevar cabo la realizacin efectiva de los diversos trmites internos y externos que demanda, y se demandan en la coordinacin antes mencionada. ste Trabajo Especial de Grado tiene como Objetivo desarrollar un prototipo que permita sistematizar los procesos acadmicos de la Coordinacin de Postgrado y ayudar a la comunidad que la satisfacen. Dicha comunidad est conformada por estudiantes, docentes y personal administrativo que laboran en dicha organizacin. Por esa razn debe estar enfocada en adaptarse a las necesidades y dar soporte a todas las solicitudes estudiantiles, del personal administrativo, asi como tambin a los procesos acadmicos para los docentes.','2009-07-14','Coordinacin de Postgrado, acadmico, automatizacin, aplicacin Web, postgrados, Ruby on Rails, estudiantes, docentes.',2,1,1,1,1,'2013-09-17 08:26:31','2013-09-17 08:26:31','Documento_178.pdf','application/pdf',0,'2013-09-17 08:26:31',20,0,0,'INCOMPLETO'),(179,'Efecto Citotxxico del grupo 22,,44--diaril--tetrahidroquinolinas sustituidas y su respuesta en combinacinn con frmacos antitumorales sobre clulas de cncer de mama humano','El cncer de mama segn los informes de la Organizacin Mundial de la Salud (O.M.S.) constituye la neoplasia maligna ms comn en las mujeres en el mundo occidental, y la segunda causa de muerte por cncer en el continente americano. En el caso particular de Venezuela, el Registro Central de Cncer - Programa de Oncologa del Ministerio para el poder popular para la Salud (MPPS) estim que para el ao 2007, existirn en Venezuela 3.549 nuevos casos de mujeres padeciendo de cncer de mama, con una mortalidad estimada de 1.449 mujeres. Entre los tratamientos que se aplican a los pacientes con estas patologas, la quimioterapia surge como una alternativa de gran importancia, sin embargo se ha observado que algunos tumores no responden a los frmacos (resistencia primaria o innata), mientras que otros que inicialmente son sensibles al tratamiento, eventualmente pueden desarrollar resistencia (resistencia secundaria o adquirida). Recientemente se ha mostrado inters en el uso de plantas como agentes antitumorales, ya que el cncer es una enfermedad que comprende un conjunto complejo de signos y sntomas. El potencial teraputico de los frmacos antitumorales derivados de las plantas pueden deberse a una variedad de mecanismos, por ejemplo: muerte por apoptosis, como molcula antiangiognica, inhibidores de proteasas, inmunomoduladores, anti- inflamatorios. Entre los compuestos naturales de importancia estn las tetrahidroquinolinas aisladas de plantas superiores. El grupo de las 2,4- diaril-tetrahidroquinolinas sustituidas son anlogos sintticos de las tetrahidroquinolinas (alcaloides) de origen natural aislados de diferentes plantas, como por ejemplo Galipea officinalis (Rutaceae). Estas estructuras tetrahidroquinolnicas son similares a otros compuestos reportados con actividades antitumorales y antioxidantes. El objetivo del presente trabajo es estudiar la actividad citotxica del grupo de compuestos sintticos 2,4- diaril-tetrahidroquinolinas sustituidas en clulas de cncer de mama. Para ello se realizaron ensayos de citotoxicidad con lneas celulares tumorales MCF-7 y SKBR3 de cncer de mama y clulas normales obtenidas de cultivos primarios de fibroblastos drmicos. La tcnica utilizada fue la del MTT diseada por Mossman en 1983; luego de 72 horas de incubacin se calcularon los valores de concentracin inhibitoria (CI50), ndices de selectividad, relaciones dosis- respuesta y se realizaron combinaciones con los frmacos antitumorales Taxol y la Gemcitabina que son utilizadas recurrentemente en los tratamientos quimioteraputicos del cncer de mama. Los resultados obtenidos reflejan una alta selectividad de los compuestos sintticos pertenecientes al grupo 2,4- diaril-tetrahidroquinolinas sustituidas hacia la citotoxicidad sobre las lneas celulares MCF-7 (CI50 = 3,01 a 30,81g/mL) y SKBR3 (CI50 = 6,77 a 56,51 g/mL) con respecto a las clulas normales (CI50 = 16,77 a 58,55 g/mL). Por otro lado, una de las 9 molculas evaluadas en este estudio present un ndice de selectividad casi tres veces mas grande que el obtenido para el frmaco de referencia Taxol en la lnea celular MCF-7, lo que demuestra la alta selectividad de estos compuestos sintticos hacia las clulas tumorales sin afectar demasiado a las clulas normales. La combinacin del compuesto DM5 con el frmaco antitumoral Taxol sobre la lnea celular SKBR3 present un sinergismo muy fuerte de tipo potenciacin, lo que se tradujo en una disminucin de la concentracin de 100 g/mL a 0,186 g/mL para obtener una efectividad mxima cercana al 90% para ambos compuestos qumicos. En conclusin, todos los compuestos pertenecientes al grupo 2,4-DAr-THQs muestran una inhibicin sobre la viabilidad celular sobre las lneas tumorales MCF-7 y SKBR3, conforme aumenta la dosis de los compuestos.','2009-09-18','Cncer, Ensayos de Citotoxicidad, Tetrahidroquinolinas, Combinacin de Frmacos, Farmacologa',1,1,1,1,1,'2013-09-17 08:26:32','2013-09-17 08:26:32','Documento_179.pdf','application/pdf',3124001,'2013-09-17 08:26:32',20,0,177,'COMPLETO'),(180,'Una herramienta basada en tecnologa Palm Pilot para el Sistema Industrial de Crdito: Anlisis de Factibilidad y Diseo de una Interfaz de Comunicacin.','El banco de la Gente Emprendedora tiene planteado dentro de sus estrategias organizacional la implantacin de un sistema que apoye la gestin de la asistente administrativo y el asesor de negocio, automatizando el proceso de transcripcin de informacin de las solicitudes de crdito de los clientes y mejorando los procesos de obtencin de informacin del estatus de la cartera de crdito para el asesor de negocio; el mejoramiento de ambos procesos aumentara la productividad de ambas reas, lo que se traducira en un ofrecimiento adecuado del servicio que se le presta a los clientes y el cumplimiento del eslogan de la organizacin \"crditos rpidos y sin tanto papeleo\". Otra ventaja para el desarrollo de un sistema de esta envergadura es lo relacionado al ahorro de recursos materiales tales como papel, tinta, consumibles, espacio fsico de equipos destinados para asesores de negocio, etc. Por lo antes expuesto es que se est desarrollando un sistema basado en tecnologa Pal Pilot (Dispositivos mviles) para la captura de informacin en campo de las solicitudes de crdito de clientes, que a travs de su respectiva interfaz podr llevar dicha informacin al Core principal de la organizacin eliminando las transcripciones innecesarias, el gasto excesivo de papel, uso de formularios, consumibles, etc. y eliminara en gran medida el uso y tiempo requerido de la fuerza de venta en un computador personal, ya que la mayora de la informacin requerida estar disponible en su dispositivo de bolsillo (Palm Pilot) a travs de las distintas sincronizaciones con la interfaz, mejorando as eficientemente el servicio que se le presta a los clientes de esta prestigiosa organizacin Financiera.','2009-10-02','Estrategia Organizacional, Procesos, Interfase, Dispositivos Mviles, ahorro, productividad y Servicio.',2,1,1,1,1,'2013-09-17 08:26:33','2013-09-17 08:26:33','Documento_180.pdf','application/pdf',0,'2013-09-17 08:26:33',19,0,0,'INCOMPLETO'),(181,'Efecto de la simulacinn de los cambios redox del suelo,, sobre las relaciones Fe--C--P en un bosque de tierra firme dela Reserva Forestal de Imataca,, Estado Bolvar','El fsforo (P) es uno de los principales nutrientes limitantes de la productividad primaria neta, en los suelos de bosques hmedos tropicales, altamente meteorizados. La alta humedad prevaleciente, acoplada a un importante contenido de materia orgnica y arcilla en el suelo, puede resultar en fluctuaciones del potencial redox, lo cual, puede conducir a la reduccin microbiana de los xidos de hierro (Fe) y la subsiguiente liberacin de P a la solucin del suelo. En este estudio se desarroll un experimento de laboratorio simulando condiciones variadas en el potencial redox del suelo, con la finalidad de observar el efecto de estas variaciones en las relaciones Fe-C- P en un suelo de bosque hmedo tropical de la Reserva Forestal de Imataca. Los resultados mostraron que en treinta das de incubacin la condicin estrictamente anxica no conduce a la reduccin bacteriana de Fe y liberacin de P, probablemente debido a limitaciones en la biodisponibilidad de carbono orgnico (CO orgnico lbil). La suplencia de oxigeno (O2) en pequeas cantidades promueve la reduccin de Fe (III) con la consecuente liberacin del P asociado. La mayor eficiencia bajo estas condiciones puede deberse a dos factores (i) que ocurra un incremento en la eficiencia de oxidacin de la materia orgnica debido a que microorganismos anaerbicos y aerbicos estn trabajando simultneamente y (ii) que al ocurrir cambios en el establecimiento de la condicin redox del suelo los microorganismos no adaptados a la nueva condicin mueran y sirvan de sustrato orgnico lbil para el nuevo grupo de microorganismos que comienzan a establecerse, promovindose as la reduccin bacteriana de los xidos de Fe(III).','2009-09-04','Suelos altamente meteorizados, potencial redox del suelo, reduccin bacteriana de Fe, liberacin de fsforo, organismos aerbicos, organismos anaerbicos, carbono orgnico lbil.',4,1,1,1,1,'2013-09-17 08:26:33','2013-09-17 08:26:33','Documento_181.pdf','application/pdf',3124001,'2013-09-17 08:26:33',20,0,177,'COMPLETO'),(182,'Precondicionamiento por aproximaciones a la matriz pseudoinversa para el problema de mnimos cuadrados lineales.','Dada una matriz A en Rmxncon m >> n, de rango completo y un vector b en Rm, Se propone utilizar una aproximacin a la matriz A++ en Rnxm, la pseudoinversa de A como precondicionador para el problema de mnimos cuadrados lineales asociado aA y b. Dicha aproximacin a A++ se obtendr a partir del mtodo iterativo de Schulz, un esquema iterativo basado en el mtodo de Newton en espacios de matrices, usado para el clculo de matrices inversas y pseudoinversas. El problema de mnimos cuadrados precondicionado se resolver a travs del esquema de aceleracinn de convergencia Richardson--PR22, un mtodo iterativo--residual obtenido como a partir de una generalizacin del mtodo iterativo de Richardson de primer orden para sistemas de ecuaciones lineales. Se estudiarn las propiedades del precondicionador y se realizarn pruebas numricas con diversas matrices densas ysparse.','2009-07-06','lgebra lineal numrica, Mnimos cuadrados, Precondicionamiento, Sistemas de ecuaciones lineales, mtodos iterativos para sistemas lineales, matrices densas.',2,1,1,1,1,'2013-09-17 08:26:34','2013-09-17 08:26:34','Documento_182.pdf','application/pdf',4083291,'2013-09-17 08:26:34',20,0,136,'COMPLETO'),(183,'\"Desarrollo de Lminas Flexibles de Mango (Mangifera indica L) Enriquecidas con Calcio\"','Las lminas de frutas constituyen una forma de conservacin de alimentos, donde el producto es fabricado por deshidratacin de pulpa acondicionada. El objetivo del presente trabajo fue desarrollar lminas flexibles de mango (Mangifera indica L.) enriquecidas con calcio, estudiando las variables: contenido de slidos solubles (20 y 30 Brix), pectina aadida (0; 0,75 y 1,50%), y estabilidad en almacenamiento a temperatura ambiente (0; 1 y 4 semanas). Despus de caracterizar la pulpa de mango `Bocado\', se realizaron pruebas para obtener la formulacin base y se elaboraron las curvas de secado. Posteriormente, se probaron 6 formulaciones (20 y 30 Brix inciales con 0; 0,75 y 1,50% de pectina aadida) que se deshidrataron a 60 C. Las lminas se caracterizaron de forma fsica, qumica, microbiolgica y sensorial. Aadir azcar afect el pH, el aw, la dureza y el color, mejorando el sabor. La adicin de pectina sin aadir azcar, increment la dureza; y en aquellas con azcar aadida afect favorablemente su color. Despus de 4 semanas no se afect significativamente el olor y sabor del producto, y se encontr que si no se aade pectina, aadir azcar favorece la dureza de las lminas. En conclusin, utilizando pulpa de mango variedad Bocado, fue posible desarrollar lminas flexibles enriquecidas con calcio, las cuales se caracterizaron por su bajo contenido de agua, alto contenido de azcares, alta acidez y baja actividad de agua. Finalmente, la racin propuesta (30 a 36 cm2), suministrara el 9,23% del requerimiento de calcio en adolescentes.','2009-09-03','Mango, laminas flexibles, frutas, calcio, deshidratacin, desarrollo de nuevos productos, cueritos de fruta, Mangifera indica L., pectina',1,1,1,1,1,'2013-09-17 08:26:36','2013-09-17 08:26:36','Documento_183.pdf','application/pdf',16742338,'2013-09-17 08:26:36',20,0,0,'INCOMPLETO'),(184,'Estudio de desempeo en un ambiente de comunicacin BBluetooth. Caso de estudio Piconet y Scatternet.','La siguiente investigacin trata de presentar un mtodo que permita la interconexin de varias Piconets (una red de dispositivos que se conectan utilizando Bluetooth), estas agrupaciones son conocidas con el nombre de Scatternet y estudiaremos el impacto en el desempeo de la comunicacin extremo a extremo entre diversos dispositivos Bluetooth.A pesar de la popularidad de la tecnologa Bluetooth para la interconexin inalmbrica de dispositivos electrnicos tales como: teclados, mouse, impresoras, telfonos mviles, auriculares, PDA (Asistente Digital Personal) y computadores; existen pocos trabajos de investigacin para la implementacin y medicin de desempeo de la topologa de comunicacin Scatternet Bluetooth. Adicionalmente, tanto la especificacin del grupo especial de investigacin SIG (special interest group) Bluetooth creadores de la tecnologa y el estndar de la IEEE 802.15.1 no definen un mecanismo para la creacin de esta topologa, lo que motiv el desarrollo de esta investigacin.En esta investigacin se presenta una metodologa para la implementacin de la estructura de comunicacin Scatternet, desarrollado sobre una plataforma Linux en particular la distribucin Ubuntu 8.04 - Hardy Heron, adicionalmente se usaron los siguientes recursos: el perfil PAN (Personal Area Network), las bibliotecas y herramientas brindadas por Bluez (pila oficial de protocolos Bluetooth para Linux).Se disearon un conjunto de escenarios con diversas topologas con el objeto de evaluar el desempeo en las comunicaciones con la tecnologa Bluetooth e identificar aquellos factores que lo degradan.El conjunto de medidas obtenidas a partir de las pruebas realizadas, mostraron un bajo desempeo en topologas con saltos o nodos intermedios y en topologas pobladas con trfico.','2009-06-23','Estndar 802.15.1, WPAN, SIG Bluetooth, Piconet, Scatternet, perfil PAN, Bluez.',2,1,1,1,1,'2013-09-17 08:26:37','2013-09-17 08:26:37','Documento_184.pdf','application/pdf',0,'2013-09-17 08:26:37',20,0,0,'INCOMPLETO'),(185,'Definiendo la integral de Riemann sin utilizar sumas de Riemann','En este T.E.G. se construye una teora de integracin bastante simple, basada en un par de axiomas. Dan aplicaciones que muestran como puede aparecer la integral en el clculo, sin necesidad de sumas de Riemann y discuten la conexin entre esta presentacin y la historia del clculo.','2009-10-07','Integral de Riemann, integral de Darboux, propiedad aditiva y propieda asimptotiva',5,1,1,1,1,'2013-09-17 08:26:38','2013-09-17 08:26:38','Documento_185.pdf','application/pdf',7453225,'2013-09-17 08:26:38',19,0,0,'INCOMPLETO'),(186,'Desarrollo de un Mdulo de generacin de reportes para el sistema CONEST de la Facultad de Ciencias.','Actualmente la Divisin de Control de Estudios de la Facultad de Ciencias de la Universidad Central de Venezuela dispone de una aplicacin Web denominada CONEST, la cual se encarga de automatizar sus procesos y a su vez almacena toda la informacin correspondiente a la gestin acadmica de la Facultad. Para los distintos procesos que lleva a cabo la Divisin de Control de Estudios es necesario emitir una serie de reportes, para los cuales no poseen una herramienta que les permita elaborarlos, adems actualmente el modelo de datos de este sistema posee alrededor de 140 tablas y esto dificulta la tarea de elaboracin de reportes. Dada esta situacin, en el presente Trabajo Especial de Grado se desarroll una aplicacin, la cual es a su vez un mdulo del sistema CONEST, que est dedicado exclusivamente a la generacin y administracin de reportes a partir de los datos almacenados en el repositorio de datos, todo esto basndose en el estudio de algunos generadores de reportes comerciales, analizando la forma como estos, a travs de secuencias ordenadas de pasos (wizards), apoyan al usuario en la tarea de elaboracin de reportes. Entre los aspectos de desarrollo de esta aplicacin tenemos el diseo del wizard que permite la creacin de los reportes de una forma ms sencilla, el desarrollo de los algoritmos de exportacin de datos a los formatos soportados, el anlisis del modelo de datos actual de CONEST, en base al cual se disearon un conjunto de vistas que faciliten el acceso a los datos y la integracin con el sistema CONEST.','2009-06-08','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',2,1,1,1,1,'2013-09-17 08:26:40','2013-09-17 08:26:40','Documento_186.pdf','application/pdf',3183462,'2013-09-17 08:26:40',20,0,102,'COMPLETO'),(187,'Elaboracin de un Gem de Ruby que encapsule un Middleware SMS para el envo y recepcin de mensajes de texto.','El presente Trabajo Especial de Grado tiene como objetivo principal la elaboracin de un gem de extensin para el lenguaje de programacin Ruby. Este gem encapsula un middleware que permite el envo y recepcin de mensajes de texto a travs de dispositivos celulares conectados al computador.Para la realizacin de los mdulos de envo y recepcin de mensajes se utiliza Gnokii, logrando la omunicacin del computador con el dispositivo celular a travs de comandos AT. Dichos comandos estn soportados hoy en da por la mayora de los telfonos celulares que utilizan la tecnologa GSM.Se debe utilizar un mecanismo para poder integrar la librera Gnokii(en lenguaje C/C++) con el lenguaje Ruby, para esto, debe crearse una extensin a partir del cdigo desarrollado en lenguaje C/C++. Existen distintos mecanismos que permiten la creacin de una extensin para Ruby. Se puede crear manualmente, utilizando un generador como Swig, o utilizar cdigo C/C++ embebido en cdigo Ruby. Al construir un gem de Ruby, ste puede ser distribuido fcilmente colocndolo en repositorios como Github o RubyForge, desde donde puede ser descargado y utilizado por otros usuarios.','2009-09-07','SMS, Ruby, Gem, Comandos AT',2,1,1,1,1,'2013-09-17 08:26:43','2013-09-17 08:26:43','Documento_187.pdf','application/pdf',1171235,'2013-09-17 08:26:43',20,0,106,'COMPLETO'),(188,'Ecuaciones Funcionales en la Teora de la Eleccin Social','Como herramienta para el estudio cuantitativo y la modelizacin de fenmenos, las matemticas estn presentes en todas las disciplinas, y en particular en las ciencias polticas. Los modelos matemticos que tradicionalmente han servido para describir situaciones surgidas en la fsica, en la ingeniera o en las finanzas, se han revelado recientemente tiles en el estudio y la descripcin de fenmenos relativos a la conducta humana. En este trabajo lo que se hizo fue ver la aplicabilidad de la matemtica en las ciencias sociales. Todo parte de querer tomar una decisin colectiva ((Regla de Eleccinn Social)) a partir de ciertas decisiones individuales (Preferencias Individuales), sabiendo que esto requiere de un ordenamiento a dichas preferencias y para ello existen ciertos mtodos que son capaces de darlo, precisamente es el estudio de las Ecuaciones Funcionales, una de las ramas de las matemticas utilizada para el modelaje de esta aplicacin econmica. En la tesis se hizo especial referencia a la Ecuacin Funcional de Sincov como una de las ms conocidas y utilizadas dentro de este mbito, as como tambin se realiz el estudio de cierto contenido de matemtica elemental tal como Relaciones Binarias, Relaciones de Equivalencia, Relaciones de Preferencia, Ordenes Intervalo, Semi ordenes entre otros.','2009-10-14','Teora de Eleccin Social, Teorema de Arrow, relaciones binarias, eleccin, decisin, preferencia, orden, intervalo, semi orden, ecuaciones funcionales, sincov.',5,1,1,1,1,'2013-09-17 08:26:44','2013-09-17 08:26:44','Documento_188.pdf','application/pdf',319761,'2013-09-17 08:26:44',20,0,10,'COMPLETO'),(189,'\"Determinacin de la masa molar de los asfaltenso utilizando su fraccin plegable A2\"','Las investigaciones en torno a los asfaltenos se han visto incrementadas en los ltimos aos por los inconvenientes que causan a la industria petrolera. En este mbito el cmo determinar la masa molar de los asfaltenos es una de las grandes dificultades que se presenta hoy en da. Esto se atribuye a la capacidad que tienen los asfaltenos para agregarse, debido a que los agregados en este estado de asociacin, las molculas que se forman poseen un valor de la masa molar por encima de su valor real. Por lo antes expuesto, este trabajo se basa en la hiptesis que la fraccin A2 de los asfaltenos tiene una menor tendencia a la agregacin que la fraccin A1 debido a la capacidad que posee su estructura de plegarse y desplegarse en s misma; por lo tanto puede ser utilizada para determinar la masa molecular sin el riesgo de monitorear agregados de mayor tamao. Clculos sencillos de mecnica molecular demuestran que los confrmeros plegados son mucho ms estables en comparacin con los desplegados(12); cuando los confrmeros plegados se aproximan entre s, el nmero de tomos que interactan entre las molculas es menor que el mximo posible, y esto lleva a una interaccin dbil tipo van der Waals dbil, por lo tanto en las molculas de la fraccin A2 no se espera agregacin de este tipo. Por el contrario para la fraccin A1 se espera una alta tendencia a la agregacin debido a que esta no posee capacidad de plegamiento, es decir, que cuando se aproxima una molcula de un modelo A1 a otra del mismo tipo, existe una fuerte interaccin de van der Waals (la llamada interaccin co-facial). Por lo tanto en esta fraccin si se espera agregacin. Para iniciar el estudio, fue necesario llevar a cabo el fraccionamiento de los asfaltenos mediante el mtodo p-nitrofenol (PNF)(3), obtenindose de esta manera las dos fracciones A1 y A2 (insoluble y soluble en tolueno respectivamente). Adicionalmente, se determin la masa molecular promedio en nmero de los asfaltenos provenientes del crudo Carabobo y sus respectivas fracciones A1 y A2 a tres diferentes temperaturas (80, 100 y 125C) usando la tcnica de Osmometra de Presin de Vapor (VPO). Los valores arrojados para los asfaltenos a las tres temperaturas fue de (1580  150) gmol-1; (1450  200) gmol-1 y (1540  340) gmol-1 respectivamente. Mientras que para el caso de la fraccin A1 a 80C se obtuvo una masa molar de (3190  540) gmol-1; a 100C (2970  570) gmol-1 y a 125C el valor obtenido fue de (2600  520) gmol-1. Finalmente para la fraccin A2 a 80C arrojo un valor de (1020  55) gmol-1; a 100C (1200  190) gmol-1 y por ltimo a 125C (1060  140) gmol-1. Siendo la fraccin A2 quien present el menor valor en la determinacin de la masa molar y manteniendo un valor relativamente constante al variar la temperatura y la concentracin, se demuestra que la fraccin A2 tiene una menor tendencia a la agregacin que la fraccin A1, que por el contrario dicha fraccin al disminuir la temperatura aumenta el valor de la masa molar lo que nos indica su agregacin. En el caso de los asfaltenos al variar la temperatura no presenta variacin con la temperatura, esto se atribuye a que los asfaltenos son una mezcla de la fraccin A1 y la fraccin A2 en un estado de agregacin desconocido y muy difcil de anticipar, como tambin es desconocido su comportamiento al variar la temperatura.','2009-09-29','crudo, asfaltenos, petroleo, S.A.R.A, fraccin A1, fraccin A2.',6,1,1,1,1,'2013-09-17 08:26:45','2013-09-17 08:26:45','Documento_189.pdf','application/pdf',437309,'2013-09-17 08:26:45',20,0,75,'COMPLETO'),(190,'DESARROLLO DE UNA APLICACION WEB DE PROGRAMA DE INCENTIVOS BAJO LA ARQUITECTURA CLIENTE-SERVIDOR UTILIZANDO LA METODOLOGIA DE DESARROLLO RUP-SCRUM','El objetivo de este Trabajo Especial de Grado es construir una aplicacion web que sirva como base para el desarrollo de programas de incentivos, a traves de la facil modificacion de la interfaz segun la imagen de la empresa asi como las reglas de negocio que deben aplicar, utilizando una metodologia de desarrollo hibrida entre RUP y Scrum, donde se tomen los aspectos de cada una que permitan desarrollar un buen producto con tiempos de espera cortos.\nUn programa de incentivos pretende incentivar la fuerza de trabajo de una empresa en la promocion y venta de los productos que ofrece dicha empresa.\nEl desarrollo de la aplicacion web se llevo a cabo utilizando como metodo de desarrollo una combinacion entre RUP y Scrum. El trabajo se dividio en cuatro (4) fases segun la metodologia RUP (a saber): inicio, elaboracion, construccion y transicion. En la fase de inicio se analizo el problema, se determinaron las principales funcionalidades del sistema y se realizaron las primeras versiones del modelo conceptual, del modelo de datos y de la interfaz del sistema tomando en cuenta la navegabilidad dentro de la aplicacion web. En la fase de elaboracion se profundizo el analisis y se determinaron el resto de las funcionalidades del sistema. La fase de construccion se desarrollo de acuerdo a la metodologia Scrum realizando un listado de las funcionalidades del sistema agrupadas por modulos, segun su afinidad, e implementandolas semanalmente de modo que al final de cada semana se obtuvo un incremento funcional de la aplicacion. Finalmente en la fase de transicion se instalo el producto y se realizaron pruebas colectivas mediante una matriz de pruebas.\nEsta combinacion de metodologias de desarrollo de software permitio formalizar la documentacion del proyecto, a traves de los diferentes diagramas realizados, y minimizar los tiempos de entrega, al dividir el trabajo de tal forma que semanalmente se obtuviera un incremento funcional del sistema. A la vez que se logro un producto de calidad que cumplio con las expectativas del usuario final.','2009-10-09','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:26:47','2013-09-17 08:26:47','Documento_190.pdf','application/pdf',8888214,'2013-09-17 08:26:47',18,0,151,'COMPLETO'),(191,'ESTUDIO DE LA FRACCIN DE ARCILLAS Y MINERALES PESADOS, ASOCIADOS AL RESIDUO INSOLUBLE DEL MRMOL DE GUACURIPIA, EDO. BOLVAR Y SUELOS SUPRAYACENTES','En el presente trabajo de investigacin se realiz un estudio de la fraccin de minerales tamao arcilla y minerales pesados, asociados al residuo insoluble del Mrmol de Guacuripia y suelos suprayacentes del Edo. Bolvar, Venezuela.Para ello se trabaj con una muestra de roca y seis muestras de suelo. El anlisis qumico solo se ejecut para el caso de la muestra de roca, la cual fue sometida a digestin parcial con HCl 4 M hasta obtener la disolucin de la fase carbontica y el residuo insoluble. Una vez obtenido ambos materiales, las muestras de suelo y el residuo insoluble obtenido de la roca carbontica, se procedi a separar las fracciones de inters, en este caso la fraccin de los minerales de arcilla, a travs del mtodo del pipeteo y los minerales pesados por el mtodo hidrodinmico.Los materiales obtenidos tanto de la roca como de los suelos se sometieron a anlisis de difraccin de rayos X para determinar las fases minerales constituyentes y microscopia electrnica de barrido para determinar la morfologa y composicin qumica de los granos minerales.Los resultados obtenidos indican que los minerales pesados presentes en el residuo insoluble de la roca son los siguientes: fosrterita, rutilo, actinolita y greenalita. Para el caso de los suelos los minerales pesados presentes son la goethita, pirolusita, pirita, cuarzo, barita, clorita y groutita. En cuanto a la fraccin tamao arcilla los suelos presentan halita y yeso y el residuo insoluble de la roca wollastonita, montmorillonita, tephorita y manganolagbeirita.Los resultados arrojados por la microscopia electrnica de barrido indican que morfolgicamente los granos presentes en la roca presentan caras definidas, mientras que los que estn presentes en los suelos presentan gran variabilidad son angulares, pasando por granos poco redondeados hasta observar granos esfricos, pero en general corresponden a masas amorfas porosas. De igual forma con esta tcnica se realiz el anlisis en una muestra de mrmol dolomtico constituida por la roca fresca, semialterada, alterada y costra con el fin de ver la distribucin y comportamiento de los elementos durante el proceso de meteorizacin, los resultados obtenidos sealan que con la evolucin del suelo, es decir, desde la roca fresca hasta la costra el Mges lixiviado de la estructura de la dolomita, mientras que el Fe y Mn presentan un comportamiento similar, sutituyendo al Ca en la estructura de la calcita y dolomita. Tambin es favorecida la formacin de xidos ricos en Fe y Mn.','2009-09-07','Mrmol dolomtico, carbonatos, suelos, arcillas, minerales pesados.',4,1,1,1,1,'2013-09-17 08:26:48','2013-09-17 08:26:48','Documento_191.pdf','application/pdf',18586409,'2013-09-17 08:26:48',18,0,143,'COMPLETO'),(192,'wradvs: Un Servidor de Autoconfiguracin sin Estado para IPv6 en Plataforma Windows','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicacin denominada \"wradvs\" que lleva a cabo el proceso de autoconfiguracin sin estado de IPv6 a travs de un servicio de Windows. El documento comienza con un estudio terico de todos los conceptos necesarios para la comprensin del proceso de autoconfiguracin sin estado incluyendo los RFC 2460, 4861, 5006, 4191, 3775 y 3963. La implementacin se lleva a cabo utilizando una metodologa gil de desarrollo denominada Scrum que propone ciclos cortos para la planificacin y posterior codificacin de los diferentes mdulos de la aplicacin. La aplicacin consta de cuatro mdulos: el mdulo de configuracin del servidor permite almacenar todos los parmetros y opciones de los mensajes Router Advertisement en un archivo XML. El mdulo principal es el servidor wradvs que lee este archivo para enviar mensajes Router Advertisement peridicos y en respuesta a mensajes Router Solicitation mientras llena un log de eventos con mensajes de informacin y error. Para la lectura del log se ofrece un visor de eventos que muestra la informacin en tiempo real. Por ltimo se proporciona una herramienta para la administracin de direcciones IPv6, rutas por defecto, tabla de enrutamiento y reenvo de paquetes. Cada mdulo posee una amigable e intuitiva interfaz grfica para sus usuarios. El producto final junto a la documentacin de la investigacin est publicada como una aplicacin con licencia GNU GPL a travs de SourceForge.net (un sitio Web que permite el hospedaje y distribucin de software libre y sistemas de cdigo abierto) en el siguiente enlace: http:// wradvs.sourceforge.net.','2009-06-03','Normal 0 false false false EN-US X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:26:50','2013-09-17 08:26:50','Documento_192.pdf','application/pdf',0,'2013-09-17 08:26:50',20,0,0,'INCOMPLETO'),(193,'REDUCCION DE ESPECIES METALICAS DE V, Ni, Co y Mo CON HIDROGENO ATOMICO (H) ELECTROQUIMICAMENTE ADSORBIDO SOBRE SUPERFICIES DE Pd Y NEGRO DE Pd','Se estudio la reactividad del hidrogeno atomico (H) electroquimicamente adsorbido sobre superficies de paladio y negro de Pd en la de reduccion de especies metalicas de niquel, cobalto, molibdeno y vanadio. El H generado electroquimicamente permea a traves de la membrana de paladio y reacciona con el precursor metalico. Fue demostrado la alta capacidad catalitica del negro de Pd respecto al Pd. El negro de Pd fue preparado por reduccion quimica con H de una solucion PdCl2 0,02 M en HCl 0,1 M. En las reacciones de reduccion via permeacion de hidrogeno, se realizo una serie de experimentos con el fin de establecer las condiciones experimentales que permitan optimizar el proceso de reduccion asistida electroquimicamente con H. En estos ensayos fue observado que las reacciones de reduccion con H se ven fuertemente influenciadas por la densidad de corriente aplicada, la temperatura, el tiempo de descarga de H y el flujo de reactivos, ya que estos parametros podrian estar determinando la cantidad de hidrogeno atomico disponible para la reaccion. La potencialidad del H ha sido evidenciada tanto en la reduccion de especies metalicas sencillas, asi como tambien en la reduccion de sistemas mas complejos como lo son las metaloporfirinas, en este caso la meso-tetrafenilporfirina de vanadilo (VOTPP) y meso- tetrafenilporfirina de niquel (NiTPP). Puesto que se ha comprobado la reactividad de H para la reduccion de metales, su aplicacion se enfoca al desarrollo de nuevas tecnologias destinadas a la extraccion de metales contenidos en fracciones de crudos, permitiendo el mejoramiento de los mismos de manera eficiente, sencilla, rentable y amigable al ambiente (comparado con los esquemas convencionales de refinacion). Adicionalmente, la modificacion de membranas de permeacion con depositos metalicos que presentan actividad catalitica es de interes en reacciones fundamentadas en el uso de hidrogeno atomico.','2009-10-08','Hidrgeno atmico, negro de Pd, reduccin con hidrgeno atmico',6,1,1,1,1,'2013-09-17 08:26:51','2013-09-17 08:26:51','Documento_193.pdf','application/pdf',0,'2013-09-17 08:26:51',20,0,0,'INCOMPLETO'),(194,'Rediseo de la aplicacin Web para la divulgacin de la oferta acadmica y servicios generales en linea del Programa de Cooperacin Interfacultades (PCI) U.C.V., siguiendo el workflow propuesto por Emily Cotler y Kelly Goto.','En este trabajo, se reflejan los aspectos metodolgicos y prcticos inherentes al proceso de rediseo que se realiz en la aplicacin Web del Programa de Cooperacin Interfacultades (PCI), institucin perteneciente a la U.C.V. Se describen los criterios y lineamientos propuestos por Emily Cotler y Kelly Goto para la planificacin y gestin del rediseo Web, conjuntamente con la metodologa de desarrollo utilizada. El PCI se encarga fundamentalmente de interrelacionar acadmicamente a las diversas Facultades de esta institucin universitaria, recolectando y gestionando informacin concerniente a aquellas asignaturas de otras carreras que un estudiante regular de la Universidad pudiese cursar; constituyndose sto en un aliciente de sumo beneficio para el enriquecimiento acadmico y personal de los estudiantes que decidan incorporarse a dicho programa.','2009-10-27','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',2,1,1,1,1,'2013-09-17 08:26:52','2013-09-17 08:26:52','Documento_194.pdf','application/pdf',0,'2013-09-17 08:26:52',20,0,0,'INCOMPLETO'),(195,'\"\"Sntesis y caracterizacinn de nanopartculas bimetlicas de Rh--Pt por va electroqumica\"\"','En el siguiente trabajo se presenta un estudio sobre la sntesis de nanopartculas de Pt, Rh y Rh-Pt por va electroqumica, y la caracterizacin de las mismas por Microscopa Electrnica de Transmisin (MET) y voltamperometra cclica. Las nanopartculas fueron sintetizadas a partir del cido hexacloroplatnico (H2PtCl6) y del cloruro de rodio(III) (RhCl3) en medio acuoso y en acetonitrilo, en presencia de bromuro de tetrapropilamonio y bromuro de tetrabutilamonio respectivamente. Las sales de tetraalquilamonio fueron utilizadas como electrolito soporte y agente estabilizante de las nanopartculas formadas. Durante el estudio se aplicaron diferentes valores de densidad de corriente y de potencial para estudiar la influencia de ambos parmetros en el tamao y composicin de las nanopartculas formadas. Adems se vari la concentracin molar del estabilizante y la relacin estequiomtrica de los precursores metlicos en una serie de nanopartculas de Rh-Pt sintetizadas a corriente constante.El tamao promedio de las nanopartculas fue determinado por MET y la composicin elemental fue determinada por Espectroscopa de Rayos X Dispersivos (EDX). Estos estudios revelaron que el tamao promedio de las nanopartculas sintetizadas a potencial controlado disminuy a medida que se aument la diferencia de potencial aplicada al sistema. La misma tendencia fue observada al aumentar la densidad de corriente aplicada. Los anlisis de por EDX sugirieron que el porcentaje de Pt en la muestra aument a medida que aument la diferencia de potencial y la densidad de corriente aplicada al sistema. La tcnica de voltamperometra cclica fue utilizada para caracterizar las nanopartculas de Rh-Pt sintetizadas a potencial controlado y a corriente constante. Adems se utiliz la tcnica electroqumica para estudiar la actividad electrocataltica de las nanopartculas de Rh-Pt sintetizadas a potencial controlado y a -5,0mA con diferentes concentraciones de estabilizante. Las nanopartculas sintetizadas a -0,6V y -5,0mA con concentracin de estabilizante 0,1M presentaron mejoras en la actividad electrocataltica para la oxidacin de metanol con respecto a las nanopartculas de Pt. En comparacin con un electrodo de Pt msico, las nanopartculas sintetizadas a -0,6V presentaron mayor intensidad de corriente en el proceso de electrooxidacin de metanol.','2009-10-27','Voltamperometra cclica, nanopartculas de Rh, Pt, Rh-Pt.',6,1,1,1,1,'2013-09-17 08:26:53','2013-09-17 08:26:53','Documento_195.pdf','application/pdf',3183462,'2013-09-17 08:26:53',20,0,102,'COMPLETO'),(196,'Estudio geoqumico y mineralgico de los sedimentos de la Laguna Paso Real, Serrana de Santo Domingo, Estado Mrida','Los sedimentos lacustres son utilizados como registros de las condiciones paleoambientalesdebido a su alto grado de continuidad depositacional y alta tasa de acumulacin de sedimentos.La quimioestratigrafa constituye una herramienta til para interpretar los procesos dedepositacin a pequea escala. La Laguna Paso Real se encuentra a una altura de 3000 m ubicadaen la serrana de Santo Domingo en Los Andes venezolanos, represada por material morrnicoerosionado. Se extrajo un ncleo de 280 cm de profundidad utilizando un mecanismo de pistn,se describi la estratigrafa de la columna y se realiz un muestreo, condicionado por laestratificacin, de la seccin ms profunda del mismo. Se obtuvieron 60 muestras cubriendo unaseccin de 70 cm, para cada una de estas muestras se realizaron anlisis granulomtricos,mineralgicos y geoqumicos. A partir del tamizado de sedimentos se determin un aumento detamao de grano hacia el tope de la secuencia, con una seccin de 280 a 230 cm de profundidadde intercalacin de capas de arena fina lodosa y lodo arenoso y otra de 230 a 210 cm deprofundidad de arena media y grava. El anlisis mineralgico se realiz mediante difraccin deRayos-X separando las distintas fracciones de sedimento y concentrando las arcillas. Losminerales principales son cuarzo, plagioclasa, feldespato potsico y muscovita, presentando comominerales de arcilla predominantes la illita y clorita. La composicin mineralgica no varasignificativamente entre las distintas fracciones, mientras que las muestras ubicadas entre los 270y 227 cm de profundidad presentan una cantidad apreciable del mineral illita-vermiculita. Lacomposicin mineralgica de los sedimentos es caracterstica de un grado de meteorizacinintermedio. Para el anlisis qumico se realiz la determinacin de los elementos mayoritarios yminoritarios Si, Al, K, Na, Ca, Mg, Fe, Ti, Mn, P y Cr mediante ICP-EOS. Se estableci unaproveniencia flsica gnea/ sedimentaria en los sedimentos, lo cual concuerda con la composicinde las rocas presentes en la zona de estudio. Las herramientas geoqumicas tambin indicaron ungrado de meteorizacin moderado en los sedimentos y condiciones xicas constantes en lacolumna. Mediante los perfiles quimioestratigrficos y las herramientas estadsticas se definieronlos elementos que presentaban un comportamiento similar y las asociaciones geoqumicas: Al,Mg, Si, K, Na, Ca: Siliciclsticos; Fe, Ti, Mn: xidos (ilmenita); Ca, P: Fosfatos. Para lasdistintas asociaciones se establecieron lmites de quimiofacies. Las caractersticas de la columnapermitieron definir un sistema depositacional deltaico.','2009-09-09','Sedimentos lacustres, quimioestratigrafa, Andes venezolanos',4,1,1,1,1,'2013-09-17 08:26:56','2013-09-17 08:26:56','Documento_196.pdf','application/pdf',3183462,'2013-09-17 08:26:56',20,0,102,'COMPLETO'),(197,'HIDRODESCLORINACIN CATALTICA DE BIFENILOS POLICLORADOS EMPLEANDO CARBUROS DE VANADIO','Se realiz la sntesis de una serie de catalizadores no soportados de carburos de nquel-vanadio, preparados mediante el mtodo de reduccin a temperatura programada (TPR) de VCl3 y Ni(NO3)2.6H2O, utilizando una mezcla carburante 20% de gas natural en hidrgeno. Las relaciones atmicas de Ni/Ni+V empleadas para la preparacin de los carburos de vanadio fueron 0; 0.15; 0.21; 0.35; 0.62 y 1. La sntesis de los catalizadores se llev a cabo en un reactor de flujo continuo a una temperatura 750 C y una velocidad de calentamiento de 18C/min. Los slidos fueron caracterizados por: difraccin de rayos X (DRX), rea especfica (BET), volumen de poro y Microscopa Auger de Barrido (SAM). El anlisis por difraccin de rayos X mostr la presencia de carburos de vanadio, especficamente la fase V8C7, as como xido de vanadio (V2O3) y nquel metlico (Ni). Por su parte, el anlisis por BET indic que se lograron obtener catalizadores con altas reas superficiales (96 m2.g-1). Los catalizadores fueron evaluados en la reaccin cataltica de hidrodesclorinacin (HDCl) de Bifenilos Policlorados (BPC). Esta se llev a cabo en un reactor de flujo continuo a 350 C y una presin de hidrgeno de 540 psi. La concentracin que se utiliz de BPC fue de 560 ppm. El proceso de pre-sulfuracin se realiz iin situ a presin atmosfrica de hidrgeno y una temperatura de 350C. Los catalizadores que se mostraron activos para la reaccin de hidrodesclorinacin de bifenilos policlorados, fueron los que posean una relacin Ni/Ni+V de 0.15 y 0.21, con valores de conversin relativamente altos con 49 y 69 %,respectivamente. Se obtuvo como productos de reaccin, benceno y ciclohexano. De los resultados logrados, se puede indicar que el comportamiento presentado sigue el modelo del Control Remoto, mostrando la existencia de sinerga entre las fases de nquel y vanadio en la reaccin de hidrodesclorinacin de Aroclor 1260.','2009-10-15','Carburos de vanadio, Bifenilos Policlorados, Hidrodesclorinacin',6,1,1,1,1,'2013-09-17 08:26:59','2013-09-17 08:26:59','Documento_197.pdf','application/pdf',0,'2013-09-17 08:26:59',20,0,0,'INCOMPLETO'),(198,'Caracterizacin geoqumica y petrogrfica de rocas fosfticas Cretcicas, de la Formacin la Luna, Estado Tchira, Venezuela','El estudio abarc un total de 13 muestras, pertenecientes al Miembro Ftanita de Tchira, de la Formacin La Luna, Estado Tchira. La metodologa experimental involucr un anlisis qumico (SiO2, P2O5, CaO, Al2O3,Na2O, Fe2O3,MgO, K2O,TiO2 ,MnO, Sr, Ba, V, Cr, Ni, Sc, Co, U, Y, Zr, Th, Nb y Rb, Ta, Cs, La, Ce, Pr, Nd, Sm, Eu, Tb, Gd, Dy, Ho, Er, Tm, Yb y Lu), petrogrfico y mineralgico (DRX). Se tuvo como objetivo establecer las caractersticas qumicas y petrogrficas que definen a estas rocas, en bsqueda de proponer un posible origen. La petrografa revela que las rocas estn constituidas por un componente fosftico (colofano y restos fsiles fosfatizados), componente carbontico (esparita, restos fsiles y lodo carbontico) y componente siliciclstico (cuarzo). El anlisis mineralgico establece que el cuarzo, calcita y fluorapatito son los minerales dominantes (dolomita, pirita y minerales de arcillas, tambin son identificados). Los resultados qumicos sugieren la intervencin de algunos procesos geoqumicos (fosfogenesis, procesos redox, productividad primaria e incorporacin de sedimentos terrgenos). Las anomalas negativas de Ce sugieren una seal primaria, la cual, refleja la qumica de aguas de ambientes de ocanos abiertos. La preservacin de materia orgnica sugiere que la sedimentacin pudo ocurrir bajo condiciones sub-xicas. Los resultados petrogrficos sugieren una diagnesis temprana hacia moderada, donde la mayora de los elementos trazas fueron incorporados por los fosfatos. El comportamiento geoqumico de los elementos de las REE, revela que principalmente fueron incorporados directamente del agua de mar, aunque procesos de adsorcin tambin estuvieron presentes. En contraste, otros elementos trazas fueron incorporados por adsorcin y/o por sustituciones isomrficas dentro de la estructura de los fosfatos. Por otro lado, la fraccin detrtica fue incorporada por una fuente nica y pobremente diferenciada, que afect la sedimentacn de ambas secciones.','2009-10-09','fosfognesis, geoqumica, fosfatos, fosforita, Tchira, Formacin La Luna',4,1,1,1,1,'2013-09-17 08:27:00','2013-09-17 08:27:00','Documento_198.pdf','application/pdf',2214718,'2013-09-17 08:27:00',19,0,74,'COMPLETO'),(199,'Desarrollo de la Aplicacin de Gestin Acadmica CONEST 2.0: Mdulo Administrativo','El objetivo de este Trabajo Especial de Grado consiste en generar la nueva versin del sistema CONEST, basndose en la experiencia del desarrollo de la versin anterior, realizando migraciones de tecnologa y datos, adems de realizar mejoras correspondientes a las entidades, procesos, gestiones administrativas, interfaces, entre otras actividades necesarias para la evolucin del Software. Asimismo brindar un mejor soporte al personal involucrado, aumentando su satisfaccin al usar nuevas tecnologas relacionadas con la web 2.0, que ofrecen beneficios tales como, accesibilidad para el usuario, usabilidad del sistema y personalizacin de la aplicacin. En esta investigacin se realiza un estudio de los modelos de datos, comparando el existente y el propuesto. El mtodo de desarrollo de software utilizado es Programacin Extrema (XP). Como producto final se obtienen las funcionalidades del Mdulo de Administracin del Sistema CONEST 2.0, relacionadas a la gestin administrativa de los estudiantes y docentes de la Facultad de Ciencias.','2009-10-26','CONEST, CONEST 2.0, Modelo Vista Controlador (MVC), Ruby on Rails, Rails 2.3, Migracin de datos, Migracin de tecnologas, Divisin de Control de Estudios, Web 2.0, Programacin Extrema (XP).',2,1,1,1,1,'2013-09-17 08:27:01','2013-09-17 08:27:01','Documento_199.pdf','application/pdf',4474200,'2013-09-17 08:27:01',20,0,169,'COMPLETO'),(200,'Desarrollo de una aplicacinn colaborativa va web para reuniones electrnnicas ascronas','Actualmente es de gran inters el proveer herramientas usables que faciliten la comunicacin entre los miembros de una organizacin, han surgido soluciones que superan las barreras de tiempo y espacio para facilitar la comunicacin, como lo son el chat y los foros. Sin embargo, en busca de mejorar la comunicacin se requiere evolucionar estas soluciones combinndolas con protocolos especficos que representan dinmicas de comunicacin que surgen en ciertos niveles organizacionales. El objetivo de este Trabajo Especial de Grado consiste en el desarrollo de una Aplicacin Colaborativa va Web para coordinar, organizar y ejecutar reuniones electrnicas asncronas orientadas bajo un protocolo de colaboracin de Agendas y Actas. El anlisis se centr en caracterizar los diferentes aspectos al momento de organizar y llevar a cabo una reunin entre un grupo de trabajo. Algunos de estos aspectos son: discrepancia entre los miembros del grupo para llegar a un acuerdo que permita definir cuando se ejecutar la reunin y la necesidad de contar con un protocolo de colaboracin que ayude al coordinador de la reunin y a los participantes en el proceso de interaccin, que facilite alcanzar los objetivos propuestos. La aplicacin se elabor siguiendo el mtodo de desarrollo basado en el Modelado gil (MA), especificando como artefactos principales: el modelado de casos de uso y diagramas de flujo de trabajo. Patrones de interaccin propuestos por Welie para la descripcin de la interfaz y como tecnologa a utilizar Ruby on Rails con la base de datos MySQL.','2009-10-21','Aplicacin Colaborativa, Reuniones Electrnicas, Protocolo de Comunicacin, Agendas y Actas, Modelado gil, Patrones de Interaccin, Ruby on Rails, Modelo Vista Controlador (MVC)',2,1,1,1,1,'2013-09-17 08:27:03','2013-09-17 08:27:03','Documento_200.pdf','application/pdf',4474200,'2013-09-17 08:27:03',20,0,169,'COMPLETO'),(201,'\"\"Estudio de la capacidad de adsorcinn de los elementos U,, Sb,, Co y Ni sobre las turbas del Golfete de Cuare,, estado Falcnn\"\"..','El presente estudio tiene como objetivo fundamental la determinacin de la capacidad de adsorcin de los elementos U, Sb, Co y Ni por las turbas de manglar del Golfete de Cuare, Estado Falcn. Para ello, se realizaron ensayos de adsorcin en sistemas simples, por contacto y agitacin con soluciones de diferente concentracin de cada una de las especies qumicas en un perodo de 24h, a una temperatura de 25 C y bajo condiciones de pH cercanas a la neutralidad. De igual manera, una vez culminadas las adsorciones de las especies qumicas en estudio, la turba fue sometida a ensayos de desorcin en sistemas simples agitando en esta ocasin las turbas impregnadas de cationes con agua destilada y manteniendo las mismas condiciones de tiempo, temperatura y pH aplicadas en los ensayos de adsorcin. Los datos experimentales de adsorcin obtenidos para cada uno de los iones se ajustaron exitosamente al modelo de isoterma de Langmuir y de Freundlich, teniendo una mejor correlacin con el primero. El orden de adsorcin para los cationes ensayados fue UO22+>>Ni2+>Co2+>Sb3+, el cual est determinado por el grado de afinidad de cada uno de los cationes por la materia orgnica, por las propiedades qumicas propias de cada elemento y por la compatibilidad con los sitios activos encontrados en la turba. Los mecanismos de adsorcin predominantes en la mayora de los casos fueron la quelatacin y el intercambio inico, proponiendo los grupos funcionales carboxlicos como los sitios activos preferidos para la adsorcin de las especies qumicas en estudio. En los ensayos de desorcin el orden obtenido muestra un comportamiento inverso al de adsorcin, Sb3+>Co2+>Ni2+>UO22+. Dicho orden se encuentra relacionado con el grado de afinidad de cada catin por la materia orgnica y con la estabilidad de los complejos formados con ella. Se propone que la interaccin de los cationes con la turba est dominada por procesos de quimisorcin ms que por adsorcin fsica; por tanto, los enlaces formados son bastante fuertes como para sugerir que el proceso de adsorcin es prcticamente irreversible, bajo las condiciones de pH trabajadas. De acuerdo a los resultados obtenidos, se confirma el importante rol que cumplen las turbas en los ecosistemas naturales como barreras para la retencin de especies metlicas.','2009-09-07','Turba, adsorcin, desorcin, isotermas de adsorcin, quelatacin, intercambio inico',4,1,1,1,1,'2013-09-17 08:27:05','2013-09-17 08:27:05','Documento_201.pdf','application/pdf',0,'2013-09-17 08:27:05',20,0,0,'INCOMPLETO'),(202,'Cultivo de clulas madre mesenquimales del cordn umbilical humano.Potencialidad steo-condrognica \"in vitro\"','Las clulas madre mesenquimales son clulas con capacidad de autorenovarse indefinidamente y generar uno o mas tipos de clulas diferenciadas. Debido a estas propiedades son activamente estudiadas para su uso en los diferentes campos de la medicina regenerativa as como en la creacin de modelos de estudio in vitro. Actualmente, una fuente de estas clulas madre, es la Gelatina de Wharton del cordn umbilical humano; el cual une al feto con su madre. Estas clulas madre son embrionarias, ya que provienen de un rgano presente solo hasta el nacimiento, y pluripotenciales, ya que diversos trabajos reportan su capacidad de diferenciacin en clulas de los tres linajes embrionarios. Estas diferenciaciones son posibles gracias al uso de distintos factores solubles adicionados a los medios de cultivo, y a los propios sistemas de cultivo empleados como los cultivos en monocapa y en sistemas tridimensionales, libres o no de matriz, los cuales buscan imitar las condiciones in vivo.Los trabajos realizados con este tipo de clulas madre embrionarias de la Gelatina de Wharton del cordn umbilical humano son escasos y mucho ms en nuestro pas, por lo que se ha propuesto establecer cultivos de estas clulas y estudiar su proliferacin y capacidad de diferenciacin steo - condrognica in vitro. Los cultivos primarios de la Gelatina de Wharton presente tanto en la zona perivascular como intervascular, muestran una poblacin heterognea formada por: clulas tipo fibroblasto, clulas con citoplasma extenso, clulas endoteliales y clulas gigantes multinucleadas (estas dos ltimas slo por disgregacin enzimtica). Estas poblaciones fueron casi totalmente homogneas a lo largo de los subcultivos, observndose solo la persistencia de clulas tipo fibroblasto y algunas clulas con citoplasma extenso. La proliferacin de cada cultivo fue diferencial, pero un ensayo para determinar este parmetro determin el comienzo de la fase de crecimiento exponencial a los 4 das, sin llegarse a observar la fase Plateau. Con trozos de Cordn Umbilical almacenados bajo condiciones especficas se pudo determinar la viabilidad, obteniendo un aumento en el tiempo de proliferacin a medida que se aumentaba el tiempo de almacenaje, observndose el mximo a los 4 das de almacenaje. Por medio de coloraciones de rutina realizadas en diversos cultivos de ambas fuentes, se pudo evidenciar la presencia de clulas tipo fibroblasto, con una morfologa ahusada, ncleo ovalado y central fuertemente basfilo, y citoplasma moderadamente basfilo. Adems se han observado clulas vacuoladas con citoplasma extenso, ncleo central, circular y basfilo; y clulas con citoplasma extenso moderadamente basfilo, protenas del citoesqueleto visible, ncleo excntrico y ovalado. Gracias a determinaciones inmunocitoqumicas se determino la co-expresin de Vimentina y Citoqueratinas en los dos tipos celulares presentes en los subcultivos, disminuyendo su nivel de expresin a lo largo de los mismos. Tanto los cultivos en monocapa como los sistemas en micromasas, sometidos a induccin as como los controles, mostraron una diferenciacin hacia el linaje steo-condrognico, determinado esto por coloraciones con Rojo Alizarina S, Azul de Toluidina y Safranina O. La intensidad de tincin en cultivos en monocapa mostr un aumento a medida que se induca por ms tiempo, sin embargo en las micromasas se mantuvo constante. Adems de esto, a nivel general, se observ que la intensidad de tincin de los cultivos provenientes de arterias siempre fue mayor que los cultivos provenientes de la Gelatina de Wharton, por lo que se sugiere que las primeras son ms fcilmente inducibles a diferenciacin.','2009-10-20','Cordn umbilical, Clulas madre mesenquimales, Gelatina de Wharton.',1,1,1,1,1,'2013-09-17 08:27:06','2013-09-17 08:27:06','Documento_202.pdf','application/pdf',0,'2013-09-17 08:27:06',20,0,0,'INCOMPLETO'),(203,'VARIACIONES ESPACIALES Y TEMPORALES DE LA COMUNIDAD ZOOPLANCTNNICA EN DOS LOCALIDADES DEL EMBALSE SUATA ((ESTADO ARAGUA,, VENEZUELA))','Hasta el momento no existen trabajos publicados sobre aspectos relacionados con la ecologa de la comunidad del zooplancton del embalse Suata (Edo. Aragua). Por ello, se plante el objetivo de cuantificar su abundancia y biomasa y relacionarlas con las variables fisicoqumicas y con la concentracin de clorofila-adel cuerpo de agua.. Para la realizacin del estudio se tomaron muestras en dos localidades del embalse con una frecuencia mensual, de mayo a octubre de 2008. La estacin 1 (E1) ubicada cerca del dique en las cercanas de la zona donde desemboca el principal afluente del embalse y donde simultneamente se genera la principal salida de agua, y la estacin 2 (E2) ubicada en el lado opuesto al dique. Entre las variables fisicoqumicas se estimaron la transparencia del agua, temperatura, oxgeno disuelto, pH, conductividad, concentraciones de nitrgeno total y fsforo total, mientras que la biomasa del fitoplancton se estim mediante la extraccin de la clorofila-a con etanol. Los organismos del zooplancton fueron colectados en el estrato oxigenado del cuerpo de agua con una red de plancton (luz de malla 77 mm) y preservados en formol (4% concentracin final). La abundancia se estim mediante conteos duplicados en cmaras Sedgwick-Rafter (1ml). La biomasa se estim mediante la determinacin del peso seco de los especmenes contenidos en una alcuota de 0,1 ml de muestra por secado a 60C por 20 horas. El embalse Suata, se clasific como polimctico debido a que permanece mezclado la mayor parte del ao. Se registraron diferencias significativas en cuanto a la concentracin de oxgeno disuelto entre ambas estaciones. El carcter de las aguas fue alcalino y se registraron altas concentraciones de Nt y Pt que permitieron clasificar el embalse como hipereutrfico. Estas ltimas y la concentracin de clorofila-a no presentaron diferencias significativas entre ambas estaciones. Se identificaron 24 taxones de zooplancton, de los cuales los rotferos presentaron 12 especies, los cladceros 6 especies y los coppodos 3 especies. El grupo de los ostrcodos domin la comunidad del zooplancton durante la mayor parte del perodo de estudio. La abundancia del zooplancton vari entre 114 org/l (julio) a 1566 org/l (septiembre) en E1, y entre 444 org/l (julio) a 5118 org/l (octubre) en E2. Estos valores son propios de sistemas hipereutrficos como lo es el embalse Suata. Los ostrcodos representaron en promedio el 59,2% de la abundancia relativa, seguidos por los rotferos con un promedio de 27,1% y por los cladceros con un 8%. El grupo de los coppodos represent el 13% de los individuos en E1 y el 5,4% en E2. Otros grupos (protozoarios, nematodos), presentaron promedios menores al 0,4%. La mayor abundancia del zooplancton se registr en los estratos superficiales de ambas estaciones. Por su parte, la biomasa del zooplancton present un promedio de1889  2331 mg/l con un mnimo de 72 mg/l (julio) y un mximo de 6551 mg/l (septiembre) para E1, mientras que en E2 el promedio fue de 2364  4000 mg/l con un mnimo de 329 mg/l (mayo) y un mximo de 10490 mg/l (octubre). La mayor parte de la biomasa total fue aportada por los ostrcodos. Los cambios temporales en las condiciones ambientales parecieron ser los responsables de las fluctuaciones en la abundancia y en la biomasa del zooplancton en el embalse Suata.','2009-10-15','Zooplancton; Abundancia; Biomasa; Embalse Tropical; Suata; Venezuela',1,1,1,1,1,'2013-09-17 08:27:08','2013-09-17 08:27:08','Documento_203.pdf','application/pdf',36253801,'2013-09-17 08:27:08',19,0,227,'COMPLETO'),(204,'CARACTERIZACIN GEOQUMICA DE LOS SEDIMENTOS DE FONDO DE LA ZONA ESTE DEL GOLFETE DE CUARE Y SU ZONA PRXIMA COSTERA, ESTADO FALCN','En el presente estudio fue determinada la concentracin de Al, Ca, Fe, Mg, Co, Cr, Cu, Ni, Mn, Sr, Pb, Zn y Hg, en la fraccin lodo de los sedimentos de fondo de la seccin este del Golfete de Cuare y su zona prxima costera. Para ello, fueron captadas 17 muestras de ncleos de 20 cm de largo, seguidamente sometidas a una extraccin cida secuencial con HCl 1M y posteriormente con HNO3 concentrado. El anlisis de estos ncleos fue realizado utilizando la tcnica de Espectroscopia de Emisin Atmica con Fuente de Plasma Inductivamente Acoplado (EEA-ICP). Por su parte el Hg en los sedimentos fue determinado por medio de un equipo analizador de mercurio total (TMA~80). As mismo fueron realizados anlisis de Difraccin de Rayos X para establecer las fases minerales presentes en las muestras de sedimentos con el propsito de conocer su asociacin con las concentraciones de los elementos. Los resultados obtenidos indican que la fraccin lodo es la dominante en la zona de estudio dentro del Golfete de Cuare con un promedio de 95%; mientras que, en la zona prxima costera predominan arenas muy fina en aproximadamente un 55%. La concentracin de Al, Fe, Mn, Cu, Zn y Pb dentro del golfete, es mayor en relacin a la zona prxima costera, pero el Co presenta un comportamiento contrario. Por otro lado, el Mg, Ni, Cr y Hg muestran una mayor homogeneidad en sus concentraciones en el sistema bajo estudio; finalmente el Ca y el Sr aumentan hacia la boca del golfete. A su vez, verticalmente es notada una distribucin homognea de los metales estudiados en el golfete; mientras que en la zona prxima costera puede observarse un aumento de la concentracin de estos en funcin de la profundidad. El Al est asociado a fases de hidrxidos de aluminio amorfas o alumino-silicatos pobremente cristalinos; por su parte, los elementos Fe y Mn estn incorporados a oxi- hidrxidos amorfos y cristalinos; mientras que, el Ca y el Sr a carbonatos. Los metales Co, Cu, Zn, Ni y Pb estn como elementos sorbidos sobre las arcillas, y/u oxi-hidrxidos de Fe, ta,nien asociados a estos ltimos por coprecipitacin. El anlisis de Difraccin de Rayos X pudo constatar la presencia de fases minerales como goetita, calcita, cuarzo y arcillas en los sedimentos de fondo de la zona bajo estudio','2009-09-07','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',4,1,1,1,1,'2013-09-17 08:27:11','2013-09-17 08:27:11','Documento_204.pdf','application/pdf',8905728,'2013-09-17 08:27:11',19,0,0,'INCOMPLETO'),(205,'Estudio qumico y evaluacin biolgica de los componentes principales del alga venezolana Ulva lactuca','Al alga Ulva lactuca colectada en las costas de la isla de Margarita, se le realiz un estudio qumico y una evaluacin biolgica. Se prepararon cuatro extractos principales a partir del material seco, mediante la particin del crudo metanlico (CM) inicial: EH, ED, EM y EA. Del EM, mediante tcnicas cromtogrficas de columna y capa fina, se aislaron tres fracciones principales: EM1, EM3 y EM4. De EM1 se logr caracterizar un cido graso como constituyente principal. En EM3 se presume la presencia de dos monosacridos, uno en forma libre y otro unido a un glicerol. Finalmente, usando los datos espectroscpicos de EM4 y realizando ensayos qumicos se pudo inferir la presencia de un monosacrido como constituyente de esta fraccin (EM4).','2009-10-26','Ulva lactuca, glucosa-6-fosfatasa, algas',6,1,1,1,1,'2013-09-17 08:27:11','2013-09-17 08:27:11','Documento_205.pdf','application/pdf',1923055,'2013-09-17 08:27:11',19,0,153,'COMPLETO'),(206,'Rediseo de la aplicacin Web para la divulgacin de la oferta acadmica y servicios generales en linea del Programa de Cooperacin Interfacultades (PCI) U.C.V., siguiendo el workflow propuesto por Emily Cotler y Kelly Goto.','En este trabajo, se reflejan los aspectos metodolgicos y prcticos inherentes al proceso de rediseo que se realiz en la aplicacin Web del Programa de Cooperacin Interfacultades (PCI), institucin perteneciente a la U.C.V. Se describen los criterios y lineamientos propuestos por Emily Cotler y Kelly Goto para la planificacin y gestin del rediseo Web, conjuntamente con la metodologa de desarrollo utilizada. El PCI se encarga fundamentalmente de interrelacionar acadmicamente a las diversas Facultades de esta institucin universitaria, recolectando y gestionando informacin concerniente a aquellas asignaturas de otras carreras que un estudiante regular de la Universidad pudiese cursar; constituyndose sto en un aliciente de sumo beneficio para el enriquecimiento acadmico y personal de los estudiantes que decidan incorporarse a dicho programa.','2009-10-27','Programa, Cooperacin, Interfacultades, PCI, UCV, Rediseo, Goto, Cotler, aplicacin Web, oferta acadmica',2,1,1,1,1,'2013-09-17 08:27:13','2013-09-17 08:27:13','Documento_206.pdf','application/pdf',0,'2013-09-17 08:27:13',20,0,0,'INCOMPLETO'),(207,'Gestin de historias medicas de hospitalizaciones utilizando dispositivos mviles y tecnologa Wi-Fi.','En el presente Trabajo Especial de Grado se describe el proceso de anlisis, diseo e implementacin de un sistema de gestin de historias mdicas de hospitalizaciones, utilizando dispositivos mviles con capacidades de navegacin Web y capacidades de conexin a redes inalmbricas IEEE 802.11. La solucin planteada se desarroll bajo una arquitectura Web de tipo Cliente/ Servidor. La gestin tradicional de historias mdicas conlleva mltiples inconvenientes, un ejemplo consiste en el almacenamiento fsico y custodia de historiales mdicos, los cuales se convierten en un verdadero problema debido a la gran cantidad de informacin que se maneja. De igual forma, la gestin tradicional conlleva a posibles equivocaciones de legibilidad al momento de realizar el llenado de la informacin o al momento de realizar transcripciones de un lugar a otro, pudiendo causar demoras e inconvenientes en la prestacin del servicio mdico. El uso de dispositivos mviles para la gestin de historiales mdicos en un rea de hospitalizacin, representa una solucin portable y poco costosa a los problemas inherentes de la gestin tradicional. Los beneficios del uso de dispositivos mviles en un rea de hospitalizacin se evidencian al permitir que los profesionales de la medicina ejecuten procesos de toma de decisiones eficientes y oportunos, teniendo acceso a la informacin de forma electrnica sin importar el lugar donde se encuentren.','2009-10-26','Historias Mdicas, Dispositivos Mviles, Redes Inalmbricas, Hospitalizaciones, IEEE 802.11.',2,1,1,1,1,'2013-09-17 08:27:14','2013-09-17 08:27:14','Documento_207.pdf','application/pdf',2303351,'2013-09-17 08:27:14',20,0,110,'COMPLETO'),(208,'EVALUACINN DE LA TCCNICA DE PCR PARA LA IDENTIFICACINN MOLECULAR DE ESPECIES DE ATNN COMERCIALIZADAS EN VENEZUELA..','En la actualidad, los consumidores estn ms conscientes de los sistemas ecolgicos y en la materia del medio ambiente; la demanda de alimentos orgnicos y de los productos obtenidos de los sistemas eco-sostenibles aument. Sin embargo, los procesos de industrializacin, as como la globalizacin de los mercados, han hecho difcil mantener un control en el procesamiento de los alimentos, haciendo relativamente fcil sustituir fraudulentamente las variedades ms valoradas de pescado por otras de caractersticas similares. La gentica molecular tiene herramientas que permiten solventar estas dificultades, ya que facilita la identificacin de las diferentes especies pesqueras y sus productos gracias a su propio ADN y no a una etiqueta asociados a ellos. En el presente trabajo se plante evaluar la identificacin, mediante tcnicas moleculares, de algunas muestras de atn tanto fresco como enlatado, que son comercializados en el pas, con la finalidad de crear una herramienta confiable, fcil y de resultados rpidos que permita distinguir las diferentes especies de pescados que puedan ser enmascarados bajo etiquetas falsas. Se realizaron distintos mtodos de aislamiento de muestras de ADN, se realiz una Reaccin en Cadena de la Polimerasa asociada a Polimorfismo de la Longitud de Fragmentos de Restriccin (PCR-RFLP), utilizando dos juegos de cebadores y diferentes enzimas de restriccin. Se demostr que la cantidad y calidad del ADN depende del grado de procesamiento y de los tipos de aditivos agregados en la materia prima. Se pudo identificar que una de las especies empleadas para el proceso de enlatado es el atn blanco o Thunnus alalunga. Esta primera prueba piloto permiti evaluar la identificacin de algunas especies de atn, para que posteriormente pueda ser transferida a los sectores empresarial y gubernamental.','2009-10-16','PCR-RFLP; ; T.. alalunga',1,1,1,1,1,'2013-09-17 08:27:15','2013-09-17 08:27:15','Documento_208.pdf','application/pdf',0,'2013-09-17 08:27:15',19,0,0,'INCOMPLETO'),(209,'Caracterizacin Geoqumica de las Cuarcitas Ferruginosas situadas en la Cuenca del ro Aro, estado Bolvar, Venezuela','Se llev a cabo un estudio sobre la abundancia y distribucin de la concentracin de los elementos mayoritarios, minoritarios, trazas y Tierras Raras en cuarcitas ferruginosas de la cuenca del ro Aro, con la finalidad de caracterizar su ambiente de formacin, determinar que tipo de cuarcita ferruginosa se presenta y establecer si representan una reserva importante de hierro y otros elementos que pudiesen estar asociados a estos cuerpos rocosos. Se colectaron 36 muestras de roca, las cuales se trituraron y pulverizaron, para su posterior anlisis mediante la tcnica de Activacin de Neutrones (INAA) en un laboratorio comercial en Canad y por el mtodo de fusin alcalina mediante la tcnica de Espectroscopia de Emisin Atmica de Plasma Inductivamente Acoplado (ICP-AES), obteniendo as la concentracin de los elementos analizados en esta investigacin. El patrn de distribucin de los elementos mayoritarios y minoritarios permite determinar una composicin similar a la encontrada para las Formaciones Bandeadas de Hierro (BIF) del Arqueano y del Paleoproterozoico, con la excepcin de los elementos Mg, Ca, K, que presentan un empobrecimiento con una concentracin por debajo del lmite establecido para estas formaciones. Los patrones de distribucin de los elementos de Tierras Raras normalizados con NASC (North American Shale Composite) y composicin condrtica, as como los valores encontrados para Eu/Eu* y Ce/Ce*, permiten proponer posibles anomalas positivas leves a moderadas de Eu, anomalas negativas de Ce y enriquecimiento de bajo a moderado grado de La, lo cual, es evidencia de un posible aporte hidrotermal, con soluciones hidrotermales fuertemente diluidas o soluciones hidrotermales muy alejadas de la fuente. Los patrones de distribucin de los elementos trazas y la composicin mineralgica encontrada para las cuarcitas ferruginosas de la cuenca del ro Aro, permiten proponer un ambiente de formacin similar al propuesto para las formaciones bandeadas de hierro de el tipo Lago Superior.','2009-09-07','Cuarcitas Ferruginosas, Formacin Bandeada de Hierro, Ro Aro',4,1,1,1,1,'2013-09-17 08:27:17','2013-09-17 08:27:17','Documento_209.pdf','application/pdf',18219344,'2013-09-17 08:27:17',18,0,91,'COMPLETO'),(210,'Sntesis y Caracterizacin del compuesto Nd((11--x))SrxMn((11-- y))FeyO33 nanocristalino..','Se sintetizaron compuestos del sistema Nd(1-x)SrxMn(1-y)FeyO3 para las siguientes composiciones: (X=0,0; Y=1,0), (X=1,0; Y=1,0) y para (X=0,3; Y=0,5), mediante los mtodos de Combustin y Sol-Gel (a excepcin del compuesto Nd0,7Sr0,3Mn0,5Fe0,5O3 que no fue sintetizado por Sol-Gel). Todas las muestras fueron calcinadas en un horno convencional tubular, usndose para (X=0,0; Y=1,0) y (X=0,3; Y=0,5) una temperatura de 650K y para (X=1,0; Y=1,0) una temperatura de 1000K. La caracterizacin estructural en los compuestos se realiz mediante la difraccin de rayos X (DRX). El anlisis de los difractogramas mostr que el compuesto Nd0,7Sr0,3Mn0,5Fe0,5O3 sintetizado por el mtodo de Combustin presenta una mezcla de fases cristalogrficas del tipo ortorrmbica y tetragonal. El SrFeO3 sintetizado por el mtodo de Combustin presenta una mezcla de fases cristalogrficas del tipo ortorrmbica y tetragonal, mientras que sintetizado por el mtodo de Sol-Gel presenta una estructura cristalina del tipo cbica simple. El compuesto NdFeO3 sintetizado por el mtodo de Combustin cristaliza en una estructura ortorrmbica, mientras que por el mtodo de sol-gel no hubo una clara formacin de una fase deseada. Fue determinado el tamao promedio de partcula usndose la ecuacin de Scherrer obtenindose un tamao alrededor de 20,7 nm para el compuesto Nd0,7Sr0,3Mn0,5Fe0,5O3, 60,6 nm para el SrFeO3por el mtodo de Combustin y 41,4 nm por el mtodo de Sol-Gel; y 70,8 nm para el NdFeO3. Utilizndose la Microscopa Electrnica de Transmisin (TEM), mediante micrografas, se confirm la existencia de nanopartculas con una amplia distribucin de tamao, con un tamao promedio de 89,60 nm para el NdFeO3 y 31,70 nm para el Nd0,7Sr0,3Mn0,5Fe0,5O3, resultados que difieren un poco de los encontrados con el uso de la ecuacin de Scherrer en los difractogramas de difraccin en polvo. Espectros de Resonancia Paramagntica Electrnica (RPE) fueron obtenidos en el rango de temperaturas entre 100K y 600K para las diversas concentraciones de Nd, Sr, Mn y Fe. Todos los espectros presentaron un pico de absorcin principal en g = 2. Entre los resultados observados destaca que el ancho de lnea pico- pico decrece con el aumento de la temperatura. Este comportamiento est relacionado con la interaccin de intercambio entre los iones magnticos. A partir del anlisis de la dependencia de DHpp con la temperatura, se extrajeron valores estimados para la temperatura de Curie-Weiss (th) y la temperatura de congelamiento Tf de la fase de vidrio de spin. Los valores de th obtenidos fueron negativos, lo que es indicativo de una fuerte interaccin del tipo antiferromagntico, con un parmetro de J = 1 que nos indica sobre una posible transicin de una fase paramagntica a una fase del tipo vidrio de spin.','2009-10-29','Sntesis y Caracterizacin del compuesto Nd(1-x)SrxMn(1-y)FeyO3 nanocristalino. Nanocristalino. Perovskitas.',3,1,1,1,1,'2013-09-17 08:27:18','2013-09-17 08:27:18','Documento_210.pdf','application/pdf',1524578,'2013-09-17 08:27:18',19,0,172,'COMPLETO'),(211,'Implementacin de una arquitectura de red WLAN basada en el estndar IEEE 880022..1111 y en el esquema de seguridad WPA22--Enterprise','La empresa C.G.S.I., C.A. (Consultora Global en Seguridad Informtica) requera implementar una red inalmbrica con fuerte nfasis en la seguridad, para remplazar su antigua WLAN basada en un dispositivo orientado a redes hogareas y con bajos niveles de proteccin. En este Trabajo Especial de Grado se presenta el proceso de diseo, implementacin y pruebas de una nueva red inalmbrica para C.G.S.I, C.A., acorde con las mejores prcticas de la industria. Esta red consta de una arquitectura de conectividad que da soporte al acceso de los clientes inalmbricos, conforme al estndar IEEE 802.11. Los componentes de esta arquitectura estn basados en dispositivos del fabricante de equipamiento para WLAN Aruba Networks. Por otra parte, existe tambin una arquitectura de seguridad donde se establece la infraestructura de autenticacin y control de acceso a la red inalmbrica. La arquitectura de seguridad, construida sobre los componentes de la plataforma Microsoft Active Directory de la compaa, implementa el esquema WPA2-Enterprise (WI--Fi Protected Access 22), que provee autenticacin IEEE 802.1X y cifrado de datos CCMP-AES. El resultado final es una solucin WLAN completamente funcional que cumple con la especificacin de red de seguridad robusta (RSN) definida en el estndar IEEE 802.11-2007.','2009-10-27','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:27:19','2013-09-17 08:27:19','Documento_211.pdf','application/pdf',835819,'2013-09-17 08:27:19',19,0,117,'COMPLETO'),(212,'Prototipo del Sistema de Gestinn de Preparadores de la Escuela de Computacinn,, mddulos Gestinn de Retiros y Administrativo..','El desarrollo del presente trabajo, constituye la construccin de un Prototipo del Sistema de Gestin de Preparadores de la Escuela de Computacin (SGP--EC), mdulos Administrativo y Gestin de Retiros para el mejoramiento de los procesos de dicha gestin, siguiendo las fases de la metodologa OpenUp produciendo en la primera fase un flujo de trabajo (Workflow) que representa las actividades correspondientes a los usuarios actuales. Tambin se llev a cabo la definicin y especificacin de los elementos necesarios para la creacin de los servicios Web que permiten el suministro de los datos para los mdulos de Gestin de Retiros y Administrativo empleando la herramienta tecnolgica Ruby on Rails. Durante la ltima fase se realiz la simulacin de la ejecucin de las funcionalidades. Alcanzando el objetivo principal de este trabajo especial de grado se consigui como resultado el desarrollo el mdulo de Gestin de Retiros, del Sistema de Gestin de preparadores de la Escuela de Computacin, en conjunto con el mdulo Administrativo del sistema.','2009-10-29','Gestin de preparadores, Gestin por procesos, Workflow, servicios Web, OpenUp, Ruby on Rails.',2,1,1,1,1,'2013-09-17 08:27:21','2013-09-17 08:27:21','Documento_212.pdf','application/pdf',1942437,'2013-09-17 08:27:21',20,0,103,'COMPLETO'),(213,'Caracterizacinn del fenmmeno de sorcinn de los elementos As,, Cr,, Hg y Pb por la turba del manglar del Refugio de Fauna Silvestre de Cuare,, localidad Boca del Zorro,, estado Falcnn','El presente trabajo tiene como objetivo principal evaluar la capacidad de adsorcin y desorcin de la turba del manglar de Morrocoy, estado Falcn hacia las especies As3+, Cr3+, Hg2+ y Pb2+. Para tal fin se efectu una caracterizacin composicional gruesa a la turba, determinando que se encuentra conformada por aproximadamente 20% humedad, 44% de materia orgnica y 36% de material inorgnico (arcillas). Para los ensayos de adsorcin, se prepararon soluciones de concentracin conocida de cada uno de los adsorbatos y se colocaron en agitacin con la turba. Se mantuvo un pH entre 6 y 7 y una temperatura promedio de 25 C. Cada ensayo se realiz por triplicado. Los resultados obtenidos mostraron que las cuatro especies qumicas bajo estudio se adsorbieron sobre la turba en una gran extensin, ajustndose satisfactoriamente al modelo de Langmuir. Las concentraciones mximas de adsorcin calculadas (Xmax) para cada especie fueron: para el As3+, 96552845 mg/Kg; Cr3+, 61301665 mg/Kg; Pb2+, 273829047 mg/Kg; y Hg2+, 531347178 mg/Kg. El orden de afinidad de los cationes hacia el sustrato fue Hg2+>Pb2+> As3+> Cr3+. El ajuste satisfactorio observado hacia el modelo de Langmuir sugiere adsorcin en monocapa, y por tanto un fenmeno de quimiosorcin. Este comportamiento se asocia principalmente a la naturaleza qumica de cada especie y a la estabilidad que tienen de formar complejos estables con la materia orgnica. Los resultados de los ensayos de desorcin de los cationes para la turba revelaron que este sustrato no libera las especies adsorbidas con facilidad. Los porcentajes de desorcin promedio fueron menores al 1%, siendo el orden de desorcin observado Hg2+>Pb2+>Cr3+. El comportamiento del As3+ en las pruebas de desorcin fue errtico y no reproducible, pero sugiere que se desorbe en mayor proporcin que los restantes elementos ensayados. Los resultados de adsorcin y desorcin obtenidos son de gran importancia, pues revelan que la turba adsorbe gran cantidad de iones y no los libera, lo que implica que este sustrato puede estar jugando un papel primordial en el control qumico y disponibilidad de especies txicas en los ambientes naturales en los que se forma.','2009-09-07','Adsorcin, turba, desorcin, manglar.',4,1,1,1,1,'2013-09-17 08:27:23','2013-09-17 08:27:23','Documento_213.pdf','application/pdf',6041266,'2013-09-17 08:27:23',19,0,157,'COMPLETO'),(214,'OBTENCINN Y CARACTERIZACINN MOLECULAR DE RESINAS TIPO I Y RESINAS TIPO II DE CRUDOS VENEZOLANOS','Debido a que experimentalmente se ha encontrado que las resinas tipo I y tipo II de los crudos poseen caractersticas dispersantes de los coloides asfaltnicos dentro de los mismos, actuando como surfactantes naturales, resulta interesante un estudio de caracterizacin molecular de dichas fracciones para crudos venezolanos de diferente estabilidad. En el presente trabajo de investigacin se obtuvieron las resinas tipo I y tipo II de los crudos inestables Furrial y Ceuta, y los estables Cerro Negro y Hamaca, y a travs de estudios de caracterizacin molecular como VPO, Anlisis Elemental de C, N, H, S y O, IR y RMN de 1H y 13C, se encontraron diferencias en las caractersticas moleculares promedio de dichas fracciones. En general se obtuvo que las resinas tipo II de todos los crudos son estructuras menos aromticas de mayor tamao, con presencia de mayor cantidad de sustituyentes alqulicos y heterotomos como O y S que las resinas tipo I de un mismo crudo. Esto permite presumir que las resinas tipo I tienen mayor capacidad de establecer interacciones efectivas con los asfaltenos por lo que coprecipitan con ellos, mientras que las resinas tipo II por ser ms sustituidas establecen interacciones ms efectivas con las dems molculas del crudo quedando en solucin cuando ocurre dicha precipitacin. Tambin se encontr que los grupos carbonilos presente en las resinas que provienen de crudos estables Cerro Negro y Hamaca estn asociados a cidos carboxlicos mientras que en las provenientes de crudos inestables Furrial y Ceuta se asocian a cetonas conjugadas. Las interacciones tipo puente de hidrgeno que se establecen entre los hidrgenos de los grupos carboxilos de las resinas de los crudos estables con los grupos bsicos de sus asfaltenos, permiten justificar la estabilidad de los mismos en solucin ya que son interacciones difciles de romper ante cualquier perturbacin del sistema del crudo.','2009-10-26','Asfaltenos, resinas tipo I, resinas tipo II, Floculacin, Aromaticidad',6,1,1,1,1,'2013-09-17 08:27:24','2013-09-17 08:27:24','Documento_214.pdf','application/pdf',586785,'2013-09-17 08:27:24',20,0,59,'COMPLETO'),(215,'APROVECHAMIENTO INTEGRAL DEL MAMNN ((Melicocca bijugaL..)) COMO MATERIA PRIMA PARA LA INDUSTRIA ALIMENTARIA','El mamn (Melicocca bijuga L.) es una fruta que es utilizada a nivel domstico como materia prima en la elaboracin de jugos, dulces y mermeladas, pudiendo ser la base de varias industrias; as, considerando las caractersticas de la semilla, la adaptabilidad de la planta a la geografa nacional y la importancia en diversos renglones econmicos regionales, as como fomentar la ingesta de frutas criollas, se desarroll el presente trabajo, en el cual se evalu la adaptabilidad del fruto de mamn (Melicocca bijuga L.) a la metodologa de extraccin de almidn de su semilla y a la elaboracin de jaleas y mermeladas. Los valores ms representativos en la pulpa fueron los de su proporcin respecto al resto de los constituyentes del fruto, ya que sta representa casi el 50 % del fruto entero. Su pH es de 3,70 lo que hace que al realizar productos como la jalea y la mermelada la adicin de cido ctrico para cumplir con las normas vigentes sea mnima. Adems, presenta un porcentaje de slidos totales de 22,59 %. En el caso de la semilla, el alto porcentaje de protena (21,07 %) resulta interesante para realizar diversos productos. En el almidn extrado de la semilla de mamn llama la atencin el alto contenido de amilosa (31,04 %) en comparacin con otros almidones. Los productos desarrollados (jalea y mermelada) se adaptan perfectamente al esquema de produccin tradicional y cumplen con las normas establecidas; al mismo tiempo presentaron una buena aceptacin por parte de un panel de consumidores.','2009-09-03','Melicocca bijuga, mamn, mermelada, jalea, almidn',1,1,1,1,1,'2013-09-17 08:27:26','2013-09-17 08:27:26','Documento_216.pdf','application/pdf',1250993,'2013-09-17 08:27:26',20,0,37,'COMPLETO'),(216,'ESTUDIO DE LA HOMOGENEIDAD QUMMICA DE LAS VARIABLES Si, Ca, Fe, K, Ti, Ba, Ce, Pb, Ni, Sc, Sn, Sr, Sb, La, Y y Mo, EN LA MUESTRA COMPUESTA DE ARCILLITAS DE FALCNN ((MCAF)),, CANDIDATA A MATERIAL DE REFERENCIA','El presente trabajo de investigacin estuvo enfocado en realizar un estudio sobre la homogeneidad de distintos elementos qumicos en la Muestra Compuesta de Arcillitas de Falcn (MCAF). La muestra fue preparada por Escorcia en 2008, a partir de la mezcla de muestras simples pertenecientes a las Formaciones geolgicas Urumaco, Socorro, Querales, Cerro Pelado, Agua Clara, Pedregoso, Pecaya y El Paraso, de la Cuenca Central de Falcn. Los elementos qumicos que constituyeron las variables de estudio fueron Si, Fe, Ca, K, Ti, Ba, Pb, Sc, Sn, Sr, La, Mo, Y, Ni, Ce y Sb. La metodologa analtica empleada consisti en seleccionar aleatoriamente 15 submuestras de la MCAF y realizar el anlisis qumico por duplicado de cada una, una vez que estas fueron llevadas a solucin mediante el mtodo de fusin alcalina. Otras 4 submuestras se seleccionaron igualmente al azar para realizar el anlisis mineralgico. Las tcnicas de anlisis empleadas fueron Espectrometra de Emisin Atmica con fuente de Plasma, EEO-IAP y Espectrometra de Emisin Atmica, (EEA-Llama, en el caso del K), para determinar las concentraciones elementales; y para las determinaciones mineralgicas se emple la tcnica de Difraccin de Rayos X. Posteriormente se realiz un anlisis exploratorio de datos que involucr pruebas de normalidad y datos anmalos y se procedi a realizar las pruebas de homogeneidad a los datos de composicin qumica obtenidos para cada variable (excepto para Ce, Ni y Sb los cuales estn por debajo del lmite de deteccin y no se determinaron), utilizando el ANOVA de un factor y la prueba de `homogeneidad suficiente\'\' descrita por Fearn y Thompson, (2001) para pruebas de homogeneidad en materiales. Los resultados obtenidos revelaron que todas las variables que pudieron ser determinadas presentan homogeneidad en el material para un 95% de confianza. Los datos son reportados como provisionales, o provisionales no recomendados para los casos en los que se present muy baja exactitud y precisin (obtenido para Pb, Mo y La). Por su parte, el anlisis mineralgico revel la presencia de al menos 6 fases minerales, de las cuales, 3 corresponden a las arcillas ilita, caolinita y montmorillonita, y el resto a cuarzo, anatasa y yeso. Se establece que el material es un buen prospecto para ser actualmente un material de referencia intralaboratorio y para continuar con estudios sobre el mismo que permitan incrementarle su rango de clasificacin.','2009-10-16','Homogeneidad qumica; Muestra compuesta; Arcillitas; material de referencia; Falcn.',4,1,1,1,1,'2013-09-17 08:27:27','2013-09-17 08:27:27','Documento_217.pdf','application/pdf',2739307,'2013-09-17 08:27:27',19,0,128,'COMPLETO'),(217,'Implantacion de una plataforma grid basada en gLite y Scientific Linux para el Centro de Computacion Paralela y Distribuida','Actualmente las aplicaciones de c lculo complejo aumentan dr sticamente la carga de trabajos en los computadores, exigi ndoles mayores recursos para terminar sus tareas. Gra- cias a los avances logrados en el c mputo distribuido, es posible contar con gran poder de procesamiento y de almacenamiento de datos a bajo coste, esto gracias a la creaci n deo cluster de alto rendimiento con m quinas tipo PC. Esto compensa a los grandes y costosos equipos de procesamiento, los cuales hace poco tiempo eran los encargados de realizar las ta- reas de c mputo de alto desempe o. Es aqu  es donde la tecnolog  Grid ofrece una soluci n viable y robusta para la resoluci n de problemas de alto desempe o.','2009-11-02','paralelismo, grid, glite',2,1,1,1,2,'2013-09-17 08:27:28','2013-09-17 08:27:28','Documento_218.pdf','application/pdf',0,'2013-09-17 08:27:28',20,0,0,'INCOMPLETO'),(218,'Evaluacinn de la actividad Citotxxica de las Clulas NK de Pacientes Crnnicamente Infectados con el Virus de Hepatitis C ((VHC))','La Hepatitis viral consiste en la inflamacin del hgado generada por un virus de las cuales existen 5 tipos principales de hepatitis: A, B, C, D y E. Actualmente 180 millones de personas estn infectadas con el virus de la hepatitis C (VHC) a nivel mundial. De las personas infectadas, el 85% presentan infeccin persistente de los cuales 30% desarrollan patologa heptica como hepatocarcinoma o cirrosis heptica y del 1 a 5% mueren. El sistema inmunolgico tiene como principal funcin la proteccin del organismo de daos causados por agentes externos, la inmunidad innata acta como un brazo efector de este sistema, siendo la primera lnea de defensa contra virus. Uno de los principales componentes de esta respuesta son las clulas citotxicas naturales o Natural Killers (NK) las cuales se definen como linfocitos grandes granulares que expresan las molculas de superficie CD56, CD16 y ausencia del complejo CD3, con la capacidad de generar citotoxicidad de manera natural sin ninguna sensibilizacin previa. Sus clulas blanco estn representadas por clulas tumorales o infectadas por virus. En el modelo de infeccin por el VHC se ha reportado que la capacidad citotxica de las clulas NK se encuentra lo cual podra explicar la alta prevalencia del virus en estos pacientes. Objetivo:: Caracterizar desde el punto de vista funcional los linfocitos citotxicos naturales de pacientes crnicamente infectados con el virus de Hepatitis C (VHC). Materiales y Mtodos::Para la determinacin de la de la actividad citotxica de la NK se usaron 3 mtodos diferentes: el kit cytotox96, basado en la medicin de la enzima Lactato Deshidrogenasa, un ensayo citofluoromtrico con Anexina-V y Ioduro de propidio y evaluacin de la molcula CD107a (Lamp-1). As mismo se evalu la expresin de los receptores citotxico naturales (NCR) en las clulas NK de pacientes y controles. Resultados::En el ensayo citotxico basado en anexina y ioduro de propidio, los controles sanos registraron mayor porcentaje de citotoxicidad que los pacientes con un mximo de 4% de diferencia entre ellos, estos resultados se repiten con el estuche comercial para la medicin de la enzima LDH. Estas diferencias sin embargo no fueron significativas. En la evaluacin de la expresin de CD107a no encontramos diferencias significativas entre pacientes y controles. Este ensayo permiti determinar la actividad citotxica de la NK de una manera ms fcil y practica. Los receptores citotxicos naturales (NCR) no mostraron variacin en su nivel de expresin entre pacientes y controles. Conclusiones:: No se observaron diferencias significativas en la actividad citotxica de los pacientes crnicamente infectados con el virus de la hepatitis C, en comparacin con individuos controles sanos','2009-10-16','Clulas NKCitotxicidadHepatitis CLamp-1',1,1,1,1,1,'2013-09-17 08:27:29','2013-09-17 08:27:29','Documento_219.pdf','application/pdf',1228511,'2013-09-17 08:27:29',19,0,84,'COMPLETO'),(219,'ESTUDIO QUMICO Y EVALUACIN DE LA POSIBLE ACTIVIDAD ANTIINFLAMATORIA DEL ALGA Gracilariopsis hommersandii','Esta investigacin tuvo como objetivo, aislar, purificar, y evaluar la actividad antiinflamatoria de los metabolitos hallados en el alga Gracilariopsis hommersandii, a travs de tcnicas cromatogrficas y la elucidacin mediante tcnicas espectroscpicas, tales como: RMN-1H, RMN-13C, DEPT 135 y EM. Por otro parte, la actividad antiinflamatoria se evalu a travs del Mtodo de Griess, determinndose la capacidad inhibidora, por parte de los metabolitos, hacia el radical NO.Adicionalmente, dicha capacidad inhibidora pudo caracterizarse en funcin del ensayo de viabilidad celular MTT, establecindose as, si la inhibicin es causada por muerte celular o por la capacidad intrnseca hacia el radical.Se obtuvieron 9 metabolitos: 4 de tipo cido graso (IV, VI, VII, VIII), 1 de tipo ster (III), 1 de tipo ftalato (V), 1 de tipo galactopiranosilglicerol (IX), 1 de tipo sulfoquinovosil diacilglicerol (II) y finalmente una estructura nueva de tipo poliol similar al xilitol (I). El metabolito que present mayor actividad antiinflamatoria fue el cido eicosanoico (VII), con IC50 = 11,65 g/mL.','2009-10-16','Estudio Qumico, Actividad antiinflamatoria, Alga Gracilarioposis hommersandii',6,1,1,1,1,'2013-09-17 08:27:29','2013-09-17 08:27:29','Documento_220.pdf','application/pdf',897723,'2013-09-17 08:27:29',19,0,105,'COMPLETO'),(220,'Modelado del Proceso de Gestinn de Cambios segnn ITIL bajo el Software Libre Intalio','La Librera de Infraestructura de Tecnologa de la Informacinn ((ITIL -- Information Technology Infrastructure Library)) propone un conjunto de mejores prcticas para gestionar el proceso de cambios en las organizaciones,, debido a que en muchas de ellas no existe un control eficiente de los cambios que se realizan.. Para implementar este proceso de manera eficiente,, se realiz la evaluacinn de herramientas de software libre y de sistemas de gestinn de procesos de negocios,, seleccionando a Intalio BPMS 55..22 para cumplir con el objetivo de este Trabajo Especial de Grado..El uso de esta herramienta permiti modelar el proceso;; definir valores a los parmetros,, tales como los nombres o roles de los actores de las tareas;; y poner en ejecucinn el proceso,, sin tener que esperar a ningnn desarrollo de programacinn..Finalmente se obtuvo el modelo del proceso en una plataforma que permite gestionarlo y adaptarlo a cualquier organizacinn en base a las mejores prcticas propuestas por ITIL..','2009-10-28','BPM,, BPMS,, Intalio,, ITIL,, Proceso de Gestinn de Cambios,, SOA,, Web Services',2,1,1,1,1,'2013-09-17 08:27:31','2013-09-17 08:27:31','Documento_221.pdf','application/pdf',1361124,'2013-09-17 08:27:31',19,0,66,'COMPLETO'),(221,'EVALUAR LA DEGRADACION DE FENOL EMPLEANDO UN METODO DE OXIDACION AVANZADA: OZONO-LUZ ULTRAVIOLETA-CATALIZADOR.','Las tecnologias avanzadas de oxidacion se perfilan como los tratamientos por excelencia para la mineralizacion de compuestos organicos, especialmente compuestos aromaticos, dada su toxicidad aun a muy bajas concentraciones, su resistencia a los tratamientos tradicionales especialmente los biologicos, los costos de tratamiento y a las normas ambientales cada vez mas exigentes. Se ha comprobado que la exposicion al fenol puede llegar a producir coma, convulsiones, hemolisis, edema cerebral y pulmonar, llegando hasta la muerte por falla respiratoria o shock. La dosis de exposicion maxima establecida es de 5mg/L y la dosis letal es 1,5 mg.\nEn el presente trabajo especial de grado se evaluo la degradacion de fenol empleando un metodo de oxidacion avanzada: Ozono-luz ultravioleta-catalizador en un reactor trifasico. El catalizador utilizado fue TiO2 dopado con Fe al 1% en peso la caracterizacion fue realizada mediante: Difraccion de Rayos X (XRD), Area especifica (B.E.T.) y analisis quimico. Las pruebas de adsorcion realizada para los catalizadores TiO2, Fe/TiO2 y TiO2 Degussa P-25 mostraron que para los dos primeros catalizadores la adsorcion aumenta al aumentar la concentracion de fenol hasta 50 y 30 mg/L respectivamente. Luego de lo cual existe una caida abrupta en la adsorcion por efecto del valor de pH del medio. Para el catalizador TiO2 de la casa Degussa P-25 se observo el aumento de los moles adsorbidos proporcional a la concentracion de fenol lo cual permitio concluir que la presencia de la fase rutilo conjuntamente a la anatasa modifica la adsorcion.\nLa optimizacion de los parametros de reaccion permitio establecer que las condiciones optimas de reactividad son: flujo de ozono: 248,96 mL/min, concentracion de catalizador:	250 mg/L, concentracion de fenol: 30 mg/L. Se observo que el porcentaje de degradacion decae cuando hay presencia de sales en solucion o el pH del medio es diferente al neutro. Bajo las condiciones estudiadas no se puedo establecer una\necuacion cinetica debido principalmente a la alta velocidad de degradacion. Sin embargo, se noto un compromiso entre las diferentes variables estudiadas para alcanzar el mayor porcentaje de degradacion.','2009-10-30','Fotocatalisis Heterogenea, Fenol, TiO2, Degradacion',6,1,1,1,1,'2013-09-17 08:27:32','2013-09-17 08:27:32','Documento_222.pdf','application/pdf',0,'2013-09-17 08:27:32',20,0,0,'INCOMPLETO'),(222,'Sistema de gestin de servicios de reservacin y control de inventario a travs del uso de dispositivos mviles','El presente Trabajo Especial de Grado tiene como objetivo la realizacin de un sistema que permitir la administracin del inventario y el almacn de una empresa que presta servicios de spa, adems de las reservaciones de las citas para sus servicios. Este sistema deber operar tanto para los empleados de la empresa como para los clientes de la misma, con distintos niveles de acceso y de forma remota desde un computador o algn dispositivo mvil con capacidades de conexin. Para ello se debieron recolectar datos sobre la empresa y las distintas herramientas existentes actualmente en el mercado para el desarrollo de sistemas de informacin de manejo de almacenes, desarrollo de sistemas para dispositivos tanto fijos como mviles e inalmbricos. En funcin de lo antes expuesto se elabor una propuesta de Sistema de Gestin de Servicios para la empresa Jumbo Spa, para dar una solucin eficiente a los requerimientos de la empresa.','2009-11-02','Sistema de Informacin, Control de Inventario, Manejo de Reservaciones, Dispositivo mvil, Desarrollo Web, Diseo, Automatizacin, Almacn.',2,1,1,1,1,'2013-09-17 08:27:32','2013-09-17 08:27:32','Documento_223.pdf','application/pdf',881306,'2013-09-17 08:27:32',18,0,110,'COMPLETO'),(223,'Anlisis mineralgico y qumico de minerales pesados de sedimentos de la cuenca del ro Aro, estado Bolvar, Venezuela','Se realiz un estudio mineralgico y qumico de minerales pesados provenientes de sedimentos fluviales de la cuenca del ro Aro, con el propsito de determinar las fases minerales dominantes que contienen concentraciones notables de U, Th, La y Ce y de determinar la distribucin de estos elementos dentro de los granos minerales que los contienen. El anlisis de las muestras se llev a cabo a travs de las tcnicas de microscopia electrnica de barrido con acoplamiento de un espectrmetro de dispersin de rayos X (MEB-EDX) y difraccin de rayos X (DRX). Se determin que la monacita es el mineral que aporta las concentraciones elevadas de Th, Ce y La, y que estos elementos se distribuyen de manera homognea dentro de los granos, lo que hace pensar en un solo proceso uniforme en su formacin. El uranio slo se detect de manera directa en inclusiones de uraninita dentro de granos de circn. Otras inclusiones encontradas son torita en granos de monacita y circn, y torianita en monacita. Las relaciones de las intensidades de las lneas espectralesMb /Ma y Mg/Ma para el torio varan en las muestras en relacin a sus relaciones en dos patrones que no contienen uranio, lo que indica que, probablemente, el uranio est presente en las monacitas en concentraciones relativamente bajas en comparacin al Th y que sus lneas espectrales se hayan solapadas con las del Th.','2009-10-29','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',4,1,1,1,1,'2013-09-17 08:27:33','2013-09-17 08:27:33','Documento_224.pdf','application/pdf',1570286,'2013-09-17 08:27:33',19,0,112,'COMPLETO'),(224,'Evaluacin de tcnicas de anlisis multivariado sobre minerales pesados pertenecientes a sedimentos de drenajes activos de la regin de Imataca, estado Bolvar, Venezuela: Implicacin en la determinacin de proveniencia','La determinacin de proveniencia de sedimentos de drenajes activos se puede realizar a partir del estudio qumico de los minerales pesados, particularmente cuando los afloramientos de la zona de estudio se encuentran bastante meteorizados, tal es el caso del rea del presente estudio. En este sentido, se utilizaron 34 atributos qumicos obtenidos del anlisis (bajo la tcnica de INAA) de minerales pesados provenientes de 94 muestras pertenecientes a drenajes activos de la regin de Imataca, estado Bolvar. Con el fin de estimar la proveniencia de estos sedimentos, se compararon dos tcnicas de anlisis multivariado: anlisis de factores (AF) y anlisis de componentes principales (ACP). Cada una de estas tcnicas fue explorada detalladamente, encontrando las condiciones ptimas para los datos tratados en base a los criterios de seleccin: facilidad de interpretar los resultados geoqumicamente (criterio geoqumico) y el porcentaje de explicacin de la varianza total (criterio estadstico). En el anlisis multivariado slo se emplearon 15 de los 34 atributos qumicos determinados, debido a que el resto de las variables presentaban ms del 25% de las muestras por debajo del lmite de deteccin. Esto se realiz para evitar que ocurrieran posibles distorsiones en los resultados del anlisis multivariado, debido a la incertidumbre de estas variables. Por otro lado, a las variables seleccionadas se les aplicaron transformaciones como Box?Cox y Ln, y posteriormente se estandarizaron, para evaluar como influye el tratamiento previo sobre los resultados obtenidos. Tanto en el caso de la tcnica de AF, como la tcnica de ACP, result ser ms favorable transformar los datos con Ln, donde la herramienta de estandarizacin fue indiferente, emplear un tipo de matriz de correlacin, estimar la covarianza con el mtodo robusto y rotar los factores con Quartimax. Ambas tcnicas arrojaron los mismos resultados desde el punto de vista geoqumico; no obstante, el AF logr explicar mejor la varianza total. A partir de los resultados obtenidos se pudo establecer que las muestras de la parte septentrional de la quebrada El Catire provienen de una fuente mfica, mientras que la mayora de las muestras de la parte Sur de esta quebrada son producto de una mezcla de fuentes flsicas y mficas. Por ltimo, se obtuvo que las muestras de las quebradas Los Brinquitos y Chaparrillal se encuentran aportadas principalmente por una fuente flsica. Estos resultados son coincidentes con los aportados a partir de la distribucin de valores de correlaciones interelementales (Th/Sc, La/Co, La/Sc, Cr/Th) y de grficos de discriminacin Th/Co vs. La/Sc y La-Sc-Th.','2009-09-07','anlisis de factores; anlisis de componentes principales; proveniencia; regin de Imataca, Venezuela.',4,1,1,1,1,'2013-09-17 08:27:35','2013-09-17 08:27:35','Documento_225.pdf','application/pdf',7512802,'2013-09-17 08:27:35',20,0,109,'COMPLETO'),(225,'DESARROLLO DE UNA SOLUCINN DEINTELIGENCIA DE NEGOCIOS PARA UN DEPARTAMENTO DE FINANZAS DENTRO DEL SECTOR PETROQUMMICO','El presente Trabajo Especial de Grado (TEG) consiste en el desarrollo de una solucin de inteligencia de negocios (BI, Business Intelligence por sus siglas en Ingls) para un departamento de finanzas del sector petroqumico, el cual maneja una gran cantidad de informacin y esta es utilizada para realizar los anlisis, reportes e informes necesarios. En la actualidad estas tareas son realizadas de manera manual apoyndose en hojas de clculos, lo que puede traer como consecuencia errores de manipulacin en los datos y una gran prdida de tiempo en todo este proceso. Nuestra solucin de inteligencia de negocio disminuye los tiempos empleados para la extraccin y carga de los datos as como para la generacin de reportes, informes, grfica, entre otros y aseguran la entrega de informacin exacta, til y necesaria para apoyar la toma de decisiones.El objetivo de este TEG es aprovechar las ventajas que nos ofrece una plataforma BI la cual es una arquitectura y coleccin de operaciones integradas y bases de datos que proporcionan a la comunidad empresarial el acceso fcil a los datos; es decir seaprovecha los proceso analtico (OLAP) el cual nos permite un mejor rendimiento para acceder a los datos ultidimensionales proporcionando una base tcnica para los anlisis y clculos requeridos, ayudando a que se tomen decisiones de manera rpida y precisa. Para alcanzar dicho objetivo se utiliz una metodologa de desarrollo de soluciones de inteligencia de negocio llamada \"\"The Business Dimensional Lifecycle\"\"propuesta por Ralph Kimball. Y como plataforma de desarrollo se utiliz una herramienta de cdigo abierto (Open Source) llamada Pentaho BI la cual es una plataforma que ofrece funcionalidades como los son la integracin de datos (ETL), reportes, anlisis, herramientas OLAP, minera de datos, entre otras.','2009-10-30','Inteligencia de Negocio,, Datawarehouse,, Pentaho,, Anlisis,, OLAP,, Integracinn de datos,, Metodologa de Ralph Kimball..',2,1,1,1,1,'2013-09-17 08:27:37','2013-09-17 08:27:37','Documento_226.pdf','application/pdf',342972,'2013-09-17 08:27:37',19,0,40,'COMPLETO'),(226,'\"Estudio de la actividad cataltica de nanopartculas de Mo, Ni y Fe en reacciones de hidrodesulfuracin de molculas tipo dibenzotiofeno presentes en el diesel\"','En este trabajo se sintetizaron nanopartculas de Mo, Ni y Fe soportadas sobre almina, por descomposicin trmica de precursores organometlicos, a 150 C y presin atmosfrica empleando nonano como solvente y dimetil disulfuro como agente sulfurante. Los slidos obtenidos fueron caracterizados mediante las tcnicas de microscopia electrnica de transmisin (MET), espectroscopia fotoelectrnica de rayos X (XPS por sus siglas en ingls), difraccin de rayos X (DRX) y anlisis qumico por absorcin atmica con plasma inductivamente acoplado (ICP por sus siglas en ingls). Se obtuvieron partculas con distribuciones de tamao relativamente estrechas (2-14 nm), con morfologa esfrica y ovalada, siendo la esfrica la poblacin predominante. Las nanopartculas sintetizadas correspondan a xidos y sulfuros de los diferentes metales empleados y adems, no se evidenci formacin de nanopartculas bimetlicas o trimetlicas, ni formacin de aleaciones. La actividad cataltica de las nanopartculas soportadas, fue estudiada empleando la hidrodesulfuracin (HDS) de molculas tipo dibenzotiofeno, en un reactor por carga sin agitacin y sumergido en un bao de arena, a una T= 370 C, a dos presiones de reaccin (500 psig o 1000 psig) durante 1,5 horas como tiempo de reaccin. En general se observaron actividades y conversiones bajas para los catalizadores empleados, aunque mostraron una tendencia a incrementar la actividad con un aumento en la presin de reaccin. As como tambin una tendencia a disminuir con el incremento de la complejidad estructural de la molculas tipo dibenzotiofeno. Las bajas actividades reportadas se deben posiblemente a que las nanopartculas sintetizadas sufrieron cambios importantes durante la reaccin de HDS, evidenciado especficamente con el Mo para todos los catalizadores, para dar lugar a la formacin de especies tpicas de MoS2 en forma laminar (\"slabs\"). La selectividad tambin fue discutida aunque cualitativamente, ya que no se generaron suficientes productos como para ser cuantificados, resultado que fue ms marcado para molculas sustituidas.','2009-10-28','Hidrodesulfuracin, nanopartculas, actividad cataltica, descomposicin trmica',6,1,1,1,1,'2013-09-17 08:27:39','2013-09-17 08:27:39','Documento_227.pdf','application/pdf',36253801,'2013-09-17 08:27:39',20,0,227,'COMPLETO'),(227,'CORRELACINN DELd1188O,, SUSCEPTIBILIDAD MAGNTTICA Y COCIENTE S,, EN EL POZO SALTARNN 11A ((COLOMBIA)),, USANDO REDES NEURONALES DIFUSAS','En el presente trabajo se busca establecer mediante el uso de la tcnica computacional de redes neuronales difusas (RND), la posible relacin entre los valores globales de d18O obtenidos de foraminferas bnticas y los valores de dos parmetros magnticos de cociente S (CS) y susceptibilidad magntica (c) medidos a un nmeros de muestras del pozo Saltarn 1A, ubicado en la Cuenca Sedimentaria de los Llanos Orientales de Colombia. Para llevar a cabo las pruebas computacionales debimos asociar los valores de CS, c y d18O, para esto se realizaron estudios bioestratigrficos entre los estudios que realizamos se encuentra el estudio de foraminferos y palinologa. Sin embargo, a partir de estos estudios no logramos establecer las edades de las muestras por lo que debimos asumir la hiptesis de una tasa de sedimentacin constante entre dos amarres de edades disponibles, los cuales sitan al tope del Mioceno Inferior a 305 metros y al tope del Mioceno Medio a 610 metros de profundidad aproximadamente. El sistema difuso fue construido considerando tres combinaciones de datos de entradas: d18O - CS, d18O - c, d18O - CS - c; esto se realiz con el fin de determinar la influencia de cada parmetro sobre los valores del d18O inferidos. Obtenindose la mejor inferencia mediante la combinacin de valores de entrada d18O - CS - c, con ecuaciones del tipo: d18O = a CS + b c + c. Debido a que asumimos una tasa de sedimentacin constante, decidimos dividir los datos en cuatro secciones de espesores iguales (en profundidad), con la finalidad de estimar cun realista resulta esta consideracin. Encontrndose que la inferencia desmejora a en la ltima seccin, esto puede deberse a que en esta seccin existe una gran densidad de superficies de erosin, indicndonos que gran parte de la continuidad en la secuencia estratigrfica se ha perdido. Resultando as inadecuada la hiptesis de una tasa de sedimentacin constante, la cual podra estar influyendo negativamente en la inferencia.','2009-10-20','{}',3,1,1,1,1,'2013-09-17 08:27:42','2013-09-17 08:27:42','Documento_228.pdf','application/pdf',2448633,'2013-09-17 08:27:42',20,0,162,'COMPLETO'),(228,'Interpretacin Fsica de los Escalares de Estructura','Se estudia la evolucin de fluidos esfricamente simtricos, no disipativos y localmenteanistropos, en el contexto de la Relatividad General, usando los escalares de es-tructura obtenidos a partir de la descomposicin ortogonal del tensor de Riemann.Se analizan dos soluciones de fluidos esfricamente simtricos en evolucin lenta y laaparicin de fracturas en dos modelos de fluidos de densidad de energa inhomognea,cuyo estudio se enfoca en dar una interpretacin fsica de los escalares de estructuraYT e YTF . Los resultados obtenidos ponen en evidencia la relevancia fsica de dichosescalares.','2009-10-02','Escalares de estructura, fluidos relativistas, anisotropos',3,1,1,1,1,'2013-09-17 08:27:45','2013-09-17 08:27:45','Documento_229.pdf','application/pdf',0,'2013-09-17 08:27:45',19,0,0,'INCOMPLETO'),(229,'\"\"ESTUDIO DE LA INFLUENCIA DEL PERSULFATO Y DEL MONOPERSULFATO DE POTASIO EN LA DEGRADACINN DE GELES DE POLIACRILAMIDA\"\"..','Geles de poliacrilamida entrecruzados con una mezcla de fenol - formaldehdo y otros entrecruzados con una mezcla de melamina formaldehdo, fueron sometidos a reacciones de degradacin empleando persulfato de potasio (K2S2O8) y monopersulfato de potasio (2KHSO5 o KHSO4 o K2SO4) como agentes degradantes. Estas degradaciones fueron monitoreadas mediante reometra dinmica, empleando geometra placa - placa, determinando el mdulo de almacenamiento (G) en funcin del tiempo de degradacin, observndose que las curvas de degradacin presentan una tendencia exponencial. Los sistemas de degradacin qumica sometidos a estudio presentan dependencia de distintos factores como lo son: El agente degradante empleado, el pH de dicho agente degradante, la estructura qumica del gel y su morfologa, por lo que todas estas variables fueron objeto de estudio. El pH del agente degradante ejerce cierta influencia sobre los geles de poliacrilamida entrecruzados con fenol - formaldehdo, adicional al hecho de que el persulfato de potasio se descompone trmicamente siguiendo distintos mecanismos dependiendo del pH del medio. Por otro lado, el monopersulfato de potasio resulta ser tan efectivo como el persulfato de potasio en la degradacin de estos geles cuando el pH inicial del agente degradante no es cambiado (pH inicial =2,4). Los estudios de morfologa fueron realizados mediante microscopa electrnica de barrido (MEB), observndose para ambos sistemas de geles, que las formulaciones sellantes son mucho menos porosas que las formulaciones no sellantes, las cuales difieren entre s en el grado de entrecruzamiento. Adicionalmente, se realiz la caracterizacin de los productos de degradacin extrables del medio de reaccin, as como de los reactivos de partida para la sntesis de los geles, mediante espectrometra infrarroja (FTIR), RMN1H y RMN13C.','2009-10-29','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',6,1,1,1,1,'2013-09-17 08:27:46','2013-09-17 08:27:46','Documento_230.pdf','application/pdf',537763,'2013-09-17 08:27:46',19,0,108,'COMPLETO'),(230,'Efecto de las emulsiones asfalticas sobre las propiedades fisico-quimicas y aguas lixiviadas de un suelo de sabana','Se determino el efecto que causan las emulsiones asfalticas sobre las propiedades fsicas, qumicas y bio-qumicas del suelo de sabana de Santa Brbara - Edo. Monagas, y el efecto que causa al combinar este suelo con fertilizantes orgnicos e inorgnicos y cal agrcola. Adems de como estas emulsiones afectan las propiedades de pH, conductividad electrica, turbidez, %aceites y grasas, y metales lixiviadas en las aguas lixiviadas de este suelo.','2009-10-30','suelo, sabana, Edo. Monagas, emulsiones asfalticas',6,1,1,1,1,'2013-09-17 08:27:47','2013-09-17 08:27:47','Documento_231.pdf','application/pdf',0,'2013-09-17 08:27:47',19,0,0,'INCOMPLETO'),(231,'Caracterizacin geoqumica de una seccin de rocas carbonticas con intrusin de un dique de textura pegmattca presente en Guacuripia, Estado Bolvar.','En este trabajo de investigacin se lleva a cabo la caracterizacin geoqumica de cinco especmenes de rocas carbonticas, compuestas principalmente por mrmol dolomtico, haciendo nfasis en la determinacin de la composicin qumica y mineralgica de las muestras de roca recolectadas. El muestreo se realiz en el afloramiento de una seccin de posible edad precmbrica correspondiente a la Formacin Guacuripia, Provincia de Imataca en el estado Bolvar.El tratamiento de las muestras consisti en la preparacin de secciones finas, pulverizacin y disolucin para realizar anlisis petrogrficos, mineralgicos y qumicos de los elementos Ca, Mg, Mn, Al, Fe, Si, Ni, Ti, Cu, Zn, Co, Rb, Sr, Pb y Ba.Los anlisis qumicos y mineralgicos de las muestras de roca, indican que para el caso de la muestra SMGR- I, SMGR- II y SMGR- IV, su composicin qumica es alta en los elementos Ca, Mg, Mn y Fe, siendo sus concentraciones promedio de 165000 ppm, 70000 ppm, 8000 ppm y 7000 ppm respectivamente, y se asocian mineralgicamente a un mrmol dolomtico donde pudieron haber operado procesos tanto de dolomitizacin como dedolomitizacin que de alguna forma se ven influenciados por el metamorfismo, en el caso de la muestra SMGR- III la composicin mineralgica es de tipo grantica y est asociada a una intrusin tipo dique pegmattico, y para el caso de la SMGR- V corresponde a la capa superior cuya composicin es de tipo silicatado y se diferencia de la muestra SMGR- III en textura, la cual es ms fina en este espcimen y tambin por la presencia de fases minerales distintas, ambas muestras presentan altas concentraciones de los elementos Si y Al principalmente, su presencia dentro del afloramiento obedece a la interaccin de fluidos con la roca que se consolidaron rellenando cavidades y fracturas.Los resultados derivados de la investigacin indican un posible origen sedimentario para estas rocas que han sido sometidas a procesos asociados como dolomitizacin y dedolomitizacin, as como un proceso de metamorfismo regional donde localmente se presenta un ensamblaje mineralgico de dolomita, calcita, dipsido y cuarzo que permite ubicar la seccin en un grado bajo.','2009-09-14','Mrmol dolomtico, carbontica, Guacuripia, Provincia de Imataca.',4,1,1,1,1,'2013-09-17 08:27:48','2013-09-17 08:27:48','Documento_232.pdf','application/pdf',1236570,'2013-09-17 08:27:48',19,0,102,'COMPLETO'),(232,'EVALUACIN DE LA HOMOGENEIDAD QUMICA DE ALGUNOS ELEMENTOS MAYORITARIOS, MINORITARIOS Y TRAZA, EN LA MUESTRA COMPUESTA DE ARCILLITAS DE FALCN MCAF, PROPUESTA COMO MATERIAL DE REFERENCIA','En el presente estudio se evalu la homogeneidad qumica de los elementos Al, Na, Mg, Mn, P, Co, Cr, Cu, V, Zn, U, Th y Zr en la Muestra Compuesta de Arcillitas de Falcn (MCAF) mediante las pruebas estadsticas ANOVA de un factor y \"homogeneidad suficiente\", esta ltima descrita por Fearn y Thompson (2001)(1); ambas para un P == 00,,0055. stas pruebas se aplicaron a los datos de concentracin de los elementos en estudio, los cuales fueron obtenidos empleando las tcnicas analticas de espectrometra de emisin ptica acoplado inductivamente a plasma (EEO-AIP) y emisin atmica a llama (EEA) para el caso del Na. Los resultados obtenidos indicaron que los elementos propuestos presentan homogeneidad qumica en la muestra a excepcin del Co y Zn, los cuales tienen asociados los valores ms altos de incertidumbre y de los cuales se obtuvo poca reproducibilidad en las medidas, siendo por lo tanto considerados como datos no recomendados. Las fases minerales presentes en la muestra se determinaron mediante la tcnica de difraccin de rayos X (DRX), obtenindose a travs de este anlisis los minerales cuarzo, anatasa, yeso y las arcillas caolinita, illita y montmorillonita.','2009-10-16','material de referencia, arcillita, homogeneidad qumica, muestra compuesta, falcn',4,1,1,1,1,'2013-09-17 08:27:49','2013-09-17 08:27:49','Documento_233.pdf','application/pdf',1556556,'2013-09-17 08:27:49',19,0,128,'COMPLETO'),(233,'ESTUDIOS DE LA HIDRLISIS Y LA FORMACIN DE COMPLEJOS DE NQUEL (II) CON LOS CIDOS OXLICO Y MALNICO EN SOLUCIN ACUOSA (NaCl 1,0 M, 25C)','La investigacin llevada en este Trabajo Especial de Grado vers, sobre el estudio de la formacin de los complejos formados entre el nquel divalente y los ligandos cido oxlico y cido malnico, adems el estudio de la hidrlisis del Ni(II) en NaCl 1,0 M a 25 C, no reportada en la bibliografa. En el presente trabajo se estudiaron los sistemas: H+ - Ni(II) H+ - cido oxlico H+ - cido malnico H+ - Ni(II) - cido oxlico H+ - Ni(II) - cido malnico por medio de medidas de fuerza electromotriz emf(H) a 25C y en NaCl 1,0 M como medio inico inerte. El anlisis de los datos experimentales de cada sistema se realiz mediante el programa de mnimos cuadrados LETAGROP y LETAGROP/FONDO, obtenindose la constante de estabilidad bpqr del complejo Ni (OH)2, adems los valores de pKa para los ligandos y sus constantes de estabilidad bPqr . Tambin se obtuvieron las constantes de estabilidad bpqrde los complejos (p, q, r), de los sistemas H+ - Ni(II) - cido oxlico y H+ - Ni(II) - cido malnico Las siguientes tablas muestran los resultados obtenidos. Tabla.. a.. Constante de formacin, log bpqr, para el sistema H+ - Ni(II), obtenida en NaCl 1,0 M a 25C. Reaccin Log bpq0 Ni2+ + 2H2O < =>Ni(OH)2 + 2H+ -17,02(2) Dispersin (s(ZB)) 0,067 Tabla b.. Complejos obtenidos con sus constantes de formacin, log bpqr para los sistemas: H+ - Ni (II), H+ - cido oxlico y H+ - cido malnico, H+ - Ni(II) - cido oxlico y H+ - Ni(II) - cido malnico, en NaCl 1,0 M a 25C. Ni(II) - cido oxlico Ni(II) - cido malnico Reacciones Log b ZB Log b ZBfondo Log b ZB Log b ZBfondo Ni2+ + H2C <=> [NiHC]+ + H+ 3,41(2) 3,41(2) 3,64(5) 3,64(5) Ni2+ + H2C <=> [NiC] + 2H+ 0,96(2) 0,96(3) 1,19(3) 1,19(3) Ni2+ + H2C <=> [NiCOH]- + 3H+ -8,49(6) -8,48(6) -3,12(4) -3,12(4) Ni2+ + 2H2C <=> [NiC2]2- + 4H+ -0,78(1) -0,77(3) - - Ni2+ + H2C <=> [Ni(OH)2C]2- + 4H+ - - -12,0(1) -12,0(1) Dispersin s(ZB) / s(ZBfondo) 0,033 0,035 0,075 0,075 Reacciones Log b pKa Log b pKa H2C <=> HC- + H+ 3,543(5) 1,098 4,968(3) 2,576 H2C <=> C2- + 2H+ 4,641(5) 4,641 7,544(5) 7,544 Dispersin s(ZC) 0,007 - 0,006 -','2009-10-30','Hidrlisis Nquel (II), cido oxlico, cido malnico, complejos, NaCl (1,0 M)',6,1,1,1,1,'2013-09-17 08:27:50','2013-09-17 08:27:50','Documento_234.pdf','application/pdf',2216674,'2013-09-17 08:27:50',18,0,73,'COMPLETO'),(234,'SINTESIS DE 1-BENZOIL-1,2-DIHIDROQUINOLINAS SUSTITUIDAS COMO POSIBLES INHIBIDORES DE LA POLIMERIZACION DE TUBULINA.','EL CANCER ES CONSIDERADO COMO UNA ENFERMEDAD DEL CICLO CELULAR, UN PROCESO QUE CONSTA DE CUATRO FASES. LOS QUIMIOTERAPEUTICOS ACTUAN SOBRE LAS DIVERSAS FASES DEL CICLO CELULAR, UNO DE SUS MODOS DE ACCION ES LA INHIBICION DE LA MITOSIS CELULAR POR DESPOLIMERIZACION DE LOS MICROTUBULOS, EVITANDO ASI LA FORMACION DEL HUSO MITOTICO, LA FORMACION CROMOSOMICA Y CITOCINESIS. BASANDONOS EN ESA INFORMACION, SE DISEO LA SINTESIS DE UN GRUPO DE 1-BENZOIL-1,2- DIHIDROQUINOLINAS SUSTITUIDAS CON CARACTERISTICAS ESTRUCTURALES SEMEJANTES A LAS COMBRETASTATINAS Y ANALOGOS, ENTRE LAS QUE DESTACAN UN ANILLO TRIMETOXIBENCENICO Y UN ANILLO AROMATICO CON DOS SUSTITUYENTES OXIGENADOS ADYACENTES.','2009-06-30','1,2-DIHIDROQUINOLINAS, TUBULINA, MICROTUBULOS, CANCER.',6,1,1,1,1,'2013-09-17 08:27:51','2013-09-17 08:27:51','Documento_235.pdf','application/pdf',2654560,'2013-09-17 08:27:51',18,0,144,'COMPLETO'),(235,'INFLUENCIA DE SILANOLES, EN SOLUCIN, EN LA POLIMERIZACIN DE OLEFINAS EMPLEANDO CATALIZADORES METALOCNICOS ACTIVADOS CON MAO','En el presente trabajo se dan a conocer los resultados obtenidos al aadir TMS en la polimerizacin del 1-undeceno, reacciones en las cuales, se emplearon dos tipos de catalizadores metalocnicos obtenidos comercialmente, dos comple sintetizados y como especie activante el MMAO. Los catalizadores comerciales empleados fueron el Cp2TiCl2 y Cp*2TiCl2, observndose un ligero aumento en la cantidad (gramos) del producto obtenido en una relacin molar Si/Ti= 1 y Si/Ti= 2 respectivamente, las mezclas Catalizador/TMS/MMAO (Mtodo A) y MMAO/TMS/Catalizador(Mtodo B) arrojaron valores similares. Los complejos sintetizados fueron el Ti(OSi(CH3)3)4 y Cp*2Ti (OSi(CH3)3)2 obtenindose una disminucin en la cantidad del producto en comparacin con el valor de referencia. El complejo Cp*2Ti(OSi (CH3)3)2fue sintetizado al hacer reaccionar el Cp*2TiCl2 con la sal TMSNa en una relacin 1:2 (Ti: Si) empleando diclorometano como solvente, la reaccin fue realizada a temperatura ambiente (24C), bajo agitacin constante durante un tiempo de 24 horas obtenindose un rendimiento porcentual del 62%. La especie Cp2Ti(OSi(CH3)3)Cl no se logr sintetizar, debido a que la especie obtenida fue el Ti(OSi(CH3)3)4al hacer reaccionar el catalizador Cp2TiCl2 con la sal TMSNa en una relacin 1:1 (Ti: Si) bajo agitacin constante por un tiempo de 4 horas y a temperatura ambiente (24C), el rendimiento porcentual fue del 60%. Estos productos fueron caracterizados por espectroscopa IRFT y RMN 1H. La solucin de los catalizadores comerciales fueron puesta en contacto con el TMS (diferentes relaciones Si/Ti) por 10 min, consecutivamente fue adicionado el MMAO, (Mtodo A) , el TMS fue agregado al cocatalizador y culminado un tiempo de 10 min fue adicionado el catalizador (Mtodo B); en el caso de los complejos sintetizados fueron agregados en solucin y activados con MMAO. Las mezclas de reaccin fueron envejecidas por 10 min y posteriormente fue adicionado el 1-undeceno, las reacciones fueron realizadas bajo atmsfera inerte a una temperatura de 80C por un tiempo de 24 horas, empleando tolueno como solvente. Transcurrido las 24 horas las reacciones fueron detenidas aadiendo HCl al 5%, la fase orgnica fue extrada y secada con sulfato de sodio anhidro, los productos eran lquidos solubles en tolueno, por lo que fueron obtenidos al evaporar el solvente a presin reducida y caracterizados mediante las tcnicas de IRFT y RMN1H. La sntesis del TMS fue realizada bajo el mtodo de hidrlisis en dos fases, utilizando como compuesto de partida el CTMS. La fase acuosa estuvo constituida por agua saturada con NaCl y (NH4)2CO3 como aceptor cido y la fase orgnica por dietilter. La reaccin fue llevada a cabo bajo agitacin constante y a una temperatura por debajo de los 0C (en bao de hielo) por un tiempo de 30 minutos. Finalizado el tiempo de reaccin, la fase orgnica fue lavada con dietilter y secada con sulfato de sodio anhidro, finalmente el producto fue obtenido por destilacin fraccionada y caracterizado mediante la tcnica IRTF. La sntesis de TMSNa fue llevada a cabo al hacer reaccionar HMDS y NaOH en tolueno como solvente, la mezcla de reaccin fue agitada vigorosamente en reflujo durante 72 horas. El producto fue obtenido al evaporar el tolueno a presin reducida, lavado varias veces con CH2Cl2y caracterizado mediante las tcnicas de IRTF y RMN1H. La influencia del TMS en las reacciones de polimerizacin del 1-undeceno empleando los sistemas catalticos metaloceno/ MMAO no se logr determinar debido a que el monmero empleado no era el adecuado para los sistemas catalticos descritos, no se obtuvo un polmero como producto, posiblemente ocurri la metilacin del monmero, para dar lugar al dodecano. El catalizador y el TMS parecen no intervenir en la reaccin, la posible metilacin sera realizada por el MMAO.','2009-10-27','SILANOL, METALOCENOS, MAO, POLIMERIZACIN DE OLEFINAS.',6,1,1,1,1,'2013-09-17 08:27:56','2013-09-17 08:27:56','Documento_236.pdf','application/pdf',2493772,'2013-09-17 08:27:56',20,0,133,'COMPLETO'),(236,'Implementacin de un dispositivo integrado de seguridad UTM y evaluacin de la factibilidad de su configuracin a travs de la metodologa de intrusin LPT','El presente Trabajo Especial de Grado consiste en evaluar la factibilidad de la configuracin de un UTM (Unified Threat Management) Firebox 750e Watchguard, el cual permite la administracin de la red y proporciona seguridad a la misma, a travs de la metodologa de intrusin LPT (Licensed Penetration Tester). El fuerte de los dispositivos UTM es la integracin de los diferentes servicios de seguridad en un solo dispositivo, mediante el cual se provee de manera centralizada la seguridad y administracin de la red, facilitando la labor del administrador de red y del analista de seguridad. Es importante acotar que la instalacin y configuracin descritas en el T.E.G. son genricas para cualquier dispositivo UTM de la marca Watchguard. El trabajo se inicia con un estudio terico de los aspectos ms relevantes que se deben tomar en consideracin en lo que a seguridad informtica se refiere y un anlisis de las tcnicas ms comunes utilizadas por los hackers. Para la instalacin del dispositivo se utilizan las recomendaciones del fabricante y para su configuracin se toma en cuenta la poltica de uso de internet de la institucin y sus requerimientos en cuanto al servicio. Se aplica la metodologa LPT al dispositivo para verificar la factibilidad de la configuracin del UTM. Los dispositivos UTM brindan proteccin de Firewall convencional, proteccin AAntispam - Antiphishing - Filtro de contenidos - Antivirus y Deteccin/Prevencin de Intrusos IDS (Intrusion Detection System) / IPS (Intrusion Prevention System)). Estos dispositivos tambin permiten la creacin de redes VPN (Virtual Private Network), utilizar protocolos de ruteo, traducciones de direcciones y registro delogs, entre otros. La metodologa para pruebas de intrusin LPT es propia de la casa de consultores de seguridad EC Council, la cual define una serie de pasos para probar la seguridad de diferentes equipos, aplicaciones y entornos de trabajo.','2009-10-29','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',2,1,1,1,1,'2013-09-17 08:27:58','2013-09-17 08:27:58','Documento_237.pdf','application/pdf',1838166,'2013-09-17 08:27:58',20,0,83,'COMPLETO'),(237,'\"Fotoelectro-oxidacin de fenoles\"','Estudiar la fotooxidacin de el p-metoxifenol y el p-nitrofenol, mediante la reaccin de transferencia de oxigeno relacionado con los fenomenos que ocurren en la superficie del electrodo, utilizando tecnicas hidrodinamica de disco- anillo, asi como estudiar las propiedades del semiconductor TiO2.','2009-10-28','fotooxidacin oxidacin p-metoxifenol y p-nitrofenolsemiconductor tipo-n',6,1,1,1,1,'2013-09-17 08:27:59','2013-09-17 08:27:59','Documento_238.pdf','application/pdf',4375107,'2013-09-17 08:27:59',20,0,109,'COMPLETO'),(238,'RESPUESTA DEL FITOPLANCTO AL ENRIQUECIMIENTO CON NITRGENO Y FSFORO EN COSMO EN EL GOLFETE DE CUARE, ESTADO FALCN','Los cambios en las concentraciones de N y P en los cuerpos de agua pueden afectar la estructura de su comunidad fitoplanctnica. Estas concentraciones pueden variar por procesos naturales y con mayor frecuencia se incrementan por actividades antropognicas. Este incremento en la concentracin de dichos elementos provoca el deterioro de la calidad del agua en las costas marinas, estuarinas, lagunas costeras, etc., originndose un proceso de eutrofizacin. Este trabajo intenta evaluar la respuesta del fitoplancton de una localidad en la boca del Golfete de Cuare, Estado Falcn, a la adicin de estos nutrientes (N y P); el tiempo de respuesta del fitoplancton al aumento de N y P; determinar los cambios temporales al enriquecimiento con nutrientes en dos pocas del ao (sequa y lluvia). Se utiliz la modalidad de microcosmos. Se llenaron treinta (30) microcosmos de 10 L \"in situ\" con agua de la zona subsuperficial de la estacin de muestreo, de los cuales quince (15) fueron enriquecidos una sola vez al inicio, triplicando las concentraciones iniciales de N y P reportadas para ese ambiente, utilizando soluciones de NH4Cl y KH2PO4, hasta una concentracin final de 304 g/L de P y de 2.181,5 g/L de N, para una relacin de 16:1. Los quince (15) microcosmos restantes se dejaron como controles. Las muestras de ambiente, microcosmos control y tratamiento se tomaron por triplicado durante cinco das de muestreo en cada poca (sequa y lluvia). Las muestras se envasaron en botellas de polietileno de 1 L que se preservaron inmediatamente con lugol. En el laboratorio se sedimentaron submuestras de 10 mL en cmaras Utermhl y se examinaron en el microscopio invertido para clasificar mediante claves taxonmicas el fitoplancton presente hasta el nivel de especie. Los valores de las variables ambientales medidas no presentaron grandes cambios en las dos pocas (sequa y lluvia), por lo que se confirma el Golfete de Cuare como un ambiente estuarino estable. En el microcosmos enriquecido (N1P1) aument la abundancia, la diversidad tuvo una variacin significativa para ambas pocas, y la riqueza aument para la poca de lluvia. El grupo de las Bacillariophyta present el mayor nmero de especies y la mayor abundancia en todas las muestras, para ambas pocas. En la poca de sequa quedaron en orden descendente de riqueza, las Pyrrophyta y las Cyanophyta; e invirtiendo el orden para la poca de lluvia. Las Euglenophyta, Chromophyta y Chlorophyta, en orden decreciente, presentaron las menores riquezas y abundancias para la poca de lluvia.','2009-07-15','FITOPLANCTON, ENRIQUECIMIENTO, FSFORO, NITRGENO, COSMOS, ESTUARIO',1,1,1,1,1,'2013-09-17 08:28:04','2013-09-17 08:28:04','Documento_239.pdf','application/pdf',34369844,'2013-09-17 08:28:04',16,0,131,'COMPLETO'),(239,'Estructura fsica y biolggica del componente arbrreo de lacomunidad de plantas de un bosque hmmedo premontano,, de laReserva Ecolggica Guquira,, en el Macizo de Nirgua,,Edo.. Yaracuy,, Venezuela..','Los sistemas forestales ms perjudicados con la actividad antrpicacorresponden a bosques que se localizan a bajas altitudes. Por consiguiente se realizuna caracterzacin empleando criterios fisionmicos y florsticos de los estratosarbreos del Bosque hmedo, localizado aproximadamente a 155 m s.n.m.El muestreo fu estratificado y sistemtico En un rea de 1/2 ha, seestablecieron 5 parcelas de 20x 50 m, y se subdividieron en 10 subparcelas de 100 m2cada una, considerando a los individuos leosos con un dimetro a la altura del pechomayor o igual a 5 cm. Se describi la forma de la copa, la altura de los individuos y lascaractersticas ms resaltantes de tallos y hojas, se codificaron los individuos y lasespecies fueron identificadas posteriormente.Se registraron un total de 23 familias conocidas y aproximadamente 61 especiesdiferentes. La forma de vda predominante son mesofanerofitas con hojas simples ypecioladas, mesfilas, con igual proporcin de pices agudos y acuminados. Sedefinieron tres estratos arbreos considerando la abundancia de individuos tanto porclases diamtricas como por clases de altura. El primero de los estratos (estrato medio)registr la mayor abundancia absoluta, tanto de especies como de individuos, losindividuos presentaron alturas menores a los 13 m y dap entre 5 y 15 cm, dominado porGustavia augusta L, el segundo de los estratos , est formado por individuos cuyasalturas estn comprendidas entre 13 y 20 m y dap entre 15-30 cm dominado porPouteria trilocularis y el tercer estrato, est formado principalmente por individuos dealturas mayores a 20 m y de dap mayores a 30 cm dominado por PseudopiptadeniaPittieri (Harms). a lo largo de esta estratificacin vertical de la vegetacin la diversidaddisminuye y la equidad aumenta en funcin de las alturas de los estratos.','2009-09-04','Bosque hmedo tropical, Reserva Ecolgica Guquira, dimetroa la altura del pecho (dap), criterios fisionmicos, florstica.',1,1,1,1,1,'2013-09-17 08:28:11','2013-09-17 08:28:11','Documento_240.pdf','application/pdf',1236946,'2013-09-17 08:28:11',17,0,87,'COMPLETO'),(240,'Implementacin y Mejoramiento de Tcnicas Serolgicas para la Optimizacin del Diagnstico de Arbovirus en la Seccin de Inmunoserologa Viral del Instituto Nacional de Higiene Rafael Rangel \"INHRR\"','RESUMENImplementacinn y Mejoramiento de Tcnicas Serolggicas para la Optimizacinn del Diagnostico de Arbovirus en la Seccinn de Inmunoserologa viral del instituto Nacional de Higiene Rafael Rangel..Las tcnicas serolgicas constituyen una herramienta imprescindible en el diagnstico virolgico y se les confiere esta importancia por lo difcil que resulta en la mayora de los casos lograr el diagnostico por aislamiento viral (Vzquez y col, 1968). La Tcnica de Neutralizacin por Reduccin en Placas (PRNT), ha sido usada por ms de 30 aos, para medir anticuerpos neutralizantes contra flavivirus, los cuales son virus que se encuentran clasificados dentro de la familia Flaviviridae, a la cual pertenece el virus de la fiebre amarilla y del dengue. Estos virus son transmitidos a travs de mosquitos (Putnak y col, 2008). A fin de Implementar la PRNT en el Laboratorio de Inmunoserologa Viral del Instituto Nacional de Higiene Rafael Rangel (INHRR), fueron comparados los parmetros, sensibilidad y especificidad, de la PRNT, cuya tcnica es novedosa en esta institucin, con los de la tcnica patrn, Inhibicin de la Hemaglutinacin (I.H), que se usa de rutina en esta Seccin del INHRR. Se analizaron 48 muestras de sueros de pacientes, separadas por grupos: 13 pares de muestras de sueros (constituidas por una muestra aguda y una convaleciente), 20 muestras de sueros nicos, en fase aguda y 15 muestras de sueros nicos, en fase convaleciente. Para el desarrollo del mtodo de la PRNT, se amplific semilla viral de la cepa vacunal del virus de la fiebre amarilla y de una cepa local de los serotipos 1 y 2 del dengue, en las lneas celulares Vero E6 y C6/36 HT, respectivamente. Se titularon las semillas virales, la de fiebre amarilla en Vero E6 y las del dengue en Vero NK, empleando el mtodo semilquido de plaqueo tradicional, con carboximetilcelulosa (CMC). Por su parte, para el desarrollo del mtodo de la I.H, se produjeron antgenos virales de los serotipos 1 y 2 del dengue, a partir de las mismas cepas locales amplificadas en C636/HT, en cerebro de ratn lactante y se extrajeron empleando el mtodo de la acetona-sacarosa de Clarke y Casals,ix1958. Se encontr, segn los anlisis de residuales estandarizados para una tabla de contingencia de dos vas, con los cuatro grupos de muestras de sueros analizadas, que la PRNT tendi a ser igualmente sensible, pero mucho ms especfica que la I.H. En cuanto a los resultados serolgicos, todas las muestras, en cada uno de los grupos, tuvieron ttulos elevados de anticuerpos hacia los dos serotipos del virus dengue por PRNT, similar al que present el control positivo hacia Den-1. Por I.H todas las muestras resultaron tener anticuerpos hacia los dos serotipos del dengue, tan o ms elevados como el control positivo. Encontrndose una relacin entre los niveles elevados de anticuerpos detectados por l.H y la sensibilidad que presenta esta tcnica para detectar anticuerpos contra cualquier flavivirus. Lo que se corresponde con los resultados de sensibilidad para esta tcnica, obtenidos previamente por Anlisis de Residuales Estandarizados. La tcnica PRNT, fue capaz de discernir entre infeccin por dengue de infeccin por fiebre amarilla, con cada grupo de muestras de suero, por lo que es posible que el diagnostico de estos arbovirus, sea optimizado prximamente, en el Laboratorio de Inmunoserologa Viral del INHRR.','2009-07-06','{}',1,1,1,1,1,'2013-09-17 08:28:14','2013-09-17 08:28:14','Documento_241.pdf','application/pdf',4383181,'2013-09-17 08:28:14',18,0,138,'COMPLETO'),(241,'Determinacin de los polimorfismos: + 647 G>C en el gen del Receptor de Glucocorticoide y -159 C>T en el gen de CD14, en pacientes con Asma y Enfermedad Obstructiva Crnica (EPOC)','El Asma y la Enfermedad Pulmonar Obstructiva Crnica (EPOC) son enfermedades respiratorias que se originan por un proceso inflamatorio crnico; ambas patologas se caracterizan por ser complejas, y resultan de la interaccin de mltiples agentes ambientales con diversos genes. Se conoce que un nmero importante de pacientes es resistente a los efectos de glucocorticoides y se desconoce las razones; por ello, la importancia de analizar los polimorfismos del gen del receptor de Glucocorticoide y las pruebas funcionales para ensayarlo. Diversos investigadores han indicado que algunos polimorfismos de tipo SNP (polimorfismos de nucletido simple), han sido asociados con el desarrollo de Asma y EPOC, uno de ellos en el gen del Receptor de Glucocorticoide (GR), el cual esta definido a +647 pb en el intrn 2 y consiste en la transversin de una Guanina (G) por una Citosina (C). Por otro lado, el CD14 es una glicoprotena expresada en la membrana de mastocitos, macrfagos, que acta como receptor de componentes bacterianos como Lipopolisacridos (LPS).Uno de los polimorfismos en la regin promotora del gen de CD14, est definido a -159 pb del sitio de inicio de la transcripcin, y consiste en la transicin de una Citosina (C) por una Timina (T). El objetivo de nuestra investigacin fu: estudiar la posible asociacin entre la presencia de las variantes allicas de estos dos polimorfismos, con el desarrollo y severidad de Asma y EPOC, en comparacin con sujetos controles (sin enfermedades respiratorias). Para ello, se realiz la amplificacin de los segmentos de inters en cada polimorfismo por PCR y luego el corte con enzimas de restriccin especficas. Al mismo tiempo se analiz en dichos pacientes, tanto la funcin del receptor LPS-CD14-TLR-4 en ensayos biolgicos in vitro deactivacin celular, como la funcin del Receptor de Glucocorticoide, mediante la produccin o inhibicin inducida por LPS, de TNF-a y radicales O2-. Se observ que la presencia de los genotipos del polimorfismo en el gen del GR, difieren significativamente de lo reportado para la poblacin caucasoide control (p < 0,01), y de lo reportado para Asma y EPOC en dicha raza. Por su parte, entre las variantes allicas del polimorfismo de CD14, no se obtuvieron diferencias significativas. En las pruebas funcionales, no se hall asociacin directa entre los genotipos de los polimorfismos estudiados, y la respuesta celular a dexametasona y sus anlogos (ginsenoides). Se concluye que la resistencia farmacolgica a los esteroides depende de varios mecanismos de respuesta celular que, en principio, no estn directamente asociados con las variantes genotpicas de los dos polimorfismos SNP estudiados.','2009-10-21','Asma, EPOC, gen del Receptor de Glucocorticoide, gen de CD14',1,1,1,1,1,'2013-09-17 08:28:15','2013-09-17 08:28:15','Documento_242.pdf','application/pdf',1904667,'2013-09-17 08:28:15',17,0,93,'COMPLETO'),(242,'CARACTERIZACINN MOLECULAR DEPhytophthorasp.ASOCIADAS AL CACAO(Theobroma cacao L) EN VENEZUELA..','RESUMEN..El cacao, Theobroma cacao L., es un cultivo tradicional en Venezuela. Nuestro pas, a pesar de poseer genotipos de excelente calidad, presenta bajos rendimientos por hectrea, siendo uno de los factores limitantes ms importantes, la incidencia de enfermedades. Algunas especies del gnero Phytophthora causan en cacao la enfermedad llamada \"pudricin parda de la mazorca\" que provoca prdidas econmicas en todo el territorio nacional. En sentido general, existe un desconocimiento de las especies asociadas a la esta y de su variabilidad gentica. El objetivo de este trabajo fue la identificacin mediante tcnicas moleculares de aislados asociados a sntomas de la enfermedad de diferentes regiones productoras de cacao del pas y la caracterizacin de los mismos con marcadores AFLP e ISSR con el objetivo de observar su variabilidad gentica.Fueron identificados 25 aislados pertenecientes a la especie Phytophthora palmivora, presentes en los estados Aragua, Miranda, Carabobo y Zulia mediante la amplificacin por PCR y posterior secuenciacin de las regiones de los espaciadores internos transcritos del ADN ribosomal y su comparacin con base de datos pblicas. El anlisis con los marcadores AFLP e ISSR mostr muy baja variabilidad entre todos los aislados estudiados.','2009-10-26','{}',1,1,1,1,1,'2013-09-17 08:28:17','2013-09-17 08:28:17','Documento_243.pdf','application/pdf',4384313,'2013-09-17 08:28:17',20,0,95,'COMPLETO'),(243,'Aspectos de mecnica cuntica relativista en dimensiones bajas','En este trabajo se consideran ciertos aspectos de la mecnica cuntica relativista en (1+1) y (1+2) dimensiones. Nuestros objetivos principales han sido el estudio de las consecuencias de la invariancia de Poincar en estas dimensiones bajas y la construccin de teoras cunticas de campos que satisfacen los axiomas de Wightman. En particular, verificamos que SL(2,R), contrariamente a su uso, no es simplemente conexo y por lo tanto no es el grupo de recubrimiento universal del grupo de Lorentz en (1+2). A dems, construimos explcitamente teoras cunticas de campos libres: (i) Campo escalar neutro y masivo, (ii) Campo escalar cargado y masivo, (iii) Campo de Dirac cargado y masivo, que satisfacen los axiomas de Wightman en (1+1). Uno de los resultados de esta construccin es que no se satisface el teorema de espn-estadstica en (1+1). Este ltimo resultado es consistente con la conocida bosonizacin en (1+1).','2009-07-10','cuntica, campos, axiomtica, Wightman, grupo de Poincare, bajas dimensiones',3,1,1,1,1,'2013-09-17 08:28:21','2013-09-17 08:28:21','Documento_244.pdf','application/pdf',2586815,'2013-09-17 08:28:21',20,0,103,'COMPLETO'),(244,'Mecnica cuntica en el espacio de Lobachevski','En este trabajo se estudian las consecuencias para la mecnica cuntica de suponer que el espacio de configuracin no es eucldeo, sino hiperblico. Nuestro objetivo principal en este trabajo ha sido la obtencin de los observables bsicos que describen la mecnica cuntica de una partcula en espacio hiperblico. El procedimiento de cuantizacin, para obtener estos observables bsicos, se realiza de manera geomtrica (esto es, independiente de las coordenadas). En este caso, como el eucldeo, los observables se obtienen de propiedades fundamentales de la geometra hiperblica (los vectores de Killing asociados a la mtrica). El modelo de espacio hiperblico usado es el del hiperboloide en espacio de Minkowski. Se considera, por completitud y para verificar resultados previos, el tomo de hidrgeno y el oscilador armnico en esta geometra.','2009-06-26','cuntica, lobachevski, hiperblico, geometra, espacio curvo, killing',3,1,1,1,1,'2013-09-17 08:28:22','2013-09-17 08:28:22','Documento_245.pdf','application/pdf',1879881,'2013-09-17 08:28:22',20,0,97,'COMPLETO'),(245,'DETECCINN DE INFECCIONES SENCILLAS Y MIXTAS POR Trypanosoma rangeli Y Trypanosoma cruzi EN MUESTRAS PROVENIENTES DE VECTORES DE DIFERENTES REGIONES DE VENEZUELA PRESERVADAS EN PAPEL FTA','Los parsitos Trypanosoma rangeli y Trypanosoma cruzi, son protozoarios de los subgnero Herpetosoma y Schyzotrypanum respectivamente, familia Trypanosomatidae, orden Kinetoplastida, que han sido descrito en gran parte del continente Americano, superponiendo en muchos casos su distribucin geogrfica; T.. cruzi, el agente etiolgico de la enfermedad de Chagas, comparte con T.. rangeli hospedadores vertebrados e invertebrados. Los hospedadores invertebrados de estos parsitos son hemipteros hematfagos (triatominos), y son capaces de transmitir T.. rangeli al vertebrado durante la picadura y T.. cruzi por contacto con las heces. Las semejanzas morfolgicas y antignicas entre estos parsitos dificultan los procesos de deteccin, por lo cual se han desarrollado herramientas que permitan una mejor identificacin de estas especies, as como el estudio detallado de las variaciones intra-especifica. T.. rangeliha sido considerado un complejo biolgico con un grado significativo de polimorfismo gentico, que permite separarlo en sub-grupos (grupos A, B, C y D) de amplia distribucin en hospederos vertebrados e invertebrados. Por su parte, en T.. cruzi se han descrito dos sub-grupos principales (linajes I y II). Estas muestras de diversidad gentica hacen de estas especies un objeto interesante de estudio. De aqu la importancia del anlisis del mayor numero de aislados posibles, provenientes de diferentes regiones que permitan establecer las relaciones existentes entre estas sub-poblaciones a nivel biolgico y taxonmico.Con la finalidad de evaluar la distribucin geogrfica de estas especies y las sub-poblaciones que se encuentran circulando en vectores triatominos, utilizando ensayos de PCR especie-especficos para T.. rangeli y T.. cruzi, nos proponemos evaluar la presencia de infecciones sencillas y mixtas en muestras de triatominos de captura y xenodiagnosticos de mamferos domsticos provenientes de diferentes regiones de Venezuela, recolectadas en papel FTA. En este trabajo se estandarizaron las condiciones de preservacin y tratamiento de las muestras preservadas en papel FTA para su utilizacin en anlisis con PCR; la evaluacin del nivel de sensibilidad de la tcnica mostr una deteccin de hasta 5 parsitos (0,5parasitos/L) colocados en un disco de papel FTA de 0,5cm. de dimetro. Con esta metodologa se analizaron 84 muestras de triatominos de captura provenientes de 76 triatominos capturados en zonas urbanas y rurales de los estados Sucre, Miranda, Vargas, Aragua y Distrito Capital, de los cuales un 84% pertenece al gnero Panstrongylus que en su mayora fueron capturados en zonas urbanas. El 76% de triatominos evaluados resultaron positivos a infecciones por T.. cruzi, con prevalencia del linaje TCI (encontrado en el 55% de las muestras infectadas); no se detectaron triatominos infectados por T.. rangeli. 71 de las muestras de triatominos capturados fueron analizadas al microscopio de luz, observando tripanosomas en el 21%, mientras que con los anlisis por PCR el 76% de estas mismas muestras fueron positivas a T.. cruzi. En las muestras provenientes de xenodiagnstico se detect la presencia de infeccin por T.. cruzi en 45 muestras (63%), sugiriendo la contaminacin de estas durante el proceso de toma.','2009-10-19','Trypanosoma cruzi, Trypanosoma rangeli, enfermedad de Chagas, identificacin molecular, triatominos, papel FTA.',1,1,1,1,1,'2013-09-17 08:28:24','2013-09-17 08:28:24','Documento_246.pdf','application/pdf',2957965,'2013-09-17 08:28:24',19,0,126,'COMPLETO'),(246,'Adecuacin a ambientes Grid de dos aplicaciones de Computacin de Alto Desempeo en el dominio de Fsica de Altas Energas y Simulacin Atmosfrica','Hoy en da, las aplicaciones operativas o en desarrollo aumentan drsticamente la carga de trabajo de los computadores, exigiendoles mayores niveles de recursos para la ejecucin de las mismas. La filosofa Grid , el alto poder de procesamiento que ofrecen hoy en da muchos computadores y las altas capacidades de almacenamiento disponibles en la actualidad, ofrecen una solucin viable para la solucin de estos problemas. El termino Grid se refiere a una infraestruc-tura que permite la integracin y el uso colectivo de computadores, redes y bases de datos que son propiedad y estn administradas por diferentes instituciones. El modelo hidrometeorolgico BRAMS y el sistema de simulacin AIRES son aplicaciones que requieren un alto poder de procesamiento, el objetivo principal de este trabajo es adaptar dichas aplicaciones a una plataforma Grid, en este caso de estudio se har uso de la plataforma instalada en el Centro de Computacin Paralela y Distribuida.','2009-11-02','Grid, gLite, BRAMS, AIRES',2,1,1,1,1,'2013-09-17 08:28:26','2013-09-17 08:28:26','Documento_247.pdf','application/pdf',1421994,'2013-09-17 08:28:26',20,0,83,'COMPLETO'),(247,'Estudio de la variacin en la composicin de minerales pesados con el tamao de grano en los sedimentos de las cuencas de los ros Aro, Arizo, Pao y Orinoco, Venezuela.','La bsqueda de las concentraciones de minerales pesados en los sedimentos aluviales es uno de los mtodos ms antiguos de prospeccin de yacimientos minerales. As, los minerales pesados, adems de ser de gran inters por su importancia econmica, aportan informacin a la prospeccin geoqumica y a la geoqumica ambiental. Por ello en el presente trabajo parcialmente financiado por FONACIT se estableci como objetivo general determinar la variacin de la composicin de minerales pesados de diferentes fracciones granulomtricas en sedimentos de las cuencas de los ros Aro, Arizo, Pao y Orinoco. Para cumplir con esto las muestras de sedimentos fluviales se tamizaron para obtener sus distintas fracciones granulomtricas, fueron separados los minerales pesados de dichas fracciones a travs del sistema hidrodinmico, luego se separaron magnticamente con el isodinmico Frantz y, parte del producto de estas separaciones, fue caracterizado mineralgicamente por difraccin de rayos X y sus elementos analizados cualitativamente por fluorescencia de rayos X. Con los anlisis qumicos y mineralgicos realizados en las distintas cuencas estudiadas se pudo evidenciar que los minerales pesados se encuentran distribuidos en distintas proporciones aumentando y disminuyendo en porcentaje en las distintas fracciones granulomtricas. Existe, en forma general una alta variabilidad de especies de minerales pesados en las fracciones de arenas gruesas y medias, mientras que en las arenas finas la variabilidad de especies de minerales pesados es menor y vuelve a aumentar en la fracciones de limos y arcillas. Dicha variabilidad en las especies minerales est acompaada de la variabilidad en la composicin qumica. Es posible diferenciar cuencas hidrogrficas de diverso orden, con el uso de la distribucin de las especies minerales pesados y sus abundancias relativas en los diversos tamaos de grano de los sedimentos derivados de ellas.','2009-10-16','Minerales pesados,, sedimentos,, hidrodinmico,, cuencas hidrogrficas,, Aro,, Arizo,, Pao,, Orinoco..',4,1,1,1,1,'2013-09-17 08:28:27','2013-09-17 08:28:27','Documento_248.pdf','application/pdf',2702679,'2013-09-17 08:28:27',17,0,145,'COMPLETO'),(248,'ESTUDIO DE LOS COMPLEJOS DE VANADIO(IV) Y LEUCINA POR MEDIO DE MEDIDAS DE FUERZAS ELECTROMOTRICES (KCl 3.0 M, 25 C)','{}','2009-10-26','{}',6,1,1,1,1,'2013-09-17 08:28:27','2013-09-17 08:28:27','Documento_249.pdf','application/pdf',1839204,'2013-09-17 08:28:27',19,0,83,'COMPLETO'),(249,'Degradacinn de las Protenas en el Lomo de Atnn ((Tunnussp))Empacado con Pelculas Comestibles y Almacenado a --1100 C','El Atn ((Thunnus sp) representa una especie de gran importancia comercial a nivel mundial, siendo consumido fresco en productos como el sushi y el ceviche, o procesado en productos como el surimi y en conservas. Por ser el pescado un alimento con gran aporte proteico y a la vez muy perecedero el procedimiento ms comnmente utilizado para su conservacin fresco es la congelacin, como medida preventiva del deterioro de origen microbiano y descomposicin qumica, lo cual conlleva a la perdida de humedad, la rancidez de lpidos y a la desnaturalizacin de protenas. Otro mtodo alternativo empleado en los procesos de conservacin es el uso de empaques los cuales deben garantizar la estabilidad y prolongar la vida til del producto que contiene, actuando como barrera protectora de microorganismos, gases, agentes qumicos y mecnicos.En la actualidad se han venido desarrollando empaques alternativos; muestra de ellos es el uso de empaques comestibles, glaseado con hidrocoloides, como la gelatina, la carragenina y el almidn, siendo utilizados en frutas, vegetales y carnes. Estos, adems de cumplir sus funciones como pelcula protectora del alimento, son mas econmicos, pueden ser ingeridos por el consumidor sin riesgo de toxicidad para el organismo y proporcionan un aporte nutricional ya que son fuente de protenas y carbohidratos. Adems, por ser biodegradables, contribuyen a la conservacin del ambiente, ayudan a preservar el olor y el sabor de los alimentos y proporcionan un aspecto ms atractivo para consumidor.Debido a las caractersticas antes mencionadas, se propone como objetivo del presente proyecto de investigacin evaluar la estabilidad proteica, mediante anlisis de solubilidad de protenas y mtodos electroforticos, en el lomo de Atn ((Thunnus sp)) empacado con pelculas comestibles elaboradas con hidrocoloides y almacenado a bajas temperaturas.','2009-06-15','Atun,hidrocoloides,proteinas,electroforesis,empaque,glaseado,carrgenina,gelatina',1,1,1,1,1,'2013-09-17 08:28:28','2013-09-17 08:28:28','Documento_250.pdf','application/pdf',4294105,'2013-09-17 08:28:28',20,0,142,'COMPLETO'),(250,'Caracterizacin mineralgica de las cuarcitas ferruginosas encontradas en la cuenca del ro Aro, estado Bolvar, Venezuela.','El presente estudio abarca la caracterizacin mineralgica de las cuarcitas ferruginosas encontradas en la cuenca de ro Aro, en el estado Bolvar. Fueron analizadas 38 muestras de roca tomadas en diferentes puntos de la cuenca de este ro. Se realizaron secciones finas para todas las muestras y se efectu un anlisis petrogrfico. De las 38 muestras se seleccionaron 3 muestras (AroAr- 9, DT-55-R, Aror191) y se les realiz un anlisis por difraccin de rayos X utilizando el mtodo del polvo. Las rocas estudiadas 33 fueron clasificadas como cuarcitas ferruginosas y 5 como metagabros cuarcferos. La cuarcitas ferruginosas tienen una composicin mineralgica conformada por cuarzo (49- 65%), magnetita (26-44%), hematita (3-23%), ferrosilita (8-20%) y plagioclasa (2-6%). Los metagabros cuarcferos tienen una composicin mineralgica conformada por hornablenda verde (41-47%), plagioclasa del tipo bytownita (27- 35%), cuarzo (18-26%) y magnetita (54). Las cuarcitas ferruginosas tienen una textura xenoblstica, mientras que los metagabros tienen una textura nematoblastica. El metamorfismo alcanzado por estas rocas (tanto los metagabros como las cuarcitas ferruginosas), es de la facie de la anfibolita, en la isgrada perteneciente a la zona de la cianita y la silimanita. El aumento en el grado de metamorfismo no afecto de forma relevante la asociacin mineralgica de estas rocas. Solo en el caso de las cuarcitas ferruginosas observamos la presencia de ferrosilita como mineral producto del metamorfismo. Las cuarcitas ferruginosas pueden clasificarse en funcin de su composicin mineralgica como formaciones de hierro ricas en xidos; la textura de estas permite clasificarlas como Fearenitas tipo Packstone o formaciones granulares de hierro tipo Packstone; y en base a su posible ambiente de formacin y con apoyo de la composicin qumica, como formaciones de hierro tipo Lago Superior. Las cuarcitas ferruginosas se agrupan geogrficamente por su concentracin de ferrosilita y hematita en dos reas. Estas reas coinciden con la ubicacin que propone Beukes et al. (1990) para estos minerales en su modelo de sedimentacin para las formaciones de hierro.','2009-10-29','Formaciones de hierro, Cuarcitas Ferruginosas, ro Aro',4,1,1,1,1,'2013-09-17 08:28:29','2013-09-17 08:28:29','Documento_251.pdf','application/pdf',1509075,'2013-09-17 08:28:29',18,0,65,'COMPLETO'),(251,'Animaciones de Algoritmos Distribuidos para Deteccin de Terminacin','Se desarrolla una herramienta monoprocesadora que anima modelos de ejecucin de los sistemas distribuidos con el fin de soportar el proceso didctico en la enseanza de los algoritmos distribuidos. Las animaciones desarrolladas se centran en la deteccin de terminacin de los procesos distribuidos, permitindose la parametrizacin de variables como el volumen de actividades, la productividad y el grafo de comunicacin del sistema. Adicionalmente se realiza una comparacin de las distintas implementaciones de los mtodos hechos, en trminos de los datos almacenados y mensajes utilizados. Con esto se crea un modelo bsico que sirve como prototipo para el desarrollo posterior de los sistemas estudiados, o bien sistemas simuladores de stos.','2009-10-29','algoritmos distribuidos, deteccin terminacin, animaciones',2,1,1,1,1,'2013-09-17 08:28:30','2013-09-17 08:28:30','Documento_252.pdf','application/pdf',1167612,'2013-09-17 08:28:30',16,0,78,'COMPLETO'),(252,'Aplicacin de los biomarcadores e hidrocarburos aromticos en breas de playas,, como indicadores de contaminacin por petrleo en regiones costeras de Venezuela..','En este estudio se identificaron los biomarcadores presentes en las fracciones de hidrocarburos saturados e hidrocarburos aromticos policclicos (HAPs), en breas de varias playas de Venezuela, con el fin de inferir posibles fuentes de origen y determinar el grado de alteracin (meteorizacin). La instrumentacin analtica empleada fue CG/EM. Las caractersticas fsicas de las muestras (dureza, y olor), la distribucin de los n-alcanos (C15-C33) y la presencia de UCM, permiti clasificar las breas en 3 grupos de acuerdo al grado de alteracin observada. El anlisis CG/EM muestra proporciones variables de terpanos tricclicos en el rango de C20-C25 y gran abundancia de terpanos pentacclicos ab (C29-C35), con predominancia de ab norhopano C29-C30 y hopano ab. Los compuestos esteranos tetracclicos fueron identificados en el rango de C27-C29. De igual manera revela en algunas muestras la presencia de un pico identificado como gammacerano y la seal asociada a 18a(H)oleanano. Algunas relaciones entre biomarcadores especficos sugieren que las breas se derivan de crudos inmaduros de origen mixto con predominancia marina, asociados a una roca fuente carbontica (tipo marga) y algunas de ellas asociadas a facies siliciclsticas, depositadas bajo condiciones anxicas en una columna de agua de salinidad normal. A partir de la identificacin de seales claras e intensas en los cromatogramas de algunas de las breas se propone la relacin Metilfenantreno/ Criseno (MF/C), para inferir el grado de alteracin (meteorizacin). La informacin generada fue comparada con datos publicados de estudios geoqumicos realizados en diferentes Cuencas Petrolferas de Venezuela. Las correlaciones positivas a partir de las caractersticas composicionales entre ambos permitieron sugerir que las breas pueden ser de origen autctono y provienen de diversas fuentes de contaminacin.','2009-10-26','biomarcadores,, HAPs,, CG//EM,, breas,, playas,, Venezuela..',4,1,1,1,1,'2013-09-17 08:28:31','2013-09-17 08:28:31','Documento_253.pdf','application/pdf',3912283,'2013-09-17 08:28:31',19,0,122,'COMPLETO'),(253,'ESTUDIO DE LA EXPRESIN DE RECEPTORES KIR EN CLULAS K','El cumplimiento de las funciones del sistema inmunitario se debe a la existencia de receptores y de un conjunto de molculas que determinan la identidad biolgica del individuo, que son codificadas por los genes del Complejo Principal de Histocomptibilidad llamados en el hombre HLA. Las clulas NK humanas expresan una familia de receptores de muerte, altamente polimrficos tipo inmunoglobulinas llamados KIR, que regulan la actividad citotxica de estas clulas. Los genes KIR proveen seales de activacin o supresin, para as regular la activacin de las clulas NK, de tal modo que juegan un papel importante en la inmunidad anti viral y anti tumoral y cada conjunto de receptores inhibidores o activadores reconocen determinantes de un mismo grupo de molculas HLA clase I. La Hepatitis C es una infeccin que causa estragos a nivel mundial, causada por un virus (VHC) de ARN. Aproximadamente 2%-3% de la poblacin mundial est crnicamente infectada con el virus de la Hepatitis C y cerca del 20% de sta se sobrepone de una infeccin aguda, estando involucrada en este hecho, la interaccin entre los receptores KIR y sus ligandos. El objetivo de este trabajo fue estudiar la expresin a nivel del ARNm de los receptores KIR inhibidores (2DL1, 2DL2, 2DL3 y 3DL1) y del KIR activador (2DS4) en clulas NK de sangre perifrica de pacientes crnicamente infectados con Hepatitis C e individuos controles. Para ello, se obtuvieron suspensiones celulares altamente enriquecidas en clulas NK, se evalu la expresin del ARNm de los receptores KIR mediante RT-PCR obtenindose que los receptores se expresan de acuerdo al genotipo dado para cada gen. Se logr estandarizar la tcnica de PCR en tiempo real para posteriormente evaluar la expresin del ARNm mediante PCR tiempo real y se obtuvo que los individuos controles expresaron ms el receptor inhibidor KIR 2DL1 y los pacientes el KIR 2DL3; en ambos grupos, el receptor menos expresado fue el KIR activador 2DS4. Slo se encontr diferencia significativa en controles y pacientes en cuanto al nivel de expresin de KIR 2DL3. En cuanto a la expresin de los genes KIR a nivel de ARNm y superficie, se encontr una correlacin inversa sin diferencias significativas en los receptores KIR 2DL1, 2DL3, 3DL1 y 2DS4.','2009-10-27','Clulas NK, receptores KIR, PCR en tiempo real',1,1,1,1,1,'2013-09-17 08:28:33','2013-09-17 08:28:33','Documento_254.pdf','application/pdf',3792064,'2013-09-17 08:28:33',20,0,158,'COMPLETO'),(254,'Aplicacin de la minera de datos para la clasificacin de la morfologa de espermatozoides humanos','Aplicacin de la minera de datos para la clasificacin de la morfologa de espermatozoides humanos','2009-09-08','mineria de datos, espermatozoides',2,1,1,1,1,'2013-09-17 08:28:35','2013-09-17 08:28:35','Documento_255.pdf','application/pdf',3382702,'2013-09-17 08:28:35',15,0,89,'COMPLETO'),(255,'Establecimiento de un Sistema de Embriognesis Somtica y de Organognesis in vitroen Ananas comosus ((L..)) Merr..','La especie Ananas comosus (pia) pertenece a la familia Bromeliaceae. La pia es cultivada predominantemente para ser consumida como fruta fresca o enlatada. Es una fuente abundante de manganeso y vitaminas C y B1, adems es usada como ingrediente en una gran variedad de comidas y tambin es de importancia medicinal por el uso de la enzima proteoltica bromelina. El trmino Cultivo de Tejidos Vegetales se refiere al cultivo in vitro de cualquier estructura de una planta (explante), sean clulas, tejidos u rganos bajo condiciones aspticas, aportndole todos los requerimientos fsicos y qumicos adecuados para inducir la respuesta de los explantes hacia un proceso determinado. La propagacin iin vitro ha sido ampliamente utilizada para lograr la rpida multiplicacin de numerosas especies vegetales y su xito a escalas comerciales depende de la habilidad de transferir las plantas a condiciones ex vitro, el bajo costo de la tcnica empleada y la obtencin de una alta tasa de supervivencia de las plantas regeneradas. La organognesis es un proceso de regeneracin que implica la formacin de rganos de novo a partir de meristemoides. Este tipo de desarrollo tambin se caracteriza por la presencia de conexin vascular entre el tejido del explante y el tejido regenerado. Por otra parte, la embriognesis somtica es el proceso mediante el cual las clulas somticas, se desarrollan para producir un embrin completo a partir de una sola clula, como sucede en la embriognesis cigtica pero sin fusin de gametos y al contrario de la organognesis, los embriones somticos no poseen conexin vascular con el tejido materno. Debido a la importancia agrcola, econmica y medicinal que tiene la pia, se plante establecer sistemas de regeneracin iin vitro va Embriognesis Somtica y Organognesis para la especie Ananas comosus(L.) Merr. como mtodo de clonacin de la misma. Para alcanzar los objetivos de este proyecto, se cultivaron bases de hojas de plantas de pia de la variedades Espaola Roja y Tab Can, obtenidas y mantenidas in vitro en un medio con las sales de Murashige y Skoog (1962), suplementado con 0,4mg/L de tiamina, 100mg/L de mio-inositol, 30g/L de sacarosa y con diferentes concentraciones de: cido naftalenactico (ANA), Bencil- adenina (BA), cido 2,4-diclorofenoxiactico (2,4-D), Picloram (Pic) y Thidiazuron (Tdz). El material vegetal, fue incubado en cmara de crecimiento a 251C, en oscuridad durante el lapso de tiempo necesario para la induccin de ambos procesos. Luego, fue transferido a condiciones de luz fluorescente continua y temperatura de 271C. En la organognesis, en la mayora de los casos se observaron cambios morfolgicos en los explantes a partir de la cuarta semana de cultivo en ambas variedades, formndose un callo granular de consistencia friable y coloracin amarillenta, mientras que en la embriognesis somtica hubo respuesta de los explantes a partir de la cuarta semana de cultivo en los medios MS4 y MS6, y a la quinta en el medio MS5. Aproximadamente a los 3 meses de cultivo, los callos organognicos formados comenzaron a mostrar indicios de desarrollo de rganos en los dos medios de cultivo para las dos variedades produciendo la formacin de races y/o brotes en los explantes. A las 10 semanas de cultivo se obtuvo la formacin de los primeros embriones somticos en estado globular en el medio MS4 en la var. Espaola Roja, mientras que en los medios MS5 y MS6, ocurri a las 13 y 15 semanas de cultivo respectivamente. En la presente investigacin ocurri embriognesis somtica directa en el 15% de los explantes de la var. Espaola Roja cultivados en el medio MS5. Comparando las dos variedades, estadsticamente se encontr que: en cuanto a la formacin de races, hubo diferencias significativas solamente en el medio de cultivo MS2 en la var. Tab Can. En el caso de la formacin de brotes hubo diferencias significativas en el medio de cultivo MS3 tanto para la var. Espaola Roja como para la var. Tab Can, pero no hubo diferencias entre los resultados obtenidos en el medio de cultivo MS2 para ambas variedades. Del total de 30 plantas aclimatadas de cada, se obtuvo un 100% de sobrevivencia en la var. Espaola Roja y un 90% de sobrevivencia en la var. Tab Can.','2009-07-16','Biotecnologa vegetal, Micropropagacin, Organognesis, Embriognesis Somtica, Ananas comosus..',1,1,1,1,1,'2013-09-17 08:28:36','2013-09-17 08:28:36','Documento_256.pdf','application/pdf',1351986,'2013-09-17 08:28:36',20,0,82,'COMPLETO'),(256,'\"Facies hidrogeoqumicas de las aguas subterrneas del sector oeste de la sub- cuenca del ro Zuata, rea Junn de la Faja Petrolfera del Orinoco, Venezuela\"','RESUMEN En la presente investigacin fueron determinadas las especies qumicas mayoritarias Ca2+, Mg2+, Na+, K+, Cl-, NO3-, SO42-, HCO3- y slice disuelta (SiO2) en muestras de aguas subterrneas y superficiales del sector oeste de la sub-cuenca del ro Zuata de la Faja Petrolfera del Orinoco, con el fin de determinar las facies hidrogeoqumicas presentes en la zona, los procesos geoqumicos que pueden estar influyendo sobre la composicin qumica, as como tambin, la evaluacin de la probable contaminacin de las aguas del acufero. Para la realizacin de este estudio fueron captadas 25 muestras de aguas subterrneas y 15 muestras de aguas superficiales, la cual se llev a cabo en el mes de julio del ao 2007; simultneamente, fueron medidos \"in situ\" los parmetros fisicoqumicos pH, Eh, conductividad y temperatura. En el laboratorio fueron determinadas las especies qumicas mayoritarias mediante tcnicas analticas tales como: espectroscopa de absorcin y emisin atmica con llama, cromatografa inica y espectrofotometra de UV-visible. Asimismo, fue determinada la concentracin terica de HCO3- utilizando para ello un modelo de interaccin del agua con las probables unidades geolgicas que constituyen la regin de estudio. Para la interpretacin de los resultados obtenidos, se emplearon herramientas como las distribuciones espaciales, las relaciones interelementales y el diagrama de Piper, que permitieron establecer la existencia de tres tipos de aguas en este sector: bicarbonatadas clcicas y/ o magnsicas (Ca2+-Mg2+-HCO3-), bicarbonatadas sdicas (Na+-HCO3-), y aguas tipo sulfatadas clcicas (Ca2+-SO42-). Igualmente, el uso de dichas herramientas indican que los principales procesos que gobiernan las caractersticas de las aguas subterrneas son: el intercambio catinico, la disolucin de minerales carbonticos, la disolucin de silicatos y aluminosilicatos y en menor proporcin, el aporte atmosfrico. As como, los probables factores, estn relacionados al tiempo de residencia, litologa, clima y las actividades antrpicas causantes de las especies contaminantes como el NO3-.','2009-10-16','{}',4,1,1,1,1,'2013-09-17 08:28:37','2013-09-17 08:28:37','Documento_257.pdf','application/pdf',1987453,'2013-09-17 08:28:37',19,0,124,'COMPLETO'),(257,'TOXICIDAD IN VIVO Y PROTEMMICA COMPARATIVA PARA EL ESTUDIO DE LA EXPRESINN DE PROTENNASCON ACTIVIDAD INSECTICIDA PRESENTES EN SEMILLAS DE Phaseolus vulgaris L..','Las caraotas (Phaseolus vulgaris) son una de las leguminosas ms cultivadas en el mundo, su composicin las hace una excelente fuente de protenas, carbohidratos, fibra diettica y micronutrientes por lo que son de gran inters desde el punto de vista nutricional. La alta calidad nutricional de P.. vulgaris la hace en ocasiones blanco de ataques de distintos tipos de insectos desde antes de la cosecha hasta el almacenamiento de los granos. Un ejemplo de este tipo de plagas son los bruquidios, particularmente las especies Acanthoscelides obtectus y Zabrotes subfasciatus.. Estos se alimentan del endospermo y causan graves daos a la semilla por lo que puede disminuir la calidad y cantidad de granos producidos hasta en un 48 %. Si bien los agricultores han empleado distintas estrategias para disminuir el efecto de los insectos, stas generalmente tienen consecuencias negativas y no son por completo efectivas. Es preciso desarrollar una estrategia que permita combatir eficazmente los bruquidios y que no implique dao a otras especies o afecte de manera considerable la produccin. Ciertas lectinas presentes en las leguminosas (como la fitohemaglutinina, los inhibidores de a-amilasa y las arcelinas) afectan a los insectos y confieren una resistencia natural al ataque de las semillas, no implican estrategias complejas o costosas para contrarrestar el efecto de las plagas y representan una buena opcin para evitar el ataque de insectos. Se realiz un bioensayo con el gorgojo de arroz (Sitophilus oryzae) a fin de estimar la toxicidad de semillas sin testa de diferentes variedades de P.. vulgaris, si bien este insecto no ataca en condiciones normales las semillas de P.. vulgaris, se ha demostrado su susceptibilidad a las protenas txicas presentes en las semillas. Mediante electroforesis en dos dimensiones se estudiaron las protenas presentes en el endospermo de las semillas, obtenidas a partir de harinas de los granos. Esta tcnica permiti comparar distintas muestras entre si mediante el anlisis de las electroforesis por bioinformtica. Mediante la correlacin entre los resultados del bioensayo y el anlisis de los geles, se busc identificar las variedades de P.. vulgaris resistentes al ataque de insectos que pueden ser de inters como parte de programas de introduccin de nuevas variedades de caraotas al mercado venezolano ms resistentes a las plagas de almacenamiento. Se obtuvieron tres grupos de resultados, semillas de toxicidad alta, moderada y baja, siendo las variedades Tacarigua, Victoria y MGM0802026, las ms txicas y Tenerife y DOR500 las menos dainas para los insectos. Las electroforesis en dos dimensiones mostraron grupos de protenas comunes para todas las variedades de semillas que mostraron ser txicas, mientras que en las variedades no txicas no se observaron estas protenas. Aparentemente existe una correlacin entre la presencia de spots en ciertas regiones de los geles y la toxicidad de las semillas','2009-10-26','Phaseolus vulgaris, Plagas de almacenamiento, Protenas con actividad insecticida, Gorgojos, Electroforesis en 2 dimensiones, Protemica comparativa, Bioensayo de toxicidad',1,1,1,1,1,'2013-09-17 08:28:39','2013-09-17 08:28:39','Documento_258.pdf','application/pdf',0,'2013-09-17 08:28:39',20,0,0,'INCOMPLETO'),(258,'Caracterizacinn Caracterizacinn de plsmidos presentes en cepas bacterianas deA.. baumannii y S.. maltophiliacon determinantes de resistencia a antibitticos,, aisladas del Hospital Clnico Universitario..','Acinetobacter baumanniiy Stenotrophomonas maltophiliason patgenos emergentes de gran impacto en trminos de salud pblica, y son la causa de infecciones en la mayora de los hospitales, especialmente en las reas de Cuidados Intensivos. Presentan un perfil de resistencia bastante complejo, siendo resistentes a la mayora de los antibiticos de uso actual. Las bacterias adquieren la capacidad de resistir a la accin de los antibiticos por varios mecanismos, entre los que destacan, como uno de los mas importantes, los procesos de intercambio de informacin gentica mediante la conjugacin, proceso por el cual, de manera directa, el DNA plasmdico de una bacteria es transferido a otra, y pueden ser movilizados genes que confieran resistencias mltiples. Esta situacin a desencadenado que los Centros de Salud sean centros de seleccin y reservorio de cepas resistentes a mltiples antimicrobianos. En este trabajo nos propusimos analizar los plsmidos presentes en cepas de A.. baumanniiy S.. maltophiliapresentes en el HUC. Se aislaron 26 cepas de A.. baumanniiy 15 cepas de S.. maltophilia. Mediante el mtodo de difusin en disco se determin el perfil de resistencia empleando 15 antibiticos de uso clnico actual. Los plsmidos fueron aislados y visualizados en electroforesis. Para determinar si estos plsmidos son capaces de conferir las resistencias a diversos antimicrobianos, se realizaron ensayos de transformacin y de conjugacin, en medio lquido y en slido, con diferentes marcadores. Tambin se obtuvo el patrn de restriccin de los plsmidos presentes en las cepas en estudio. Nuestros resultados mostraron que las 26 cepas de A.. baumanniipresentaron multirresistencia, entre 12 y 15 de los antibiticos examinados. Los resultados de los ensayos de conjugacin, tanto en lquido como en slido, demostraron que en las condiciones empleadas, ninguna de las cepas en estudio logr transferir informacin gentica a una cepa E.. colireceptora utilizada. Esta informacin es relevante para las autoridades de Salud para mejorar el diseo de las medidas a implementar para el control de la dispersin de la multirresistencia.','2009-10-16','A. baumannii, S. maltophilia, Conjugacion, Transformacion, Plasmidos, Resistencia bacteriana.',1,1,1,1,1,'2013-09-17 08:28:39','2013-09-17 08:28:39','Documento_259.pdf','application/pdf',0,'2013-09-17 08:28:39',20,0,0,'INCOMPLETO'),(259,'Caracterizacinn de Integrones clase I en cepas de Acinetobacter baumannii y Stenotrophomonas maltophilia aisladas del Hospital Universitario de Caracas..','Los integrones se han identificado como elementos que actan como un vector natural de clonamiento y expresin, porque pueden incorporar un nmero indefinido de genes de resistencia. La posibilidad que se generen diversos arreglos de genes en los integrones, ha contribuido al surgimiento de cepas multirresistentes. Los integrones se pueden encontrar asociados a transposones, que a su vez pueden encontrarse en plsmidos conjugativos, por lo que su movilidad est asegurada. La transmisin de genes que confieren resistencia entre diferentes especies bacterianas, es un problema creciente en el mbito de las enfermedades infecciosas, y ms grave si nos referimos a infecciones nosocomiales. En este estudio nos propusimos, identificar y caracterizar los integrones Clase I en aislados bacterianos provenientes del Hospital Universitario de Caracas, en los cuales la multirresistencia puede estar asociada a estas estructuras. Acinetobacter baumannii y Stenotrophomonas maltophilia son bacilos Gram negativos, frecuentemente asociados a infecciones nosocomiales. Fueron analizadas 41 cepas aisladas de pacientes con infecciones nosocomiales y de ambientes inanimados del Hospital Universitario de Caracas. Los datos de resistencia contra los diferentes agentes antimicrobianos empleados, revelaron la presencia de patrones complejos de resistencia mltiple, que puede estar mediada por plsmidos. El perfil plasmdico obtenido, mostr para todas las cepas, un plsmido de alto peso molecular, adems de otras molculas menores. Mediante la amplificacin del gen ribosomal 16S por PCR, se evalu la calidad tanto de los lisados celulares como del ADN plasmdico extrado de las diferentes cepas estudiadas, con fin de verificar que el material fue adecuado para ser molde en las reacciones de PCR. Analizando las cepas de A.. baumannii portadoras de plsmidos, se determin una frecuencia de 90% de integrones clase I en las cepas provenientes de pacientes con infecciones nosocomiales de la UCI, de 40% de integrones clase I en las cepas provenientes del ambiente de la UCI y de 25% en las cepas provenientes del ambiente del Servicio de Neonatologa. Tambin se determin la frecuencia de integrones clase I en las cepas de S.. maltophilia, evidencindose una frecuencia de 57% en las cepas provenientes del ambiente de la UCI, de 33% en las cepas provenientes de pacientes con infecciones nosocomiales de la UCI y no detectndose estos elementos genticos en la cepa de ambiente del Servicio de Neonatologa. La secuenciacin de las regiones variables de algunos integrones, permiti conocer cuales determinantes de resistencia estn asociados a estas estructuras. En las regiones variables caracterizadas se identificaron los genes aacC1 y aadA1, que confieren resistencia a aminoglucsidos Estos resultados nos permiten inferir que los integrones clase I, contribuyen a la diseminacin de genes de resistencia en los aislados nosocomiales y ambientales provenientes la UCI y del Servicio de Neonatologa del HUC.','2009-10-16','Infecciones nosocomiales, Acinetobacter baumannii, Stenotrophomonas maltophilia, Integrones clase I',1,1,1,1,1,'2013-09-17 08:28:40','2013-09-17 08:28:40','Documento_260.pdf','application/pdf',4028931,'2013-09-17 08:28:40',20,0,100,'COMPLETO'),(260,'DESCONTAMINACIN DE NCTAR Y JUGO DE FRUTAS CON TRATAMIENTO DE LUZ ULTRAVIOLETA.','Los jugos comerciales poseen caractersticas diferentes a los naturales debido principalmente a sufrir degradacin trmica durante su pasteurizacin. Algunos estudios han demostrado la utilidad del tratamiento con luz UV-C para inactivar microorganismos presentes en jugos, sin embargo, ninguno de ellos ha estudiado el efecto de la luz UV-C sobre las caractersticas sensoriales de los jugos. Igualmente, estudios previos han demostrado la eficacia del reactor UV- C construido en el Laboratorio de Nuevas Tecnologa, pero la dosimetra respectiva no ha sido realizada. El presente trabajo tuvo como objetivo estudiar el efecto de la luz UV-C sobre la carga microbiana y la calidad sensorial del jugo de naranja y los nctares de guayaba y parchita. Para reportar adecuadamente las condiciones de trabajo se hizo la estimacin radiomtrica respectiva. Los resultados demostraron que la luz UV-C corresponde a dosis volumtricas de 6,19-23,62 KJ/L, y dosis por rea de 3,64-13,89 J/cm2. Los tratamientos lograron un mximo de inactivacin en el recuento de microorganismos aerobios mesfilos de 1,36 log10 UFC/mL (parchita) y en mohos y levaduras de 0,93 log10 UFC/mL (naranja). Las tasas de inactivacin estuvieron en el rango 0,02-0,14 log10 UFC/KJ, con R2=0,88-0,98, y su orden no estuvo correlacionado con la absorbancia de los jugos. El panel entrenado observ diferencias estadsticamente significativas (p<0,05) entre las muestras tratadas y las controles. Se concluye que los tratamientos con luz UV-C usados lograron inactivar microorganismos presentes en jugo de naranja y nctares de guayaba y parchita, pero alteraron sus caractersticas sensoriales; siendo este ltimo resultado el ms importante.','2009-10-22','Nctar, Jugo, Ultravioleta, Reactor, UV-C, Efecto, Dosis, Flujo, Inactivacin, Alteracin.',1,1,1,1,1,'2013-09-17 08:28:41','2013-09-17 08:28:41','Documento_261.pdf','application/pdf',544615,'2013-09-17 08:28:41',19,0,0,'INCOMPLETO'),(261,'ESTUDIO HIDROGEOQUMMICO DE LAS AGUAS SUBTERRNNEAS DEL SECTOR ESTE DE LA SUB-- CUENCA DEL ROO ZUATA DEL RREA JUNIN DE LA FAJA PETROLFFERA DEL ORINOCO','Con la finalidad realizar un estudio hidrogeoqumico en el sector este de la sub-cuenca del ro Zuata, fueron captadas 15 muestras de aguas subterrneas en aljibes y pozos de bombeo. Durante la fase de campo, se midieron los parmetros fisicoqumicos pH, conductividad y Eh; posteriormente en el laboratorio, fue determinada la concentracin de las especies qumicas mayoritarias Na+, K+, Ca2+, Mg2+, NO3-, SO42-, y SiO2(slice disuelta); as como, la concentracin terica del HCO3-, a partir de los probables minerales presentes en la regin de estudio. Los resultados obtenidos se interpretaron atendiendo a mapas de distribucin espacial, a algunas relaciones interinicas, as como a los diagramas de Gibbs y Piper, permitiendo establecer la existencia de tres tipos de aguas en la zona de estudio, a saber: Ca2+-HCO3-, Na+-HCO3- y una tipo Ca2+-SO42-. As mismo la caracterizacin geoqumica evidenci que la composicin qumica de estas aguas est controlada por procesos de precipitacin y disolucin de sales evaporiticas, histolisis de aluminosilicatos e intercambio inico; mientras que, los factores estn asociados al clima, a la interaccin agua-medio poroso y al tiempo de residencia.','2009-09-07','{}',4,1,1,1,1,'2013-09-17 08:28:42','2013-09-17 08:28:42','Documento_262.pdf','application/pdf',961035,'2013-09-17 08:28:42',19,0,134,'COMPLETO'),(262,'ESTIMAR LA CINETICA DE HIDRODESCLORINACION DE LOS CONGENERES 2,3,4,5 Y 2,4,4\',6 DE LOS CONGENERES DEL TETRACLOROBIFENILO EN CONDICIONES DE HIDROTRATAMIENTO CATALTICO.','El presente TEG abarca un estudio fisicoqumico desde el punto de vista terico-computacional de las cintica de la hidrodesclorinacion de bifenilos policlorados en condiciones de hidrotratamiento cataltico empleando una herramienta matemtica computacional llamada MATLAB. Se calcularon la concentracion de las especies en el tiempo sin hacer ningun tipo de aproximaciones y se determinaron parmetros de diseo de una reactor flujo piston.','2009-10-13','BifenilosMatlabReactor Flujo Piston',6,1,1,1,1,'2013-09-17 08:28:43','2013-09-17 08:28:43','Documento_263.pdf','application/pdf',2443143,'2013-09-17 08:28:43',18,0,103,'COMPLETO'),(263,'Factores y procesos que determinan la calidad qumica de las aguas subterrneas del sector sur-central del rea Junn de la Faja Petrolfera del Orinoco','En ste trabajo se determin la calidad qumica de las aguas subterrneas del sector sur-central del rea Junn de la Faja Petrolfera del Orinoco. Para ello, fueron analizadas 31 muestras, distribuidas de la siguiente manera: 18 de aljibes, 12 de ro y 1 muestra de morichal, de las cuales se realiz mayor nfasis en las muestras de aljibes. Cabe destacar que el muestreo fue realizado en el mes de julio de 2007, a travs de una campaa llevada a cabo por el Instituto de Ciencias de la Tierra, el Instituto de Zoologa Tropical y PDVSA. Se determinaron las concentraciones de las especies mayoritarias, a travs de diferentes tcnicas analticas, los datos obtenidos fueron analizados a travs del uso de diferentes herramientas graficas, como diagramas de Piper, cajas graficas, y distribucin espacial, entre otras. Los resultados obtenidos indican que el 78% de las muestras de aljibes corresponden a aguas del tipo Ca2+-HCO3-,mientras que un 11% son Na+- K+-HCO3- y el resto corresponden al tipo Na+-SO42- y K+-SO42-. La composicin de las aguas posiblemente est controlada por diversos factores, entre los que se encuentran la interaccin agua- roca, a travs del intercambio inico; precipitacin atmosfrica y actividades antropicas. Esta ltima posiblemente est afectando sectores particulares del rea de estudio.En cuanto a la calidad qumica, atendiendo al decreto 883 (Gaceta Oficial N 5021, 2005) el 93,5% de las muestras analizadas entran en la clasificacin de buena a excelente, que pueden ser usadas para cualquier actividad; mientras que, el 6,5%, correspondiente a dos muestras, estn por debajo de la clasificacin de buenas, es probable que tengan una mayor influencia de las actividades agrcolas, ganaderas e industriales de la regin.','2009-10-06','aAguas subterrneas,, calidad qumica,, Junn,, aljibes,, Decreto 888833..',4,1,1,1,1,'2013-09-17 08:28:44','2013-09-17 08:28:44','Documento_264.pdf','application/pdf',1188425,'2013-09-17 08:28:44',19,0,73,'COMPLETO'),(264,'\"\"Estudio de los parmetros que influyen en el proceso de electrogasificacinn de residuos sllidos de carbono\"\"','Investigaciones previas han reportado la oxidacin electroqumica del carbn, ya sea mineral o activado. El objeto de estudio de este trabajo es la electrooxidacin de materiales carbonosos ms complejos como: flexicoque Amuay con alto contenido de vanadio y coque Petrozuata. Para el primero se consigue la electrogasificacin en medio cido (H2SO4 1 M) donde la suspensin es agitada hasta ser obtenido un porcentaje de CO2 mnimo y constante (0,14 %), al aplicar la perturbacin elctrica (1,87 V vs. SCE o 25 mAcm-2) este porcentaje aumenta hasta aproximadamente 2 % y se detecta la presencia de CO (0,10 %). Tambin es electrooxidado en medio bsico (NaOH 1 M) producindose 0,06 % de CO con la aplicacin de 1,87 V vs. SCE. La presencia de los metales ocluidos en la matriz carbonosa juega un papel importante en la respuesta electroqumica del material, ya que stos actan como catalizador en la reaccin. Los procesos electroqumicos no ejercen efecto significativo en la remocin de metales del material al contacto con el medio electroltico.','2009-10-22','electrogasificacin. coque.',6,1,1,1,1,'2013-09-17 08:28:45','2013-09-17 08:28:45','Documento_265.pdf','application/pdf',4614516,'2013-09-17 08:28:45',20,0,0,'INCOMPLETO'),(265,'Comparacinn de la cisten proteasa y del kinetoplasto de dos aislados venezolanos de tripanosomas de inters veterinario','La tripanosomiasis animal es una enfermedad ampliamente distribuida en todo el mundo, particularmente la equina y la bovina son causadas por especies del subgnero Trypanozoon: Trypanosoma brucei brucei,, T.. evansiy T.. equiperdum. La tripanosomiasis atribuida a T.. evansi se conoce como surra o derrengadera, y la enfermedad causada por T.. equiperdum, es denominada durina, caracterizada por transmitirse nicamente de forma venrea y por la formacin de placas edematosas cutneas en el rea urogenital. Estos parsitos son morfolgicamente indistinguibles entre s, pero pueden diferenciarse a travs del estudio microscpico y molecular de su kinetoplasto, el cual est compuesto por dos clases de molculas concatenadas entre s: los mini y los maxicrculos. En el caso de T.. evansi, se observa la ausencia de maxicrculos, a diferencia de T.. equiperdum, que an presenta fragmentos del mismo, similar en secuencia a los presentes en T.. brucei. Sin embargo, conjuntamente, con el estudio de estos marcadores moleculares, se requiere de la bsqueda de marcadores bioqumicos que permitan distinguir entre T.. equiperdumy T.. evansi, y que a su vez, pudieran correlacionarse con las diferencias en el grado de virulencia y/o patogenicidad de la durina y derrengadera, respectivamente. Las proteasas constituyen factores claves para la virulencia de varios parsitos y en el establecimiento de la patognesis de dichas parasitosis. La principal cisten proteasa de los tripanosomas africanos, posee una secuencia primaria y caractersticas bioqumicas similares a la catepsina L de los mamferos, presentando cuatro regiones: pre-cataltica, pro-cataltica, cataltica y una regin C-terminal que inicia con nueve residuos de prolina contiguos e incluye ocho residuos de cistena, caracterstica propia que la diferencia de las cisten proteasas reportadas en mamferos. El objetivo de este trabajo fue comparar la secuencia y la actividad de la cisten proteasa y las diferencias en el kinetoplasto de dos aislados venezolanos de tripanosomas de inters veterinario, uno de los cuales presenta caractersticas de T.. equiperdum (TeAp- N/D1). El anlisis de la secuencia de la principal cisten proteasa (Cat-L) del aislado TeAp-N/D1, present un residuo extra de prolina en la regin bisagra, caracterstica que comparte con la secuencia reportada para T.. brucei y que lo diferencia del aislado TeAp-Fro01, el cual slo presenta ocho prolinas. As mismo, el estudio de la secuencia completa del minicrculo agrup a TeAp-N/D1 con minicrculos tipo B (correspondientes a cepas de T.. equiperdum), y lo diferenci del aislado TeAp-Fro01 que presenta minicrculos tipo A1. Simultneamente, se determin la presencia de una fraccin de maxicrculo en el aislado TeAp-N/D1, excluyendo la posibilidad que este aislado sea clasificado como T.. evansi. Durante el estudio de la actividad proteoltica se realizaron ensayos de zimografa con gelatina y fluorimetra con los sustratos ZFR-AMC y ZRR-AMC, para comparar cualitativa y cuantitativamente la actividad de los dos aislados de inters. Se encontr que el aislado ms virulento (TeAp-N/D1) presenta una menor actividad proteoltica, tanto en el ensayo de zimografa como en el ensayo para catepsina L, en relacin al aislado menos virulento en infecciones experimentales (TeAp-ElFro01). Se determin tambin que no existen diferencias significativas, entre ambos aislados, en cuanto a la actividad proteoltica tipo catepsina B. Con este trabajo se concluye que el aislado TeAp-N/D1, inicialmente clasificado como Trypanosoma evansi, no pertenece a esta especie, sino que presenta caractersticas moleculares consistentes con su reclasificacin como Trypanosoma equiperdum.','2009-10-28','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:28:46','2013-09-17 08:28:46','Documento_266.pdf','application/pdf',6676443,'2013-09-17 08:28:46',20,0,252,'COMPLETO'),(266,'Estudio de la posible asociacinn del sistema KIR--HLA--I con la susceptibilidad a Hepatitis Autoinmune tipo I..','ESTUDIO DE LA POSIBLE ASOCIACINN DEL SISTEMA KIR--HLA--I CON LA SUSCEPTIBILIDAD A HEPATITIS AUTOINMUNE TIPO I..((Study of the possible association of the system KIR--HLA-- I with the susceptibility to autoimmune hepatitis type 11))..Bochichio M..11;; Conesa A.. 11;; Fortes M.. 1111Instituto de Inmunologa.. Facultad de Medicina,, UCV.. marybochichio666600@@gmail..com Estudios recientes han demostrado que las clulas NK expresan familias de receptores, que generan tanto seales activadoras como inhibidoras de la actividad citotxica de las mismas. Entre estos receptores se encuentran los KIR perteneciente a la superfamilia de las inmunoglobulinas. El polimorfismo de KIR e interaccin con combinaciones especficas KIR-HLA, estn relacionadas con la susceptibilidad o resistencia a numerosas enfermedades. Por ello, el objetivo de este trabajo es el estudio de la posible asociacin del sistema KIR-HLA con la susceptibilidad a Hepatitis Autoinmune tipo 1, ya que sobre dicha enfermedad no se ha realizado ningn estudio referente a estos receptores. El estudio se realizara mediante aislamiento de ADN de la capa de blancos (Buffy coat) y su posterior amplificacin mediante PCR-SSP con cebadores sentido y antisentido especficos para cada KIR. El estudio de los alelos HLA se realizar mediante la hibridacin con sondas especficas de Oligonucletidos (PCR-SSO) usando el estuche comercial de Dynal Reli[TM] SSO HLA Typing Kit. Los resultados muestran que 2DL1, 2DL3 y 2DP1 as como las combinaciones 3DL1 HLA-Bw4 y 2DL3 HLA-C1 confieren proteccin a individuos con HAI tipo 1. En cambio 2DL2 con HLA-C1 ambos en condicin homciga, pudieran conferir susceptibilidad a HAI tipo 1, lo cual nos lleva a concluir que la presencia de las combinaciones encontradas podran actuar inhibiendo la actividad citotoxica de las clulas NK y por ende, actuar como un factor protector.','2009-10-27','Hepatitis Autoinmune, clulas NK, receptores KIR, Susceptibilidad',1,1,1,1,1,'2013-09-17 08:28:47','2013-09-17 08:28:47','Documento_267.pdf','application/pdf',1793069,'2013-09-17 08:28:47',19,0,124,'COMPLETO'),(267,'Identificacinn de la presencia de genes plasmdicos qnrque confieren resistencia a quinolonas en cepas de Escherichia coli causantes de infecciones de tracto urinario con expresinn de b--lactamasas de espectro extendido','Las infecciones de tracto urinario (ITU) son un problema de Salud Pblica que afecta a gran parte del mundo, no slo por su incidencia, sino por la rpida diseminacin de genes de resistencias a los antibiticos que han surgido en los ltimos tiempos en los microorganismos productores de este tipo de infecciones. Estas resistencias se adquieren por mutaciones o por ganancia horizontal de material gentico, sobre todo, por el uso indiscriminado de antibiticos, lo cual genera la seleccin de microorganismos resistentes. Las cepas productoras de BLEE, resistentes a cefalosporinas de 3ra y 4ta generacin, son un claro ejemplo del problema al que nos estamos enfrentado actualmente, debido a que su presencia dificulta la aplicacin de un tratamiento eficaz. Para estos casos se utilizan otros antibiticos con mayor espectro de accin como lo son las quinolonas, pero ahora se est observando un aumento en la seleccin de cepas resistentes a este grupo de antibiticos. La resistencia a las quinolonas aparece principalmente por mutaciones cromosomales, pero tambin se han reportado genes plasmdicos qnr, capaces de conferir resistencia contra estos antibiticos. En Venezuela, existe una frecuencia elevada de cepas de E.. coli causantes de ITU multiresistentes a los antibiticos comnmente empleados en su tratamiento, pero no se ha realizado, hasta el momento, la determinacin de la incidencia de estos genes plasmdicos codificantes para resistencia a quinolonas, en cepas que concomitantemente expresen BLEEs. Como un aporte para la vigilancia epidemiolgica y el entendimiento de las causas para la prevalencia y la dispersin de estas cepas multiresistentes, en este trabajo se determin la coexistencia de resistencia a BLEE y a quinolonas en cepas causante de ITU. En este estudio se report que el 76,4% de las ITU en pacientes de consulta ambulatoria fueron causadas por E.. coli, predominando en pacientes femeninos en un 79,2% de los aislados. Las cepas productoras de BLEE estuvieron representadas por el 3,5% de las cepas de E.. coliaisladas de ITU, las cuales presentaban un perfil de multiresistencia a distintas familias de antibiticos, con una resistencia elevada a SXT (83,3%), CRO (75%), CTX (79,2%), CIP (87%), OFX (87%), NAL (91,7%),TOB (62,5%), ATM (56,5%), seguidos de GN (34,8%), FOX (21,7%), CAZ (20,8%), AMC(17,4%), mientras que para IMP y AN no se obtuvieron cepas resistentes, constituyendo estos ltimos antibiticos la mejor opcin teraputica para estos pacientes en particular. Se obtuvo predominancia del gen blaCTX -M(87,5%) en los aislados seguido del gen bla TEM (25%) y del gen blaSHV (12,5%)), particularmente las cepas positivas para el gen blaTEM tambin estaban asociadas al gen blaCTX-M. Adems se determin la presencia de los genes qnrB y qnrS en 20,8% y 16,7% respectivamente. No fue detectada la presencia de los determinantes qnrA, qnrC, qnrD y qepA en las cepas evaluadas. La incidencia de genes bla y qnr en una misma cepa fue encontrada en 33,3% de los aislados y fue asociada principalmente a los genes blaCTX-M y se encontraron en menor proporcin en cepas que portaban los genes blaSHVyblaTEM. Esta investigacin permiti detectar la incidencia de qnr en la comunidad, indicando la diseminacin de este mecanismo de resistencia fuera de ambientes hospitalarios, representando un serio problema al considerar que las ITU afectan a gran parte de la poblacin y la expresin concomitante de genes bla y qnr dificulta las opciones teraputicas, ya que la transferencia horizontal de estos genes de resistencia es muy probable.','2009-10-29','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:28:48','2013-09-17 08:28:48','Documento_268.pdf','application/pdf',7344129,'2013-09-17 08:28:48',20,0,128,'COMPLETO'),(268,'Determinacin de los polimorfismos: + 647 G>C en el gen del Receptor de Glucocorticoide y -159 C>T en el gen de CD14, en pacientes con Asma y Enfermedad Obstructiva Crnica (EPOC)','El Asma y la Enfermedad Pulmonar Obstructiva Crnica (EPOC) son enfermedades respiratorias que se originan por un proceso inflamatorio crnico; ambas patologas se caracterizan por ser complejas, y resultan de la interaccin de mltiples agentes ambientales con diversos genes. Se conoce que un nmero importante de pacientes es resistente a los efectos de glucocorticoides y se desconoce las razones; por ello, la importancia de analizar los polimorfismos del gen del receptor de Glucocorticoide y las pruebas funcionales para ensayarlo. Diversos investigadores han indicado que algunos polimorfismos de tipo SNP (polimorfismos de nucletido simple), han sido asociados con el desarrollo de Asma y EPOC, uno de ellos en el gen del Receptor de Glucocorticoide (GR), el cual esta definido a +647 pb en el intrn 2 y consiste en la transversin de una Guanina (G) por una Citosina (C). Por otro lado, el CD14 es una glicoprotena expresada en la membrana de mastocitos, macrfagos, que acta como receptor de componentes bacterianos como Lipopolisacridos (LPS).Uno de los polimorfismos en la regin promotora del gen de CD14, est definido a -159 pb del sitio de inicio de la transcripcin, y consiste en la transicin de una Citosina (C) por una Timina (T). El objetivo de nuestra investigacin fu: estudiar la posible asociacin entre la presencia de las variantes allicas de estos dos polimorfismos, con el desarrollo y severidad de Asma y EPOC, en comparacin con sujetos controles (sin enfermedades respiratorias). Para ello, se realiz la amplificacin de los segmentos de inters en cada polimorfismo por PCR y luego el corte con enzimas de restriccin especficas. Al mismo tiempo se analiz en dichos pacientes, tanto la funcin del receptor LPS-CD14-TLR-4 en ensayos biolgicos in vitro deactivacin celular, como la funcin del Receptor de Glucocorticoide, mediante la produccin o inhibicin inducida por LPS, de TNF-a y radicales O2-. Se observ que la presencia de los genotipos del polimorfismo en el gen del GR, difieren significativamente de lo reportado para la poblacin caucasoide control (p < 0,01), y de lo reportado para Asma y EPOC en dicha raza. Por su parte, entre las variantes allicas del polimorfismo de CD14, no se obtuvieron diferencias significativas. En las pruebas funcionales, no se hall asociacin directa entre los genotipos de los polimorfismos estudiados, y la respuesta celular a dexametasona y sus anlogos (ginsenoides). Se concluye que la resistencia farmacolgica a los esteroides depende de varios mecanismos de respuesta celular que, en principio, no estn directamente asociados con las variantes genotpicas de los dos polimorfismos SNP estudiados.','2009-10-21','Asma, EPOC, gen del Receptor de Glucocorticoide, gen de CD14',1,1,1,1,1,'2013-09-17 08:28:51','2013-09-17 08:28:51','Documento_269.pdf','application/pdf',9370196,'2013-09-17 08:28:51',17,0,89,'COMPLETO'),(269,'Evaluacin de la capacidad de sorcin de metano y otros hidrocarburos, por los carbones de la Formacin Cerro Pelado (Mioceno temprano), Edo. Falcn.','El presente estudio contempl como objetivos principales la capacidad de desorcin de metano por los carbones de la Formacin Cerro Pelado y su relacin con la granulometra de la muestra, as como su capacidad de adsorcin de diferentes hidrocarburos. Para ello la muestra fue sometida a un anlisis termogravimtrico a partir de cuyos resultados se obtuvieron las condiciones adecuadas para los ensayos posteriores. Posteriormente, la muestra fue triturada manualmente y tamizada en diferentes granulometras (250-1000m, 149- 250 m, 74-149 m y <74 m). Cada una de ellas fue sometida a tratamiento trmico mediante un dispositivo, que permiti medir el volumen de gas liberado por una masa conocida de muestra slida. Por otro lado, la fraccin comprendida entre 74-149 m fue utilizada para los ensayos de adsorcin, al ponerla en contacto con diferentes hidrocarburos (hexano, octano, decano, trimetilpentano, ciclohexano, y decalina), durante un tiempo de 12h, para luego separar la muestra del lquido y dejar evaporar durante el mismo tiempo. Por ultimo, la muestra fue desorbida mediante la utilizacin del dispositivo antes mencionado.La granulometra de la muestra no es un factor determinante en las mediciones de gas desorbido; sin embargo, la mayor homogeneidad de la forma grano y del proceso de desorcin se encuentra en la fraccin comprendida entre 74-149 m. Los resultados obtenidos en este trabajo sugieren que el gas contenido por unidad de masa para los carbones de la Formacin Cerro Pelado es de 2,565cm3/g, mientras que las reservas de gas, en el espacio micro y mesoporoso calculadas para la cuenca, estn en el orden de 0,014TFC, o trillones (1012) de pies cbicos. Los resultados de las pruebas indican que la adsorcin de molculas en los microporos del carbn est condicionada no slo por la forma del poro sino tambin con la interaccin de las molculas con las paredes y puntos activos dentro de los microporos. De esta manera, molculas de estructura similar como n-alcanos presentan volmenes adsorbidos similares, mientras que con el cambio de estructura de los compuestos existen restricciones. La molcula de benceno a pesar de tener un tamao considerable se adsorbe en volmenes importantes en comparacin a molculas similares pero de menor polaridad.','2009-09-07','carbn, sorcin, Cerro Pelado, Coalbed Methane, hidrocarburos.',4,1,1,1,1,'2013-09-17 08:28:53','2013-09-17 08:28:53','Documento_270.pdf','application/pdf',4697649,'2013-09-17 08:28:53',20,0,145,'COMPLETO'),(270,'DISTRIBUCIN, ABUNDANCIA Y ESTRUCTURA POBLACIONAL DEL BABO MORICHALERO (Paleosuchus palpebrosus) EN LOS LLANOS ORIENTALES DEL ESTADO ANZOTEGUI, VENEZUELA','El babo morichalero (Paleosuchus palpebrosus) est considerado uno de los cocodrilos ms pequeos y menos conocidos del mundo. El propsito de este trabajo fue evaluar la ecologa de esta especie en trminos de su abundancia poblacional, distribucin espacial y estructura poblacional, en ambientes perturbados por la explotacin petrolera al suroeste del Estado Anzotegui, a 20 km de San Diego de Cabrutica (8 24 55 N, 64 53 03 O). Los recorridos se realizaron en cuatro ros con una vegetacin de bosques siempre verdes y palmares de Mauritia flexuosa (Morichales). El clima es biestacional con un periodo de 6 meses de lluvias (mayo a octubre) y 6 meses de sequa (noviembre a abril). La temperatura media anual es 26,2 C y la precipitacin total media anual es de 890 mm. Se realizaron conteos nocturnos a pie utilizando linternas de mano y faros pilotos. Los animales avistados fueron capturados y marcados, registrando medidas corporales, sexo, peso, localidad geo-referenciada y descripcin del micro hbitat. El babo morichalero estuvo presente en todos los ros recorridos, avistndose, en 64 km. recorridos, 66 individuos, de los cuales 46 fueron capturados. La abundancia poblacional vari entre 0,28 a 2,3 individuos/ km, valores similares a las reportados en su rea de distribucin. Se reportaron mayormente densidades bajas y medias de babos morichaleros en los lechos de los ros, a excepcin de Ro Negro, donde se reportaron sectores con alta densidad, compuestas por individuos juveniles y sub-adultos. La estructura de tallas estuvo mayormente compuesta por individuos adultos, y la proporcin de sexos estuvo representada por 1,8 machos por hembra. La distribucin espacial de la poblacin del babo morichalero mostr una tendencia a un arreglo uniforme y aleatoria. En cambio, el babo morichalero y el babo comn (Caiman crocodilus), tambin presente en el rea de estudio, tienden a estar negativamente asociados en cuanto a su disposicin espacial, lo cual sugiere una relacin de competencia o depredacin entre estas especies.','2009-07-04','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:28:54','2013-09-17 08:28:54','Documento_271.pdf','application/pdf',2969756,'2013-09-17 08:28:54',19,0,117,'COMPLETO'),(271,'ELABORACIN DE HARINA DE PULPA Y CSCARA DE PLTANO VERDE CLON HARTN COMN PARA LA FORMULACIN DE UNA MEZCLA DE HARINA PARA AREPAS A BASE DE PLTANO:MAZ','Resumen En el presente trabajo se plantearon como objetivos la elaboracin de harina de la pulpa y cscara del pltano verde clon Hartnn Comnn y su caracterizacin proximal, qumica y fisicoqumica, para ser utilizada como posible sustituta de la harina de maz. En los anlisis realizados se encontr que las harinas son potencialmente utilizables, ya que son de fcil obtencin mediante un proceso muy eficiente y con altos rendimientos, lo que la hace disponible para el desarrollo de nuevos productos con una materia prima subutilizada, como es la cscara del pltano. Adems, las caractersticas nutricionales de ambos tipos de harina (pulpa y cscara), constituyen un aporte nutricional a la poblacin que consuma este producto. Se demostr que la harina de cscara aporta protena y fibra dietaria a la harina compuesta formulada, lo cual la hace un producto funcional. Se formul la harina compuesta con 80 % harina de maz, 15% harina de pulpa de pltano y 5% harina de cscara de pltano, aceptada por un panel evaluador; con la cual se elaboraron arepas. Esta proporcin usada en la harina compuesta rene las propiedades para obtener un producto como la arepa, de buena calidad y aceptacin por el consumidor.','2009-11-02','Hartn Comn, harina, harina compuesta, composicin proximal, fisico qumica y funcional.',1,1,1,1,1,'2013-09-17 08:28:56','2013-09-17 08:28:56','Documento_272.pdf','application/pdf',4194071,'2013-09-17 08:28:56',20,0,171,'COMPLETO'),(272,'NEUROANATOMAA DEL ENCFFALO DEL BAGRE SIERRA NEGRA,, Oxydoras sifontesi:: DISTRIBUCINN DE LAS NEURONAS PRODUCTORAS DE LA HORMONA LIBERADORA DE LAS GONODOTROFNNAS ((GnRH)) Y DE LOS RECEPTORES DE MELATONINA ((Mel--R))','El proceso reproductivo en los vertebrados, est regulado por el eje hipotlamo-hipfisis-gnada. El factor regulador neurohormonal de este proceso, es la hormona liberadora de gonadotropinas (GnRH), sintetizada y liberada principalmente por el hipotlamo. Debido a que la actividad reproductiva de los peces es estacional, la sincronizacin de la secrecin hormonal con el medio ambiente es un evento crtico. En este sentido, la participacin de la hormona melatonina en el control diario y estacional de estas funciones es bastante conocido en los vertebrados superiores, sin embargo, en los peces tropicales, estos sistemas no han sido estudiados. El presente trabajo representa un primer esfuerzo en la bsqueda de relaciones morfolgicas y funcionales entre la hormona melatonina y el eje reproductivo neuronendocrino en una especie de bagre de nuestra regin, conocido como \"Sierra Negra\",Oxydoras sifontesi,, (Familia Doradidae). Para ello se desarrollaron 3 objetivos especficos que en resumen buscan: describir la morfologa y la neuroanatoma del cerebro; determinar la distribucin de las neuronas productoras de la hormona liberadora de las gonadotropinas (GnRH); y de los receptores de melatonina en el encfalo del bagre, utilizando diferentes tcnicas inmunohistiqumicas. Para ello, se utilizaron las tcnicas de tincin con hematoxilina/eosina para el estudio neuroanatmico; autoradiografa de receptor utilizando como ligando radiactivo la 2-[(125)I]-yodomelatonina para la deteccin de los receptores de melatonina; y la inmunohistoqumica para localizar las neuronas inmunoreactivas a GnRH (GnRHir).Los resultados muestran una aparente colocalizacin de las neuronas GnRHir y de los receptores de melatonina en los ncleos hipofisiotrpicos hipotlamicos, as como en otras reas cerebrales involucradas en el control de la actividad reproductiva, en el procesamiento visual y en la modulacin de la conducta sexual (p.. ej., los ncleos anterioris tuberis, ncleo glomerulosus, ncleo diffusus torus lateralis, ncleo preglomerulosus y ncleo lateralis tuberis). Estas evidencias sustentan la hiptesis que la melatonina pudiera participar en la modulacin de la produccin de la GnRH en esta especie, tal y como se ha reportado en algunas especies de telesteos.','2009-10-28','telesteos, GnRH, receptores de melatonina, reproduccin, cerebro, hipotlamo.',1,1,1,1,2,'2013-09-17 08:28:59','2013-09-17 08:28:59','Documento_273.pdf','application/pdf',4100952,'2013-09-17 08:28:59',20,0,154,'COMPLETO'),(273,'Estudios de el efecto de las resinas I y II como estabilizantes de asfaltenos en solucin','El crudo est constituido segn su composicin SARA por componentes tales como: saturados, aromticos y macromolculas complejas de alto peso molecular conocidas como resinas y asfaltenos. Estos componentes se constituyen como un sistema complejo y en el cual los asfaltenos y las resinas forman la fase dispersa mientras que los maltenos (saturados, aromticos y una porcin de resinas) la fase continua o dispersante. Algunos autores han reportado la existencia de dos fracciones de resinas en el crudo, una de ellas se encuentra como parte del agregado coloidal de la fraccin asfaltnica y denominada resinas I, y la otra fraccin se encuentra en los maltenos denominada resinas II. El objetivo fundamental del presente trabajo fue el estudio del efecto dispersante de resinas I y resinas II sobre la floculacin de asfaltenos en solucin de tolueno. A partir de muestras de crudos venezolanos de diferente estabilidad, como crudo Furrial (inestable) y Carabobo (estable) se obtuvieron las muestras de asfaltenos resinas I y resinas II. El estudio del efecto estabilizador se realiz empleando un equipo de dispersin de luz, el cual es automatizado y permite determinar el umbral de floculacin de asfaltenos en solucin de tolueno, el cual se induce por la adicin de n-heptano como agente precipitante. Los resultados mostraron diferencias en el poder de estabilizacin de asfaltenos con el tipo y concentracin de resinas en la solucin. Las resinas II resultaron ser ms eficientes en la estabilizacin de los asfaltenos, siendo las resinas II provenientes del crudo estable las que mostraron un efecto mayor. La estabilizacin de asfaltenos se alcanza a partir de relacin resinas /asfaltenos superior a 1.A partir del estudio cintico ensayado a fin de evaluar las diferencias en la velocidad de agregacin aparente de los asfaltenos y su relacin con las diferencias en la participacin de las resinas I y resinas II en el mecanismo de agregacin asfaltenos, se encontr que la constante de velocidad de agregacin es mayor para el sistema resinas II - asfaltenos. La diferencia en la velocidad de agregacin permite proponer mecanismos de estabilizacin, por parte de los dos tipos de resinas, tambin diferentes. Por lo que se propone que la diferencia debe estar relacionada con el tamao y nmero de flculos, donde una fraccin de resinas modifica el mecanismo de agregacin retardando la formacin de flculos de gran tamao y el otro grupo de resinas interactan con los asfaltenos produciendo sobre sus agregados un efecto estrico, estabilizndolos an en presencia de mayor proporcin de agente precipitante.','2009-10-29','floculacin, asfaltenos, resinas.',6,1,1,1,1,'2013-09-17 08:29:03','2013-09-17 08:29:03','Documento_274.pdf','application/pdf',594323,'2013-09-17 08:29:03',18,0,57,'COMPLETO'),(274,'Estudio de la distribucin de Cd, Fe, Zn y Mn en tejido de ratas dosificadas con Cd y Zn','Estudio de la influencia del Cd y Zn sobre los niveles de Cd, Fe, Mn y Zn en tejido de hgado y rin de ratas','2009-09-11','Cd, Fe, Mn, Zn, hgado, rin y ratas',6,1,1,1,1,'2013-09-17 08:29:04','2013-09-17 08:29:04','Documento_275.pdf','application/pdf',1868828,'2013-09-17 08:29:04',19,0,164,'COMPLETO'),(275,'Estudio hidrogeoqumico de las aguas subterrneas de la Cuenca de los Valles del Tuy en el sector de Charallave--Paracotos,,Edo.. Miranda,, Venezuela','El crecimiento demogrfico, junto con el desarrollo urbanstico e industrial en el estado Miranda, especficamente en la regin de Charallave y Paracotos, han motivado el estudio de la calidad de las aguas subterrneas en funcin de su composicin qumica. Para ello, fueron captadas 22 de pozos y 3 muestras de aguas superficiales, ubicadas en ambos sectores. La evaluacin de estas aguas fue realizada mediante la medicin de los parmetros fisicoqumicos pH, temperatura, conductividad y alcalinidad, seguido de la determinacin de las especies qumicas Na+, K+, Ca2+, Mg 2+, Cl-, HCO3-, SO42- , NO3- y slice disuelta (SiO2), mediante las tcnicas de Absorcin y Emisin Atmica, Cromatografa Inica y Espectroscopia de Absorcin Atmica UV-Visible. Para la caracterizacin de las aguas fue utilizado el diagrama de Piper, la distribucin espacial, la variacin de los datos expresados en cajas grficas y relaciones interelelmentales. Asimismo, diagramas como el de Gibbs y el clculo del ndice de saturacin (IS) de algunas especies minerales, ayudaron a la interpretacin de los procesos controladores de la composicin de las aguas subterrneas. El tipo de agua identificadas para la regin de Charallave y Paracotos son bsicamente dos grupos: sulfatadas clcicas (Ca2+- SO42-) y/o magnsicas (Mg2+- SO42-) y bicarbonatadas clcicas (Ca2+- HCO3-) y/ o magnsicas (Mg2+- HCO3-). Donde procesos como la disolucin e hidrlisis de minerales como calcita y anhidrita son los que controlan la composicin de estas aguas a travs de la interaccin agua-roca. Sin embargo, existe evidencia de la influencia de las actividades antrpicas sobre las caractersticas qumicas de estas aguas.','2009-10-26','{}',4,1,1,1,1,'2013-09-17 08:29:06','2013-09-17 08:29:06','Documento_276.pdf','application/pdf',1632170,'2013-09-17 08:29:06',19,0,116,'COMPLETO'),(276,'Desarrollo del Sistema de Gestin Acadmica CONEST 2.0: Mdulo de Reportes, Constancias y Tareas en Lote','Mdulo de reportes, constancias y tareas en lote del sistema CONEST 2.0, basadas en las nuevas tecnologas Ruby 1.9, Rails 2.2 y MySQL 5.0. Las funcionalidades ofrecen una mayor usabilidad y rendimiento que las presentes en el sistema CONEST y permite el ahorro de recursos en la impresin fsica de documentos.','2009-11-02','CONEST, CONEST 2.0, Ruby, Rails, MySQL, BackgrounDRb, reportes, constancias, tareas en lote.',2,1,1,1,1,'2013-09-17 08:29:09','2013-09-17 08:29:09','Documento_277.pdf','application/pdf',1412410,'2013-09-17 08:29:09',20,0,76,'COMPLETO'),(277,'Elaboracin de harina de pltano para la formulacin de productos instantneos tipo atol con bajo y alto contenido de fenilalanina','La elaboracin de frmulas infantiles con bajo contenido de fenilalanina a base de harina de pltano verde, le ofrece a los pacientes fenilcetonricos una opcin para mantener su dieta especial. En el mercado venezolano se encuentran pocos productos dirigidos a este tipo de pacientes que, en su mayora, son importados. El uso de un insumo de produccin nacional como lo es el pltano transformado en harina para elaborar estos productos, disminuira los costos de estos alimentos y mantendra disponibilidad de los mismos en el mercado. La harina de pltano es rica en carbohidratos y fibra, por lo que se dispondra de un alimento de gran valor nutricional. Por otra parte, la formulacin de alimentos tipo atol enriquecido con leche completa sera un producto con alto contenido de protenas, que puede ser dirigido a cualquier sector de la poblacin. El objetivo de este trabajo fue desarrollar productos instantneos a base de harina de pltano verde, con baja y alta concentracin de fenilalanina. Para alcanzar los objetivos propuestos, los frutos fueron recolectados en la poblacin de Ocumare de la Costa en el estado Aragua en plantaciones asesoradas por el CENIAP-Maracay (Centro Nacional de Investigacin Agropecuaria). Se elabor la harina de pltano verde y se formularon dos productos instantneos tipo atol, con bajo contenido de fenilalanina dirigido a pacientes fenilcetonricos y con alto contenido de fenilalanina dirigido a la poblacin general. Para la caracterizacin de la harina de pltano y de los productos elaborados se realizaron anlisis fsicos y qumicos; as como pruebas de evaluacin sensorial en los productos elaborados. Se encontr que la harina de pltano precocida es un producto con bajo contenido de fenilalanina que puede ser utilizado en formulaciones para la elaboracin de productos como bebidas instantneas de buena calidad dirigido a pacientes fenilcetonricos y se demostr la factibilidad de elaborar dos productos tipo atol con bajo y alto contenido de fenilalanina.','2009-10-16','Harina, Pltano, Composicin, Atol, Instantaneo, Fenilalanina.',1,1,1,1,1,'2013-09-17 08:29:10','2013-09-17 08:29:10','Documento_278.pdf','application/pdf',1046053,'2013-09-17 08:29:10',20,0,123,'COMPLETO'),(278,'Ultraestructura de adenocarcinomas y sus efectos peritumorales en pacientes tratados con quimioterapia y radioterapia..','El cncer es una enfermedad caracterizada por la proliferacin incontrolada e inadecuada de clulas que morfolgica y funcionalmente son inmaduras y aberrantes, con capacidad para invadir los tejidos adyacentes y diseminarse a distancia. El cncer es la segunda causa de muerte en Venezuela, siendo slo superado por enfermedades del corazn. Alrededor del 40% de los tumores malignos de colon estn situados en el recto y es la tercera causa de muerte por cncer en el mundo con una tasa de incidencia 10 veces mayor en pases desarrollados que en pases en desarrollo. El cncer de colon y recto representa en nuestro pas la mayor incidencia despus de los tumores de pulmn, prstata y estmago en los hombres, y luego de cuello uterino y mama en mujeres. Ms del 95% de los tumores del recto son adenocarcinomas. Existen diferentes tipos de tratamientos para todos los pacientes con cncer del recto, utilizndose principalmente tres tipos de tratamiento estndar: quimioterapia, radioterapia y ciruga. Con este trabajo se intenta ampliar el conocimiento que sobre la ultraestructura de los tumores gastrointestinales existe actualmente, conocimiento que es importante dado la alta incidencia actual de los tumores gastrointestinales en nuestro pas. Para el logro de esta investigacin, las muestras se sometieron al procesamiento rutinario de corte fino para microscopa electrnica de transmisin. Los resultados obtenidos tanto a nivel tumoral como peritumoral en pacientes tratados y no tratados incluyeron cuadros de atrofia en clulas epiteliales y en clulas musculares lisas con incremento significativo de vacuolas autofgicas, degeneracin con subsiguiente necrosis tanto en clulas musculares lisas como en la inervacin amielnica y en algunos infiltrados celulares. An cuando los capilares mostraron diferentes alteraciones (engrosamiento del endotelio, prolongaciones del mismo hacia la luz del vaso, oclusin de la luz, engrosamiento y reduplicacin de membrana basal), en los mismos no se observ necrosis. Por su parte, en el rea tumoral, en pacientes tratados se localizaron cuadros apoptticos, pudiendo ello estar relacionado con un efecto beneficioso del tratamiento antineoplsico, dada la relacin inversa que existe entre apoptosis y malignidad. Sin embargo, la similitud en el grado de alteracin de otras estructuras celulares y extracelulares perecen sugerir que el tratamiento por lo menos no elimin del todo los efectos del tumor ni los peritumorales. Estos resultados apoyan a otras investigaciones en el sentido de que los tejidos que rodean a diferentes tipos de tumores primarios no son normales, siendo sumamente importante estudiar su ultraestructura para un mejor conocimiento del proceso tumoral.','2009-07-08','Cncer colorrectal, alteraciones ultraestructurales',1,1,1,1,1,'2013-09-17 08:29:11','2013-09-17 08:29:11','Documento_279.pdf','application/pdf',763185,'2013-09-17 08:29:11',19,0,92,'COMPLETO'),(279,'Efecto de la mezcla Resina cruda/TOFA sobre la formacin de Macroemulsiones de aceite en agua (O/W) y sus propiedades como fluido de completacin de pozos.','La industria petrolera emplea una variedad de surfactantes que son utilizados para la formulacin de fluidos de perforacin, completacin y rehabilitacin de pozos, estos aditivos en su mayora son importados y aaden un valor agregado en la formulacin de dichos fluidos. Durante los ltimos aos en nuestro pas se han venido estudiando alternativas para disminuir la dependencia de estos aditivos y poder formular nuestros propios fluidos con materia prima nacional. Para lograr este objetivo se ha propuesto emplear como surfactante natural una resina cruda extrada de las cortezas de pino caribe de Uverito proveniente de las plantaciones de CVG - Proforca, y una mezcla de cidos grasos y su sal, mejor conocida como TOFA, siendo esta ultima importada. El alcance de esta investigacin se basa en emplear una mezcla surfactante Resina cruda/ TOFA para la formacin de emulsiones (O/W), de manera de crear un efecto sinergstico que mejore las propiedades del fluido y tenga potencial aplicacin en la completacin de pozos. Para ello se evaluaron formulaciones con distintas relaciones RC/TOFA, concentraciones de sal, para concentraciones de la mezcla en 1,5 y 2 % p/p, en pruebas de estabilidad esttica, dinmica, comportamiento reolgico, diferentes interacciones en pruebas de compatibilidad y finalizando con un estudio completo en pruebas de desplazamiento del tipo dinmico y semidinmico, empleando crudo Urdaneta del pozo UD-300. Se obtuvieron emulsiones con dimetros de gotas menores a 10 m siendo estables a 40C solo para las relaciones de RC/TOFA 75/25 en ambas concentraciones de la mezcla estudiada, tolerando temperaturas de envejecimiento hasta 250F (121 C) para formulaciones con 1% p/p de KCl. Con esto se concluye que la mezcla surfactante RC/TOFA origina una sinergia positiva incrementando la estabilidad de las emulsiones de aceite Biodoil en agua ((O/W)) y obtenindose bajos daos a la formacin, ubicando a este fluido como candidato potencial para su aplicacin en las reas de completacin de pozos petroleros en nuestro pas.','2009-10-26','resina cruda, emulsiones, TOFA, fluidos de completacin',6,1,1,1,1,'2013-09-17 08:29:13','2013-09-17 08:29:13','Documento_280.pdf','application/pdf',6041275,'2013-09-17 08:29:13',20,0,157,'COMPLETO'),(280,'Soluciones polinomiales de la ecuacin en diferencias de tipo hipergeomtrica','{}','2009-06-29','{}',5,1,1,1,1,'2013-09-17 08:29:15','2013-09-17 08:29:15','Documento_281.pdf','application/pdf',1993922,'2013-09-17 08:29:15',20,0,139,'COMPLETO'),(281,'IDENTIFICACION DEL COMPUESTO PRESENTE EN EL EXTRACTO DE BAUHINIA MEGALANDRA,, RESPONSABLE DE LA INHIBICION DE LA ABSORCION INTESTINAL DE GLUCOSA','Uno de los principales factores que incrementan la glicemia se encuentra la absorcin intestinal de glucosa, por lo cual el reducir la misma, pudiera ser un factor importante para disminuir la hiperglicemia en pacientes diabticos. Paralelamente se demostr que el extracto metanlico de las hojas de B.. megalandra inhiba la absorcin intestinal de glucosa, por lo cual en el presente trabajo se plante la identificacin del compuesto presente en el extracto de B.. megalandra responsable de la inhibicin de la absorcin intestinal de glucosa. Se fraccion el extracto metanlico de las hojas de B.. megalandra guiado por bioensayos, empleando un fraccionamiento con diferentes solventes y por cromatografa en contracorriente. Por el uso de dicha metodologa se obtuvo dos compuestos puros los cuales fueron identificados por RMN-[1H] y RMN-[13C] como kanferol 3-O-a-ramnosido y quercetina 3-O-a-ramnosido. El primero de los cuales vari significativamente el valor de KMde 38,93 mM, para el control, a 67,24 mM y sin un cambio significativo para el valor de VMAX. Adems se demostr que el kanferol 3-O-a- ramnosido ejerci un efecto sinrgico al combinarlo con floricina, por lo cual sugerimos que el kanferol 3-O-a-ramnosido tiene como blanco al cotransportador SGLT1.','2009-09-03','Bauhinia megalandra, absorcion intestinal de glucosa, transportador SGLT1, flavonoides.',1,1,1,1,1,'2013-09-17 08:29:18','2013-09-17 08:29:18','Documento_282.pdf','application/pdf',3228956,'2013-09-17 08:29:18',18,0,105,'COMPLETO'),(282,'La funcionalidad de los linfocitos T CD44++ anti--VIH y anti-- Toxoplasma gondii en pacientes VIH++y seropositivos a Toxoplasma gondii','La infeccin con el Virus de Inmunodeficiencia Humana (VIH) conduce a una alteracin marcada del sistema inmunitario de pacientes en etapas avanzadas de la infeccin, lo cual conlleva, entre otros fenmenos, a una eliminacin de linfocitos T CD4+ y a un desbalance entre las respuestas de citocinas tipo Th1 y Th2, conduciendo a la aparicin de infecciones oportunistas. Una de estas infecciones ms frecuentes asociadas a la inmunodeficiencia con VIH, es la Toxoplasmosis causada por un protozoario obligatorio intracelular denominado Toxoplasma gondii. Cabe destacar que en personas inmunocompetentes, la infeccin por T.. gondii es latente, generalmente asintomtica, no obstante, la inmunodeficiencia causada por la infeccin con VIH puede conllevar a una reactivacin de la infeccin parasitaria, desarrollando graves afecciones a nivel del sistema nervioso central. En pacientes co-infectados con VIH+/Tx+ con un mayor progreso de la infeccin viral, los bradizotos pueden reactivarse y manifestarse una encefalitis toxoplsmica. En nuestros estudios nos interes evaluar si la progresin de la infeccin viral afectara a la respuesta del linfocito T CD4 contra T.. gondii generando una mayor inmunodeficiencia, por lo que pudiese influir en la clnica de los pacientes VIH+ con serologa positiva. Estudiamos la funcin de los linfocitos T CD4+ de pacientes VIH+ con serologa positiva para T.. gondii, en diferentes estadios de la infeccin viral, buscando una mejor comprensin de los mecanismos inmunopatolgicos que estn afectando al cuadro de co- infeccin. Los resultados de los ensayos ex vivo observamos mayores alteraciones en la expresin de ciertas molculas que relacionan con la muerte/ supervivencia y funcionalidad de linfocitos TCD4 de pacientes co-infectados en relacin a los infectados por VIH solamente, lo cual, pudiese explicar el por qu aquellos pacientes co-infectados ms inmunodeficientes (<200 CD4/ml) presentaron valores menores de clulas TCD4+ en sangre en relacin a pacientes a pacientes VIH+ ms inmunodeficientes (<200 CD4/ml). Cabe destacar que este grupo de pacientes co-infectados ms inmunodeficientes presentaron una tendencia mayor de carga viral en comparacin a los pacientes ms inmunodeficientes, infectados solamente con el virus, la cual indica que este parmetro puede estar jugando tambin un papel fundamental en la disminucin de niveles sanguneos de clulas TCD4,. , Por otra parte, se encontr que los pacientes co-infectados presentaron a un valor similar de la frecuencia de apoptosis o muerte celular en clulas TCD4+ sanguneas en relacin a los grupos de pacientes VIH, a pesar, que presentaron una mayor sobre-expresin de las molculas Fas/CD95, HLA-DR y PD-1 y una menor expresin de IL-7a en los linfocitos TCD4 totales, vrgenes y memoria, particularmente de los pacientes co-infectados ms inmunodeficientes con respecto a los pacientes VIH. Finalmente, en referencia a los mecanismos efectores de los linfocitos T CD4, se encontr que la capacidad de proliferacin con estimulacin mitognica (PHA) se perdi parcialmente en los grupos de pacientes. En presencia de antgenos T.. gondii, los pacientes VIH/Tx+ an no han perdido esa respuesta proliferativa especifica al protozoario pero hay una tendencia a disminuir en presencia de la infeccin viral. En presencia o estimulacin especfica a antgenos del virus, los pacientes VIH estaba significativamente ms perdida la respuesta de proliferacin vs los pacientes co-infectados, indicando que la respuesta anti- VIH por los linfocitos T CD4 es afectada por la infeccin viral, mientras que la co-infeccin pareciera ejercer un efecto menos drstico en tal prdida de clones anti-VIH. Todos estos resultados pueden estar ocasionando importantes efectos sobre la inmunidad contra el parsito, ocasionando en aquellos pacientes realmente infectados por T.. gondii en un futuro, una reactivacin de la infeccin parasitaria que puede establecer una cuadro de encefalitis, generalmente letal.','2009-10-23','VIH, Toxoplasma gondii, linfocito TCD4, apoptosis, receptores, activacion, co- infeccin.',1,1,1,1,1,'2013-09-17 08:29:20','2013-09-17 08:29:20','Documento_283.pdf','application/pdf',4192458,'2013-09-17 08:29:20',19,0,121,'COMPLETO'),(283,'Desarrollo de una Aplicacinn Adaptativa para el Control de Prstamo de los Equipos del Centro de Computacinn','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicacin para el control de prstamos de los equipos del Centro de Computacin de la Facultad de Ciencias de la UCV. Dicha aplicacin es adaptativa, es decir que su interfaz de usuario (basada en tecnologa Web) se puede visualizar tanto en un computador de escritorio como en un dispositivo mvil pequeo. El documento comienza con el estudio terico de todos los conceptos necesarios que se tomaron en cuenta para el desarrollo de este proyecto. La metodologa utilizada para la implementacin consiste en una metodologa iterativa adaptada al modelo de desarrollo gil, donde una iteracin refleja el proceso de creacin de un mdulo de la aplicacin. La tecnologa utilizada para el desarrollo de la aplicacin incluye el servidor Web Apache versin 2.2.8, el lenguaje de programacin PHP versin 5.2.5 y el servidor de base de datos MySQL versin 5.0.51a. Cabe destacar que todas estas herramientas utilizadas son open source (cdigo abierto). La aplicacin desarrollada es capaz de adaptarse a diferentes dispositivos, ofreciendo a los usuarios todas las funciones independientemente del dispositivo que se utilice, donde la nica diferencia percibida es la interfaz. Las principales funciones de la aplicacin consisten en registrar la entrada y salida de los equipos del Centro de Computacin, para as tener un mejor control de estos.','2009-09-15','Redes,, Dispositivos Inalmbricos,, Dispositivos Mvviles,, Web Mvvil,, PDA,, Web,, PHP,, MySQL',2,1,1,1,1,'2013-09-17 08:29:21','2013-09-17 08:29:21','Documento_284.pdf','application/pdf',3889705,'2013-09-17 08:29:21',12,0,130,'COMPLETO'),(284,'SNNTESIS DE POLIESTIRENO Y POLI ((METIL METACRILATO)),, EMPLEANDO CATALIZADOR DEL TIPO a-- DIIMINA DE COBRE,, A TRAVSS DE POLIMERIZACINN VAA RADICAL POR TRANSFERENCIA ATMMICA ((ATRP))','En el presente trabajo se sintetiza el complejo a-diimina de cobre: Diacetilbutil-(2,4,6-trimetil-fenil)iminacobre (I) partiendo del ligando Diacetilbutil-(2,4,6-trimetil-fenil)imina y cloruro de cobre (I), con el propsito de ser empleado como catalizador en la sntesis de poli (metil metacrilato) (PMMA), con cloruro de bencenosulfonilo como iniciador (en fase homognea) y tolueno como solvente. Los resultados experimentales muestran que es posible la reaccin de ATRP del metil metacrilato (MMA) con los reactivos mencionados, siendo la mejor condicin experimental de polmerizacin la combinacin de (0,0005  0,0001) mmol de catalizador y (0,34  0,06) mmol de iniciador; asimismo se registra mayor cantidad de polmero a la temperatura de 40 C. Se percibe que para aquellos procesos donde el catalizador es generado \"in situ\" partiendo de cantidades equimolares (0,0005  0,0001) mmol de sal de cobre y ligando, la productividad de PMMA es mucho menor; sin embargo, anlogo a lo anterior el parmetro de temperatura favorece la reaccin. De forma adicional y a manera de comparacin, se efectan reacciones con la amina bidentada N,N,N,N-tetrametiletilendiamina y cloruro de cobre (I) bajo las condiciones planteadas para el catalizador a-diimina, en donde no se genera producto para cada uno de los casos.','2009-10-29','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',6,1,1,1,1,'2013-09-17 08:29:22','2013-09-17 08:29:22','Documento_285.pdf','application/pdf',2581041,'2013-09-17 08:29:22',20,0,172,'COMPLETO'),(285,'DETERMINACION DE ELEMENTOS TRAZA EN SUERO SANGUINEO DE SUJETOS SANOS, CON HIPERPLASIA PROSTATICA Y CON CANCER PROSTATICO, POR ESPECTROMETRIA DE EMISION OPTICA CON PLASMA INDUCTIVAMENTE ACOPLADO.','En el presente trabajo se estudiaron las concentraciones de Cu, Zn y Se en suero sanguneo de pacientes sanos, con hiperplasia prosttica benigna y cncer de prstata por espectrometra de emisin atmica con plasma inductivamente acoplado. Se analizaron 97 muestras tomadas en pacientes del Hospital Clnico Universitario de Caracas de individuos de diferentes edades, de las cuales 15 fueron de pacientes sanos, 61 con hiperplasia benigna prosttica, y 21 sufran de cncer de prstata. Se encontr que el Cu est presente en menores cantidades en pacientes sanos que en pacientes con hiperplasia prosttica o con cncer. Para el Se, se observ que ste ejerce un efecto protector ya que su concentracin es mayor en personas sanas que en personas con hiperplasia prosttica, y a su vez est en mayores proporciones en este ltimo grupo que en personas con cncer. Para el Zn se observ una dbil variacin en su comportamiento, sin embargo no se determin que existan diferencias estadsticamente significativas en sus valores de concentracin en los tres grupos. Se encontraron correlaciones en los valores de las relaciones de concentraciones Cu/Zn, Se/Cu y Se/Zn de pacientes sanos, con hiperplasia prosttica y con cncer de prstata. La relacin Cu/Zn, disminuye en pacientes sanos con respecto a pacientes con cncer. La relacin Se/Zn disminuye en pacientes con cncer con respecto a los individuos sanos. La relacin Se/Cu es la ms sensible de las tres relaciones estudiadas, debido a que las concentraciones de Se y Cu presentan mayores variaciones entre los tres grupos.','2009-10-30','Elementos Traza, Cncer, Cncer de Prstata, Hiperplasia Prosttica, Niveles de elementos traza en suero humano',6,1,1,1,1,'2013-09-17 08:29:23','2013-09-17 08:29:23','Documento_286.pdf','application/pdf',2231638,'2013-09-17 08:29:23',18,0,177,'COMPLETO'),(286,'Organizacin, Gestin y Anlisis de Datos de Levantamiento de Suelos Mediante un Agente de Software','Uno de los principales problemas encontrados en el proceso de levantamiento de suelos, est relacionado con la manera de organizar la informacin que se genera relativa a los suelos, debido a las distintas fuentes de informacin que son utilizadas tales como imgenes satelitales, levantamiento de suelos, resultados de distintas pruebas de laboratorio, entre otros. Esta falta de organizacin dificulta el almacenamiento y posterior ubicacin de manera rpida y concisa de la informacin por parte de los investigadores. Con el fin de apoyar a los edaflogos en el estudio de suelos, toma de decisiones sobre el uso apropiado de este recurso y realizar predicciones ms precisas sobre usos especficos de ellos, este anlisis permite su clasificacin determinando as su disponibilidad en calidad, cantidad y distribucin. En este trabajo se propone un agente de software que gestione y almacene los datos inherentes a los perfiles de suelos; siendo este el ncleo de un Sistema Basado en Agentes (SBA) que apoye a los profesionales de agronoma en sus labores rutinarias de captura, gestin y clasificacin de la informacin. Este sistema permitir gestionar la informacin relacionada con los aspectos propios del suelo y otras variables geogrficas de un espacio particular, mediante la carga de informacin y consultas complejas que permitirn al usuario descifrar de manera ms simple todo lo relacionado con los suelos, indicando sus potencialidades y limitaciones ms importantes, as como, la superficie que ellos ocupan y donde se ubican los que poseen ciertas caractersticas particulares. Durante el desarrollo del Sistema de Software se realizaron diversas investigaciones sobre las metodologas ms utilizadas para el desarrollo de Sistemas Basado en Agentes. Se aplic la metodologa MAS-CommonKADS, debido a que esta posee herramientas para determinar todos los elementos que interactan junto a sus relaciones, lo cual permite poder identificar de forma precisa los actores activos y pasivos. Por esto, al usar esta metodologa se logro disear un modelo de Sistema Multi-Agentes el cual sirvi de gua durante todo el desarrollo y posteriormente formular los objetivos que llevaron a la mejor solucin mediante la elaboracin de requisitos.','2009-10-30','MAS-CommonKADS, Multi-Agentes, Suelos, Gestionar, Software.',2,1,1,1,1,'2013-09-17 08:29:27','2013-09-17 08:29:27','Documento_287.pdf','application/pdf',1251071,'2013-09-17 08:29:27',19,0,104,'COMPLETO'),(287,'MODELADO DE LA INTERACCINN DE RADICALES LIBRES SOBRE SUPERFICIES DE HIDROCARBUROS POLIAROMTTICOS ((PAH))..','En este trabajo se modela, usando el mtodo cuntico paramtrico MINDO/SR incluido en el paquete CATIVIC, la interaccin qumica de las especies radicales (adsorbatos) metileno (CH2o), metilo (CH3o), amino (NH2o) e hidrxilo (OHo), sobre un modelo de coroneno cargado positivamente (sustrato). Este ltimo tiene hidrogenado todos los tomos de carbono externos para saturar los bordes, adems tiene quimisorbidos sobre la superficie tomos de hidrgeno. A travs, de la metodologa planteada en el paquete CATIVIC, se determin la formacin de las especies sustrato-adsorbato (S-A), para cada uno de los radicales nombrados anteriormente, se obtiene que es posible la formacin de especies S-A tales como [Coro-H-CH2]+, [Coro-H-NH2]+ y [Coro-H-OH]+, las cuales interaccionan a travs de uno o dos enlaces, en estructuras de tipo puente. Tambin se estudi la formacin de las especies moleculares metilo (CH3o), metano (CH4), amoniaco (NH3) y agua (H2O), a partir de la interaccin, a travs del mecanismo Eley-Rideal (ER), de los radicales CH2o, CH3o, NH2o yOHo, sobre los hidrgenos quimisorbidos en la superficie del sustrato. De igual manera, se estudi la formacin de las mismas especies moleculares, a partir de intermediarios encontrados en este trabajo, a travs del mecanismo Langmuir- Hinshelwood (LH). Se encuentra que la va ms adecuada para formar estas especies, es la va ER. Adems a lo anterior se hall que es posible la formacin de metilamina y metanol a partir de la reaccin, va ER, de la especie radical libre CH3o con un intermediario en el cual estn adsorbidos el NH2o y el OHo sobre el sustrato.','2009-07-13','Hidrocarburos poliaromticos, radicales libres, adsorbato, sustrato y mtodos cunticos paramtricos.',6,1,1,1,1,'2013-09-17 08:29:28','2013-09-17 08:29:28','Documento_288.pdf','application/pdf',0,'2013-09-17 08:29:28',19,0,0,'INCOMPLETO'),(288,'DETERMINACINN DE LA FACTIBILIDAD DEL SISTEMA ARN ANTISENTIDO COMO HERRAMIENTA DE ANLLISIS GENTTICO EN Trypanosoma rangeli,, ACOPLADO AL SISTEMA DE EXPRESINN CONDICIONAL DE GENES ARNpT77//TetR..','Los tripanosomtideos constituyen una familia de protozoos que incluye parsitos de importancia mdica y veterinaria, entre los cuales se encuentran Trypanosoma cruzi, Trypanosoma brucei, y las diferentes especies de Leishmaniacausantes de diversos cuadros clnicos en humanos. Dentro de la familia del orden Kinetoplastida se encuentra Trypanosoma rangeli, parsito que infecta a humanos sin patologas asociadas a la infeccin en el hospedador vertebrado, el cual comparte con T.. cruzi hospedadores vertebrados e invertebrados, reservorios y en consecuencia la distribucin geogrfica en el continente Americano. Ambos protozoarios han sido utilizados como modelos experimentales, para conocer y entender los distintos mecanismos que operan en los sistemas de interaccin parsito-hospedador a nivel molecular. Para este abordaje molecular se han desarrollado herramientas genticas, particularmente vectores de expresin especficos para tripanosomatdeos, permitiendo generar el fondo gentico necesario para la produccin condicional de ARN antisentido y ARN de interferencia (ARNi) in vivo. Basados en el conocimiento existente de los sistemas inducibles en Tripanosomatideos y la efectividad de la metodologa del ARNi y ARN antisentido para la inactivacin funcional de genes en T.. brucei y Leishmania,, en el Laboratorio de Gentica Molecular nos hemos planteado determinar la factibilidad del sistema ARN antisentido en T.. rangeli,, acoplado a un sistema de expresin condicional de genes utilizando los vectores pLew13 y pTcIndex. La estrategia de trabajo planteo la construccin de lneas estables de T.. rangeli mediante la insercin de pLew13 lineal en el genoma, mediada por recombinacin homloga de la regin b tubulina presente en el vector. Contrario a lo esperado, el anlisis del Southern blot determin la ubicacin episomal del vector pLew13 en los clones 1, 3 y 4, sin embargo el anlisis por Western blot determin la expresin estable del gen ARNpT7 en estas tres lneas. La evaluacin preliminar de la organizacin de la tanda a- b tubulina en T.. rangeli demostr la existencia de un polimorfismo en el sitio HindIII, presente en el gen de a tubulina de la cepa venezolana Triat-1, similar al reportado por Esquenazi y colaboradores (1989) en un aislado venezolano, y ausente en una cepa del amazonas, abriendo la posibilidad de utilizar este marcador para diferenciar los grupos poblacionales descritos en T.. rangeli (Da Silva y col., 2007). La evaluacin del sistema ARN antisentido planteo el clonamiento dirigido del gen de a tubulina de T.. rangeli sentido y antisentido en el vector pTcIndex-RFP, utilizando los sitios XbaI y BamHI y partiendo del aislamiento del gen de los recombinantes pTrTriatalfatub 3 y pTrTriatalfatub 4. La verificacin de los sitios XbaI y BamHI en pTcIndex-RFP demostr la presencia de sitios nicos de corte en posiciones espaciadas por 1600 pb, impidiendo su utilizacin para este clonamiento. En la actualidad planteamos el clonamiento dirigido del gen a tubulina en ambos sentidos en el vector pTcIndexI, utilizando los sitios NotI/BamHI. La transfeccin de pTcIndexatub en lneas T.. rangeli Triat-1[pLew13], permitir evaluar la presencia del sistema ARN antisentido en T.. rangeli, permitiendo as la utilizacin de esta herramienta en el anlisis gentico mediante Knock out funcionales.','2009-10-15','Trypanosoma rangeli, ARN antisentido, pLew13, pTcIndex, sistema inducible, Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0',1,1,1,1,1,'2013-09-17 08:29:30','2013-09-17 08:29:30','Documento_289.pdf','application/pdf',10685459,'2013-09-17 08:29:30',19,0,101,'COMPLETO'),(289,'Efecto de emulsiones asflticas sobre la estructura comunitaria microbiana en microagregados de un suelo de sabana','En las ltimas dcadas, los volumnes de uso del asfalto en forma de emulsiones asflticas han sido grandes debido a su bajo costo, a las propiedades de hidrofobicidad y a la relativa resistenca a la intemperie (Talavera et al, 2001). Los efectos sobre el ambiente, en particular, sobre el estado de agregacin de las particulas del suelo y la comunidad microbiana en suelos de sabana han sido poco estudiados en el mbito nacional (Casanova, 1991). Sin embargo, investigaciones llevadas a cxabo a nivel internacional, han demostrado que las emulsiones asflticas o bituminosas, incrmenetan la temperatura del suelo en climas fros, preservan la humedad del suelo en pocas de sequa, y mejoran la estructura del suelo (Jiuzhi et al, 1985). En Venezuela, cerca de un tercio del territorio nacional esta asociado a los ecosistemas de sabana. Estas se caracterizan por ser ecosistemas herbceos tropicales con un estrato arbreo ms o menos uniforme o escaso algunas veces. (Sarmineto, 1990). Por otro lado, la marcada bioestacionalaidad entre pocas de lluvia y de sequa, han generado una alta meteorizacin del componente suelo, generando suelos de baja fertilidad natural por contener poco aporte de materia orgnica (vegetacin herbcea), adems de presentar un elevado ndice de lavado de bases ibntercambiables, torenando a estos suelos cidos y de poca estructura. En el presente trabajo se evalu el efecto de emulsiones aasflticas sobre la estructura de suelos arenosos cidos proveniente de las sabanas orientales de Pariagun y su efecto sobre la estructura comunitaria microbiana asociada a microagregados. Los resultados mostraron que la estructura comuinitaria no es alterada significativamente por la presencia de estas emulsiones (p=0.05). mientras que la estructura se estabilizo y en algunos casos se incrment el porcentaje de agregados en >10 % en suelos tratados con emulsin.','2009-09-04','Comunidad microbiana, emulsiones asflticas, agregados, suelos de sabana',1,1,1,1,1,'2013-09-17 08:29:31','2013-09-17 08:29:31','Documento_290.pdf','application/pdf',576341,'2013-09-17 08:29:31',17,0,66,'COMPLETO'),(290,'Evaluacin de mtodos para la preservacin de cepas bacterianas de uso frecuente como control en microbiologa de alimentos','RESUMEN Uno de los principales problemas en la mayora de los laboratorios de microbiologa es la preservacin de las cepas bacterianas que se mantienen como muestras de referencia o control para los mltiples ensayos o pruebas inherentes a la actividad microbiolgica. Centrndonos en esto, es necesario evaluar para disponer de un mtodo sencillo, econmico, el cual no requiera de procesos complejos y equipos sofisticados, aplicable en cualquier laboratorio de microbiologa, que sea capaz de permitir la versatilidad en cuanto a tipos microbianos a ser preservados, as como tambin mantener la viabilidad de los microorganismos el mayor tiempo posible y en general, ajustado a los criterios inicialmente sealados para un buen mtodo de preservacin. Fue evaluada y comparada la efectividad de tres mtodos de preservacin aplicada sobre cuatro microorganismos donde las caractersticas estudiadas fueron viabilidad y pureza durante un tiempo de preservacin para as establecer el o los mtodos ms efectivos basado en el anlisis de dichas caractersticas. El resultado obtenido fue que cada microorganismo analizado mostr las mismas caractersticas bioqumicas y morfolggicas en cada uno de los mtodos aplicados,, por lo que se puede afirmar que ninguno de los tres mtodos de preservacinn aplicados durante el tiempo de estudio causa un estrs lo suficientemente fuerte en las cepas como para dar origen a un cambio sensible a nivel bioqumico y fenotpico,, adems se deduce que no hubo contaminacinn de las cepas en ninguno de los procesos aplicados..','2009-07-16','mtodos,preservacin, microbiologa,alimentos',1,1,1,1,1,'2013-09-17 08:29:32','2013-09-17 08:29:32','Documento_291.pdf','application/pdf',1645405,'2013-09-17 08:29:32',18,0,80,'COMPLETO'),(291,'Evaluacin fsica, qumica y biolgica de un suelo de sabana mezclado con una emulsin asfltica sembrado con la especie vegetal: Urochloa brizantha','Con la finalidad de estudiar el efecto de una emulsin asfltica en las propiedades fsicas, qumicas y biolgicas de un suelo de sabana moderadamente cido sembrado con la especie Urochloa brizantha, mediante la realizacin de dos ensayos. En el primero se determino el tipo de emulsin asfltica (catinica y aninica) y la dosis que origino cambios fsicos, qumicos y biolgicos en el suelo favorables para el crecimiento de la especie vegetal. Para ello, se utilizaron 13 tratamientos de suelo: control, 0,5; 1,0; 1,5; 2,0; 2,5; 3,0 %p/p EA y 0,5; 1,0; 1,5; 2,0; 2,5; 3,0 %p/p EC. Las emulsiones se aplicaron mecnicamente sobre el suelo, y los microcosmos fueron estudiados por un perodo de 30 das, bajo condiciones de invernadero. Los resultados de las propiedades fsicas y qumicas no arrojaron cambios importantes en el suelo, en cambio, la actividad biolgica, empleando como indicador la actividad de la enzima deshidrogenasa (ADH), mostr que el 3,0 %p/p EC present diferencias significativas con la mayora de los tratamientos (p<0,05), exhibiendo el valor ms elevado (82,24 g/g suelo) de la serie. En funcin de que la actividad microbiolgica del suelo afecta directamente su fertilidad, se selecciono la emulsin catinica a una concentracin de 3,0 %p/p, para la realizacin de la segunda parte del diseo experimental. En el segundo ensayo se compararon 6 tratamientos: T0: suelo control; T1: suelo + 3 %p/p emulsin + T2: suelo + 3 %p/p emulsin + fertilizante ; T3: suelo + 3 %p/p emulsin + 10 %p/p estircol de aves; T4: suelo + 3 %p/p emulsin + 10 %p/p de estircol de aves + fertilizante; T5: suelo + 3 %p/p emulsin + cal, en presencia de Urochloa brizantha. Los microcosmos fueron evaluados por un perodo de 120 das, bajo condiciones de invernadero, con un muestreo inicial y a los 30, 60 y 120 das. Los resultados obtenidos sugieren que la gramnea tolera la concentracin 3,0 %p/p de la emulsin catinica y adems favorece su produccin de biomasa seca total. Con respecto a las propiedades fsicas, los tratamientos T3 y T4 presentaron diferencias significativas en el contenido de humedad con los dems tratamientos (p<0,05) a 120 das de estudio, debido a que el acondicionador orgnico se caracteriza por su capacidad de absorber agua, evitando as su rpida evaporacin en el suelo. La estabilidad de los agregados no mostr diferencias significativas en los tratamientos al finalizar el estudio. En cuanto a las propiedades qumicas, se observ diferencias significativas en el pH del suelo en los tratamientos en comparacin con el suelo control a 120 das de ensayo (p<0,05), lo cual demuestra que la emulsin por su carcter cido, podra estar confirindoles protones a la solucin del suelo, provocando la disminucin del pH. La conductividad elctrica (CE), el contenido de cloruros (Cl-) y de fsforo disponible, bases intercambiables (BI), capacidad de intercambio catinico (CIC), saturacin con base (%SB) y relacin de adsorcin de sodio (RAS) no mostraron cambios significativos en el tratamiento T1 con respecto al suelo control para el tiempo de estudio. El contenido de los hidrocarburos biodegradables (saturados y aromticos) disminuy en el tiempo, en relacin a los tratamientos que presentan estircol y fertilizacin, debido a la incorporacin de nutrientes al suelo. En el caso de los tratamientos donde se favoreci la produccin de biomasa (T1, T2 y T5), presentan una reduccin en el contenido de aceites y grasas y de las concentraciones de los metales Ba y Zn principalmente, con respecto a los resultados obtenidos para el diseo experimental sin planta para 120 das de estudio. Por otra parte, la actividad biolgica, empleando como indicador la actividad de la enzima deshidrogenasa (ADH) y respiracin edfica (CO2), se increment en los primeros 30 das de estudio con respecto al control (suelo sin emulsin) y luego al decrecer la concentracin de los hidrocarburos biodegradables, se observ una disminucin gradual en el tiempo, destacndose que el tratamiento T4present la mxima actividad de los microorganismos en el suelo.','2009-10-30','Suelo de sabana; Emulsin asfltica; Urochloa brizantha',6,1,1,1,1,'2013-09-17 08:29:33','2013-09-17 08:29:33','Documento_292.pdf','application/pdf',4165339,'2013-09-17 08:29:33',19,0,76,'COMPLETO'),(292,'Estudio del Mecanismo de Hidrodesclorinacin Cataltica por intercambio Deuterio-Hidrgeno empleando un catalizador bimetalico Ni-Mo soportado','RESUMEN..Los bifenilos policlorados (BPC), son el nombre genrico dado a una clase de compuestos organoclorados. Se estima que debido al gran empleo de los BPC a nivel mundial, el 40% se ha introducido al ambiente. En la actualidad, existen diversos mtodos para la eliminacin de los BPC, siendo el hidrotratamiento cataltico el mtodo reductivo ms adecuado, el cual utiliza catalizadores para extraer progresivamente los cloros de dicha molcula, generando productos de menor grado de toxicidad. El presente trabajo se basa en el estudio del mecanismo superficial de la Hidrodesclorinacin y cuyo seguimiento se realiz empleando deuterio. El cual nos proporcion la herramienta necesaria para dar la ubicacin y procedencia del hidrgeno que sustituye los cloros extrados de las molculas organocloradas. Para ello se propuso examinar el rol del hidrgeno en el mecanismo superficial de la hidrodesclorinacin de compuestos organoclorados (clorobenceno y Aroclor 1260), por intercambio hidrgeno-deuterio, usando catalizadores soportados de nquel (Ni) y nquel-molibdeno (Ni-Mo). En la determinacin del mecanismo se emplearon clorobenceno y Aroclor 1260 utilizando etanol como solvente. El deuterio se utiliz, para entender y determinar el papel del hidrgeno dentro de la hidrodesclorinacin (HDCl). Para ello se utiliz un agente reductor deuterado (LiAlD4), a fin de seguir la reaccin superficial y poder promover el papel del hidrgeno dentro del mecanismo de HDCl. Tratando de explicar la reaccin de HDCl del Aroclor 1260, se emple clorobenceno como molcula modelo sencilla. Para este estudio se emplearon catalizadores de nquel y nquel-molibdeno soportados sobre g-almina, que fueron caracterizados mediante rea Especfica por el mtodo BET, Difraccin de Rayos X (DRX) y Resonancia Magntica Nuclear en estado slido (2D-MAS-RMN). De aqu se propone que el mecanismo de reaccin ocurre va sinergia de contacto. El presente trabajo muestra la importancia del modelo de Control Remoto y el rol que juega en la sinerga hacia la HDCl de bifenilos policlorados. Desde el punto de vista fundamental, los resultados permiten avanzar en la comprensin del mecanismo de spill-over del hidrgeno. En una primera aproximacin, los resultados obtenidos empleando deuterio indican cierta facilidad para disociarse, adsorberse y migrar sobre la superficie. Por otra parte, este trabajo muestra la existencia de sinerga entre las fases de sulfuro de nquel y sulfuro de molibdeno en la reaccin de hidrodesclorinacin de Aroclor 1260.','2009-10-27','Hidrodesclorinacin, Deuterio,Hidrgeno, Ni-MO',6,1,1,1,1,'2013-09-17 08:29:35','2013-09-17 08:29:35','Documento_293.pdf','application/pdf',1464313,'2013-09-17 08:29:35',18,0,109,'COMPLETO'),(293,'ESTUDIO DE LA DISTRIBUCIN DE Cd, Fe, Mn y Zn EN RGANOS DE RATASTRATADAS CON Cd Y Zn','Estudiar la influencia que ejerce el suministr de Cd y Zn sobre los niveles de Fe, Cd, Mn y Zn en tejido de hgado y rin de ratas','2009-09-11','Fe, Cd, Mn y Zn, elementos traza, higado y rin de ratas',6,1,1,1,1,'2013-09-17 08:29:36','2013-09-17 08:29:36','Documento_294.pdf','application/pdf',2916508,'2013-09-17 08:29:36',19,0,104,'COMPLETO'),(294,'Distribucin de la enzima 3a-hidroxiesteroide oxidoreductasaen el cerebro de rata durante el desarrollo embrionario y postnatal:un posible rol para los neuroesteroides en el control dela biologa de los progenitores neurales','Por mucho tiempo se pens, que una vez culminado el desarrollo del sistema nervioso, las clulas madrey los progenitores neurales desaparecan por completo. Sin embargo, actualmente se sabe que estas clulaspersisten en nichos neurognicos en el tejido adulto, sirviendo como fuente de nuevas clulas nerviosasdurante toda la vida, y pudiendo participar en procesos regenerativos. Debido a esto, el estudio enprofundidad de la biologa de las clulas madre y de los progenitores neurales, y en particular de los factoresque regulan la proliferacin, migracin, diferenciacin y supervivencia de estas clulas, es indispensable parael desarrollo exitoso de estrategias teraputicas. Adems de los factores de crecimiento, otras molculas estncobrando inters en la actualidad, este es el caso de los neurotransmisores, en particular del GABA y de losneuroesteroides, como la 3a,5a-tetrahidroprogesterona (3a,5a-THP o alopregnanolona) un metabolitoneuroactivo de la progesterona que acta como un potente modulador del receptor GABAA. Recientemente,utilizando un modelo in vitro, de progenitores neurales aislados de cerebro de rata recin nacida, seestableci que la 3a,5a-THP y el GABA eran capaces de estimular la proliferacin de estas clulas actuandova receptores GABAA. El objetivo general del presente trabajo fue el de aportar evidencias anatmicas de laposible participacin de la 3a,5a-THP en el control de la biologa de los progenitores neurales in vivo. Sedetermin, por inmunofluorescencia, la distribucin de la 3a-hidroxiesteroide oxidoreductasa (3a-HSOR),enzima responsable de la sntesis de la 3a,5a-THP, en el cerebro de rata durante el desarrollo. Se utilizaronratas Sprague-Dawley de 14, 17 y 20 das embrionarios (E14, E17 y E20), y de 1, 4, 7, 12, 15 y 21postnatales (P1, P4, P7, P12, P15 y P21). En E14, la enzima se expres en la zona ventricular (ZV), elneuroepitelio olfatorio y las eminencias ganglinicas. En E17, la 3a-HSOR se expres en las capas externasde la corteza, los bulbos olfatorios (BO) y el hipocampo. En E20, la expresin de la enzima fue mas amplia yse observ en la ZV y en la zona subventricular (ZSV). En las etapas postnatales, la expresin de la 3a-HSOR en las zonas neurognicas aument durante las primeras semanas y luego disminuy sin desaparecer.En la extensin caudal de la ZSV, se observ una alta densidad de clulas 3a-HSOR+ que conforman cadenasradiales que penetran el cuerpo calloso (CC). En P21, las cadenas celulares en el CC desaparecen, quedandosolo clulas 3a-HSOR+ aisladas. Se observaron tambin endotelios vasculares 3a-HSOR+ asociados a laszonas neurognicas. Adems, la expresin de la enzima en los vasos se increment considerablementedurante P12 y P15. En trminos generales, los resultados obtenidos muestran que la 3a-HSOR se expresaampliamente durante el desarrollo embrionario y postnatal siguiendo un patrn espacio-temporal definido.Pudimos establecer que la expresin de la enzima es considerable en las zonas neurognicas, siendo ms altaal comienzo del desarrollo embrionario y durante el perodo postnatal comprendido entre P7 y P12. Elpresente trabajo aporta evidencias anatmicas sobre el posible papel de la 3a,5a-THP en el control de labiologa de las clulas madre neurales y de los progenitores neurales in vivo durante el desarrollo.','2009-07-14','clulas madre neurales, progenitores neurales, neuroesteroides, 3a,5a- tetrahidroprogesterona(alopregnanolona), receptor GABAA, desarrollo del sistema nervioso central.',1,1,1,1,1,'2013-09-17 08:29:37','2013-09-17 08:29:37','Documento_295.pdf','application/pdf',1951688,'2013-09-17 08:29:37',20,0,98,'COMPLETO'),(295,'SISTEMA DE GESTIN DE PREPARADORES PARA LA FACULTAD DE CIENCIAS DE LA UCV','La gestin de preparadores no est automatizada en la Universidad Central de Venezuela, por lo que los trmites se hacen lentos y propensos a frecuentes errores. Esto trae como consecuencia retardos e inconvenientes administrativos en la contratacin delpersonal docente de preparaduras.En este trabajo se dise y construy una aplicacin basada en tecnologas web que permiten automatizar y agilizar los procesos administrativos referentes a la contratacin, seguimiento y control del personal de preparaduras. El sistema est diseado para atenderlas demandas de la Facultad de Ciencias de la UCV. El diseo se basa en la metodologa de flujos de trabajo (workflows) lo que lo hace flexible y fcil de extender a nuevos requerimientos.El sistema ha sido desarrollado en Ruby usando el framework de desarrollo Rails y una arquitectura basada en Servicios Web que permite integrar este sistema con otros ya previamente desarrollados o en desarrollo, especialmente el sistema de Control de EstudiosCONEST y con el sistema de gestin de personal de la UCV.','2009-10-30','PREPARADORES, PRESUPUESTO, MOVIMIENTO DE PERSONAL, RECURSOS HUMANOS, CONSEJO DE FACULTAD.',2,1,1,1,1,'2013-09-17 08:29:41','2013-09-17 08:29:41','Documento_296.pdf','application/pdf',768576,'2013-09-17 08:29:41',20,0,82,'COMPLETO'),(296,'Evaluacin del contenido de metales pesados en agua y peces del Lago de Valencia','En ste trabajo se llev a cabo un estudio ambiental en el Lago de Valencia, Venezuela, basado en el contenido de metales pesados presentes en sus aguas y peces. Este estudio se realiz de manera bimensual entre los meses de junio y octubre de 2009 en cinco sectores del lago caracterizados por las principales influencias de tipo industrial, urbano y agrcola. El muestreo de las aguas en cada sector se realiz a tres profundidades: superficie-intermedio-fondo. Los elementos determinados fueron Cd, Cu, Cr, Ni y Pb mediante Espectrometra de Absorcin Atmica con Atomizacin Electrotmica (ETAAS) y Hg por Espectrometra de Fluorescencia Atmica con generacin de vapor fro CV-AFS. Para ello, se optimiz la metodologa de anlisis de Hg por CV-AFS para las muestras de tejidos de peces (msculo e hgado) y para el resto de los anlisis se emplearon las metodologas reportadas y validadas en trabajos previos.','2009-10-30','metales pesados, Lago de valencia, analisis de aguas, Estudio ambiental, Bioacumuladion, biomagnificacion,',6,1,1,1,1,'2013-09-17 08:29:42','2013-09-17 08:29:42','Documento_297.pdf','application/pdf',9116633,'2013-09-17 08:29:42',20,0,74,'COMPLETO'),(297,'Estudio geoqumico de los elementos C, N y P en los sedimentos de fondo, depositados en el Golfete de Cuare, estado Falcn.','El presente trabajo de investigacin tuvo como objetivo principal, estudiar la composicin qumica y distribucin espacial en trminos de las concentraciones de C, N y P en la fraccin fina (< 63 mm) de los sedimentos de fondo depositados en el Golfete de Cuare, estado Falcn. Para ello, fueron colectadas 36 muestras de ncleo de sedimentos en la parte ms externa del golfete y en la zona de playa frente a la poblacin de Chichiriviche y Varadero. En cada sitio se midieron los parmetros fsico- qumicos (temperatura y salinidad) y la profundidad de la columna de agua. En el laboratorio, los ncleos fueron cortados y la porcin de sedimento de los primeros 5 cm tamizados y analizados por las tcnicas de combustin seca y Espectrometra de Absorcin Molecular para la determinacin de carbono total y fsforo total, respectivamente. La concentracin de carbono orgnico fue determinada por el mtodo de Walkley - Black (1934), la de nitrgeno total (NT) por el mtodo de Kjeldahl, mientras que el fsforo total por el mtodo de Murphy - Riley (1962). Los resultados obtenidos indican que Las concentraciones de CT, CO y CI en las muestras de sedimento superficial (0- 5 cm) de toda la zona de estudio fueron: 1,08 a 5,54 , 0,26 a 3,49 % y 0,48 a 3,32 %, respectivamente. La distribucin espacial del CT muestra dos poblaciones de datos bien definidas; la primera en la zona de playa cuyos valores de concentracin son inferiores a 2,91 %, y la segunda en el Golfete de Cuare con valores que oscilaron entre 1,50 y 5,54 %. Esta distribucin es similar a la del CO, donde las concentraciones de este componente en las localidades de la zona de playa variaron entre 0,26 y 1,73 %, mientras que las del Golfete de Cuare entre 2,06 y 3,49%. Las concentraciones de NT para las muestras de sedimento superficial fueron: 0,07 a 0,39 . Su distribucin espacial es similar a la de CO debido a que las concentraciones de NT estn controladas por la descomposicin de la materia orgnica. La relacin CO/NT (7,9) calculada para las muestras captadas en la regin podra ser consecuencia de una proporcin apreciable de materia orgnica de origen marino. Las concentraciones de PT para las muestras de sedimento superficial oscilaron entre: 202 y 835 g/g. La distribucin espacial del PT a lo largo de la zona de estudio es de una poblacin logartmica normal, producto de que la concentracin de este elemento, de origen litolgico, est controlada principalmente por fases de oxihidrxidos de Fe y Mn, compuestos amorfos de Al o arcillas, despus de la alteracin qumica de los minerales de fosfatos de calcio de origen litolgico.','2009-10-26','GOLFETE DE CUARE, SEDIMENTO, NITRGENO, CARBONO, FSFORO',4,1,1,1,1,'2013-09-17 08:29:43','2013-09-17 08:29:43','Documento_298.pdf','application/pdf',974780,'2013-09-17 08:29:43',18,0,89,'COMPLETO'),(298,'Prototipo del Sistema de Gestin de Preparadores de la Escuela de Computacin, mdulos Gestin de Concursos y Nombramientos.','El propsito de este trabajo especial de grado se orient en la elaboracin de un prototipo del sistema de gestin de preparadores de la Escuela de Computacin, enfocado especficamente en el desarrollo de los mdulos de gestin de concursos y nombramientos, tomando como base el modelo Workflow propuesto para estos procesos. Para llevar a cabo la implementacin de este sistema se uso OpenUp como metodologa de desarrollo de software y la herramienta de Ruby on Rails como plataforma de construccin. El resultado obtenido fue la creacin de un prototipo encargado de controlar la gestin de los preparadores, especficamente en lo concerniente a los mdulos gestin de concurso y gestin de nombramiento. Este prototipo depende de la interaccin con la base de datos a travs de servicios Web. Dado que el desarrollo de la base de datos del sistema corresponde a un trabajo a futuro, el prototipo fue dotado de una solucin preliminar, a travs de archivos XML que simulan la capa de datos, con la cual se muestran los resultados a travs de la aplicacin, mientras se alcanza en otra etapa la implantacin del acceso a los datos mediante los servicios Web.','2009-11-02','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0in 5.4',2,1,1,1,1,'2013-09-17 08:29:44','2013-09-17 08:29:44','Documento_299.pdf','application/pdf',0,'2013-09-17 08:29:44',19,0,0,'INCOMPLETO'),(299,'ESTUDIO QUMICO Y EVALUACIN DE LA POSIBLE ACTIVIDAD ANTIINFLAMATORIA DEL ALGA Gracilariopsis hommersandii','Esta investigacin tuvo como objetivo, aislar, purificar, y evaluar la actividad antiinflamatoria de los metabolitos hallados en el alga Gracilariopsis hommersandii, a travs de tcnicas cromatogrficas y la elucidacin mediante tcnicas espectroscpicas, tales como: RMN-1H, RMN-13C, DEPT 135 y EM. Por otro parte, la actividad antiinflamatoria se evalu a travs del Mtodo de Griess, determinndose la capacidad inhibidora, por parte de los metabolitos, hacia el radical NO.Adicionalmente, dicha capacidad inhibidora pudo caracterizarse en funcin del ensayo de viabilidad celular MTT, establecindose as, si la inhibicin es causada por muerte celular o por la capacidad intrnseca hacia el radical.Se obtuvieron 9 metabolitos: 4 de tipo cido graso (IV, VI, VII, VIII), 1 de tipo ster (III), 1 de tipo ftalato (V), 1 de tipo galactopiranosilglicerol (IX), 1 de tipo sulfoquinovosil diacilglicerol (II) y finalmente una estructura nueva de tipo poliol similar al xilitol (I). El metabolito que present mayor actividad antiinflamatoria fue el cido eicosanoico (VII), con IC50 = 11,65 g/mL.','2009-10-16','ESTUDIO QUMICO, EVALUACIN DE LA POSIBLE ACTIVIDAD ANTIINFLAMATORIA, ALGA Gracilariopsis hommersandii',6,1,1,1,1,'2013-09-17 08:29:44','2013-09-17 08:29:44','Documento_300.pdf','application/pdf',4969741,'2013-09-17 08:29:44',19,0,140,'COMPLETO'),(300,'\"ESTUDIO DE ADSORCIN DE FRACCIONES ACIDAS PROVENIENTES DE CRUDOS VENEZOLANOS SOBRE ASFALTENOS\"','En el presente Trabajo Especial de Grado se estudiaron los fenmenos deadsorcin y desorcin por parte de la fraccin cida soluble en heptano (FASH) extradade dos crudos con diferencias de acidez sobre superficies asfaltnicas provenientes decrudos con diferentes caractersticas de estabilidad. Luego de la adsorcin por parte dela FASH en una interfase hexano- asfalteno, se construyeron las isotermas de adsorciny desorcin para las FASH, empleando la espectrometra de absorcin molecular UVVisiblea 230,4 nm, para la cuantificacin de la adsorcin. Se evidenci una grantendencia a la adsorcin a medida que se aument la concentracin de FASH(Carabobo y Lagunilla) en solucin. Las isotermas de adsorcin resultaron del tipo IV,caracterstico de superficies mesoporosas.Los estudios de desorcin demostraron que la adsorcin de FASH sobreasfaltenos es \"irreversible\", sugiriendo la incorporacin de estos compuestos en elslido asfaltnico, logrando establecer interacciones efectivas con centros bsicos delos asfaltenos. La interaccin que se corresponde con el hecho de la nula desorcin deFASH a partir del slido es del tipo cido- base.Tambin se estudi el efecto de la FASH adsorbida en asfaltenos sobre sufloculacin inducida con n-heptano, hecho que no mostr ninguna evidencia que puedaexplicar la incongruencia de los valores negativos de estabilizacin obtenidos con losaltos valores de adsorcin y bajos valores de desorcin, esto se debe a la baja relacinFASH/asfaltenos que permita modificar positivamente el umbral de floculacin deasfaltenos. Sin embargo, y de acuerdo a resultados cualitativos de los ensayos deadsorcin de FASH en solucin de n-heptano sobre asfaltenos es posible asegurar quelos componentes que constituyen la FASH, tienen caractersticas de surfactantesnaturales de alta compatibilidad con crudo y con un alto potencial para su empleo comodispersantes de asfaltenos en solucin','2009-09-07','Crudo, Asfalteno, Adsorcin, Desorcin, Floculacin,',6,1,1,1,1,'2013-09-17 08:29:47','2013-09-17 08:29:47','Documento_301.pdf','application/pdf',1073835,'2013-09-17 08:29:47',20,0,89,'COMPLETO'),(301,'HIDRODESCLORINACINN CATALTTICA DE BIFENILOS POLICLORADOS EMPLEANDO CARBUROS DE VANADIO','Se realiz la sntesis de una serie de catalizadores no soportados de carburos de nquel-vanadio, preparados mediante el mtodo de reduccin a temperatura programada (TPR) de VCl3 y Ni(NO3)2.6H2O, utilizando una mezcla carburante 20% de gas natural en hidrgeno. Las relaciones atmicas de Ni/Ni+V empleadas para la preparacin de los carburos de vanadio fueron 0; 0.15; 0.21; 0.35; 0.62 y 1. La sntesis de los catalizadores se llev a cabo en un reactor de flujo continuo a una temperatura 750 C y una velocidad de calentamiento de 18C/min. Los slidos fueron caracterizados por: difraccin de rayos X (DRX), rea especfica (BET), volumen de poro y Microscopa Auger de Barrido (SAM). El anlisis por difraccin de rayos X mostr la presencia de carburos de vanadio, especficamente la fase V8C7, as como xido de vanadio (V2O3) y nquel metlico (Ni). Por su parte, el anlisis por BET indic que se lograron obtener catalizadores con altas reas superficiales (96 m2.g-1). Los catalizadores fueron evaluados en la reaccin cataltica de hidrodesclorinacin (HDCl) de Bifenilos Policlorados (BPC). Esta se llev a cabo en un reactor de flujo continuo a 350 C y una presin de hidrgeno de 540 psi. La concentracin que se utiliz de BPC fue de 560 ppm. El proceso de pre-sulfuracin se realiz iin situ a presin atmosfrica de hidrgeno y una temperatura de 350C.Los catalizadores que se mostraron activos para la reaccin de hidrodesclorinacin de bifenilos policlorados, fueron los que posean una relacin Ni/Ni+V de 0.15 y 0.21, con valores de conversin relativamente altos con 49 y 69 %,respectivamente. Se obtuvo como productos de reaccin, benceno y ciclohexano.De los resultados logrados, se puede indicar que el comportamiento presentado sigue el modelo del Control Remoto, mostrando la existencia de sinerga entre las fases de nquel y vanadio en la reaccin de hidrodesclorinacin de Aroclor 1260.','2009-10-15','hidrodesclorinacin, carburos, bifenilos policlorados.',6,1,1,1,1,'2013-09-17 08:29:48','2013-09-17 08:29:48','Documento_302.pdf','application/pdf',811524,'2013-09-17 08:29:48',20,0,62,'COMPLETO'),(302,'Edad y crecimiento del cazn playn, Rhizoprionodon porosus Poey (1861), de la regin nororiental de Venezuela','En este trabajo se describi el crecimiento del cazn playn, Rhizoprionodon porosus, de la regin nororiental de Venezuela, utilizando ejemplares provenientes de la pesca artesanal que opera en la zona. En la evaluacin de las capturas de elasmobranquios durante el periodo muestreado (agosto 2008 - agosto 2009) se encontr que el grupo de los tiburones pertenecientes al gnero Rhizoprionodones uno de los ms comnmente capturados (12%) en la zona de estudio. Los parmetros de crecimiento de R.. porosusse estimaron a travs del anlisis de frecuencia de tallas y la aplicacin de los modelos de crecimiento de von Bertalanffy (1938), Fabens (1965) y Richards (1959). Los individuos recin nacidos encontrados (n=7; 35,0-45,5 cm LT) tuvieron una talla promedio de 42,3 cm LT. La poca de nacimiento parece estar entre enero y abril y la de apareamiento en el segundo trimestre del ao. Se encontr una talla de madurez sexual para machos (LT50%) de 67 cm. El anlisis de la tasa de incremento marginal (n=53) sugiere que la formacin de los anillos de crecimiento es anual. La determinacin de la edad de R.. porosusa partir del anlisis de vrtebras se realiz con base en 38 hembras (41,5-93,6 cm LT) y 55 machos (35-88,8 cm LT). Tomando en cuenta una periodicidad anual para la formacin de los anillos de crecimiento, las edades estimadas estuvieron comprendidas entre 0 y 9 aos. El modelo de Fabens (1965) fue el que result ms adecuado para describir el crecimiento de tipo isomtrico de R.. porosus. Los parmetros poblacionales estimados son una tasa de crecimiento (K) de 0,29- 0,33 aos-1 y una talla mxima terica (Loo) de 90,3-92,2 cm. R.. porosuspodra considerarse una especie de crecimiento rpido (K>1) donde los individuos presentan incrementos de talla de aproximadamente 20 y 11 cm en el primer y segundo ao de vida respectivamente. Los pocos individuos de tallas asintticas encontrados en el presente estudio y la evidente escasez de los mismos desde hace dcadas puede ser consecuencia de la creciente presin pesquera en el nororiente de Venezuela y sugiere la presencia de seales de sobreexplotacin del recurso. Una proporcin importante de individuos inmaduros del cazn playn es capturada por las pesqueras artesanales de la regin y se propone como estrategia de manejo bsica, el establecer como talla mnima de captura permitida 67 cm.','2009-10-28','Caribe, Vrtebras, Edad y crecimiento, Rhizoprionodon, Isla de Margarita',1,1,1,1,1,'2013-09-17 08:29:49','2013-09-17 08:29:49','Documento_303.pdf','application/pdf',2428289,'2013-09-17 08:29:49',20,0,97,'COMPLETO'),(303,'Prototipo del Sistema de Gestin de Preparadores de la Escuela de Computacin, Mdulos Gestin de Concursos y Nombramientos','El propsito de esta trabajo especial de grado se orient en la elaboracin de un prototipo del sistema de gestin de preparadores de la Escuela de Computacin, enfocado especificamente en el desarrollo de los mdulos de gestin de concursos y nombramientos, tomando como base el modelo Workflow propuesto para estos procesos, el cual est basado en la manera en como se maneja dicha gestin actualmente en la Escuela de Computacin.','2009-11-13','Gestin de Preparadores, Gestin por Procesos, Workflow, Servicios Web, OpenUp, Ruby on Rails.',2,1,1,1,1,'2013-09-17 08:29:51','2013-09-17 08:29:51','Documento_304.pdf','application/pdf',0,'2013-09-17 08:29:51',19,0,0,'INCOMPLETO'),(304,'Respuestas fisiolgicas y anatmicas de Nicotiana glauca Graham (Solanaceae)a la sequa y la salinidad','Nicotiana glauca es una planta nativa del sur de Amrica del Sur, ampliamente distribuida en el mundo gracias a su carcter invasor, que le permite establecerse rpidamente en ambientes perturbados y en ecosistemas ridos en los que el dficit hdrico (DH) supone el principal factor que limita la tasa fotosinttica (A) y el desarrollo de las plantas. Las plantas de N.. glaucase establecen sobre terrenos pedregosos en el estado Vargas, en los que el DH que ocurre durante un largo perodo del ao, y la salinidad en el suelo, que causa efectos hiperinicos e hiperosmticos estresantes, afectan su estado fisiolgico. Con el objeto de determinar las caractersticas fisiolgicas de N.. glauca que le permiten invadir ambientes de alta salinidad (S), y ambientes con DH recurrente, cuantificamos en condiciones de campo e invernadero por 20 das, los efectos que tienen el DH y S (riego con NaCl al 10 %), sobre las relaciones hdricas, el intercambio de gases y la fluorescencia de la clorofila a en N.. glauca. EL potencial hdrico (PSw) en DH disminuy dos veces y en S tres veces; en ambos casos hubo ajuste osmtico, marcadamente mayor en las plantas en S. La disminucin del PSw en ambos tratamientosprovoc un aumento del cierre estomtico y una disminucin a la mitad en A en DH y en S; A fue nula a los 15 das. El transporte de electrones disminuy un 30 % en DH, y un 60 % en S. Con base en estos resultados concluimos que N.. glauca es capaz de establecerse en ambientes con salinidad en el suelo y no soporta un DH fuerte.','2009-06-19','Fotosntesis, Nicotiana glauca, intercambio gaseoso, relaciones hdricas, actividad fotoqumica, fluorescencia de la clorofila a, dficit hdrico, sequa, salinidad, anatoma foliar.',1,1,1,1,1,'2013-09-17 08:29:52','2013-09-17 08:29:52','Documento_305.pdf','application/pdf',2346833,'2013-09-17 08:29:52',17,0,108,'COMPLETO'),(305,'Evaluacinn del contenido de aminocidos en guabina ((Hoplias malabaricus,, Bloch 11779944)),, capturadas en el embalse hipereutrffico de Suata ((Estado Aragua))..','En este trabajo se evalu el contenido de aminocidos en guabinas (Hoplias malabaricus), capturadas en el embalse de Suata, Estado Aragua, con la finalidad de aportar informacin sobre la calidad nutricional de las guabinas comercializadas en la zona. Adems se adquiri una guabina (H.. malabaricus) de referencia en el embalse el Pueblito, Estado Gurico para observar si existe algn efecto de las condiciones de las aguas en el contenido de aminocidos en los peces. El muestreo en el embalse de Suata se realiz durante los meses de noviembre de 2007 a julio de 2008, determinndose tanto en la guabina referencia como en las guabinas de Suata el contenido de protenas, grasa y cenizas. El anlisis de aminocidos de las protenas se realiz en cuatro pasos: hidrlisis, resecado, derivatizacin y anlisis por HPLC, segn el protocolo para el anlisis de aminocidos (totales y libres) aplicado en los laboratorios de Cervecera Polar C.A. Los resultados obtenidos indicaron que el contenido de protenas no vari significativamente durante los meses de muestreo. Los aminocidos no esenciales mayoritarios fueron el acido asprtico y el acido glutmico. Los contenidos de serina, glicina y lisina presentaron diferencias estadsticamente significativas durante los meses de muestreo. La lisina y la leucina fueron los aminocidos esenciales mayoritarios presentes en las guabinas H.. malabaricus capturadas en el embalse de Suata. En los meses de diciembre de 2007 y febrero de 2008 se observ una disminucin en el contenido de aminocidos no esenciales, esenciales y totales que afectan la calidad nutricional de las protenas del pescado, probablemente debido a la reduccin de nutrientes, como consecuencia de que no se haba iniciado el periodo de lluvias que permitiera la resuspencin de nutrientes del fondo a la superficie, para asi aumentar sus disponibilidades. El contenido de nitrgeno en noviembre y diciembre de 2007 fue bajo, lo que limit la sntesis de aminocidos no esenciales en estos meses. Adems, las actividades antrpicas en los alrededores del embalse Suata promovieron la presencia de contaminantes como, metales, pesticidas, amonio, entre otros, que afectaron la salud del hbitat acutico, calidad y alimentos disponibles, causando posiblemente una disminucin en el contenido de aminocidos de guabinas durante algunos de los meses de muestreo. Las guabinas H.. malabaricus del embalse de Suata aportan a los humanos protenas de valor nutritivo por el alto contenido de lisina y otros aminocidos esenciales. Las condiciones del agua del embalse de Suata parecieron no afectar el contenido de aminocidos en las guabinas H.. malabaricus, ya que no se observaron diferencias estadsticamente significativas entre la muestra de referencia capturada en el embalse oligotrfico el Pueblito y las guabinas del embalse de Suata.','2009-09-21','Embalse hipereutrfico, Hoplias malabaricus, aminocidos.',1,1,1,1,1,'2013-09-17 08:29:54','2013-09-17 08:29:54','Documento_306.pdf','application/pdf',3154894,'2013-09-17 08:29:54',18,0,67,'COMPLETO'),(306,'Criterio del segundo cociente para convergencia de series numricas.','Criterio del segundo cociente para convergencia de series numricas.','2009-09-24','Criterio de convergencia, series numricas, segundo cociente.',5,1,1,1,1,'2013-09-17 08:29:55','2013-09-17 08:29:55','Documento_307.pdf','application/pdf',0,'2013-09-17 08:29:55',19,0,0,'INCOMPLETO'),(307,'Actividad de catalizadores de W, Co-W y Ni-W Soportados en Sepiolita y Activados con Compuestos Orgnicos de Azufre en el Hidrotratamiento de Fracciones de Crudo','Se sintetizaron catalizadores en base W y NiW por el mtodo de intercambio inico, soportados por sepiolita modificada con el agente g- aminopropiltrietoxisilano, y se estudi su comportamiento en el hidrotratamiento de HVGO. Se estableci un mtodo de activacin con disulfuro de carbono (CS2) para los precursores catalticos de W y NiW utilizando como referencia un catalizador comercial, KF 757 1.5E (14% Co+Mo/Al2O3). Se obtuvo una superficie de material carbonceo proveniente de la descomposicin trmica del agente modificante y del disulfuro de carbono en el proceso de activacin. Los slidos preparados se caracterizaron mediante la tcnica de espectrometra IR de transformada de Fourier, anlisis textural, anlisis qumico elemental y anlisis termogravimtrico. Se determin la actividad de los catalizadores para el proceso de hidrotatamiento de una carga de HVGO. Los productos se caracterizaron mediante anlisis elemental de azufre y nitrgeno, medidas de densidad y anlisis termogravimtrico. El catalizador sintetizado en base a Ni-W, con una relacin atmica R= 0,2 Ni/[Ni +W] y 1,78 % p/p de carga metlica, mostr un valor de actividad cataltica (expresada por gramos de fase metlica) 1,12 veces mayor que la actividad del catalizador comercial KF 757 1,5E CoMo con una carga metlica de 13% p/p.','2009-05-29','Hidrotratamiento, Catalizadores, Tungsteno, Soportados, Hidrodesulfuracin',6,1,1,1,1,'2013-09-17 08:29:56','2013-09-17 08:29:56','Documento_308.pdf','application/pdf',0,'2013-09-17 08:29:56',20,0,0,'INCOMPLETO'),(308,'Produccinn y evaluacinn de un anticuerpo ((IgY)) anti--Tirotropina ((TSH)) conjugado con fosfatasa alcalina,, biotina e isotiocianato de fluorescena','La Pesquisa Neonatal tiene como funcin detectar el hipotiroidismo congnito para evitar el retardo mental. La prueba que se realiza para el diagnstico es determinar los niveles de Tirotropina (TSHh) en sangre de neonatos, por un inmunoensayo enzimtico utilizando anticuerpos monoclonales para capturar la Tirotropina y un anticuerpo secundario marcado, para su deteccin. La produccin de anticuerpos monoclonales es costosa y requiere de personal especializado, por ello, se han buscado otras alternativas como es el desarrollo de anticuerpos policlonales de gallinas, tecnologa utilizada recientemente para el diagnstico de muchas enfermedades. El objetivo de este trabajo fue producir y evaluar anticuerpos policlonales en gallinas (IgY), contra pptidos sintticos de la hormona Tirotropina, y se conjug con fosfatasa alcalina, biotina e isotiocianato de fluorescena, para utilizarlo como sonda para el diagnstico del hipotiroidismo congnito. Para ello, se inmuniz una gallina Isabrown con un pptido sinttico de la cadena a de la tirotropina (IMT-771), se purificaron los anticuerpos de la yema de los huevos por mtodos de precipitacin y se caracterizaron a travs de las tcnicas de ELISA, MABA y Western blot. El pptido fue inmunognico, encontrndose un mximo de produccin de anticuerpos en los das 42 y 49 postinmunizacin y un ttulo de 1:10.000 a travs del ensayo de ELISA. Los anticuerpos fueron especficos al evaluarlos por medio de MABA. Sin embargo, no reconocieron a la TSHh. Tambin se evalu un anticuerpo contra la subunidad beta de la TSH (IMT- 861), el cual demostr una alta especificidad y reconocimiento de la TSHh. Finalmente, estos anticuerpos se marcaron con fosfatasa alcalina, biotina e isotiocianato de fluorescena y se evaluaron en un ensayo de ELISA de captura con TSHh comercial y en suero de neonatos, resultando el anticuerpo anti-861 con mayor potencial. La metodologa desarrollada en este trabajo permiti establecer las bases para el marcaje de los anticuerpos IgY y su utilizacin en el diagnstico del hipotiroidismo congnito.','2009-07-10','Anticuerpos IgY, TSH, marcaje, fosfatasa alcalina, biotina, fluoresceina',1,1,1,1,2,'2013-09-17 08:29:57','2013-09-17 08:29:57','Documento_309.pdf','application/pdf',2041669,'2013-09-17 08:29:57',20,0,112,'COMPLETO'),(309,'Sintesis de nanoparticulas bimetalicas por via electroquimica','El inters en nanopartculas de transicin ha aumentado en los ltimos aos debido a la variedad de aplicaciones de stos materiales, en especial de las nanopartculas bimetlicas. Existen varios mtodos para la obtencin de materiales a esta escala, pero presentan algunas inconvenientes. Por esta razn se han aplicado mtodos electroqumicos en la sntesis de stos materiales nanoestructurados ya que ofrecen ventajas como alto rendimiento, ausencia de productos colaterales o residuales, productos fcilmente aislables y control de tamao por simple variacin de potencial o densidad de corriente aplicada. En este trabajo se sintetizaron nanopartculas bimetlicas de Rh-Ni por va electroqumica, utilizando como precursor tricloruro de Rodio (III) y cloruro y bromuro de Nquel (II) hexahidratadado y como agente estabilizante y electroltico el bromuro de tetrapropilamonio; se aplicaron potenciales constantes de valores -0,7 V, -0,6 V y -0, 9 V. Se sintetizaron adems nanopartculas bimetlicas Rh-Ni aplicando densidades de corriente constantes de -1 mA/cm2, -3 mA/cm2y -5 mA/cm2. Todas las reacciones se realizaron bajo atmosfera inerte de argn. El anlisis para la determinacin de tamao para las nanopartculas bimetlicas Rh-Ni se realizo mediante microscopia electrnica de transmisin (MET). La determinacin de los porcentajes de metales se realizo mediante difraccin de rayos x (EDX). Los anlisis por MET indicaron, en los casos en que se pudo realizar el anlisis, que el tamao promedio de partcula es menor a 20 nm. Los tamaos y distribuciones dependen del potencial aplicado. Adems se sintetizaron nanopartculas bimetlicas de Rh-Ni a -0,7 V en diferentes solventes: agua, etano y acetonitrilo para determinar la influencia del medio en el tamao de partcula. Los resultados por voltamperometra cclica demuestran que se trata de procesos cuasireversibles. Ensayos preliminares de electrocatlisis mostraron que existe un aumento significativo de la corriente, en las zonas de adsorcin y desorcin de hidrogeno, lo que indica cierta actividad electrocataltica frente para la reduccin de hidrogeno.','2009-07-14','sintesis de nanoparticulas bimetalicas de Rh-Ni',6,1,1,1,1,'2013-09-17 08:30:00','2013-09-17 08:30:00','Documento_310.pdf','application/pdf',2878327,'2013-09-17 08:30:00',18,0,123,'COMPLETO'),(310,'CARACTERIZACINN HISTOTRPPICA Y GENTTICA MEDIANTE LSSP--PCR DE AISLADOS RECIENTES DE Trypanosoma cruziDE VENEZUELA..','{}','2009-10-21','Trypanosoma cruzi, LSSP-PCR, Histotropismo, Genetica',1,1,1,1,1,'2013-09-17 08:30:03','2013-09-17 08:30:03','Documento_311.pdf','application/pdf',442868,'2013-09-17 08:30:03',19,0,87,'COMPLETO'),(311,'Desarrollo de un mdulo que permita manejar eventos dentro de los procesos modelados para el prototipo de la aplicacin Web de gestin de Procesos Acadmicos de la Coordinacin de Postgrado de la Facultad de Ciencias de la Universidad Central de Venezuela','En la unidad acadmica de la Coordinacin de Postgrado de la Facultad de Ciencias de la Universidad Central de Venezuela intervienen un determinado nmero de procesos donde destaca la complejidad y flujo constante de informacin afectando de manera directa o indirecta el tiempo de respuesta para llevar a cabo la realizacin efectiva de diversos trmites internos y externos que all son demandados. El presente Trabajo Especial de Grado tiene como objetivo desarrollar un sistema de workflow u herramienta que permita monitorear los procesos y controlar su ejecucin, encargndose de crear una lista de trabajo segn los procesos vayan inicindose, y segn sea el perfil entre el conjunto de actores como lo son estudiantes, docentes y personal administrativo que labora en dicha organizacin. La metodologa de desarrollo utilizada para la gestin de esta aplicacin fue una adaptacin de la Programacin Extrema (XP), la cual permiti la elaboracin de la parte prctica del presente trabajo de investigacin. Dentro de las necesidades contempladas en la aplicacin se tiene lo siguiente: Mantener informado a los actores involucrados del flujo de trabajo con la informacin pertinente dependiente del tipo de proceso que se estuviese llevando a cabo en determinado momento. El desarrollo de la aplicacin contempl el estudio e incorporacin del conocimiento previamente desarrollado en los sistemas referentes a: el Sistema de Control de Estudios (CONEST) y el Sistema de Gestin de Postgrado (SIGEPOST) y el nuevo sistema Conest Postgrado.','2009-10-30','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:30:04','2013-09-17 08:30:04','Documento_312.pdf','application/pdf',3345016,'2013-09-17 08:30:04',20,0,132,'COMPLETO'),(312,'Muscas domestica como vector mecnico de Salmonella spp. en la comunidad agrcola de la Colonia Tovar, Edo. Aragua.','La mosca domstica es considerada una plaga comn y abundante en las granjas avcolas. Su densidad es proporcional a la acumulacin de estircol de ave, el cual constituye un excelente medio de cultivo para las larvas de estos insectos. M.. domestica puede actuar como vector mecnico y/o biolgico de diferentes microorganismos patgenos, presentes en las heces de pollo y causantes de enfermedades gastrointestinales en humanos, convirtindose as en un problema de salud pblica. Entre estos microorganismos se encuentran algunas especies del gnero Salmonella, en su mayora capaces decolonizar el aparato gastrointestinal de los pollos y dispersarse en el ambiente a travs de sus heces. Se busca demostrar que la M.. domestica puede actuar como vector mecnico para la transmisin de bacterias entricas potencialmente patgenas, principalmente serotipos de Salmonellapresentes en la gallinaza. Se colectaron moscas en el municipio Tovar, Edo. Aragua. Se estableci la cra de M.. domestica segn la metodologa de Martiradonna y Soto (2006). Los insectos fueron expuestos a bajas temperaturas a fin de producir aletargo. Se midi el tiempo requerido para que la mosca recobrara su actividad. Para eliminar la carga microbiana en la cutcula de las moscas, fueron sumergidas en desinfectantes comerciales a base de: hipoclorito de sodio al 5%, amonio cuaternario al 10% y polimetilendiurea al 5%, con posteriores baos en agua destilada estril. Luego del tratamiento, la eliminacin bacteriana era comprobada haciendo caminar las moscas sobre agar nutritivo estril, con la consecuente ausencia de crecimiento microbiano. Las moscas libres de microorganismos eran infectadas selectivamente con Salmonella typhimurium LT2 presente en estircol de pollo. Se colectaron moscas, muestras de heces de pollo y gallinaza en diferentes lugares del Municipio Tovar, de las cuales se aisl SSalmonellaspp..utilizando los medios especficos Agar SS y XLD, y la posterior confirmacin de las bacterias aisladas con tincin Gram y pruebas bioqumicas. El tiempo de exposicin ideal de las moscas al fro fue de 150 seg, obteniendo un aletargo de alrededor de 5 minutos. El desinfectante como componente activo, amonio cuaternario elimin toda la carga microbiana de la cutcula de las moscas en 4 de las rplicas. Las moscas desinfectadas colocadas en presencia de gallinaza contaminada con S.. typhimurium LT2 presentaron esta bacteria en su cuerpo; lo cual se comprob mediante la transferencia de cada mosca a placas de agar XLD. En el 16,4% de las moscas colectadas en campo se encontr en su cuerpo Salmonellaspp.. En 4 de 6 muestras de heces de pollo se encontr SSalmonellaspp. y en 4 de 6 muestras de gallinaza tambin. Ya que M.. domestica desarrolla gran parte de su ciclo de vida en heces de pollo y gallinaza, se puede considerar una relacin directa entre la Salmonellaspp.. aislada de la gallinaza y heces y la Salmonellaspp.. aislada del cuerpo de las moscas en El Municipio Tovar. Relacionando esto con la alta densidad de M.. domesticaen esta zona y que los habitantes sufren constantes disenteras provocadas por bacterias entricas.','2009-10-16','Muscas domestica, Salmonella spp, Gallinaza, estircol de pollo, Colonia Tovar, Vector mecnico.',1,1,1,1,1,'2013-09-17 08:30:06','2013-09-17 08:30:06','Documento_313.pdf','application/pdf',989668,'2013-09-17 08:30:06',19,0,105,'COMPLETO'),(313,'Estructura Fsica y Biolgica de la Comunidad de Epifitas Vasculares de un Bosque Hmedo Premontano, de la Reserva Ecolgica Guquira, en el Macizo de Nirgua, Edo. Yaracuy, Venezuela','La diversidad y estructura de la comunidad de epifitas vasculares, fue estudiada en todosaquellos portadores reales con D.A.P >= 2,5cm, en un bosque hmedo premontano, ubicadoen la Reserva Ecolgica Guquira. Se establecieron 5 parcelas de 0,1ha, subdivididas ensubparcelas de 10x10m. Se registr un total de 53 especies epifitas, representadas en 12familias (Bromeliaceae, Orchidaceae, Araceae, Gesneriaceae, Piperaceae, Clusiaceae,Aspleniaceae, Polypodiaceae y dos familias no identificadas). Se encontraron relacionesinversas entre el nmero de especies e individuos epifitos y la altura y dimetro del soporte.Las epifitas revelaron preferencia por la regin superior de las ramas y tipos de cortezaestriada y rugosa. A partir de un anlisis de agrupamiento, se obtuvieron 6 grupos deespecies epifitas, los cuales responden a cambios en los gradientes ambientales que se dan alo largo del fuste y ramas de los portadores. El grado de perturbacin en el rea estudiada,tambin podra estar influenciando el patrn de distribucin de este grupo de plantas.Tambin fue encontrada preferencia de las especies epifitas por un ejemplar de la zona,perteneciente a la familia Bombacaceae (Ceiba pentandra), la corteza rugosa y con fisurasprofundas de este individuo parecen brindar condiciones adecuadas para el establecimientode las mismas, adems la disposicin casi horizontal de sus ramas y el alto grado dedesarrollo de stas y del fuste, podra indicar una relacin especie-rea como la definida porYeaton y Gladstone (1982). Los forofitos pertenecientes a clases de alturas superiores,presentaron mayor diversidad de grupos de plantas epifitas, que aquellos forofitos en clasesde alturas bajas e intermedias, debido posiblemente a la mayor cantidad de microhbitatsadecuados presentados en los primeros.','2009-09-04','Palabras Clave: Epifitas, Patrn de Distribucin, Preferencias, Corteza, Perturbacin.',1,1,1,1,1,'2013-09-17 08:30:07','2013-09-17 08:30:07','Documento_314.pdf','application/pdf',5723177,'2013-09-17 08:30:07',18,0,85,'COMPLETO'),(314,'ESTUDIO DE LA HIDRODESCLORINACIN CATALTICA DE ACEITES DE TRANSFORMADOR CONTAMINADOS CON BIFENILOS POLICLORADOS (AROCLOR 1260) EMPLEANDO CATALIZADORES DE Ni-Mo','En el presente estudio se realiz la Hidrodesclorinacin Cataltica de Bifenilos Policlorados (Aroclor 1260), en un reactor de lecho fijo a una presin de 540 Psi y temperaturas entre 350 y 400C, la solucin reactante es una mezcla de aceite mineral y 500ppm de BPC. Los productos de reaccin fueron identificados por Cromatografa de Gases, entre los resultados obtenidos, los catalizadores no presentaron actividad en el aceite mineral como medio de reaccin.','2009-10-30','Hidrodesclorinacin Cataltica de Bifenilos Policlorados',6,1,1,1,1,'2013-09-17 08:30:08','2013-09-17 08:30:08','Documento_315.pdf','application/pdf',1919055,'2013-09-17 08:30:08',18,0,142,'COMPLETO'),(315,'El teorema de Nehari y el teorema de Kronecker..','Se estudia en detalle el teorema deNehari y de Kronecker, y los conocimientos bsicos para comprender y desarrollar estos Teoremas.','2009-09-03','Nehari,, Kronecker,, Anlisis..',5,1,1,1,1,'2013-09-17 08:30:11','2013-09-17 08:30:11','Documento_316.pdf','application/pdf',2810852,'2013-09-17 08:30:11',20,0,89,'COMPLETO'),(316,'SISTEMA DE GESTIN DE PREPARADORES PARA LA FACULTAD DE CIENCIAS DE LA UCV','La gestin de preparadores no est automatizada en la Universidad Central de Venezuela, por lo que los trmites se hacen lentos y propensos a frecuentes errores. Esto trae como consecuencia retardos e inconvenientes administrativos en la contratacin delpersonal docente de preparaduras.En este trabajo se dise y construy una aplicacin basada en tecnologas web que permiten automatizar y agilizar los procesos administrativos referentes a la contratacin, seguimiento y control del personal de preparaduras. El sistema est diseado para atenderlas demandas de la Facultad de Ciencias de la UCV. El diseo se basa en la metodologa de flujos de trabajo (workflows) lo que lo hace flexible y fcil de extender a nuevos requerimientos.El sistema ha sido desarrollado en Ruby usando el framework de desarrollo Rails y una arquitectura basada en Servicios Web que permite integrar este sistema con otros ya previamente desarrollados o en desarrollo, especialmente el sistema de Control de EstudiosCONEST y con el sistema de gestin de personal de la UCV.','2009-10-30','PREPARADORES, PRESUPUESTO, RECURSOS HUMANOS, CONSEJO DE FACULTAD, MOVIMIENTO DE PERSONAL.',2,1,1,1,1,'2013-09-17 08:30:12','2013-09-17 08:30:12','Documento_317.pdf','application/pdf',1380176,'2013-09-17 08:30:12',20,0,82,'COMPLETO'),(317,'ESTUDIO COMPARATIVO DE LA COMPOSICIN PROXIMAL Y ELEMENTAL EN BIVALVOS DEL ESTADO NUEVA ESPARTA.','{}','2009-09-03','{}',1,1,1,1,1,'2013-09-17 08:30:15','2013-09-17 08:30:15','Documento_318.pdf','application/pdf',5881546,'2013-09-17 08:30:15',19,0,104,'COMPLETO'),(318,'INFLUENCIA DEL CRECIMIENTO DE RACES FINAS EN LOS RESERVORIOS DE P EN EL SUELO DE LOS BOSQUES INUNDABLES DE LA PARTE BAJA DEL RIO ORINOCO. IMPLICACIONES DE LA ESTACIOANALIDAD.','Fue llevado a cabo un estudio con el propsito de evaluar a lo largo de un hidroperodo el crecimiento de races finas y sus implicaciones en los reservorios de P, la materia orgnica y la actividad de la fosfatasa cida en el suelo, en un experimento de campo al sur del Estado Anzotegui, en la parte baja del ro Orinoco. El estudio fue realizado en dos zonas de diferente intensidad de inundacin: MAX y MIN, las cuales se inundan 8, y 2 meses por ao respectivamente, siguiendo un completo hidroperodo: (i) inicio de lluvias (Junio 2007), (ii) final de la inundacin (Noviembre 2007) y (iii) mxima sequa (Abril-2008). Cada zona fue subdividida en 10 subparcelas. Al final de la poca seca (mayo 2007) fueron instalados en cada subparcela dos cilindros de crecimiento (CCR) y dos de exclusin (CE) (n= 20 zona/tratamiento). Para dos fechas de muestreo: inicio de lluvias y salida de la inundacin, fueron colectados de cada subparcela 1 CCR y 1 CE (n=10/zona/fecha/tratamiento). Con el propsito de evaluar la poca seca, fueron instalados en cada zona en Noviembre 2007 1 CCR y 1 CE por subparcela (n=10/zona/tratamiento), los cuales fueron removidos en Abril 2008. Durante las tres fechas de muestreo el suelo de los cilindros fue secado, pesado, toda raz extrada y pesada. La cantidad de materia orgnica, actividad de la fosfatasa cida y el P en el suelo en sus distintas formas fueron determinados en el suelo de los cilindros. Los resultados mostraron que para las tres fechas de muestreo en MAX se obtuvo la mayor productividad. Para ambos tratamientos, la productividad de races decrece con la inundacin teniendo la mayor productividad en los CCR, sin embargo, el contenido de P en las races aumento significativamente durante la inundacin. La influencia del crecimiento o no de races no parece generar cambios en los distintos reservorios de P en el suelo, sin embargo las variaciones en el hidroperodo tienen un efecto significativo. La presencia de races finas no tiene efecto sobre el contenido de materia orgnica y la actividad de la fosfatasa cida en ambientes inundables. La biodegradacin de la materia orgnica y la AFA est regulada por la duracin de los perodos de inundacin.','2009-10-27','Productividad, Fraccionamiento, Rstacionalidad',1,1,1,1,1,'2013-09-17 08:30:18','2013-09-17 08:30:18','Documento_319.pdf','application/pdf',0,'2013-09-17 08:30:18',19,0,0,'INCOMPLETO'),(319,'Caracteristicas Combinatorias del Cardinal del Continuo','Estudia distintas caracteristicas combinatorias del cardinal del continuo.','2009-12-16','Teoria de conjuntos, Cardinales, Hipotesis del continuo.',5,1,1,1,1,'2013-09-17 08:30:19','2013-09-17 08:30:19','Documento_320.pdf','application/pdf',1799438,'2013-09-17 08:30:19',20,0,108,'COMPLETO'),(320,'Framework basado en Colonias de Hormigas Artificiales para la resolucin de Problemas de Optimizacin','En el trabajo se realiz un estudio a profundidad de los modelos computacionales derivados los sistemas de Colonias de Hormigas naturales en bsqueda de alimento. Luego, se construy una herramienta basada en Software libre, en la cual el programador puede hacer uso de los principales algoritmos de Colonias de Hormigas artificiales. Por ltimo, se verific el funcionamiento del framework, y la aplicabilidad de los algoritmos de Colonias de Hormigas a distintos problemas de optimizacin.','2010-01-28','colonias de hormigas, framework, optimizacin, sistemas bioinspirados, inteligencia artificial',2,1,1,1,1,'2013-09-17 08:30:20','2013-09-17 08:30:20','Documento_321.pdf','application/pdf',3937401,'2013-09-17 08:30:20',20,0,87,'COMPLETO'),(321,'Diseo e Implementacin de un Servicio de E-mail Aunado a Tcnicas Antispam y Basado en Software de Dominio Pblico','El presente Trabajo Especial de Grado est enfocado hacia la implementacin de un sistema de correo electrnico conjugado con tcnicas y herramientas para el control de spam basado en software de dominio pblico. El objetivo del trabajo es proponer una solucin que permita a cualquier persona u organismo implementar un sistema de correo electrnico con un eficaz manejo de mensajes no deseados. El proyecto est compuesto por un proceso de investigacin, instalacin y configuracin de los componentes necesarios para implementar una plataforma de correo electrnico con control de spam. La solucin antispam se basa en spamassassin, el cual es un software de cdigo abierto que implementa funcionalidades necesarias para el control del spam. Como caso de estudio se seleccion a la Asamblea Nacional, en la cual se efectu reingeniera total de la plataforma de correo, quedando establecido Zimbra Messaging and Collaboration Suite 5.0 como plataforma de mensajera y colaboracin. Esta suite usa como background el sistema operativo Debian Etch release 4. Todos estos sistemas se integraron para proporcionar un servicio de correo libre de spam en concordancia con los lineamientos del decreto N 3.390. Con la implementacin de la plataforma de correo electrnico con control de spam, se logr obtener una solucin que proporciona beneficios adicionales (antivirus, firewall, etc.) que brinda ms y mejores opciones a los usuarios y administradores. De igual forma se obtuvo una plataforma fcilmente escalable en cuanto a servicios y funcionalidades, adems de ser extensible, ya que esta solucin se podra implementar en otros entes pblicos y privados.','2009-12-16','spam e-mail zimbra postfix spamassassin mta correo electronico',2,1,1,1,1,'2013-09-17 08:30:22','2013-09-17 08:30:22','Documento_322.pdf','application/pdf',1824744,'2013-09-17 08:30:22',18,0,109,'COMPLETO'),(322,'ESTIMAR LA REACTIVIDAD HACIA LA HIDRODESCLORINACIN CATALTICA DE BIFENILOS POLICLORADOS ((AROCLOR 11226600)):: SISTEMA NiW SOPORTADO..','Los bifenilos policlorados (PCB) son mezclas de hidrocarburos clorados que se han utilizado en abundancia desde 1930 en diversas aplicaciones industriales, por ejemplo como material aislante de transformadores y condensadores grandes, fluidos de intercambio trmico, aditivos de pinturas, papel autocopiante y plsticos. El inters de los PCB para aplicaciones industriales radica en la inercia qumica, la resistencia al calor, la no inflamabilidad, la baja presin de vapor y la alta constante dieltrica. Existen 209 PCB posibles, desde los tres ismeros monoclorados hasta el ismero decaclorobifenilo, completamente clorado. Generalmente, la solubilidad en agua y la presin de vapor disminuyen con el aumento de las sustituciones y la liposolubilidad se eleva a medida que hay ms sustituciones de cloro. En el medio ambiente es ms probable encontrar los PCB unidos a componentes orgnicos del suelo, sedimentos y tejidos biolgicos, o bien al carbono orgnico disuelto en sistemas acuticos, ms que en solucin acuosa. Los PCB se volatilizan de la superficie del agua a pesar de su baja presin de vapor, en parte como consecuencia de su hidrofobia; el transporte atmosfrico, por consiguiente, puede ser una ruta importante para la distribucin de los PCB en el medio ambiente. Las tcnicas de remediacin qumica usualmente se basan en la sustitucin de cloros, reduccin por hidruros, hidrodesclorinacin, desclorinacin empleando metales, radilisis, oxidacin, electrolisis. Algunas de ellas empleadas comercialmente para el tratamiento de lquidos y aceites contaminados con BPC. Sin embargo, la baja reactividad y / o selectividad hacia la desclorinacin hace que los mtodos de tratamiento ms empleados requieran de altas temperaturas y presiones. La hidrodesclorinacin (HDCl) ha sido estudiada para el tratamiento de desechos lquidos contaminados por compuestos orgnicos clorados como: olefinas cloradas, bencenos clorados, clorofenoles, bifenilos policlorados (BPC), etc... La hidrodesclorinacin de haluros orgnicos produce el hidrocarburo correspondiente y cloruro de hidrgeno. El cloruro de hidrgeno producido puede ser fcilmente separado, mientras que el hidrocarburo puede ser reciclado para minimizar el desecho o valorizarlos. En el presente estudio se estudi la hidrodesclorinacin cataltica de bifenilos policlorados (Aroclor 1260), empleando un reactor de lecho fijo a una presin de 540psi y temperaturas entre 350 y 400 C con solucin de BPC en heptano. Para llevar a cabo este proceso, se sintetizaron una serie de catalizadores NiW, variando el porcentaje del nquel (1-5%) siendo el porcentaje tungsteno constante a 20% en peso. La caracterizacin fisicoqumica se realizo mediante: rea especfica con N2, difraccin de rayos x, espectroscopia fotoelectrnica de rayos x y anlisis elemental. Los catalizadores fueron presulfurados con una solucin de CS2 (presin de 1atm y 350C), antes de iniciar las reacciones de hidrodesclorinacin, de 4 horas de duracin. Los productos de reaccin fueron identificados por cromatografa de gases, Obtenindose benceno como nico producto.','2010-02-25','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; m',6,1,1,1,1,'2013-09-17 08:30:23','2013-09-17 08:30:23','Documento_323.pdf','application/pdf',1880884,'2013-09-17 08:30:23',20,0,83,'COMPLETO'),(323,'DINAMICA DE PRODUCCION DE COPROLITOS DE LOMBRICES DE TIERRA EN LA SABANA DE LA ESTACION BIOLOGICADELOS LLANOS','Fue analizada la dinmica de produccin espacio-temporal de coprolitos epgeos de lombrices de tierra en dos sistemas, una sabana protegida del fuego y pastoreo durante ms de treinta aos ubicada en la Estacin Biolgica de los Llanos en el Estado Guarico (SP) y una sabana adyacente no protegida actualmente sometida a quemas anuales y baja tasa de pastoreo, perteneciente a el Fundo \"La Matica\" (SNP). Adicionalmente, se analiz la composicin de las comunidades de lombrices de tierra a nivel de Familia en ambos sistemas y se estimaron algunos parmetros fsicos (temperatura, humedad, densidad aparente, capacidad de campo y textura) a profundidades de 0-10,10-20,20-30 cm. Se realizaron tres muestreos, uno en poca de sequa y dos en poca de lluvia. Para el muestreo de coprolitos epgeos se delimit una parcela de 90 x 90 cm en cada sistema y se eligieron 5 unidades muestrales de 1 m2 en cada parcela. En cada perodo de muestreo la extraccin de lombrices se realiz tomando 5 muestras de 25 cm2 x 30 cm de profundidad, adyacentes a las unidades muestrales de los coprolitos, empleando el mtodo de extraccin manual (Anderson e Ingram, 1989) y el mtodo de flotabilidad para el anlisis de presencia de capullos de lombrices de tierra en las mismas fracciones de suelo. La produccin de coprolitos en ambos sistemas, SP y SNP, difiri notablemente siendo mayor en SP y presentando formas generalmente globulares. La densidad y biomasa de lombrices de tierra fue mayor en SP y no se encontr diferencia entre estaciones (sequa y lluvia) para un mismo sistema (SP o SNP). Entre los cambios de estaciones se pudo notar que los individuos tienden a migrar a zonas ms profundas (20-30 cm) en la poca seca permaneciendo inactivos y se desplazan a la superficie (0-10 cm) en la poca de lluvia para alimentarse. El principal factor que determin la distribucin de lombrices en la poca seca fue la humedad del suelo. Los individuos encontrados en ambos sistemas pertenecieron a la familia Glossoscolecidae siendo ms abundantes los individuos en estado inmaduro. No se encontraron capullos en los estratos de suelos durante los distintos muestreos. Estos resultados indican una respuesta positiva en el proceso de produccin de coprolitos epgeos en la sabana protegida, adicionalmente, indican que la proteccin de la sabana ha favorecido la proliferacin de lombrices de tierra, indicado por un mayor valor de densidad y biomasa de las mismas.','2010-01-22','Coprolitos, lombrices de tierra, sabana, Estacin Biolgica de los Llanos, macrofauna',1,1,1,1,1,'2013-09-17 08:30:24','2013-09-17 08:30:24','Documento_324.pdf','application/pdf',6977808,'2013-09-17 08:30:24',20,0,128,'COMPLETO'),(324,'EFECTO DE LA ILUMINACIN CON LUZ UV- C SOBRE MICROFLORA NATURAL EN TRES VARIEDADES DE LECHUGAS FRESCAS (Lactuca sativa L)) CORTADAS DE ENSALADAS LISTAS PARA SERVIR DE DISTRIBUCIN COMERCIAL.','Trozos de lechugas ((Lactuca sativa L..)) frescas cortadas con mnimo proceso distribuidas comercialmente como ensaladas listas para servir,, fueron sometidas a bajas dosis de iluminacinn ((22,,77;; 44,,55 y 66,,33 kJ..m--22)) por ambas caras de la muestra,, con lmparas germicidas ((225544 nm)) de luz ultravioleta banda C ((UV--C)) en periodos de 33,,55,, y 77 minutos,, con el propssito de evaluar su efecto germicida sobre microflora inicial deteriorativa del producto.. Las muestras fueron aportadas por productor local,, analizndose de tres lotes con da de produccinn cero,, compuesto por una mezcla de tres variedades ((Lactuca sativa var.. capitata,, Lactuca sativa var.. longifolia,, Lactuca sativa sp..)) almacenados a temperaturas de refrigeracinn de 4411C analizados durante diez ((1100)) das.. La evaluacinn sensorial del producto mnimamente procesado se realiz al tercer da de almacenamiento refrigerado a 4411C,, donde se evalu las variables cualitativas aroma,, color,, textura y aceptacinn global,, a travs de panel no entrenado de degustacinn.. La investigacinn arrojo como resultado que una exposicinn durante 55 minutos a una dosis de 44,,55 KJ//m22 es una combinacinn tiempo--energa adecuada que inhibe el desarrollo de la microflora inicial,, y ms especficamente el crecimiento del grupo Enterobacterias,, Mohos y Levaduras.. No presentndose diferencia significativa en el nivel de aceptacinn segnn el panel evaluador no entrenado..','2009-12-01','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',1,1,1,1,1,'2013-09-17 08:30:26','2013-09-17 08:30:26','Documento_325.pdf','application/pdf',0,'2013-09-17 08:30:26',20,0,0,'INCOMPLETO'),(325,'Desarrollo de una Aplicacin Web para el Centro de Cmputo de una Procesadora de Medios de Pago que automatice la Gestin de Incidencias.','El presente Trabajo Especial de Grado expone el desarrollo de una aplicacin Web capaz de gestionar eficientemente, las incidencias ocurridas en el Centro de Cmputo. La Aplicacin desarrollada deber facilitar, el registro actualizacin, consulta y seguimiento de las incidencias. Adicionalmente, deber mejorar el rendimiento, productividad y capacidad de respuesta al personal del Centro de Cmputo. La Aplicacin se desarroll siguiendo una metodologa denominada Proceso Unificado, la cual utiliza como una de sus herramientas principales los diagramas de casos de uso para representar las funcionalidades y requerimientos de la aplicacin, se caracteriza por ser capaz de adaptarse a cambios de requisitos en cualquier punto del ciclo de desarrollo de la aplicacin y estimula el continuo contacto que debe mantenerse entre el desarrollador y el cliente. Para la implementacin se utiliza como herramientas de desarrollo, PHP (Hypertext Pre-processor), Sistema Manejador de Bases de Datos MySQL y JavaScrip, estas herramientas se caracterizan por ser Software Libre y juntas proveen las funcionalidades necesarias para la construccin de la aplicacin. El resultado obtenido es una aplicacin sencilla de manejar, que logra optimizar y facilitar el proceso de gestin de incidencias, a travs de una infraestructura tecnolgica que abre las puertas hacia un crecimiento competitivo y permanente.','2010-02-08','Medios de pago, Procesadora de medios de pago, Centro de Cmputo, Incidencias, Sistema de Registro de Incidencias.',2,1,1,1,1,'2013-09-17 08:30:27','2013-09-17 08:30:27','Documento_326.pdf','application/pdf',1299518,'2013-09-17 08:30:27',18,0,78,'COMPLETO'),(326,'Implementacinn de un Protocolo de Enrutamiento Avanzado de Vector de Distancia','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicacin denominada Easy-EIGRP para la enseanza del protocolo EIGRP (Enhanced Interior Gateway Routing Protocol) patentado por Cisco Systems. La aplicacin provee un conjunto de herramientas que permiten depurar paso a paso todos los procesos llevados a cabo durante el funcionamiento de EIGRP en distintos escenarios. El trabajo se inicia con un estudio basado en ingeniera inversa, el cual consiste en el desarrollo de situaciones puntuales para el estudio del comportamiento del protocolo utilizando routers Cisco. Durante la implementacin de la aplicacin, se utiliz una metodologa iterativa basada en las nuevas tendencias del modelo de desarrollo gil que plantea la creacin de cada una de las herramientas de la aplicacin en una iteracin del proceso que abarca las fases de Anlisis, Diseo, Implementacin y Pruebas. Easy-EIGRP est diseado para ser instalado en cualquier computador y convertir al mismo en un router creando la posibilidad de comunicarse con otros routers o computadores que cuenten con el protocolo. Easy-EIGRP es una implementacin parcial de EIGRP donde se encuentra el protocolo RTP (Reliable Transfer Protocol), el algoritmo DUAL (Diffussing Update Algorithm), el protocolo de descubrimiento y recuperacin de vecinos, entre otros. Adems, la aplicacin incorpora una gran cantidad de funcionalidades para facilitar el uso de la herramienta y el entendimiento del protocolo. Algunas de estas funcionalidades son: posibilidad de configuracin de interfaces fsicas y virtuales, mapas parciales de la red, mquina de estado finito, sniffer, bitcoras de sucesos con distintos niveles de depuracin, etc.','2010-01-27','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:30:28','2013-09-17 08:30:28','Documento_327.pdf','application/pdf',796088,'2013-09-17 08:30:28',20,0,77,'COMPLETO'),(327,'Implementacinn de un Protocolo de Enrutamiento Avanzado de Vector de Distancia','El presente Trabajo Especial de Grado consiste en el desarrollo de una aplicacin denominada Easy-EIGRP para la enseanza del protocolo EIGRP (Enhanced Interior Gateway Routing Protocol) patentado por Cisco Systems. La aplicacin provee un conjunto de herramientas que permiten depurar paso a paso todos los procesos llevados a cabo durante el funcionamiento de EIGRP en distintos escenarios. El trabajo se inicia con un estudio basado en ingeniera inversa, el cual consiste en el desarrollo de situaciones puntuales para el estudio del comportamiento del protocolo utilizando routers Cisco. Durante la implementacin de la aplicacin, se utiliz una metodologa iterativa basada en las nuevas tendencias del modelo de desarrollo gil que plantea la creacin de cada una de las herramientas de la aplicacin en una iteracin del proceso que abarca las fases de Anlisis, Diseo, Implementacin y Pruebas. Easy-EIGRP est diseado para ser instalado en cualquier computador y convertir al mismo en un router creando la posibilidad de comunicarse con otros routers o computadores que cuenten con el protocolo. Easy-EIGRP es una implementacin parcial de EIGRP donde se encuentra el protocolo RTP (Reliable Transfer Protocol), el algoritmo DUAL (Diffussing Update Algorithm), el protocolo de descubrimiento y recuperacin de vecinos, entre otros. Adems, la aplicacin incorpora una gran cantidad de funcionalidades para facilitar el uso de la herramienta y el entendimiento del protocolo. Algunas de estas funcionalidades son: posibilidad de configuracin de interfaces fsicas y virtuales, mapas parciales de la red, mquina de estados finitos, sniffer, bitcoras de sucesos con distintos niveles de depuracin, etc.','2010-01-27','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:30:30','2013-09-17 08:30:30','Documento_328.pdf','application/pdf',8354004,'2013-09-17 08:30:30',20,0,121,'COMPLETO'),(328,'Construccin de un parche triangular de Bzier cuadrtico','Al clacular la ecuacin implcita de una superficie racional cuadrtica de Bzier resultan que tienen a lo sumo grado algebraico cuatro. EL objetivo principal de este trabajo es construir un parche racional cuadrtico de Bzier cuya ecuacin implcita sea de grado dos.','2009-12-11','parches, Bzier, geometra, proyectiva, homogenizacin, superficie, puntos de control, racional',5,1,1,1,1,'2013-09-17 08:30:31','2013-09-17 08:30:31','Documento_329.pdf','application/pdf',1939848,'2013-09-17 08:30:31',20,0,125,'COMPLETO'),(329,'EVALUACINN DE LA PRESENCIA DE IgG ANTI--Trypanosoma cruzi Y SU CINTTICA DE AVIDEZ EN PACIENTES DE FASE AGUDA INFECTADOS POR VAA ORAL EN CARACAS--VENEZUELA..','RESUMEN La presencia de IgG especficos es una prueba que permite definir de forma rpida si una persona ha estado en contacto con Trypanosoma cruzi. Por su parte, la IgM es un marcador de fase aguda, y con frecuencia permanece positiva por varios meses despus de una primo-infeccin, pero en algunas ocasiones el resultado es inconcluso. Solo con estas dos pruebas se dificulta precisar la fase reciente, indeterminada o crnica de la infeccin. La poca fuerza de unin de anticuerpos IgG a los antgenos es caracterstico de infecciones recientes, y se puede determinar con pruebas serolgicas deavidez de las IgG por ELISA y \"Western blot\", de fcil ejecucin y econmicas. Se determin la avidez de las IgG por ELISA y \"Western blot\", as como los ttulos de IgG e IgM de 35 personas (24 nios y 11 adultos) infectados por va oral con T.. cruzi en la Escuela Andrs Bello del Municipio Chacao, los cuales fueron confirmados por ELISA IgG e IgM y PCR reactivos. Se trabaj con cuatro muestras una pre-tratamiento y tres post-tratamiento. El uso de una prueba para medir la avidez de las IgG especficas en la preparacin antgenica de epimastigotes de T.. cruzi ha sido propuesta para distinguir entre infecciones recientes y crnicas. En base a los resultados obtenidos, el ndice de avidez incrementa al transcurrir el tiempo de infeccin, como se evidencio para todas las muestras de pre-tratamiento que presentaron una avidez baja, lo que sugiere que un ndice de avidez <0,45 indica una infeccin reciente. Con una sensibilidad de 100% y especificidad de 91% se puede decir que la prueba estandarizada para determinar la avidez de las IgG especficas para la ECh, es vlida para detectar infecciones recientes. Al caracterizar el patrn de reconocimiento de polipptidos, encontramos que para la fase reciente hay un patrn de 3 bandas que presentan una frecuencia de aparicin mayor o igual al 70% (72-, 18- y 15 kDa), en el caso de la fase crnica hay un patrn de 2 bandas (31 y 29 kDa). Basados en esta alta frecuencia de aparicin, hemos considerado que las bandas que conforman cada patrn son caractersticas para diferenciar una fase de otra.','2010-01-22','Enfermedad de Chagas ((ECh)),, Trypanosoma cruzi,, Avidez..',1,1,1,1,1,'2013-09-17 08:30:32','2013-09-17 08:30:32','Documento_330.pdf','application/pdf',2293979,'2013-09-17 08:30:32',20,0,81,'COMPLETO'),(330,'Mejoras al Prototipo de Sistema de Informacinn de Gestinn de Proyectos:: Mddulos de Alcance,, Tiempo,, Costes y Recursos Humanos','Este trabajo especial de grado (T.E.G.) comprende la revisin y reparacin de un sistema de informacin para la gestin de proyectos en el rea de alcance, tiempo, costes y recursos humanos, siguiendo las buenas prcticas planteadas por la gua del PMBOK (Project Management Body of Knowledge, Gua de Fundamentos de la Direccin de Proyectos). Con este T.E.G. se desea: revisar y reparar los mdulos de alcance, tiempo, costes y recursos humanos para su integracin en el prototipo de Sistema de Informacin de Gestin de Proyectos (SIGP), con el fin de cumplir un conjunto de requisitos y requerimiento para la Gerencia de Proyectos. Para llevar a cabo este desarrollo se utiliz una Metodologa de Mejoras, ajustando la Metodologa de trabajo de la tesis doctoral: Diseoos instructivos adaptativos:: formacinn personalizada y reutilizable en entornos educativos Berlanga ((22000066)). El mtodo de desarrollo utilizado consiste en: Conocer el estado del arte::En este paso se desea conocer y obtener las bases conceptuales de la gerencia de proyecto. Identificar reas de mejora::En este paso se revisa el SIGP, a fin de determinar cules son las herramientas que posee el sistema y cules de estas presentan fallas. Proponer y desarrollar alternativas de solucinn::En este paso se propone y se desarrollan las alternativas de solucin para mejorar las fallas presentadas. Obtener retroalimentacinn de la comunidad cientfica y reflexionar y plantear nuevas cuestiones::En este paso se revisan las propuestas establecidas en el paso anterior considerando si las mismas son o no son adecuadas. Probar y evaluar la propuesta final::En este paso una vez que la propuesta es lo suficientemente consistente, se implementa, se prueba y se evala mediante la aplicacin de un caso prctico. Se revisan las herramientas correspondientes al rea de tiempo, alcance, costo y recursos humanos para seleccionar aquellas que presentan fallas en el prototipo. Una vez seleccionadas se llevan a cabo las mejoras de las mismas y las pruebas necesarias para comprobar su correcto funcionamiento.','2010-02-26','Proyecto, Gestin de Proyecto, Herramientas y Tcnicas, rea de conocimientos, alcance, tiempo, costes, RRHH, revisin, falla, reparacin.',2,1,1,1,1,'2013-09-17 08:30:34','2013-09-17 08:30:34','Documento_331.pdf','application/pdf',9873039,'2013-09-17 08:30:34',20,0,110,'COMPLETO'),(331,'ESTUDIOS DE FORMACINN DE COMPLEJOS TERNARIOS ENTRE EL SISTEMA VANADIO((III)) -- CCIDO DIPICOLNNICO Y LOS AMINOCCIDOS PROLINA,, GLICINA,, a -- ALANINA Y b -- ALANINA','En este trabajo se estudiaron las reacciones de formacin de complejos ternarios en el sistema vanadio(III) - cido dipicolnico y los aminocidos prolina (pro), glicina (gly), a-alanina (a-ala) y b-alanina (b-ala), realizados mediante medidas de fuerzas electromotrices emf((H). Los datos fueron analizados utilizando el programa computacional de mnimos cuadrados generalizados LETAGROP, tomando en consideracin los productos de hidrlisis del ion vanadio (III), las constantes de acidez de los ligandos empleados y las constantes de formacin de complejos binarios. En el sistema V(III) - cido dipicolnico - a- alanina el modelo que mejor ajust los datos experimentales inclua a las especies [V(Hdipic)(Ha-ala)]+ (log bpqrs = 7.1(3)), [V(dipic)(Ha-ala)]+ (log bpqrs = 6.29(6)),[V(dipic)(a-ala)] (log bpqrs = 2.88(5)), [V(dipic)(a- ala)(OH)]-(log bpqrs = -3.7(1)) y [V(dipic)(a-ala)(OH)2]2-(log bpqrs = -12.0 (1)), en el sistema V(III) - cido dipicolnico - b-alanina se obtuvieron los complejos [V(dipic)(Hb-ala)]+ (log bpqrs = 7.02(6)), [V(dipic)(b-ala)] (log bpqrs = 2.83(5)), [V(dipic)(b-ala)(OH)]- (log bpqrs = -3.85(8))y [V(dipic)(b- ala)(OH)2]2-(log bpqrs = -11.9(2)), mientras que en el sistema V(III) - cido dipicolnico - glicina el modelo obtenido fue [V(Hdipic)(Hgly)]2+ (log bpqrs = 7.4(4)), [V(dipic)(Hgly)]+(log bpqrs = 6.4(1)), [V(dipic)(gly)] (log bpqrs = 3.2(1)), [V(dipic)(gly)(OH)]- (log bpqrs = -3.7(2)) y [V(dipic)(gly)(OH)2]2- (log bpqrs = -13.83(5)), y finalmente en el sistema V(III) - cido dipicolnico - prolina se obtuvieron las especies [V(Hdipic)(Hpro)]2+(log bpqrs = 7.9(1)), [V(dipic)(Hpro)]+(log bpqrs = 5.92(7)), [V(dipic)(pro)] (log bpqrs = 1.98(9)) y [V(dipic)(pro)(OH)]-(log bpqrs = -5.1(2)).','2010-04-21','CONSTANTES DE FORMACIN, COMPLEJO TERNARIO.',6,1,1,1,1,'2013-09-17 08:30:35','2013-09-17 08:30:35','Documento_332.pdf','application/pdf',15421552,'2013-09-17 08:30:35',18,0,153,'COMPLETO'),(332,'EVALUACIN DEL PROCESO DE REMOCIN DE As (V) UTILIZANDO NANOPARTCULAS DE XIDO DE Fe COMO SISTEMA ADSORBENTE','La presencia natural o por fuentes antropognicas de As (V) en muestras de aguas de pozos subterrneos, en condiciones del medio oxidantes y de bajos pH, constituye actualmente un grave problema ambiental y de salud pblica. En varias regiones del mundo tales como Asia, Sudamrica y Europa, este tipo de aguas estn contaminadas con elevados niveles de As (V) y son consumidas por su poblacin como agua potable. El lmite establecido por la Organizacin Mundial de la Salud (OMS) para evitar la afectacin de la salud humana por As (V) en agua, es de 10 g/L, sin embargo en las regiones mencionadas la concentracin de este metaloide es del orden de los mg/L, de all que resulta urgente desarrollar metodologas eficientes de remocin de esta especie. En este sentido, este trabajo tuvo como objetivo principal desarrollar una metodologa para la remocin de As (V) en agua, utilizando Nanopartculas de xidos de hierro (Nps OxFe) como sistema adsorbente. Las Nps OxFe fueron producidas mediante Ablacin Lser (AL), bajo las siguientes condiciones: tiempo de ablacin de (15 minutos), concentracin de SDS (0,045 M), volumen (4 mL), energa del laser (146,5 mJ /pulso) y rea del spot (0,00145 cm2). Estas Nanopartculas (Nps) presentaron propiedades pticas relativas al fenmeno de Resonancia de Plasmn Superficial (SPR) con una banda ancha entre 330 y 340 nm, la cual es ms definida a pH fuertemente cido (pH=1). El ensanchamiento de dicha banda de SPR se debe a los efectos de confinamiento cuntico que se presentan en Nps de dimetro menores a 20nm, en este trabajo las Nps son susceptibles de dicho confinamiento dado que su dimetro promedio fue de 20 nm, segn la tcnica de Dispersin Dinmica de la Luz (DLS). La capacidad de Remocin de As (V) sobre las Nps OxFe fue de 24,3 mg As/g Nps Fe y los datos de adsorcin de este sistema Nps OxFe - As se ajustan al modelo lineal de isoterma de Langmuir con un coeficiente de correlacin R2= 0,980 y una KL de adsorcin de 3,847. Se encontr que la capacidad de adsorcin de las Nps OxFe es dependiente del pH del medio, obteniendo como pH ptimo (pH=1) para una remocin del 86% del analito. La metodologa de remocin de As (V) fue utilizada para la determinacin de este analito presente en muestras reales de agua. Para ello se enriquecieron muestras de agua potable y de agua de grifo con 3 mg/L de As (V). En ambos casos el porcentaje de recuperacin fue mayor al 96 % lo que indica la ausencia del efecto matriz en dichas muestras.','2010-04-20','Nanopartculas, Ablacin, Plasmn Superficial, isoterma de Langmuir',6,1,1,1,1,'2013-09-17 08:30:37','2013-09-17 08:30:37','Documento_333.pdf','application/pdf',0,'2013-09-17 08:30:37',19,0,0,'INCOMPLETO'),(333,'CLASIFICACIN DE TUMORES CEREBRALES DE ACUERDO AL GRADO DE MALIGNIDAD MEDIANTE EL ANLISIS DE PARMETROS CARACTERSTICOS DEL BORDE DEL TUMOR','En general los tumores presentan una forma irregular con propiedades geomtricas que parecen depender del grado de malignidad del tumor. Para estudiar estas irregularidades es necesario implementar procedimientos de segmentacin de imgenes para definir el contorno y las zonas activas del tumor. En el presente trabajo, imgenes de Resonancia Magntica con y sin contraste provenientes de un servicio de Radioterapia fueron utilizadas para evaluar los parmetros del contorno que pueden estar relacionados con el estadio de malignidad, teniendo como referencia la clasificacin de la lesin mediante estudios Histopatolicos, pudiendo as establecer una relacin entre dichos parmetros y la biologa del tumor. El contorno del tumor ha sido obtenido para cada plano de la imagen en su extensin volumtrica con la finalidad de obtener la dispersin de los valores en funcin del corte. Para obtener dichos contornos se han utilizado diferentes mtodos de segmentacin como el Mtodo del Umbral. Exponentes Crticos asociados a la rugosidad del contorno del tumor fueron calculados obteniendo resultados que demuestran una buena relacin entre dichos parmetros y el grado de malignidad del tumor.','2010-02-10','Segmentacin de Imgenes, Crecimiento tumoral, Estadio del tumor, Exponentes Crticos, Dimension Fractal',3,1,1,1,1,'2013-09-17 08:30:37','2013-09-17 08:30:37','Documento_334.pdf','application/pdf',450950,'2013-09-17 08:30:37',20,0,74,'COMPLETO'),(334,'VARIACINN MORFOLGGICA DE LA REGINN CEFLLICA DE ESPECIES DEL GNNERO CROTALUS,, UTILIZANDO MTTODOS DE MORFOMETRAA GEOMTTRICA','El estudio taxonmico de las serpientes de cascabel, al igual que el de muchas otras serpientes ha sido bastante complicado por la cantidad de variaciones que se pueden presentar en los caracteres ms comnmente utilizados como lo son lepidosis y patrones de coloracin, incluso dentro de poblaciones relativamente cercanas de una misma especie. Esta falta de caracteres cuantificables al momento de aceptar alguna de las clasificaciones propuestas hasta ahora, como vlida, ha llevado a una bsqueda de metodologas distintas para discernir entre los distintos grupos de cascabeles. Actualmente se consideran cinco grupos de cascabeles en el pas pero no se ha podido unificar un criterio para determinar si lo que esta presente en Venezuela son realmente cinco especies o una o ms especies con cierto nmero de subespecies. Esta necesidad de encontrar una metodologa que ayude a discernir entre un grupo y otro de manera ms concisa nos ha motivado a aplicar metodologas de anlisis de morfometra geomtrica a nivel ceflico para determinar si existen variaciones en la forma de la cabeza de los distintos grupos y as contribuir un poco a aclarar el estado taxonmico del gnero Crotalus en Venezuela. Objetivo General: En este trabajo se plantea como principal objetivo, la determinacin de las variaciones morfolgicas a lo largo del desarrollo ontogentico en la cabeza de los distintos representantes del gnero Crotalus en Venezuela, as como las variaciones nter especficas del gnero las cuales podran ser utilizadas en descripciones taxonmicas ms robustas de las especies estudiadas. Metodologa: Se va a realizar un anlisis morfomtrico utilizando el mtodo de cerchas (box truss). Se van a tomar fotos de las cabezas de los ejemplares del gnero Crotalus que se encuentren preservados en las principales colecciones herpetolgicas del pas, sobre dichas fotos se van a tomar un total de 26 hitos homlogos, 13 de la zona dorsal y 13 de la zona ventral, luego se van a medir un total de 53 distancias inter-hitos 26 en la zona dorsal y 27 en la zona ventral, y con dichas distancias se va a realizar un anlisis de componentes principales el cual permita eliminar el componente del tamao de los distintos ejemplares, de forma tal que permita analizar especficamente variaciones en la forma de los ejemplares. RESULTADOS Luego de realizado este estudio, podemos notar que efectivamente existen diferencias morfolgicas a lo largo del desarrollo ontogentico de los individuos, en las distintas especies y subespecies de serpientes de cascabel presentes en Venezuela. Estas diferencias morfolgicas a nivel ceflico siguen patrones distintos que van asociados a cada grupo en particular, ms sin embargo, observamos que las zonas de mayor variacin entre los distintos grupos, es la zona correspondiente a las Cerchas IV y V, siendo esto un resultado comn entre todos los grupos.Igualmente se puede observar que no existen evidencias de dimorfismo sexual a nivel ceflico en ninguno de los grupos estudiados as como tampoco se evidencia ningn patrn que permita hacer diferenciaciones entre los individuos estudiados segn sus localidades, sin embargo consideramos prudente la realizacin de estudios ms especficos y detallados para determinar o descartar diferencias morfolgicas intrapoblacionales de las distintas especies y subespecies. Los resultados obtenidos demuestran que efectivamente existen diferencias morfolgicas a nivel ceflico, entre los individuos adultos de las dos subespecies de C.. durissus que se encuentran en Venezuela, al igual que diferencias morfolgicas a nivel ceflico entre C.. maricelae y el resto de las cascabeles del pas. Sin embargo consideramos que dichas diferencias no poseen un peso suficiente como para sustentar o desestimar, alguna de las clasificaciones de las serpientes de cascabel venezolanas, existentes hasta ahora.','2010-04-30','Crotalus, cascabeles, morfometra geomtrica',1,1,1,1,1,'2013-09-17 08:30:38','2013-09-17 08:30:38','Documento_335.pdf','application/pdf',472182,'2013-09-17 08:30:38',18,0,56,'COMPLETO'),(335,'ESTUDIO DE ANISOTROPIA SISMICA BAJO EL OCCIDENTE DE VENEZUELA A PARTIR DEL DESDOBLAMIENTO DE ONDAS DE CORTE','En este trabajo, se realizo un estudio de anisotropa ssmica en la regin occidental de Venezuela analizando el desdoblamiento de ondas de corte de fases telessmicas SKS, en sismogramas grabados por la estaciones CAPV, CURV, DABV, JACV, MONV, SIQV, SOCV, TERV y VIRV pertenecientes a la Red Sismolgica nacional de FUNVISIS. Para el anlisis se empleo la metodologa desarrollada por Silver y Chan (1991). Los resultados obtenidos muestran que los tiempos de retraso varan en direccin SO-NE, donde el extremo NE muestra mayores porcentajes de anisotropa ssmica que el SO, es decir la deformacin del manto es mayor en el noreste. Las direcciones de polarizacin promedio en las estaciones ubicadas en las regiones del bloque de Maracaibo y los Andes de Venezuela (CAPV, CURV, QARV, SOCV y VIRV) coinciden, aproximadamente, con la direccin E-O del movimiento absoluto de placas (MAP) de Sudamrica, en cambio, las estaciones ubicadas en el bloque de Bonaire (DABV, JACV y MONV) muestran direcciones de polarizacin que coinciden con las fallas superficiales cercanas a las estaciones lo que indica que el proceso de deformacin del manto es diferente en esta regin. Resultados anmalos se encontraron en las estaciones TERV y SIQV, ubicadas en la regin de los andes y la regin del bloque de Maracaibo, respectivamente, donde las direcciones de polarizacin y su promedio difieren en 90 grados, aproximadamente, de la direccin del MAP de Sudamrica y tampoco coinciden con la direccin SO-NE de las estructuras geolgicas superficiales cercanas a las estaciones, estos resultados, que son distintos a los obtenidos en otras estaciones muy cercanas (CURV, DABV y QARV) indican que el flujo del manto puede estar siendo alterado por alguna estructura u obstculo.','2010-04-06','Anisotropa Ssmica, Desdoblamiento de Ondas de Corte, Tiempo de Retraso, Manto Superior',3,1,1,1,1,'2013-09-17 08:30:39','2013-09-17 08:30:39','Documento_336.pdf','application/pdf',713242,'2013-09-17 08:30:39',20,0,104,'COMPLETO'),(336,'EVALUACIN DE LA VARIACIN EN PROFUNDIDAD DE LA ANISOTROPA SSMICA EN LA REGION NOR-ORIENTAL DE VENEZUELA','Las caractersticas anisotrpicas bajo el noreste de Venezuela son estudiadas por medio del anlisis del desdoblamiento de ondas de corte medido en 346 sismos locales. Las formas de onda usadas fueron registradas entre 2003 y 2009 por las estaciones banda-ancha AVEV, BLOS, CRUV, CUPC, DRKS, GUIV, GUNV, IBAV, ITEV y MIPC, pertenecientes a la red sismolgica de FUNVISIS y al arreglo telemtrico de Venezuela (proyecto BOLIVAR). En esta regin convergen el sistema transpresivo asociado a las Fallas de El Pilar, Los Bajos- El Soldado, y La subduccin entre las Placas Sur-Americana y Caribe, causando que el rea sea geodinmicamente compleja. La polarizacin medida en estaciones instaladas en el continente es coherente con los principales accidentes geolgicos de la regin (i.e. falla El Pilar y Graben de San Juan), mientras que en las regiones de ante-arco y retro-arco, pasa de ser normal a sub- paralela a la trinchera de las Antillas Menores. En la placa Caribe la polarizacin pareciera coincidir con el mximo esfuerzo compresional (shmax) regional, y en el caso especfico de IBAV coincide con el rumbo de la falla de Punta Arenas. Los valores de tiempo de retraso medido a lo largo del noreste de Venezuela son bastante pequeos (tmax dtmax = 0,22 s), estables, y no evidencian dependencia alguna con la profundidad. El anlisis de la magnitud de anisotropa en sismos localizados por debajo de los 140 Km de profundidad y la consideracin de los resultados obtenidos mediante fases telessmicas (ej. SKS) en estudios anteriores, indica que la anisotropa bajo el noreste de Venezuela est contenida principalmente en dos capas: en la corteza y regiones someras del manto superior (menor a 65 Km), y por encima de los 130 Km de profundidad, mientras, la cua mantlica aparenta ser isotrpica.','2010-04-15','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',3,1,1,1,2,'2013-09-17 08:30:41','2013-09-17 08:30:41','Documento_337.pdf','application/pdf',1116114,'2013-09-17 08:30:41',20,0,90,'COMPLETO'),(337,'Propuesta de diseo de una solucin de videovigilancia soportada en cmaras IP con tecnologa IEEE 802.11 para el Edificio el Rectorado, la Plaza Cubierta y el Complejo Cultural Aula Magna de la UCV','Debido a los diversos ataques en los que se ha visto involucrada la UniversidadCentral de Venezuela, surgi la necesidad de una propuesta de diseo de una solucinde videovigilancia soportada en cmaras IP, con la finalidad de incrementar los nivelesde vigilancia en el Edificio el Rectorado, la Plaza Cubierta y el Complejo Cultural AulaMagna de la UCV. Esta fue la propuesta de la Direccin de Tecnologa de Informaciny Comunicaciones (DTIC), con el objetivo de reforzar los niveles de seguridad y de estamanera brindar tranquilidad a la comunidad universitaria.En este Trabajo Especial de Grado se presenta el diseo, los dispositivosinalmbricos usados y unas pruebas de funcionamiento, que dan soporte al diseo dela solucin. Los dispositivos inalmbricos involucrados en el diseo estn basados enel fabricante Cisco Systems. La propuesta de diseo de la solucin de videovigilanciase basa en el estndar IEEE 802.11 y as mismo se propone la implementacin de QoS(Quality of Service), especficamente del mecanismo de DiffServ (DifferentiatedServices), con la finalidad de evitar la congestin del trfico que transita por la red. A suvez para validar esta propuesta de diseo, se realizaron diversas pruebas. El resultadofinal, es una solucin de videovigilancia soportada en una WLAN completamentefuncional, que cumple con los requisitos exigidos por la DTIC y por la Direccin deSeguridad de la UCV.','2010-05-03','WLAN, IEEE 802.11, Quality of Service, QoS, Differentiated Services, DiffServ, cmaras IP.',2,1,1,1,1,'2013-09-17 08:30:43','2013-09-17 08:30:43','Documento_338.pdf','application/pdf',1426004,'2013-09-17 08:30:43',20,0,128,'COMPLETO'),(338,'ESTUDIOS DE ADSORCINN DE LAS SUBFRACCIONES A11 Y A22 DE ASFALTENOS SOBRE SUPERFICIES INORGNNICAS\"\"','La industria petrolera venezolana est enfocada en la bsqueda de una explotacin eficaz del crudo, por lo cual busca minimizar los gastos e inconvenientes que puedan presentarse en todos sus procesos. Los crudos pesados se caracterizan por poseer alta viscosidad debido a su alto contenido de asfaltenos, los cuales tienden a asociarse entre s para formar agregados, que luego continan asocindose hasta formar flculos que, posteriormente precipitan y obstaculizan determinados procesos en la industria. Debido a la inquietud que se tiene acerca de la diferencia en cuanto al comportamiento coloidal de los asfaltenos, algunos trabajos reportan su fraccionamiento a fin de simplificar su estudio. Estas fracciones conocidas como A1 y A2 presentan comportamiento diferente de solubilidad, por lo que en este trabajo se propone como objetivo principal el estudio de diferencias a nivel molecular a partir de la adsorcin de las subfracciones A1 y A2 de asfaltenos provenientes de los crudos Carabobo y Furrial sobre superficies inorgnicas. A partir de las soluciones de A1 y A2 en cloroformo en un rango de concentraciones comprendido entre 500 y 20000 mg/L, se construyeron isotermas de adsorcin representando el espesor de capa en funcin de la concentracin en solucin empleando un interfermetro de luz blanca de barrido modelo New View 600. Los resultados encontrados revelan que para el crudo Carabobo (estable) la formacin de agregados se traduce en un incremento en el tamao de las partculas de los asfaltenos, mientras que para el crudo Furrial (inestable); la formacin de agregados est gobernada por el aumento en el nmero de los mismos, formando multicapas en la superficie.','2010-05-06','Adsorcin, Asfaltenos, A1, A2, agregados, Interferometra',6,1,1,1,1,'2013-09-17 08:30:44','2013-09-17 08:30:44','Documento_339.pdf','application/pdf',1507362,'2013-09-17 08:30:44',19,0,77,'COMPLETO'),(339,'DESARROLLO DE UN TEXTURIZADO FUNCIONAL A BASE DE PULPA DE PARCHITA (Passiflora edulisvar. Flavicarpa) Y GELATINA CON INCORPORACIN DE INGREDIENTES PROBITICOS Y PREBITICOS','Fue desarrollado un texturizado funcional a base de pulpa de parchita y gelatina incorporando ingredientes prebitico (Inulina) y probitico (encapsulados de bfidobacterias en alginato de sodio). En la primera fase del trabajo, se realizaron ensayos preliminares para determinar la concentracin de los componentes principales del texturizado, obteniendo una formulacin final de 30% de Pulpa de Parchita ajustada a 30Brix, 6% de Gelatina, 1% de Inulina y aproximadamente 8 g de encapsulados de bfidobacterias. En una segunda fase, se realiz un anlisis fsico, qumico, microbiolgico y sensorial de los texturizados formulados, durante un periodo de 27 das para as tener una idea de la estabilidad de stos y adicionalmente determinar la aceptabilidad por parte de los consumidores. El texturizado funcional de parchita, present caractersticas fisicoqumicas resaltantes, como un bajo pH (<4) y una actividad de agua de 0,965 las cuales permitieron que el producto fuera muy estable, tanto fisicoqumica, como microbiolgicamente durante su almacenamiento bajo refrigeracin. Sin embargo, la medicin de textura (Dureza) instrumental y sensorial de los texturizados report cambios significativos de este parmetro durante el almacenamiento de los mismos.Los resultados obtenidos en las pruebas sensoriales realizadas, indican que el producto final fue ampliamente aceptado por los consumidores y que no presenta cambios significativos en caractersticas de olor, color y sabor, lo que es de gran importancia.','2010-04-30','Texturizado, Alimento Funcional, Probiticos, Passiflora edulis, Pulpa de Parchita',1,1,1,1,1,'2013-09-17 08:30:48','2013-09-17 08:30:48','Documento_340.pdf','application/pdf',1557768,'2013-09-17 08:30:48',20,0,105,'COMPLETO'),(340,'Desarrollo de un agente para la captura de datos agronmicos desde dispositivos mviles utilizando la metodologa JADE','El estudio y clasificacin de suelos resulta ser una actividad imprescindible para el manejo sustentable de este recurso en mltiples actividades humanas. Un problema al que se enfrentan los investigadores en esta rea est relacionado con la manera cmo se organiza y gestiona la informacin que se genera desde las distintas fuentes utilizadas, tales como: imgenes satelitales, levantamiento de suelos, resultados de distintas pruebas de laboratorio, entre otras. Con el fin de apoyar a los profesionales en esta actividad, se ha propuesto un sistema basado en agentes inteligentes para el almacenamiento, gestin y clasificacin de datos. En este sistema se contempla el diseo y construccin de un agente que permita la captura de datos desde un dispositivo mvil, que es el motivo del presente trabajo. El agente beneficia el proceso de recoleccin de datos, haciendo la captura y el registro de los datos de campo desde la misma aplicacin; a diferencia de los procesos manuales, los cuales requieren realizar gastos adicionales de tiempo y recursos, para la validacin y el almacenamiento de los datos. Adems, el agente proporciona asistencia al especialista durante el proceso de captura.','2010-05-06','Agente, Captura de datos, dispositivo mvil, JADE, metodologa de agentes, Siscla, Agentes Inteligentes, agronoma, edaflogo, agrologo, Laboratorio de Inteligencia Artificial',2,1,1,1,1,'2013-09-17 08:30:49','2013-09-17 08:30:49','Documento_341.pdf','application/pdf',2161039,'2013-09-17 08:30:49',20,0,100,'COMPLETO'),(341,'Ecuaciones de inferencia entre cociente S y susceptibilidad magntica del pozo Saltarn 1A, usando redes neuronales difusas','En este trabajo se ha utilizado las redes neuronales difusas (RND), en la inferencia del cociente S (CS ) a travs de la susceptibilidad magntica (h). Se cuenta con 90 datos experimentales de h y CS , las cuales abarcaron 670 metros de profundidad, del pozo Saltarn 1A, localizado al este de Colombia (cuenca de los Llanos Orientales). Las pruebas computacionales se hicieron tomando en cuentas dos tipos de divisiones: a) por formaciones litolgicas (Guayabo, Len y Carbonera), b) por envolventes transgresivas (envolvente 1, envolvente 2 y envolvente 3). Las ecuaciones provenientes de los entrenamientos para una determinada formacin o envolvente, no infieren correctamente al evaluarlas con los datos de h de las otras dos formaciones y envolventes. Sin embargo, las ecuaciones derivadas del entrenamiento de la Formacin Guayabo del pozo Saltarn 1A, infieren adecuadamente al evaluarlas con los datos experimentales de la h de los pozos G-1X y G-8X, pertenecientes a la Formacin Guayabo del campo Guafita, sur-oeste de Venezuela. De estudios anteriores se sabe que el pozo Saltarn 1A, en la Formacin Guayabo, presenta una anomala magntica tipo A, producida principalmente por framboides de magnetita autignica y con una relacin gentica con un posible yacimiento de hidrocarburos subyacente. Por otro lado, se conoce que el pozo G-1X presenta tambin una anomala tipo A y otra tipo B (contraste litolgico sin relacin gentica con el hidrocarburo subyacente), mientras que el pozo G-8X posee nicamente una anomala tipo B. De esta forma es importante destacar que la mejor inferencia de las reglas difusas derivadas de la Formacin Guayabo en el pozo Saltarn 1A se obtiene precisamente para la anomala tipo A de G-1X. Por otro lado para el pozo G-1X se emple el modelo A (simple), mientras que para el pozo G-8X se us el modelo B (semi-Log), con un ligero empeoramiento en la inferencia del CS . Esta diferencia de modelos para la inferencia del CS , puede ser debida a la diferencia en el origen de las anomalas magnticas que se encuentran en ambos pozos. Las ecuaciones asociadas a la Formacin Guayabo perteneciente al pozo Saltarn 1A, infieren razonablemente bien sobre otros datos experimentales de h si stos son similares a su litologa y tipos de ambientes.','2010-03-24','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Table Normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',3,1,1,1,1,'2013-09-17 08:30:52','2013-09-17 08:30:52','Documento_342.pdf','application/pdf',10378482,'2013-09-17 08:30:52',20,0,106,'COMPLETO'),(342,'Evaluacin del efecto anti-inflamatorio de compuestos kauranos extrados de plantas del gnero Croton.','Los productos naturales pueden definirse como una sustancia qumica que esta presente o es producida por un organismo vivo. Muchos de los compuestos utilizados en el tratamiento de enfermedades relacionadas con la inflamacin, son obtenidos de los extractos de plantas y otros organismos; y stos incluyen diversos compuestos como fenoles, terpenoides, alcaloides, esteroides, glicsidos y carbohidratos. Bajo esta premisa el objetivo de este trabajo es estudiar el efecto antiinflamatorio de los compuestos extrados de plantas del gnero Croton: Micanol, KAJ y Deoxo-geayine, sobre leucocitos humanos y macrfagos mridos Raw 264.7.Para esto se aplicaron las siguientes tcnicas y metodologas: determinacin del efecto de compuestos kauranos Micanol, KAJ y Deoxo-geayine sobre la inhibicin de la produccin de xido ntrico en macrfagos mridos RAW 264.7 (mtodo de Griess), los ensayos de viabilidad celular por el mtodo de reduccin de MTT, la actividad captadora del radical xido ntrico (NPS) por parte de los compuestos, el mtodo de reduccin del azul de nitrotetrazolio (NBT) para cuantificar la variacin en la produccin de anin superxido involucrada en la cascada de reacciones pro-inflamatorias inducida por el PMA en leucocitos humanos, el ensayo de la capacidad oxidativa por citometra de flujo, la determinacin del potencial de captacin de radicales libres mediante el uso de DPPH y finalmente el ensayo de proliferacin por citometra de flujo. Lo que representa los ensayos iniciales para cada compuesto, y el punto de partida para estudios posteriores de su posible aplicacin como frmacos.Como resultados y conclusin, los compuestos Micanol, KAJ y Deoxo-geayine, tienen una potencial actividad anti-inflamatoria debido a que: disminuyen la viabilidad sobre las lneas celulares leucmicas, y no afectan la viabilidad de los leucocitos humanos. En macrfagos mridos RAW 264.7 inhiben la cantidad de nitritos producidos; los compuestos Micanol y Deoxo-geayine son capaces de inhibir la produccin de anin superxido en leucocitos humanos estimulados con PMA, y por ltimo estos compuestos tienen efectos directos sobre las clulas induciendo cambios en el patrn de produccin de radicales, viabilidad y proliferacin celular.','2010-05-03','Kauranos, Euphorbiaceae, Inflamacin, anticanceroso, citotoxicidad, antitumoral, terpeno, diterpeno, flavonoide.',1,1,1,1,1,'2013-09-17 08:30:55','2013-09-17 08:30:55','Documento_343.pdf','application/pdf',6515795,'2013-09-17 08:30:55',17,0,153,'COMPLETO'),(343,'IMPLEMENTACINN DEL PLAN DE MANEJO DE DESECHOS SLLIDOS PELIGROSOS DERIVADOS DE LA MANUFACTURA DE SABORES CONCENTRADOS PARA BEBIDAS CARBONATADAS Y NO CARBONATADAS','La generacin de desechos slidos es parte indisoluble de las operaciones de manufactura en la industria. Considerando que dentro de las etapas del ciclo de vida de los desechos slidos (generacin, transportacin, almacenamiento, recoleccin, tratamiento y disposicin final), las empresas constituyen el escenario fundamental, en el que se desarrollan y se vinculan las diferentes actividades asociadas al manejo de los mismos, resulta esencial el tratamiento acertado de estos temas y su consideracin de forma priorizada en el contexto de las actividades de Gestin Ambiental, a travs de los cuales se potencie el establecimiento de esquemas de manejo seguro que garanticen un mayor nivel de proteccin ambiental, como parte de las metas y objetivos de los diferentes sectores productivos y de servicios, en funcin de la Excelencia Empresarial. PEPSI-COLA VENEZUELA, C.A, empresa perteneciente al sector de bebidas refrescantes dedicada a la produccin de bebidas carbonatadas y no carbonatadas, preocupada por mejorar su desempeo ambiental, propicia el espacio para un detallado diagnstico ambiental de los procesos de manufactura de concentrados lquidos en el centro productivo PCV Planta de Concentrados, herramienta que fue crucial para la implementacin de su plan de manejo de desechos peligrosos slidos. Este diagnstico sirvi de base para desarrollar todas las actividades necesarias que permitieran mitigar los impactos ambientales identificados, enfocndose en una fase inicial en los residuos slidos peligrosos, ya que estos se generan en los procesos productivos de mayor relevancia. A partir de este estudio, se establecieron los procedimientos necesarios para garantizar el manejo adecuado de los desechos slidos peligrosos derivados de los procesos de manufactura de bases concentradas para Bebidas Carbonatadas y No Carbonatadas, los cuales ascienden a 21.273 Kg, cifra que constituye el 49% de los desechos slidos generados por PCV Planta de Concentrados, ubicndose dentro de la categora de Grandes Generadores de desechos peligrosos, de acuerdo con el Art.42. del Decreto No.2.635, relativo al control Administrativo de Generadores de Desechos Peligrosos. Como resultado de la formulacin e implementacin del Plan de Manejo de Desechos Peligrosos Slidos (PMDPS), se logr incrementar el nivel de cumplimiento legal-ambiental de la planta en un 59,24% en su primera etapa, con la construccin y adecuacin de un Almacn Temporal de Desechos Peligrosos, de conformidad con los lineamientos establecidos en el Decreto 2.635, contentivo de las Normas para el Control de la Recuperacin de Materiales Peligrosos y el Manejo de los Desechos Peligrosos, estimndose un incremento del 97,27% para finales del perodo 2009-2010. Adicionalmente, se impulsaron proyectos de ingeniera e infraestructura de gran envergadura en materia de adecuacin de reas de almacenamiento de sustancias peligrosas, que contribuirn a incrementar el estndar de operacin de la planta, al minimizar los riesgos asociados con las operaciones de manejo de insumos dentro de las reas productivas.','2010-04-30','Desechos peligrosos, desechos slidos, gestin de desechos peligrosos',6,1,1,1,1,'2013-09-17 08:30:59','2013-09-17 08:30:59','Documento_344.pdf','application/pdf',0,'2013-09-17 08:30:59',20,0,0,'INCOMPLETO'),(344,'Deteccin de algunas mutaciones comunes en los genes BRCA1 y BRCA2 en mujeres con cncer de mama del tipo hereditario.','El cncer de mama es la quinta causa de muerte a nivel mundial y la segunda entre las mujeres, en las cuales, el 10% son del tipo hereditario, debido principalmente a mutaciones germinales en los genes BRCA11 y BRCA22. Se han detectado ms de 1600 mutaciones en estos genes, siendo las deleciones e inserciones las que tienen un comprobado efecto patolgico. Algunas mutaciones se han detectado ms comnmente en grupos tnicos particulares. En Venezuela no se han realizado estudios de este tipo y es por ello, que en el presente trabajo se procedi a la determinacin de la presencia de mutaciones debidas a inserciones o deleciones en los genes BRCA11 (c.943ins10, c.1135insA, c.1623del5, c.2080delA, c.2552delC, c.3450del4, c.3875del4 y c.5083insC) y BRCA22 (c.3036del4, c.3492insT, c.6696delTC y c.9254del5), ms comnmente encontradas en la poblacin espaola, italiana, africana y latinoamericana en general; poblaciones de gran influencia en la composicin actual de nuestra poblacin. Adems, se analiz la presencia de las mutaciones encontradas con mayor frecuencia en la poblacin mundial general, con efecto fundador en la poblacin Juda-Ashkenazi (c.185delAG y c.5382insC para el gen BRCA11 y c.6174delT en BRCA22). Para llevar a cabo este estudio, a partir del ADNg aislado de 48 muestras de sangre de pacientes venezolanos con cncer de mama del tipo hereditario, diagnosticadas por el Centro Clnico de Estereotxia (CECLINES), se procedi inicialmente a la deteccin de las mutaciones mediante PCR y electroforesis en geles de poliacrilamida en condiciones desnaturalizantes. Con esta tcnica se logr evaluar las mutaciones de origen Judo-Ashkenazi, las cuales no estuvieron presentes en la muestra poblacional analizada. Debido a dificultades en la estandarizacin de esta tcnica para evaluar el resto de las mutaciones se procedi al uso de la tcnica de SSCP (Conformacin de Polimorfismos de cadena Sencilla). Con el uso de ambas metodologas, en total, se detectaron 7 mutaciones diferentes distribuidas en 8 pacientes. Cinco de las mutaciones detectadas se hallan en el exn 11 del gen BRCA11; c.1128_1136insA, p.P871L, p.K1183R y p.S694S, ya reportadas previamente, y c.951_952insA, mutacin descrita por primera vez en este estudio. En BRCA22 se detectaron las mutaciones c.2733insA y c.3036_3039del4 en el exn 11, de las cuales, la primera no ha sido reportada y la segunda si esta reportada en BIC (Breast Cancer Information Core). Este estudio constituy el primero realizado en Venezuela para la evaluacin del espectro mutacional de BRCA11//22 en el pas, mediante estudios posteriores, ser posible establecer la poblacin con mayor riesgo de padecer la enfermedad, con la finalidad de aumentar la vigilancia mdica en pro de la deteccin temprana de la enfermedad, y la aplicacin del consejo gentico en las pacientes portadoras.','2010-04-30','Cncer de mama, BRCA1, BRCA2, mutacin fundadora.',1,1,1,1,1,'2013-09-17 08:31:00','2013-09-17 08:31:00','Documento_345.pdf','application/pdf',1216393,'2013-09-17 08:31:00',20,0,107,'COMPLETO'),(345,'\"ESTUDIO DE LA TENSIN INTERFACIAL DE LAS FRACCIONES A1 Y A2DE ASFALTENOS CARABOBO Y FURRIAL\"','En este trabajo se determin la tensin superficial de los asfaltenos Furrial y de Carabobo as como de sus subfracciones (A1 y A2), empleando el mtodo de la gota en reposo. Para ello se desarroll y empleo una metodologa que consisti en la adsorcin de asfaltenos y sus subfracciones, a partir de soluciones de 10000ppm de las mismas sobre superficies slidas, en este caso vidrio. El equipo utilizado para estas medidas se desarroll en el laboratorio de Espectroscopa Lser en la Facultad de Ciencias, UCV. Los resultados obtenidos demuestran que los asfaltenos del crudo Carabobo, presentan los mayores valores de ngulo de contacto es decir presentan mayor carcter hidrofbico. Para las muestras del crudo Furrial se encontr menor carcter hidrofbico, por lo que debe poseer mayor cantidad de compuestos polares del tipo puente de hidrgeno. Las subfracciones presentaron menores ngulos de contacto, esto se debe a que al fraccionar a los asfaltenos, existe una distribucin de compuestos que exhiben centros activos a su interaccin con el solvente conduciendo a un mayor carcter hidrofilico. Se realizaron medidas de espesores de capa adsorbida (asfaltenos y subfracciones) sobre vidrio, encontrando evidencias de que A1 se agrega mucho ms posiblemente por el tipo de estructura que presenta esta fraccin, ya que est conformada por anillos aromticos que estn enlazados entre s, haciendo una estructura rgida, que no permite una buena interaccin con el solvente, a diferencia de A2 donde sus anillos estn unidos por cadenas alifticas que le confiere flexibilidad y una mejor interaccin con el solvente. Por otro lado las diferencias entre Furrial y Carabobo se basan en la mayor tendencia de agregacin de los asfaltenos de Furrial debido a un aumento en el nmero de agregados, mientras que Carabobo tiende a aumentar es en el tamao de los agregados ya que mostraron mayor espesor de capa.','2010-04-28','{}',6,1,1,1,1,'2013-09-17 08:31:01','2013-09-17 08:31:01','Documento_346.pdf','application/pdf',0,'2013-09-17 08:31:01',17,0,0,'INCOMPLETO'),(346,'Estudio de los Complejos de Vanadio de Valencia Mixta ((IV,, V)) y la Glicina ((KCl 33..00 M,, 2255 C)) Estudio de los Complejos de Vanadio de Valencia Mixta ((IV,, V)) y la Glicina ((KCl 33..00 M,, 2255 C))','En este trabajo se estudiaron las reacciones de formacin de los complejos de vanadio valencia mixta (IV, V) y el aminocido glicina, realizados mediante medidas de fuerzas electromotrices emf (H). Los datos fueron analizados utilizando el programa computacional de mnimos cuadrados generalizados LETRAGROP, tomando en consideracin los productos de hidrlisis de los iones de vanadio (IV, V), las constantes de acidez del ligando empleado y las constante de formacin de los complejos. E n el Sistema H+ - VO2+ - VO2+ - glicina el modelos que mejor ajusto los datos experimentales incluyo a las espcies : [HV2O3C]3+ (Log pqrs = 32.43(4)), [HV2O3C2]2+ (Log pqrs = 41.63(7)), [H2V2O3C2]3+ (Log pqrs = 42.9 < 43.6), [V2O3C]2+ (Log pqrs = 28.9(3)), [V2O3C2]+ (Log pqrs = 36.8 < 37.7). [(OH)V2O3C]+ (Log pqrs = 26.54(5)), [ (OH)2V2O3C] (Log pqrs = 22.70(3)). Y finalmente, los valores de pKa para el ligando protonado y neutro fueron: H2C+ pKa= 2.72 (2) y HC pKa= 10.09 (3)','2010-05-06','TEG',6,1,1,1,1,'2013-09-17 08:31:02','2013-09-17 08:31:02','Documento_347.pdf','application/pdf',1472797,'2013-09-17 08:31:02',15,0,147,'COMPLETO'),(347,'SNNTESIS DE POLMMEROS ARCILLA -- NANOCOMPOSITOS A TRAVSS DE POLIMERIZACINN VAA RADICAL POR TRANSFERENCIA ATMMICA ((ATRP))','En el presente trabajo de investigacin se sintetiza polimetacrilato de metilo (PMMA) arcilla nanocomposito mediante ATRP a temperaturas de 25, 40 y 80 C. Para lograr este producto, fue necesario partir de la modificacin orgnica de la arcilla Montmorillonita clcica (MMT-Ca) con una sal de amina cuaternaria, en este caso se utiliz bromuro de cetil trimetil amonio, para crear un ambiente organoflico adecuado a la sntesis de los polmeros. Con la intercalacin de la sal, se consigui incrementar el espaciado interlaminar de la arcilla de 15,68 a 19,48 , lo cual fue comprobado mediante DRX y la aplicacin de la ley de Bragg. Seguidamente se sintetiz el complejo Clorodiacetilbutil-(2,4,6-trimetilfenil) imina de cobre (I) partiendo del ligando a-diimina Diacetilbutil-(2,4,6- trimetilfenil) imina, (sintetizado con un 57 % de rendimiento) y CuCl con 72 % de rendimiento, para intercalarlo en la arcilla modificada y as ser empleado como catalizador en la sntesis en fase heterognea de PMMA. Los resultados experimentales muestran que es posible llevar a cabo la polimerizacin de PMMA nancomposito mediante ATRP bajo estas condiciones, y que se obtienen nanocompositos intercalados, exfoliados y en fase separada, observados en las micrografas de microscopa electrnica de trasmisin, tomadas a los productos de sintetizados.','2010-05-04','POLIMEROS, NANOCOMPOSITOS, MONTMORILLONITA, ALFADIIMINA, ATRP',6,1,1,1,1,'2013-09-17 08:31:05','2013-09-17 08:31:05','Documento_348.pdf','application/pdf',1762216,'2013-09-17 08:31:05',20,0,95,'COMPLETO'),(348,'Desarrollo del mdulo WebQuest basado en la especificacin IMS Learning Design para la creacin de cursos en la plataforma Moodle','El presente trabajo consiste en el diseo e implementacin del mdulo WebQuest basado en la especificacin IMS Learning Design para la creacin de cursos en el Sistema de Gestin de Cursos Moodle. En la actualidad Moodle no cuenta con formatos para la creacin de cursos basados en Estrategias de Aprendizaje que proporcionen un aprendizaje significativo y el cumplimento de las necesidades instruccionales sin requerir la seleccin e implementacin de una Estrategia de Aprendizaje de manera correcta por parte del docente. Se utiliz la Estrategia de Aprendizaje Colaborativo WebQuest porque est centrada en los estudiantes y puede ser utilizada en diferentes niveles de instruccin o contextos educativos de manera sencilla y eficaz por medio de un conjunto de actividades guiadas por el docente para la resolucin de un problema. Por estas razones se desarroll un mdulo basado en la Estrategia de Aprendizaje WebQuest que adems de permitir el desarrollo de cursos en la plataforma Moodle, se basa en la especificacin IMS Learning Design para la generacin de Unidades de Aprendizaje a partir de estos cursos, permitiendo su reutilizacin en diferentes plataformas o sistemas de Enseanza - Aprendizaje que soporten dicha especificacin. El proceso de generacin de Unidades de Aprendizaje a partir de los cursos creados por medio del mdulo WebQuest se realiz en un mdulo independiente para cumplir con el principio de modularidad de la plataforma y para proveer la posibilidad de integracin de esta funcionalidad con diversos mdulos. Para el desarrollo de ambos mdulos se utiliz el mtodo de desarrollo Unificado gil (Agile Unified Proccess), realizando tres iteraciones que permitieron la implementacin de funcionalidades y mejoras de manera incremental. En la primera iteracin se implement el proceso de creacin de cursos basados en la Estrategia de Aprendizaje WebQuest en el Sistema de Gestin de Cursos Moodle. En la segunda iteracin se realiz el proceso de generacin de Unidades de Aprendizaje segn la especificacin IMS Learning Design a partir de los cursos creados mediante la primera iteracin. Y se realiz una tercera y ltima iteracin para facilitar el proceso de importacin de usuarios de cursos disponibles en cualquier formato en el Sistema de Gestin de Cursos Moodle a cursos creados mediante la primera iteracin.','2010-05-06','Estrategia de Aprendizaje, WebQuest, Aprendizaje Colaborativo, IMS Learning Design, Diseo de Aprendizaje, Unidad de Aprendizaje, Moodle, Sistema de Gestin de Cursos, curso web, entorno virtual de aprendizaje, plataforma virtual educativa, proceso de E',2,1,1,1,1,'2013-09-17 08:31:08','2013-09-17 08:31:08','Documento_349.pdf','application/pdf',5094367,'2013-09-17 08:31:08',20,0,99,'COMPLETO'),(349,'Morfologa del gnero AbutilonMill. (Malvaceae) en Venezuela','La palinologa es la ciencia que estudia el polen y las esporas. La morfologa del polen posee alto valor diagnstico por ser un caracter reproductivo y porque sus paredes tienen una composicin qumica que le permiten conservarse por miles de aos. En taxonoma, la contribucin de la palinologa se concentra en la exina, ya que sta incorpora un gran nmero de caracteres diagnsticos fcilmente estudiables, y tambin porque los estudios de polen fsil estn hechos con base en el esqueleto de la exina. Para Venezuela los trabajos en morfologa del polen son numerosos; sin embargo, no se encontraron para la familia Malvaceae Juss. En el presente trabajo se estudi la morfologa del polen del gnero AbutilonMill. como una contribucin a la taxonoma del grupo. Este gnero pertenece a la tribu Malveae, familia Malvaceae, con 11 especies en Venezuela, de las cuales A.. burandtiiy A.. cuspidatum son endmicas. Se analizaron 10 muestras de polen provenientes de material de herbario, incluyendo A.. divaricatum (excluida del Nuevo Catlogo de la Flora de Venezuela) A.. striatum (especie cultivada, pero reportada en la Flora de vila como naturalizada) y Pseudabutilon umbellatum (muy cercana al gnero). Se midieron, al MO, 30 granos acetolizados por especie (en vista polar y ecuatorial) en la exina, aberturas y espinas; al MEB se detall la ornamentacin de la exina y las aberturas. Los datos obtenidos se analizaron para evaluar si haba diferencias estadsticamente significativas. Como resultado se encontr que el polen de Abutilonesgrande, suboblato - oblato- esferoidal, 3-(4)zonocolporado, con anillo; tectado, equinado, imperforado - foveolado, con espinas erectas o torcidas y disco basal. Se determin que los caracteres cuantitativos de los granos de polen evaluados, as como la forma de estos y la perforacin del tectum, son tiles para la separacin de las especies y fueron utilizados en la elaboracin de la clave palinolgica.','2010-04-26','Polen, Abutilon, Malvaceae, palinologa',1,1,1,1,1,'2013-09-17 08:31:11','2013-09-17 08:31:11','Documento_350.pdf','application/pdf',0,'2013-09-17 08:31:11',20,0,0,'INCOMPLETO'),(350,'FRACCIONAMIENTO DE RESINAS I Y DE RESINAS II Y CARACTERIZACIN MOLECULAR','El estudio de los asfaltenos se ha incrementado en los ltimos aos debido a su fenmeno de precipitacin, el cual se manifiesta en prcticamente todas las etapas de la industria petrolera. Los asfaltenos se encuentran en el crudo como una suspensin coloidal gracias a la participacin de otra fraccin importante del crudo como son las resinas. Muchos investigadores afirman que las resinas son las responsables de mantener dispersos a los coloides asfaltnicos, sin embargo las caractersticas moleculares de los compuestos de esta fraccin no se conocen completamente. Algunos de los argumentos empleados para explicar el papel de las resinas en los mecanismos de dispersin coloidal de asfaltenos, se fundamentan en las caractersticas estructurales de las resinas y en la existencia de 2 tipos de resinas en los crudos, siendo la resina I aquella fraccin que coprecipita con los asfaltenos y la resina II la remanente en los maltenos. Este trabajo reporta el fraccionamiento de resinas I y II, basado en las diferencias de adsorcin sobre gel de slice y la posterior caracterizacin molecular de las sub-fracciones, con la idea de establecer relaciones entre estructura-actividad dispersante de asfaltenos en crudos. Para esto, se emple la espectroscopia de infrarrojo empleando mtodos cuantitativos de anlisis mediante integraciones en los espectros de IR de las seales ms resaltantes, como bandas representativas de compuestos aromticos, alifticos, carbonlicos y sulfxidos. Resultando de la informacin espectroscpica diferencias de aromaticidad en algunas fracciones y un mayor contenido de compuestos carbonlicos y sulfxidos en las fracciones ms polares de las resinas, separadas por adsorcin en silica gel. Adems se encontr que las resinas II y los crudos estables presentaron el mayor porcentaje de carbonilos, por lo que se presume que estos grupos funcionales son los responsables de fuertes interacciones con grupos bsicos de los asfaltenos, inhibiendo entonces su agregacin.','2010-05-03','CRUDO, FRACCIONAMIENTO, RESINAS, CARACTERIZACIN MOLECULAR',6,1,1,1,1,'2013-09-17 08:31:13','2013-09-17 08:31:13','Documento_351.pdf','application/pdf',31404752,'2013-09-17 08:31:13',18,0,126,'COMPLETO'),(351,'estudio de la cintica de agregacin de asfaltenos furrial y carabobo a partir de la medida de dispersin dinmica de luz en funcin del tiempo','Los asfaltenos presentan impactos negativos en varias de las estapas de produccin en la industria petrolera. Muchos de los problemas estn relacionados al caracterstico estado coloidal en que se encuentran los asfaltenos en el crudo y su fuerte tendencia a la agregacin y floculacin. A partir de estudios cinticos de agregacin de los asfaltenos no solo se puede tener una idea del crecimiento tamao y nmero de los agregados, sino que adems se puede entender la dinmica que gobierna este fenmeno, bien sea del tipo de agregacin por difusin o del tipo de agregacin por reaccin. El presente est enfocado en el estudio de la cintica de agregacin de asfaltenos de Furrial y de Carabobo en solucin de tolueno/n-heptano, a partir de medidas de dispersin dinmica de luz con un equipo construido en el laboratorio. A travs de la tcnica utilizada, es posible obtener valores del dimetro hidrodinmico de las partculas o agregados de los asfaltenos dispersos en una solucin en funcin del tiempo. Se encontraron diferencias en la cintica de agregacin entre los dos tipos de asfaltenos. Una de ellas fue que, para los asfaltenos Carabobo, la velocidad de crecimiento de los agregados result independiente de la concentracin de asfaltenos en solucin, as como de la relacin tolueno/n-heptano en el intervalo estudiado. Contrariamente, los asfaltenos de Furrial resultaron mostrar una cintica de agregacin dependiente de las dos variables mencionadas anteriormente. Otra diferencia interesante observada fue que los dimetros de los agregados de asfaltenos de Furrial en solucin alcanzan un valor mximo de 2000nm, mientras que para los asfaltenos del crudo Carabobo los dimetros mximos llegan hasta 6000nm. Esta diferencia est relacionada con las caractersticas de los agregados formados y dispersos en solucin, as como las diferencias en densidad de masa de los agregados de asfaltenos provenientes de crudos con diferencias en estabilidad operacional.','2010-05-06','asfaltenos dispersin cintica agregacin',6,1,1,1,1,'2013-09-17 08:31:15','2013-09-17 08:31:15','Documento_352.pdf','application/pdf',3172285,'2013-09-17 08:31:15',20,0,116,'COMPLETO'),(352,'Prototipo de un proceso para la extraccin, transformacin y visualizacin de ndices acadmicos de la base de datos CONEST.','Implantacin de un proceso automatizado para la extraccin, transformacin y visualizacin de ndices acadmicos que apoyen la gestin de la comisin curricular de la Escuela de Computacin','2010-05-06','Desarrollo Rpido de Aplicaciones, ndice Acadmico, Comisin Curricular, Visualizacin de datos, MVC, Ruby On Rails, Escuela de Computacin, UCV, RAD',2,1,1,1,1,'2013-09-17 08:31:16','2013-09-17 08:31:16','Documento_353.pdf','application/pdf',0,'2013-09-17 08:31:16',20,0,0,'INCOMPLETO'),(353,'SNNTESIS EN FASE SLLIDA DE UN MATERIAL HBBRIDO PPPTIDO--POLMMEROS ACRLLICOS\"\"','Se plante la sntesis de un material hbrido pptido-polmero acrlico por medio de la tcnica de sntesis en fase slida, para lo cual se sintetiz un copolmero de estireno- divinilbenceno (S-DVB) como soporte slido en el proceso. El S-DVB fue funcionalizado con clorometil metil ter (CME) para producir de esta manera de la resina de Merrifield. Debido a varios factores, no fue posible anclar el primer aminocido protegido (glicina-FMOC) a la resina sintetizada, por lo cual se decidi utilizar una resina comercial como lo es la resina de 2- clorotritilo. A partir de esta resina se logr la sntesis en fase slida de un tripptido de glicina, tras lo cual fue anclado un iniciador para ATRP como el cloruro de cloroacetilo. Seguidamente se realiz la polimerizacin del 2- hidroxietil acrilato para obtener el producto resina-pptido-poli(2-hidroxietil acrilato). Por ltimo, se realiz el clivaje del material hbrido de la resina, obtenindose el producto deseado, Gly-Gly-Gly-poli(2-hidroxietil acrilato), siendo ste unas gotas de aceite denso de color marrn claro. Este producto slo pudo ser caracterizado por FTIR.','2010-04-28','polmeros, sntesis en fase slida, resina de Merrifield, resina 2- clorotritilo, ATRP, 2-hidroxietil acrilato, cloruro de cloroacetilo, N,N,N,Ntetrametiletilendiamina',6,1,1,1,1,'2013-09-17 08:31:17','2013-09-17 08:31:17','Documento_354.pdf','application/pdf',0,'2013-09-17 08:31:17',18,0,0,'INCOMPLETO'),(354,'AVANCES EN EL DESARROLLO DE MTTODOS PARA LA DETECCINN DE INHIBIDORES DE LA ENZIMA MONOAMINO OXIDASA B..','En el presente trabajo se reporta el avance en el desarrollo y evaluacin de mtodos para la deteccin de posibles inhibidores de la enzima Monoamino Oxidasa B (MAO-B). Se desarrollo y optimiz una metodologa para la determinacin de la actividad enzimtica de MAO-B por Cromatografa de Capa Fina (CCF), empleando bencilamina como sustrato; detectndose la catlisis enzimtica a travs del cambio de tonalidad del colorante Azul de Nilo el cual forma un complejo rojizo con el sustrato bencilamina, pero permanece su color azul en presencia del producto de oxidacin enzimtica (benzaldehdo). Al no poder utilizarse este mtodo en la deteccin de los posibles inhibidores de la enzima, se desarroll una nueva metodologa para la evaluacin inhibitoria de 17 compuestos anlogos de berberina por medio de espectrofotometra de UV empleando dopamina como sustrato. Por medio de sta tcnica se encontr que de los compuestos evaluados, 7 presentan actividad inhibitoria considerable, comparable o incluso superior a berberina.','2010-04-30','espectrofotometra UV, monoamino oxidasa, inhibidores, cromatografa de capa fina, tcnica bioautogrfica, bencilamina, dopamina, berberina',6,1,1,1,1,'2013-09-17 08:31:18','2013-09-17 08:31:18','Documento_355.pdf','application/pdf',1355101,'2013-09-17 08:31:18',19,0,95,'COMPLETO'),(355,'Variaciones temporales del zooplancton del Lago del Crculo Militar de Caracas ((DC)) y bases para la taxonoma molecular de Thermocyclops decipiens ((Copepoda,, Cyclopoida))..','Introduccinn: El Lago Artificial del Crculo Militar, ubicado en el rea Metropolitana de Caracas es un lago somero, del cual no existen reportes de estudios sobre sus caractersticas limnolgicas ni de la estructura comunitaria del zooplancton. Entre los componentes del zooplancton se encuentra el coppodo Cyclopoida Thermocyclops decipiens(Kiefer, 1929), que es un organismo abundante en los sistemas tropicales y se ha reportado que puede ser utilizado como un indicador del estado trfico de los cuerpos de agua.Objetivo:: Analizar las variaciones temporales de la abundancia de la comunidad de zooplancton en este lago, adems de realizar pruebas preliminares para estandarizar la taxonoma molecular de T.. decipiens. Mtodos: Se estimaron las variables fisicoqumicas del lago, la biomasa del fitoplancton, y se colectaron organismos zooplanctnicos, para posteriores ensayos para la caracterizacin molecular de T.. decipiens. Se amplific la regin del espaciador interno transcrito ITS2 del ADN ribosomal de los individuos T.. decipiens por medio de ensayos de PCR y se analiz por secuenciacin. Resultados:: Las variables fisicoqumicas presentaron variaciones marcadas en todo el periodo de estudio as como tambin la biomasa de fitoplancton. La mayor abundancia zooplanctnica se present en los estratos superficiales, en los cuales los coppodos y los rotferos fueron los grupos ms abundantes. Se logr un aislamiento eficiente del ADN genmico de individuos T.. decipiens recolectados del lago y se amplific la regin del ITS2. Conclusinn: Las tcnicas moleculares ofrecen herramientas muy tiles en los estudios de la sistemtica de coppodos. Estos estudios moleculares no han sido realizados en Venezuela, por lo que nuestros resultados podrn ser aplicados en el futuro cercano para el anlisis taxonmico del zooplancton presente en nuestros cuerpos de agua.','2010-05-06','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:31:21','2013-09-17 08:31:21','Documento_356.pdf','application/pdf',4042762,'2013-09-17 08:31:21',19,0,94,'COMPLETO'),(356,'Identificacin de genes de virulencia de Helicobacter pylori en pacientes con lesiones gstricas precancerosas.','Helicobacter pylori es una bacteria Gram negativa, de gran variabilidad gentica y de alta prevalencia en Venezuela y el mundo, que coloniza la capa de moco de las clulas del epitelio estomacal, desencadenando una respuesta inflamatoria local de intensidad y extensin variables asociada con el desarrollo de diversas enfermedades gstricas severas como lo son gastritis crnica, lcera pptica y cncer gstrico. La isla de patogenicidad cag, las variantes allicas del gen vacA (s11//s22 y m11//m22) y el gen babA son factores de virulencia asociados al desarrollo de estas patologas. Sus productos de expresin son transportados hasta al interior de las clulas epiteliales causando alteraciones importantes en su estructura y funcin. El objetivo de este trabajo fue identificar genes de Helicobacter pylori asociados a virulencia y adems evaluar algunos parmetros inmunolgicos en pacientes con lesiones precancerosas del Hospital Universitario de Caracas. A partir de las biopsias gstricas y del cultivo de H..pylori se realiz la extraccin de ADN y posteriormente con una PCR multiplex, se amplificaron los genes de virulencia vacAm11//m22 (567/642 pb), vacAs11//s22 (259/286 pb). Con una PCR sencilla se amplificaron los genes ureC(294 pb), cagA33 (642 pb) y babA (832 pb). Adems se determinaron anticuerpos especficos IgG anti H.. pylori en suero y anticuerpos secretores IgA en saliva, mediante inmunoensayo de ELISA, en pacientes que asistieron a consulta de gastroenterologa del Hospital Universitario de Caracas. De la poblacin estudiada, un 72% fue positiva para H.. pylori. La combinacin allica del gen vacA ms frecuente fue, vacA m11//s11 con un 25%. Los resultados obtenidos sugieren una baja frecuencia del gen babA..El 9% de la poblacin fue cagA positivo, no encontrndose diferencias significativas con las lesiones precancerosas halladas. El porcentaje de coinfeccin en esta investigacin oscil entre el 4% y el 9% en cepas vacAm11//m22 y vacAs1/s2, respectivamente. La presencia de H.. pylori fue detectada en 30% (13/43) de las lesiones negativas para malignidad, 40% (17/43) de las lesiones indefinidas para displasia, mientras que en ningn caso de displasia de bajo grado se observ la presencia de la bacteria. En cuanto a la respuesta inmune observada se obtuvo un 70% (40/57) de positividad al determinar anticuerpos IgA secretores en muestras de saliva, adems fue estandarizada una ELISA casera para la determinacin de anticuerpos IgG sricos anti H.. pylori.','2010-04-30','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',1,1,1,1,1,'2013-09-17 08:31:23','2013-09-17 08:31:23','Documento_357.pdf','application/pdf',4073365,'2013-09-17 08:31:23',18,0,106,'COMPLETO'),(357,'Diseoo y evaluacinn dosimtrica de un maniqu para tratamiento de mama con braquiterapia intersticial ((HDR)),','DISEOO Y EVALUACINN DOSIMTTRICA DE UN MANIQU PARA TRATAMIENTO DE MAMA CON BRAQUITERAPIA INTERSTICIAL ((HDR))La braquiterapia de alta tasa de dosis (HDR), mejora significativamente la distribucin de dosis de radiacin, mediante el control de la posicin de la fuente y la variacin del tiempo de permanencia en cada posicin durante el tratamiento.El objetivo general de este trabajo consiste en evaluar dosimtricamente un maniqu para tratamiento de mama con braquiterapia intersticial (HDR). Es por ello que se plantea comparar las distribuciones dosimtricas relativas para una fuente puntual, un arreglo lineal de fuentes y cinco arreglos lineales de fuentes en un plano, para un maniqu de polimetilmetacrilato (PMMA), el cual cumple con las caractersticas necesarias para ser considerado como sustituto del tejido mamario. Aplicando los parmetros y funciones establecidas por el protocolo de la AAPM TG - 43 para clculos tericos y el uso del sistema de planificacin Brachy Vision para la optimizacin de los planes, adems, se describen los mtodos utilizados para la verificacin de las distribuciones de dosis; que incluye dosimetra relativa con el arreglo de cmaras de ionizacin (PTW 2D - Array seven29) y el estudio del ndice gamma para la comparacin de las distribuciones de dosis entre los datos proporcionados por el sistema de planificacin y las medidas realizadas. Las evaluaciones realizadas mediante los distintos mtodos empleados en la comparacin de las distribuciones de dosis relativas para distancias radiales inferiores a 7.17cm, permitieron mantener las incertidumbres por debajo de 5% respecto a la variacin de la dosis, lo cual garantiza una correcta implementacin de los aspectos dosimtricos para una tcnica tan compleja como lo es la braquiterapia generando una buena distribucin de dosis uniforme. De hecho estas diferencias estn en el rango de tolerancia de acuerdo a las incertidumbres planteadas por los organismos internacionales. Adems, se compararon los mapas de fluencias obtenidos por el sistema de planificacin y las medidas experimentales mediante el criterio gamma estableciendo lmites de tolerancias de (4%, 4mm) en el plano de deteccin (frontal) para la dosis y la distancia fsica respectivamente, los resultados obtenidos son satisfactorios, cumplindose una buena correspondencia entre lo medido y planificado.Las diferencias dosimtricas relativas presentadas en este trabajo ratifican los resultados de los estudios realizados, garantizando la correcta implementacin de los aspectos dosimtricos de la braquiterapia intersticial de mama, trayendo como consecuencia directa el beneficio del paciente.','2010-04-07','{}',3,1,1,1,1,'2013-09-17 08:31:24','2013-09-17 08:31:24','Documento_358.pdf','application/pdf',0,'2013-09-17 08:31:24',20,0,0,'INCOMPLETO'),(358,'ESTUDIO DEL EFECTO DE LA ACTIVIDAD DE LAS PROTEASAS ((CATEPSINAS B,, D Y L)) EN LOS CAMBIOS FSSICOS Y QUMMICOS DEL MSSCULO DE BAGRE SIERRA ((Oxydoras sifontesi)) EN DIFERENTES ESTADIOS DE MADUREZ SEXUAL..','Oxydoras sifontesi,,conocido como Bagre Sierra, representa un grupo de peces neotropicales, de aguas dulces continentales. Su nombre se deriva de la presencia de una serie de placas seas laterales con espinas centrales curvadas y dirigidas hacia atrs, a manera de sierra, que pueden o no cubrir todo el cuerpo. Son de constitucin robusta y poseen fuertes espinas en la aleta dorsal y pectoral que utilizan como medida de defensa; puede llegar a alcanzar los 120 cm de longitud y 20 Kg de peso. Se caracterizan por su largo hocico cnico, cabeza estrecha y centralmente son aplanados. Es una especie endmica, la cual se puede encontrar con mayor frecuencia en la Cuenca del Ro Orinoco. El presente estudio consisti en evaluar como objetivo la influencia de la actividad de las proteasas (catepsina B, D y L) en los cambios fsicos y qumicos del msculo de Bagre Sierra((Oxydoras sifontesi))en diferentes estadios de madurez sexual. A las muestras de bagre sierra se le realizaron los siguientes anlisis: anlisis proximal, protenas solubles, actividad enzimtica de las catepsinas B, D y L, determinacin de pH. Los resultados fueron analizados en Statgraphics plus 5.1 mediante una prueba de ANOVA de una va, con un nivel de significancia del 5%. Se concluy que la accin de las enzimas proteolticas especficamente catepsinas B, D y L ejercen influencias en el tejido muscular sobre las diferentes etapas del ciclo reproductivo en la especie estudiada.','2010-01-15','Proteasa; actividad enzimatica',1,1,1,1,1,'2013-09-17 08:31:24','2013-09-17 08:31:24','Documento_359.pdf','application/pdf',0,'2013-09-17 08:31:24',18,0,0,'INCOMPLETO'),(359,'DETERMINACINN DE ARSNNICO EMPLEANDO EXTRACCINN ACELERADA CON SOLVENTES Y DETERMINACINN CON HG--ICP--OES','El arsnico, es un elemento metlico altamente txico y se encuentra ampliamente distribuido en la naturaleza (alrededor del 5 x 10-4% de la corteza terrestre), si a ello sumamos el hecho de que el hombre a travs de la industrializacin ha incrementado su presencia en el medio ambiente, representando as un gran riesgo para la salud humana. Ejemplo de ello, es que en una zona contaminada, el excedente del metal puede migrar a travs de las lluvias y los ros a los mares, donde la biota marina tiende con facilidad a bioacumularlo. El consumo de estos alimentos con niveles de arsnico \"altos\", puede causar en el humano enfermedades como cncer de pulmn, de vejiga, de rin, enfermedades cardacas, etc. Por lo tanto, el presente trabajo estuvo enfocado en la determinacin de arsnico en productos alimenticios marinos, en especial las algas utilizadas en la preparacin de \"sushi\" y afines. Para ello, se emple como tcnica de tratamiento de muestra la Extraccin Acelerada con Solventes y la medida de arsnico se realiz empleando la combinacin de la Generacin de Hidruros con Plasma Inductivamente Acoplado-Espectrometra de Emisin ptica. En los ensayos de optimizacin de la Extraccin Acelerada con Solvente se logr obtener un 92 % de recuperacin con un DSR del 3 %. Se logr determinar arsnico en el orden de los 0,6 mg/g. En las muestras en estudio de algas Nori, no se encontraron valores detectables de arsnico.','2010-05-03','Arsenico, Extraccion Acelerada con Solvente, Espectroscopia de emisin optica con plasma inductivamente acoplado ICP-OES, Generacion de Hidruros, algas, sushi, porcentaje de recuperacion.',6,1,1,1,1,'2013-09-17 08:31:26','2013-09-17 08:31:26','Documento_360.pdf','application/pdf',5508867,'2013-09-17 08:31:26',18,0,156,'COMPLETO'),(360,' Efectos Topolgicos y Cuantizacin en Corrientes de Espn','En este trabajo se realiza el desarrollo y anlisis de un filtro de espn en dos dimensiones, basado en el interfermetro Mach-Zehnder, tanto para estados de entrada puros como para estados mezclados, en presencia de un campo magntico externo e interaccin espn-rbita Rashba y Dresselhaus. Este tipo de interaccin espn-rbita es producida en materiales semiconductores que no poseen simetra de inversin. Para este caso la interaccin espn-rbita se representa como una teora de calibre SU(2)XU(1), obteniendo as una formulacin no Abeliana del campo de calibre, tipo campo de Yang-Mills. Se analizaron las condiciones necesarias para obtener un filtro de espn as como los invariantes topolgicos.','2010-05-06','Normal 0 false false false EN-US X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Table Normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',3,1,1,1,1,'2013-09-17 08:31:26','2013-09-17 08:31:26','Documento_361.pdf','application/pdf',0,'2013-09-17 08:31:26',20,0,0,'INCOMPLETO'),(361,'FRACCIONAMIENTO DEL FSSFORO Y ACTIVIDADES ENZIMTTICAS EN COPROLITOS DE LOMBRICES DE TIERRA EN SABANAS DEL ORINOCO VENEZOLANO','El fraccionamiento del fsforo ha sido ampliamente estudiado en diferentes tipos de suelos en Venezuela y el mundo, Sin embargo es poco lo que se ha investigado respecto a las formas de fsforo presentes en los coprolitos que producen las lombrices de tierra que habitan las sabanas venezolanas. Bajo la premisa el siguiente trabajo fue desarrollado con la intencin de conocer la influencia de la lombriz de tierra en el cambio de las fracciones de fsforo disponible en suelos de sabana de Trachypogon ubicados en los estados Amazonas y Gurico. Los suelos fueron recolectados a profundidades de 0-10, 10-20 y 20-30cm en tres calicatas realizadas a lo largo de una transecta, escogida al azar. Los coprolitos frescos y viejos fueron recolectados manualmente en parcelas cercanas a las calicatas primero los viejos al limpiar cada rea y luego los frescos. Posterior al tratamiento de muestras respectivo: secado, pulverizado y tamizado, se procedi a realizar un estudio de laboratorio y uno de campo previo que incluyo: anlisis fsicos del suelo (temperatura, humedad, densidad aparente y textura), anlisis qumicos de suelos y coprolitos (pH, fsforo total, fsforo orgnico, inorgnico y microbiano) y anlisis bioqumicos de suelos y coprolitos (actividades uresicas y fosfatsicas). Los resultados demostraron los efectos de la actividad alimentaria de las lombrices al incrementarse las fracciones de fsforo inorgnico lbil y las de fsforo orgnico fcilmente mineralizable. La actividad enzimtica fosfatsica arroj como resultado una notable influencia en la mineralizacin del fsforo al verse aumentada en los coprolitos siendo ms notorio su efecto en el rea protegida de Calabozo. La actividad uresica mostr su posible participacin en la fijacin biolgica del nitrgeno, al verse incrementada especialmente en la Estacin Biolgica. Lo cual fue consistente con los reportes de N total en esa misma zona. El fsforo microbiano por su lado present valores exageradamente altos no esperados para el caso de Amazonas, no obstante estos datos podran confirmar la hiptesis planteada por otros autores donde se relacionan la disponibilidad del fsforo y el contenido del mismo en los microorganismos, sin embargo no se descarta la posibilidad de errores metodolgicos.','2010-05-07','coprolitos, lombrices de tierra, sabanas, Orinoco, fraccionamiento, fsforo',6,1,1,1,1,'2013-09-17 08:31:27','2013-09-17 08:31:27','Documento_362.pdf','application/pdf',1863015,'2013-09-17 08:31:27',16,0,81,'COMPLETO'),(362,'ESTUDIO INICIAL DE GESTINN DE RIESGOS DE LA FACULTAD DE CIENCIAS,, COMO ESTRATEGIA PARA REDUCIR LA VULNERABILIDAD DE SSTA A DESASTRES SOCIO--NATURALES','Establecer pautas para gestionar los diferentes tipos de riesgos de una comunidad requiere un trabajo de investigacin y evaluacin de gran importancia y relevancia, debido a la magnitud del impacto a largo plazo que esto puede representar para la comunidad de estudio. Actualmente la Facultad de Ciencias de la Universidad Central de Venezuela ha iniciado una serie de investigaciones y trabajos que nos permitirn paulatinamente adecuarnos a la normativa legal correspondiente y acercarnos a los estndares internacionales relacionados con gestin de riesgos. Se sabe que ste recinto universitario presenta un elevado nivel de riesgo debido a los materiales peligrosos que en el se encuentran; existen diversas escuelas e institutos que trabajan con ellas y estn en pro de las condiciones mnimas necesarias de seguridad, lo que se plantea en ste escrito. Como cientficos debemos preocuparnos por el impacto que pueden ocasionar nuestras labores de docencia e investigacin y luchar por minimizar dicho impacto, como por ejemplo desarrollar y trabajar en una ciencia \"limpia\" aplicable al medio ambiente, fomentando el trabajo seguro dentro de un ambiente potencialmente peligroso como en el que trabajamos para evitar que ocurran accidentes lamentables para nosotros y el entorno. A lo largo de sta investigacin se evaluaron las condiciones de riesgo de la Facultad, dando prioridad a los riesgos de mayor relevancia como: el riesgo qumico, escapes de gas, derrames de sustancias peligrosas, el descontrol de agentes biolgicos, sismos, incendios y explosiones, debido al posible impacto que puede ocasionar un accidente de stas ndoles. En el presente trabajo de investigacin se presentan pautas de gestin de riesgo, reportando opciones que permitan reducir la vulnerabilidad de la Facultad de Ciencias a desastres socio-naturales, as mismo se desarroll un plan de respuesta en caso de emergencias que nos permitir tener una clara idea de que hacer ante una situacin adversa, se plantea una poltica de prevencin de riesgos, se presenta una propuesta de reglamento interno de seguridad y salud laboral donde se trazan condiciones mnimas de seguridad para el buen desempeo del personal dentro de la Facultad, todo esto basado en las leyes y normativas competentes. Finalmente se considera importante el trabajo en conjunto de la comunidad, la aplicacin de todas y cada una de las propuestas aqu establecidas, el cumplimiento de las normativas, la divulgacin de sta informacin y la puesta en prctica de los planes de respuesta en caso de emergencia junto a la creacin de una brigada de emergencia, ya que esto en conjunto promete un comienzo en el desarrollo de la Facultad de Ciencias, como casa pionera y a futuro, de ejemplo a seguir para otras facultades y Universidades en el rea de gestin de riesgos.','2010-05-06','riesgos desastre ciencias',6,1,1,1,1,'2013-09-17 08:31:28','2013-09-17 08:31:28','Documento_363.pdf','application/pdf',1219185,'2013-09-17 08:31:28',20,0,88,'COMPLETO'),(363,'Un estudio del sistema dinamico generado por la ecuacin de Van der Pol','En dicho trabajo se realiza un estuadio a la salucin de la ecuacin de Van der Pol, garantizando la existencia, unicidad y prolongabilidad de la misma, para luego estudiar su comportamiento a traves del tiempo mediante la implementacin de los sistemas dinmicos. Luego se implementa el mtodo de mltiple escala para encontrar la aproximacin de la solucin mediante la teora de perturbacin y finalmente usando MATLAB comparamos los resultados del estudio previo junto con las corridas en dicho programa variando en parmetro de la ecuacin.','2010-04-22','El estudio del circuito electrico representado por la ecuacin de Van der Pol mediante la teora de sistema dinmico, el metodo de multiple escala y MATLAB',5,1,1,1,1,'2013-09-17 08:31:30','2013-09-17 08:31:30','Documento_364.pdf','application/pdf',4143017,'2013-09-17 08:31:30',20,0,57,'COMPLETO'),(364,'Solucin de la Ecuacin de Van der Pol a travs de la Teora de Sistema Dinmico','Se realiz un estudio de la ecuacin de Van der Pol,centrndose en la solucin de la misma, esto fue logrado a travs de aplicaciones y temas de la Teora de Sistema Dinmico. Se demostr que la ecuacin de Van der Pol posee solucin peridica, por lo tanto posee ciclos lmites, variando el parmetro que pertenece a la ecuacin. Adems sta solucin es orbitalmente asintticamente estable, as como tambin encontramos que dicha solucin puede ser expandida por una serie de potencia convergente. Estas soluciones fueron halladas por el Teorema de Bedixson, el Teorema de Linard y el Mtodo de Poincar-Lindstedt, respectivamente. Finalmente, se hizo una representacin grfica de la ecuacin mediante el programa Matlab.','2010-04-28','Ecuacin de Van der Pol, Sistema Dinmico, Teorema de Bendixson, Teorema de Linard, Mtodo Poincar-Linsdtedt.',5,1,1,1,1,'2013-09-17 08:31:30','2013-09-17 08:31:30','Documento_365.pdf','application/pdf',0,'2013-09-17 08:31:30',20,0,0,'INCOMPLETO'),(365,'Estudio de los niveles de Isoleucina en orina como un biomarcador de Cncer de Prstata','El cncer de prstata es una de las neoplasias comnmente diagnosticadas y representa la primera causa de muerte por cncer en hombres. En la actualidad, investigadores han determinado los niveles de aminocidos como posibles biomarcadores, para evaluar si estos estn relacionados con el desarrollo de este carcinoma. En el presente proyecto se propuso determinar y comparar las concentraciones de isoleucina (ILE), aminocido primario, en orina de ayuna de pacientes con y sin cncer de prstata. Las muestras de orina de pacientes que se realizan biopsia prosttica son suministradas por el Hospital Universitario de Caracas de la Universidad Central de Venezuela. Como grupo control o sujetos sanos se toman muestras de individuos voluntarios con valores de PSA menores a 4 ng/mL. Se analizaron (32) muestras de individuos mayores de 40 aos, divididas en grupos: con cncer de prstata (8), de individuos que deben realizarse nueva biopsia en un perodo de seis meses (4), sin cncer (12) y muestras de individuos sanos (8). Para la determinacin de ILE se utiliz la tcnica cromatografa lquida de alta eficiencia por derivacin precolumna con o-ftaldialdehido (OPA) -cido tiogliclico. La curva de calibracin fue lineal entre concentraciones de 252 a 629 mmol/L. El lmite de deteccin encontrado para isoleucina es 9,55 mmol/L y el de cuantificacin de 27,78 mmol/L. El aminocido ILE es excretado por el 62,5 % de los pacientes a los que les fue realizada biopsia prosttica en un rango de concentracin (559 1215) mmol/L. No se encontraron diferencias estadsticamente significativas entre las concentraciones de ILE en orina de los grupos de pacientes a los que les fue realizada biopsia de la prstata, mientras que en los individuos sanos no fueron detectados niveles del aminocido.','2010-04-28','Cncer de prstata, biomarcador, orina, HPLC.',6,1,1,1,1,'2013-09-17 08:31:31','2013-09-17 08:31:31','Documento_366.pdf','application/pdf',4089015,'2013-09-17 08:31:31',19,0,106,'COMPLETO'),(366,'Desarrollo de un Sistema de Informacin de procesamiento de Transacciones (TPS) basado en la metodologa de Desarrollo Agile Unified Process (AUP) para la captura de datos de la Encuesta de Establecimientos Tursticos de Alojamiento Colectivo.','El Departamento de Estadsticas Econmicas del Instituto Nacional de Estadsticas (INE) propone un nuevo proyecto denominado Encuesta de Establecimiento de Turismo de Alojamiento Colectivo, el cual en su primera fase plantea la recoleccin de los datos de la encuesta fsica, y en su segunda fase la creacin de tabuladores o reportes sustentados en los datos obtenidos en la primera fase. Debido a que la muestra de establecimientos a nivel nacional es bastante amplia, no resulta conveniente para el departamento tener los datos de la encuesta en fsico, adems esto dificultara la ejecucin de la segunda fase del proyecto. Por ello surge en el presente Trabajo Especial de Grado (TEG) la necesidad de desarrollar un sistema que permita la captura de los datos de la encuesta y los almacene en una base de datos centralizada. El sistema debe ser web, ya que permite a los transcriptores o informantes de los distintos establecimientos llenar la encuesta digital desde cualquier lugar.Para alcanzar dicho objetivo se utiliz la metodologa de desarrollo del Proceso gil Unificado (AUP, por sus siglas en ingls), la cual ofrece la flexibilidad necesaria para el desarrollo y la documentacin del sistema. El patrn de diseo Modelo- Vista- Controlador (MVC), el cual permite el diseo modular del sistema, disminuyendo as las complicaciones ante los cambios, y se emplearon los lenguaje de programacin web PHP y JavaScript los cuales facilitan crear las funcionalidades del sistema y el manejador de Base de datos PostgreSQL para almacenar los datos de la Encuesta','2010-05-10','Turismo, Establecimientos Tursticos,Turismo de oferta, Alojamiento colectivo, AUP, MVC, JavaScript, PHP, PostGreSQL.',2,1,1,1,1,'2013-09-17 08:31:32','2013-09-17 08:31:32','Documento_367.pdf','application/pdf',721422,'2013-09-17 08:31:32',19,0,43,'COMPLETO'),(367,'Desarrollo de un Sistema de Informacin de procesamiento de Transacciones (TPS) basado en la metodologa de Desarrollo Agile Unified Process (AUP) para la captura de datos de la Encuesta de Establecimientos Tursticos de Alojamiento Colectivo','El Departamento de Estadsticas Econmicas del Instituto Nacional de Estadsticas (INE) propone un nuevo proyecto denominado Encuesta de Establecimiento de Turismo de Alojamiento Colectivo, el cual en su primera fase plantea la recoleccin de los datos de la encuesta fsica, y en su segunda fase la creacin de tabuladores o reportes sustentados en los datos obtenidos en la primera fase. Debido a que la muestra de establecimientos a nivel nacional es bastante amplia, no resulta conveniente para el departamento tener los datos de la encuesta en fsico, adems esto dificultara la ejecucin de la segunda fase del proyecto. Por ello surge en el presente Trabajo Especial de Grado (TEG) la necesidad de desarrollar un sistema que permita la captura de los datos de la encuesta y los almacene en una base de datos centralizada. El sistema debe ser web, ya que permite a los transcriptores o informantes de los distintos establecimientos llenar la encuesta digital desde cualquier lugar.Para alcanzar dicho objetivo se utiliz la metodologa de desarrollo del Proceso gil Unificado (AUP, por sus siglas en ingls), la cual ofrece la flexibilidad necesaria para el desarrollo y la documentacin del sistema. El patrn de diseo Modelo- Vista- Controlador (MVC), el cual permite el diseo modular del sistema, disminuyendo as las complicaciones ante los cambios, y se emplearon los lenguaje de programacin web PHP y JavaScript los cuales facilitan crear las funcionalidades del sistema y el manejador de Base de datos PostgreSQL para almacenar los datos de la Encuesta.','2010-05-10','Turismo, Establecimientos Tursticos, AUP, MVC, JavaScript, PHP, PostGreSQL',2,1,1,1,1,'2013-09-17 08:31:33','2013-09-17 08:31:33','Documento_368.pdf','application/pdf',1518036,'2013-09-17 08:31:33',19,0,65,'COMPLETO'),(368,'ESTUDIO DE COMPLEJOS DE VANADIO ((V)) Y ARGININA ((KCl 33..00 M,, 2255C))','En el presente trabajo se estudiaron los sistemas: H++ -- arginina ((HC))H++-- VO22++ -- arginina ((HC)) Por medio de medidas de fuerzas electromotrices emf(H) a 25C y en KCl 3.0 M como medio inico inerte. Fueron determinados los valores de pKa del aminocido arginina en KCl 3.0 M a 25C, la siguiente tabla resume los resultados obtenidos.  Sistema H++ -- arginina ((HC)) EspeciespKaH3C+2 H2C++ H+22,,2244 ((22))H2C+ HC + H+99,,2233 ((22))HC C- + H+1111,,0055 ((77))s(thc)00,,003355 En el caso del sistema H+-VO2+ - arginina (HC), se obtuvieron los valores de las constantes de formacin de los complejos formados en este sistema, la siguiente tabla resume los resultados obtenidos.  Sistema H++ -- VO22++ -- arginina ((HC)) pH+ + qVO2+ + rC- Hp(VO2)qCr ((q-r+p) Especiesp,,q,,rLog bpqr[H2VO2C]2+21123.32 (7)23.43 (6)23.49 (5)23.1(1) [HVO2C]+11121.51 (4)21.60 (3)21.63 (4)21.6(4)[H2VO2C2]+21240.0 (1)40.06 (2)40.2 (1)40.1(2)(OH)VO2(HC)01118.13 (6)18.27 (5)18.26 (6)18.29(6)s(thB) 0.0811 s (thc) 0.0212 s(thcf) 0.0679 s(thBf) 0.0968','2010-05-06','vanadio (V), arginina, KCl (3 M), medidas de fuerza electromotrices emf (H)',6,1,1,1,1,'2013-09-17 08:31:34','2013-09-17 08:31:34','Documento_369.pdf','application/pdf',393788,'2013-09-17 08:31:34',20,0,44,'COMPLETO'),(369,'Aplicacin de la Teora de Control ptimo y la programacin Dinmica a la Gestin de los Acuferos','El objetivo principal de esta tesis de grado es el estudio y aplicacin de la ecuacin diferencial parcial Hamilton-Jacobi-Bellman (HJB). La ecuacin diferencial parcial HJB es muy importante en la teora de control pues sirve para vericar si un control es ptimo. Aplicamos sta ecuacin al problema de la gestin de un recurso hdrico: Acuferos. Describimos brevemente las distintas formas de gestin de un acufero, basndonos en cmo estn definidos los derechos de propiedad. Luego se expone un modelo terico que integra los elementos hidrolgicos y econmicos presentes en un acufero, con el objeto de obtener las trayectorias de equilibrio tanto de la extraccin de aguas subterrneas, como del stock del acufero. Adems se desarrolla una de las aplicaciones pioneras de la programacin dinmica estocstica, dentro del campo de la economa de los recursos hdricos, el trabajo de Oscar Burt. Tambin se presenta un modelo de tiempo continuo que investiga el nivel del acufero en el cual se detiene la extraccin neta, y se restringe, el bombeo futuro al ritmo previsto de recarga. Por ltimo se analiza una versin estocstica del modelo en tiempo continuo y se deriva una nueva regla de parada en el caso de que el volumen de las aguas subterrneas evolucione como un proceso de Ito.','2009-12-03','Ecuacin Hamilton-Jacobi-Bellman, Principio del Mximo de Pontryagin, Programacin Dinmica, Principio de Optimalidad de Bellman, Funcin Valor, Proceso de Wiener, Lema de Ito, Acuferos, Gestin de Acuferos.',5,1,1,1,1,'2013-09-17 08:31:35','2013-09-17 08:31:35','Documento_370.pdf','application/pdf',4231266,'2013-09-17 08:31:35',20,0,84,'COMPLETO'),(370,'Vnculo entre las ecuaciones diferenciales ordinarias y las ecuaciones diferenciales estocsticas.','Desde que en el siglo XVII Newton y Leibniz pusieron las bases de lo que ahora llamamos\"Calculo Diferencial\", las ecuaciones diferenciales ordinarias han sido una herramienta matemticafundamental para modelar sistemas fsicos. Las leyes fsicas que gobiernan un sistemadeterminan las ecuaciones correspondientes, que despus intentamos resolver, es decir,de las cuales intentamos obtener una expresin del estado del sistema en el instante detiempo t como funcin explcita de t. Entre algunos de los innumerables ejemplos de fenmenosque pueden ser modelados por ecuaciones diferenciales ordinarias se encuentran: lainteraccin de planetas, flujos de fluidos, reacciones qumicas, dinmicas poblacionales yeconmicas. Pero estas ecuaciones diferenciales ordinarias solo modelan fenmenos en unsistema ideal es decir sin perturbaciones, pero en una gran cantidad de casos existen fenmenosaleatorios que nos alteran el sistema con lo que debemos introducir un termino anuestra ecuacin diferencial llamado ruido; esta ecuacin diferencial es llamada estocstica.En los ltimos aos el estudio de estas ecuaciones diferenciales estocsticas ha tenidouna creciente e importante atencin, en mecnica y en muchas otras reas de la fsica tericaas como de la biologa experimental y tambin en el estudio de finanzas.Para nuestro estudio consideramos una ecuacin diferencial ordinaria de la siguienteforma:dXt = a(t, Xt)dt, X(0) = x0.a la cual le introducimos una condicin inicial aleatoria y un termino de ruido aleatorio adicional:dXt = a (t, Xt)dt + b(t, Xt)dBt, X0(w) = Y(w), (1)La solucin de esta ecuacin, si esta existe, es un proceso estocstico.Muchos autores han investigado sobre las ecuaciones diferenciales del tipo (1) y, la existencia y unicidad de lassoluciones de estas ecuaciones se ha demostrado en cada uno de estos estudios y se basaen la utilizacin de la ecuacin integral estocstica asociada. Tanto lascondiciones para obtener la existencia y la unicidad de la solucin de este tipo de ecuacionesdiferenciales estocsticas as como la demostracin se basan en las implementadas enlas ecuaciones diferenciales ordinarias. Nuestro interes es desarrollar e implementar estas ecuaciones.','2010-01-28','ecuaciones diferenciales ordinarias; ecuaciones diferenciales estocsticas; movimiento Browniano; proceso estocstico; integral estocstica It; condicin de Lipshitz; Existencia y unicidad de la solucion de las ecuaciones diferenciales de primer ord',5,1,1,1,1,'2013-09-17 08:31:36','2013-09-17 08:31:36','Documento_371.pdf','application/pdf',1437296,'2013-09-17 08:31:36',20,0,99,'COMPLETO'),(371,'Perturbaciones de los Solitones pticos de la Ecuacin No-Lineal de Schrdinger','El presente trabajo realiza un estudio tanto analtico como numrico de las principales perturbaciones de los solitones temporales-brillantes con orden N = 1 de la Ecuacin No-Lineal de Schrdinger (ENLS), aplicada al campo de la ptica no-lineal y escrita en forma escalar, continua y en 1 + 1 dimensiones. Mediante el formalismo Lagrangiano clsico se desarrolla un anlisis variacional que, junto al teorema de los procesos adiabticos, resulta en la dinmica de las coordenadas colectivas del solitn fundamental perturbado, quedando stas escritas en funcin de los modelos matemticos de cada perturbacin tratada, i.e. disipacin energtica, auto-escarpado (\"self- steepening\") y dispersin intra-pulso de Raman (\"intra-pulse Raman scattering\"). Finalmente, el anlisis numrico por el mtodo Split-Step de Fourier Simetrizado es empleado para confirmar las predicciones analticas de la dinmica adiabtica ante cada perturbacin individual, mediante la integracin directa de la ENLS modificada correspondiente y la comparacin de las caractersticas de la solucin numrica resultante vs. la analtica respectiva.','2009-12-16','solitn, solitones pticos, ecuacin no lineal de Schrdinger, ptica no lineal, perturbacin de solitones, coordenadas colectivas, split-step de Fourier simetrizado',3,1,1,1,1,'2013-09-17 08:31:37','2013-09-17 08:31:37','Documento_372.pdf','application/pdf',0,'2013-09-17 08:31:37',20,0,0,'INCOMPLETO'),(372,'CATALIZADORES NANOESTRUCTURADOS EN BASE A NQQUEL EN EL REFORMADO DE METANO CON VAPOR:: PROBLEMAS DE TRANSFERENCIA DE CALOR','El presente trabajo se realiz con el propsito de estudiar el efecto que tienen la dilucin de lecho y el uso de estructuras metlicas con una serie de catalizadores en base a nquel, en los problemas de transferencia de calor que ocurren en la reaccin de reformado de metano con vapor de agua. Se sintetizaron tres precursores catalticos en base a nquel, un precursor tipo hidrotalcita utilizando la metodologa de coprecipitacin, un precursor tipo perovskita utilizando la metodologa sol-gel y un precursor nanoestructurado soportado, utilizando la preparacin del complejo in situ. Estos slidos fueron caracterizados mediante anlisis qumico, difraccin de rayos X (DRX), reduccin con temperatura programada (RTP), rea especfica (B.E.T.), anlisis termogravimtrico termodiferencial (ATG-ATD). Se realiz una estrategia de deposicin hmeda de una pelcula de material cataltico sobre una estructura rgida en varias etapas, proceso conocido como \"Washcoating\", se utiliz como estructura rgida una aleacin de hierro FeCrAlloy, esta estructura fue analizada mediante microscopa electrnica de barrido (MEB). Las pruebas catalticas en polvo sirvieron de referencia para evaluar el efecto sobre la transferencia de calor que tiene el uso de la dilucin de lecho, los resultado indican que la dilucin de lecho disminuye los problemas de transferencia de calor, pero hay que evaluar la formacin de carbn. Los resultados de probar el catalizador NiAl2O4 estructurado en forma de placa indica que la trasferencia de calor disminuye en mayor proporcin que la dilucin de lecho, hay que hacer las estructuras en forma de monolitos y probarlas en reaccin, ya que esto no se logr por completo y tambin realizar el anlisis de deposicin de carbn para poder hacer una comparacin entre ambos mtodos.','2010-05-05','Washcoating, monolitos, perovskitas, hidrotalcitas, reformado de metano con vapor, slurry, complejos orgaometlicos',6,1,1,1,1,'2013-09-17 08:31:38','2013-09-17 08:31:38','Documento_373.pdf','application/pdf',1390453,'2013-09-17 08:31:38',19,0,88,'COMPLETO'),(373,'Filogenia Intraespecfica y Variabilidad Gentica en Culex quinquefasciatusSay ((Diptera:: Culicidae)) utilizando secuencias de ADN mitocondrial','Culex quinquefasciatus Say, es una especie de mosquito perteneciente a la familia Culicidae, y forma parte del complejo Pipiens de Culex. Esta especie tiene amplia distribucin en el mundo y en Venezuelase distribuye por casi todo el territorio nacional (Sutil, 1980; Del Ventura, 2008). Esta especie es acentuadamente antropoflica y es considerado un importante vector de varios virus as como de algunos parsitos, los cuales son mantenidos en la naturaleza en un ciclo enzotico ave-mosquito- ave. Su amplia distribucin y ocupacin de diversos hbitats larvales de origen antropognico podra sugerir la presencia de subpoblaciones geogrficas que pudieran participar en forma diferencial en la transmisin de patgenos. Anlisis de las secuencias de porciones del ADN mitocondrial pueden ser de utilidad para delimitar la existencia de una estructuracin poblacional de origen geogrfico verificado por medio de mtodos filogenticos de las secuencias (filogeografa) y verificar hiptesis de variabilidad, homogeneidad gentica y de estructuracin filogentica. Se realizaron anlisis genticos haciendo uso de los genes mitocondriales COI (Subunidad I del Citocromo oxidasa) y ND5 (Subunidad 5 de la NADH deshidrogenasa) en poblaciones de Cx.. quinquefasciatus de nueve localidades del pas (especficamente de cementerios locales), para establecer la presencia de una estructura subpoblacional y/ o posibles linajes intraespecficos, relacionados con reas geogrficas u otro mecanismos de diferenciacin poblacional. Los resultados obtenidos revelan niveles altos de variacin gentica tanto para el gen COI como para ND5. Particularmente para el gen ND5 los niveles de variacin encontrada fueron altos en contraste a secuencias de ND5 de otras poblaciones de mosquitos, como Aedes aegypti y Aedes albopictus,, mientras que el gen COI comparativamente con ND5 revel niveles de variacin menor dentro de Cx.. quinquefasciatus. Los anlisis filogenticos realizados con ambos genes sugieren que las poblaciones de Cx.. quinquefasciatus de las distintas localidades estudiadas mostraron una alta homogeneidad gentica, reflejndose en una ausencias de clados monofilticos entre poblaciones de los diferentes cementerios sin divergencia entre haplotipos, lo que demuestra la presencia de una sola entidad filogentica (monofilia) correspondiente a la especie Cx quinquefasciatus. Se demostr que el fragmento del gen COI estudiado es ms sensible en la definicin de la filogenia de especies cercanas, as como a nivel de gneros y correlacionado con la clasificacin actual, mientras que el gen ND5 por su alta variacin es ms til para estudios poblacionales.','2010-05-05','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',1,1,1,1,1,'2013-09-17 08:31:39','2013-09-17 08:31:39','Documento_374.pdf','application/pdf',2077723,'2013-09-17 08:31:39',18,0,85,'COMPLETO'),(374,'Estudio de los cambios en la tendencia de consumo de antibitticos y su relacinn con la resistencia bacteriana en Venezuela,, durante el periodo 22000055--22000088..','Diversas publicaciones cientficas, basadas en la determinacin de la susceptibilidad microbiana en aislados clnicos, han reportado que el empleo inadecuado de antibiticos promueve la seleccin de cepas de bacterias resistentes, lo que deriva en un problema de salud pblica a nivel mundial, ya que se reducen las opciones teraputicas para tratar las infecciones, se incrementan los gastos y se aumenta la mortalidad. Como una medida para contener el aumento de la resistencia bacteriana en el pas, el 2 de enero de 2006, se publica la resolucin N 604 de la Gaceta Oficial Venezolana N 38.348, mediante la cual se regula la dispensacin de medicamentos antimicrobianos en farmacias, servicios farmacuticos y cualquier otro establecimiento debidamente autorizado, mediante la presentacin de la prescripcin facultativa. Los medicamentos antimicrobianos a los que se refiere dicha Gaceta, son aquellos de uso sistmico que pertenezcan a las siguientes categoras: Fluoroquinolonas, Macrlidos - Lincosamidas, Cefalosporinas de tercera generacin y aquellos cuyo principio activo sea Rifampicina. En este trabajo se estudiaron los cambios derivados de la medida regulatoria de dispensacin de antibiticos sobre la tendencia de venta de antimicrobianos en Venezuela y su vnculo con la variacin de la resistencia bacteriana durante el periodo 2005-2008. Se estim la fraccin de la poblacin Venezolana expuesta al grupo de antibiticos regulados y a un grupo de antibiticos de libre dispensacin, a travs de la dosis diaria definida por 1000 habitantes por da (DHD). Se realizaron anlisis de varianzas de un factor (ANOVA) y se observaron las diferencias en el comportamiento de la tendencia de consumo, de las categoras de antibiticos del grupo regulado y no regulado. Los resultados se compararon con los porcentajes de resistencia bacteriana total en el pas, para un periodo pre- medida regulatoria de 1 ao (2005) y para un periodo post - medida regulatoria de 3 aos (2006 a 2008). Se relacionaron los porcentajes de cepas resistentes reportadas para 7 microorganismos Gram negativos y 2 microorganismos Gram positivos, con las DHD de los antibiticos sugeridos como indicadores de resistencia por el CSLI. Se obtuvieron los resultados para conocer la tendencia de la resistencia bacteriana entre el ao 2005 y 2008, y la tendencia del consumo de antibiticos para el mismo periodo. Se encontr ausencia de cambios derivados de la medida regulatoria de dispensacin de antibiticos tanto en el consumo de antimicrobianos como en el porcentaje de cepas bacterianas resistentes. Este resultado nos permite sugerir que la ausencia de diferencias en la venta de antimicrobianos puede deberse a la falta de informacin referente a la medida y a la falta de seguimiento del cumplimiento de la misma. Adems, se deben implementar medidas complementarias a la regulacin de la dispensacin de algunos antibiticos, a los fines de lograr controlar la aparicin, seleccin y dispersin de la resistencia bacteriana a estos agentes, y continuar este tipo de estudios para monitorear el xito de estos programas Venezuela es uno de los primeros pases latinoamericanos que ha legislado una medida regulatoria de dispensacin de antibiticos, por lo que el presente estudio no solo aporta informacin relevante para el pas, sino que sirve de monitor para otros pases que estn persiguiendo el mismo propsito.','2010-04-30','Antibitico, resistencia bacteriana, estudio de utilizacin de medicamentos',1,1,1,1,1,'2013-09-17 08:31:40','2013-09-17 08:31:40','Documento_375.pdf','application/pdf',2792653,'2013-09-17 08:31:40',20,0,108,'COMPLETO'),(375,'AISLAMIENTO Y CARACTERIZACIN DEL GEN HMG-CoA REDUCTASA DE YUCA (Manihot esculenta, Crantz) EVALUANDO SU EXPRESIN MEDIANTE UNA PCR EN TIEMPO REAL','El cultivo de yuca es de suma importancia para combatir la desnutricin en el mundo, ya que es capaz de crecer en suelos pobres y con gran sequa. Sin embargo el rpido deterioro post-cosecha resulta en prdidas del 90% de la siembra total, por esto se han dirigido las investigaciones en biotecnologa, al desarrollo de plantas de yuca resistentes a enfermedades e insectos.El gen HMG-CoA reductasa (3-hidroxi-3-metil-glutaril-CoA reductasa) regula la ruta metablica del mevalonato que desencadena en la produccin de metabolitos secundarios, como las fitoalexinas, compuestos que le confieren a la planta resistencia contra microorganismos patgenos y plagas. Por lo tanto se cree que el estudio de este gen y su posterior manipulacin podra ayudar a disminuir el deterioro post-cosecha de los cultivos de yuca.Como objetivo inicial de este trabajo se plante el clonamiento del gen HMG-CoA reductasa, utilizando la estrategia propuesta por Sambrook (2.001), para luego secuenciar el clon completando la secuencia parcial del gen de 1.907 pb, que fue obtenida en investigaciones previas en el laboratorio de Biotecnologa Agrcola del IDEA. La publicacin del genoma de yuca en noviembre de 2.009, permiti identificar la secuencia del gen HMG-CoA reductasa y enfocar el trabajo a la caracterizacin molecular de este gen en la planta de yuca.El anlisis in slico posibilit la identificacin de la secuencia del gen HMG-CoA reductasa en 2.493pb ordenados en 4 exones y 3 intrones, con una similitud de 97,7% del mismo gen en otras especies de plantas. El anlisis de la organizacin la secuencia facilit el diseo de dos pares de cebadores, para la evaluacin mediante una PCR en tiempo real de los niveles de expresin del gen HMG-CoA reductasa en diferentes condiciones fisiolgicas. Pero no se pudo medir la expresin debido a errores en la estandarizacin de la PCR, luego de normalizar las condiciones de temperatura, concentracin de cloruro de magnesio y concentracin de ADN se realiz la PCR en tiempo real cuyos resultados preliminares se presentaron en este trabajo.','2010-04-20','gen HMG-CoA reductasa, 3-hidroxi-3-metil-glutaril-CoA reductasa, yuca, manihot, PCR en tiempo real',1,1,1,1,1,'2013-09-17 08:31:41','2013-09-17 08:31:41','Documento_376.pdf','application/pdf',2383612,'2013-09-17 08:31:41',14,0,90,'COMPLETO'),(376,'Soluciones Autosimilares para las Primeras Etapas de Formacin Estelar','Se estudia el proceso de condensacin de nubes de plasma a bajas temperaturas, en regiones del medio interestelar que son inicialmente trmicamente biestables.Se utilizan las variaciones de la velocidad inicial del plasma en la frontera de la nube como forma de simular perturbaciones de diferentes magnitudes. Estas condiciones son estudiadas para el caso de 3 plasmas astrofsicos que difieren entre ellos nicamente en el mecanismo mediante el cual radan energa. Se estudia: (a) Una nube de gas fro compuesto principalmente de hidrgeno molecular; (b) Un plasma totalmente ionizado y (c) Una nube de gas adiabtico. Esto con la finalidad de estudiar mediante el mtodo de bsqueda de soluciones autosimilares qu tipo de plasma colapsa de manera ms eficiente.Se analiza el comportamiento del fluido al tomar en cuenta la conductividad trmica en las ecuaciones, encontrndose que al incluir este efecto no es posible encontrar soluciones autosimilares, restringindose los casos de estudio a plasmas donde la interfase sea sostenida nicamente por los efectos radiativos, es decir que la longitud de la misma sea mayor que la Longitud de Field.A pesar de que el marco de trabajo simplificado que se propone deja de lado caractersticas importantes para flujos reales tridimensionales, se halla que las nubes fras de hidrgeno molecular son ms propensas a sufrir una condensacin inducida por una compresin, y que este mecanismo debe ser el principal para la formacin de protoestrellas.','2010-05-03','Astrofsica, Mecnica de Fluidos, Soluciones Numricas, Ecuaciones Diferenciales No Lineales, Autosimilaridad, Formacin Estelar',3,1,1,1,1,'2013-09-17 08:31:43','2013-09-17 08:31:43','Documento_377.pdf','application/pdf',2758481,'2013-09-17 08:31:43',19,0,183,'COMPLETO'),(377,'\"\"Estudio de capacidad alergnica de las protenas del polen de capim melao ((Melinis minutiflora))en individuos venezolanos con enfermedades alrgicas\"\"','La alergia al polen es el prototipo de enfermedad alrgica a nivel de la poblacin mundial. Cuando ste entra en contacto con la nariz, el ojo o la mucosa gastrointestinal, libera protenas que se difunden a travs del medio acuoso de las mucosas. Las personas alrgicas a stas, presentan hipersensibilidad con incremento en la produccin de anticuerpos IgE, as como la secrecin de citocinas por los linfocitos del fenotipo Th2. En Venezuela se ha establecido una relacin entre los perodos de floracin de las gramneas y la incidencia de crisis de rinitis y asma, se ha sugerido que el polen de capim melao (Melinis minutiflora.) podra ser un contaminante biolgico del aire con posible implicacin en la etiologa de alergia respiratoria (Pinto, 1972). Los extractos procesados de polen de capim melao fueron analizados por la tcnica de electroforesis en geles de poliacrilamida para separar las protenas las cuales fueron transferidas a membranas de nitrocelulosa. Posteriormente se confrontaron con sueros de pacientes clasificados de acuerdo a sus niveles de IgE total mediante la tcnica denominada western Blot. Se identificaron varias bandas entre 150 a 7 kDa y se reconocieron protenas de 65, 44 y 33 kDa de masa molecular. Este trabajo nos permiti, por primera vez en nuestro pas, identificar protenas asociadas a la respuesta de tipo IgE especfica contra el polen del capim melao (Melinis minutiflora.), determinar la existencia de reaccin cruzada entre los plenes de capim melao y el polen de la mezcla comercial gramneas IV, as como una correspondencia entre los niveles de IgE total y los niveles de IgE especifica de pacientes alrgicos que posiblemente podran estar sensibilizados a esta gramnea.','2010-05-03','Alergia, Polen, Capim Melao (Melinis minutiflora.)',1,1,1,1,1,'2013-09-17 08:31:44','2013-09-17 08:31:44','Documento_378.pdf','application/pdf',809747,'2013-09-17 08:31:44',14,0,76,'COMPLETO'),(378,'EVALUACINN CATALTTICA DE ZSM--55,, Al--MCM--4411 Y SISTEMA COMBINADO ZSM--55--Al--MCM--4411 MEDIANTE REACCIONES DE CATLLISIS CCIDA','En el presente trabajo se sintetizaron la zeolita ZSM-5, el tamiz molecular mesoporoso Al-MCM-41 y un material combinado ZSM-5-Al-MCM-41. Estos tres slidos fueron comparados con una mezcla mecnica (ZSM-5//Al-MCM-41) preparada mezclando cantidades iguales de zeolita y mesoporoso. Los cuatro materiales fueron caracterizados por fisisorcin de nitrgeno, difraccin de rayos X y microscopa electrnica de barrido en conjunto con energa dispersiva de rayos X para el anlisis qumico. La evaluacin cataltica fue realizada utilizando reacciones modelo basadas en la transformacin de aromticos, alcanos y olefinas, especficamente la transformacin de m-xileno, n-hexano, 3- metilpentano y 1-buteno. La caracterizacin de los slidos mostr que se obtuvieron las fases de ZSM-5 y de Al-MCM-41 con las propiedades esperadas. En cuanto al material combinado, present caractersticas particulares que indicaron su naturaleza micro y mesoporosa. La transformacin de m-xileno se realiz a 370 C bajo condiciones que permitieran comparar el comportamiento del material combinado con las fases puras en condiciones favorables a la reactividad de la fase correspondiente denominadas \"condiciones de zeolita\" (velocidad espacial VEHP de 40 h-1 y relacin Nitrgeno/m-xileno de 4) y \"condiciones de mesoporoso\" (velocidad espacial VEHP de 8 h-1 y relacin Nitrgeno/m-xileno de 1,5). A la mayor velocidad espacial y mezcla de alimentacin ms diluida, slo la zeolita y la mezcla mecnica mostraron actividad. La disminucin de la velocidad espacial y uso de alimentacin ms concentrada (condiciones ms severas), permiti obtener conversiones del orden del 3 % para el material combinado y el mesoporoso, mientras que para la zeolita y la mezcla mecnica se obtuvo un aumento notable en la conversin y una menor relacin p-xileno/o-xileno en comparacin a las \"condiciones de zeolita\". Para los slidos Al-MCM-41 y ZSM-5-Al-MCM-41, la relacin p-xileno/o-xileno se fij como 1, debido a la ausencia de limitaciones difusionales de estos ismeros dado el tamao de poro de los materiales. A partir de la transformacin de n-hexano y de 3-metilpentano a 500 C, se determin el ndice de restriccin de los cuatro slidos. La zeolita ZSM-5 y la mezcla mecnica presentaron valores mayores a 1, mientras que para el Al-MCM-41 y el material combinado se obtuvieron valores menores o iguales a 1, indicando diferentes caractersticas estructurales de los slidos evaluados. La transformacin de 1-buteno fue realizada a 470 C, obtenindose el siguiente orden de conversin total del hidrocarburo: ZSM-5 > ZSM-5//Al-MCM-41 ~= ZSM-5-Al-MCM-41 >> Al-MCM-41 y el siguiente orden de selectividad hacia la formacin de isobuteno: Al-MCM-41 > ZSM-5//Al-MCM-41 > ZSM-5-Al-MCM-41 > ZSM-5. Los slidos ms activos fueron ms selectivos hacia la formacin de productos de craqueo, indicando una acidez ms fuerte. Se evalu la estabilidad cataltica de los slidos Al-MCM-41 y ZSM-5-Al-MCM-41, realizando pruebas de 48 horas de duracin, con regeneracin del catalizador en corriente de aire y posterior uso del catalizador regenerado en las mismas condiciones de reaccin y tiempo que el catalizador fresco. Ambos slidos son activos despus de la regeneracin, obtenindose mayor estabilidad con el slido Al-MCM-41 debido probablemente a la menor conversin lograda.','2010-05-03','Tamices moleculares, zeolitas mesoporosas',6,1,1,1,1,'2013-09-17 08:31:46','2013-09-17 08:31:46','Documento_379.pdf','application/pdf',417880,'2013-09-17 08:31:46',20,0,72,'COMPLETO'),(379,'Construccin y optimizacin de un equipo para la lectura de celdas de ELISA por fluorescencia molecular..','En el presente trabajo se realiz la construccin y la evaluacin preliminar de un equipo de medicin simultnea de fluorescencia molecular, teniendo como objetivo su aplicacin futura en el anlisis de muestras clnicas. Se ensayaron dos montajes experimentales: uno basado en un digitalizador de imgenes (scanner) convencional y otro empleando un montaje convencional de fluorescencia por reflexin. En el primer caso no se logr obtener una sensibilidad adecuada. El montaje del equipo propuesto emplea lmparas fluorescentes convencionales como fuentes de excitacin, placas de 96 pozos para inmuno-ensayo de ELISA como porta muestras y una cmara fotogrfica convencional como sistema de deteccin y registro de la seal de fluorescencia. Para el procesamiento de la seal se emple un programa diseado empleando Matlab. La evaluacin analtica se realiz empleando soluciones de fluorescena en una mezcla de etanol/agua. El intervalo lineal obtenido es relativamente limitado, tpico de los metodos basados en medidas de fluorescencia. La sensibilidad, evaluada como la pendiente de la curva de calibracin es sustancialmente menor que la obtenida en equipos comerciales, sin embargo, es lo sufientemente elevada para realizar anlisis cuantitativos de especies de interes que no se encuentren en niveles de concentracin de trazas. El equipo diseado mostr sensibilidad, estabilidad y respuesta lineal para realizar anlisis cuantitativo de hasta 96 muestras de forma simultnea en un corto tiempo.','2010-05-05','Fluorescencia, LEDs, CCD',6,1,1,1,1,'2013-09-17 08:31:47','2013-09-17 08:31:47','Documento_380.pdf','application/pdf',3172285,'2013-09-17 08:31:47',19,0,116,'COMPLETO'),(380,'Generando Sitios Web Dirigidos a Profesionales Independientes','Este Trabajo Especial de Grado presenta el desarrollo de un Generador de Sitios Web de Profesionales Independientes, denominado G-WEBPRi, el cual fue diseado considerando la necesidad que poseen los profesionales independientes de contar con un sitio Web donde puedan ofrecer sus productos y/o servicios. De esta forma, los usuarios de esta aplicacin podrn construir y mantener actualizado de forma sencilla su sitio Web de profesional independiente, mediante una serie de pasos guiados. Asimismo, el usuario podr cambiar la apariencia de su sitio Web, a travs de un conjunto de plantillas que ofrece la aplicacin. Para realizar el anlisis y diseo de G-WEBPRi,,as comopara la implementacin, se utiliz un mtodo Ad Hoc basado en el Proceso Unificado ((Unified Process -- UP)) en su versin gil (Agile Unified Process --AUP), con la incorporacin de patrones de interaccin y evaluaciones heursticas, empleando como lenguaje de programacin PHP y como Sistema Manejador de Bases de Datos MySQL. El producto obtenido es una aplicacin que promueve la participacin de los ciudadanos en la construccin de su sitio Web, sin requerir conocimientos avanzados de la tecnologa subyacente ni plataformas complejas, apoyando la labor que realiza cada uno de los profesionales independientes en pro de mejorar sus condiciones econmicas y sociales, al ofrecer sus productos y/o servicios en Internet, a travs del sitio Web creado.','2010-05-05','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',2,1,1,1,1,'2013-09-17 08:31:49','2013-09-17 08:31:49','Documento_381.pdf','application/pdf',0,'2013-09-17 08:31:49',19,0,0,'INCOMPLETO'),(381,'Desarrollo y evaluacin de un biosensor quimioluminiscente para su aplicacin en anlisis clinicos.','En este trabajo se explor la viabilidad de elaborar un biosensor para la determinacin de Glucosa en sangre por quimioluminiscencia usando como receptculo de la muestra una placa ELISA. El mtodo se basa en las diferencia s en la intensidad de quimioluminiscencia del luminol debido a las diferentes cantidades de perxido de hidrgeno producido por la reaccin enzimtica de glucosa catalizada por la enzima glucosa oxidasa. Para la adquisicin y el procesamiento de los datos experimentales se utiliz una cmara CCD y un software diseado en Matlab R2006a. Con el fin de obtener las condiciones experimentales ptimas, fueron investigados una serie de parmetros y dos sistemas de medida. En uno glucosa oxidasa (GO) es encapsulada en un sol gel y en otro GO es utilizada directamente en solucin. Dentro de los parmetros estudiados estn, el efecto del rea de observacin y la reproducibilidad del sistema con la enzima tanto en la matriz slida como en solucin. En el primer caso se encontraron problemas en la velocidad de difusin de las especies a travs de los poros del gel, lo cual impidi que se realizaran medidas con este. Para las medidas en solucin se evaluaron dos software, uno cuya seal emitida es igual a la mediana de los pixeles ubicados en el rea de observacin seleccionada y otro en el cual esta es igual a la suma de todos los pixel. El segundo software usando un tiempo de integracin de la seal entre 0,1 y 1,0 seg. present mejor reproducibilidad y por lo tanto fue el empleado para el resto de los anlisis. La curva de calibracin obtenida con las condiciones ptimas del sistema fue lineal en el rango de 500 a 2000 mg/l con un coeficiente de correlacin de 0,9457. El mtodo propuesto fue aplicado en la determinacin de glucosa en plasma sanguneo de ratas encontrando que existen interferencias por parte de la matriz de la muestra en el procedimiento de medida lo que impidi validar el mtodo propuesto.','2010-04-28','Quimioluminiscencia, CCD, Mtodos enzimticos.',6,1,1,1,1,'2013-09-17 08:31:50','2013-09-17 08:31:50','Documento_382.pdf','application/pdf',2229058,'2013-09-17 08:31:50',20,0,110,'COMPLETO'),(382,'Evaluacin del potencial de rendimiento en 14 variedades de arroz (Oryza sativaL..)), cultivadas en Venezuela desde la dcada de los aos 50.','En Venezuela la produccin de arroz ha aumentado desde el ao 1960, como consecuencia de una mayor rea cultivada y mayores rendimientos. No obstante, desde 1989, el rendimiento promedio nacional se ha estancado en alrededor de 500 g.m-2; con una tasa promedio anual de 8 g.m-2.ao-1; a pesar de la liberacin de un nmero considerable de nuevas variedades en este perodo. El incremento del rendimiento ha sido producto esencialmente de tres factores: i) Mejoramiento gentico del rendimiento per se; ii) Mejoramiento gentico de la tolerancia/resistencia a plagas y enfermedades; y iii) Mejoras en las prcticas de manejo agronmico. Sin embargo, la informacin disponible no permite dilucidar el aporte relativo de estos componentes al incremento del rendimiento del arroz en Venezuela. Este trabajo tiene como objetivos determinar los cambios en el rendimiento del arroz en Venezuela producto del mejoramiento gentico desde la dcada de los aos 50 y evaluar la importancia de algunos parmetros de crecimiento y morfolgicos en la determinacin del rendimiento del arroz en el pas. Se evaluaron 14 variedades de arroz, liberadas desde 1951 hasta 2006, las cuales fueron sembradas por trasplante, utilizando un diseo completamente aleatorio con cuatro rplicas, en las localidades de Calabozo y Acarigua, en la poca de lluvias de 2006; y se cultivaron bajo prcticas actuales de manejo agronmico, protegindolas contra posibles daos ocasionados por plagas y enfermedades. El muestreo se realiz en diferentes estadios de desarrollo del cultivo. Las variables a evaluar fueron rendimiento, tasa de crecimiento relativo (TCR), biomasa total, biomasa vegetativa, ndice de Cosecha (IC) y, largo y ancho de la hoja bandera. Se utiliz el anlisis de regresin lineal para correlacionar las variables evaluadas con los aos de liberacin de las variedades, as como tambin para correlacionar el rendimiento con el resto de las variables. Los resultados obtenidos sealan que: El mejoramiento gentico ha contribuido con un 50% al aumento en el rendimiento, y posiblemente el mayor aporte parece haber sido sobre el ndice de cosecha en combinacin con una mayor biomasa total. Araure 4 la menos rendidora, Centauro la ms rendidora. Acarigua es la localidad con los mayores rendimientos, as como tambin con la mayor TCR, biomasa total y biomasa vegetativa en comparacin con Calabozo. El PR de las variedades de arroz en Venezuela se encuentra entre 1114,1 y 1120,0 g.m-2; el rendimiento promedio nacional del arroz en Venezuela apenas supera los 500 g.m-2, por tanto, existe una amplia brecha que superar para incrementar la produccin de arroz en el pas. Este trabajo aporta por primera vez indicadores del progreso gentico para algunas determinantes en variedades de arroz cultivadas en Venezuela desde la dcada de los aos 50.','2010-04-30','{}',1,1,1,1,1,'2013-09-17 08:31:52','2013-09-17 08:31:52','Documento_383.pdf','application/pdf',0,'2013-09-17 08:31:52',17,0,0,'INCOMPLETO'),(383,'Caracterizacinn fisicoqumica y evaluacinn de la calidad e inocuidad microbiolggica de cuatro variedades de mapuey ((Dioscorea trifida)) y sus productos ((almidnn nativo y almidnn modificado)),, provenientes del estado Amazonas y del estado Sucre','El mapuey (Dioscorea trifida), tubrculo nativo de Amrica tropical y apreciado por su sabor y fina textura, ha sido poco explotado en Venezuela. Al darle valor agregado, por ejemplo la obtencin de almidn es un ingrediente, potencial para el desarrollo de numerosos productos. Por otro lado, poco se ha estudiado de la flora microbiana presente en estos tubrculos y sus productos. En este trabajo se evalu la calidad e inocuidad microbiolgica de cuatro variedades de mapuey (D.. trifida), tres de las cuales eran procedentes del estado Amazonas, y una del estado Sucre. Los almidones de las variedades de mapuey fueron obtenidos mediante extraccin acuosa y deshidratacin respectivamente. Asimismo se midieron los parmetros fisicoqumicos, tales como actividad de agua (aW), acidez y pH, siguiendo los mtodos oficiales. En cuanto a la morfologa y tamao de las variedades de mapuey, no se encontraron diferencias significativas lo cual indic que hay similitud (excepto por el color) en cuanto a las muestras de mapuey blanco y mapuey morado. En relacin a la microbiologa asociada a estos tubrculos, se encontr que hay una alta incidencia de aerobios mesfilos en la pulpa de mapuey blanco comercial, en relacin a las dems muestras de mapuey analizadas, lo cual pudiese ser atribuido a las condiciones de riego, cultivo o de almacenamiento. La incidencia de Bacillus cereussobre las muestras de mapuey estuvo por debajo de 100UFC/g, por lo que no se pudo detectar por el mtodo de siembra en superficie. Y en lo que respecta a la comparacin de la microflora procedente del proceso de deshidratacin, se encontr que hay diferencias significativas entre las muestras de mapuey y la muestra de almidn de yuca algodonado proveniente de Colombia, as tambin se encontr que hay diferencias en cuanto a los parmetros fisicoqumicos evaluados en las variedades de mapuey y la yuca algodonada.','2010-05-06','{}',1,1,1,1,1,'2013-09-17 08:31:53','2013-09-17 08:31:53','Documento_384.pdf','application/pdf',1161063,'2013-09-17 08:31:53',19,0,69,'COMPLETO'),(384,'\"\"Sntesis y Caracterizacinn de Agregados Metlicos de los Grupos 77 y 88 con Terbutildialilfosfina y Dialilfenilfosfina\"\"..','El inters generado por el desarrollo de complejos de agregados metlicos en qumica organometlica ha sido especialmente por lo que respecta a su potencial como catalizadores homogneos, as como tambin, se ha especulado que el estudio de estos complejos polinucleares que contiene enlaces metal-metal pueden servir como modelos de superficies catalticas ayudando a encontrar la conexin entre la catlisis homognea y la heterognea,[1] adems, se basa en sus aplicaciones en varios campos de investigacin, tales como, la electrnica, la ptica no lineal, incluso en el rea de la biologa.[2,3] Los agregados metlicos han sido utilizados como modelos de la interaccin que existe entre los sustratos orgnicos y las superficies metlicas de catalizadores, debido a la similitud de los agregados polinucleares con dichas superficie. As, el entendimiento de los modos de coordinacin de los ligandos podra conllevar a la creacin de nuevos catalizadores o al mejoramiento de los ya existentes. [4] En este proyecto se estudi la reactividad qumica de las fosfinas hemilbiles dialilfenilfosfina y terbutildialilfosfina con los agregados metlicos bis(acetonitrilo) dodecacarbonilo de triosmio [Os3(CO)10(CH3CN)2] y bis(acetonitrilo) octacarbonilo de direnio [Re2(CO)8(CH3CN)2], respectivamente. La reaccin de la dialilfenilfosfina con el [Os3(CO)10 (CH3CN)2], conduce a la formacin de 3 complejos, el primero [Os3(CO)11{P (C3H5)2(Ph)}] (I.1) donde la dialilfenilfosfina se encuentra monocoordinada a un centro metlico del tringulo de osmio a travs del par de electrones libres del tomo de fsforo; el segundo complejo [Os3(CO)10{m:e3-P(C3H5)2(Ph)}] (I.2) donde la dialilfenilfosfina se encuentra coordinada en puente al tringulo de osmio a travs del par de electrones libres del tomo de fsforo, va s a un centro metlico y a travs de un grupo alilo va p, al centro metlico adyacente y el tercer complejo [Os3(CO)10{P(C3H5)2(Ph)}2] (I.3), donde el tringulo de osmio se encuentra 1,2-disustituido por 2 molculas de dialilfenilfosfina a travs del par de electrones libres del tomo de fsforo, presentndose un equilibrio fluxional. Observndose que el complejo mayoritario es (I.2). Tambin se obtuvo 2 complejos productos de la reaccin de la terbutildialilfosfina con el [Re2(CO)8(CH3CN)2], el primero [Re2(CO)9{P(C3H5)2 (t-Bu)}] (II.1) donde la terbutildialilfosfina se encuentra monocoordinada a un centro metlico del dinuclear de renio a travs del par de electrones libres del tomo de fsforo y el segundo complejo [Re2(CO)8{m:e3-P(C3H5)2(t-Bu)}] (II.2), donde la terbutildialilfosfina se encuentra coordinada en puente al dinuclear de renio a travs del par de electrones libres del tomo de fsforo, va s a un centro metlico y a travs de un grupo alilo va p, al centro metlico adyacente. Encontrndose que el compuesto mayoritario es el (II.2).','2009-12-08','Cluster de los grupos 7 y 8 con fosfinas (terbutildialilfosfina y dialilfenilfosfina)',6,1,1,1,1,'2013-09-17 08:31:54','2013-09-17 08:31:54','Documento_385.pdf','application/pdf',391007,'2013-09-17 08:31:54',20,0,56,'COMPLETO'),(385,'PROPIEDADES FSSICAS,, MECNNICAS,, Y BIOENSAYO CON Sitophilus oryzae DE PELCCULAS COMESTIBLES DE ALMIDNN CON PROBITTICOS,, PREBITTICOS Y OMEGA--33','En la actualidad, el uso de pelculas y coberturas comestibles no slo se limita al hecho de brindar proteccin a los alimentos como barrera al intercambio de agua y gases, sino que se perfila como vehculo de diversos ingredientes funcionales de carcter bioactivo. El uso de modelos biolgicos como el gorgojo de arroz constituye una manera fcil, rpida y econmica para la evaluacin iin vivode diversos componentes de la dieta y hacer inferencias de carcter nutricional. Es por ello, que se evalu la viabilidad de pelculas comestibles elaboradas con almidones de yuca, batata y pltano con un bioensayo sencillo que utiliza el gorgojo de arroz (Sitophilus oryzae). De los tres almidones estudiados, el de pltano fue el que mantuvo la supervivencia ms elevada y adems fue el nico que produjo un incremento de peso, por lo cual se seleccion como el polmero definitivo para la incorporacin de cidos grasos omega-3 (O-3), inulina y bifidobacterias; por ser el ms adecuado para satisfacer las demandas nutricionales del mantenimiento de los insectos. En relacin a las propiedades fsicas y mecnicas evaluadas, la adicin de O-3 produjo un aumento en el grosor, la capacidad de retencin de agua y flexibilidad de las pelculas comestibles de almidn de pltano; mientras que la incorporacin de inulina y bifidobacterias influy disminuyendo la capacidad de retencin de agua; pero incrementando la permeabilidad al vapor de agua, grosor, solubilidad en agua y fuerza de puncin. Por ltimo, se puede mencionar que los resultados de esta investigacin indican que las pelculas de almidn de pltano sirven como un medio de transferencia de bifidobacterias para al gorgojo de arroz, pues se encontraron bifidobacterias viables en el insecto.','2010-05-06','pelculas comestibles, gorgojo de arroz, alimentos funcionales, bioensayo',1,1,1,1,1,'2013-09-17 08:31:55','2013-09-17 08:31:55','Documento_386.pdf','application/pdf',4640851,'2013-09-17 08:31:55',20,0,104,'COMPLETO'),(386,'Propuesta de diseo de una solucin de videovigilancia soportada en cmaras IP con tecnologa IEEE 802.11 para el Edificio El Rectorado, Plaza Cubierta yComplejo Cultural Aula Magna de la Universidad Central de Venezuela','Debido a los diversos ataques en los que se ha visto involucrada la Universidad Central de Venezuela, surgi la necesidad de una propuesta de diseo de una solucin de videovigilancia soportada en cmaras IP, con la finalidad de incrementar los niveles de vigilancia en el Edificio el Rectorado, la Plaza Cubierta y el Complejo Cultural Aula Magna de la UCV. Esta fue la propuesta de la Direccin de Tecnologa de Informacin y Comunicaciones (DTIC), con el objetivo de reforzar los niveles de seguridad y de esta manera brindar tranquilidad a la comunidad universitaria. En este Trabajo Especial de Grado se presenta el diseo, los dispositivos inalmbricos usados y unas pruebas de funcionamiento, que dan soporte al diseo de la solucin. Los dispositivos inalmbricos involucrados en el diseo estn basados en el fabricante Cisco Systems. La propuesta de diseo de la solucin de videovigilancia se basa en el estndar IEEE 802.11 y as mismo se propone la implementacin de QoS (Quality of Service), especficamente del mecanismo de DiffServ (Differentiated Services), con la finalidad de evitar la congestin del trfico que transita por la red. A su vez para validar esta propuesta de diseo, se realizaron diversas pruebas. El resultado final, es una solucin de videovigilancia soportada en una WLAN completamente funcional, que cumple con los requisitos exigidos por la DTIC y por la Direccin de Seguridad de la UCV.','2010-05-03','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:31:57','2013-09-17 08:31:57','Documento_387.pdf','application/pdf',2678056,'2013-09-17 08:31:57',20,0,138,'COMPLETO'),(387,'Estudio de la actividad cataltica de nanopartculas de rodio soportadas con polmeros orgnicos en la reaccin de carbonilacin de 1-hexeno.','Estudio de la actividad cataltica de nanopartculas de rodio soportadas con polmeros orgnicos en la reaccin de carbonilacin de 1-hexeno.','2010-05-04','nanopartculas de rodio soportadas con polmeros orgnicos',6,1,1,1,1,'2013-09-17 08:31:59','2013-09-17 08:31:59','Documento_388.pdf','application/pdf',1109439,'2013-09-17 08:31:59',20,0,80,'COMPLETO'),(388,'CONDUCTA POST-CONFRONTACION EN MONOS CAPUCHINOS COMUNES (Cebus olivaceus) EN CAUTIVERIO.','{}','2010-01-29','{}',1,1,1,1,2,'2013-09-17 08:32:00','2013-09-17 08:32:00','Documento_389.pdf','application/pdf',15869427,'2013-09-17 08:32:00',18,0,137,'COMPLETO'),(389,'Sistema de Informacin para la Planificacin Estratgica de Tecnologa de Informacin y Comunicacin','Sistema que se encarga de la planificacin estratgica de una Organizacin, donde puede esquematizas los planes operativos, los proyectos, con sus fases, recursos, sabiendo as sus fortalezas, oportunidades, debilidades y amenazas que pueda poseer esa organizacin y as saber como plantearse de llegar de la misin a la visin.','2009-11-25','Planificacin Organizacional',2,1,1,1,1,'2013-09-17 08:32:02','2013-09-17 08:32:02','Documento_390.pdf','application/pdf',5214841,'2013-09-17 08:32:02',18,0,105,'COMPLETO'),(390,'Estudio de un material adsorbente para la remocin de mercurio en aguas de consumo humano','El mercurio es un metal txico el cual es usado en la minera y otras actividades industriales. En la extraccin de oro artesanal, los mineros utilizan el mercurio sin ningn tipo de control realizando el proceso de amalgamado en ros u otros afluentes acuticos cercanos a las minas, trayendo consigo la contaminacin de stos, los seres que all habitan y las personas que se alimentan de estas especies contaminadas.Es por ello que en la presente investigacin se estudi un material adsorbente tipo arcilla para la remocin de mercurio en aguas de consumo humano. El material tiene una composicin de 27% de minerales de arcilla, dentro de los cuales estn presentes la caolinita, lilita y esmectita. Se estudi el tamao de partcula, caudal de adsorcin y desorcin, capacidad de adsorcin, recuperacin de la columna rellena con el material adsorbente luego de ser usada y forma de empaquetamiento del material adsorbente para ser utilizado como filtro para la remediacin de las aguas contaminadas con mercurio. El filtro optimizado consta de una columna rellena con aproximadamente 48 gramos del material adsorbente con un tamao de grano entre 250 y 500 micras, el cual adsorbe 100% de mercurio por largos perodos de tiempo en condiciones de caudal mnimo (0,91 mL/min) y para caudales cercanos al del servicio de agua domstica (1000mL/min) adsorbe entre 85% y 33% dependiendo de la concentracin de mercurio presente en el agua.La determinacin de la concentracin de mercurio fue realizada utilizando espectrometra de absorcin atmica con generacin de vapor frio y espectrometra de fluorescencia atmica con generacin de vapor frio.','2010-05-03','Contaminacin mercurial, adsorbente, arcilla, mineria',6,1,1,1,1,'2013-09-17 08:32:04','2013-09-17 08:32:04','Documento_391.pdf','application/pdf',1062117,'2013-09-17 08:32:04',18,0,78,'COMPLETO'),(391,'\"Estudio preliminar del contenido de Vanadio y Nquel en las fracciones A1 y A2 de asfaltenos provenientes de crudos Venezolanos\"','Venezuela es uno de los pases con mayores reservas de petrleo, en su mayora de crudos pesados y extrapesados. Sin embargo, la explotacin de estos se dificulta debido a su alta viscosidad y mayor proporcin de fracciones pesadas como resinas y asfaltenos, siendo esta la que genera problemas en las distintas etapas de produccin y almacenamiento, adems de que el contenido de metales presentes en esta fraccin causa el envenenamiento de catalizadores.Los asfaltenos han sido el objetivo de muchos estudios que intentan proponer estructuras que sean consistentes con la informacin experimental existente, en este sentido, se ha reportado la existencia de dos fracciones de asfaltenos las cuales presentan diferencias en solubilidad, la fraccin A1 insoluble en tolueno y la fraccin A2 soluble, dicho comportamiento se ha podido explicar de acuerdo a las diferencias estructurales encontradas para cada una de ellas, an cuando no se han encontrados diferencias significativas en sus caractersticas moleculares como peso molecular, aromaticidad y contenido de heterotomos que permitan justificar este comportamiento.En relacin a lo expuesto, se propuso determinar el contenido de Ni, V, Fe y Zn en las fracciones A1 y A2 de asfaltenos de crudos con diferente estabilidad empleando espectroscopia de emisin ptica con plasma inductivamente acoplado y estudiar como se distribuyen dichos metales en estas fracciones y correlacionarlo con sus caractersticas de solubilidad y estabilidad de asfaltenos en crudos.Los valores de concentracin obtenidos para V y Ni mostraron una muy buena reproducibilidad y bajo porcentaje de error comparado con los de Fe y Zn los cuales presentaron un porcentaje de error alto, el cual se puede atribuir a la baja concentracin de estos metales en crudo y a la contaminacin de los reactivos cidos empleados en las digestiones.5Los resultados obtenidos en este trabajo muestran que existe una mayor concentracin de V y Ni en asfaltenos de crudos estables que de crudos inestables. En cuanto a las fracciones A1 y A2, se encontr que existe una mayor concentracin de V y Ni en la fraccin A1 y esta pareciera ser mas marcada en la fraccin A1 de crudos inestables, de acuerdo a esto se puede establecer que los compuestos organometlicos son atrapados por molculas de A1 de manera eficiente quedando ocluido dentro de ellas, por ello, se pudiera pensar que los metales de tipo porfirinico quedan atrapados en el coloide asfaltenico entre las molculas de A1 y A2','2010-04-28','vanadio, niquel, asfaltenos, fracciones A1 y A2, digestion por microondas',6,1,1,1,1,'2013-09-17 08:32:05','2013-09-17 08:32:05','Documento_392.pdf','application/pdf',0,'2013-09-17 08:32:05',20,0,0,'INCOMPLETO'),(392,'SNTESIS ELECTROQUMICA Y CARACTERIZACIN DE NANOPARTCULAS BIMETLICAS DE METALES DE TRANSICIN','A continuacin se presenta un estudio sobre la sntesis electroqumica de nanopartculas bimetlicas de Rh-Pd y Rh-Ru y su caracterizacin por Microscopa Electrnica de Transmisin (MET), voltamperometra cclica y espectroscopa uv-visible. Las sntesis se realizaron a partir de RhCl3, PdBr2 y RuCl3 en presencia de bromuro de tetrapropilamonio el cual sirvi como electrolito soporte y estabilizador de las nanopartculas; se realizaron variaciones en las condiciones de sntesis (densidad de corriente aplicada, voltaje, concentracin de metales y de estabilizante) para determinar la influencia de stos en el tamao de las partculas y en la proporcin de los metales que las conforman. La determinacin del tamao de las partculas fue realizada por MET, estos estudios mostraron que el tamao promedio de las partculas est relacionado con la densidad de corriente y el potencial aplicado, a medida que stos aumentan, el tamao de las nanopartculas disminuye. Los patrones de difraccin de electrones obtenidos de ste estudio mostraron que en las nanopartculas bimetlicas de Rh-Pd y Rh-Ru se encuentran presentes fases metlicas y oxidadas de los metales que las conforman. Por medio de los estudios de voltamperometra cclica y espectroscopa UV-visible sugieren que las nanopartculas bimetlicas de Rh- Pd y Rh-Ru son nanoaleaciones. Se realizaron los estudios de la actividad electrocataltica mediante voltamperometra cclica de las nanopartculas de Rh-Pd y Rh-Ru sobre la oxidacin del MeOH y del HCOOH respectivamente, encontrando que las que tuvieron mejores respuestas fueron las nanopartculas de Rh-Pd sintetizadas a -0,7V/Ag/AgCl y las de Rh-Ru sintetizadas a -5mA con una concentracin inicial de 1.10-2 mol/L de Rh.','2010-04-08','Nanopartculas bimetlicas, voltamperometra cclica, espectroscopa UV- visible, microscopa electrnica de transmisin',6,1,1,1,1,'2013-09-17 08:32:06','2013-09-17 08:32:06','Documento_393.pdf','application/pdf',2018065,'2013-09-17 08:32:06',20,0,107,'COMPLETO'),(393,'Sntesis y caracterizacin de nuevos materiales microestructurados basados en hidrogeles de acrilamida y/o cido acrlico con esferas de carbono funcionalizadas para la remocin de metales pesados\"','En los ltimos aos, se ha innovado en el desarrollo de nuevas mtodos aplicados a la sntesis de materiales a partir de materiales de bajo costo y compatibles con el medio ambiente, dentro de esta gama de nuevas tecnologas se encuentra el desarrollo de materiales hbridos con propiedades y/o funcionalidad aumentada con respecto a los componentes individuales a travs del ensamblaje cooperativo de especies orgnicas e inorgnicas (sinergismo). Normal 0 false false false EN-US X-NONE X-NONE / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Estos nuevos mtodos, mencionados anteriormente, se utilizaron para la sntesis de hidrogeles de poliacrilamida entrecruzada y co-polimeros de acrilamida y cido acrlico (1:1) modificados con microesferas de carbono con la intensin de estudiar sus propiedades como superabsorbentes y tambin su potencialidad en la remocin de cationes metlicos presentes en disoluciones acuosas.','2010-05-07','hidrogel, material hibrido, microestructurado',6,1,1,1,1,'2013-09-17 08:32:10','2013-09-17 08:32:10','Documento_394.pdf','application/pdf',2048506,'2013-09-17 08:32:10',19,0,109,'COMPLETO'),(394,'ESTUDIO DE LOS COMPLEJOS DE VANADIO ((III)) CON AMINOACIDOS..SISTEMA H++-- V33++-- CCIDO GLUTMMICO ((KCl 33..00 M,, 2255 C))','En el presente trabajo fueron estudiados los siguientes sistemas: H++-- cido glutmico H++-- V33++--cido glutmico por medio de medidas de fuerzas electromotrices, emf(H), en KCl 3.0 M y a 25 C. El anlisis de los datos mediante LETAGROP arroj los siguientes resultados: Sistema H++-- cido glutmico (H2C) Especies pKa Logpqr H2C + H+ H3C+ 2.46(1) 2.46(1) H2C H+ + HC- 4.49(1) 4.49(1) H2C H+ + C2- 9.89(1) 14.38(1) (thc) 0.0114 Sistema H++-- V33++-- cido glutmico Especies Log bpqr [H2VC2]+ 25.5<26.0 Max 26.1 25.7<26.1 23.8<25.8 [HVC2] 21.3(2) 21.4(3) 21.4(2) 21.4(2) [H2VC]+3 17.81(5) 17.88(4) 17.93(4) 17.95(3) [HVC]+2 15.06(5) 15.12(4) 15.17(4) 15.17(0) s(thB) 0.0855 s (thC) 0.0196 s(thCf) 0.0786 S(E) / mV 1.28','2010-02-04','VANADIO ((III)),AMINOACIDOS , CCIDO GLUTMMICO,, Complejos de vanadio ((III)) con Acido glutamico',6,1,1,1,1,'2013-09-17 08:32:14','2013-09-17 08:32:14','Documento_395.pdf','application/pdf',1726631,'2013-09-17 08:32:14',18,0,57,'COMPLETO'),(395,'DETERMINACIN DE Zn, Pb, Cd, Cu, Cr, Se Y Hg EN CABELLO Y ORINA DE NIOS CON SNDROME DE ESPECTRO AUTISTA MEDIANTE TCNICAS DE ESPECTROSCOPA ATMICA','Se determin la concentracin de elementos traza como Zn, Cu, Cr, Se, Cd, Pb y Hg en muestras de cabello y orina con 24 horas de recoleccin en nios con Sndrome de Espectro Autista con edades comprendidas entre 3 y 16 aos, pertenecientes al Hospital J. M. de los Ros y al Hospital Prez Carreo y de una poblacin de grupo control (nios sanos) pertenecientes, en su mayora, a la Gran Caracas. Se analizaron en total 21 muestras de orina y 42 muestras de cabello de nios con Sndrome de Espectro Autista. Adicionalmente, se analizaron 9 muestras de orina y 8 muestras de cabello de nios pertenecientes a un grupo control. La determinacin de Zn, Cu, Cr, Se, Cd y Pb se realiz mediante espectrometra de emisin atmica con plasma inductivamente acoplado (ICP-OES) y la determinacin de Hg total se realiz mediante espectrometra de absorcin atmica con generacin de vapor fro (CV-AAS). Finalmente, se determin creatinina en orina mediante espectrometra ultravioleta - visible. Los resultados obtenidos fueron tratados estadsticamente empleando el programa Statgraphic Plus versin 5.0. Las concentraciones de los elementos en cabello y orina de nios con Sndrome de Espectro Autista y pertenecientes al grupo control, fueron comparadas con intervalos de referencia internacional. Para las muestras de orina, las concentraciones de Zn, Se y Hg de nios autistas estuvieron dentro del intervalo de las concentraciones de referencia, el Cu y el Pb presentaron niveles por encima de los valores referenciales y el Cr se encontr superior a estos niveles. Para una poblacin sana, las concentraciones de Cr y Hg estuvieron dentro de los valores referenciales, mientras que Cu y Se seubicaron por encima de los mismos y finalmente las concentraciones de Zn por debajo y Pb se encontraron por encima de los valores de referencia. Los valores de las concentraciones de Se, Cr y Hg se encontraron dentro del rango referencial en muestras de cabello de nios autistas, mientras que las concentraciones de Pb se ubicaron por encima y las de Zn y Cu por debajo de los mismos. Para el cabello, se encontr que slo el Hg estuvo dentro del intervalo de referencia en la poblacin sana, los elementos Se, Cr y Pb se hallaron por encima, finalmente los valores obtenidos de las medianas para el Zn y el Cu, estuvieron por debajo de los valores de referencia. Se compararon las tendencias encontradas para cada elemento en nios autistas con respecto a una poblacin control observndose que, tanto para la orina como para el cabello la eliminacin de Cu y Pb fue mayor en nios autistas que sanos. Por otro lado, la de Se, Cr y Hg fue mayor en la poblacin control que en la autista por ambas vas y la excrecin de Zn en orina fue mayor en autistas que sanos y caso contrario ocurri con el cabello. Finalmente se establecieron relaciones entre elementos como Se/Zn, Cu/Se y Cu/Zn en las muestras de orina indicando que las tendencias de concentraciones de los dos primeros eran inversamente proporcionales mientras que para la relacin Cu/Zn fue directamente proporcional.','2010-05-07','Nios con Sndrome de Espectro autista, Mercurio, Elementos traza',6,1,1,1,1,'2013-09-17 08:32:15','2013-09-17 08:32:15','Documento_396.pdf','application/pdf',1237578,'2013-09-17 08:32:15',18,0,65,'COMPLETO'),(396,'\"\"EVOLUCINN Y GEOQUMMICA DE LOS SEDIMENTOS HOLOCENOS PROXIMALES DEL SISTEMA LAGUNAR DE HIGUEROTE,, ESTADO MIRANDA.. NCCLEO HSR--11\"\"','Este trabajo tiene como objetivo la caracterizacinn geoqumica de los elementos mayoritarios presentes en los sedimentos recolectados en la paleolaguna ubicada al noroeste de la poblacinn de Higuerote,, a 33 Km de la costa oriental del Estado Miranda y la identificacinn de posibles cambios paleoambientales recientes.. Los sedimentos fueron recuperados usando el tomador de nccleos de sedimentos no consolidados de 11,,55 m de longitud fabricado en el Centro de Geologa del Instituto de Ciencias de la Tierra para este fin,, el cual emplea un sistema de percusinn,, permitiendo recuperar los sedimentos sin inducir deformacinn.. El nccleo recuperado HSR--11 tiene una longitud de 5500 cm,, se realiz un muestreo sistemtico de alta resolucinn cada 55 milmetros y se analizaron por FRX ((Fluorescencia de Rayos X)) y AES ((Espectrometra de Emisinn Atmmica)),, para determinar las concentraciones de los elementos:: Al22O33,, CaO,, Fe22O33,, K22O,, MnO,, Na22O,, SiO22 y TiO22.. sstos muestran el lmite de dos quimiofacies caracterizadas por materia orgnica y depssitos siliciclsticos.. El sodio disminuye gradualmente hacia el tope,, el hierro y el manganeso aumentan en la seccinn oxidada con mayor bioturbacinn,, mientras que los incrementos del calcio son debidos a la presencia de minerales de yeso por precipitacinn de agua marina,, otros minerales como cuarzo,, illita,, goethita,, dolomita y calcita estn presentes.. Adems,, se concluye que la seccinn de la base,, corresponde a un paleosuelo de manglar existente hace 22550000 aoos tomando la tasa de sedimentacinn de 00,,22 mm//aoo tpica para sedimentos lagunares de la costa centro--oriental de Venezuela.. Estos resultados indican que ha existido una disminucinn significativa del aporte de influencia marina en el sistema ocasionando la desaparicinn de lagunas de gran envergadura en la reginn,, dando paso a una sedimentacinn siliciclstica predominante hasta colmatarla completamente.. Tomando en cuenta un contexto de transgresinn marina global,, los resultados sugieren de manera preliminar que localmente existe una regresinn,, forzada probablemente por un aumento significativo en la tasa de sedimentacinn en la costa..','2010-05-06','Laguna Costera, Holoceno, Geoqumica, Amenazas Naturales.',6,1,1,1,1,'2013-09-17 08:32:16','2013-09-17 08:32:16','Documento_397.pdf','application/pdf',2167502,'2013-09-17 08:32:16',19,0,101,'COMPLETO'),(397,'\"Sntesis y Caracterizacin de los Derivados deDifenilalilfosfina de los Agregados Metlicos [Ru3(CO)12] y[H2Os3(CO)10] \"','I) RESUMENLa qumica de los agregados metlicos ha despertado un gran inters en losltimos aos, debido a pueden funcionar como catalizadores homogneos y ademsayudan a entender los procesos que ocurren en las superficies metlicas de loscatalizadores heterogneos, puesto que estos complejos contienen enlaces directosmetal-metal [1].Por esta razn, este trabajo se enfoca en la sntesis y caracterizacin de nuevosagregados metlicos con aplicaciones catalticas, estudiando la reactividad qumica defosfinas terciarias frente agregados metlicos del grupo 8, especficamente[H2Os3(CO)10] y [Ru3(CO)12]. Los resultados de este trabajo provienen de la interaccindel ligando orgnico alildifenilfosfina con los clusters [H2Os3(CO)10] y [Ru3(CO)12].El ligando alildifenilfosfina reacciona con [H2Os3(CO)10], a la temperatura dereflujo del ciclohexano durante 16 horas, originando los complejos minoritarios[Os3(CO)11 {1-P(C3H7)(C6H5)2] (I), [Os3(-H)(CO)9{3-3-P(C6H4)(C6H6) (C3H7)] (II)[Os3(CO)10{-3-P(C3H5)(C6H5)2] (III) y en mayor proporcin el complejo [Os3(CO)9{-3-P(C3H5)(C6H5)2,}{1-P(C3H7) (C6H5)2}] (IV).Por otro lado, el ligando alildifenilfosfina reacciona rpidamente con el agregadometlico [Ru3(CO)12] bajo reflujo de ciclohexano durante 40 min, dando lugar a laobtencin de dos complejos mayoritarios, [Ru3 (CO)10{1-P(C3H5)(C6H5)}2] (I) y[Ru3(CO)9{1-P(C3H5)(C6H5)}3] (II).','2009-12-08','{}',6,1,1,1,1,'2013-09-17 08:32:18','2013-09-17 08:32:18','Documento_398.pdf','application/pdf',1828779,'2013-09-17 08:32:18',20,0,74,'COMPLETO'),(398,'Gestin de Residuos de Permanganato de Potasio generados en los Laboratorios de Docencia de la Escuela de Qumica','RESUMENEn los Laboratorios de Docencia de la Escuela de Qumica se generan constantemente y se acumulan gran cantidad de residuos y desechos que por sus caractersticas fsicas y qumicas se consideran materiales peligrosos. Dentro de esta problemtica se destacan los residuos de Permanganato de Potasio, dado que son los que se generan en un mayor volumen y representan un alto grado de peligrosidad por s mismos y por hallarse en diversas mezclas. Este trabajo de investigacin tuvo como objetivo establecer una gestin para los diversos residuos de Permanganato de Potasio generados por la Institucin, diseando metodologas experimentales que puedan ser aplicadas por los mismos estudiantes que los generan, con el fin de reducir su concentracin, peligrosidad, almacenamiento y transformarlos en un producto til. La gestin consisti primeramente en hacer la identificacin completa de este tipo residuos a travs del estudio de cada prctica y experimento que los generaban. Se elaboraron esquemas de segregacin para cada prctica, stos contenan la reaccin qumica, los procesos y cantidades de residuo producidas, as como su composicin y asignacin de un cdigo. A partir de esta informacin se hizo el inventario correspondiente, se investig la clasificacin de peligrosidad y se construyeron las etiquetas. Se estableci recuperar el Manganeso como Dixido de Manganeso, para ello se evaluaron varios tratamientos qumicos de los cuales se seleccionaron los dos ms sencillos, rpidos y eficaces que fueron el uso de H2O2 y del propio KMnO4, adems stos no dejan residuos ni introducen especies nuevas a la solucin. El xido obtenido fue secado a 100C y caracterizado por XRD y FTIR determinndose como fase mayoritaria g-MnO2 hidratada o Nsutita que posee propiedades catalticas entre otras.Se dise una marcha analtica sencilla para eliminar las otras especies contaminantes como Fe, Sb, Ag, fosfatos, sulfatos, alcohol benclico, benzaldehdo, entre otras, logrndose disminuir sus concentraciones, exceptuando los nitratos, por debajo de los lmites permitidos en el Decreto 883. Un 57% de los productos obtenidos pueden ser reinsertados como reactivos en los propios laboratorios de esta institucin, el 14% pueden ser descartados por el drenaje y el 29% deben ser almacenadas para su disposicin final. El costo promedio de los tratamientos propuestos es de 37,05 BsF por litro de residuo y debido a la sencillez de los procedimientos pueden ser ejecutados por los propios alumnos, para lo cual se elabor una prctica para los dos primeros laboratorios de la carrera, Principios de Qumica e Inorgnica I, quedando demostrado que no se necesita de grandes desarrollos tecnolgicos para dar solucin al problema de los residuos de Permanganato de Potasio.','2010-05-06','Gestin de Residuos de Laboratorios, Residuos de Permanganato de potasio, Dixido de Manganeso',6,1,1,1,2,'2013-09-17 08:32:19','2013-09-17 08:32:19','Documento_399.pdf','application/pdf',1128540,'2013-09-17 08:32:19',20,0,60,'COMPLETO'),(399,'Dieta natural del zooplancton del embalse Suata (Edo. Aragua)','En vista de la inexistente informacin sobre los vnculos entre el fitoplancton y el zooplancton del embalse Suata (Edo. Aragua), se propuso el objetivo de analizar la dieta natural del zooplancton de este cuerpo de agua en pocas climticas diferentes. Los especmenes se capturaron mensualmente (noviembre 2007- octubre 2008) en una localidad cercana al dique del embalse mediante barridos verticales de 2 m con ayuda de una red de cierre (77 mm de luz de malla); los organismos se anestesiaron con agua carbonatada para evitar el regurgitado de su contenido estomacal y posteriormente fueron preservados con solucin de formaldehido (concentracin final 4 %). Una vez en el laboratorio los especmenes se aclararon con medio de Hoyer, el cual disuelve los tejidos blandos de los especmenes sin daar su contenido estomacal, para posteriormente ser observados bajo el microscopio. Se analiz un total de 2273 individuos (6,98% presentaron sus tractos digestivos vacos): 207 Prionodiaptomus colombiensis, 317 coppodos Cyclopoida, 197 Keratella spp., 198 Brachionus spp., 398 ostrcodos, 200 Diaphanosoma spinulosum, 158 Moina micrura, 220 Alona sp., 121 Ceriodaphnia cornuta y 257 nauplios pertenecientes a los coppodos Cyclopoida y Calanoida. Se reconocieron 11 items alimenticios, de los cuales el material particulado (conformado por algas trituradas, fragmentos de algas, detritus y partculas minerales) present las mayores frecuencias de aparicin entre los organismos estudiados. La diatomea Cyclotella y el alga verde Monoraphidium parecieron ser las especies ms consumidas por la mayora de los organismos estudiados. Los coppodos Cyclopoida presentaron la dieta ms variada (incluyeron en su dieta todos los items que se logr identificar, incluyendo rotferos y cianobacterias), seguidos del coppodo Calanoida Prionodiaptomus colombiensis, de los cladceros Diaphanosoma spinulosum, Moina micrura, Alona sp., Ceriodaphnia cornuta y de los ostrcodos (10), los nauplios (9), Brachionus spp. (7) y Keratella spp. (5). Se registr una alta superposicin de las dietas entre los diferentes grupos del zooplancton estudiado (>70%). Adems se encontraron diferencias significativas entre las dietas de sequa y lluvias para Brachionus spp., Keratella spp. y para los nauplios de los coppodos de Calanoida y Cyclopoida. El material particulado fue el items msconsumido en ambas pocas climticas. Las algas ms frecuentemente encontradas fueron Cyclotella, Oocystis, Monoraphidium y Aulacoseira en la poca de sequa y Monoraphidium, Cyclotella y Trachelomonas en la poca de lluvias. Los resultados mostraron que, a semejanza con otros embalses venezolanos, el zooplancton del embalse Suata consumi principalmente material particulado, diatomeas y algas verdes.','2010-05-03','Zooplancton-Dieta-Suata',1,1,1,1,1,'2013-09-17 08:32:21','2013-09-17 08:32:21','Documento_400.pdf','application/pdf',3522579,'2013-09-17 08:32:21',17,0,120,'COMPLETO'),(400,'Dieta natural de Thoracocharax stellatus (Characiformes: Gasteropelecidae) en una seccin de la cuenca baja del ro Orituco, Estado Gurico.','Una manera de estudiar las relaciones trficas es a travs del anlisis de la dieta de las especies en condiciones naturales, de la disponibilidad del alimento y de su conducta alimentaria lo que resulta fundamental para entender la estructura de las comunidades, sus patrones de distribucin, las estrategias de vida de las especies y el papel que stas desempean dentro del ecosistema (Blaber 1997). Los estudios de los hbitos alimenticios en peces de sistemas tropicales han demostrado la importancia que tienen los diferentes recursos en las comunidades cticas, sealando que no existen regmenes alimentarios estrictos, debido a las considerables variaciones en la disponibilidad de los recursos a lo largo del ao (Lowe-McConnell 1987, Sanchez y col. 2003, Ortaz 1992). En este trabajo se plante cuantificar, en distintas fases hidrolgicas, la dieta de Thoracocharax stellatus, especie de Characiforme presente en la cuenca baja del rio Orituco as como evaluar la variacin de la dieta entre fases y entre diferentes clases de tallas. Los muestreos se realizaron en la cuenca baja del ro Orituco, aproximadamente a 167 km aguas debajo de la cuenca alta y cerca de la poblacin de Calabozo. Se analizaron 380 ejemplares de muestras provenientes de colectas realizadas entre junio-2006 a mayo-2007 y entre diciembre-2007 a febrero-2008. Los resultados obtenidos sugieren que T.. Stellatus posee una dieta orientada al consumo de invertebrados acuticos y terrestres, en relacin a las presas consumidas. La clase Insecta fue el recurso de mayor importancia durante las tres fases hidrolgicas evaluadas en ambos periodos de campo, sin embargo no se encontraron todas las categoras en las 3 fases hidrolgicas evaluadas. Los insectos acuticos fueron un recurso de gran importancia en la dieta de Thorachocarax stellatus durante la fase de ascenso de aguas. En la poca de lluvia los invertebrados acuticos se encuentran ms disponibles dentro de la columna de agua como consecuencia de una mayor productividad en el medio, adems se presenta un incremento del rea superficial del ro y el arrastre de nutrientes al lecho del ro por efecto de la escorrenta (Angermeier y Karr, 1983).se encontraron diferencias en la dieta de la especie ne las dieferentes tallas como consecuencia de las necesidades energticas de los diferentes grupos de tallas y no relacionadas con las variaciones ontognicas.','2010-05-04','dieta de ictiofauna, ontogenicos, cambios estacionales',1,1,1,1,1,'2013-09-17 08:32:23','2013-09-17 08:32:23','Documento_401.pdf','application/pdf',1387451,'2013-09-17 08:32:23',18,0,57,'COMPLETO'),(401,'Mtodo de Anlisis de Riesgo (SPAN)','En esta tesis se estudio el mtodo de anlisis de riesgo SPAN, que es un mtodo que sirve para la dministracin y contro de riesgo de diversas institucioines y empresas financieras. El SPAN genera mediante una serie de parmetros la peor prdida probable en la que puediera incurrir una cartera de inversion que contiene instrumentos derivados. Se estudiaron cada uno de los parmetros del SPAN, demostrando los aspectos matemticos del mismo.','2010-02-24','Riesgo financiero, Medidas choherentes de riesgo, Administracin de riesgo',5,1,1,1,1,'2013-09-17 08:32:25','2013-09-17 08:32:25','Documento_403.pdf','application/pdf',28334978,'2013-09-17 08:32:25',20,0,171,'COMPLETO'),(402,'ZOOPLANCTON EN SEIS CUERPOS DE AGUA DE LA REGINN CENTRO--NORTE DE VENEZUELA Y CARACTERIZACINN MOLECULAR DE LA ESPECIE MSS COMNN','Durante el estudio de las comunidades zooplanctnicas de los ecosistemas acuticos, se pueden presentar dificultades en la identificacin de especies, muchas de las cuales son discriminadas con base en caracteres morfolgicos y morfomtricos, algunos muy sutiles. Estas comunidades pueden ser indicadoras de la calidad del agua y de su estado trfico, por lo que resulta de gran inters su estudio e identificacin. Como una contribucin al conocimiento de los cuerpos de agua de nuestro pas, se estimaron variables fisicoqumicas y la biomasa del fitoplancton y se determin la composicin y la abundancia del zooplancton en los siguientes cuerpos de agua: Embalses Guanapito y Tierra Blanca (Edo. Gurico), Lago del Crculo Militar y Embalse La Mariposa (Distrito Capital), Embalse La Pereza (Edo. Miranda) y Lago de Valencia (Edos. Carabobo y Aragua). Adems, se estandariz el mtodo para aislar ADN de zooplancton y mediante la tcnica de PCR se amplificaron 3 regiones del genoma del cladcero Diaphanosoma birgeiKorineck, 1981. Las regiones amplificadas forman parte de los genes que codifican para el gen 12S ARN ribosomal del ADN mitocondrial (12S ARNr), el gen de la subunidad I de la citocromo oxidasa C mitocondrial (mtCOI) y el espaciador ribosomal interno transcrito 2 (ITS2). La recoleccin del zooplancton se realiz a travs de un muestreo puntual en cada sistema mediante barridos verticales en el estrato oxigenado con una red de cierre (luz de malla= 77 m). Las muestras se preservaron en formaldehdo al 4% de concentracin final y en etanol 99,8% y vivas. La biomasa del fitoplancton se estim mediante la determinacin de la concentracin de clorofila-a. La mayora de los cuerpos de agua estuvieron estratificados trmicamente durante los muestreos, con temperaturas superficiales superiores a los 26,5 C. En el Lago de Valencia y los embalses La Pereza y Tierra Blanca se registraron condiciones de hipoxia en los estratos profundos, posiblemente debido a las altas tasas de descomposicin de materia orgnica. En general, los valores de pH registrados fueron alcalinos. En cuanto a las caractersticas biticas, el menor valor de la biomasa fitoplanctnica se registr en el embalse Guanapito (0 g/L) y el mayor en el Lago del Crculo Militar (21,2 g/L). Los embalses Guanapito y La Mariposa presentaron las menores abundancias medias de zooplancton (8 y 16 ind./L, respectivamente). En el Lago de Valencia, por el contrario, se registr la mayor abundancia media (131 ind./L), seguido por: embalse Tierra Blanca (81 ind./L), Lago del Crculo Militar (59 ind./L) y embalse La Pereza (30 ind./L). Los coppodos resultaron ser el grupo dominante, seguidos de los rotferos y de los cladceros. Las abundancias del zooplancton en algunos de los cuerpos de agua estudiados parecieron corresponderse con la biomasa del fitoplancton, la cual representara la oferta de alimento para los animales planctnicos. El gnero de Cladocera ms comn presente en los seis cuerpos de agua bajo estudio fue Diaphanosoma, por lo que cuyos representantes fueron empleados en los anlisis genticos. En estos, los resultados indicaron que la preservacin con etanol fue la ms efectiva para la extraccin del ADN, con posterior hidratacin. Se evalu la eficiencia de la tcnica de extraccin empleando tres mtodos distintos, de los cuales result ms eficaz el uso de un estuche comercial, con algunas modificaciones. Los cebadores empleados en las reacciones de amplificacin no parecieron ser especficos para los genes 12S ARNr, ITS2 y mtCOI codificados por organismos de este gnero. La inclusin de caracteres taxonmicos moleculares es una herramienta til para la identificacin exacta y confiable de los individuos, y dado que en Venezuela no se han realizado estudios de biologa molecular con microcrustceos, la estandarizacin llevada a cabo en el presente trabajo es pionera en esta rea.','2010-05-04','Zooplancton, cuerpos de agua.',1,1,1,1,1,'2013-09-17 08:32:29','2013-09-17 08:32:29','Documento_404.pdf','application/pdf',38762784,'2013-09-17 08:32:29',18,0,140,'COMPLETO'),(403,'Morfologa del polen del gnero Abutilon Mill. (Malvaceae) en Venezuela','La palinologa es la ciencia que estudia el polen y las esporas. La morfologa del polen posee alto valor diagnstico por ser un caracter reproductivo y porque sus paredes tienen una composicin qumica que le permiten conservarse por miles de aos. En taxonoma, la contribucin de la palinologa se concentra en la exina, ya que sta incorpora un gran nmero de caracteres diagnsticos fcilmente estudiables, y tambin porque los estudios de polen fsil estn hechos con base en el esqueleto de la exina. Para Venezuela los trabajos en morfologa del polen son numerosos; sin embargo, no se encontraron para la familia Malvaceae Juss. En el presente trabajo se estudi la morfologa del polen del gnero AbutilonMill. como una contribucin a la taxonoma del grupo. Este gnero pertenece a la tribu Malveae, familia Malvaceae, con 11 especies en Venezuela, de las cuales A.. burandtiiy A.. cuspidatum son endmicas. Se analizaron 10 muestras de polen provenientes de material de herbario, incluyendo A.. divaricatum (excluida del Nuevo Catlogo de la Flora de Venezuela) A.. striatum (especie cultivada, pero reportada en la Flora de vila como naturalizada) y Pseudabutilon umbellatum (muy cercana al gnero). Se midieron, al MO, 30 granos acetolizados por especie (en vista polar y ecuatorial) en la exina, aberturas y espinas; al MEB se detall la ornamentacin de la exina y las aberturas. Los datos obtenidos se analizaron para evaluar si haba diferencias estadsticamente significativas. Como resultado se encontr que el polen de Abutilonesgrande, suboblato - oblato-esferoidal, 3-(4)zonocolporado, con anillo; tectado, equinado, imperforado - foveolado, con espinas erectas o torcidas y disco basal. Se determin que los caracteres cuantitativos de los granos de polen evaluados, as como la forma de estos y la perforacin del tectum, son tiles para la separacin de las especies y fueron utilizados en la elaboracin de la clave palinolgica.','2010-04-26','Palinologa, Abutilon, polen, Malvaceae',1,1,1,1,1,'2013-09-17 08:32:31','2013-09-17 08:32:31','Documento_405.pdf','application/pdf',4022472,'2013-09-17 08:32:31',20,0,0,'INCOMPLETO'),(404,'Modelos de Medicinn de Riesgo de Crdito en Portafolios','La teora de riesgo en seguros es til en el mbito de los crditos, una vez que se muestra la similitud entre un seguro y un crdito. Las metodologas elaboradas con esta teora parten de un enfoque de portafolio; estas permiten cuantificar elementos importantes como la volatilidad de las probabilidades de incumplimiento, y los efectos que tienen sobre el portafolio la concentracin y la diversificacin.','2010-01-22','Riesgo, Seguros, Portafolio, Crdito, Modelos',5,1,1,1,1,'2013-09-17 08:32:32','2013-09-17 08:32:32','Documento_406.pdf','application/pdf',1977283,'2013-09-17 08:32:32',20,0,100,'COMPLETO'),(405,'SNNTESIS Y CARACTERIZACINN DE NANOPARTCCULAS DE RODIO ESTABILIZADAS CON LQQUIDOS INNICOS..ESTUDIO DE SU ACTIVIDAD CATALTTICA EN REACCIONES DE HIDROGENACINN DE HIDROCARBUROS INSATURADOS..','RESUMEN..Utilizando el mtodo de reduccin y desplazamiento de ligandos se evalu la influencia que tiene emplear un precursor monometlico vs un dmero organometlico del metal. En la obtencin de nanopartculas de Rh estabilizadas en diferentes lquidos inicos (LIs). La utilizacin de diferentes LIs como agentes estabilizantes de las nanopartculas metlicas fue realizada con el fin de comparar el efecto que pudiese tener el tamao del catin y el tamao de la cadena alqulica de estos lquidos inicos, tanto en la distribucin de tamao de las nanopartculas, su estabilidad, as como su actividad cataltica en reacciones de hidrogenacin. En tal sentido se sintetizaron los siguientes LIs de hexafluorofosfato: de 1-pentil-3-metil-imidazolio, de 1-dodecil-3-metil- imidazolio, de 1-pentil-4-picolinio y el de 1-dodecil-4-picolinio. La caracterizacin de estos LIs se llev a cabo mediante espectroscopia de resonancia magntica nuclear (1HRMN), espectrometra de masas y anlisis elemental por ICP-OES.Los precursores organometlicos [Bis-m-cloro-di-(1,5- ciclooctadieno)]dirodio(I) y 2,4-pentanodiona(1,5-ciclooctadieno)rodio(I) utilizados tambin fueron sintetizados como parte de este trabajo y caracterizados por espectroscopa de infrarrojo con transformada de Fourier.Los ocho sistemas de rodio sintetizados fueron caracterizados mediante:, microscopia electrnica de transmisin de alta resolucin (HRTEM), difraccin de electrones, difraccin de rayos X (DRX) y anlisis elemental por ICP-OES. Estos anlisis evidencian que todos los sistemas estn compuestos de nanopartculas de Rh metlico, con tamaos promedios comprendidos entre 1,3 y 6,5nm. Estos sistemas tienen un arreglo cristalogrfico cbico centrado en las caras. Los porcentajes de metal obtenidos para cada sistema dependieron del precursor y el LI empleado para su obtencin.Con el fin de evaluar la influencia del precursor organometlico y del LI utilizado en la actividad cataltica de estos sistemas, se estudi la reactividad de los mismos en las reacciones de hidrogenacin de ciclohexeno y benceno. Los resultados obtenidos de este estudio arrojan que los sistemas sintetizados a partir del precursor dimrico (Rh1-LIn) fueron eficientes a temperatura ambiente, exceptuando al (Rh1-1-dodecil-3-metil-imidazolio), que solo present un 24% de conversin a estas condiciones. Al aumentar la temperatura a 80C todos los sistemas (Rh1- LIn) presentaron 100% de conversin a excepcin del (Rh1-LI2). Sin embargo todos los TOF obtenidos son altos en relacin a los reportados en la literatura para la hidrogenacin del ciclohexeno en condiciones similares.En la hidrogenacin cataltica del benceno, todos los catalizadores (Rh1-LIn) generaron ciclohexano como nico producto. El (Rh1-LI3) fue el mejor catalizador presentando una conversin cercana al 50% con un TOF de 84h-1 el resto de los sistemas presentaron conversiones bajas en condiciones suaves.Los sistemas sintetizados con el precursor monometlico (Rh2-LIn) fueron 100% eficientes en la hidrogenacin cataltica del ciclohexeno a temperatura ambiente.Los sistemas (Rh2-LIn) fueron activos en la hidrogenacin cataltica del benceno. Sin embargo, slo el sistema (Rh2-1-dodecil-4-picolinio) present una conversin mayor al 60% en la hidrogenacin cataltica del benceno a temperatura ambiente con un TOF de 4509 moles de productos/ mol de metal o h, lo cual es muy superior a los reportes encontrado en la literatura.Se comprueba que mediante el diseo del LI y la escogencia apropiada del precursor organomtalico se logra optimizar la actividad cataltica de estos sistema','2010-04-29','Sntesis y Caracterizacin de Nanopartculas, Nanopartculas de Rh, Lquidos Inicos, Hidrogenacin de Hidrocarburos Insaturados.',6,1,1,1,1,'2013-09-17 08:32:34','2013-09-17 08:32:34','Documento_407.pdf','application/pdf',7861473,'2013-09-17 08:32:34',20,0,99,'COMPLETO'),(406,'EVALUACIN DE FORMULACIONES DE DESEMULSIFICANTES PARA EMULSIONES DE AGUA EN CRUDO EXTRAPESADO VENEZOLANO.','Las principales reservas de petrleo en Venezuela son de crudo pesado y extrapesado, y debido al incremento de demanda de energa del mundo, Venezuela esta investigando sobre diferentes mtodos de produccin de este crudo. Uno de los mtodos estudiados es la inyeccin de vapor de agua, con el fin de disminuir la viscosidad del crudo y mover el mismo a superficie. Sin embargo, este mtodo puede promover la formacin de emulsiones estables agua en aceite (emulsiones W/O), las cuales incrementan la viscosidad original del crudo y dificultan el transporte del mismo en superficie. Para tratar de solventar este problema, diferentes formulaciones de surfactantes acuosos son usados para mezclarlos con las emulsiones W/O y producir emulsiones inversas inestables de crudo extrapesado en agua (emulsiones O/W). Adems, este mtodo permite disminuir la viscosidad del crudo y consecuentemente mejorar el transporte del mismo hasta las plantas de tratamientos, donde la emulsin es rota y deshidratada. Las formulaciones de surfactantes evaluadas para formar las emulsiones O/W fueron soluciones alcalinas, las cuales activan los surfactantes naturales (SN) presentes en el crudo. Adicionalmente se evaluaron mezclas de cidos grasos, mayoritariamente acido oleico y linoleico, con sales de sodio y monoetanolamina. Los resultados muestran la formacin de emulsiones mltiples tipo W/O/W, cuando la emulsin OW es mezclada con las formulaciones de surfactantes. Sin embargo, la viscosidad de las emulsiones mltiples es similar a la del agua y puede ser fcilmente transportada. En orden de romper y deshidratar las emulsiones mltiples fue utilizado el mtodo de calentamiento en sinergia con salmuera durantes varias horas. Los mejores resultados fueron obtenidos cuando las emulsiones mltiples estuvieron en contacto con el qumico natural de alquil-poliglucsido extrado de la planta Aloe Vera. Este alquil- pliglucsido trabaja como un excelente desemulsificante en sinergia con calentamiento por varias horas desde que el porcentaje de deshidratacin fue hasta 98%.','2010-05-04','Emulsiones, Crudo Extrapesado, Formulaciones, Surfactantes Naturales',6,1,1,1,1,'2013-09-17 08:32:36','2013-09-17 08:32:36','Documento_408.pdf','application/pdf',18379307,'2013-09-17 08:32:36',17,0,136,'COMPLETO'),(407,'El Crculo Gua de una Cclide.','Una cclide general es una superficie tubular definida por la envolvente de una familia cuadrtica monoparamtrica de esferas en el espacio Eucldeo. Las Cclides generales son las principales primitivas geomtricas mbox{usadas} en la modelacin de estructuras tubulares de radio constante o variable y de conexin suave. Estas superficies han sido estudiadas por importantes gemetras en el rea de C.A.G.D (Computer Aided Geometric Design) durante los ltimos 20 aos, cabe destacar a W. Boehm, Pottman, Larry Schumaker, entre otros. Diversos modelos matemticos se emplean en el estudio de las cclides, por ejemplo: el modelo propuesto por Dan Pedoe, el modelo de Moebis y el modelo de Laguerre. En este trabajo se emplea el modelo propuesto por Dan Pedoe el cual establece una correspondencia biyectiva entre puntos que yacen en el exterior de una cudrica $varphi subset,R^4,$ que denotaremos por $varphi^+$ y esferas y/ o puntos en el espacio 3D. A partir de esta correspondencia se establece tambin una correspondencia entre rectas que yacen en $varphi^+$ con crculos en 3D.\\ Al considerar una cnica de Bzier $b(t)subsetvarphi^+,$ se obtiene una familia cuadrtica monoparamtrica de esferas en $R^3$ y la superficie envolvente de dicha familia ser la cclide asociada a la cnica $b.$ Las rectas tangentes a $b$ se corresponden a las secciones circulares de la envolvente, las cuales sern de gran ayuda para el despliegue de su grfico sin hacer uso su ecuacin implcita. \\ Independientemente del modelo usado para construir una cclide, esta superficie tiene asociado un crculo muy especial denominado 	extit{crculo gua,} ver [3], el cual aparece por la propiedad de ortogonalidad entre las esferas, $mbox{ver [1].}$ Es nuestro inters estudiar este crculo y su relacin con la forma de la cclide. Para ello, se llev a cabo el diseo de una interfaz grfica con el software MATLAB 2008 que permite la visualizacin de los resultados.\\ El manuscrito est estructurado de la siguiente forma: En el Captulo 1, se comienza con la definicin de los polinomios de Bernstein y el estudio de algunas propiedades importantes de estos; A partir de estos polinomios se definen unas curvas muy importantes en la modelacin geomtrica que se denominan curvas de Bzier, estudiandose alguna de sus propiedades ms importantes como por ejemplo la interpolacin y la tangencia. Luego, se describe un algoritmo muy eficiente para el despliegue de estas curvas conocido como Algoritmo de de Casteljau. Por ltimo se define superficie envolvente. En el Captulo 2, se describe el modelo de Dan Pedoe, extendiendo la idea original a una dimensin mayor, estableciendo una correspondencia biyectiva entre puntos de $R^4$ que yacen en el exterior de una cuadrica muy particular ($varphi$) y esferas y/o puntos de $R^3.$ A partir de esta correspondencia se establece tambin una correspondencia entre rectas de $R^4$ que no cortan a $varphi$ y crculos en 3D. En el Captulo 3, se introduce la definicin de cclide general, como la superficie envolvente de una familia monoparamtrica de esferas en 3D. En este trabajo una cclide se define como la envolvente de una familia monoparamtrica de esferas generada por una cnica de Bzier $b(t)subsetvarphi^+.$ Por ltimo se define el crculo gua asociado a una cclide el cual se corresponde con la recta conjugada del 2-plano que contiene a la cnica $b(t)subset R^4$ y se estudian algunas propiedades interesantes que relacionan este crculo con la cclide.','2010-06-28','Ciclide general, recta conjugada, armonicos conjugados, modelo de pedoe.',5,1,1,1,1,'2013-09-17 08:33:07','2013-09-17 08:33:07','Documento_409.pdf','application/pdf',899938,'2013-09-17 08:33:07',20,0,73,'COMPLETO'),(408,'Desarrollo de una aplicacin para procesar y organizar oficios digitalizados de modificacin y apertura de materias de la Divisin de Control de Estudios de la Facultad de Ciencias de la Universidad Central de Venezuela.','El objetivo del presente Trabajo Especial de Grado consiste en el desarrollo de un sistema que automatice el proceso de digitalizacin de oficios de aperturas y modificaciones de materias de la Facultad de Ciencias de la Universidad Central de Venezuela, que han sido almacenados en las instalaciones de la Divisin de Control de Estudios, especficamente un archivo ubicado en la oficina de la directora de dicha divisin. El sistema est dividido en dos partes, donde se tiene una aplicacin local encargada de empaquetar y enviar las imgenes al servidor, y en segundo lugar se tiene una aplicacin Web encargada del procesamiento de los oficios. Para cumplir con los objetivos de la aplicacin se utiliz la metodologa gil XP (Programacin Extrema), la cual se basa fundamentalmente, en la construccin progresiva del software sin hacer nfasis en etapas de diseos.','2010-06-28','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Table Normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',2,1,1,1,1,'2013-09-17 08:33:10','2013-09-17 08:33:10','Documento_410.pdf','application/pdf',2470879,'2013-09-17 08:33:10',20,0,176,'COMPLETO'),(409,'Estudio de Ecuaciones Duferenciales Utilizando Mtodos Geomtricos','Explicamos el mtodo de simetras de Lie y el de la caracterstica de Cartan- Monge para resolver ecuaciones diferenciales y por ltimo formulamos el formalismo de fibrados de Jets para ecuaciones diferenciales, sus soluciones y los mtodos nombrados anteriormente.','2010-07-06','Ecuaciones diferenciales y Geometra',5,1,1,1,1,'2013-09-17 08:33:13','2013-09-17 08:33:13','Documento_411.pdf','application/pdf',12922282,'2013-09-17 08:33:13',20,0,127,'COMPLETO'),(410,'PROCESAMIENTO E INVERSINN GRAVIMTTRICA EN LA REGION DEL SUR DEL LAGO DE MARACAIBO','El Uranio en el mundo entero se est considerando cada vez ms, como una fuente de energa limpia y confiable. Alrededor del 30% de los recursos de Uranio en el mundo constan de depsitos de Uranio en areniscas y corresponden al segundo tipo de depsitos de Uranio ms importante (International Atomic Energy Agency, 3003). Este tipo de depsitos se forma cuando el agua oxidante subterrnea (que contiene Uranio diluido U6+) se mueve a travs de una unidad de areniscas permeables y encuentra un agente reductor tal como materia orgnica o pirita, donde el Uranio es precipitado en su estado tetravalente U4+. La reduccin es causada principalmente por el H2S que se genera de la materia orgnica en descomposicin, o por la introduccin de gases o fluidos reductores (H2S, hidrocarburos o ambos) a travs de estructuras geolgicas favorables (Spirakis, 1996). Con la finalidad de encontrar fuentes alternativas de energa en Venezuela, a partir de los aos 70 en todo el territorio nacional se llevaron a cabo diversos estudios geoqumicos, sobre muestras de rocas, agua y sedimentos, as como estudios geolgicos donde se evala la potencialidad de distintos ambientes como reas favorables para la mineralizacin de Uranio (Audemar, 1977; Escola, 1977; Lo Monaco, 1985; Pasquali, 1974, 1977, 1981; Perez & Sifontes, 1985; Sifontes et al., 1982, 1985; Yanes et al., 1985). Los resultados de estos estudios muestran que en Venezuela existen tres reas donde potencialmente puedan existir yacimientos de Uranio: La discordancia de la base del Grupo Roraima en el Escudo de Guayana, la discordancia de rocas ms jvenes supreyacentes al Escudo de Guayana, al sur de la Cuenca Oriental de Venezuela y las areniscas, lodositas y fosforitas del Miembro Quevedo de la Formacin Navay en el Edo. Tchira. Existe otra zona en Venezuela donde potencialmente puedan existir yacimientos de Uranio, ubicada al norte de los Andes venezolanos, al sur del Lago de Maracaibo, donde se plantea la hiptesis de encontrar depsitos de Uranio en areniscas de tipo \"Roll Front\" (Pinero y Tosiani, comunicacin personal). En este modelo, el Uranio diluido que proviene de los Andes (de los granitos que forman parte de las asociaciones Los Torres y Bella Vista y el complejo Iglesias), es incorporado en las aguas superficiales y subterrneas del flanco norte de los Andes, que gradualmente percolan hacia las zonas bajas del pie de monte, hasta encontrar agentes reductores o iones precipitantes, los cuales fijan el Uranio, generando el yacimiento. Con la finalidad de identificar de forma regional paleo canales, acuferos, fallas y altos estructurales, que pudieran estar asociados directamente con el transporte de gases y fluidos reductores, as como del propio Uranio, se lleva a cabo un estudio gravimtrico, en el cual se reprocesa y analiza un conjunto de datos ubicados al sur del lago de Maracaibo en el piedemonte norte de los Andes, que pertenecen a PDVSA-INTEVEP. Esta base de datos contiene valores de anomalas de Bouguer simple, calculados a partir de una densidad de 2,67g/cm3, con su respectiva ubicacin espacial y altura. A cada estacin se le calcula la correccin topogrfica para obtener valores de anomala de Bouguer completa, que varan de los -156mGal hasta los 4,04mGal. Los mximos valores de anomala se encuentran sobre los Andes, mientras que los mnimos se encuentran en el piedemonte norte de los Andes, en una franja de direccin sur-oeste nor-este, que corresponden con la raz de los Andes de Mrida.Se calcula y analiza el espectro de potencias del mapa de anomala de Bouguer completa, para luego aplicarle distintos filtros y as obtener la separacin regional-residual. Se calculan adems, las derivadas direccionales y las soluciones de Euler al mapa de la anomala de Bouguer y a los mapas de sus componentes residual y regional. Dichos mapas (especialmente los de la componente residual) realzan ciertos rasgos que ubican estructuras geolgicas como fallas, paleocanales, altos estructurales, entre otras, que no se observan a simple vista sobre el mapa de anomala de Bouguer. De esta manera se localizaron numerosas fallas, la mayora de direccin nor-oeste sur-este que se encuentran en el piedemonte norte de los Andes, cercanas a los mrgenes del lago de Maracaibo.Adicionalmente se trazan dos perfiles sobre el mapa de la anomala de Bouguer y su componente residual, uno de direccin nor-oeste sur-este, perpendicular a los andes y otro paralelo a los Andes, de direccin nor-este sur-oeste que corta perpendicularmente al primer perfil. Sobre estos perfiles se obtienen modelos bidimensionales del subsuelo, en los cuales se muestran un conjunto de fallas inversas que involucran basamento y sedimentos del Cretcico y Mioceno/Eoceno. Algunas de estas fallas forman parte del frente de deformacin que dio origen a los Andes, otras simplemente son el producto de diferentes procesos compresionales de direccin nor-oeste sur-este que ocurrieron al norte de los Andes cerca de los mrgenes con el lago de Maracaibo. Estas fallas resultan ser estructuras que potencialmente pudieran favorecer a la depositacin de Uranio.','2010-09-10','Uranio, Mtodos Gravimtricos, anlisis espectral, Inversin 2D',3,1,1,1,1,'2013-09-17 08:33:15','2013-09-17 08:33:15','Documento_412.pdf','application/pdf',2180799,'2013-09-17 08:33:15',20,0,82,'COMPLETO'),(411,'Anlisis numrico del efecto de la Anisotropa de Superficie en Nanopartculas Ferromagnticas','En este trabajo hacemos un estudio numrico de los efectos de la anisotropa superficial en cantidades termodinmicas de nanopartculas ferromagnticas cbicas, representadas mediante un modelo mixto de Ising de espines S==00,, 11. Se consideran interacciones de intercambio a primeros vecinos entre los espines, as como los efectos producidos por la anisotropa de superficie, KS, y de volumen ,KV. Variamos el tamao de los nanocubos desde un L00==44 espines por aristas, donde la relacin superficie-volumen es mayor a uno S//V>>11, hasta Lmax==2200espines con S//V~~==00..44, incluyendo un tamao intermedio Lu==1100 espines, cuya relacin SS//V~~==11. Usando el mtodo de Monte Carlo se generan configuraciones de importancia, para calcular la energa por sitio, magnetizacin, calor especfico y susceptibilidad magntica. Hemos logrado reproducir con este modelo sencillo, muchos de los comportamientos obtenidos por otros autores con el modelo de Heisenberg. En el caso de la nanopartcula de menor tamao, encontramos cambios importantes en el comportamiento de las cantidades termodinmicas estudiadas. Encontramos anomalas en las curvas de magnetizacin y susceptibilidad magntica caractersticas de sistemas nanoscpicos, las cuales se atribuyen al bajo nmero de coordinacin y la falta de compensacin de los espines de superficie. As mismo, mostramos que el ordenamiento ferromagntico o paramagntico del sistema depende del la relacin entre entre la anisotropa superficial y la interaccin de intercambio. Encontramos que en el rango donde KS<<--Jnn se observan cambios en la temperatura crtica (TC) del sistema, mientras que para KS>>--Jnn, TC aumenta de manera no lineal.','2010-07-19','Nanopartculas Ferromagnticas, Monte Carlo, Anisotropa de superficie.',3,1,1,1,1,'2013-09-17 08:33:16','2013-09-17 08:33:16','Documento_413.pdf','application/pdf',0,'2013-09-17 08:33:16',19,0,0,'INCOMPLETO'),(412,'Anlisis e Implementacinn de un Esquema Bsico de Seguridad Usando Software Libre','Actualmente las redes de rea local son tan habituales que casi no hay oficina que no la posea; incluso gran parte de hogares la tienen. La mayora de estas redes estn conectadas a Internet, hecho que las hace vulnerables a los peligros latentes en el Internet, por ese motivo es necesario proporcionar a estas redes algn nivel de seguridad. En este trabajo se analizaron en forma detallada cada una de las recomendaciones propuestas por el documento ISO/IEC 27002; con el objeto de buscar un esquema bsico de seguridad para las redes de rea local y proponer un conjunto mnimo de recomendaciones al respecto, as como tambin su implementacin usando software libre. El esquema bsico de seguridad encontrado est compuesto por un conjunto mnimo de recomendaciones (clusulas) cuyo cumplimiento proporciona un nivel de seguridad aceptable en redes no crticas; es decir en redes de organizaciones con pocos enemigos potenciales, redes que no pertenecen a grupos de espionaje, ni agencias de investigacin, ni centros de seguridad gubernamental, ni bancos, ni otras organizaciones del estilo. Adicionalmente, se recomienda abaratar costos de implementacin, incrementar la independencia y mantenerse actualizado. Para lograrlo se propone usar software libre, el cual con costos bajos y alta confiabilidad permite implementar el conjunto mnimo de recomendaciones extrado del documento ISO/IEC 27002.Las recomendaciones del esquema bsico propuesto se implementaron en un caso de estudio, usando herramientas de software libre, demostrando as la efectividad de la propuesta.','2010-06-15','Internet,, intranet,, seguridad,, software libre,, ISO//IEC 2277000022..',2,1,1,1,1,'2013-09-17 08:33:17','2013-09-17 08:33:17','Documento_414.pdf','application/pdf',1000395,'2013-09-17 08:33:17',16,0,57,'COMPLETO'),(413,'Modelaje Fsico--Matemtico del transporte del inn Ca22++ en el citosol de clulas de mssculo liso vascular mediante el uso de una ecuacinn de difusinn--reaccinn','Se sabe con precisin que la contraccin de las clulas musculares lisas, al igual que en las clulas de msculo estriado, est regulada por un aumento de la concentracin del in Ca2+ en el citosol, aunque en la actualidad no se conocen exactamente los mecanismos de liberacin de calcio en el msculo liso.En este trabajo se ha construido un modelo fsico-matemtico unidimensional que representa a una clula de msculo liso, mediante el uso del paquete computacional COMSOL Multiphysics 3.4 (basado en el mtodo numrico de elementos finitos) el cual resuelve numricamente una ecuacin de difusin- reaccin (ecuacin en derivadas parciales) obtenida a partir de la descripcin de la dinmica del in Ca2+ en el citosol de la clula muscular lisa. Se disearon experimentos computacionales \"in silico\" de difusin-reaccin para el disparo de 1, 2 y 3 canales de rianodina (RyR) y la accin de Jserca, (accin de la bomba ATP-sica del retculo sarcoplsmico) donde se analiz el comportamiento de la concentracin citoslica de Ca2+ (sparks) en funcin del tiempo para distintos puntos del dominio y diferentes tiempos de disparos. Se determin que slo la accin de Jserca(modelada por la frmula de Michaelis- Menten) no garantiza el regreso de la concentracin al nivel basal durante la relajacin, razn por la cual se consider la accin de una segunda reaccin llamada Jfuga(la accin simultnea de ambas simula el efecto del fosfolambano sobre Jserca). Tambin se demostr que la difusin del Ca2+ sin considerar la accin de los buffer alcanza su estado estacionario cerca de 50 veces ms rpido que cuando se considera la accin del buffer Calmodulina (CaM). Como consecuencia de la liberacin impulsiva de Ca2+ su concentracin mxima en el citosol es diecisiete (17) veces mayor que la basal. Los cambios transitorios de concentracin en puntos cerca del lugar de la liberacin ocurren diez (10) veces ms rpido que los cambios transitorios en puntos localizados cerca de los extremos del dominio. Se observaron oscilaciones en la concentracin del in Ca2+ en puntos del dominio cuando se disparan ms de 1 canal de RyR. Los tiempos obtenidos para alcanzar el estado estacionario (relajacin) estn acorde con los descritos en la literatura para una clula de musculo liso. Estos experimentos \"in silico\" representan una aproximacin a la comprensin de los mecanismos locales que operan en la difusin citoslica del in calcio cuando se consideran liberaciones a travs de pocos canales de RyR.','2010-09-09','Msculo liso, In calcio, Difusin-reaccin, Comsol 3.4, Elemento finito',3,1,1,1,1,'2013-09-17 08:33:20','2013-09-17 08:33:20','Documento_415.pdf','application/pdf',3742947,'2013-09-17 08:33:20',20,0,102,'COMPLETO'),(414,'DESARROLLO DE UN SISTEMA DE INFORMACIN COLABORATIVO PARA EL CONTROL DE VISITAS MDICAS','En este Trabajo Especial de Grado se presenta el desarrollo de un Sistema de Informacin Colaborativo para facilitar el control y la administracin de la informacin de organizaciones de mercadeo de productos farmacuticos. Para el desarrollo del mismo se utilizan diversas tecnologas de programacin, organizadas en el modelo multi-capa, entre las que podemos nombrar: PHP Hypertext Processor y su librera de funcionalidades Zend Framework para la capa lgica de negocio, Base de Datos MySql para la capa de persistencia de datos y JavaScript y su librera de funcionalidades Jquery. La arquitectura que se utiliza para construir el Sistema de Informacin es la llamada Modelo Vista Controlador. Todo el desarrollo se apoya en la metodologa de desarrollo Scrum tomando las historias de usuario de la Programacin Extrema (XP). Con el desarrollo de este Sistema, se logra la disminucin de los tiempos de respuesta en las operaciones de la empresa, as como la automatizacin de diversas tareas, el control de las actividades y centralizacin de la informacin.','2010-06-11','Sistemas de Informacin, aplicaciones de trabajo colaborativo, Control de visitas, controles de eventos, Lenguajes de Programacin, Servidor Web, Base de Datos, Programacin Extrema, Scrum, MySql, PHP, Zend Framework, Jquery, JavaScript, AJAX, CS',2,1,1,1,1,'2013-09-17 08:33:21','2013-09-17 08:33:21','Documento_416.pdf','application/pdf',1744030,'2013-09-17 08:33:21',20,0,79,'COMPLETO'),(415,'REGISTRO Y ANLISIS DE LA VARIABILIDAD DEL RITMO CARDACO EN EMBRIONES DE POLLO CON CORTO PERIODO DE GESTACIN','Los estudios sobre el sistema cardiovascular de las aves se han visto fortalecidos con la aplicacin de registros en seales cardacas. En el presente trabajo se utiliz tres registros definido como: Electrocardiograma (ECG) y Acustocardiograma (ACG) y uno ptico, reforzado con su respectivo anlisis en las seales cardacas obtenidas de los embriones de pollo con 8, 9, 14 y 15 das de gestacin. A fines de aplicar las tcnicas de anlisis de la variabilidad de la frecuencia cardaca (VFC). Los resultados mostraron un aumento en la Frecuencia Cardaca Promedio (FCP), calculada en pulsaciones por minutos (lat/min), a travs de la medicin en los intervalos entre los puntos mximos del registro del ECG. Este aumento est vinculado a los cambios que van ocurriendo en la formacin del embrin, el rango obtenido de FCP esta entre 196-243 latidos por minuto. El tacograma fue mostrado en funcin del tiempo y los ndices de VFC son determinados encontrndose algunas diferencias entre las diferentes edades del embrin. Por otra, la densidad espectral del registro ECG presenta diferentes picos correspondientes a la FCP con sus armnicos, para obtener frecuencias bajas (LF) alrededor de 0,2 - 0,72 Hz y frecuencias altas (HF) entre 1,9 - 2,5Hz. Con respecto al Acustocardiograma la FCP esta en el rango de 169-192 latidos por minuto slo para embriones de 8 y 9 das de gestacin. Con respecto a los ndices VFC existen algunas diferencias al comparar el ACG con el ECG. Con todo esto se demostr que puede ser claramente analizada el modelo cardaco del embrin de pollo en corto perodo de gestacin, fortalecido con los mtodos de registros como el ACG y ECG. Y por ltimo, se aplic un registro ptico el cual no arroj ningn resultado satisfactorio ya que no se conto con los aparatos pticos necesarios.','2010-09-08','Embrin de pollo- electrocardiograma-acustocardiograma-variabilidad de la frecuencia cardaca-desarrollo embrionario.',3,1,1,1,1,'2013-09-17 08:33:23','2013-09-17 08:33:23','Documento_417.pdf','application/pdf',4692447,'2013-09-17 08:33:23',18,0,124,'COMPLETO'),(416,'CARACTERIZACIN DE UNA COMUNIDAD MICROBIANA EN SUELOS AFECTADOS POR LA ACTIVIDAD PETROLERA EN EL REA DE INFLUENCIA DE LA FOSA BARED-9, UBICADA EN EL EDO. ANZOTEGUI.','En Venezuela existen unas 12.000 fosas petroleras, donde se han almacenado por dcadas desechos de las actividades de explotacin y produccin de hidrocarburos. El presente estudio se realiz en la fosa Bared-9, ubicada geogrficamente a una latitud 8 5546,2 N y longitud 64 744,8 W (coordenadas UTM 948033 N 379742 E), en el Distrito San Tom, Estado Anzotegui -Venezuela. Considerando el papel que juegan los microorganismos en el ciclaje de nutrientes y su potencial para ser utilizados en recuperacin de reas impactadas por la actividad petrolera, se caracteriz la comunidad microbiana (bacteriana y fngica) en el rea de influencia de esta fosa. Para la toma de muestras se levantaron transectas en 3 puntos diferentes alrededor de la fosa y en cada una de estas se ubicaron 3 parcelas de dimensiones: 10 m x 5 m. que representaban reas con diferente grado de impacto (desde el borde hasta reas alejadas de la fosa), de cada parcela se tomaron 4 submuestras de suelo, con las cuales se form una muestra compuesta. Los anlisis microbiolgicos incluyeron: aislamiento de cepas bacterianas y fngicas cultivables, caracterizacin macro, micromorfolgica y bioqumica. En las tres parcelas estudiadas predominaron bacterias Gram positivas y en las poblaciones fngicas fueron las levaduras las que se expresaron en mayor proporcin, en el caso de los hongos filamentosos solo se aislaron en las segundas y terceras parcelas. Las comunidades microbianas no mostraron diferencias en su estructura funcional a lo largo del gradiente estudiado, revelando un gran porcentaje de cepas con actividad degradativa frente a sustratos simples (glucosa y lactosa) y complejos, como: celulosa, lignina, pectina, quitina, baja capacidad para desdoblar urea y gran actividad lipoltica, infiriendo la capacidad de estas comunidades microbianas para degradar productos derivados del petrleo, utilizndolos como fuente de carbono y energa. Con los resultados del espectro bioqumico y aplicando anlisis multivariado de clster se determin la estructura funcional de la comunidad microbiana, permitiendo evidenciar que las poblaciones fngicas eran ms diversas funcionalmente que las poblaciones bacterianas. En los anlisis de clster que integraban ambas poblaciones se formaron Grupos de Identidad Funcional (GIF), infiriendo que en la degradacin de diferentes sustratos participan ambas poblaciones de microorganismos, lo cual evidencia que cepas taxonmicamente diferentes, presentan equivalencias funcionales en el ecosistema. El espectro bioqumico mostrado por las comunidades microbianas revela un gran potencial para ser utilizadas en procesos de biorremediacin.','2010-06-22','Fosa Bared-9, Hongos, Bacterias, caracterizacin bioqumica, caracterizacin funcional',1,1,1,1,1,'2013-09-17 08:33:24','2013-09-17 08:33:24','Documento_418.pdf','application/pdf',2485989,'2013-09-17 08:33:24',18,0,156,'COMPLETO'),(417,'Esquemas de sincronizacin en autmatas celulares','En este trabajo se estudian esquemas de sincronizacin estocstica yse desarrolla un esquema de sincronizacin determinista aplicable a autmataselementales caticos y de comportamiento complejo. Para el desarrollo de esteesquema, se utiliz una de nicin del Jacobiano Booleano para construir unafuncin de acople, con la cual se logra sincronizar dos sistemas perturbandoun conjunto pequeo de sitios.','2010-07-13','Automatas, caos, sincronizacion',3,1,1,1,1,'2013-09-17 08:33:26','2013-09-17 08:33:26','Documento_419.pdf','application/pdf',1673443,'2013-09-17 08:33:26',20,0,107,'COMPLETO'),(418,'\"\"Evaluacinn de los niveles de mercurio total y mercurio orgnico en muestras de suelos procedentes de Instituciones Educativas del pueblo \"\"El Callao\"\",, Estado Bolvar,, Venezuela..\"\"','El presente trabajo de investigacin, tuvo como finalidad evaluar los niveles de mercurio total y mercurio orgnico en los suelos de las Instituciones Educativas ubicadas en el pueblo El Callao. La tcnica empleada fue la espectrometra de fluorescencia atmica con vapor fro (CV-AFS), que posee una alta sensibilidad para el estudio de mercurio. Entre los meses de Febrero y Marzo del ao 2010, se recogieron un total de 43 muestras, a una profundidad de 15 cm aproximadamente. Para la determinacin de mercurio total se emple una solucin de agua regia y posteriormente se le agreg permanganato de potasio y perxido de hidrgeno para garantizar que todas las especies de mercurio estuvieran bajo la forma de in mercrico (Hg2+). Una vez medidas en el equipo, las concentraciones obtenidas estuvieron en un rango de (77 - 740) mg Hg / Kg suelo seco, las cuales superan los valores mximos permitidos por el Programa de las Naciones Unidas para el Medio Ambiente (PNUMA), (70 - 300) mg Hg / Kg suelo. Por otro lado, se extrajo mercurio inorgnico empleando una solucin de sulfato de cobre (II) y bromuro de potasio y al medirlas en el equipo se obtuvo concentraciones entre (52 - 555) mg Hg / Kg suelo. Por diferencia entre el mercurio total e inorgnico, se obtuvieron las concentraciones del mercurio orgnico, en un rango de (20 - 255) mg Hg / Kg suelo. Estos valores fueron bajos quizs por la poca humedad de los suelos y la baja presencia de bacterias anaerbicas, las cuales son las responsables de la formacin del enlace mercurio - carbono. Se concluye que las altas concentraciones de mercurio en los suelos de las escuelas fueron quizs debido a la presencia de molinos y minas en sus alrededores y a la existencia de mayores especies de azufre, materia orgnica y arcillas, que conforman la capa superficial de los suelos y que retienen las especies de mercurio.','2010-07-12','mercurio, suelos, vapor fro',6,1,1,1,1,'2013-09-17 08:33:27','2013-09-17 08:33:27','Documento_420.pdf','application/pdf',1313484,'2013-09-17 08:33:27',20,0,94,'COMPLETO'),(419,'Dieta de las especies y composicinn de la comunidad de murcilagos en el bosque ribereoo del Bloque de Produccinn Petrocedeoo--PDVSA,, en el sector sur--oriental del estado Anzotegui\"\"..',' Con este trabajo se pretende conocer la composicin y estructura de una comunidad de murcilagos ubicada al suroeste del estado Anzotegui, en la Faja Petrolfera del Orinoco. El rea de estudio se encuentra dentro de las inmediaciones del Bloque de Produccin PDVSA-Petrocedeo, y los muestreos se realizaron en el bosque ribereo que bordea los ros Cangilones, Negro y Claro. La identificacin de algunas especies y el anlisis de las muestras fecales para el estudio de la composicin de la dieta se llevaron a cabo en la Estacin Biolgica PDVSA- Petrocedeo (8 49\' 47,6\"N, 64 42`55,7\"W). Los muestreos se realizaron en la poca de sequa y durante 6 das consecutivos en el bosque ribereo en Ro Cangilones en febrero, en la localidad de Ro Negro en el mes de marzo y en el bosque de Ro Claro en abril del 2009. Se utilizaron tres mallas de neblina de 6, 12 y 20 metros de largo y 2,5 metros de altura como tcnica de captura durante 4 horas (18:00-22:00 horas), colocadas a nivel del sotobosque durante la fase de luna nueva. Se realiz la identificacin taxonmica de las especies capturadas, se tomaron las medidas corporales, el sexo, la edad, el estado reproductivo y el peso. Algunos individuos se sacrificaron para obtener una muestra representativa de la quiropterofauna del rea de estudio, mientras que el resto fue identificado y marcado antes de su liberacin, depilando parte del pelaje dorsal. Tambin se recolectaron las heces fecales y estmagos de algunos individuos para el anlisis de la composicin de la dieta de cada especie. En total se colectaron y se registraron 323 individuos de 28 especies pertenecientes a 5 Familias y 9 Subfamilias. La Familia Phyllostomidae fue la mejor representada en cuanto a abundancia (94,70%) y a la diversidad (18 especies), le siguen las Familias Emballonuridae (2,20%, 4 especies), Vespertilionidae (1,50%, 3 especies), Noctilionidae (1,30%, 2 especies) y Molossidae (0,31%, 1 especie). Las especies ms comunes fueron Carollia perspicillata (27,20%), Trachops cirrhosus (15,80%), Glossophaga longirostris (14,20%), Carollia brevicauda(9,09%), Desmodus rotundus (5,30%) ySturnira lilium (4,70%) Se registraron los siguientes 10 gremios trficos en el bosque ribereo del Bloque de Produccin PDVSA-Petrocedeo: insectvoro areo sobre el dosel (IASD), piscvoro insectvoro (PIIN), insectvoro de follaje (INFO), insectvoro areo de bajo dosel (IABD) insectvoro carnvoro (INCA), omnvoro (OMNI), nectarvoro-omnvoro (NEOM) frugvoro de sotobosque (FRSO), frugvoro de dosel (FRSO) y Hematfago (HEMA). Los gremios representados con un mayor nmero de especies tanto en el rea de estudio como en las 3 localidades estudiadas fueron el de los insectvoros seguidos por frugvoros. En relacin a la abundancia, el patrn vara entre las localidades y las especies dominantes pertenecen a los gremios: FRSO, NEOM, INCA yHEMA. En el anlisis de la composicin de la dieta, se identificaron 5 rdenes de Insecta, 16 morfotipos de semillas y restos de sangre, huesos y tejido blando. La composicin de la comunidad de murcilagos del rea de estudio es similar a las observadas en reas boscosas de la regin neotropical con diversos grados de perturbacin antrpica, en donde pocas especies estn representadas por un alto nmero de individuos que se alimentan de plantas pioneras de gran importancia en los procesos de mantenimiento y regeneracin del bosque ribereo siempre verde y de sucesin secundaria.','2010-07-19','Murcilagos Petrocedeo-PDVSA Biologa poblacin diversidad dieta',1,1,1,1,1,'2013-09-17 08:33:29','2013-09-17 08:33:29','Documento_421.pdf','application/pdf',1446667,'2013-09-17 08:33:29',19,0,132,'COMPLETO'),(420,'EVALUACINN DE LOS NIVELES MERCURIALES EN EL AIRE DE AULAS EN UNIDADES EDUCATIVAS DE EL CALLAO,, ESTADO BOLVVAR','El Mercurio es un metal sin funcin biolgica conocida, al cual se le atribuyen diversos efectos txicos en sistemas vivos. Se utiliza en algunas tcnicas artesanales de la minera extractiva de metales tales como la extraccin de oro artesanal, debido a su capacidad de formar amalgamas con ellos. En este procedimiento, se emiten vapores y productos (xidos) de la quema al medio ambiente a travs del aire. En la poblacin de El Callao, Estado Bolvar, se practica la minera extractiva artesanal en gran escala y se presumen elevados niveles de Mercurio en el aire de la regin, siendo de gran inters los mbitos de las Unidades Educativas Bolivarianas debido a que los nios permanecen gran parte del da en sus instalaciones expuestos al producto areo de la actividad minera. Para este estudio, se evalu la exposicin de nios de edades comprendidas entre 6 y 13 aos, debido al riesgo de toxicidad reportado para la exposicin a mercurio y sus especies inorgnicas por la va inhalatoria. Estos efectos han sido especificados a nivel del Sistema Nervioso Central lo cual hace que esta poblacin sea sumamente vulnerable ya que se encuentran en desarrollo de sus funciones motoras. Las muestras de aire fueron recolectadas segn la Norma del Instituto Nacional de Salud y Seguridad Ocupacional (NIOSH), N 6009 con una variacin del mtodo de digestin y cuantificacin por Espectroscopa de Fluorescencia Atmica con generacin de vapor frio (CV-AFS). Se muestrearon un total de 11 Unidades Educativas Bolivarianas de diferentes zonas de la poblacin de El Callao, encontrando valores entre 0,09 y 0,9 gHg/ m3, algunos de estos valores se encuentran por encima del valor de Nivel de Riesgo Mnimo (MRL por sus siglas en ingls) de 0,2 gHg/m3, propuesto por la Agencia para Sustancias Txicas y Registro de Enfermedades (ATSDR).','2010-07-09','Mercurio,ATSDR,NIOSH,MRL',6,1,1,1,1,'2013-09-17 08:33:30','2013-09-17 08:33:30','Documento_422.pdf','application/pdf',3226527,'2013-09-17 08:33:30',18,0,99,'COMPLETO'),(421,'PROTOTIPO DE UN SISTEMA PORTTIL DE REGISTRO DIGITAL DE LA VARIACIN DE VOLUMEN SANGUNEO UTILIZANDO LA TCNICA DE FOTOPLETISMOGRAFA DE TRANSMISIN','El trabajo presenta un sistema porttil de registro digital de la variacin de volumen sanguneo utilizando la tcnica de fotopletismografa de transmisin. Se desarroll un sensor para obtener la seal fotopletismogrfica. Dicha seal se acondiciona en etapas de amplificacin y filtrado, con un circuito basado en amplificadores operacionales, y se digitaliza utilizando el mdulo de conversin analgico/digital de un microcontrolador PIC. Los datos obtenidos son almacenados en una memoria Secure Digital (SD).Se cre un software en lenguaje ensamblador en el PIC para controlar el proceso de digitalizacin de la seal PPG y para establecer el protocolo de comunicacin con la memoria SD. La resolucin del conversor utilizado es de 10 bits y la tasa de muestreo se fij a $256 muestras/s$. Para poder realizar registros de 24 horas, a sta tasa de muestreo, se requieren por lo menos 42 Mb, sin embargo, las memorias SD ms pequeas superan por mucho este valor. Las memorias SD no solo satisfacen los requerimientos de almacenamiento, tambin facilitan la transferencia de informacin a un computador.El objetivo de crear este prototipo es dar paso a la investigacin de la seal PPG, ya que es una variable hemodinmica importante en el diagnstico de enfermedades cardiovasculares, y al desarrollo de un equipo ms sofisticado, que pueda monitorear la presin arterial latido a latido.','2010-09-06','{}',3,1,1,1,1,'2013-09-17 08:33:31','2013-09-17 08:33:31','Documento_423.pdf','application/pdf',3526627,'2013-09-17 08:33:31',20,0,100,'COMPLETO'),(422,'DIGESTIBILIDAD IN VITRO Y APROVECHAMIENTO POR EL GORGOJO DE ARROZ DE ALMIDONES DE PLTTANO,, VARIEDADES HARTNN COMNN,, CAMBUR NEGRO,, TOPOCHO CENIZO,, HH--1122 Y CAMBUR 001122','Resumen El almidn es un polisacrido de origen vegetal y representa una fuente de alimento importante en animales. Los estudios de digestibilidad in vitroe in vivo del almidn han sido de inters al evaluar aspectos relacionados con su biodisponibilidad. En Venezuela, el pltano se presenta como fuente alternativa de almidn dada su importancia tanto a nivel agronmico como de consumo por parte de la poblacin. En este estudio, se evalu la digestibilidad de almidones de pltano, variedades: hartn comn, cambur negro, topocho cenizo, HH-12 y cambur 012; utilizando almidn de maz como referencia. La digestibilidad in vitro fue analizada mediante la determinacin de los parmetros: almidn potencialmente disponible, almidn resistente total y tasa de aamillisis in vitro, mientras que la digestibilidad in vivo de los almidones de pltano fue evaluada mediante el uso del bioensayo del gorgojo de arroz, Sitophilus oryzae (L.).Se encontr que todos los almidones de pltano poseen un 93 - 99% de almidn potencialmente disponible, a excepcin de la variedad HH-12 (82%). El contenido de almidn resistente total se encontr entre 55 y 64% para todas las variedades; de las cuales hartn comn y topocho cenizo presentaron los mayores niveles, mientras que cambur 012 y cambur negro, presentaron los menores. En cuanto a la tasa de aamillisis in vitro, se encontr que todos los almidones crudos de pltano poseen velocidades iniciales menores que 2%, las cuales aumentaron cuando fueron gelatinizados (56 - 61%). Las magnitudes finales de hidrlisis de los almidones crudos fueron menores a 4%, y aumentaron al gelatinizarlos (71 - 81%).Los biomarcadores supervivencia, variacin de peso, agua corporal, nitrgeno proteico, nitrgeno cuticular y excrecin de cido rico, no mostraron diferencias relacionadas con la digestibilidad in vitro de los almidones. No obstante, los biomarcadores grasa corporal y actividad similar a aamilasa, presentaron diferencias que correlacionaron con el contenido de almidn resistente presente en los almidones. A partir de los anlisis de correlacin realizados, se encontr que el almidn resistente total, fue el mejor estimador de las respuestas encontradas in vivo; correlacionndose negativamente con la grasa corporal (R2 = 0,43; p = 0,008) y positivamente con la actividad similar a a-amilasa (R2 = 0,33; p = 0,03).En cuanto a la digestibilidad in vivo de los almidones de pltano, las variedades hartn comn y HH-12 fueron los menos biodisponibles, mientras que el almidn de cambur 012 present la mayor biodisponibilidad y no present diferencias significativas con respecto al almidn de maz (considerado de alta biodisponibilidad). Los almidones de pltano de las variedades cambur negro y topocho cenizo presentaron una biodisponibilidad intermedia.En base a los resultados encontrados en este estudio, los almidones crudos de pltano se perfilan como buenas fuentes de almidn para la formulacin de alimentos dirigidos a consumidores con necesidades nutricionales especiales, tales como personas diabticas y obesas. Adems, los biomarcadores grasa corporal y actividad similar a aamilasa, del bioensayo del gorgojo de arroz, resultaron ser tiles y eficaces en la caracterizacin de la digestibilidad in vivo de almidones de pltano.','2010-09-10','Digestibilidad, almidn de pltano, gorgojo de arroz',1,1,1,1,1,'2013-09-17 08:33:32','2013-09-17 08:33:32','Documento_424.pdf','application/pdf',1682475,'2013-09-17 08:33:32',20,0,110,'COMPLETO'),(423,'Anlisis e Implementacinn de un Esquema Bsico de Seguridad Usando Software Libre','Actualmente las redes de rea local son tan habituales que casi no hay oficina que no la posea; incluso gran parte de hogares la tienen. La mayora de estas redes estn conectadas a Internet, hecho que las hace vulnerables a los peligros latentes en el Internet, por ese motivo es necesario proporcionar a estas redes algn nivel de seguridad. En este trabajo se analizaron en forma detallada cada una de las recomendaciones propuestas por el documento ISO/IEC 27002; con el objeto de buscar un esquema bsico de seguridad para las redes de rea local y proponer un conjunto mnimo de recomendaciones al respecto, as como tambin su implementacin usando software libre. El esquema bsico de seguridad encontrado est compuesto por un conjunto mnimo de recomendaciones (clusulas) cuyo cumplimiento proporciona un nivel de seguridad aceptable en redes no crticas; es decir en redes de organizaciones con pocos enemigos potenciales, redes que no pertenecen a grupos de espionaje, ni agencias de investigacin, ni centros de seguridad gubernamental, ni bancos, ni otras organizaciones del estilo. Adicionalmente, se recomienda abaratar costos de implementacin, incrementar la independencia y mantenerse actualizado. Para lograrlo se propone usar software libre, el cual con costos bajos y alta confiabilidad permite implementar el conjunto mnimo de recomendaciones extrado del documento ISO/IEC 27002.Las recomendaciones del esquema bsico propuesto se implementaron en un caso de estudio, usando herramientas de software libre, demostrando as la efectividad de la propuesta.','2010-06-15','Internet, intranet, seguridad, software libre, ISO/IEC 27002.',2,1,1,1,1,'2013-09-17 08:33:33','2013-09-17 08:33:33','Documento_425.pdf','application/pdf',2606222,'2013-09-17 08:33:33',16,0,130,'COMPLETO'),(424,'\"\"DETERMINACINN DE LOS NIVELES DE MERCURIO EN SANGRE DE LOS NIOOS EN EDAD ESCOLAR DE LA POBLACINN DE EL CALLAO,, ESTADO BOLIVAR\"\"','El mercurio es un metal muy toxico y es frecuentemente usado en la minera artesanal para la extraccin de oro y plata y en Venezuela existen varios yacimientos de oro, que se encuentran en el Estado Bolvar destacndose 4 reas de gran importancia econmica: las zonas aurferas de Tumeremo, El Callao, El Dorado y El Manteco, donde existe como principal profesin la minera artesanal. Debido a que el mercurio afecta al ser un humano y principalmente a los nios, se realizaron anlisis de mercurio en sangre a 112 nios en edades comprendidas entre 5 y 13 aos en la poblacin de El Callao, dichos nios fueron seleccionados de manera aleatoria en trece escuelas de dicha poblacin manteniendo la representatividad de sexo y edad. La determinacin de mercurio en sangre se realizo mediante la tcnica de Espectroscopia de Fluorescencia Atmica con generacin de vapor (CV-AFS). Los resultados obtenidos oscilaron entre 0,15 y 27 g/L obtenindose una gran diversidad de resultados en ese rango, donde el 28 % de la poblacin muestreada tenan los niveles de mercurio en sangre por encima de los lmites tolerables por el organismo infantil. Se pudo notar que los nios que tuvieron los niveles ms altos estaban relacionados con la minera artesanal, debido al lugar de la vivienda o del colegio y a la profesin de los padres.','2010-07-09','mercurio, sangre, nios, poblacin',6,1,1,1,1,'2013-09-17 08:33:34','2013-09-17 08:33:34','Documento_426.pdf','application/pdf',1197780,'2013-09-17 08:33:34',20,0,75,'COMPLETO'),(425,'Desarrollo de una Herramienta de Software Libre que Permita el Diseo de Centros de Datos','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0in 5.4pt 0in 5.4pt; mso-para-margin-top:0in; mso-para-margin-right:0in; mso-para-margin-bottom: 10.0pt; mso-para-margin-left:0in; line-height:115%; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin;} El presente Trabajo Especial de Grado consiste en el anlisis, diseo y desarrollo de una herramienta de software libre que permita el diseo de centros de datos, para as poder llevar un inventario de los equipos, reflejar las interconexiones de los mismos y visualizar las aplicaciones que en stos se ejecutan. Normalmente en un centro de datos no se tiene un inventario actualizado de los recursos de hardware y software, es decir, que la mayora de los centros de datos operan sin llevar un control especfico de los componentes, perfil del uso de los equipos, estado de uso y obsolencia en que se encuentran y aplicaciones que se encuentran en las instalaciones. Esto acarrea que la solicitud de nuevos equipos, mantenimiento y produccin se vean limitados. El objetivo del presente Trabajo Especial de Grado resolver los problemas antes mencionados y optimizar las tareas de los operadores y administradores de centros de datos, y por ende el rendimiento del mismo. El sistema desarrollado proporciona interfaces de diseo y carga de datos que permiten a los usuarios incorporar al sistema toda la informacin relacionada con el centro de datos a disear, as como el posicionamiento e interconexiones de los elementos e igualmente el software que en ellos se ejecuta. De la misma manera, el sistema proporciona interfaces que permiten al usuario visualizar el centro de datos una vez diseado, o incluso parcialmente diseado. Una vez que se guarda un estado del centro de datos en el diseador, inmediatamente se encuentra disponible para su visualizacin. Las tecnologas y herramientas utilizadas ms relevantes que contribuyeron al desarrollo exitoso de la aplicacin fueron las siguientes: Ruby on Rails, framework para el desarrollo de aplicaciones Web bajo el esquema MVC; ActionScript 3, lenguaje de programacin de Adobe que cuenta con una amplia librera de funciones grficas; Action Message Format 3, formato de intercambio de mensajes que permite una comunicacin eficiente entre un servidor de aplicaciones y ActionScript; AJAX, enfoque de desarrollo basado en un conjunto de tecnologas ya existentes, agrupadas para presentar informacin e interactuar dinmicamente, de manera asncrona, con un servidor Web; Prototype, librera de JavaScript que provee de mltiples funcionalidades y utilidades tales como interaccin con AJAX, efectos grficos, entre otros; Swift3D, suite de diseo de elementos 3D con capacidades de exportacin al formato SWF de Flash; Suite Adobe Flash CS4, entorno de desarrollo que provee mltiples herramientas que facilitan e incrementan el tiempo de desarrollo; Distributed ruby, tecnologa de comunicaciones distribuidas para el lenguaje ruby.','2010-10-15','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:33:35','2013-09-17 08:33:35','Documento_427.pdf','application/pdf',1487750,'2013-09-17 08:33:35',20,0,122,'COMPLETO'),(426,'Medicinn con detectores de estado solido de la dosis absorbida en maniqu abdominal utilizando tcnicas de radioterapia 44D e hipofraccionamiento.. Aplicacinn a tratamientos de MT hepticas..','En el presente trabajo se disearon y evaluaron protocolos de tratamiento de metstasis hepticas, para ello, se realizaron mediciones con detectores de estado slido de la dosis absorbida en un maniqu abdominal, haciendo uso de tcnicas de radioterapia 4D e hipofraccionamiento. Durante la realizacin del trabajo, se construy un maniqu abdominal, cuya funcin principal es servir de sustituto del tejido. De esta manera, se us un material que se comporta de manera similar al tejido humano al estar en presencia de la radiacin ionizante. Debido a que la zona de irradiacin es el abdomen, fue necesario tomar en cuenta el movimiento del blanco debido a la respiracin del paciente. De esta manera, se construy una base para simulacin con desplazamiento horizontal, con nueve posiciones que definen nueve posibles desplazamientos. La posibilidad de variar el desplazamiento de una sesin a otra, permiti recrear situaciones en las que el paciente mantiene un patrn respiratorio regular, as como el caso contrario donde, durante la irradiacin cambian las condiciones presentadas en la simulacin de tratamiento. La aplicacin de tratamiento al sistema base de simulacin - maniqu, y posterior comparacin entre la dosis medida y la planificada, mostr que con dicha tcnica se concentran altas dosis en el volumen tumoral, recibiendo una dosis total de 6000 cGy en tres sesiones de tratamiento, mientras se disminuye la dosis absorbida en rganos a riesgo como mdula y estmago, estas se mantienen por debajo del punto de dosis mxima, 1800 cGy y 3000 cGy respectivamente.','2010-09-09','Radioterapia 4D, Hipofraccionamiento, Detectores de estado slido, MT Hepticas',3,1,1,1,1,'2013-09-17 08:33:37','2013-09-17 08:33:37','Documento_428.pdf','application/pdf',2936681,'2013-09-17 08:33:37',20,0,67,'COMPLETO'),(427,'Construccin de una cepa mutante de Mycobacterium smegmatis que contenga el eptope FLAG en el gen mfpA','Las fluoroquinolonas (FQs) son antibiticos que se utilizan para el tratamiento de la enfermedad tuberculosis debido a su capacidad de inhibir la ADN girasa. Sin embargo, existen reservas acerca de su uso como drogas anti-tuberculosas, debido a que se seleccionan mutantes resistentes rpidamente. Los mecanismos involucrados en la resistencia a estos antibiticos son bombas de eflujo, mutaciones en el blanco y un mecanismo descrito recientemente que involucra una protena perteneciente a la Familia de Pentapptidos Repetidos, llamada MfpA (\"Mycobacterial Fluoroquinolone Resistance Protein\"). Esta protena es codificada por el gen mfpA de Mycobacterium smegmatis, tiene 192 aminocidos, consiste en 32 pentapptidos repetidos en tanda y es capaz de conferir bajos niveles de resistencia a ciprofloxacina y esparfloxacina. Hacia el extremo 5\' del gen mfpA, hay 4 genes que estn altamente conservados en las micobacterias que se expresan como parte de la misma unidad transcripcional. Existe evidencia de que la organizacin de los genes que forman parte del presunto opern es similar tanto en M.. tuberculosiscomo en M.. smegmatis, es por ello que esta ltima es un modelo apropiado para llevar a cabo el etiquetamiento gen mfpA. Este trabajo tiene como objetivo la construccin de una cepa mutante de M.smegmatis que contenga el eptope FLAG en el extremo 5\' del gen mfpA, empleando tcnicas bsicas de gentica molecular. Con la primera estrategia utilizada, se lograron clonar los dos fragmentos correspondientes a las regiones 5\' y 3\' del gen mfpA en el vector pYUB854, una vez obtenida esta construccin se utiliz como sistema la recombinacin homloga, para introducir el eptope a nivel cromosomal en la micobacteria, pero esto no se logr,,porlo tanto se consider emplear una nueva metodologa que consisti en la extensin por solapamiento mediante PCR de los genes mfpEB y mfpA, para intentar etiquetar la protena MfpA hacia su extremo N-terminal y lograr que esta se expresara en el genoma de M.. smegmatis a partir de su propio promotor, ubicado en el extremo 5\' del gen mfpE. Se logr incorporar el eptope FLAG en la secuencia del opern mmfpEA, al cual pertenece el gen de inters. Pero por limitaciones de tiempo esta construccin no se pudo introducir en el genoma de la micobacteria. Con la construccin de esta cepa se pretenden evaluar a posteriori, los niveles de expresin de la protena a travs de la tcnica de Western Blot.','2010-07-16','Mycobacterium, rcombinacin homloga, fluoroquinolonas.',1,1,1,1,1,'2013-09-17 08:33:38','2013-09-17 08:33:38','Documento_429.pdf','application/pdf',2003389,'2013-09-17 08:33:38',19,0,79,'COMPLETO'),(428,'Uso del hongo entomopatggenoMetarhizium anisopliae ((Clase Hyphomycetes))en el control de Musca domesticaLinneaus ((Diptera:: Muscidae)) en galpones avcolas..','Musca domestica Linneaus es una de las plagas ms comunes asociada a las actividades avcolas. Una de las estrategias de control ms estudiadas en la actualidad es la basada en la utilizacin de hongos entomopatgenos. La capacidad de infeccin del hongo Metarhizium anisopliae sobre M.. domesticaes bastante conocida, sin embargo son pocos los trabajos realizados directamente en las granjas avcolas. Este trabajo tiene como objetivo general, desarrollar y evaluar una metodologa para el control de M.. domestica en los galpones avcolas, basada en la colocacin de telas impregnadas con conidias del hongo M.. anisopliae. Se estableci una cra de M.. domestica en condiciones de laboratorio y se evalo a M.. anisopliae como agente de infeccin sobre adultos de la mosca, utilizando para el contagio una superficie de tela, obtenindose como mejor atrayente el color amarillo. Luego, se estim la cantidad de conidias capaces de fijarse a la tela amarilla preparndose cuatro montajes con las siguientes densidades: 3,89 x105 (DMa1), 2,72 x106 (DMa2), 6,33 x106 (DMa3) y 1,45 x107 (DMa4) conidias por cm2 de tela amarilla y se colocaron en el interior de recipientes de vidrio con cincuenta individuos adultos de la mosca. Una vez el lienzo tratado produjo el 100% de mortalidad ste fue colocado en un recipiente nuevo con un nuevo grupo de moscas adultas y se procedi a evaluar la mortalidad diaria. Los tratamientos DMa3 y DMa4 fueron capaces de conseguir el 100% de mortalidad luego de cinco semanas de aplicados en la tela, siendo seleccionado para el trabajo en campo el tratamiento DMa3. Para determinar la patogenicidad de M.. anisopliae sobre diferentes grupos etarios de M.. domestica, se realizaron ensayos con edades de 0 (recin eclosionados), 5, 10, 15, 20, 25 y 30 das post-eclosin. Los tiempos letales estimados con el anlisis de Probit, indicaron que la patogenicidad del hongo no se vea alterada en los grupos de 5, 10, 15 y 20 das (grupos B, C, D y E, respectivamente). En el grupo A, por tratarse de jvenes recin eclosionados se present un retraso en producirse el 100% de mortalidad y en cuanto a los grupos Fy G (25 y 30 das) se encontraron descensos debido a causas naturales, lo que redujo el nmero de individuos capaces de ser infectados por M.. anisopliae.. Sin embargo, segn Keiding (1986) los grupos A, F y G no se encuentran representados de manera importante en la poblacin presente en los galpones avcolas. El trabajo en campo se realiz en dos galpones avcolas. Se realizaron dos aplicaciones del hongo M.. anisopliae, mediante la colocacin de los montajes de tela amarilla impregnados con conidias. En el centro de cada galpn y a 3 m de altura aprox., se colocaron cuatro montajes, siendo restituidos cada tres semanas. Con la rejilla de Scudder (Scudder, 1947) se estim la poblacin de mosca domstica pre y post-tratamiento y tambin se realizaron pases con malla entomolgica para evidenciar la infeccin fngica en la poblacin. Las aplicaciones realizadas condujeron a una reduccin del 99% en la poblacin de la mosca para ambos galpones y luego de nueve semanas a partir del inicio del tratamiento. Estos resultados indican que la metodologa implementada constituye una alternativa viable para el control de M.. domestica.','2010-10-14','Normal 0 21 false false false PT X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabela normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso',1,1,1,1,1,'2013-09-17 08:33:40','2013-09-17 08:33:40','Documento_430.pdf','application/pdf',1684571,'2013-09-17 08:33:40',20,0,184,'COMPLETO'),(429,'OBTENCINN Y CARACTERIZACINN DE HARINA DE PLTTANO DE 1188 CLONES DE BANANOS PROVENIENTES ((INIA)) Y SU APLICACINN EN LA ELABORACINN DE UN PRODUCTO HORNEADO..','El pltano es uno de los cultivos de plantas que se producen para el consumo local y la exportacin y son de gran importancia econmica para las regiones tropicales y subtropicales de frica, Amrica Central, Amrica del Sur, Asia y las reas del Pacfico (Noyer y col., 2005). La Organizacin para la Agricultura y la Alimentacin (FAO) considera al pltano como el cuarto alimento importante en el mundo, despus del arroz, del trigo y del maz. Los pltanos son conocidos por tener grandes fuentes de vitaminas A, B1, B2, B3 y B6 y minerales, tales como, potasio, fsforo y calcio. En el presente trabajo se plantearon como objetivos la obtencin y la caracterizacin de harina de 18 clones de bananos provenientes del Banco de Germoplasma de Instituto Nacional de Investigaciones Agrcolas (INIA)- Maracay, estado Aragua, Venezuela y su aplicacin en la elaboracin de un producto horneado.. Para el logro de los objetivos,, se determinaron la composicinn proximal,, las caractersticas,, fsicas,, fisicoqumicas y funcionales de las harinas elaboradas y del productos formulado,, siguiendo la metodologas oficiales descritas en la AACC,, ((22000033)) y Normas COVENIN.. Los resultados indican que existe una relacin entre el contenido de protena y el origen genmico de los clones. A nivel nutricional, el banano, sus harinas y el producto elaborado con el mismo, son fuentes importantes de fibra dietaria, en mayor proporcin que la que puede suministrar la harina de trigo. Asimismo, se demostr, mediante esta investigacin, la factibilidad de elaborar harinas de banano de diferentes clones con propiedades que varan en funcin a su origen genmico. Tambin se revelaron diferencias en cuanto a sus propiedades funcionales y la morfometra de sus almidones que les da versatilidad de usos. El panqu que se elabor con harina compuesta (cambur y trigo) tuvo mayor aceptacin que el panqu de harina de trigo.','2010-10-04','{}',1,1,1,1,1,'2013-09-17 08:33:41','2013-09-17 08:33:41','Documento_431.pdf','application/pdf',831356,'2013-09-17 08:33:41',19,0,95,'COMPLETO'),(430,'Estudio de la Brecha de Energa en el BaPtSi3 utilizando la Longitud de Penetracin Magntica.','En este trabajo especial de grado se realizaron medidas de longitud de penetracin magntica en el superconductor no centrosimtrico BaPtSi3 en el rango de temperatura de 40 mK hasta 2, 42 K (temperatura crtica). Los resultados muestran un comportamiento exponencial de la longitud de penetracin magntica en el lmite de temperaturas bajas. Esto nos indica una estructura de la brecha de energa superconductora isotrpica sin nodos, lo que es caracterstico de un superconductor tipo BCS.','2010-10-08','Superconductividad, Brecha de energa, Longitud de penetracin magntica, no centrosimetra, bajas temperaturas, BaPtSi3, teora BCS.',3,1,1,1,1,'2013-09-17 08:33:42','2013-09-17 08:33:42','Documento_432.pdf','application/pdf',1583656,'2013-09-17 08:33:42',19,0,96,'COMPLETO'),(431,'ESTIMAR LA REACTIVIDAD CATALTTICA HACIA REACCIONES DE HIDROTRATAMIENTO EMPLEANDO CATALIZADORES V--Ni--Mo // ALMMINA','RESUMEN El mejoramiento de crudos pesados se ha vuelto una necesidad cada vez ms imperiosa para la industria petrolera a nivel mundial. En este mbito el hidrotratamiento ha figurado como uno de los procesos catalticos ms eficientes para la eliminacin de compuestos orgnicos sulfurados, nitrogenados y aromticos de las corrientes dentro de las refineras. La revalorizacin de la corriente de LCO, que es un subproducto que proviene de las unidades de craqueo cataltico y que posee un alto contenido de aromticos y de azufre, es particularmente importante para ser incluido dentro del pool de diesel. El proceso de hidrotratamiento para lograr el mejoramiento del LCO se llev a cabo sobre molculas modelo, en un reactor operado en flujo continuo a alta presin, y temperatura constante (T=350 C), donde se trataron soluciones de tiofeno (10%p/p), tolueno (30%p/p) y piridina (10%p/p) para ensayar las reacciones de HDS, HYD y HDN. A tal fin se sintetiz un catalizador bimetlico de Nquel- Molibdeno (3% y 11% respectivamente) y 4 catalizadores de Vanadio-NiMo, todos soportados sobre g-almina, variando los porcentajes de vanadio (0.5, 1.0, 1.5 y 2.0%) en el catalizador. Los mismos fueron presulfurados (CS2) in situantes de dar inicio a la reaccin a T= 350 C y presin atmosfrica de hidrgeno. Los catalizadores fueron caracterizados por tcnicas texturales y de superficie, rea especfica BET (AE-BET) y tamao de poro, difraccin de rayos X (DRX) y anlisis elemental (ICP-AEE). Los productos de reaccin fueron analizados por cromatografa de gases (GC-FID). Los resultados de la caracterizacin de los catalizadores mostraron una buena dispersin de los metales sobre el soporte. La conversin mxima alcanzada durante la reaccin de HDS de tiofeno fue de 100% lograda con el catalizador con 1,5% de vanadio. En las reacciones de hidrogenacin de tolueno la conversin mxima obtenida fue de 43,1% con el catalizador con 1,0% de V. Mientras que para las reacciones de HDN de piridina se obtuvo conversiones de 100% con todos los catalizadores ensayados. La tendencia en la actividad de los catalizadores hacia las reacciones de hidrotratamiento mostr un aumento en las conversiones con el incremento del contenido de vanadio, y luego una disminucin de las mismas para los catalizadores con mayor contenido del metal. Sin embargo los valores mximos alcanzados siempre fueron comparables e inclusive mayores que aquellos logrados con el catalizador comercial usado (TK-437), por lo que se puede indicar que los catalizadores estudiados en el proceso de hidrotratamiento cataltico podran ser eficientes para el mejoramiento de la corriente de LCO.','2010-10-18','HIDROTRATAMIENTO, CATALIZADORES, VANADIO, NIQUEL, MOLIBDENO',6,1,1,1,1,'2013-09-17 08:33:44','2013-09-17 08:33:44','Documento_433.pdf','application/pdf',0,'2013-09-17 08:33:44',19,0,0,'INCOMPLETO'),(432,'EXTRACCINN,, PURIFICACINN Y CARACTERIZACINN DEL ALMIDNN DE 2211 CLONES DEL BANCO DE GERMOPLASMA DE MUSCCEASDEL INIA.. ELABORACINN DE UN PRODUCTO TIPO PUDIN..','La planta de banano surgi de dos especies diploides, la Musa acuminata (AA) y la Musa balbisiana (BB), encontrando especies o hbridos diploides, triploides y tetraploides provenientes de estas dos subespecies. En Venezuela, se usan los trminos pltano y cambur; nombres usuales para designar la especie de coccin y de consumo fresco, respectivamente. El almidn es el principal componente de los bananos en estado verde. Desde hace mucho tiempo el almidn nativo se ha utilizado como materia prima para la preparacin de productos, sin embargo, poco se conoce sobre los aspectos funcionales de los almidones de las diferentes variedades de bananos. Por lo antes expuesto se plante. Extraer, purificar y caracterizar almidones extrado de 21 clones de bananos del Banco de Germoplasma de Musceas INIA. Mediante su composicin proximal y caractersticas qumica y fsicas se determin cual o cuales almidones es o son los ms idneo para formular un producto alimenticio tipo pudn. Los resultados indican que existen diferencias estadsticamente significativas (p<<==00,,0055) en cuanto, a la composicin proximal, caractersticas fsico-qumico, morfomtricas y funcionales de los 21 tipos de almidones. En cuanto al color se encontr que los almidones son claros, reflejando matices rojo y amarillos, estos matices podran deberse a la presencia de pigmentos del tipo carotenoides. De acuerdo a los valores de breakdown, consistencia, set back y el contenido de amilosa, se infiri que los almidones podan utilizarse en productos alimenticios refrigerados. El almidn ms promisorio para la elaboracin del pudn result ser el clon 072. Al realizar pruebas sensoriales el pudn elaborado con este almidn mostr diferencia significativa de preferencia en el olor, al compararlo con el pudin comercial. Se estudiaron los parmetros de calidad qumicos, fsicos y fsico-qumicos en el, resultando ser un producto poco cido, con un bajo contenido de acidez, y alta humedad y con sinresis negativa. El color del producto result ser oscuro con bajo contenido de matiz amarillo.','2010-10-04','almidn, musceas, clones.',1,1,1,1,1,'2013-09-17 08:33:45','2013-09-17 08:33:45','Documento_434.pdf','application/pdf',2558730,'2013-09-17 08:33:45',20,0,99,'COMPLETO'),(433,'Desarrollo de los Mdulos de Constancias y de Comprobantes para el Sistema CONEST Postgrado.','En la Coordinacin de Postgrado de la Facultad de Ciencias de la Universidad Central de Venezuela existe la problemtica en cuanto a la generacin de Constancias, Actas de Notas, y Resmenes curriculares, debido a que stas se deben emitir continuamente y tienen que ser realizadas de forma manual por el personal administrativo de la coordinacin.El presente Trabajo Especial de Grado se realiz con la finalidad de automatizar los procesos para la generacin de dichos documentos y para ello se procedi a ampliar el sistema CONEST Postgrado. El desarrollo del sistema se realiz a travs de la metodologa gil \"Programacin Extrema\" (XP), la cual se caracteriza por su simplicidad, comunicacin, retroalimentacin y refactorizacin de cdigo. Entre las tecnologas usadas se destaca el lenguaje de programacin Ruby 1.8.7, su framework de desarrollo web Rails 2.3.2 y el sistema manejador de base de datos MySQL 5.1.El resultado es el desarrollo de dos nuevos mdulos, el primero denominado Mdulo de Constancias del cual se podrn generar los siguientes documentos: Actas de Notas, Constancias de Inscripcin, Resumen Curricular; el segundo mdulo fue denominado Mdulo de Comprobantes y a travs de l se genera el Comprobante de Inscripcin y el Resumen Curricular (a modo de comprobante). Adems se cre el Mdulo de Administracin en el cual se puede actualizar los datos acadmicos de un estudiante y la generacin de un ltimo documento denominado Comprobante de Calificacin dentro del Mdulo de Calificacin.La creacin de estos mdulos aporta un agregado significativo a las funcionalidades del Sistema CONEST Postgrado, adems mejora las funciones de la Coordinacin de Postgrado disminuyendo el tiempo de procesamiento y de generacin de los documentos.','2010-10-05','Constancia, Mdulo, Coordinacin de Postgrado, CONEST, Inscripcin, Calificacin, Acta de notas, Resumen curricular, Comprobante de inscripcin, Ruby on Rails.',2,1,1,1,1,'2013-09-17 08:33:47','2013-09-17 08:33:47','Documento_435.pdf','application/pdf',4181368,'2013-09-17 08:33:47',20,0,214,'COMPLETO'),(434,'Estudio de ecuaciones diferenciales utilizando mtodos geomtricos','Se estudia la estructura de las ecuaciones diferenciales a travz de trminos como variedades y fibrados, y adems se muestran algunos mtodos de resolucin de ecuaciones diferenciales no lineales.','2010-07-06','Ecuaciones diferenciales, Geometra, Variedades, Fibrados.',5,1,1,1,1,'2013-09-17 08:33:51','2013-09-17 08:33:51','Documento_436.pdf','application/pdf',4181379,'2013-09-17 08:33:51',20,0,214,'COMPLETO'),(435,'Estudio estructural y magntico de la aleacin Fe80Cr20elaborada por molienda mecnica','Presentamos el estudio estructural y magntico de la cintica de formacin de laaleacin nanomtrica Fe80 Cr20 . La sntesis se realiz por molienda mecnica usandoun molino vibratorio Spex 8000 mill. Para observar la cintica se elaboraron mues-tras a distintos tiempos de molienda las cuales fueron especcamente 2, 5, 10, 20 y30 horas. El tamao de grano se determin empleando difraccin de Rayos X reve-lando un tamao de aproximadamente 12 nanmetros para 30 horas de molienda. Losestudios mgneticos efectuados fueron mediante espectroscopa Mssbauer y medi-das de histresis magntica. La espectroscopa Mssbauer fue realizada a temperaturaambiente, y tambin a 77 K para la muestra de 30 horas, observndose en general lavariacin del campo magntico hiperno, con respecto al hierro puro, al aumentar eltiempo de molienda y a su vez la aparicin del estado estacionario de molienda a las 20horas. Las medidas de histresis magntica se obtuvieron utilizando un magntometrode muestra vibrante, en donde los resultados mostraron una tendencia a saturar rpidoy an as, una disminucin de la magnetizacin de saturacin, con respecto al hierropuro. El campo coercitivo aument a 77 gauss para 5 horas de molienda mantenindoseconstante hasta las 30 horas','2010-07-13','aleacin Fe80Cr20 molienda mecnica',3,1,1,1,1,'2013-09-17 08:33:54','2013-09-17 08:33:54','Documento_437.pdf','application/pdf',1118918,'2013-09-17 08:33:54',19,0,65,'COMPLETO'),(436,'Una prueba elemental de la desigualdad de Hilbert','La desigualdad de Hilbert, tiene muchas aplicaciones en la teoria de funciones analiticasy a la teoria de funciones de variable real. Algunas de ellas se pueden hallar en el CapituloIX y en el Apendice 3 del libro inequalities. La demostracion original de la desigualdad, debido a Hilbert,tambien se puede ver en ese mismo libro.','2010-10-26','Hilbert',5,1,1,1,1,'2013-09-17 08:33:56','2013-09-17 08:33:56','Documento_438.pdf','application/pdf',1757530,'2013-09-17 08:33:56',20,0,222,'COMPLETO'),(437,'Elaboracin de pelculas antimicrobianas a partir de recursos sub-utilizados: quitosano de conchas de camarn (Penaeus vannamei) y almidn de ocumo chino (Colocasia esculenta).',' Actualmente los materiales de empaque que utilizan la mayora de las industrias de alimentos no son amigables con el ambiente lo que trae como consecuencia que su degradacin demore aos, esto ha hecho que surjan investigaciones para desarrollar materiales de empaque que sean biodegradables y que ofrezcan otros beneficios como que sean activos, es decir que sirvan de transporte de agentes antimicrobianos, para garantizar productos inocuos para el consumidor sin ocasionar impactos negativos al ambiente. En el presente estudio se elaboraron pelculas comestibles con propiedades antimicrobianas a partir de quitosano y almidn extrados de materiales subutilizados como conchas de camarones (Penaeus vannamei) y ocumo chino (Colocasia esculenta), evaluando adems sus propiedades de barrera, estructurales, mecnicas y funcionales. Para ello se procedi a realizar la extraccin y caracterizacin de la materia prima; los resultados demostraron que los mtodos empleados para la extraccin de los polmeros son eficientes obtenindose almidn con 99,14% de pureza y quitosano con un grado de desacetilacin del 72,45%. Por otra parte la aplicacin de un diseo factorial de mltiples niveles permiti encontrar las formulaciones ptimas para pelculas a base de almidn o quitosano conteniendo aceites esenciales de organo y ajo como sustancias antimicrobianas contra microorganismos patgenos como Salmonella entrica Ser. Enteritidis y Listeria monocytogenes,,encontrndose que 7% de almidn, 2% de glicerol y 0,5% de aceite esencial de organo y 0,25% aceite esencial de ajo fue la combinacin ideal para pelculas de almidn, mientras que 4,485% de quitosano, 2% de glicerol y 0,82% de aceite esencial de organo y 0,5% aceite esencial de ajo fue la combinacin ideal para pelculas de quitosano. Adems, los resultados demostraron que la concentracin de polmero (almidn o quitosano) y aceites esenciales utilizada afecta significativamente (p<0,05) las propiedades de barrera, estructurales, mecnicas y funcionales de las pelculas. En conclusin, el desarrollo de pelculas antimicrobianas a partir de productos subutilizados como las conchas de camarones y ocumo chino es totalmente factible y representa una alternativa novedosa para aprovechar estos materiales, ofreciendo a la industria de alimentos materiales biodegradables para empaques que garantizaran la calidad e inocuidad de los alimentos.','2010-10-22','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',1,1,1,1,1,'2013-09-17 08:33:57','2013-09-17 08:33:57','Documento_439.pdf','application/pdf',516262,'2013-09-17 08:33:57',20,0,54,'COMPLETO'),(438,'COMPUESTOS CON POTENCIAL ACTIVIDAD ANTIMITTICA Y ANTIANGIOGNICA. SNTESIS DE 5, 6, 7-TRIMETOXIISOQUINOLINAS, SUSTITUIDAS EN LA POSICIN 1 CON ANILLOS FENILICOS DISUSTITUIDOS','Se hizo el estudio sobre la sntesis de 1-fenilisoquinolinas, las cuales presentan en comn un anillo trimetxibenceno y dos sustituyentes oxigenados en el anillo fenlico. Dichas caractersticas le podran conferir actividad antimittica y / o antigiognica, pues estudios previos as lo sugieren.La va sinttica escogida consisti en primer lugar en la sntesis de la 2,3,4- trimetxifenetilamina a partir de la reduccin del nitroestireno correspondiente, obtenido por una condensacin nitroaldlica entre el 2,3,4- trimetxibenzaldehido y nitrometano. Seguidamente se procedi a activar la fenetilamina empleando cloruro de tosilo en trietilamina para luego hacerla reaccionar con los benzaldehdos disustituidos basada en la reaccin Pictet- Spengler y as obtener luego de la remocin del grupo activante las tetrahidroisoquinolinas correspondiente. En ste ltimo paso se utiliz KOH en DMSO. Al elucidar los productos obtenidos mediante ste ensayo se observ que no correspondan a las tetrahidroisoquinolinas sino a las isoquinolinas.Los productos obtenidos en ste trabajo de investigacin fueron: 5,6,7- trimetxi-1-(3,4-dimetxifenil)-isoquinolina. 5,6,7-trimetxi-1-(3,4- metilendioxifenil)-isoquinolina. 5,6,7-trimetxi-1-(3-hidrxi-4- metxifenil)-2-p-toluensulfonil-1,2,3,4-tetrahidroisoquinolina.','2010-10-21','Sntesis, Isoquinolinas, Antimitsis, Antigiognicos',6,1,1,1,1,'2013-09-17 08:33:59','2013-09-17 08:33:59','Documento_440.pdf','application/pdf',3002765,'2013-09-17 08:33:59',19,0,119,'COMPLETO'),(439,'Un Esquema Mimtico de Diferencias Finitas para la Ecuacinn de Onda Biarmnnica','En el siguiente trabajo se presenta un esquema mimtico para la resolucin de la ecuacin de onda Biarmnica. Se demuestra que dicho esquema es consistente con la ecuacin diferencial, es condicionalmente estable y por lo tanto es convergente. Un estudio numrico comparativo evidencia la superioridad del esquema mimtico, ya que est produce errores menores que el esquema de diferencias finitas tradicional, este ltimo esta basado en el uso de nodos imaginarios o fantasmas para las condiciones de borde. A pesar de que el esquema de diferencias finitas es bastante sencillo y de fcil implementacin, los resultados obtenidos muestran que el esquema mimtico es ms eficiente y estable, ya que requiere de menos cuentas y clculos computacionales para resolver la ecuacin de onda Biarmnica.','2010-10-26','Ecuacin de Onda Biarmnica, Esquemas Mimticos, Convergencia, Estabilidad, Consistencia',5,1,1,1,1,'2013-09-17 08:34:00','2013-09-17 08:34:00','Documento_441.pdf','application/pdf',4047738,'2013-09-17 08:34:00',20,0,147,'COMPLETO'),(440,'Acciones de Grupos de Lie en Pseudovariedades.','En la tesis de grado del Prof. Tomas Guardia ([2]), se prob que el espacio de rbita deuna accin libre de un grupo de Lie compacto en una variedad diferenciable es una variedaddiferenciable. La condicin de libre es de vital importancia pues en general, este resultadono es cierto para acciones no libres; es el caso de la accin por rotaciones de la circunferenciaen el plano, donde el espacio de rbitas es el intervalo [0;1) quin obviamente no es unavariedad.Esta tesis consiste en introducir una nueva categora de objetos que generaliza la nocinde variedad y donde los espacios de rbita son objetos de esta categora; esta categora esLa Categora de las G-pseudovariedades Estratificadas, siendo G un grupo de Lie compacto.Obtendremos como resultado nal que si X es una G-pseudovariedad estratificada y K esun subgrupo cerrado de G; entonces X/K es una G-pseudovariedad estratificada.','2010-10-11','Variedades, Slices, Espacios de rbitas, Espacios Estratificados, Pseudovariedades estratificadas, G- Pseudovariedades estratificadas',5,1,1,1,1,'2013-09-17 08:34:04','2013-09-17 08:34:04','Documento_442.pdf','application/pdf',3483533,'2013-09-17 08:34:04',20,0,98,'COMPLETO'),(441,'Sobre el colapso gravitacional de nubes protoestelares enfriadas por radiacinn','Se estudia el problema del colapso de una esfera considerando el efecto gravitacional y difusivo.. Para modelar ms adecuadamenteel efecto difusivo en el problema se hace la suposicinn ms general en cuanto al coeficiente de difusinn,, es decir,, ste depende de la densidad y temperatura.. Por otra parte,, se emplea un grupo de transformaciones autosimilares para lograr transformar un problema de ecuaciones diferenciales en derivadas parciales,, a un problema en ecuaciones diferenciales en derivadas ordinarias.. Adems,, dada la complejidad del problema,, encontrar una solucinn analtica es sumamente complejo por lo tanto nos valdremos de mtodos numricos para resolver el problema para lo cual implementaremos una rutina Runge--Kutta de cuarto orden a fin de encontrar las funciones involucradas.. En otro orden de ideas,, se estudian algunas propiedades termodinmicas bsicas con el objeto de entender qu sucede con la entropa del sistema y cul es el efecto del trmino no lineal de la ecuacinn de la conservacinn de la energa en la acelaracinn radial de la esfera.. Finalmente estudiaremos el espacio de solucinn del grupo de transformaciones de escala que es vlida para nuestro problema concreto,, es decir,, el colapso gravitacional.. Con este estudio se logra generalizar las soluciones para los problemas de colapso gravitacional considerados hasta ahora,, dado que no se parte de un estado termodinmico particular;; adems se logra ver,, mediante el nmmero de Pclet y la tasa de fuerza debida a la presinn respecto de la gravedad,, que el sistema se \'\'\'\'enfra\'\'\'\' a causa de las prdidas radiativas..','2010-10-04','Hidrodinmica,, formacinn estelar,, autosimilaridad,, colapso gravitacional.',3,1,1,1,1,'2013-09-17 08:34:05','2013-09-17 08:34:05','Documento_443.pdf','application/pdf',6749761,'2013-09-17 08:34:05',20,0,149,'COMPLETO'),(442,'RELACINN ENTRE CAMBIOS ESTRUCTURALES EN EL CITOESQUELETO DE ASTROCITOS t--11 Y LA ACTIVIDAD DEL INTERCAMBIADOR Na++//Ca22++','Los astrocitos son uno de los tipos celulares de mayor abundancia, representando aproximadamente la cuarta parte del volumen celular total en cerebro y cerebelo. Estas clulas gliales actan como clulas de sealizacin, donde las variaciones en la concentracin de calcio citoplasmtico ([Ca2+]i) actan como una seal capaz de propagarse a otros astrocitos y clulas adyacentes; en las cuales este in puede participar como segundo mensajero y/ o regular diversos procesos biolgicos. En astrocitos, la [Ca2+]i puede cambiar en respuesta a estmulos como un \"shock\" hipo-osmtico (similar al generado durante patologas como isquemia e hiponatremia), responsable de inducir la liberacin de Ca2+ a partir de reservorios intracelulares como el retculo endoplasmtico (ER), que generan un incremento en la seal de Ca2+ citoslica controlada por la actividad en modo directo del intercambiador Na+/ Ca2+ (NCX); que es el principal mecanismo regulador de la [Ca2+]i en astrocitos t-1. Adicionalmente, el NCX puede actuar en modo reverso frente a un desbalance del flujo de Na+, encontrando que este modo de operacin es considerablemente incrementado si adems se encuentra en presencia de un medio hipo-osmtico libre de Na+externo (Na+e). I Los resultados del presente trabajo, ponen en evidencia el posible mecanismo por el cual se produce un aumento en la [Ca2+]i frente a un shock hipo-tnico libre de Na+e, indicando que las alteraciones que se producen en el citoesqueleto frente a este medio inducen un incremento en la actividad en modo reverso del NCX. Estas alteraciones corresponden a la disrupcin o despolimerizacin de los F-actina, de forma similar a la generada por toxinas de actina como Citocalasina D (CD) y Latrunculina B (Lat B). El incremento en la actividad del NCX se evidenci frente a los medios iso-osmtico e hipo-osmtico, luego de la despolimerizacin de los F-actina; observando en ambos casos un incremento en la seal de Ca2+i medida mediante microespectrofluorometria y perfusin. Otro hallazgo observado, fue el aumento en la fluorescencia asociada a la identificacin del NCX y en el coeficiente de correlacin entre el NCX y los F-actina, frente a un medio iso- osmtico y en condiciones de despolimerizacin, lo que sugiere una interaccin directa entre ambas estructuras y en consecuencia un posible aumento en la expresin del NCX. En este trabajo se presentan evidencias que sealan una independencia entre la liberacin de calcio desde el ER y el citoesqueleto de actina, encontrando que la despolimerizacin de sus filamentos no afecta a dichos reservorios, donde el vaciado de Ca2+ ocurre solo en presencia de un medio hipo-osmtico libre de Na+ y Ca2+. II De forma general, los hallazgos reportados en este trabajo, identifican la despolimerizacin de los F-actina como responsable de incrementar la actividad del NCX, lo que convierte a este contra transportador en un mecano sensor capaz de reconocer los cambios de volumen intrnseco a las alteraciones del citoesqueleto de actina e inducidos por perfusin extracelular; que resultan similares a las condiciones presentadas en astrocitos t-1 durante daos cerebrales como isquemia cerebral, hiponatremia y encefalopata heptica; por lo cual el aumento en la actividad del NCX contribuira a controlar las [Ca2+]i en estas condiciones.','2010-09-06','NCX, Astrocitos t-1, F-actina, Calcio.',1,1,1,1,1,'2013-09-17 08:34:15','2013-09-17 08:34:15','Documento_444.pdf','application/pdf',1418741,'2013-09-17 08:34:15',20,0,89,'COMPLETO'),(443,'\"Sntesis y Caracterizacin de zeolita ZSM-5 mesoporosa\"','{}','2010-10-22','Sntesis, Caracterizacin, ZSM-5, mesoporsa.',6,1,1,1,1,'2013-09-17 08:34:17','2013-09-17 08:34:17','Documento_445.pdf','application/pdf',8555526,'2013-09-17 08:34:17',20,0,104,'COMPLETO'),(444,'\"Sntesis y caracterizacin de zeolita ZSM-5 mesoporosa\"','{}','2010-10-22','Sntesis, Cracterizacin, ZSM-5, mesoporosa',6,1,1,1,1,'2013-09-17 08:34:18','2013-09-17 08:34:18','Documento_446.pdf','application/pdf',1066646,'2013-09-17 08:34:18',20,0,96,'COMPLETO'),(445,'Esterificacin del cido benzoico con metanol utilizando mordenitas mesoporosas','{}','2010-10-21','Esterificacion, mordenita, mesoporosa',6,1,1,1,1,'2013-09-17 08:34:19','2013-09-17 08:34:19','Documento_447.pdf','application/pdf',2961460,'2013-09-17 08:34:19',20,0,145,'COMPLETO'),(446,'Esterificacin del cido benzoico con metanol utilizando mordenitas mesoporosas','{}','2010-10-21','Esterificacin mordenitas mesoporosas',6,1,1,1,1,'2013-09-17 08:34:23','2013-09-17 08:34:23','Documento_448.pdf','application/pdf',45555838,'2013-09-17 08:34:23',20,0,82,'COMPLETO'),(447,'EVALUAR LA ACTIVIDAD CATALTTICA HACIA REACCIONES DE HIDROTRATAMIENTO DE LCO EMPLEANDO CATALIZADORES SULFURADOS DE Mo--V','R E S U M E N..El Light Cycle oil (LCO) es un producto de la unidad de craqueo cataltico de fluidos el cual es de inters en nuestra nacin, por que a travs de reacciones de hidrotratamiento se puede mejorar y obtener a partir de l un diesel de calidad comercializable en diferentes pases..En el presente trabajo de investigacin se realiz la sntesis de una serie de catalizadores no soportados, de molibdeno-vanadio, mediante el mtodo de precipitacin en medio homogneo. Las relaciones atmicas nominales empleadas de molibdeno-vanadio (Mo/Mo+V) fueron 0; 0,25; 0,5; 0,75; 1. La sntesis de los catalizadores se llev a cabo en presencia de nitrgeno y bajo agitacin constante durante un tiempo de dos (2) horas. La caracterizacin de los catalizadores se realiz empleando difraccin de rayos X (DRX), rea especfica (BET).La caracterizacin por rayos X mostr la presencia del complejo Mo2VS4en los catalizadores mixtos adems de las fases de los metavanadatos V6O13 y V3O5. Por su parte el anlisis textural por BET indic que se obtuvieron reas comprendidas entre 5 y 15 m2/g caractersticas de los catalizadores msicos.Los catalizadores, se sometieron a hidrotratamiento cataltico, evaluando las reacciones de hidrodesulfuracin (HDS), hidrodesnitrogenacin (HDN) e hidrogenacin (HYD) de LCO. Esta se llev a cabo en un reactor de flujo continuo a una temperatura 375 C y a una presin de 30 atmosferas, el proceso de presulfuracin se realiz iin situ a presin atmosfrica de hidrgeno y a una temperatura de 300C por dos (2) horas. El catalizador que se mostr activo para las reacciones de HDS y HDN, fue el que posea una relacin de Mo/Mo+V igual a 0,5. Este catalizador alcanz conversiones de 30% para las reacciones de HDN y HDS las cuales son de valor considerable para un catalizador msico. Por los resultados obtenidos, la fase mixta de MoV puede ser la responsable de la actividad observada en los catalizadores de V-NiMo/almina en el hidrotratamiento de LCO.','2010-10-18','LCO (light cycle oil)Hidrodesnitrogenacion (HDN)Hidrodesulfuracion (HDS)Catalizadores Molibdeno-Vanadio Mo-V',6,1,1,1,1,'2013-09-17 08:34:25','2013-09-17 08:34:25','Documento_449.pdf','application/pdf',3561425,'2013-09-17 08:34:25',19,0,111,'COMPLETO'),(448,'Caracterizacin de una regin HHindIII de 3kb (H2) del genoma de Leishmania ((Viannia)) portadora de genes de la beta tubulina','La Leishmaniasis es un padecimiento que provoca una amplia gama de patologas en el humano y en trminos epidemiolgicos esta enfermedad exhibe grandes variaciones a lo largo del continente Americano, lo que ha originado incertidumbre en la correlacin especie-clnica. Por tal razn se han desarrollado numerosas herramientas para el diagnstico e identificacin del parsito a diferentes niveles. En los ltimos aos tcnicas basadas en marcadores genotpicos tales como el anlisis del polimorfismo en la longitud de los fragmentos de restriccin (RFLP) y la reaccin en cadena de la polimerasa (PCR) han mostrado una mayor especificidad y sensibilidad en comparacin con las metodologas tradicionales. En un anlisis de RFLP sobre la regin de los genes de b-tubulina en el DNA genmico de Leishmania se encontraron diferencias entre los subgneros Leishmania y Viannia; por ej. en L. ((Viannia)) guyanensis se encontraron dos fragmentos HindIII de tamao 2.4 kb y 3 kb, denominados H1y H2respectivamente, mientras que para L.. ((Leishmania)) mexicana se encontr solo un fragmento HindIII de 3.4 kb (H3). En este proyecto se prosigui el anlisis de la regin H2de L.. ((V..)) guyanenis, luego de clonarse la misma en el plsmido pUC18. Varios intentos en la purificacin del recombinante para completar la caracterizacin fueron infructuosos por razones tcnicas. Paralelamente se realizo un anlisis in silico de los genes de b-tubulina de Leishmania ((Viannia)) braziliensis,, Leishmania ((Leishmania)) major,, Leishmania ((Leishmania)) infantum y Trypanosoma bruceiutilizando la aplicacin nnucleotide BLAST. Los resultados de este procedimiento apoyan lo obtenido experimentalmente sobre los loci de b- tubulina y las regiones HindIII (Mendoza-Len y col, 1995) pero difieren con lo reportado por otros autores.','2010-07-01','Biologa Molecular, Bioinformatica, Leishmania, Tubulina',1,1,1,1,1,'2013-09-17 08:34:27','2013-09-17 08:34:27','Documento_450.pdf','application/pdf',2096865,'2013-09-17 08:34:27',16,0,105,'COMPLETO'),(449,'Estudio de las cocadenas casiconmutativas en conjuntos cbicos.','Dennis Sullivan desarroll una teora que permitio estudiar losgrupos de homotopa de un espacio topolgico como espaciosvectoriales sobre Q (tensorizados por los racionales) usando formasdiferenciales, ver [Su]. Sin embargo, la construccin de Sullivan noMax Karoubi logr construir un nuevo tipo de formas diferenciales[K1] que logran resolver ese problema. Es decir describir grupos dehomotopas de conjuntos simpliciales usando lgebras diferencialescasiconmutativas. Este trabajo trata de extender la construccin de Karoubi al caso de conjuntos cbicos.Usando la teora Karoubi de l\'Universit Paris Diderot-Paris 7 y las teoras de los Profesores J. Peter May de The Universityof Chicago, y del Profesor J.F. Jardine de The University of WesternOntario.','2010-10-26','Topologa algebrica,lgebra homolgica',5,1,1,1,1,'2013-09-17 08:34:29','2013-09-17 08:34:29','Documento_451.pdf','application/pdf',922131,'2013-09-17 08:34:29',20,0,60,'COMPLETO'),(450,'IMPLEMENTACINN DE UN FILTRO DE POLARIZACINN BASADO EN LA DESCOMPOSICINN DEL VALOR SINGULAR ((SVD))','En este trabajo hemos introducido una tcnica adaptativa de filtrado que permite resaltar los eventos ssmicos selectivamente de acuerdo a su polarizacin, la cual, consiste en la implementacin de un filtro de polarizacin basado en la Descomposicin del Valor Singular (SVD). El SVD, tiene una variedad de aplicaciones en el procesamiento de seales, aunque este mtodo est enfocado como una poderosa matriz de descomposicin, tambin ha sido considerado til en la aplicacin del procesamiento de imgenes. Como un registro ssmico es considerado una imagen del subsuelo, en este trabajo, se presentan los fundamentos matemticos asociados al anlisis y filtrado selectivo de polarizacin que se aplicar a datos ssmicos sintticos multicomponente (MC), generados a travs de un programa de modelado elstico. Esta tcnica permiti la reconstruccin de la imagen ssmica generada a partir de las primeras dos autoimgenes, reproducir los atributos de polarizacin (rectilinialidad y planaridad) del movimiento de las partculas, suprimir el ruido aleatorio de alta frecuencia, mejorar la relacin seal-ruido y de esta forma se logr obtener una imagen clara y coherente de los eventos ssmicos asociados a las energas primarias de reflexin, de inters en estudios ssmicos de reflexin.','2010-07-16','Propagacinn de Ondas en Medios Elsticos,,Polarizacinn de Ondas,,Ruido ssmico,,Filtros,,Descomposicinn del Valor Singular ((SVD)).',3,1,1,1,1,'2013-09-17 08:34:30','2013-09-17 08:34:30','Documento_452.pdf','application/pdf',0,'2013-09-17 08:34:30',20,0,0,'INCOMPLETO'),(451,'ESTUDIO DE LOS COMPLEJOS TERNARIOS DE VANADIO((III)) CON 22,,22\'\'--BIPIRIDINA Y LOS COMPONENTES DEL PLASMA SANGUINEO DE BAJO PESO MOLECULAR','El presente trabajo experimental muestra el estudio de equilibrio en complejos ternarios de V(III), 2,2`-bipiridina(C) y ligandos(HiL) derivados de cido oxlico, cido fosfrico, cido ctrico y cido lctico. Las medidas fueron realizadas en medio acuoso con KCl 3.0 M, 25 C, atmsfera inerte de gas nitrgeno y monitoreadas con medidas de emf((H)) al variar el pH de la mezcla con una titulacin volumtrica con KOH. Los clculos y diagramas de distribucin se realizaron a travs de los programas LETAGROP y HYSS. Resultando con las constantes de acidez de los ligandos: cido oxlico (H2L = cido oxlico) H2L/ HL- (-Log bp0r 1.277(8)); H2L/L2-(-Log bp0r 5.067(8)); cido fosfrico (H3L = cido fosfrico) H3L/H2L- (-Log bp0r 1.44(1)), H3L/HL2- (-Log bp0r 7.76(1)); H3L/L3- (-Log bp0r 18.78(2)), cido ctrico (H3L = cido ctrico) H3L/H2L- (-Log bp0r 3.009(3)); H3L/HL2- (-Log bp0r 7.369(4)); H3L/L3- (-Log bp0r 12.816(4)), cido lctico Hlac/lac- (H3L = cido lctico) (-log bp0r 3.927 (5)) y el sistema H+-2,2\'-bipiridina (brevemente C) C/HC+ (log bp0r 5.193 (7)). Para los equilbrios V(III)-2,2`-bipiridina-ligando que se formaron con derivados de: cido oxlico : [VCHL]2+ (log bpqr 17.37(6)), [VCL]+ (log bpqr 15.34(7)), V(OH)CL (log bpqr 12.46(6)), [V(OH)2CL]- (log bpqr 5.0(2)), [V (OH)3CL]2- (-log bpqr 3.2(1)); cido fosfrico: [VCH2L)]2+ (log bpqr 11.47(3)), [VCHL]+ (log bpqr 8.37(7)); cido ctrico: [VCHL]+ (log bpqr 9.63(1)), VCL (log bpqr 6.92(4)), [V(OH)CL]- (log bpqr 1.87(9)), [V(OH)2CL]2- (-log bpqr 5.3 (2)) y cido lctico: [VCL]2+ (log bpqr 17.58(7)), [V(CL2]+ (log bpqr 18.0 (1)), V(OH)2CL (log bpqr 12.02(7)), [V2OC2L2]2+ (log bpqr 32.7(4))','2010-10-26','VANADIO(III); EQUILIBRIO; LETAGROP; 2,2`-BIPIRIDINA; CIDO OXLICO; CIDO FOSFRICO; CIDO CTRICO; CIDO LCTICO; EMF(H)',6,1,1,1,1,'2013-09-17 08:34:30','2013-09-17 08:34:30','Documento_453.pdf','application/pdf',1165768,'2013-09-17 08:34:30',19,0,83,'COMPLETO'),(452,'Evaluacinn de las concentraciones de Pb,, Cd,, Ni,, Cr y Cu enAmphimedon viridisy Niphates erectaen ambientes contrastantes respecto al impacto antrppico','Dra. Estrella Villamizar, Tutora La intensificacin de las actividades antrpicas, con el inicio de la Revolucin Industrial, produjo impactos notorios sobre los ecosistemas marinos, ya que stos son sitios primordiales de recepcin de efluentes industriales y domsticos, as como asiento de diferentes actividades productivas como pesquera, transporte de bienes y personas, y turismo. Los ecosistemas marinos estn sujetos a una gran cantidad de perturbaciones. Actualmente los estudios de impacto ambiental consideran sus anlisis desde el nivel molecular hasta ecosistemico, incluyendo la amplia gama de especies que representan diferentes niveles trficos y hbitats, para dar una visin en conjunto de las presiones que se mantienen sobre estos (Cebrian, y col. 2006). Los metales pesados son elementos que se encuentran entre los contaminantes ms frecuentes resultantes de las actividades antrpicas; sin embargo, la determinacin e interpretacin del comportamiento de estos elementos en el medio marino es compleja, debido a la naturaleza y caractersticas del medio. En todo caso, la calidad qumica de las aguas, sedimentos y de la biota marina pueden ser reflejo de la contaminacin a la cual ha estado sometida un rea especfica. Esta investigacin llev a cabo una evaluacin comparativa de las concentraciones de metales pesados en dos especies de esponjas marinas en diferentes localidades de la costa venezolana, con el objetivo de evaluar su posible capacidad para reflejar las condiciones del entorno marino en cuanto a la contaminacin con estos elementos. La seleccin de esponjas se debe a que son organismos ssiles, exclusivamente filtradores y desarrollan su ciclo de vida en un mismo lugar. Estos rasgos los hacen potencialmente tiles como biomonitores, bioindicadores o \"vigilantes\" biolgicos. Para ello se determinaron las concentraciones de Pb, Cd, Ni, Cr y Cu en las esponjas marinas,Amphimedon viridis y Niphates erecta y en los sedimentos de dos ambientes arrecifales contrastantes respecto a su impacto antrpico, uno ubicado en el Parque Nacional Archipilago de Los Roques especficamente en la zona de Dos Mosquises, sin ninguna influencia de industrias pesadas, aunque si del trnsito turstico de embarcaciones y otro en la Baha de Bergantn, estado Anzotegui, ubicada frente a una refinera petrolera, con un trnsito pesado de buques y recepcin de descargas domsticas e industriales. Las esponjas fueron procesadas a travs de una digestin cida en horno microondas, en tanto que para los sedimentos se llev a cabo un protocolo de extraccin secuencial BCR-701 que incluyo hasta sus etapas 1 y 2 (total de metales biodisponibles). Las concentraciones totales de los elementos traza en ambos tipos de muestras se determinaron por Espectrometra de Absorcin Atmica Electrotrmica (ETAAS) y adicionalmente se hizo la determinacin de materia orgnica total (MOT) y granulometra de los sedimentos. A travs de los anlisis estadsticos, se determin que existen interacciones significativas para las concentraciones de nquel (Ni), cromo (Cr) y cobre (Cu) entre las dos especies y las dos localidades, siendo los niveles promedio de la concentracin de nquel para Niphates erecta significativamente mayores en el P. N. A. Los Roques, en comparacin a las concentraciones de cromo (Cr) que presentaron diferencias significativas para las dos localidades, siendo las concentraciones de ambas especies mayores en Baha de Bergantn que en el P. N. A. Los Roques. La concentracin de cobre (Cu) fue significativamente mayor para la especie N.. erecta en la Baha de Bergantn respecto a la media de la misma especie en el P. N. A. Los Roques y las concentraciones de A.. viridis en ambas localidades estudiadas. Las concentraciones de plomo (Pb) y cadmio (Cd) se analizaron por pruebas unifactoriales dando diferencias significativas entre los valores promedio de localidades (el Pb result mayor en la Baha de Bergantn y el cadmio en el P. N. A. de Los Roques), mas no entre las especies. Por otro lado, se determinaron las concentraciones en los sedimentos para las dos primeras etapas de la extraccin secuencial y se encontr que las mismas fueron significativamente mayores para el Pb, Cr y Cu en el P. N. A. Los Roques que para la Baha de Bergantn, pero no se observaron diferencias significativas entre las dos localidades para el Cd y el Ni. Las concentraciones de cobre y nquel son las ms altas entre los metales analizados en los sedimentos de ambas localidades y estos son tambin los metales ms acumulados por ambas especies de porferos; sin embargo no hay una estricta proporcionalidad entre stas. Las inconsistencias de los contenidos de metales pesados entre las esponjas y los sedimentos, la podemos atribuir principalmente a las diferencias en las caractersticas mineralgicas de los sedimentos de cada zona de estudio (mayoritariamente carbonatos para P. N. A. de Los Roques en contraste con mayoritariamente terrgenos alumino-silicatos para la Baha de Bergantn), as como tambin a las diferencias en la hidrodinmica de los sitios. Como conclusiones de este trabajo podemos decir que existe bioacumulacin de los metales pesados en ambas especies de esponjas, N.. erecta y A.. viridis., Niphates erecta en general fue la especie que acumul ms metales pesados (Pb= 0,55-2,6mg g-1; Ni= 3,3-23mg g-1; Cu= 11-19mg g-1) comparada con A.. viridis (Cd= 0,79-2,31mg g-1 Cr= 0,33-2,8mg g-1; Cu=10,4-10,6mg g-1). El metal que fue bioacumulado en mayor concentracin para las dos especies de esponjas en ambas localidades fue el cobre (Cu), lo que sugiere que pueden existir en estos organismos mecanismos especficos de incorporacin y retencin de este elemento.','2010-10-25','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; m',1,1,1,1,1,'2013-09-17 08:34:32','2013-09-17 08:34:32','Documento_454.pdf','application/pdf',1775451,'2013-09-17 08:34:32',19,0,96,'COMPLETO'),(453,'Funciones de Variacin Acotada geeralizada y un Teorema de Representacin de Chistyakov.','En este trabjo especial de grado se expone de manera explcita la nocin de Variacin Acotada, dando la definicin, ejemplos, propiedades tanto para un itnervalo cerrado [a,b] como para un sub conjunto E de los nmeros Reales. Se demuestra que la clase BV[a,b] posea una estructura de espacio vectorial, espacio de Banach y un lgebra de Banach.Tambin se demuestra la generalizacion de esta nocin de Variacin Acotada en el sentid de Wiener. y se dota a la clase BV [a,b] en el sentido de Wiener de espacio vactorial, espacio de Banach y lgebra de Banach.Se hace la representacin de la nocin de variacin acotada mediante el famoso Teorema de representacin de Jordan y el Teorema de Represemtacin de Chistyakov estas son otras caracterizaciones de la nocin de Variacin Acotada.','2010-10-18','nocin de variacin acotada. generalizacion y caracterizacin de tres maneras diferentes de la nocin de variacin acotada.',5,1,1,1,1,'2013-09-17 08:34:33','2013-09-17 08:34:33','Documento_455.pdf','application/pdf',1417511,'2013-09-17 08:34:33',20,0,93,'COMPLETO'),(454,'Efecto Citotxxico de seco--ent--kauranos de Croton micans en clulas PC--33 ((cncer de prsstata)) y HeLa ((cncer de ttero)):: Combinacinn con compuestos seco-- ent--kauranos y frmacos antitumorales','El cncer de prstata es uno de los cnceres ms frecuentes en el mundo, al igual que el cncer de crvix. Los tratamientos clsicos para el cncer se enmarcan en el campo de la ciruga, quimioterapia y radioterapia. Sin embargo se ha observado que algunos tumores no responden a los frmacos, mientras que otros pueden desarrollar resistencia a medida que el tratamiento es aplicado al paciente. Por esta razn se ha mostrado un gran inters por el uso de plantas como agentes antitumorales. El objetivo del presente trabajo es estudiar la actividad citotxica de productos naturales aislados de la especie Croton micans,, pertenecientes al grupo seco-ent- kauranos, en clulas de cncer de prstata y cncer de tero, as como la combinacin de estos productos, y con frmacos antitumorales que son utilizados en los tratamientos quimioteraputicos contra el cncer. Para ello se realizaron ensayos de citotoxicidad con lneas tumorales PC3 (prstata), HeLa (tero) y fibroblastos drmicos. El ensayo empleado, MTT, (Mosmann, 1983), luego de las 72 horas de incubacin permite calcular los valores de concentracin inhibitoria (CI50) especfica para cada uno de los productos naturales sobre las lneas celulares. Adems se obtuvieron los ndices de selectividad, as como las relaciones dosis- respuesta y las combinaciones entre los productos naturales y los frmacos antitumorales Adriamicina y Mitomicina C. Los resultados obtenidos en este estudio reflejan que el grupo de seco-ent-kauranos evaluados presenta una marcada citotoxicidad sobre las lneas tumorales PC3 y HeLa con respecto a las clulas control, siendo el EMCM 125 en PC3 y HeLa, y el EMCM 128 y EMCM 145 los que poseen mayor efecto sobre las PC3. En relacin a las combinaciones, los resultados reflejan un sinergismo en los compuestos evaluados cuando son combinados entre s, contrario a esto, cuando los kauranos son combinados con los frmacos antitumorales, se observa un antagonismo fuerte en los diferentes tipos celulares. En base a los resultados de este trabajo se puede inferir que los compuestos pertenecientes al grupo seco-ent- kauranos aislados de Croton micans muestran una inhibicin sobre la viabilidad celular en las lneas tumorales PC-3 y HeLa, a medida que aumenta la dosis administrada de los compuestos, del mismo modo el efecto citotxico de las combinaciones entre los compuestos es ms potente sobre las clulas en comparacin con la accin de cada uno individualmente.','2010-06-18','citotxicidd, Croton micans, cncer de prstata, cncer de tero.',1,1,1,1,1,'2013-09-17 08:34:35','2013-09-17 08:34:35','Documento_456.pdf','application/pdf',38765509,'2013-09-17 08:34:35',20,0,132,'COMPLETO'),(455,'Patrones de Accesibilidad Web para la construccin de interfaces de usuario: Un medio de inclusin para personas con discapacidades visuales','En la actualidad y de manera general, existe una gran cantidad de desarrolladores de software que estn acostumbrados a crear aplicaciones Web para las masas, sin tomar en cuenta a las personas con discapacidades dando como resultado aplicaciones muy poco o nada accesibles a stas y en particular a las que poseen discapacidades visuales. Actualmente existen diversos grupos de investigacin e iniciativas promoviendo la creacin de pginas Web accesibles. La WAI (Web Accessibility Iniciative) es una de ellas. Perteneciente a la W3C (Wold Wide Web Consortium), la WAI se ha abocado a la creacin de un extenso compendio de guas de accesibilidad. El objetivo principal de este Trabajo Especial de Grado es proporcionar una solucin a los desarrolladores, que ayude a minimizar el problema que presentan las personas con discapacidades, especficamente con discapacidades visuales al momento de acceder la Web. La solucin se logr mediante Patrones de Accesibilidad Web, creados y validados a travs de la ejecucin de las siguientes cuatro (4) etapas: 1.- Seleccin de un conjunto de sitios Web a fin de evaluar su accesibilidad; 2.- Realizacin de una serie de pruebas de accesibilidad a los sitios seleccionados para determinar los problemas existentes; 3.- Creacin de un conjunto de patrones de accesibilidad que faciliten el desarrollo de sitios Web accesibles a las personas con discapacidades visuales; 4.- Aplicacin de los Patrones de Accesibilidad a un caso de estudio. Incluyendo en el desarrollo de un caso de estudio los Patrones de Accesibilidad Web, se logra generar una aplicacin Web accesible a las personas con discapacidades visuales.','2010-10-25','accesibilidad, accesibilidad Web, discapacidades, discapacidad visual, patrones de accesibilidad.',2,1,1,1,1,'2013-09-17 08:34:38','2013-09-17 08:34:38','Documento_457.pdf','application/pdf',4454729,'2013-09-17 08:34:38',20,0,113,'COMPLETO'),(456,'ESTUDIOS DE FORMACINN DE COMPLEJOS DE NQQUEL((II)) CON LOS AMINOCCIDOS:: PROLINA,, GLICINA,, a--ALANINA Y b--ALANINA,, MEDIANTE MEDIDAS DE EMF((H)) EN NaCl 11,,00 M A 2255C','La investigacin llevada en ste Trabajo Especial de Grado vers, sobre el estudio de la formacin de los complejos formados entre el nquel divalente y los ligandos a- alanina, b-alanina, glicina y prolina. En el presente trabajo se estudiaron los sistemas: H+ - a-alanina H+ - Ni (II) - a-alanina H+ - b-alanina H+ - Ni(II) - b-alanina H+ - glicina H+ - Ni(II) - glicina H+ - prolina H+ - Ni(II) - prolina por medio de medidas de fuerza electromotriz emf(H) a 25C y en NaCl 1,0 M como medio inico inerte. El anlisis de los datos experimentales de cada sistema se realiz mediante el programa de mnimos cuadrados LETAGROP y LETAGROP/FONDO, obtenindose los valores de pKa para los ligandos y sus constantes de estabilidad bPqr. Las siguientes tablas muestran los resultados obtenidos. Tabla I..Valores de pKa obtenidos para cada uno de los ligandos, medidos en NaCl 1,0 M a 25C. Especies H++-- a--alanina pKa H++--b--alanina pKa H++-- glicina pKa H++-- prolina pKa [H2C]+/[HC] 2,53(3) 3,70(4) 2,54(4) 2,10(2) [HC]/[C]- 9,68 (3) 9,98(4) 9,44(4) 10,42(3) Dispersin s(ZC) 0,023 0,031 0,033 0,019 Tabla II.. Complejos obtenidos con sus constantes de formacin, log bpqr para los sistemas: H+ - Ni(II)- a-alanina, H+ - Ni(II)- b-alanina, H+ - Ni(II)- glicina y H+ - Ni(II)- prolina, en NaCl 1,0 M a 25C. H++--Ni((II)) -- a--alanina H++--Ni ((II)) --b--alanina H++--Ni((II)) -- glicina H++--Ni((II)) -- prolina Especies Log bpqr Log bpqr Log bpqr Log bpqr [NiC+] 5,32(4) 4,84(8) 5,50(3) 5,78(5) [NiC2] 9,69 (3) 8,08(9) 10,04(3) 10,53(5) [NiC3-] 12,68(6) 9,40 13,23(4) 13,10(1)','2010-10-22','Constantes de formacin para complejos de nquel(II) con los aminocidos: PROLINA, GLICINA, a-ALANINA Y b-ALANINA',6,1,1,1,1,'2013-09-17 08:34:38','2013-09-17 08:34:38','Documento_458.pdf','application/pdf',1192354,'2013-09-17 08:34:38',20,0,31,'COMPLETO'),(457,'SISTEMA DE INFORMACINN PARA LA GESTINN DE LAS COMUNICACIONES DE PROYECTOS','El presente Trabajo Especial de Grado contempla el desarrollo de un Sistema de Informacin para la Gestin de las Comunicaciones de Proyectos, siguiendo los estndares establecidos en la Gua del PMBOK (Project Managemet Body of Knowledge, Gua de Fundamentos de la Gestin de Proyectos). Para dicho desarrollo se utiliz el mtodo de investigacin TTipo Proyectiva,,permitiendo el levantamiento de informacin en 3 fases: inicio, desarrollo, evaluacin y cierre. La fase de inicio consisti en la recopilacin y seleccin de la informacin concerniente a los formularios especificados por el PMI (Compendium of Project Management Practices 22000033 ((Compendio de Prcticas de Gestin de Proyectos 2003)),, que sern usados para la compilacin y distribucin de la informacin a los interesados de los proyectos. La fase de desarrollo se bas en el anlisis de las herramientas y tcnicas del rea de Gestin de las Comunicaciones y adaptacin de los formularios seleccionados en la fase anterior para desarrollar un flujo de trabajo para la automatizacin y manejo de documentos para los proyectos. La fase de evaluacin y cierre, verific la correctitud y completitud de la informacin que ser distribuida a los grupos de interesados de los proyectos gestionados por el PSGP. Una vez seleccionadas todas las herramientas y tcnicas se lleva a cabo la implementacin de las mismas y las pruebas necesarias para comprobar su correcto funcionamiento. El objetivo principal de este Trabajo Especial de Grado consiste en el anlisis, seleccin e implementacin de un conjunto de herramientas y tcnicas de la Gestin de las Comunicaciones basadas en las descritas en el PMBOK, el desarrollo de las interfaces de usuario y modelos de datos correspondientes, adems del conjunto de manuales de usuario y sistema necesarios; permitiendo as el desarrollo de un Prototipo de Software de seguimiento y control para la Gestin de las Comunicaciones de Proyectos.','2010-10-28','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:34:40','2013-09-17 08:34:40','Documento_459.pdf','application/pdf',1557432,'2013-09-17 08:34:40',20,0,92,'COMPLETO'),(458,'Desarrollo de una Aplicacinn Web para la Biblioteca Alonso Gamero que permita el almacenamiento,, gestinn y bssqueda de la Produccinn Intelectual de la Facultad de Ciencias de la Universidad Central de Venezuela','El siguiente Trabajo Especial de Grado aborda la localizacin y el difcil acceso que tiene la Produccin Intelectual de la Facultad de Ciencias de la Universidad Central de Venezuela, ms especficamente de los Trabajos Especiales de Grado (T.E.G.) de pregrado. En el marco terico se explican los conceptos asociados a la gestin del conocimiento y su relacin con las aplicaciones Web, el formato de documento electrnico ms comn y los motores de bsqueda que manipulan estos documentos electrnicos. En el marco aplicativo se muestran las etapas del desarrollo de una aplicacin Web con un motor de bsqueda embebido que gestiona los T.E.G. de la Facultad de Ciencias, utilizando el mtodo de desarrollo de software Programacin Extrema (XP). El sistema desarrollado realiza una integracin con el sistema CONEST para aprovechar los datos all almacenados y los procesos de validacin de usuarios, y as poder alcanzar y cubrir por completo los requerimientos de los usuarios de ste sistema al que se le denominar BUBAG.','2010-10-27','Universidad Central de Venezuela, Facultad de Ciencias, Escuela de Computacin, Biblioteca Alonso Gamero, Gestin de Documentos, Aplicacin Web, Bsqueda de Documentos Electrnicos, Ruby on Rails, Programacin Extrema (XP), BUBAG.',2,1,1,1,1,'2013-09-17 08:34:41','2013-09-17 08:34:41','Documento_460.pdf','application/pdf',0,'2013-09-17 08:34:41',20,0,0,'INCOMPLETO'),(459,'Trabajo Especial de Grado Desarrollo de una Aplicacinn Web para la automatizacinn de la Unidad de Servicio Comunitario de la Facultad de Ciencias','La Unidad de Servicio Comunitario requiere la organizacin de sus procesos con el uso de las Tecnologas de Informacin y Comunicacin (TIC), con el fin de gestionar de mejor forma la informacin de los involucrados en las actividades del Servicio Comunitario, beneficiando a la comunidad estudiantil, docente y el personal que la conforma. Con el propsito de apoyar a la Unidad de Servicio Comunitario se plantea como objetivo de este Trabajo Especial de Grado el desarrollo de una aplicacin Web que automatiza los procesos relacionados con los cursos de induccin (inscripcin y control de asistencia) y proyectos (inscripcin, cronograma de actividades y calificacin). En ste trabajo se utiliza el mtodo de desarrollo de software gil Programacin Extrema, que permite la interaccin continua con el cliente para cubrir sus necesidades referentes al software en un tiempo oportuno. Se adoptan tecnologas software libre como: MySQL, Ruby on Rails, JavaScript, HTML, CSS, entre otros.','2010-10-20','Unidad de Servicio Comunitario, Servicio Comunitario, Prestador Comunitario, Tutor Acadmico, Tutor Comunitario, Aplicacin Web, Programacin Extrema, Ruby on Rails.',2,1,1,1,1,'2013-09-17 08:34:42','2013-09-17 08:34:42','Documento_461.pdf','application/pdf',1939146,'2013-09-17 08:34:42',20,0,96,'COMPLETO'),(460,'ESTUDIO DE LA FORMACINN DE COMPLEJOS DE NQQUEL ((II)) CON LOS CCIDOS PICOLNNICO Y DIPICOLNNICO EN DISOLUCINN ACUOSA ((NaCl 11,,00 M,,2255 C))','RESUMEN En el presente Trabajo Especial de Grado se estudi la formacinn de complejos de nquel ((II)) con los cidos picolnico y dipicolnico en disolucinn acuosa ((NaCl 11,,00 M,, 2255 C)) y la hidrllisis del Ni((II)) en medio innico de NaCl 11,,00 M a 2255 C.. Los sistemas estudiados en el presente trabajo fueron los siguientes:: H++ -- Ni((II))H++ -- cido picolnicoH++ -- cido dipicolnicoH++ -- Ni((II)) -- cido picolnicoH++ -- Ni((II)) -- cido dipicolnico Empleando mediciones de fuerza electromotriz fem((H)) a 2255C y en NaCl 11,,00 M como medio innico inerte.. El anlisis de los datos experimentales para cada sistema se realiz mediante el programa de mnimos cuadrados LETAGROP y LETAGROP//FONDO.. Las siguientes tablas rennen los resultados obtenidos para cada uno de los sistemas antes mencionados.. Tabla I.. Logaritmos de las constantes de formacinn de los hidroxocomplejos de Ni((II)),, en el sistema H++ -- Ni((II)),, obtenidas en NaCl 11,,00 M a 2255C.. ReaccinnLogbpqr--99,,44((11))--1166,,9944((44))--2277,,7733((33))Dispersinns((ZB))00,,00009966 Tabla II.. Valores de pKa,, para el sistema H++ -- cido picolnico,, en NaCl 11,,00 M a 2255C.. ReaccinnpKa11,,7777((44))55,,2244((55))Dispersinns((ZC))00,,003333 Tabla III.. Valores depKa,, para el sistema H++ -- cido dipicolnico,, en NaCl 11,,00 M a 2255C.. ReaccinnpKa22,,2299 ((22))44,,4411((22))Dispersinns((ZC))00,,001188 Tabla IV.. Complejos obtenidos en el sistema H++ -- Ni((II)) -- cido picolnico con sus logaritmos de las constantes de formacinn,, en NaCl 11,,00 M a 2255C.. ReaccinnLogbpqr11,,5599((55))11,,3300((77))11,,5599((55))11,,2266 ((77))22,,1122((55))11,,9911((55))22,,1122((55))11,,9977((55))11,,4477((66))11,,33((11))11,,4477((66))11,,33((11))Dispersinn ((s))00,,00449900,,00225500,,00449900,,002288 Tabla V.. Complejos obtenidos en el sistema H++ -- Ni((II)) -- cido dipicolnico con sus logaritmos de las constantes de formacinn,, en NaCl 11,,00 M a 2255C.. ReaccinnLogbpqr11,,1166((77))11,,3311((55))11,,4499((66))11,,3322((66))11,,44((11))11,,77((11))22,,11 ((11))11,,77((11))Dispersinn ((s))00,,00447700,,00334400,,00557700,,003377','2010-10-19','{}',6,1,1,1,1,'2013-09-17 08:34:43','2013-09-17 08:34:43','Documento_462.pdf','application/pdf',962909,'2013-09-17 08:34:43',19,0,74,'COMPLETO'),(461,'Simulacinn de galaxia mediante autmmatas celulares','Existen diversos mtodos y herramientas matemticas utilizadas para modelar estructurasgalcticas, sin embargo, la mayora de dichos modelos no incluyen al mismo tiempo lacinemtica galctica y los procesos evolutivos dentro de la galaxia, tales como los inherentesa la evolucin estelar. Se propone un modelo que simule ambos efectos utilizando para elloun autmata celular. Dicho modelo considera los procesos de formacin estelar desarrolladospor Mueller & Arnett (1976) junto con los mecanismos de evolucin estelar propuestos porLejeune & Perdang (1996). Al considerar unicamente procesos de formacin estelar, el modelopropuesto genera patrones espirales caractersticos de las galaxias de tipo espiral. A medidaque se introducen los elementos caractersticos de los procesos de evolucin estelar, se observala necesidad de otro(s) mecanismo(s) para que los patrones espirales permanezcan invariables,morfologicamente hablando, durante largos perodos de tiempo. Se observa adems que los procesosde formacin estelar son auto-sostenidos por los procesos de evolucin estelar: la expulsinde gas de una estrella a su entorno, permite la inicializacin de nuevos procesos de formacinestelar, sin necesidad de que se introduzca gas mediante fuentes externas. El modelo propuestopresenta caractersticas propias de un sistema dinmico complejo','2010-10-29','Galaxias Evolucin estelar Poblacin estelar Formacin estelar Autmatas celulares',3,1,1,1,1,'2013-09-17 08:34:45','2013-09-17 08:34:45','Documento_464.pdf','application/pdf',1799021,'2013-09-17 08:34:45',20,0,100,'COMPLETO'),(462,'Sistema de Gestinn de Puntos de Compromiso y Puntos de Aceptacinn para los Bancos afiliados a la Corporacinn Suiche 77B','El presente trabajo expone fundamentos conceptuales, metodolgicos y de implementacin que resumen la investigacin del Trabajo Especial de Grado realizado con el objetivo de desarrollar una aplicacin Web para la Corporacin Suiche 7B C.A. que permita el intercambio entre las diferentes instituciones bancarias de informacin asociada a posibles fraudes en operaciones con tarjetas de crdito y dbito. La aplicacin en cuestin permitir la deteccin de los Puntos de Compromiso (PDC) y Puntos de Aceptacin (PDA) utilizados en acciones de fraude, como parte de una nueva estrategia de cooperacin interbancaria que ayude a combatir la copia y uso ilegal de tarjetas de dbito y crdito a los usuarios de las instituciones bancarias del pas. Para alcanzar estos objetivos se aplic una metodologa basado en la adaptacin de XP (Programacin Extrema), detallando las fases de Planificacin, Diseo, Codificacin y Pruebas para cada una de las iteraciones que se dividi el desarrollo de la aplicacin Web. Se obtuvo como resultado una aplicacin Web para el manejo del personal de las diferentes comisiones de Fraude de las instituciones bancarias as como para el personal de la Gerencia de Operaciones de la Corporacin Suiche 7B, convirtindose as, en la primera aplicacin en el pas para tal fin.','2010-10-28','Sistema de Gestin de Puntos de Compromiso y Puntos de Aceptacin (SIPCA), Punto de Compromiso (PDC), Punto de Aceptacin (PDA), Clonacin, Cajero Automtico (ATM), Punto de Venta (POS), Score.',2,1,1,1,1,'2013-09-17 08:34:46','2013-09-17 08:34:46','Documento_465.pdf','application/pdf',2209340,'2013-09-17 08:34:46',20,0,131,'COMPLETO'),(463,'Estudio electrocintico del cido saliclico','En el presente trabajo se realiz el estudio electrocintico del cido saliclico empleando las tcnicas de voltamperometra cclica, voltamperometra lineal normal e hidrodinmica, cronocoulombimetra, cronoamperometra y cronopotenciometra. Obteniendo como resultados que el compuesto presenta un comportamiento electroqumico lento, caracterstica de un sistema cuasi- reversible, correspondiente a la reduccin del grupo carboxlico mediante un mecanismo de reaccin eC, y presentando un cambio de mecanismo de transferencia a difusin a partir de 100 mV/s. Los parmetros electroqumicos determinados se presentan a continuacin. Parmetro Valor ko mxima (Pt) (1/s) 0,014 ko altas v.de barrido (Pt) (1/s) 0,005 L (Pt) 4,2 a 0,9 ared (Pt) 0,59 aox (Pt) 0,39 Dred (KCl 0,5 M)(cm2/s) 6,98 x 10-6 Dred (DMFA) (LiClO4 0,5 M) (cm2/s) 2,15 x 10-5 n 1 Io (A) 2,73 x 10-6','2010-10-20','electrocintica, cido saliclico, voltamperometra, velocidad de transferencia electrnica, coeficiente de difusin.',6,1,1,1,1,'2013-09-17 08:34:54','2013-09-17 08:34:54','Documento_466.pdf','application/pdf',2294877,'2013-09-17 08:34:54',20,0,102,'COMPLETO'),(464,'ESTUDIOS DE LOS COMPLEJOS DE VANADIO ((IV)) Y ((V)) CON PROLINA POR MEDIO DE MEDIDAS DE FUERZAS ELECTROMOTRICES ((KCl 33,,00 M,, 2255 C))','En este trabajo se estudiaron los siguientes sistemas por medio de medidas de fuerzas electromotrices en el medio inico KCl 3,0 M y a 25C:  H+ - prolina H+ - V(IV) - prolina H+ - V(V) - prolina Sistema H++ -- prolina Los valores de pKaobtenidos son los siguientes: Especie pKa H2C+ 2,34(1) C- 11,12 (1) s(thc) 0,0139 Sistema H++ -- V((IV)) -- prolina Las constantes de estabilidad de este sistema fueron determinadas segn la siguiente reaccin global: p H+ + q VO2+ + r C- <-> Hp (VO)qCrp+2q-r Complejo p,,q,,r --log bpqr [H2VOC2]+2 2,1,2 24,8(2) 25,03(3) 21,89(6) 25,01(4) 25,22(3) [HVOC2]+ 1,1,2 21,46(4) 21,49(3) 21,42(2) 21,44(2) 21,50(1) [HVOC]+ 1,1,1 12,93(4) 12,76(2) 12,83(3) 12,80(3) 12,79(2) [VOC]+ 0,1,1 7,4(<7,8) 6,9(<7,6) <7,5 <7,4 6,8(<7,3) [(OH)VOC2]- 1,1,2 11,21(3) 11,28(1) 11,26(8) 11,32(6) 11,46(4) s((thC)) 0.012 - - - - s((thCf)) - 0.034 - - - s((thB)) - - 0.0344 - - s((thBf)) - - - 0.029 - s((thE)) - - - - 1.2 mV Sistema H++ -- V((V)) -- prolina Las constantes de estabilidad de este sistema fueron determinadas segn la siguiente reaccin global: p H+ + VO2+ + r C- <-> Hp(VO2)(C)rp-1 Complejo p,,q,,r --logbpqr [H2VO2C2]+ 2,1,2 26,55 (9) 26,3(1) 26,71(2) HVO2C2 1,1,2 24,15(6) 24,13(4) 24,31(9) [HVO2C]+ 1,1,1 12,9(1) 13.22(7) 13,2(<13,6) VO2C 0,1,1 10(<10.4) 10,4(2) 10,58(2) s((thC)) 0,016 - - s((thB)) - 0,060 - s((thE)) - - 4,9 mV','2010-10-19','vanadio, vanadio (IV), vanadio (V), aminoacido, prolina, medidas de fuerzas electromotrices, vanadilo (IV), vanadilo(IV), metavanadato, letagrop, medio ionico KCl 3,0 M',6,1,1,1,1,'2013-09-17 08:34:57','2013-09-17 08:34:57','Documento_467.pdf','application/pdf',2742346,'2013-09-17 08:34:57',19,0,124,'COMPLETO'),(465,'ESTUDIO DEL EFECTO DE LOS METALES,,EN LA ETAPA DE EXTRACCINN EN FASE SLLIDA DEL CCIDO FTTICO,,EMPLEANDO MUESTRAS SINTTTICAS QUE SIMULEN CEREALES INFANTILES..','RESUMENEl cido ftico (myo--inositol hexafosfato) es un compuesto natural encontrado en cantidades considerables en cereales y semillas de leguminosas, cuya principal funcin es almacenar fsforo como fuente de energa para las plantas. Posee la capacidad de establecer fuertes interacciones con minerales esenciales de nuestra nutricin, comprometiendo los niveles de stos en el organismo. Motivados por esta particularidad antinutricional, se han desarrollado numerosos mtodos para cuantificar el cido ftico, siendo los procedimientos cromatogrficos los ms comnmente empleados. Sin embargo, cuando las muestras contienen un alto contenido de metales, como es el caso de los cereales infantiles, se reportan valores de cido ftico por defecto, atribuidos al procedimiento del tratamiento de muestra, en especial, a la etapa de extraccin fase slida.Con la finalidad de estudiar el efecto de los metales en esta etapa de tratamiento de muestra, se realiz un estudio de la recuperacin del cido ftico para muestras sintticas con y sin metales (Fe y Ca), las cuales se midieron por espectrometra de absorcin molecular UV- Visible. Para las muestras sin metales el porcentaje de recuperacin estuvo en el orden del 75 %, y la prdida se atribuy fundamentalmente a la etapa de eliminacin del HCl. En cuanto a las muestras preparadas con calcio y hierro, se observ una disminucin de los porcentajes de recuperacin, obtenindose valores entre 57 y 69 %, que result ms evidente al estudiar el efecto combinado de ambos metales (38 %).Para corregir el efecto de los metales, se propuso emplear cido tricloroactico en vez de HCl, para simular la matriz de la muestra. Los resultados demostraron una mejora en los porcentajes de recuperacin (71 %), concluyendo entonces, que para el estudio de cereales, en especial los de consumo infantil, es recomendable extraer el cido ftico con cido tricloroactico, planteando una concentracin ptima de 0,3 M de dicho cido.','2010-10-19','cido ftico, metales, extraccin en fase slida, bajos porcentajes de recuperacin',6,1,1,1,1,'2013-09-17 08:34:58','2013-09-17 08:34:58','Documento_468.pdf','application/pdf',1613832,'2013-09-17 08:34:58',20,0,120,'COMPLETO'),(466,'Anlisis numrico del efecto de la Anisotropa de Superficie en Nanopartculas Ferromagnticas','En este trabajo hacemos un estudio numrico de los efectos de la anisotropa superficial en cantidades termodinmicas de nanopartculas ferromagnticas cbicas, representadas mediante un modelo mixto de Ising de espines S=0, 1. Se consideran interacciones de intercambio a primeros vecinos entre los espines, as como los efectos producidos por la anisotropa de superficie (KS) y de volumen (KV). Variamos el tamao de los nanocubos desde un Lo=4 espines por arista, donde la relacin superficie-volumen es mayor a uno (S//V>1), hasta Lmax=20 espines con S//V~=0.4, incluyendo un tamao intermedio Lu=10 espines, cuya relacin SS//V~=1. Usando el mtodo de Monte Carlo se generan configuraciones de importancia, para calcular la energa por sitio, magnetizacin, calor especfico y susceptibilidad magntica. Hemos logrado reproducir con este modelo sencillo, muchos de los comportamientos obtenidos por otros autores con el modelo de Heisenberg. En el caso de la nanopartcula de menor tamao, encontramos cambios importantes en el comportamiento de las cantidades termodinmicas estudiadas. Encontramos anomalas en las curvas de magnetizacin y susceptibilidad magntica caractersticas de sistemas nanoscpicos, las cuales se atribuyen al bajo nmero de coordinacin y la falta de compensacin de los espines de superficie. As mismo, mostramos que el ordenamiento ferromagntico o paramagntico del sistema depende del la relacin entre entre la anisotropa superficial y la interaccin de intercambio (Jnn). Encontramos que en el rango donde KS<<--Jnn se observan cambios en la temperatura crtica (Tc) del sistema, mientras que para KS>>--Jnn, Tc aumenta de manera no lineal.','2010-07-19','Anisotropa, Nanopartculas ferromagnticas, Monte Carlo',3,1,1,1,1,'2013-09-17 08:34:59','2013-09-17 08:34:59','Documento_469.pdf','application/pdf',4357072,'2013-09-17 08:34:59',19,0,346,'COMPLETO'),(467,'Estudio de los complejos de valencia mixta de V ((IV,, V)) con el cido asparticopor medio de medidas de fuerzas electromotrices ((2255 C,, KCl 33..00 M))','En el presente trabajo de investigacin se estudiaron los sistemas: H+ - cido asprtico (H2C) H+- V22O33++33- cido asprtico (H2C) Por medio de medidas de fuerzas electromotrices emf(H) a 25C y en KCl 3.0 M como medio inico inerte. El anlisis de los datos experimentales expresados de la forma de thc (-log h) y thcf(-log h)), donde thc es el nmero medio de iones H+ asociados por mol de ligando y thcf es el nmero medio de H+ asociados por mol de ligando restando la contribucin de la protonacin y desprotonacin del ligando, as como los productos de la hidrlisis del ion VO2+ (V(IV)), VO+2 (V(V)) y V2O3+3 (V (IV,V)) se realiz utilizando el programa de mnimos cuadrados generalizados LETAGROP, obtenindose los siguientes valores de pKa para el cido asprtico y las constantes de estabilidad de los complejos bPqr, segn las siguientes reacciones generales:  Sistema H++ -- cido asprtico reaccinn pKa H2C + H+ H3C+ 2.30(1) H2C HC- + H+ 3.89(1) H2C- C2- + 2H+ 9.86(2) s(thc) 0.016(1)  Sistema H++ --V22O33++33 -- cido asprtico ((H22C)) p H+ + q V22O33++33+ r L2- HP+1 ((V22O33)) (L)rp+1-2r [21] Especies pqr Log b*Pqr de la forma HP(V22O33++33)qLrP+q- r [H2(HV2O3)L]+4 3111 38,21(2) 38,22(2) 38,07(6) [H2V2O3L]+3 2111 ---------- - Max = 34,9 34,3 < 35,0 [HV2O3L]+2 1111 33,69(2) 33,71(2) 33,53(4) (V2O3L)+1 0111 30,18(9) 30,20(9) 30,28(8) OHV2O3L -1111 27,16(4) 27,21(4) 27,16(4) [OH2V2O3L]-1 -2111 22,7(1) 22,6(2) 22,72(8) [H2V2O3L2]+1 2112 45,8(2) 45,5(2) 45,7(1) [V2O3L2]-1 0112 38,7(2) 38,7(1) 38,8(1) s(thc) 0,022o s(thB) 0,0719 s E 1,093','2010-10-28','valencia mixta ,,cido aspartico',6,1,1,1,1,'2013-09-17 08:35:08','2013-09-17 08:35:08','Documento_470.pdf','application/pdf',2845866,'2013-09-17 08:35:08',18,0,110,'COMPLETO'),(468,'Estudio de los complejos de valencia mixta de V ((IV,,V))..SISTEMA V22O3333++--F-- ALANINA ((KCl 33..00 M,, 2255C))','En el presente trabajo se estudiaron los sistemas: H+ - F- alanina (HL) H+- V2O3 3+ - F-alanina por medio de medidas de fuerzas electromotrices emf(H) a 25C y en KCl 3.0 M como medio inico inerte. Se determinaron las constantes de acidez de la F-alanina y posteriormente las constantes de equilibrio del sistema H+- V2O3 3+ -F-alanina (HL) luego de representar los datos en trminos de las funciones de formacin thL (pH), thLf(pH) as como las correspondientes curvas calculadas suponiendo el modelo terico formado por las especies HV2O3L3+ H(HV2O3)L 4+, V2O3L2+, HV2O3L22+, OHV2O3 L2, (OH)2V2O3L, OHV2O3 L+, V2O3L2+. Los datos se analizaron empleando el programa de mnimos cuadrados generalizados LETAGROP, a continuacin se muestran tablas de los resultados encontrados as como las reacciones consideradas. Normal 0 false false false EN-US X-NONE X-NONE / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:10.0pt; font-family:\"Times New Roman\",\"serif\";}  Sistema H++ --F--alanina ((HL)) Reaccinn pKa H2L+ D HL + H+ 9.55 (1) HL D L - + H+ 2.54 (1) s(thL) 0.009  Sistema H++-- V22O3333++--F--alanina p H++ V2O33+ + s L- D HpV2O3Ls (p+3-s) Especies Log bp1s(3s) [HV2O3L]3+ 32.0 (1) 31.5 (< 31.8) 32.0 (2) [V2O3L]2+ 29.72 (4) 29.78 (5) 29.77 (5) [(OH)V2O3L]+ 26.2 (1) < 25.9 26.2 (2) (OH)2V2O3L 22.65 (7) 22.6 (1) 22.64 (7) [H(HV2O3)L]3+ 34.63 (3) 34.60 (3) 34.60 (8) [HV2O3L2]2+ 41.67 (5) 41.63 (7) 41.58 (6) [V2O3L2]+ 38.2 (1) 38.2 (2) 38.21 (9) (OH)V2O3L2 34.77 (5) 34.88 (6) 34.78 (3) s(thL) 0.022 s(thLf) 0.067 s(E) 1.6 mV','2010-10-28','Valencia mixta,,Vanadio,, fenilalanina',6,1,1,1,1,'2013-09-17 08:35:13','2013-09-17 08:35:13','Documento_471.pdf','application/pdf',832360,'2013-09-17 08:35:13',20,0,73,'COMPLETO'),(469,'Sistema Control de Solicitudes para Peticiones Tecnologicas por parte del Campus Universitario de la UCV','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} El Sistema de Control de Solicitudes (SCS) es un sistema informtico de tipo web portable de atencin al cliente para la administracin, control, coordinacin, organizacin y medicin de las solicitudes que recibe la DTIC en relacin a los servicios informticos que presta. Este sistema debe coordinar el ciclo de atencin de la solicitud desde su creacin hasta su cierre, controlando sus transiciones y organizando la informacin necesaria para su tratado. Esta estructura de Service Desk fue creada para la Direccin de Tecnologa Informacin y Comunicacin, de la Universidad Central de Venezuela y desarrollada bajo el concepto del decreto 3390 del gobierno nacional, que promueve el desarrollo de herramientas tecnolgicas bajo la utilizacin de tecnologas Open Source. Para implementar lo propuesto hasta el momento se har uso de SQL Server como Sistema Manejador de Base de Datos. De igual manera se utilizar como herramienta tecnolgica para el desarrollo de las interfaces web el lenguaje de programacin PHP 5. Por ultimo La aplicacin ser soportada bajo el servidor web APACHE.','2010-10-28','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:35:15','2013-09-17 08:35:15','Documento_472.pdf','application/pdf',2794077,'2013-09-17 08:35:15',18,0,77,'COMPLETO'),(470,'\"\"Determinacinn de los Niveles de Mercurio en la Orina de nioos en edad escolar de la Poblacinn de El Callao,, en La Zona Minera del Estado Bolvar Venezuela','El mercurio y sus compuestos presentan una alta toxicidad para los humanos y los efectos perjudiciales a la salud pueden ser de mayor magnitud para la poblacin infantil. En Venezuela la informacin sobre los niveles de mercurio en las zonas mineras es limitada y es importante para evaluar los posibles riesgos de la salud de estos nios, sobre todo en zonas de alta actividad minera como lo es la poblacin de El callao. En este estudio se seleccionaron nios en edades de 6 a 13 aos, los cuales habitan en zonas aledaas al pueblo de El Callao. Se encontraron valores de mercurio en la orina desde no detectable (menor a 0.2 g Hg/L, limite de detencin) hasta 167 g Hg/L y con respecto a la creatinina los valores estn comprendidos desde valores menores a 3.6 g Hg/g creatinina hasta valores 147 g Hg/g creatinina. Un 38% de Los valores de mercurio encontrados en las muestras de orina, son mayores que los valores referenciales para personas normales (no expuestas) dados por la OMS.','2010-07-09','MERCURIO',6,1,1,1,1,'2013-09-17 08:35:17','2013-09-17 08:35:17','Documento_473.pdf','application/pdf',664804,'2013-09-17 08:35:17',18,0,88,'COMPLETO'),(471,'EMPLEO DE LA TCCNICA DE DISPERSINN DE LUZ PARA ESTUDIAR LAS PROPIEDADES ESTRUCTURALES DE LOS AGREGADOS DE ASFALTENOS..','Los asfaltenos son una parte del crudo que tiene especial importancia debido a los problemas que ocasionan en todos los procesos de extraccin y refinacin del petrleo. A partir de mediciones de la intensidad dispersada por agregados de asfaltenos de crudos Furrial y Carabobo se pueden obtener las propiedades estructurales que sirvan para caracterizar y por ende ayudar a predecir el mecanismo de precipitacin de las partculas de asfaltenos durante todas las fases asociadas a la produccin del petrleo. El presente trabajo est orientado al estudio de las propiedades estructurales de dichos crudos, en soluciones tolueno-n-heptano, a partir de medidas realizadas mediante la tcnica de dispersin de luz. Las diferencias obtenidas con respectos a cada uno de los crudos sirven para comparar las caractersticas de crudos inestables, que tienden a precipitar, como Furrial, con crudos estables, como es el caso de Carabobo. Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle- rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style- priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para- margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Se encontraron diferencias en las medidas de intensidad de luz realizadas para las distintas soluciones de cada asfalteno. En Carabobo se observa que la intensidad medida es independiente de la concentracin de la solucin. Caso contrario se observa en Furrial, donde al comparar las medidas de intensidad para varias soluciones de distinta concentracin, se observan un decaimiento conforme disminuye la concentracin. Para ambos tipos de asfaltenos se observa un decaimiento de la intensidad medida conforme aumenta el vector q, el cual est directamente relacionado con el ngulo de dispersin. La dimensin fractal fue estimada para ambos, dando para Carabobo df>2 y para Furrial df<2, lo que corresponde a mecanismos de agregacin limitados por reaccin RLCA y por difusin DLCA respectivamente. El mecanismo RLCA que rige la formacin de los agregados de asfalteno Carabobo explica la estabilidad de ste crudo. Lo contrario aplica para asfaltenos Furrial, donde el mecanismo DLCA explica la inestabilidad de ste crudo. Adems de esto, la dimensin fractal en el caso de Carabobo sugiere una estructura densa y ms ordenada que para los agregados de Furrial, cuya dimensin fractal indica agregados de superficie y menos compactos. En cuanto a los radios de giro calculados para los agregados formados en cada caso, se observa que para Carabobo se tienen estructuras de un tamao menor que para el caso de Furrial. En ambos casos los agregados estn alrededor de los 2000nm, pero en Furrial se observan tamaos mayores debidos posiblemente a que el mecanismo RLCA permite la incorporacin de un mayor nmero de partculas al agregado y por lo tanto la extensin de ste aumenta con respecto a los agregados de Carabobo. Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle- rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style- priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para- margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Si bien, el diagrama de Zimm fue realizado, no pudo estimarse del peso molecular de los agregados por problemas asociados al equipo. Sin embargo, de los datos obtenidos se infiere que para Furrial el peso molecular de los agregados es mayor que para los agregados de Carabobo, lo que sugiere que la estructura de los agregados inestables se encuentra formada por un mayor nmero de partculas. Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom: 10.0pt; mso-para-margin-left:0cm; line-height:115%; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;}','2010-10-25','asfaltenos, estructura, crudo inestable, crudo estable, factor de estructura, radio de giro, dimensin fractal, diagrama de Zimm',6,1,1,1,1,'2013-09-17 08:35:18','2013-09-17 08:35:18','Documento_474.pdf','application/pdf',3510648,'2013-09-17 08:35:18',18,0,145,'COMPLETO'),(472,'Escner 33D de Bajo Costo empleando Webcams','En este trabajo se aplican conceptos y mtodos relativos al procesamiento digital de imgenes y la computacin grfica en la construccin de un escner 3D de bajo costo que emplea 2 webcams, y que sea capaz de realizar la reconstruccin 3D de la geometra de un objeto. Para ello, se aplican tcnicas para la obtencin de puntos caractersticos que definan la estructura del objeto y se realiza la calibracin de las cmaras empleadas, con el fin de obtener los parmetros que definen las propiedades de ellas y su ubicacin con respecto a un sistema de coordenadas global.La reconstruccin de un objeto se realiza utilizando dos cmaras web, separadas una cierta distancia horizontal entre s, con las cuales se obtienen dos fotos de una misma escena desde puntos de vista diferentes. A partir de estas imgenes, y de los parmetros obtenidos en la calibracin, es posible determinar las coordenadas X,Y,Z de cada uno de los puntos que definan la estructura del objeto en cuestin. Este trabajo pretende crear un prototipo de software y hardware que permita obtener la reconstruccin tridimensional de un objeto, esta informacin puede ser empleada, posteriormente, para construir modelos de estudios, con fines recreativos, culturales, mdicos, entre otros.','2010-10-19','reconstruccin 3D, visin estereoscpica, calibracin de cmaras, triangulacin de delaunay',2,1,1,1,1,'2013-09-17 08:35:21','2013-09-17 08:35:21','Documento_475.pdf','application/pdf',6156531,'2013-09-17 08:35:21',20,0,126,'COMPLETO'),(473,'MODELO FISICOQUMMICO EN DOS DIMENSIONES DE LA DIFUSINN DEL INN Ca 22++ EN UN MIOCITO ESQUELTTICO..','Resumen Cuando una clula de msculo esqueltico (ME) est expuesta a un determinado estmulo externo (fsico, qumico o elctrico) ocurre a una elevacin transitorial del nivel de Ca2+ en el citosol y ello origina el acortamiento de la clula contrctil y luego, la recaptacin del in produce la relajacin celular. Diversos mecanismos participan en el proceso: canales de calcio dependientes de voltaje (canales de dihidropiridina, DHPR) que permiten la entrada de calcio extracelular cuando se produce despolarizacin del sarcolema (SL), canales del tipo \"sensor voltaje\", canales de Ryanodina (RyR) ubicados en la membrana del retculo sarcoplsmico (RS) que liberan Ca2+ hacia el citosol por diversos mecanismos, protenas buffers que se unen al calcio quelndolo transitoriamente y haciendo su difusin ms lenta, bombas que sacan Ca2+ del citosol, bien hacia depsitos intracelulares como el RS (SERCA) o hacia el medio extracelular (PMCA), intercambiadores del SL y de la membrana mitocondrial, entre otros. El RS es el principal almacn de calcio intracelular en el msculo estriado y participa de forma determinante en la regulacin del proceso acoplamiento-excitacin-contraccin (AEC), regulando las concentraciones intracelulares de calcio durante la contraccin y la relajacin muscular. En este trabajo se model la dinmica correspondiente a la evolucin de la concentracin c(x,y,t) del in calcio en el espacio confinado que existe entre las membranas del RS y el sarcolema (\"junctional space\", \"cleft space\") de una clula de msculo esqueltico, el modelaje se hizo en dos dimensiones y se fundament en la ecuacin de difusin-reaccin (D-R) considerando diversas fuentes (liberacin impulsiva a travs de pocos receptores de RyR y flujos de fuga compensatorios) y sumideros (SERCA, PMCA) y la amortiguacin del Ca2+ por la parvoalbmina. Al resolver numricamente (ya que no tiene solucin analtica) la ecuacin de D-R (a la cual se le se le impuso la condicin de borde homognea de Neumann) mediante el paquete computacional COMSOL Multiphysics3.4  basado en Elementos Finitos se obtuvo la c(x,y,t) en funcin de la posicin para diversos instantes de tiempo y c(x,y,t) en funcin del tiempo para diversas locaciones del dominio, con liberaciones simultneas o no de tres receptores de RyR .','2010-10-28','palabras claves:: msculo esqueltico, miocito, in calcio, difusin-reaccin, elementos finitos, COMSOL, receptores de RyR.',6,1,1,1,1,'2013-09-17 08:35:34','2013-09-17 08:35:34','Documento_476.pdf','application/pdf',1801166,'2013-09-17 08:35:34',20,0,125,'COMPLETO'),(474,'Desarrollo de adsorbentes de carbn para purificacin de corrientes de refinera','Preparacin de carbn a partir de coque de petrleo con el obejtivo de eliminar molculas de azufre y nitrgeno, que son consideradas contaminantes, las cuales se encuentran presentes en corrientes de refinera provenientes del proceso de craqueo catalitico de lecho fluidizado.','2010-10-07','Adsorbentes, carbn activado, coque de petrleo, craqueo cataltico en lecho fluidizado, regulaciones ambientales (TIER II y Euro 5 y 6).',6,1,1,1,1,'2013-09-17 08:35:35','2013-09-17 08:35:35','Documento_479.pdf','application/pdf',5917410,'2013-09-17 08:35:35',20,0,53,'COMPLETO');
INSERT INTO `documento` VALUES (475,'optimizacinn de los componentes de una formulacinn lcali,, surfactante y polmero ((asp)) con potencial empleo en recuperacinn mejorada de un crudo del occidente del pas','Este trabajo contiene los resultados obtenidos en las pruebas de emulsificacin espontnea de los sistemas ASP. El objetivo de esta investigacin, es definir la concentracin ptima de lcali, surfactante y polmero, con potencial empleo en la recuperacin mejorada de crudo en un yacimiento al occidente del pas. Para dar cumplimiento al objetivo planteado, se realizaron pruebas de comportamiento de fase a 55C, temperatura de yacimiento, de sistemas crudo, lcali, surfactante, y polmero, observando el intervalo de concentracin donde se produce la zona de emulsificacin espontnea de la fase acuosa. Los resultados evidenciaron que la concentracin ptima de lcali fue 10000 ppm, surfactante 696 ppm y polmero 2100 ppm, con valores de tensin interfacial crudo/agua de 0,002 mN/m, un valor ultra bajo ideal para establecer condiciones propicias que contribuyan al incremento del recobro de petrleo por el aumento de la evidencia de barrido de crudo en el medio poroso. Para validar las propiedades de esta formulacin ASP, se realizaron pruebas de desplazamiento con ncleos de berea bajo condiciones sucedneas de yacimiento (temperatura, presin, permeabilidad, porosidad y fluidos acuosos y oleico). La recuperacin total de crudo promedio fue de 72,32% con respecto al POES, lo que evidenci una adecuada eficiencia para la recuperacin de petrleo, logrando disminuir la saturacin de petrleo residual en el medio poroso. Este comportamiento fue debido a la sinergia fisicoqumica de los componentes de la mezcla ASP, las tensiones interfaciales ultra bajas del agua - petrleo y por la favorable relacin de movilidad causada con el incremento de la viscosidad de la fase acuosa desplazante. Finalmente, se evalu la adsorcin de los componentes de la frmula en el medio poroso en las pruebas de desplazamiento analizando los efluentes obtenidos. Se obtuvieron valores de retencin de los componentes ASP en la roca y no se evidenci problemas de incompatibilidad en los fluidos inyectados en la roca, esto contribuy a definir la proporcin final de los componentes de la formulacin ASP. Las pruebas de adsorcin de los componentes de la frmula en el medio poroso mostraron que un 33,45 %m/m de lcali, 34,98 %m/m del polmero y 20,86 %m/m se adsorbieron en la berea. Por otra parte, el 61,16 %m/m del surfactante migr hacia el seno del crudo.','2010-10-28','Recuperacin mejorada de crudo.Surfactante, lcali y polmero (ASP). Factor de recobro de crudo',6,1,1,1,1,'2013-09-17 08:35:37','2013-09-17 08:35:37','Documento_481.pdf','application/pdf',544776,'2013-09-17 08:35:37',19,0,87,'COMPLETO'),(476,'DISTRIBUCINN ESPACIAL Y VARIACINN ESTACIONAL DEL CONTENIDO DE LOS METALES PESADOS:: Cd,, Cr,, Cu,, Hg,, Ni,, Y Pb EN AGUAS Y PECES DEL LAGO DE VALENCIA','El Lago de Valencia, situado en Venezuela entre los estados Aragua y Carabobo, se encuentra entre las ciudades de Valencia y Maracay, importantes centros urbanos e industriales de elevado crecimiento en las ltimas dcadas. Las aguas residuales y desechos provenientes de las actividades domsticas, industriales y agrcolas de la zona, llegan al lago mediante sus efluentes y las escorrentas y atentan contra la calidad de las aguas del lago y la biota que contiene. Los estudios ms importantes realizados en la zona, que datan de finales de los aos 80\'s (Mogolln [28]), sealaron el enriquecimiento de los sedimentos de fondo del lago con los metales Zn, Cu, Pb y Cr, y pocos estudios aportan informacin sobre el contenido de trazas de metales pesados, disueltos en sus aguas y presentes en la biota, debido a limitaciones de la sensibilidad de las tcnicas analticas empleadas. En este trabajo se analiz el contenido de trazas metlicas de Cd, Cr, Cu, Ni Hg y Pb disueltas en las aguas y tejido de peces capturados en el Lago de Valencia, durante el semestre noviembre 2009-mayo 2010. Asimismo,se estudiaron las variaciones espaciales y estacionales en la composicin de dichas muestras durante el ao 2009-2010, dando continuidad al trabajo de Palma [11], y al proyecto CDCH-PG-03-00-6495-2006. El anlisis qumico se realiz mediante ETAAS y CV-AFS, y la data obtenida fue analizada empleando anlisis de agrupamiento y de correlaciones mltiples Los resultados mostraron que el contenido de los metales disueltos en las aguas, no supera los valores mximos especificados en la norma EPA [8] para aguas dulces, y en los decretos nacionales 3.219 [24]y 883 [40], por lo que son aptas para el uso de riego y recreacin contemplados en estas normativas, que las clasifican como aguas Tipo 2, Sub-tipo 2B. Por otra parte, la concentracin de los metales mostr variaciones estacionales, observndose una disminucin de la concentracin de todos los elementos desde el mes de junio 2009, atribuyndose al incremento del pH que ocurre en la poca de lluvias. Tambin se determin que la concentracin de los metales disueltos en las aguas del lago, muestra homogeneidad espacial, entre estaciones de muestreo y dentro de la columna de agua, a consecuencia del continuo mezclado de las aguas. Este mezclado es casi total para el mes de enero. El promedio anual de las concentraciones de los metales disueltos en las aguas del Lago de Valencia fueron las siguientes: Cd 0,06 mg L-1, Cr 0,86 mg L-1, Cu 0,57 mg L-1, Hg 0,08 mg L-1, Ni 1,96 mg L-1y Pb 1,18 mg L-1. Las correlaciones significativas obtenidas entre el Pb con el Cd, Cu, Ni y Hg, indicaran su introduccin conjunta al cuerpo de agua mediante una fuente y vehculo comn. Las principales actividades antrpicas que aportan estos metales son de tipo agrcola (empleo de fertilizantes y pesticidas) e industriales (metalrgicas, bateras y uso de gasolinas) las cuales se desarrollan en la zona y cuyos desechos llegan al lago mediante los principales tributarios: ros Cao Central y Los Guayos al oeste, Gige al sur, Guey y Tipitapa al este, y Guacara y Mariara al norte. Por otra parte, la concentracin de los metales en el hgado de peces fue superior que en el msculo, donde las concentraciones de Cd y Cu no superaron los valores mximos permitidos contenidos en las normas COVENIN 1087 [25] y 1766 [26] y en el Codex Alimentarius [27], y las de Cr y Ni no pudieron compararse, ya que no estn especificadas en dichas normas. Sin embargo, las concentraciones de Hg obtenidas en msculo (0,25-0,39 mg Kg-1), sobrepasaron el valor mximo permitido por la norma COVENIN 1087 (0,10 mg Kg-1), y las de Pb (1,1-1,7 mg Kg- 1) sobrepasaron el valor mximo establecido en el Codex Alimentarius (0,3 mg Kg-1), as como los indicios de bioacumulacin de Hg y Cr, determinados en algunos ejemplares de peces, de acuerdo al factor de bioacumulacin (FBC), muestran que el consumo de los peces del Lago de Valencia representa un riesgo para la salud humana. Las diferencias entre los patrones de agrupamiento y correlaciones obtenidas en el msculo e hgado de peces, y en el agua, sugiere que el principal aporte de los elementos en la dieta de estos peces depredadores, no es el agua, sino el zooplancton y los sedimentos suspendidos en el agua.','2010-10-28','Lago de Valencia, Metales Pesados, Quimica ambiental, Qumica de aguas, metales pesados en aguas y peces',6,1,1,1,1,'2013-09-17 08:35:39','2013-09-17 08:35:39','Documento_482.pdf','application/pdf',14557304,'2013-09-17 08:35:39',19,0,207,'COMPLETO'),(477,'CAMBIOS EN EL CARBONO DEL SUELO LUEGO DE LA AFORESTACINN CONAcacia mangium,, EN UNA SABANA VENEZOLANA..','Con la finalidad de incrementar las tasas de circulacin del CO2 desde la atmsfera hasta los sumideros terrestres, en el protocolo de Kyoto se sugieren tres lneas estratgicas de mitigacin: 1) Incremento y mantenimiento de los niveles de carbono en los sistemas terrestres, mediante el manejo de tierras, la fertilizacin y evasin de la degradacin, 2) Incremento de las cantidades de carbono en reas bajo agricultura, con la creacin de sistemas agroforestales y 3) Mantenimiento e incremento de las reas boscosas, empleando tcnicas de reforestacin y aforestacin. El presente trabajo constituye una evaluacin a la puesta en prctica de la aforestacin como estrategia para la creacin de nuevos sumideros de carbono y aumento del potencial de secuestro de carbono en sabanas venezolanas. En el Edo. Anzoategui, la empresa Petropiar inici ensayos pilotos de bosques compensatorios de CO2 con el rbol leguminosa de origen australiano, Acacia mangium. El establecimiento de esta especie se ha hecho en reas de sabanas de Trachypogon spicatus y Aristida longifolia. Con el objetivo de determinar si las plantaciones de A. mangium han incrementado las cantidades de carbono presentes en un suelo de sabana, se evalu la contribucin de las fracciones de la materia orgnica del suelo al carbono total, la variacin en la actividad metablica de los suelos y la profundidad a la cual se registran cambios. Para ello se contrast una sabana de T.. spicatus con un rodal de A.. mangium de 10 aos de edad, ubicados adyacentes y separados entre s unos 200m. Se identificaron en cada zona tres estratos en el perfil del suelo (E1, E2 y E3) correspondientes a horizontes A, Bt1 y Bt2 de un Haplustox. Se tomaron 6 muestras compuestas en cada horizonte, para un total de 36 muestras (18 muestras por zona).Se encontr un aumento promedio de 43,01% del CT en el bosque correspondiente a una diferencia neta de 0,22 tonCOKg- 1ha-1. As mismo la cantidad de MOS present un promedio general (media ES) para el bosque de 3,60 0,34% y para la sabana de 2,60 0,41%, lo que representa un aumento de 38,46%. La biomasa de hojarasca en el bosque super en un 763,95% a la de la sabana (214,75gm-2 y 1855,34 gm-2, respectivamente).En cuanto a la contribucin de las diferentes formas del carbono al CT se encontr que el Cmic present la mayor variacin, con un 163,84%, seguido del CFP con un 50,39% de variacin siendo mayor en el bosque, mientras que las diferencias encontradas entre tipos de vegetacin en el CFL y el Csol, no fueron significativas. El flujo de CO2 medido como RE result mayor para la sabana (183,05 mgCO2m-2h-1) situando al bosque como menor emisor de este gas con efecto invernadero (123 mgCO2m-2h-1). La contribucin del metabolismo microbiano a este hecho fue descartada al no encontrar diferencias significativas entre la RB de las zonas. Por su parte, el qCO2 fue menor para el bosque sugiriendo mayor eficiencia en la mineralizacin del carbono y menores condiciones de estrs para los microorganismos.Los cambios a nivel nutricional se registraron en la concentracin de N (0,02%) equivalente a un aumento del 39,27% en el bosque, y Pdis (1,32 mgg-1) el cual es menor en el bosque en un 65,25%. De los parmetros fsicos, el cambio ms importante fue en el pH, con una disminucin promedio de 0,60 unidades en el bosque (de 4,46 en la sabana a 3,86 en el bosque).De los resultados se extrae que la aforestacin con Acacia mangium ha significado el aumento del potencial del secuestro de carbono, favorecindose a su vez la biomasa microbiana y el enriquecimiento de los suelos con nitrgeno, producto de la interaccin simbitica de esta leguminosa. Estos cambios han ocurrido sin que ello suponga un aumento en la emisin de CO2 del suelo y sugieren una mayor diferenciacin entre la sabana y el bosque en comparacin a la ltima evaluacin hecha al rodal en el 2006 por Petropiar. Por otra parte, la diminucin del pH y el aumento de la materia orgnica sugieren limitaciones en la disponibilidad de nutrientes, en especial del fsforo. Finalmente, los valores de MOS, CT y biomasa de la hojarasca presentados por la sabana testigo son superiores a la mayora de las sabanas de Trachypogon sp, en Venezuela, lo que sugiere que con la proteccin del fuego de estas sabanas, puede tambin aumentar su potencial de secuestro de carbono.','2010-06-29','aforestacin, sabanas, Acacia mangium, carbono del suelo, fracciones de la materia orgnica.',1,1,1,1,1,'2013-09-17 08:35:43','2013-09-17 08:35:43','Documento_483.pdf','application/pdf',905841,'2013-09-17 08:35:43',19,0,81,'COMPLETO'),(478,'Desarrollo de un Sistema de Monitoreo de Eletrocardiograma','En este trabajo se elabor un dispositivo para monitorear seales cardiacas mediante un circuito, una tarjeta de adquisicin y una computadora. Se emple LabVIEW para visualizar y procesar la seal obtenida obteniendo los intervalos RR.','2010-09-08','LabVIEW Ritmo Cardiaco Tarjeta de Adquisicin',3,1,1,1,1,'2013-09-17 08:35:45','2013-09-17 08:35:45','Documento_484.pdf','application/pdf',9806415,'2013-09-17 08:35:45',20,0,99,'COMPLETO'),(479,'Estudio de los Protocolos de Enrutamiento para Redes Malladas con Restricciones de Ancho de Banda en el Borde','La siguiente investigacin se bas en disear un testbed para estudiar distintos protocolos de enrutamiento para redes malladas, y as poder determinar cul de ellos podra ofrecer las mejores prestaciones para una red con diferentes nmeros de dispositivos y especificando diversos valores de ancho de banda, al brindarle a la misma acceso a Internet a travs de un cliente de la red que alcance la seal de un enrutador inalmbrico que se encuentre en una zona cercana y que cuente con dicho servicio. Dicha investigacin surge por la idea de utilizar la seal de enrutadores inalmbricos que se encuentren en urbanizaciones de Caracas para brindarle acceso a Internet a barrios aledaos, ya que muchos hogares en estas urbanizaciones, cuentan con este servicio y muchas veces sucede que la seal de los enrutadores inalmbricos es propagada ms all de la frontera del hogar de la persona que cuenta con este servicio y por lo tanto puede ser utilizada para brindar acceso a Internet a los usuarios en los barrrios aledaos via una red mallada. El desarrollo de una solucin como la descrita anteriormente debe comenzar por conocer que protocolo de enrutamiento podra ser el ms adecuado para este diseo de red, de otra forma podra conllevar a una red con un pobre rendimiento que no cumplira con los objetivos deseados. Para dicha investigacin se dise un testbed implementando la estructura de la red descrita anteriormente, donde todos los dispositivos trabajaban sobre una plataforma Linux (distribucin Ubuntu 10.04) y se hizo uso de diferentes protocolos de enrutamiento como OLSR, BATMAN y Babel (protocolos de enrutamiento proactivos para redes malladas) y herramientas como D-ITG (generador de trfico). Se plantearon diferentes escenarios donde variaban aspectos como nmeros de clientes y el ancho de banda disponible para la red mallada, y sobre ellos se realizaron diversas pruebas con el fin de determinar cul es el protocolo de enrutamiento que puede ofrecer las mejores prestaciones para el funcionamiento de una red mallada en las condiciones planteadas. Al analizar los resultados de las diversas mtricas de desempeo obtenidas se pudo determinar que el protocolo que mejor se adapta a las condiciones planteadas fue Babel.','2010-10-28','Redes malladas, Protocolos de enrutamiento, OLSR, Babel, BATMAN',2,1,1,1,1,'2013-09-17 08:35:50','2013-09-17 08:35:50','Documento_485.pdf','application/pdf',42232006,'2013-09-17 08:35:50',20,0,155,'COMPLETO'),(480,'Estudio de los Protocolos de Enrutamiento para Redes Malladas con Restricciones de Ancho de Banda','Mariana Colombo 14.00 Normal 0 21 false false false ES-VE X-NONE X-NONE / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin- bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso-pagination: widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii- font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi; mso-fareast-language:EN-US;} La siguiente investigacin se bas en disear un testbedpara estudiar distintos protocolos de enrutamiento para redes malladas, y as poder determinar cul de ellos podra ofrecer las mejores prestaciones para una red con diferentes nmeros de dispositivos y especificando diversos valores de ancho de banda, al brindarle a la misma acceso a Internet a travs de un cliente de la red que alcance la seal de un enrutador inalmbrico que se encuentre en una zona cercana y que cuente con dicho servicio. Dicha investigacin surge por la idea de utilizar la seal de enrutadores inalmbricos que se encuentren en urbanizaciones de Caracas para brindarle acceso a Internet a barrios aledaos, ya que muchos hogares en estas urbanizaciones, cuentan con este servicio y muchas veces sucede que la seal de los enrutadores inalmbricos es propagada ms all de la frontera del hogar de la persona que cuenta con este servicio y por lo tanto puede ser utilizada para brindar acceso a Internet a los usuarios en los barrrios aledaos via una red mallada. El desarrollo de una solucin como la descrita anteriormente debe comenzar por conocer que protocolo de enrutamiento podra ser el ms adecuado para este diseo de red, de otra forma podra conllevar a una red con un pobre rendimiento que no cumplira con los objetivos deseados. Para dicha investigacin se dise un testbedimplementando la estructura de la red descrita anteriormente, donde todos los dispositivos trabajaban sobre una plataforma Linux (distribucin Ubuntu 10.04) y se hizo uso de diferentes protocolos de enrutamiento como OLSR, BATMAN y Babel (protocolos de enrutamiento proactivos para redes malladas) y herramientas como D-ITG (generador de trfico). Se plantearon diferentes escenarios donde variaban aspectos como nmeros de clientes y el ancho de banda disponible para la red mallada, y sobre ellos se realizaron diversas pruebas con el fin de determinar cul es el protocolo de enrutamiento que puede ofrecer las mejores prestaciones para el funcionamiento de una red mallada en las condiciones planteadas. Al analizar los resultados de las diversas mtricas de desempeo obtenidas se pudo determinar que el protocolo que mejor se adapta a las condiciones planteadas fue Babel.','2010-10-28','Redes Malladas, Protocolos de Enrutamiento, OLSR, Babel, BATMAN.',2,1,1,1,1,'2013-09-17 08:35:56','2013-09-17 08:35:56','Documento_486.pdf','application/pdf',5092738,'2013-09-17 08:35:56',20,0,74,'COMPLETO'),(481,'ESTUDIO DE LOS COMPLEJOS DE VANADIO ((IV)) Y ARGININA POR MEDIO DE MEDIDAS DE FUERZAS ELECTROMOTRICES ((KCl 33..00 M,, 2255 C))','Se estudi mediante medidas de fuerzas electromotrices emf(H), la determinacin de las constantes de acidez del aminocido Arginina y la formacin de los complejos de vanadio (IV) con la arginina en solucin acuosa a 25 C y en KCl 3,0 M como medio inico inerte. En el anlisis de los datos potenciomtricos mediante el programa computacional LETAGROP, se obtuvieron los siguientes resultados de los valores de las constantes de acidez para la Arginina, pKa11 == 22,,3366 ((22)),, pKa22== 99,,7744 ((22)) y pKa33== 1122,,5566 ((22)) , e igualmente la formacin de cantidades significativas de los complejos con sus respectivas constantes de formacin: EspeciespqrLog bpqr ((33s))[H22VOC]++332 1 125.00 (3)[((OH))22VO((HC))]-1 1 110.3 <10.6[H44VOC22]44++4 1 2 48.7 (2)[H33VOC22]33++3 1 245.96 (3)[((OH))VO((HC))22]++1 1 236.06 (6)','2010-10-27','COMPLEJOS - VANADIO (IV) - ARGININA - AMINOACIDOS',6,1,1,1,1,'2013-09-17 08:35:57','2013-09-17 08:35:57','Documento_487.pdf','application/pdf',12060559,'2013-09-17 08:35:57',19,0,71,'COMPLETO'),(482,'EVALUACION DE NIVELES DE MERCURIO EN AGUAS,, SEDIMENTOS,, Y PECES EN EL RIO YURUARI,, EN LAS CERCANIAS DE EL CALLAO,, ESTADO BOLIVAR..','Dado que en la poblacin de El Callao se lleva a cabo la minera artesanal, para lo cual se utiliza el mercurio en el proceso de concentracin del oro, en este trabajo se plante como objetivo realizar una evaluacin de los niveles de mercurio en el sector del ro Yuruari cercano a la poblacin de El Callao; debido a que este ro es la principal fuente de abastecimiento de agua potable para sta poblacin. Se evalu la concentracin de mercurio en aguas, sedimentos y peces muestreados en Febrero y Marzo del 2010. La concentracin de mercurio en agua y sedimentos fue determinada por espectrometra de fluorescencia atmica con generacin de vapor y para las muestras de peces se utiliz la espectrometra absorcin atmica por vaporizacin trmica. Se obtuvieron lmites de deteccin de 0,004 ng/mL, 0,01g/Kg Y 0,005 g/Kg, para agua, sedimentos y peces respectivamente. Los resultados de los factores de recuperacin del mercurio para las muestras de agua, y sedimentos estuvieron dentro del rango aceptado, lo cual indica una buena exactitud de los mtodos utilizados. Para las muestras de agua se obtuvo una mediana de concentracin de 0,76  0,7 ng/mL de mercurio en un intervalo de 0,03 y 2,26 ng/mL, el valor de la mediana se encuentra por debajo de la concentracin permitida por los organismos nacionales e internacionales para aguas de consumo humano, la cual es de 1 ng/mL, para las muestras de sedimentos se obtuvo una mediana de concentracin de mercurio de 215 g/Kg, con un intervalo de concentraciones entre 74 y 691 g/Kg, cuyo valor se encuentra por encima de los valores de concentracin de fondo para la zona de El Callao que se encuentran entre 170 y 200 g/Kg. Para las muestras de peces, la mediana de la concentracin fue de 360 g/Kg, con intervalo de concentraciones entre 67 y 574 g/Kg, donde se observ que algunas muestras sobrepasaron el lmite de concentracin permitida para el consumo humano segn la EPA de 500 g/Kg.','2010-10-21','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',6,1,1,1,1,'2013-09-17 08:35:59','2013-09-17 08:35:59','Documento_488.pdf','application/pdf',3786672,'2013-09-17 08:35:59',20,0,93,'COMPLETO'),(483,'Aplicacinn de tcnicas nucleares sobre acuferos contaminados con gas natural','Integrantes del laboratorio de Fsica Nuclear de la Universidad Simn Bolvar, Caracas, Venezuela, han aplicado tcnicas nucleares para determinar las posibles causas de contaminacin por gases naturales en aguas de pozos pertenecientes a la localidad de Tascabaa, comunidad indgena ubicada en el Estado Anzotegui. Es importante destacar que bajo estos suelos se encuentra una de las mayores reservas de agua subterranea de Amrica Latina, por esto el grado de importancia que implica el identificar las posibles fuentes de contaminacin de estos pozos, para as, evitar daos mayores a ste acufero. A travs de medicionesin situ se obtuvieron mapas de la distribucin superficial de la radiactividad Gamma y de la concentracin de Radn en los gases del suelo. Para el anlisis Gamma espectromtrico se utiliz un espectrmetro Gamma de baja resolucin energtica con detector BGO. Para evaluar las concentraciones de Radn en los poros del suelo se realizaron mediciones instantneas utilizando Celdas Lucas acopladas al equipo Paylon AB-5. El caso que se describe forma parte de un conjunto de resultados experimentales que relacionan las anomalas superficiales del Potasio, Uranio y Radn con microfiltraciones desde los depsitos de hidrocarburos. El Radn-222 se utiliz como trazador natural radiactivo en el transporte de gases naturales a travs del suelo y para evaluar su posible particin en las aguas por la presencia de fases liquidas no acuosas (NAPLs), mientras que la espectrometra Gamma sirvi como indicador de cambios geoqumicos superficiales inducidos por la migracin de hidrocarburos hasta la superficie. Los resultados obtenidos muestran zonas con comportamientos anmalos de las variables estudiadas indicando la(s) posible(s) fuente(s) de contaminacin. Se destacan dos zonas anmalas, una desde el pozo petrolero y otra desde un sitio prximo a las emanaciones en el ro, que se orientan con valores decrecientes en las variables medidas haca los sitios donde estn los pozos de agua contaminados, pareciendo indicar la pluma contaminante. No obstante, para una mejor interpretacin los resultados deben integrarse a la informacin regional, que comprende datos como la geologa, topografa, hidrologa superficial y el sistema de fracturas y fallas','2010-10-27','Potasio, Uranio, Radn, radiactividad, espectrometra gamma, geofsica, geoqumica, gas natural, hidrocarburos, acuferos.',3,1,1,1,1,'2013-09-17 08:36:00','2013-09-17 08:36:00','Documento_489.pdf','application/pdf',876861,'2013-09-17 08:36:00',19,0,51,'COMPLETO'),(484,'CONTROL DE MICROORGANISMOS PATGENOS Y DETERIORATIVOS EN NARANJA (Citrus sinensis L.) Y MANGO (Mangifera indica L.) FRESCOS CORTADOS USANDO SUSTANCIAS ANTIMICROBIANAS NATURALES.','La demanda de alimentos sanos como las frutas y hortalizas frescas cortadas por parte del consumidor es cada vez mayor, debido a un aumento en la promocin del consumo de estos alimentos como parte de una dieta sana. La industria de alimentos ha respondido a dicha demanda elaborando productos frescos sometidos a un mnimo proceso que limite el crecimiento de los microorganismos y que mantenga los atributos nutricionales y sensoriales. No obstante, un manejo inadecuado de estos alimentos durante su procesamiento podra traer como consecuencia la presencia de microorganismos patgenos como Salmonella y E.. coli.. Por tal motivo el objetivo principal de esta investigacin fue evaluar la efectividad de sustancias antimicrobianas de origen de plantas como una alternativa para reducir los niveles de Salmonella entrica serv. Saintpaul y Escherichia coliO157:H7 en naranja variedad \"Valencia\" y mango variedad \"Haden\" frescos cortados. Para esto, se determinaron las concentraciones mnimas inhibitorias (CMI) de Ginseng, Ginkgo biloba, Extracto de semillas y cscaras de uvas roja y Aloe vera por el mtodo de discos de papel de filtro. De estas sustancias seleccionamos Ginseng por su mayor efectividad y lo aplicamos solo o en combinacin con cidos orgnicos (ctrico o mlico), una sal (sorbato de potasio) y lactato de calcio mediante un diseo factorial de mltiples niveles (2 x 2 x 2 x 4 x 2 x 2) a naranjas y mangos de madurez intermedia mediante tratamientos de inmersin por 1 a 2 minutos. La aplicacin de una combinacin de todos los compuestos tuvo un efecto sinrgico en la reduccin de la poblacin de los patgenos en ambas frutas, siendo las combinaciones ideales en naranja (mximas reducciones de 2,99 Log UFC/g Salmonella y 1,56 Log UFC/g E.. coli): Ginseng 3%, c. Mlico 1% y sin la adicin de sorbato y lactato, mientras que en mango (mximas reducciones de 2,1 Log UFC/g Salmonella y 2,0 Log UFC/g E.. coli) fue Ginseng 3%, c. Mlico 1%, sorbato 0,05% y lactato 0,75%. Adems estas combinaciones de sustancias causaron una disminucin en el crecimiento de la flora nativa, extendiendo la vida til desde un punto de vista microbiolgico. Sin embargo, algunas caractersticas fsicas, qumicas y sensoriales de las frutas fueron afectadas levemente. Con los resultados obtenidos se puede considerar que el uso de compuestos de origen vegetal solos o combinados resulta efectivo para reducir los niveles de microorganismos patgenos y deteriorativos en frutas frescas cortadas, logrando extender su vida til.','2010-10-27','Frutas frescas cortadas, Salmonella, Escherichia coliO157:H7, antimicrobianos',1,1,1,1,1,'2013-09-17 08:36:01','2013-09-17 08:36:01','Documento_490.pdf','application/pdf',1228462,'2013-09-17 08:36:01',20,0,119,'COMPLETO'),(485,'Propuesta para la Implementacinn de un Servicio de Hilos Musicales utilizando IPv66 Multicast','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} El objetivo del presente Trabajo Especial de Grado consiste en investigar los requerimientos necesarios para habilitar un Servicio de Hilos Musicales sobre IPv6 Multicast para la Universidad Central de Venezuela. Esta investigacin se basa en el estudio de la tecnologa Multicast, la infraestructura y configuracin necesaria para este tipo de servicios en un entorno IPv6. El trabajo empieza con un proceso de investigacin de la tecnologa Multicast, que contempla su origen, evolucin e interaccin con los nuevos estndares de comunicacin IP. Posteriormente, en base a dicha investigacin, se propone una infraestructura de red que abarca protocolos, estndares, tecnologas y equipos necesarios para implementar un servicio de Hilos Musicales sobre IPv6 Multicast. El protocolo de enrutamiento multicast ha utilizar es PIM-SM, debido a que es uno de los protocolos ms utilizados en este tipo de ambientes, definido formalmente en un RFC y adoptado por las principales compaas fabricantes de dispositivos de red. Por otra parte, para el servicio de difusin de los hilos musicales, y tras una investigacin de las aplicaciones disponibles, se utiliz Microsoft Windows Media Service 9 como servidor de streaming debido a un conjunto de caractersticas importantes, tales como soporte de formatos de audio ampliamente desplegados en Internet, fcil instalacin y administracin, soporte IPv6 y Multicast, entre otros. Finalmente, este trabajo provee, adems de una propuesta para un Servicio de Hilos Musicales para la UCV, una implementacin del servicio para la Facultad de Ciencias.','2010-07-07','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:36:04','2013-09-17 08:36:04','Documento_491.pdf','application/pdf',0,'2013-09-17 08:36:04',20,0,0,'INCOMPLETO'),(486,'\"\"DETERMINACINN DE LOS NIVELES DE HIERRO,, ZINC Y COBRE EN NIOOS EN EDAD ESCOLAR,, EN LA POBLACINN DE EL CALLAO,, EDO.. BOLVVAR\"\"','El Fe, el Cu y el Zn son los oligoelementos ms abundantes en el organismo, se encuentran en concentraciones menores a 1 mg/mL en los tejidos corporales. Ellos son esenciales para el crecimiento ptimo y el desarrollo de los seres humanos. La carencia de los mismos es un criterio para el diagnostico de la desnutricin. La OMS menciona que la desnutricin puede ser un factor que intensifique los efectos txicos del mercurio, el cual es un elemento no esencia y absolutamente ajeno a cualquier funcin fisiolgica del ser humano, pero no reportan datos que los comprueben. El objetivo de este trabajo fue estudiar los niveles de Fe, Zn, Cu en el suero sanguneo de los nios la poblacin de El Callao Estado Bolvar, con la finalidad de evaluar su estado nutricional y estudiar su correlacin con los niveles de mercurio en sangre y orina. Para este propsito se utilizaron las tcnicas de espectrometra de emisin atmica con plasma inductivamente acoplado yespectrometra de absorcinn atmmica con llama.. Del mismo modo con la finalidad de caracterizar la poblacin en estudio se elabor y realiz una encuesta epidemiolgica, para recolectar informacin referente a la vida del nio, edad, sexo, hbitos alimenticios, profesin de los padres, entre otros. En este estudio se seleccionaron nios en edades de 6 a 13 aos y se tomaron las escuelas como elemento central para la recoleccin de las muestras. Se encontraron valores de Fe, Cu y Zn, en un rango de (0,48-1,19) mg/L, (0,67-1,15) mg/L, (0,84-1,19) mg/L respectivamente, los cuales se encuentran entre los valores reportados en la bibliografa. Del mismo modo se encontr que no existen correlacin estadsticamente significativa entre la concentracin de Fe, Cu y Zn la concentracin Hg en sangre y orina, para un nivel de confianza del 90%. En general se encontr que la poblacin infantil estudiada, la cual es una muestra representativa de la poblacin infantil del pueblo de El Callao, tiene una alimentacin balanceada, presenta talla y pesos normales para su edad y presentan caractersticas de una poblacin sana.','2010-07-12','Hierro, zinc, cobre, mercurio, nutricin',6,1,1,1,1,'2013-09-17 08:36:05','2013-09-17 08:36:05','Documento_492.pdf','application/pdf',2190524,'2013-09-17 08:36:05',19,0,94,'COMPLETO'),(487,'Evaluacin de un cultivo de fresa (Fragaria x ananassaDuch.) afectado por manchas foliares ocasionadas porMycosphaerella fragariae ((Tul..)) Lindau ((anamorfo::Ramularia brunnea Peck..))','El cultivo de fresa se ha expandido por todo el mundo por su adaptabilidad y escasas exigencias; sin embargo, es afectado por variadas enfermedades de origen fngico. La ms frecuente es la mancha foliar comn o mancha prpura causada por Mycosphaerella fragariae(Ramularia brunnea) que produce manchas redondeadas de color prpura y centro necrtico en todos los rganos vegetativos de la planta. El objetivo del presente estudio fue registrar el avance de la mancha foliar comn y la presencia de compuestos fenlicos en un cultivo de fresa. Para esto se recolectaron muestras de fresa, cultivar Camino Real, en la Colonia Tovar y se determin la incidencia y severidad de la mancha prpura. Se prepararon cmaras hmedas y se extrajeron los compuestos fenlicos por medio de un macerado en metanol. Estos se analizaron por cromatografa en capa fina de slica gel y se cuantificaron por el mtodo de Folin-Ciocalteau. Se presentaron los primeros sntomas en la 5o semana del cultivo alcanzando la mxima incidencia (50-60%) en la 14oy mantenindose as hasta el final del estudio. La severidad promedio present valores entre 2,55 y 5,21% lo que clasifica al cultivar como de baja susceptibilidad. Ademas de R.. brunnease encontraron otros 9 patgenos foliares, destacndose por su frecuencia Phyllosticta fragariicola, Alternaria alternatay Colletotrichumspp. La concentracin de fenoles aument con la severidad de la enfermedad, siendo significativamente mayor en hojas con severidades mayores al 5% con respecto a hojas sanas, sin embargo no se hallaron compuestos nuevos en la cromatografa como respuesta a la infeccin.','2010-06-22','Fitopatologa, fresa, Fragaria x ananassa, mancha prpura, Mycosphaerella fragariae, fenoles',1,1,1,1,1,'2013-09-17 08:36:09','2013-09-17 08:36:09','Documento_493.pdf','application/pdf',1622475,'2013-09-17 08:36:09',19,0,75,'COMPLETO'),(488,'ESTUDIOS DE FORMACINN DE COMPLEJOS TERNARIOS ENTRE EL SISTEMA VANADIO ((III)) -- 22,,22--BIPIRIDINA Y LOS AMINOCCIDOS PROLINA,, GLICINA,, a -- ALANINA Y b -- ALANINA A KCL 33M y 2255C..','En el presente trabajo se estudiaron los sistemas:H+ - 2,2-Bipiridina; H+ - Ha- Alanina; H+ - Hb-Alanina; H+ - HGlicina; H+ - HProlina y V(III)-2,2-bipiridina- a-alanina; V(III)-2,2-bipiridina-b-alanina; V(III)-2,2-bipiridina-glicina; V (III)-2,2-bipiridina-prolina; mediante medidas de fuerzas electromotrices emf (H) a 25C y en KCl 3.0 M como medio inico inerte. El anlisis de los datos experimentales de cada sistema se realiz mediante el programa de mnimos cuadrados LETAGROP, obtenindose los siguientes valores de pKa para los ligandos y las constantes de estabilidad bPqrde los complejos (P, q, r), segn las siguientes reacciones generales: Constantes de acidez (log bp,r) de los ligandos estudiados en KCl 3,0 M a 25C. EquilibrioH++-- 22,,22--bipilog bp00rH++--Ha-- Alalog bp00rH++--Hb--Alalog bp00rH++-- HGlilog bp00rH++--HProlog bp00rHL+H+ H2L+ 2.97(6)3.80(3)2.87(5)2.41(3)HL L-+H+ -9.90(6)- 10.18(3)-9.91(5)-10.88(9)L + H+ HL+5.16(3) Dispersin s (ZC)0.0160.0360.0250.0260.031N de titulaciones22222pKi pKa115.16(3)2.97 (6)3.80(3)2.87(5)2.41(3)pKa22 9.90(6)10.18(3)9.91(5)10.88(9) Valores entre parntesis representan las desviaciones estndar [3s(log b)] en la ltima cifra decimal Constantes de equilibrio del sistema ternario V(III)-2.2-bipiridina- a-alanina en KCl 3,0 M y 25C. ReaccinnLogbPqr V3+ + Bipi + 2HaAla + H2O V(Bipi)(OH)(aAla)2 + 3H+7,2(1)2V3+ + Bipi + HaAla + H2O V2O(Bipi)(aAla)3+ + 3H+16,66(8)2V3+ + 2Bipi + 2HaAla + H2O V2O(Bipi)2(aAla)22+ + 4H+21,96(9)V3+ + Bipi + HaAla + 2H2O V(OH)2(Bipi)(aAla) + 3H+3,1 max 3,4Dispersin s (ZC)0,066 Constantes de equilibrio del sistema ternario V(III)-2,2-bipiridina- b-alanina en KCl 3,0 M y 25C. ReaccinLLogbPqrV3+ + Bipi + 2HbAla + H2O V(OH)(Bipi)(bAla)2 + 3H+5,8 mx 6,42V3+ + Bipi + HbAla + H2O V2O(Bipi)(bAla)3+ + 3H+16,5(1)2V3+ + 2Bipi + 2HbAla+ H2O V2O(Bipi)2(bAla)22+ + 4H+21,7(1)V3+ + Bipi + HbAla + 2H2O V(OH)2(Bipi)(bAla) + 3H+4,2(1)Dispersin s(ZC)0,085 Constantes de equilibrio del sistema ternario V(III)-2,2-bipiridina-glicina en KCl 3,0 M y 25C. ReaccinLLogbPqrV3+ + Bipi + 2HGly + H2O V(OH)(Bipi) (Gly)2 + 3H+7,5(1)2V3+ + Bipi + HGly + H2O V2O(Bipi)(Gly)3+ + 3H+17,1(1)2V3+ + 2Bipi + 2HGly + H2O V2O(Bipi)2(Gly)22+ + 4H+22,1(1)V3+ + Bipi + HGly+ 2H2O V(OH)2(Bipi)(Gly) + 3H+3,0 mx 3,5Dispersin s(ZC)0,072 Constantes de equilibrio del sistema ternario V(III)-2,2-bipiridina-prolina en KCl 3,0 M y 25C. ReaccinLLogbPqrV3+ + Bipi + 2HPro + H2O V(OH)(Bipi)(Pro)2 + 3H+6,1(3)2V3+ + Bipi + HPro + H2O V2O(Bipi)(Pro)3+ + 3H+16,44(9)2V3+ + 2Bipi + 2HPro+ H2O V2O(Bipi)2(Pro)22+ + 4H+21,29(9)V3+ + Bipi + HPro + 2H2O V(OH)2(Bipi)(Pro) + 3H+3,72(7)Dispersin s (ZC)0,089Valores entre parntesis representan las desviaciones estndar [3s(log b)] en la ltima cifra decimal.','2010-10-15','2,2-bipiridina;vanadio(III);complejos ternarios de vanadio(III).',6,1,1,1,1,'2013-09-17 08:36:10','2013-09-17 08:36:10','Documento_494.pdf','application/pdf',1448831,'2013-09-17 08:36:10',17,0,88,'COMPLETO'),(489,'Estudio geoqumico del granitoide de timotes','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband- size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii- theme-font:minor-latin; mso-fareast-font-family:\"Times New Roman\"; mso-fareast- theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor- bidi;} El granitode de Timotes conforma un cuerpo grantico ubicado en los Andes de Mrida, el cual es intrusivo en rocas de edad Neoproterozoica y Paleozoica Temprano, principalmente. Mediante el presente trabajo, el granitode de Timotes fue estudiado geoqumicamente con la finalidad de caracterizarlo, clasificarlo e inferir su ambiente tectnico de formacin. Un total de 20 muestras fueron tomadas a lo largo del cuerpo grantico, para la determinacin de los elementos qumicos mayoritarios, minoritarios y trazas, incluyendo a los elementos de las tierras raras (REE). Los elementos qumicos mayoritarios y los elementos trazas, incluyendo a los REE, fueron determinados por Espectrometra de Emisin ptico con Plasma Inductivamente Acoplado (ICP-- OES) y Espectrometra de Masas con Plasma Inductivamente Acoplado (ICP--MS) respectivamente, despus de una fusin alcalina. Los anlisis qumicos fueron realizados mediante el apoyo irrestricto del Instituto Nacional de Geologa y Minera (INGEOMIN). Los resultados obtenidos mediante el anlisis qumico permitieron caracterizar geoqumicamente el granitode de Timotes, encontrndose que este cuerpo est integrado por granitos (sensu estricto) y granodioritas, de naturaleza calcoalcalina, altas en potasio; son rocas peralumnicas posiblemente generadas por anatexis de rocas sedimentarias (metagrauvacas y ortogneises cuarzo-feldespticos) en ambientes de convergencia de placas (zona de subduccin). Los granitodes de Valera- La Puerta y Timotes estn en contacto de falla con rocas del Complejo Iglesias (Proterozoico Tardo-NeoProterozoico) en los Andes de Mrida. La gran similitud entre las caractersticas geoqumicas de ambos cuerpos, tanto en los componentes mayoritarios, minoritarios y trazas, incluyendo a los elementos de las tierras raras (REE), as como su naturaleza calcoalcalina y peralumnica sugiere una relacin comagmtica; no obstante, las edades determinadas por el mtodo U-Pb, segn Burkley (1976), son significativamente diferentes (593  16 millones de aos (Ma) para el granitode de Valera- La Puerta y 434  7 Ma para el de Timotes). Con los adelantos actuales en el mtodo U-Pb para realizar geocronologa merece que dichas edades sean revisadas.','2010-09-09','Granitoide; Zona de convergencia de placas; caracterizacin geoqumica; clasificacin geoqumica; Espectrometra ptica; Espectrometra de masas.',4,1,1,1,1,'2013-09-17 08:36:11','2013-09-17 08:36:11','Documento_495.pdf','application/pdf',1425198,'2013-09-17 08:36:11',18,0,98,'COMPLETO'),(490,'ESTUDIO GEOQUMMICO DEL GRANITOIDE DE TIMOTES,, ESTADO MRRIDA','El granitode de Timotes conforma un cuerpo grantico ubicado en los Andes de Mrida, el cual es intrusivo en rocas de edad Neoproterozoica y Paleozoica Temprano, principalmente. Mediante el presente trabajo, el granitode de Timotes fue estudiado geoqumicamente con la finalidad de caracterizarlo, clasificarlo e inferir su ambiente tectnico de formacin. Un total de 20 muestras fueron tomadas a lo largo del cuerpo grantico, para la determinacin de los elementos qumicos mayoritarios, minoritarios y trazas, incluyendo a los elementos de las tierras raras (REE). Los elementos qumicos mayoritarios y los elementos trazas, incluyendo a los REE, fueron determinados por Espectrometra de Emisin ptico con Plasma Inductivamente Acoplado (ICP-- OES) y Espectrometra de Masas con Plasma Inductivamente Acoplado (ICP--MS) respectivamente, despus de una fusin alcalina. Los anlisis qumicos fueron realizados mediante el apoyo irrestricto del Instituto Nacional de Geologa y Minera (INGEOMIN). Los resultados obtenidos mediante el anlisis qumico permitieron caracterizar geoqumicamente el granitode de Timotes, encontrndose que este cuerpo est integrado por granitos (sensu estricto) y granodioritas, de naturaleza calcoalcalina, altas en potasio; son rocas peralumnicas posiblemente generadas por anatexis de rocas sedimentarias (metagrauvacas y ortogneises cuarzo-feldespticos) en ambientes de convergencia de placas (zona de subduccin). Los granitodes de Valera- La Puerta y Timotes estn en contacto de falla con rocas del Complejo Iglesias (Proterozoico Tardo-NeoProterozoico) en los Andes de Mrida. La gran similitud entre las caractersticas geoqumicas de ambos cuerpos, tanto en los componentes mayoritarios, minoritarios y trazas, incluyendo a los elementos de las tierras raras (REE), as como su naturaleza calcoalcalina y peralumnica sugiere una relacin comagmtica; no obstante, las edades determinadas por el mtodo U-Pb, segn Burkley (1976), son significativamente diferentes (593  16 millones de aos (Ma) para el granitode de Valera- La Puerta y 434  7 Ma para el de Timotes). Con los adelantos actuales en el mtodo U-Pb para realizar geocronologa merece que dichas edades sean revisadas.','2010-09-09','Granitoide; zona de convergencia de placas; Caracterizacin geoqumica; clasificacin geoqumica; Espectrometra ptica; Espectrometra de masas.',4,1,1,1,1,'2013-09-17 08:36:12','2013-09-17 08:36:12','Documento_496.pdf','application/pdf',9804055,'2013-09-17 08:36:12',18,0,98,'COMPLETO'),(491,'EVALUAR LA ACTIVIDAD CATALTTICA HACIA REACCIONES DE HIDROTRATAMIENTO DE LCO EMPLEANDO CATALIZADORES SULFURADOS DE Ni--V','RESUMEN El consumo de los combustibles fsiles ha producido la disminucin de las reservas de crudos livianos y medianos, lo que ha llevado a un aumento en la extraccin y refinacin de crudos pesados y extrapesados. Sin embargo, este tipo de crudos posee altos contenidos de elementos potencialmente contaminantes como el azufre, lo cual genera problemas de ndole ambiental por lo que es necesario desarrollar procesos eficientes que eliminen dichos contaminantes dada las restricciones ambientales que en los ltimos tiempos se han vuelto ms estrictas. El hidrotratamiento es el proceso cataltico ms apropiado para la eliminacin de dichos elementos, pero hay que tomar en cuenta que al tratar crudos pesados y extrapesados con este tipo de proceso se debe utilizar catalizadores que puedan soportar las severas condiciones de reaccin requeridas al tratar este tipo de cargas. Se ha prestado considerable atencin al desarrollo de catalizadores y procesos para mejorar LCO ya que este por sus caractersticas fsicas se puede procesar a travs de la reacciones de hidrotratamiento para la obtencin de diesel que cumpla con las regulaciones de tipo ambiental; para eso se busca desarrollar nuevos catalizadores mucho ms activos y menos susceptibles al envenenamiento de los sitios activos, lo que conllevara a la eventual venta del mismo en los pases consumidores de combustible. En este trabajo los slidos se sintetizaron por el mtodo de precipitacin en medio homogneo (HPS) bajo atmosfera de nitrgeno. Las relaciones nominales Ni/Ni+V fueron 0; 0,25; 0,50; 0,75 y 1. Luego de agitacin por 6 horas se conservaron en una caja seca. La caracterizacin de los catalizadores se realiz por medio de difraccin de rayos X (DRX), rea especfica (BET) y volumen de poro.Por medio del anlisis qumico elemental se constat que las relaciones Ni/(Ni+V) obtenidas son bastantes diferentes de los valores nominales en los casos de los catalizadores NiV-0,50 (0.36) y NiV-0,75 (0.46) pero no para el NiV-0.25 cuyo valor real es NiV-0,22. Se realiz DRX antes y despus de reaccin y se detectaron en ambos casos mezclas de las fases NiV2S4y NiV4S8. Se determin el rea especfica y el volumen de poro por adsorcin de N2 y Ar. Los cuales son bastante bajos, tpicos de catalizadores no soportados. Una vez hecha la caracterizacin se evalu la actividad cataltica para las reacciones de HDS, HDN y HYD de LCO en un equipo diseado para operar a alta presin a una temperatura de 375 C y a 30 atm. La presulfuracin se realiz a presin atmosfrica y 300C por 2 horas empleando CS2. En todos los casos el catalizador que present la mayor actividad fue el NiV-0,25. Los valores de gravedad API demuestra que los catalizadores mantienen el carcter ligero del LCO mientras que con el NiMo desmejora esta propiedad y por ltimo la destilacin simulada refleja que el catalizador NiV-0,25 presenta la capacidad de hidrogenar y as generar productos livianos.','2010-10-25','Catalizadores Ni-VLCOHidrotratamientohidrodesulfuracionHidrodesnitrogenacion',6,1,1,1,1,'2013-09-17 08:36:16','2013-09-17 08:36:16','Documento_497.pdf','application/pdf',2158525,'2013-09-17 08:36:16',19,0,111,'COMPLETO'),(492,'CONTENIDO DE LPIDOS, COLESTEROL Y PERFIL DE PROTENAS EN EL CURITO (Hoplosternum littorale) (HANCOCK, 1828) EN DOS DIFERENTES POCAS DEL AO','Los curitos o bucos (Hoplosternum littorale), se encuentra en toda Amrica del Sur, especficamente desde Venezuela hasta Argentina. Son peces suramericanos pertenecientes a la familia Callichthyidae y se encuentran ampliamente distribuidos en los llanos de Venezuela. Se caracterizan por tener un cuerpo olivceo oscuro, cubierto por dos series de placas seas, boca terminal y sin dientes en los adultos y tallas pequeas que oscilan entre 150 a 200 mm de largo estndar. Durante la estacin seca se mantienen en charcas aisladas, las que pueden habitar debido a la posesin de adaptaciones fisiolgicas y anatmicas, tal como la posibilidad de respirar aire, gracias a una modificacin del tracto digestivo. Esta respiracin accesoria los torna aptos para vivir en reas pantanosas pobres en oxigeno. Se observa adems en la especie un dimorfismo sexual caracterizado por un macho ms grande y con la aleta pectoral modificada armada de un proceso espinoso fuerte adems de la construccin de un nido flotante a base de restos vegetales y burbujas y un cuido tenaz de la cra por parte del macho. La especie H. littorale es considerada como omnvora, ya que consume algas asociadas al fondo pero principalmente micro crustceos y larvas de insectos. Por tratarse de una especie poco aprovechada en nuestro pas y de gran potencial comercial en los mercados de Trinidad hasta la Unin Europea donde es considerada una exquisitez, el objetivo de evaluar la variacin de los lpidos y las protenas del curito (Hoplosternum littorale) Hancock, 1828 en dos diferentes pocas del ao. Se observaron diferencias significativas (P<0,05) en cuanto a la variacin entre las dos etapas evaluadas de la grasa , la protena y la cenizas aumentando tanto la grasa como la protena en la etapa 2 y disminuyendo la cenizas; la humedad se mantuvo invariable. El contenido de grasas en la etapa 2 aumenta, notndose tambin un incremento en el contenido de testosterona y estradiol mientras que para el colesterol la se observa unadisminucin lo que refleja una relacin inversamente proporcional del colesterol con las dos hormonas dado que la disminucin de colesterol coincide con aumentos de testosterona y estradiol.','2010-07-14','LPIDOS COLESTEROL',1,1,1,1,1,'2013-09-17 08:36:18','2013-09-17 08:36:18','Documento_498.pdf','application/pdf',1696497,'2013-09-17 08:36:18',17,0,127,'COMPLETO'),(493,'DESARROLLO DE UN METODO ANALITICO PARA LA DETERMINACION DE ACETAMINOFEN,, FENILEFRINA Y SUS PRODUCTOS DE DEGRADACION EN FORMULACIONES FARMACEUTICAS PARA EL RESFRIADO COMUN','En este trabajo de investigacin, se desarroll un mtodo de cromatografa lquida en fase reversa para la separacin simultnea de acetaminofn, fenilefrina, clorfeniramina y los posibles productos de degradacin del acetaminofn (Dimeros) y la fenilefrina (o-pc, ciclacin en la posicin \"orto\" del anillo fenlico) y (p-pc, ciclacin en la posicin \"para\" del anillo fenlico), mediante el uso de un software especializado (OptichromLC) en el modelado de la cromatografa lquida en fase reversa a travs de la construccin y evaluacin de los perfiles de retencin (log k Vs %B) de los analitos de inters. La instrumentacin empleada para la separacin cromatogrfica de estos siete (7) compuestos fue una columna Waters Xbridge de 150 mm de longitud, 4,6 mm de dimetro interno y 3,5 mm de tamao de partcula. Adems, se utiliz un flujo de fase de mvil de 1 mL min -1 con un gradiente de solvente constituido por metanol/solucin de tetraborato de sodio (10 mM) a pH 9,38. Adicionalmente, se evalu figuras de mrito como la especificidad, linealidad, intervalo lineal de respuesta, lmite de cuantificacin, lmite de deteccin, exactitud y precisin del mtodo cromatogrfico. Finalmente, se aplic el mtodo cromatogrfico para el monitoreo de los analitos de inters en un producto farmacutico comercial. Encontrando que el mtodo cromatogrfico desarrollado y optimizado con el uso de OptichromLC, es adecuado para el anlisis simultneo de acetaminofn, fenilefrina, clorfeniramina y los productos de degradacin propuestos en este trabajo (dimeros del acetaminofn, o-pc y p-pc).','2010-10-28','ACETAMINOFEN,, FENILEFRINA,, PRODUCTOS DE DEGRADACION,, MODELADO Y OPTIMIZACION VIA SOFTWARE,, OPTICHROMLC',6,1,1,1,1,'2013-09-17 08:36:19','2013-09-17 08:36:19','Documento_499.pdf','application/pdf',2633242,'2013-09-17 08:36:19',20,0,97,'COMPLETO'),(494,'Colonoscopa virtual usando tcnicas de optimizacin de Ray Casting','Realizar el render por software de una colonoscopa obtenida a travs de una resonancia magntica que permita navegar dentro del colon y visualizarlo usando solo recursos bsicos. Optimizacin del render por software del volume rendering y uso de hilos para acelerarlo. Resaltado de zonas de importancia.','2010-07-06','Volume Rendering, Colonoscopa Virtual, Ray Casting, Optimizaciones rendering, render multihilos, Software render, Importance Driven Volume Rendering',2,1,1,1,1,'2013-09-17 08:36:20','2013-09-17 08:36:20','Documento_500.pdf','application/pdf',3204646,'2013-09-17 08:36:20',18,0,160,'COMPLETO'),(495,'DETERMINACINN DE LOS MRRGENES DE LA ENFERMEDAD SUB-- CLNNICA TUMORAL POR MEDIO DE LA CLASIFICACINN DE LOS PATRONES EN LOS VALORES DE LA ESCALA DE GRISES DE UNA IMAGEN MULTICANAL','En el presente trabajo se propone un procedimiento de segmentacin para imgenes que presenten tumores a nivel del sistema nervioso central, basado en la morfologa matemtica. Este procedimiento considera el uso de imgenes de resonancia magntica multimodalidad, de manera que cada pxel representativo de la imagen esta descrito por un vector n- dimensionalidad, donde n depender del numero de modalidades de IRM que hayan sido adquiridas y las componentes de estos vectores vendrn dadas por el nivel de gris correspondiente a cada modalidad de IRM. Las imgenes son analizadas por medio de un filtro morfolgico n-dimensional denominado filtro de excentricidad, el cual no es mas que una extensin de los operadores bsicos de la morfologa matemtica adaptado para imgenes multicanal. Este filtro fue utilizado para obtener imgenes, donde se resaltaran en unas las zonas oscuras y en otras las zonas claras, esto reemplazando cada pxel por el pxel mas representativo dentro de su elemento estructurante, por ejemplo el que presentara la mnima distancia total hacia el resto de los pixeles en el elemento estructurante. Sobre el gradiente morfolgico resultante de estas imgenes se aplico la transformada de \"watershed\" (TW) (divisin de cuencas), obteniendo as imgenes segmentadas, siendo los sectores de estas homogenizados por el pxel mas representativo de la regin y a continuacin analizados por un algoritmo de agrupamiento, con el fin de reducir la cantidad de zonas obtenidas en un principio por el operador TW. Por ultimo se hizo el reconocimiento de las zonas de carcter tumoral y de aquellas que pudieran representar la extensin de la lesin, siendo estas zonas resaltadas en las imgenes originales suprimiendo bien sea una o dos de las coordenadas del cdigo RGB que comprenden estas imgenes.','2010-11-02','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',3,1,1,1,1,'2013-09-17 08:36:21','2013-09-17 08:36:21','Documento_501.pdf','application/pdf',3337211,'2013-09-17 08:36:21',20,0,115,'COMPLETO'),(496,'ESTUDIO DE LOS COMPLEJOS DE VANADIO ((IV,,V)) VALENCIA MIXTA CON AMINOACIDOS..SISTEMA H++ -- V((IV,, V)) -- VALINA ((KCl 33,,00 M,, 2255 C))','Este trabajo especial de grado se baso en la determinacion de las constantes de acidez(pka) y las costantes de formacion para diferentes relaciones(R=2, R=4 y R=9), de un sistema de valencia mixta vanadio(IV/V) con el aminoacido Valina .','2010-10-28','Vanadio(IV/V) valencia mixta con valina',6,1,1,1,1,'2013-09-17 08:36:22','2013-09-17 08:36:22','Documento_502.pdf','application/pdf',2197504,'2013-09-17 08:36:22',19,0,0,'INCOMPLETO'),(497,'Diseo de la Red de rea Local Inalmbrica para el Edificio de Aulas de la Facultad de Ciencias de la UCV','El presente trabajo especial de grado tiene como objetivo elaborar y proponer el diseo de una solucin inalmbrica basada en el estndar IEEE 802.11 para la conectividad del Edificio de Aulas de la Facultad de Ciencias de la UCV con su red de datos existente.','2010-11-01','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:36:23','2013-09-17 08:36:23','Documento_503.pdf','application/pdf',0,'2013-09-17 08:36:23',20,0,0,'INCOMPLETO'),(498,'Efectos de hongos aislados de yuca y sus metabolitos sobre el crecimiento in vitrode esta planta','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; text-align:justify; line- height:200%; mso-pagination:widow-orphan; font-size:11.0pt; font-family: \"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font: minor-latin; mso-fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font: minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor- latin;} El objetivo de este trabajo es conocer el efecto que tienen hongos aislados de la yuca (Manihot esculenta)) y sus metabolitos sobre el crecimiento in vitro de estas plantas. Para esto se tomaron muestras de plantas de yuca con sntomas de sper-alargamiento en Masparro, Municipio Cruz Buredes, Edo. Barinas, Venezuela. Las hojas, tallos y peciolos de estas plantas fueron esterilizadas superficialmente con hipoclorito de sodio al 3% y etanol al 70%. Los microorganismos que crecieron del material vegetal fueron transferidos a agar zanahoria suplementado con ampicilina y carbenicilina a una concentracin final de 0,1 mg/mL. Posteriormente se realiz un cultivo monosprico por diluciones seriadas, para lo cual se adicionaron 100 mL de una suspensin de conidios a una concentracin de 100 conidios/mL en tween 2200 al 0,005%, a agar agua. Los cultivos axnicos de los 18 hongos aislados se conservaron de dos formas, utilizando el mtodo de Castellani y sumergidos en glicerol al 30%. Los experimentos se realizaron con las variedades 35 y 98 de plntulas de yuca, proporcionadas por la Agricultura y Soberana Alimentaria de la Fundacin IDEA. Para conocer el efecto de los hongos aislados sobre las plantas de yuca, se utilizaron dos estrategias. Primero, para conocer el efecto de los metabolitos producidos por los hongos, sobre el crecimiento in vitro de plantas de yuca, se incub cada hongo, durante una semana, en un medio de crecimiento rico en carbono y limitado en nitrgeno con una proporcin 1:19 C: N. Por cuantificacin del consumo de nitrgeno y carbono se determin la fase del metabolismo alcanzada por los hongos. Posteriormente, el sobrenadante de los hongos incubados se infiltr en hojas de yuca. Comparando los efectos producidos con un control de cido acetil saliclico, se observ que algunos hongos mimetizaban la respuesta de hipersensibilidad en las hojas. Segundo, se infectaron plntulas de yuca, crecidas in vitro, con micelio en crecimiento de los hongos aislados. Los cambios inducidos por los hongos y sus metabolitos fueron analizados realizando un ANOVA donde la variable en estudio fue la longitud de los entrenudos de las plntulas infectadas y de los controles, los cuales fueron plntulas de yuca sin infectar. Los resultados del ANOVA no fueron significativos con respecto a las plntulas control. En el experimento de infeccin no se observ los sntomas caractersticos de la enfermedad de sper-alargamiento, sin embargo, cuatro hongos fueron patgenos, causando la muerte de la planta, donde la variedad 35 mostr ser ms susceptible que la 98.','2010-10-27','yuca, hongos, superalargamiento, metabolitos primarios, metabolitos secundarios, metabolitos, respuesta hipersensible, resistencia sistmica adquirida.',1,1,1,1,1,'2013-09-17 08:36:24','2013-09-17 08:36:24','Documento_504.pdf','application/pdf',25858698,'2013-09-17 08:36:24',20,0,57,'COMPLETO'),(499,'Sistema de Informacin para la Gestin de Calidad y Riesgos de los Proyectos.','La gerencia de proyectos brinda los conocimientos, habilidades, tcnicas y herramientas a las actividades de un proyecto, para as satisfacer los requisitos del mismo. Desde el ao 2008, estudiantes de la Escuela de Computacin, de la Universidad Central de Venezuela, han estado desarrollando, en software libre, el Prototipo de Software de Gestin de Proyectos (SGP), basado en los estndares establecidos en la gua del PMBOK (Project Management Body of Knowledge, Gua de Fundamentos de la Gestin de Proyectos) del PMI (Project Management Institute, Instituto de Gestin de Proyectos). El presente Trabajo Especial de Grado (TEG), consisti en el desarrollo de un Sistema de Informacin para la Gestin de la Calidad y de los Riesgos de los Proyectos. Se utiliz el mtodo de investigacin de tipo proyectiva, permitiendo analizar y seleccionar las tcnicas y herramientas necesarias para la gestin de calidad y riesgos, presentadas en la gua del PMBOK. Como mtodo de desarrollo se emple la entrega por etapas, facilitando el anlisis, diseo e implementacin del sistema a desarrollar, y el mtodo de programacin, consisti en un estndar que permiti organizar la estructura del cdigo del sistema, facilitando su entendimiento. Como resultado, se obtuvo un Sistema de Informacin para la Gestin de Calidad y Riesgos de los Proyectos, basado en las reas del conocimiento de Calidad y Riesgos planteadas en la gua del PMBOK, integrado al Prototipo de Software de Gestin de Proyectos (SGP), que hasta el momento contaba con las reas de alcance, tiempo, costes y recursos humanos, y que ahora permite analizar, planificar y llevar un seguimiento de la calidad y de los riesgos presentes en un proyecto.','2010-10-28','Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-styl',2,1,1,1,1,'2013-09-17 08:36:27','2013-09-17 08:36:27','Documento_505.pdf','application/pdf',1112736,'2013-09-17 08:36:27',19,0,71,'COMPLETO'),(500,'EVALUACINN DEL CONTENIDO DE METALES EN ALGAS MARINAS VENEZOLANAS Y SU POSIBLE USO COMO BIOINDICADOR AMBIENTAL','En este trabajo se realiz un estudio preliminar para establecer el contenido de los metales Ca, Mg, Zn, Fe, Cu, Cr, Ni, Pb, Cd y Hg en diferentes muestras de especies de algas marinas, localizadas en zonas de la costa central y de la isla de Margarita, Venezuela, con la finalidad de establecer posibles especies bioindicadoras y localidades con exposicin contrastante. El anlisis qumico de las muestras se realiz mediante FAAS, ETAAS y CV-AFS luego de llevarlas a solucin, mediante su digestin en un microondas. En total se analizaron veintisis muestras correspondientes a nueve especies de algas colectadas en once localidades. La colecta de las muestras fue realizada por el Prof. Gerard Haiek de la Facultad de Farmacia, UCV. Los datos fueron analizados empleando diferentes herramientas estadsticas (ANOVA de una y dos vas, Cluster Anlisis, Correlaciones Mltiples y Anlisis de Componentes Principales). Los resultados obtenidos en este trabajo mostraron concentraciones elevadas de Pb, Cu, Cr, Fe en la especie colectada en la localidad de la Marina Carrasco en Higuerote, la cual se diferenci significativamente del resto de las localidades, seguida de Taguao donde se encontraron concentraciones elevadas y diferentes significativamente de Ni. Las localidades menos expuestas correspondieron a las Playas de Cepe Edo Aragua, Playa Caribe en Chuspa y algunas Playas del Edo Nueva Esparta como Punta Arenas y Manzanillo. Se encontraron dos posibles fuentes de origen de la entrada de los elementos a las aguas. Uno debido a los derrames de crudo que introducen los elementos Ni, y Cr que afectan principalmente la zona de Taguao, donde el crudo regularmente es descargado para su consumo en la planta elctrica Ricardo Zuloaga. La herrumbre de los tanqueros que traen el crudo introducira al Fe. La segunda fuente sera el empleo de gasolina y combustibles por las embarcaciones en zonas tursticas, lo cual domina la concentracin de Pb en las algas en las zonas como la Marina Carrasco de Higuerote, el Muelle de Puerto Cabello y Chichiriviche de la Costa. Aunque no se encontraron diferencias entre las especies de algas, en cuanto a su capacidad para su empleo como especies bioindicadoras, el amplio intervalo de concentraciones de los diferentes metales txicos encontrados en Padina gymnospora y Ulva lactuca, junto a su abundancia y presencia en varias de las zonas muestreadas, podra ser elementos para seleccionarlas para prximos estudios. Este trabajo fue financiado por el proyecto CDCH UCV PG-06-7155- 2008/1','2010-10-28','Algas, Bioindicadores, contaminacion acuatica',6,1,1,1,1,'2013-09-17 08:36:28','2013-09-17 08:36:28','Documento_506.pdf','application/pdf',2498296,'2013-09-17 08:36:28',20,0,130,'COMPLETO'),(501,'Uso de la dispersion de Hiper Rayleigh para el estudio y caracterizacion de nanoparticulas de oro','Las Nanopartculas (Nps) de oro manifiestan propiedades elctricas y pticasinteresantes, tiles y nicas. As mismo, las Nps de oro presentan efectos pticos nolineales (ONL) de segundo orden. Por lo general, el comportamiento ONL desegundo orden de las Nps de oro es cuantificado en trminos de la primerahiperpolarizabilidad, tensor . Por su parte, la dispersin de Hiper Rayleigh (HRS)ha surgido como una tcnica eficaz para medir los valores de  de Nps metlicas ensoluciones tanto acuosas como orgnicas. Sin embargo, mientras que laspropiedades pticas lineales de las Nps de oro han sido ampliamente investigadas;el potencial de estos materiales para aplicaciones pticas no lineales de segundoorden, por ejemplo, anlisis biolgico, telecomunicaciones, optoelectrnica,incluyendo aplicaciones fotnicas de segundo orden (hiper-fotnicos), etc., no se haestudiado del todo.Esta investigacin fue enfocada en la caracterizacin y estudio de Nps de oroa travs de la tcnica de HRS. Inicialmente, las Nps de oro fueron generadas porablacin lser a partir de una placa de oro sumergida en solucin acuosa de unsurfactante aninico, Dodecil Sulfato de Sodio (SDS). Posteriormente, se realiz unestudio para determinar el alcance e influencia de ciertas variables experimentalesde la ablacin lser, sobre los espectros de absorcin, distribucin de tamaos ypropiedades pticas no lineales (ONL) de las Nps de oro generadas. Las variablesexperimentales que se modificaron fueron: concentracin del surfactante [SDS],irradiancia del lser y tiempo de ablacin. Durante el proceso de ablacin, se trabaja la longitud de onda fundamental (1064 nm) y a una frecuencia fija de 10 Hz. Lacaracterizacin de dichas Nps de oro no funcionalizadas se llev a cabo medianteEspectroscopa UV-Vis, Dispersin Dinmica de Luz (DLS) y Dispersin de HiperRayleigh (HRS).Se observ que incrementos en el tiempo de ablacin (15 minutos) generanaltas concentraciones de nanopartculas en el medio. As mismo, se encontr quefenmenos de fragmentacin se manifiestan cuando se emplean irradianciassignificativamente grandes; esta tendencia fue observada hasta un valor limite deirradiancia de 1.34 GW/cm, despus del cual el dimetro medio aumentabanuevamente ocasionado por la agregacin inducida por la gran cantidad de Npspresentes en el medio. Igualmente, se comprob, para tres diferentes valores deirradiancia, que 4.5x10-02 M es la concentracin ms apropiada de SDS para obtenermayor cantidad de Nps de oro de menor dimetro y de mayor estabilidad en eltiempo. Por otro lado, se encontr una dependencia de la seal de HRS con lacantidad de Nps de oro no funcionalizadas presentes en el medio; cuanto mayor esla cantidad de Nps, mayor es la seal de HRS.Posteriormente, las Nps de oro fueron generadas y funcionalizadas \"in-situ\"por ablacin lser a partir de una placa de oro sumergida en una mezcla desoluciones de SDS y fluorforo, es decir, SDS-Disodiofluoresceina (DSF) o SDSRodaminaB (RB). Igualmente, la caracterizacin de dichas Nps de orofuncionalizadas se llev a cabo mediante Espectroscopa UV-Vis, Espectroscopade Fluorescencia, Dispersin Dinmica de Luz (DLS) y Dispersin de Hiper Rayleigh(HRS).Comparando los agentes funcionalizadores, RB y DSF, se observ queambos por igual producen importantes cambios espectrales UV-Vis. Se not que amedida que la concentracin de ambos fluorforos aumenta, la absorbancia de lasNps tambin se ve incrementada. Adems de la banda de PS, que se observ a 520nm para los complejos Nps de oro-RB-SDS, una segunda banda de absorcinapareci a 400-425 nm. Se cree que estos resultados se deban a pequeosaumentos en la constante dielctrica del medio ambiente en el cual se hallan lasNps y a la agregacin que experimentan las partculas por la adicin de RB.Por otro lado, la seal de HRS de las Nps funcionalizadas mejorconsiderablemente con respecto a la seal proveniente de las partculas nofuncionalizadas. Se determin que el valor de la primera hiperpolarizabilidad de unananopartcula de oro solitaria y sin modificacin fue alrededor de 1.92.5x10-23 esu.Igualmente, se encontr que el valor del tensor  para los complejos Nps de oro-DSF-SDS y Nps de oro-RB-SDS fue 5.52.2x10-22 y 13.31.6x10-23 esu,respectivamente. Es notorio, que las Nps de oro funcionalizadas con Rodamina Bposeen un mayor valor de hiperpolarizabilidad que aquellas partculas que fueronmodificadas con Disodiofluoresceina. La Rodamina B realz e increment msefectiva y eficientemente, en un orden de magnitud, las propiedades ONL de lasNps de oro.As mismo, se realizaron varios estudios del quenching de la emisin defluorescencia del agente funcionalizador como consecuencia del contacto con unquencher (Nps). Se not un fuerte decaimiento de la emisin de fluorescencia paraambos fluorforos, RB y DSF, debido a la gran cercana entre las molculas deestos y los ncleos metlicos de las Nps de oro. Las desviaciones encontradas enlas grficas de Stern-Volmer, para los complejos Nps de oro-DSF-SDS y Nps deoro-RB-SDS, sugieren que el quenching observado no fue enteramente dinmico oesttico, sino ms bien una combinacin de ambos.La funcionalizacin, tal como se tena previsto increment significativamentela seal de HRS de las Nps de oro bajo una marcada dependencia de la seal deHRS con la concentracin del agente funcionalizador, es decir, a medida que laconcentracin del fluorforo aumenta, la seal de HRS se ve incrementada. Sepiensa que este fenmeno se deba a: (i) como es lgico, a medida que aumenta laconcentracin del funcionalizador tambin, en la misma medida, las interaccioneselectrostticas que se establecen entre las molculas del fluorforo y la superficie dela Nps incrementan, (ii) aumentos de la concentracin del fluorforo crean nuevascondiciones no- centrosimtricas en el sistema (iii) altas intensidades de las sealesde HRS proveniente de las Nps de oro modificadas se pueden atribuir a procesos deagregacin de las partculas.Por ltimo, la intensidad de HRS proveniente de los complejos Nps de oro-RB-SDS fue significativamente mayor que la seal de HRS proveniente de loscomplejos Nps de oro-DSF-SDS. Las molculas de RB y la superficie de lasnanopartculas establecen una mejor y mayor interaccin electrosttica, lo que a suvez, se ve reflejado en el realzamiento de la respuesta ptica no lineal de segundoorden de las Nps de oro.','2010-10-04','dispersion de hiper rayleigh, nanoparticulas de oro, propiedades opticas no lineales, ablacion laser.',6,1,1,1,1,'2013-09-17 08:36:30','2013-09-17 08:36:30','Documento_507.pdf','application/pdf',5989263,'2013-09-17 08:36:30',20,0,111,'COMPLETO'),(502,'Distribucinn espacial de fssforo en sedimentos superficiales del Lago de Valencia','El objetivo del siguiente trabajo fue establecer la distribucin espacial del fsforo en los sedimentos superficiales del Lago de Valencia. Para lograr dicho objetivo fueron recolectadas 41 muestras de sedimentos superficiales en el Lago de Valencia. Estas muestras fueron fraccionadas por tamao de grano (grava, arena, limo y arcilla) y cada una de las distintas fracciones granulomtricas obtenidas fueron sometidas a calentamiento por 2h a diferentes temperaturas (105C, 450C, 550C y 750C) y finalmente fueron extradas con HCl 1M. El extracto cido fue usado para determinar fsforo por fotocolorimetra segn la metodologa de Murphy & Rilley (1962). Los resultados obtenidos indican que la prdida a 450C est distribuida hacia el centro del lago, mientras que la prdida a 550C est en la periferia del lago, en las zonas de menor profundidad. La prdida a 750C present mayores porcentajes (>10%) en las estaciones 4, 15, 26 y 39, con porcentajes intermedios (4-10%) hacia el centro del lago y los menores valores (<4%) hacia la periferia. Esto sugiere que la depositacin de carbonatos ocurre preferentemente en las estaciones 4, 15, 26 y 39. Los menores valores de residuo insoluble fueron encontrados en aquellas estaciones que presentaron los mayores valores de prdida a 750C y los mximos valores estuvieron distribuidos hacia la parte sur del lago, indicando una mayor fuente de sedimentos siliciclsticos. Por ltimo, se logr diferenciar que la fijacin del fsforo en los sedimentos ocurre por medio de dos procesos, uno asociado a la materia orgnica y los oxihidrxidos de hierro y aluminio, el cual tiene una fuerte influencia en la mayor parte del sistema; y otro asociado a los carbonatos, que domina en las estaciones 4, 15, 26, 37, 38 y 39. Las concentraciones obtenidas para fsforo oscilaron entre 500 y 15000 mg/Kg para todas las fracciones granulomtricas y entre 1000 y 4800 mg/Kg para la muestra total. Los mayores valores de concentracin de fsforo fueron obtenidos en las fracciones de arena, especialmente en las estaciones con mayor prdida a 750C. Finalmente, la correlacin lineal encontrada entre las concentraciones de fsforo y la prdida a 450C sugiere que la materia orgnica tiene un aporte significativo de fsforo orgnico.','2010-10-29','Fsforo, Lago de Valencia, Sedimentos',4,1,1,1,1,'2013-09-17 08:36:32','2013-09-17 08:36:32','Documento_508.pdf','application/pdf',544469,'2013-09-17 08:36:32',18,0,87,'COMPLETO'),(503,'Evaluacin de la contaminacin atmosfrica por hidrocarburos aromticos policclicos, empleando el liquen Parmotrema sancti-angelii y aplicando un muestreo de tipo activo en la ciudad de Caracas','El objetivo de este trabajo fue determinar la concentracin de los hidrocarburos aromticos policclicos (HAP), empleando el liquen Parmotremasancti--angelii y un muestreo de tipo activo, en la ciudad de Caracas. Para ello fueron transplantados lquenes de una zona suburbana a seis localidades de la ciudad de Caracas, en las cuales estuvieron expuestos a la atmsfera urbana por un periodo de cuatro meses. El mtodo de extraccin empleado fue un bao de ultrasonido, usando como solvente una mezcla hexano: diclorometano (3:2, v/v). La separacin de la fraccin de compuestos aromticos fue lograda mediante el uso de una columna cromatogrfica con slica gel y la elucin con una mezcla hexano-diclorometano (3:2, v/v). Los anlisis fueron realizados mediante cromatografa de gases acoplada a espectrometra de masas (CG/EM) y cromatografa lquida de alta eficiencia (HPLC/UV/FL). Fueron identificados 16 HAP: naftaleno, acenaftileno, acenafteno, fluoreno, fenantreno, antraceno, fluoranteno, pireno, criseno, benzo[a]antraceno, benzo [b]fluoranteno, benzo[k]fluoranteno, benzo[a]pireno, dibenzo[a,h]antraceno, benzo[g,h,i]perileno e indeno[1,2,3-cd]pireno. La concentracin de HAP totales obtenida en esta investigacin estuvo en el rango de 6,47  3,80 g/g a 2,30  0,49 g/g. Los lquenes mostraron un enriquecimiento en compuestos de 6 y 5 anillos (6>5>3>4 para LCM; 6>3>5>4 para LCF, LBC, LSC y LC5; 6>3>4>5 para LRC) asociados a las partculas atmosfricas comnmente generadas en procesos de combustin. La relacin Ind/(Ind+B[g,h,i]P) seala la presencia de HAP provenientes de la quema de vegetacin en todas las localidades, y la relacin B[g,h,i]P/B[a]P un fuerte aporte de las emisiones provenientes especficamente de la quema de gasolina en El Cafetal, lo cual indica una fuerte incidencia del trfico vehicular.','2010-10-27','Hidrocarburos aromticos policclicos, contaminacin atmosfrica, biomonitoreo, relaciones diagnsticas, muestreo activo.',4,1,1,1,1,'2013-09-17 08:36:34','2013-09-17 08:36:34','Documento_509.pdf','application/pdf',10584852,'2013-09-17 08:36:34',19,0,82,'COMPLETO'),(504,'EVALUACINN DEL EFECTO DE LA DENSIDAD DE POBLACINN Y LA FASE DE CRECIMIENTO SOBRE LA LETALIDAD POR PULSOS DE LUZ EN MICROORGANISMOS ASOCIADOS A ALIMENTOS','Dentro de las nuevas tecnologas no trmicas ni qumicas para procesar alimentos se encuentra el tratamiento con pulsos de luz, que se ha usado para la desinfeccin de superficies, aguas y podra ser aplicado para la obtencin de alimentos o productos alimenticios, mnimamente procesados pero ms seguros, ya que se ha demostrado que tienen efectos bactericidas. La caracterstica ms importante de la tecnologa de pulsos de luz es que, aparte del nmero y la duracin, la energa proporcionada es mayor que la obtenida por una radiacin de luz continua. Mientras ms corta es la duracin de cada pulso, ms alta es su intensidad, aumentando su capacidad de inactivacin microbiana. Sin embargo, poco se sabe de su efecto de esta tecnologa sobre la densidad de poblacin y en diferentes etapas de crecimiento de un cultivo microbiano. En este estudio se evalu, el efecto de un pulso de luz a una intensidad de 0,35 J/cm2, sobre la inactivacin de un cultivo de Pseudomona fluorescens a diferentes densidades de poblacin (109, 108, 106, 104 y 102UFC/mL) y sobre las fases de crecimiento (Fase de latencia, exponencial y estacionaria) de Pseudomona fluorescens, Salmonella spp., Listeria monocytogenes,, Bacillus cereus y Saccharomyces cerevisiae..Para ello, estos microorganismos fueron incubados a 30 y 35-37 C segn su temperatura de crecimiento, durante 24 horas. Los resultados fueron evaluados mediante el contaje de UFC y se realizo un anlisis estadstico. Se determin que a diferentes densidades de poblacin y en las diferentes fases de crecimiento existe variacin en su susceptibilidad por la inactivacin con pulsos de luz.','2010-11-01','Pulsos de luz',1,1,1,1,2,'2013-09-17 08:36:35','2013-09-17 08:36:35','Documento_510.pdf','application/pdf',1140523,'2013-09-17 08:36:35',20,0,34,'COMPLETO'),(505,'Caracterizacion Fisicoquimica y Reactividad de Coques de Petroleo','El estudio de las reactividades en modo TPO y gasificacion en Ar saturado con agua de distintos materiales carbonosos de bajo valor agregado que se obtienen en el circuito refinador de Venezuela. El coque de petroleo es uno de los materiales carbonosos estudiados, en particular se seleccionaron el coque Petrozuata y Amuay, asi como el flexicoque de alto vanadio. En particular, para el caso de flexicoque se trato quimicamente para remover selectivamente el Va y el Ni, discriminando de esta manera el papel catalitico de estos metales. Antes de examinar la reactividad de estas muestras, fueron estudiadas mediante la tecnica de analisis elemental de carbono por combustion, analisis textural, y por XPS, de estas tecnicas, se obtuvo la composicion de carbono y azufre de las muestras, el area superficial de microporo, volumen de poro y la distribucion de los metales en la superficie. La interpretacion de estos resultados analiticos permitio alcanzar una correlacion fisicoquimica entre la composicion de los materiales carbonosos y la reactividad. El analisis de la reactividad se realizo en una termobalanza acoplada a un cuadrupolo de masas, con la finalidad de monitorear la evolucion de los gases que intervienen en las reacciones de combustion y gasificacion. Ademas de los coques y los flexicoques, se estudio la reactividad de una muestra de residuo de vacio mezclado mecanicamente con metales para estudiar el posible efecto catalitico de los mismos.','2010-07-09','coque retardado, flexicoque, residuo de vacio, TPO, gasificacion, catalisis, vapor de agua, vanadio, niquel, potasio, termobalanza, cuadrupolo de masas',6,1,1,1,1,'2013-09-17 08:36:37','2013-09-17 08:36:37','Documento_511.pdf','application/pdf',3545253,'2013-09-17 08:36:37',20,0,137,'COMPLETO'),(506,'ESTUDIO DE LA MICROEXTRACCINN EN FASE SLLIDA DE LOS HAPs EN MUESTRAS DE CEREALES Y SU ANLLISIS POR CROMATOGRAFAA DE GASES','En el presente trabajo se estudi la Microextraccin en Fase Slida de los Hidrocarburos Aromticos Policclicos (HAPs), empleando las tcnicas de Espacio confinado (EC-MEFS) e Inmersin Directa (ID-MEFS), empleando como sistema de sorcin un bao de glicerina, con una fibra de Polidimetilsiloxano-Divinilbenceno (PDMS-DVB) de 65 m de espesor y como sistema de desorcin y deteccin un Cromatgrafo de Gases con un Detector de Ionizacin a la llama (GC-FID). Entre las variables optimizadas tenemos la fibra empleada en la cual se compararon las de 30 m (PDMS) y la de 65 m (PDMS-DVB), siendo sta ltima la que arrojo mejores resultados. Para el caso de la etapa de sorcin de la tcnica de ID-MEFS se optimiz la temperatura del bao de glicerina y el tiempo de sorcin de la fibra, siendo 65 C y 40 min respectivamente los valores ptimos obtenidos. Se estudi adems el multipatrn de referencia (CUS-9735, Ultra Scientific), el cual posee 25 HAPs de ellos los 16 seleccionados por la Agencia Federal para la Proteccin del Medio Amiente (EPA) de los Estados Unidos, encontrndose que las condiciones empleadas son capaces de detectar hasta 11 de ellos: naftaleno, acenaftileno, acenafteno, fluoreno, fenantreno, antraceno, fluoranteno, pireno, criseno, benzo [b]fluoranteno y benzo[k]fluoranteno, asimismo la tcnica de EC-MEFS puede detectar los 9 primeros si estos se encuentran en una cantidad adecuada para ser sorbidos por la fibra. Se evaluaron 4 tipos de muestras las cuales fueron 2 tipos de trigo: TSRW y HRW as como 2 tipos de maz: Amarillo y blanco; encontrndose que para estas ltimas se lograron identificar los siguientes HAPs: Naftaleno, Fluoreno, Antraceno y Pireno, por ambas tcnicas empleadas, en cambio para las primeras muestras slo se logro detectar la presencia de estos hidrocarburos por la tcnica de EC-MEFS.','2010-10-29','{}',6,1,1,1,1,'2013-09-17 08:36:41','2013-09-17 08:36:41','Documento_512.pdf','application/pdf',0,'2013-09-17 08:36:41',17,0,0,'INCOMPLETO'),(507,'Anlisis de Interferometra de Espn Mediante la Aproximacin Tight-Binding en Gases de Electrones Bidimensionales','Se presentan resultados de aplicar la aproximacin Tight-Binding a gases de elec- trones bidimensionales (2DEG) para un arreglo de interferometra de espn Mach- Zender (MZI) considerando interaccin espn-rbita (EO) [1]. Se hallan condiciones de filtraje efectivo de espn para los dispositivos propuestos siguiendo el arreglo MZI mediante la definicin de la asimetra de transmisin. Adicionalmente, discutimos y comparamos nuestros resultados con propuestas realizadas anteriormente en la lite- ratura [28, 31], que manipulan los efectos Aharonov-Bohm y Aharonov-Casher para desarrollar un filtro de espn. Encontramos que el mtodo de las asimetras de trans- misin es igual de eficiente pero ms sencillo para analizar el filtrado, por lo que puede resultar conveniente para implementaciones en sistemas de mayor complejidad','2010-09-09','Interferometra Espn Tight-Binding Gases Electrones Bidimensionales',3,1,1,1,1,'2013-09-17 08:36:42','2013-09-17 08:36:42','Documento_513.pdf','application/pdf',4487655,'2013-09-17 08:36:42',20,0,184,'COMPLETO'),(508,'Determinacinn de secciones eficaces de produccinn de rayos X caractersticos tipo L y M generados mediante impacto electrnnico','Se determinaron las secciones eficaces de produccin de rayos X tipo L y M de los elementos Au, Ta y Mo, para un rango de energas del haz electrnico entre un valor cercano al umbral de ionizacin correspondiente y una energa mxima de 30 keV. Para ello se midi mediante un espectrmetro EDX, el nmero de fotones X caractersticos NL(E), NM(E), emitidos por el espcimen bombardeado con Ne electrones de energa E. Luego, estos datos fueron convertidos en secciones eficaces de produccin de rayos X caractersticos, al tomar en cuenta el espesor de las pelculas delgadas que se utilizaron como muestras experimentales, la concentracin atmica, el nmero de electrones impactantes, la eficiencia del detector y el ngulo slido de deteccin. En procura de minimizar la proporcin de electrones retrodispersados, las muestras experimentales se elaboraron depositando, mediante la tcnica de pulverizacin catdica, pelculas delgadas de los elementos mencionados sobre pelculas delgadas de carbn, utilizando rejillas de cobre de las usadas en TEM como soportes para el conjunto. Los espesores de las pelculas se determinaron mediante un microscopio de fuerza atmica, al medir la altura de \"escalones\" de material depositado, creados mediante la colocacin de mscaras sobre pastillas de silicio durante la pulverizacin. Se determinaron las secciones eficaces de produccin de rayos X por impacto electrnico Au--La, Au--Lb, Au--Ma, Ta--Ma y Mo-- L, encontrndose una tendencia polinomial de segundo grado en dichas medidas.','2010-05-21','Seccin eficaz, produccin de rayos X caractersticos, espectrmetro EDX, pelculas delgadas.',3,1,1,1,1,'2013-09-17 08:36:45','2013-09-17 08:36:45','Documento_514.pdf','application/pdf',2117562,'2013-09-17 08:36:45',18,0,107,'COMPLETO'),(509,'CARACTERIZACINN DE LA DISPERSINN POST--NATAL DEL PERIQUITO MASTRANTERO ((Forpus passerinus)) EN LOS LLANOS OCCIDENTALES DEL ESTADO GURRICO','Los movimientos que realizan los individuos juveniles desde el lugar de nacimiento al sitio donde se reproducen por primera vez, se conoce como dispersin post-natal. En aves, estos movimientos pueden variar con el sexo. La relacin de sexos en la poblacin adulta de Periquitos Mastranteros en el Hato Masaguaral, Estado Gurico, pudiera estar influenciada por diferencias en la dispersin post-natal y/o mortalidad diferencial entre sexos. Al momento del vuelo, presenta una proporcin sexual 1:1, pero en la etapa adulta el cociente es 1,7 machos por hembra. Con el objetivo de evaluar si hay diferencias en la dispersin entre machos y hembras, 13 juveniles (seis pares de hermanos macho y hembra, y una hembra adicional) fueron monitoreados a diario, usando radio- telemetra, desde el da que abandonaron el nido hasta alrededor de 50 das despus del vuelo. Adicionalmente, se registraron otros juveniles nacidos en el ao 2008, observados durante la bsqueda de los individuos radio-marcados. Los juveniles aumentaron las distancias de dispersin hasta los 45 das de vuelo, luego, algunos machos se acercaron a los nidos, mientras que las hembras permanecieron superando los 1000 metros. Del total de juveniles nacidos en 2008, se observ el 53%, incluyendo el 69% del total de machos y el 38% del total de hembras. Sin embargo, los datos obtenidos con telemetra muestran que machos y hembras tuvieron una supervivencia elevada y similar durante los dos primeros meses de vida. Estos resultados apoyan la hiptesis de que las hembras presentan mayores niveles de dispersin, en lugar de mayor mortalidad, en comparacin con los machos, quienes tienden a quedarse cerca del rea natal. En general, los juveniles fueron vistos ms en sabana arbolada (44%) que en bosque seco (39%) y sabana abierta (17%); con una tendencia a incrementar los tamaos de grupo a medida que se acentu la estacin de sequa.','2010-05-25','Forpus passerinus, dispersin post-natal, telemetra',1,1,1,1,1,'2013-09-17 08:36:46','2013-09-17 08:36:46','Documento_515.pdf','application/pdf',794757,'2013-09-17 08:36:46',19,0,58,'COMPLETO'),(510,'MODELO FISICOQUMMICO EN DOS DIMENSIONES DE LA DIFUSINN DEL INNCa 22++ EN UN MIOCITO ESQUELTTICO..','Resumen Cuando una clula de msculo esqueltico (ME) est expuesta a un determinado estmulo externo (fsico, qumico o elctrico) ocurre a una elevacin transitorial del nivel de Ca2+ en el citosol y ello origina el acortamiento de la clula contrctil y luego, la recaptacin del in produce la relajacin celular. Diversos mecanismos participan en el proceso: canales de calcio dependientes de voltaje (canales de dihidropiridina, DHPR) que permiten la entrada de calcio extracelular cuando se produce despolarizacin del sarcolema (SL), canales del tipo \"sensor voltaje\", canales de Ryanodina (RyR) ubicados en la membrana del retculo sarcoplsmico (RS) que liberan Ca2+ hacia el citosol por diversos mecanismos, protenas buffers que se unen al calcio quelndolo transitoriamente y haciendo su difusin ms lenta, bombas que sacan Ca2+ del citosol, bien hacia depsitos intracelulares como el RS (SERCA) o hacia el medio extracelular (PMCA), intercambiadores del SL y de la membrana mitocondrial, entre otros. El RS es el principal almacn de calcio intracelular en el msculo estriado y participa de forma determinante en la regulacin del proceso acoplamiento-excitacin-contraccin (AEC), regulando las concentraciones intracelulares de calcio durante la contraccin y la relajacin muscular. En este trabajo se model la dinmica correspondiente a la evolucin de la concentracin c(x,y,t) del in calcio en el espacio confinado que existe entre las membranas del RS y el sarcolema (\"junctional space\", \"cleft space\") de una clula de msculo esqueltico, el modelaje se hizo en dos dimensiones y se fundament en la ecuacin de difusin-reaccin (D-R) considerando diversas fuentes (liberacin impulsiva a travs de pocos receptores de RyR y flujos de fuga compensatorios) y sumideros (SERCA, PMCA) y la amortiguacin del Ca2+ por la parvoalbmina. Al resolver numricamente (ya que no tiene solucin analtica) la ecuacin de D-R (a la cual se le se le impuso la condicin de borde homognea de Neumann) mediante el paquete computacional COMSOL Multiphysics3.4  basado en Elementos Finitos se obtuvo la c(x,y,t) en funcin de la posicin para diversos instantes de tiempo y c(x,y,t) en funcin del tiempo para diversas locaciones del dominio, con liberaciones simultneas o no de tres receptores de RyR .','2010-10-28','palabras claves:: msculo esqueltico, miocito, in calcio, difusin-reaccin, elementos finitos, COMSOL, receptores de RyR.',6,1,1,1,1,'2013-09-17 08:36:47','2013-09-17 08:36:47','Documento_516.pdf','application/pdf',1673833,'2013-09-17 08:36:47',20,0,95,'COMPLETO'),(511,' Desarrollo de una Aplicacinn Web para la Gestinn de Historias Clnicas Digitales','El objetivo de este Trabajo Especial de Grado consisti en desarrollar una aplicacin web para la creacin y manipulacin de las historias clnicas digitales, en la que se realiz el manejo y diseo de interfaz, brindando un mayor control y gestin de las historias clnicas de los profesionales de la medicina, configuracin y administracin de informes y rcipes mdicos y gestin de citas. Esta aplicacin web fue desarrollada utilizando como lenguaje de programacin Ruby On Rails, tecnologas del lado del cliente como HTML, HTML5, CSS y JavaScript especficamente la librera JQuery, a travs del mtodo de desarrollo gil de software Programacin Extrema (XP). Para este Trabajo Especial de Grado se realiz una fase de investigacin en la cual se efectu un estudio de las necesidades de mayor importancia con respecto a las historias clnicas manejadas por distintos tipos de mdicos especialistas. Luego de una recoleccin de historias clnicas tradicionales, se logr determinar las caractersticas comunes de las mismas en cuanto a formato, proporcionando informacin relevante para el desarrollo del trabajo. Como producto final se obtuvo una aplicacin web que permite registrar al personal mdico, crear, configurar y modificar el formato de las historias clnicas, como tambin de informes y rcipes mdicos, adems de proveer la posibilidad de gestionar citas mdicas.','2010-10-22','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',2,1,1,1,1,'2013-09-17 08:36:49','2013-09-17 08:36:49','Documento_517.pdf','application/pdf',1832334,'2013-09-17 08:36:49',18,0,131,'COMPLETO'),(512,'COMPOSICINN QUMMICA Y DISPONIBILIDAD AMBIENTAL DE LOS ELEMENTOS EN LOS SEDIMENTOS DEL LAGO DE VALENCIA,, EDO.. ARAGUA y EDO.. CARABOBO','En ste trabajo se presentan los resultados correspondientes al estudio de los sedimentos de fondo del Lago de Valencia, Venezuela, con el objetivo de evaluar su estado ambiental, de acuerdo a su concentracin de metales. Este estudio surge como consecuencia de la importancia del elevado desarrollo urbano e industrial observado en la zona en los ltimos 20 aos, as como por su impacto sobre las aguas del lago cuyo destino principal es el de riego de las zonas agrcolas aledaas. Los ltimos estudios realizados datan de 1988 [7]. En el estudio se consideraron los sedimentos recolectados entre junio-octubre de 2009, de manera bimensual en cinco estaciones (Ei) seleccionadas de acuerdo a las principales influencias industriales, urbanas, domsticas y agrcolas que se desarrollan en los alrededores del lago. Los sedimentos fueron analizados para determinar la composicin total de los elementos Cd, Cr, Cu, Ni, Pb, Zn, Co, V, Fe, Ti, Mn Ca, Mg, Al, Si y Hg, as como carbono orgnico e inorgnico, y su fraccionamiento qumico. Las metodologas aplicadas fueron validadas empleando los estndar de referencia LKSD-4 y BCR-701. De acuerdo al Factor de Enriquecimiento (FE) y al ndice de Geoacumulacin (Igeo) obtenidos empleando los valores de lnea base determinados para el Lago de Valencia por Mogolln [7], los sedimentos de fondo del lago se encuentran enriquecidos con Pb>Zn>Cu>Cr y se clasifican de no contaminados a moderadamente contaminados. Adicionalmente, la concentracin de Corg es elevada lo que sugiere una fuerte intervencin antrpica. Los anlisis de agrupamiento realizados indicaron que la composicin qumica de los sedimentos presenta pequeas variaciones temporales que ocurren en la poca de lluvias, especficamente para las especies Cinorg, Ca, Mg, Mn, Al y Ni, para las que, a excepcin del Al y Ni, su variacin fue atribuida a su precipitacin en forma de carbonatos, que ocurre en todo el lago durante la poca de lluvias. Por otra parte, la composicin de los sedimentos present variaciones espaciales en las concentraciones de Corg, Cu, Zn, Pb y Hg. Excepto para el Hg, la concentracin de los elementos aumenta con la del Corg en las estaciones ms profundas debido a sus condiciones anxicas y reductoras (E1 y E5) y es incrementada por el aporte antrpico domstico-industrial introducido mediante los rios Cao Central y Los Guayos (E3) y domestico-industrial-agrcola por los rios Guey y Tipitapa (E5). Para el resto de los elementos, los resultados indican que su concentracin en los sedimentos es resultante del aporte litogeoqumico de la zona y su variacin en el espacio y en el tiempo es pequea. Los resultados del fraccionamiento qumico indican que el riesgo que presentan los sedimentos tambin vara espacialmente: los sedimentos de la E4 (norte del lago) no presentan riesgo alguno; las estaciones E2 y E5 (sur y este del lago) se parecen en el riesgo medio de sus sedimentos de Zn, Ni y Co, y la E3 (Oeste) riesgo alto en Cr y bajo en Co. En el centro del lago (E1), los sedimentos tienen una composicin mixta, presentando un riesgo medio de Co y Zn. Adicionalmente, los sedimentos de las estaciones presentan un riesgo bajo de Cd, Pb y Cu. Estos resultados concuerdan con los obtenidos por Mogolln (1988) [7] quien obtuvo enriquecimiento de los sedimentos con Pb, Zn, Cu, Cr y Ni, el cual estara localizado en el eje de los rios Los Guayos y Guey. El riesgo determinado para los sedimentos es potencial y solo se observara bajo condiciones fisicoqumicas de las aguas que favorezcan el intercambio, lo cual se espera que no ocurra ya que las aguas del embalse son bsicas debido a la naturaleza carbontica de la litoga de la zona. Este trabajo forma parte del proyecto del CDCH de la UCV PG 03-00-6495-2006.','2010-10-27','{}',6,1,1,1,1,'2013-09-17 08:36:51','2013-09-17 08:36:51','Documento_518.pdf','application/pdf',2655956,'2013-09-17 08:36:51',20,0,91,'COMPLETO'),(513,'DETERMINACIN DE LA DIFUSIN EFECTIVA DE 222Rn y N2O EN UNSUELO AGRCOLA DEL ESTADO PORTUGUESA A PARTIR DEMEDIDAS DE EMISIN SUPERFICIAL Y CONCENTRACIN DE 222Rn ADISTINTAS PROFUNDIDADES','En el presente trabajo fue determinada la difusin efectiva del 222Rn y N2O en unsuelo agrcola del Estado Portuguesa bajo siembra directa, en dos zonas con distintashistorias de uso, a fin de cuantificar la contribucin del transporte fsico en la emisinsuperficial del N2O, gases de inters atmosfrico, a partir del anlisis de 222Rn enmuestras de aire intersticial de los suelos, hasta una profundidad de 100 cm, y de laemisin superficial o flujo, mediante la tcnica de deteccin de centelleo de partculasalfa con sulfuro de zinc, activado con plata, en celdas de Lucas.El anlisis de 222Rn en aire intersticial de los suelos a diferentes profundidadesindic que no existen diferencias significativas en la concentracin de 222Rn encontradaen las dos zonas estudiadas, con una posibilidad de 92% que sean igualesdemostrando que la diferencia en la historia de uso no gener mayor variacin en estacondicin. El perfil del suelo presento concentraciones de 222Rn que variaron entre4.500 y 40.000 Bq m-3 durante el muestreo de este suelo. Las emisiones superficialesmonitoreadas en las dos zonas estudiadas si demostraron estar relacionadas con lashistorias de uso y adems presentaron una marcada relacin lineal con la humedad delos suelos. La emisin superficial tiende a ser mayor en la zona de labranzaconvencional que en la zona de siembre directa. El flujo promedio registrado en ambaszonas estudiadas en este trabajo es de 128  46 Bq m2 h-1. A partir del anlisis de laconcentracin de 222Rn en el perfil de suelo fue posible determinar los valores dedifusin efectiva de 222Rn a distintas profundidades, los cuales corroboran lasdiferencias encontradas en los flujos superficiales de las zonas estudiadas, ya que lautilizacin de la tcnica de labranza convencional, en donde la tierra fue aradarepetidas veces, genera una mayor perturbacin de los primeros 25 cm del suelo ypromueve un aumento en la difusin efectiva en comparacin con zona donde latcnica utilizada fue la siembra directa, donde prcticamente la siembra fue realizadasobre el suelo sin arar.','2010-06-22','Emision supercial de Radon 222.Flujo Superficial del N2O. Radon en suelos agricolas.',6,1,1,1,1,'2013-09-17 08:36:54','2013-09-17 08:36:54','Documento_519.pdf','application/pdf',485596,'2013-09-17 08:36:54',19,0,18,'COMPLETO'),(514,'PRECONCENTRACINN Y ANALISIS MULTIELEMENTAL DE METALES PESADOS EN ACEITES COMESTIBLES -- APLICACINN A ACEITES COMERCIALES VENEZOLANOS','La presencia de metales pesados en los aceites comestibles, se debe a varios factores entre los cuales, el enriquecimiento de los suelos donde se cultivan las semillas oleaginosas, el proceso de refinacin y almacenamiento son las causas ms evidentes. El contenido de metales pesados en los aceites comestibles est limitado, debido al efecto que muchos de ellos tienen sobre la salud humana. A nivel nacional, contamos con las Normas Covenin, las cuales indican los niveles mximos de concentracin de Pb, As, Fe y Cu permitidos en los aceites comestibles comerciales en Venezuela. Estas normas son un reflejo de las normas internaciones expresadas en el Codex Alimentarius.En este trabajo se optimizaron las metodologas de extraccin en el punto de niebla empleando DDTP y APDC como agentes acomplejantes, la extraccin cida y la digestin cida y se compararon en base a sus figuras de mrito: factor de enriquecimiento, LODm, %Rm, y reproducibilidad. La metodologa de extraccin acida result la opcin idnea para la determinacin simultnea de Cd, Cu, Cr, Ni y Pb en aceites comestibles, puesto que es una metodologa sencilla, que permite realizar un elevado nmero de extracciones en poco tiempo, y minimiza los posibles factores de contaminacin debido al empleo de pocos reactivos. Esta metodologa se caracteriz por presentar los mejores lmites de deteccin para todos los analitos (LODm entre 1,5 y 4,75 veces mejor que los obtenidos por extraccin por CPE) y una reproducibilidad superior a la obtenida con los otros mtodos estudiados. La exactitud del mtodo analtico, determinada mediante el estudio de recuperacin efectuado en distintos aceites vegetales, estuvo entre 86% y 103%, a excepcin del Cr para el cual se presentaron problemas de contaminacin en algunos aceites. Para el caso de la digestin acida se observaron bajos lmites de deteccin que limitan su aplicacin al anlisis deseado, y para la metodologa de extraccin por CPE, aunque present lmites de deteccin apropiados, su procedimiento se vi severamente afectado por la contaminacin, bien proveniente del ambiente y/o debido a la cantidad de pasos y reactivos que involucra, lo cual afecta tanto la exactitud como la reproducibilidad de los resultados.La metodologa de extraccin cida y anlisis simultneo mediante ETAAS fue aplicado para la determinacin simultnea de Cd, Cu, Cr, Ni y Pb en una gran cantidad de aceites comerciales venezolanos, de diferentes tipos y marcas, para los cuales se obtuvieron niveles inferiores a los mximos permitidos en las normativas nacionales (que coinciden con los del Codex Internacional), y por lo tanto resultan adecuados para el consumo humano. Este trabajo fue financiado por el proyecto UCV-CDCH- PI-03-7534-2009/1.','2010-10-07','Aceites, aceites comestibles, metales pesados, analisis multielemental, aceites comerciales venezolanos',6,1,1,1,1,'2013-09-17 08:36:55','2013-09-17 08:36:55','Documento_520.pdf','application/pdf',2329944,'2013-09-17 08:36:55',20,0,86,'COMPLETO'),(515,'Teorema de Ramsey para una Clase de Categoras.','En este trabajo presentaremos el Teorema de Ramsey para ciertas clases de categoras, basado en el trabajo de R.L. Graham, K. Leeb y B.L. Rothschild, ttulado \"Ramsey\'s Theorem for a Class of Categories\" publicado en 1972. El teorema de Ramsey que presentaremos en este trabajo es lo suficientemente general como para incluir el caso especial al anlogo del teorema de Ramsey para espacios vectoriales de dimensin finita, mejor conocido como la Conjetura de Gian-Carlo Rota. La Teora de Ramsey es una teora matemtica que pretende justificar que \"el desorden absoluto es imposible\". La Teora de Ramsey afirma que, en sistemas suficientemente grandes siempre existen subsistemas no pequeos con estructura y orden.','2010-07-06','Categora, grafos, producto tensorial, coproducto, funtor, espacio vectorial, conjuntos, coloracin.',5,1,1,1,1,'2013-09-17 08:36:57','2013-09-17 08:36:57','Documento_521.pdf','application/pdf',215954,'2013-09-17 08:36:57',20,0,3,'COMPLETO'),(516,'Estudio de Parmetros Elsticos y Geotcnicos en la Transecta Guarenas - Guatire mediante Mtodos Ssmicos','En el presente trabajo se llevaron a cabo tendidos de Refraccion por Microtremores y Estudios de pozo mediante el metodo Downhole, con la finalidad de obtener cantidades fisicas como son las velocidades de propagacion de ondas de corte (Vs) y de ondas compresionales (Vp) en las cuatro estaciones del transporte colectivo Metro Guarenas-Guatire, necesarias para la caracterizacion de sitio y ytiles para determinar los parametros Elasticos y Geotecnicos.','2010-10-28','Metodos Sismicos, Refraccion por Microtremores, Downhole',3,1,1,1,1,'2013-09-17 08:36:58','2013-09-17 08:36:58','Documento_522.pdf','application/pdf',959002,'2013-09-17 08:36:58',19,0,71,'COMPLETO'),(517,'EVALUACIN DE LA CALIDAD DEL AIRE EN LOS ALREDEDORES DE LA POBLACIN MINERA DE TIARA EMPLEANDO LQUENES COMO BIOMONITORES DE METALES','En este estudio han sido empleados los lquenes para evaluar contaminacin por fuentes fijas (industrias), enfocndonos en la empresa Minera Loma de Nquel C.A., la cual est encargada de explotar a cielo abierto las rocas mficas- ultramficas de esta zona, siendo de mayor inters el mineral silicatado de Garnierita (Ni,Mg)3Si2O5(OH)4 (mena de nquel); alterando as la atmsfera local y generando, posiblemente, problemas de salud en las poblaciones adyacentes como Tiara asociados a la presencia de metales en el aire. Para llevar a cabo esta investigacin fue realizado un monitoreo de tipo activo: fueron trasplantados lquenes Parmotrema sancti angelii (Lynge) Hale desde la Universidad Simn Bolvar hasta los alrededores de la poblacin minera de Tiara (5 puntos en una transecta). Adicionalmente fueron tomadas muestras de suelo superficial en la zona ms distante y cercana a la minera con la finalidad de realizar estudios sobre el factor de enriquecimiento de los metales. La metodologa empleada para analizar las muestras de liquen consisti en la pulverizacin inicial con nitrgeno lquido en un mortero de gata. Posteriormente fueron secados en una estufa por 2 horas y subsiguientemente pesados 350 mg de cada muestra para disolverlas en HNO3 concentrado de grado p.a y bidestilado, empleando para ello un bloque digestor a una temperatura de 120C durante 8 horas. La solucin resultante fue filtrada y enrasada en 25 ml con agua deionizada para determinar los metales (Al, As, Ba, Cd, Co, Cr, Cu, Fe, Hg, Mg, Mn, Ni, Pb, V, Zn y Ti) mediante el uso de espectrometra de absorcin atmica de llama (AAS), Espectrometra de Emisin ptica por Plasma Inductivamente Acoplado (ICP-AES) y el Analizador Directo de Mercurio MA-80. Las muestras de suelo superficial fueron disueltas segn la misma metodologa descrita anteriormente, pero esta vez empleando 500 mg para cada alcuota. Los resultados obtenidos evidencian que existe acumulacin para todos los metales, a excepcin del Cd y As que no fueron detectados, en las muestras trasplantadas. La concentracin en estas muestras refleja muy buena correlacin entre los metales Al, Co, Hg, Fe, Mg, Mn, Ni y Ti a lo largo de la transecta; todos ellos asociados a la litologa explotada por la minera. Otra buena correlacin en los puntos muestreados es observada entre los metales Pb y Zn, ambos comnmente provenientes de fuentes antropognicas (quema de combustibles fsiles). El estudio del factor de enriquecimiento permiti establecer que las concentraciones de los metales Pb y Zn principalmente, no provienen del suelo local de la zona y que su fuente de emisin puede ser atribuida a fenmenos de transporte que actan sobre otras fuentes naturales y/o por fuentes antropognicas.','2010-10-26','Lquenes, Biomonitoreo, Loma de Nquel, Contaminacin del aire, Metales, Parmotrema sancti--angelii, Tiara',4,1,1,1,1,'2013-09-17 08:36:59','2013-09-17 08:36:59','Documento_523.pdf','application/pdf',1665069,'2013-09-17 08:36:59',19,0,79,'COMPLETO'),(518,'Determinacinn de los Niveles de Mercurio Orina en los Nioos de la Poblacinn de El Callao,, Estado Bolvar,, Venezuela..\"\"','El mercurio es un metal txico bajo cualquiera de sus formas: mercurio elemental (Hg0), mercurio inorgnico (I-Hg) o mercurio orgnico (O-Hg). Los efectos del mercurio sobre la salud van a depender de la magnitud de la exposicin que es dependiente del tiempo y la dosis, especie mercurial, la va de entrada al organismo y de la sensibilidad propia de cada individuo, sin embargo los nios son los individuos en los cuales, se pueden manifestar un mayor efecto en vista de que se encuentran en etapas de crecimiento. El mercurio independientemente de la forma en que entre en contacto con el organismo puede causar nefrotoxicidad y neurotoxicidad. El nivel de exposicin a largo plazo se evidencia en la orina, ya que el mercurio es excretado del cuerpo alrededor de 10 das despus de su absorcin o acumulacin en los riones y otros tejidos. Entre las actividades humanas que propician una exposicin a largo plazo se encuentra la minera artesanal del oro, en la cual se libera elevadas cantidades de mercurio al medio ambiente. Esta tipo de minera es comn en poblaciones cercanas a las zonas donde se explota el oro con fines comerciales, como la poblacin de El Callao, en el Estado Bolvar, Venezuela. Por esta razn en el presente trabajo nos hemos propuesto, evaluar el impacto que esta actividad puede tener en la poblacin infantil de El Callao, Edo. Bolvar. Para ello, se realiz una encuesta epidemiolgica para conocer los grados de exposicin de los nios tanto a las fuentes primarias de exposicin al mercurio, as como aquellas que son producto del consumo de alimentos y medicamentos. Por otra parte, se determinaron los niveles de concentracin de Hg por gramo de creatinina en muestras de orina de 24 horas en nios que estudian en 4 instituciones educativas pertenecientes al casco histrico de El Callao, en el estado Bolvar en Venezuela. Se encontraron un valores promedio de 8,21 mg Hg/g creat, un valor de mediana de 1,86 mg Hg/g creat y una desviacin estndar de 16,66 mg Hg/g creat, el rango obtenido de valores de concentracin de las muestras fue de (0,08-90,80) mg Hg/g creat. Las pruebas estadsticas indicaron que existen diferencias significativas al 95% de confianza entre el valor de la mediana de concentracin de Hg y el valor del promedio de concentracin de Hg, lo cual indica que no existi una distribucin normal de los valores. No se encontraron diferencias significativas cuando se relacionaron las medianas de las concentraciones de Hg con variables como la edad, el sexo y el tiempo de residencia en El Callao. Se encontr una tendencia a la disminucin de la concentracin de Hg por gramo de creatinina a medida que aumentaban las distancias entre la vivienda de habitacin de los nios y las posibles fuentes de exposicin como son los molinos, minas, joyeras y talleres. Tambin se encontr que los nios con padres cuya profesin es \"joyeros\" , presentan mayores niveles de concentracin de Hg que los nios que tienen padres molineros y estos a su vez tienen valores mayores de concentracin que los nios que tienen padres mineros. Por ltimo se encontraron mayores concentraciones de mercurio en aquellos nios cuyos hogares son utilizados por sus padres para la quema de amalgamas, y nios que acompaan a sus padres a los molinos.','2010-07-09','mercurio, creatinina, orina, nios, El Callao',6,1,1,1,1,'2013-09-17 08:37:01','2013-09-17 08:37:01','Documento_524.pdf','application/pdf',411110,'2013-09-17 08:37:01',20,0,73,'COMPLETO'),(519,'Desarrollo de una Aplicacin Web para la Gestin de Historias Clnicas Digitales','El objetivo de este Trabajo Especial de Grado consisti en desarrollar una aplicacin web para la creacin y manipulacin de las historias clnicas digitales, en la que se realiz el manejo y diseo de interfaz, brindando un mayor control y gestin de las historias clnicas de los profesionales de la medicina, configuracin y administracin de informes y rcipes mdicos y gestin de citas.Esta aplicacin web fue desarrollada utilizando como lenguaje de programacin Ruby On Rails, tecnologas del lado del cliente como HTML, HTML5, CSS y JavaScript especficamente la librera JQuery, a travs del mtodo de desarrollo gil de software Programacin Extrema (XP). Para este Trabajo Especial de Grado se realiz una fase de investigacin en la cual se efectu un estudio de las necesidades de mayor importancia con respecto a las historias clnicas manejadas por distintos tipos de mdicos especialistas. Luego de una recoleccin de historias clnicas tradicionales, se logr determinar las caractersticas comunes de las mismas en cuanto a formato, proporcionando informacin relevante para el desarrollo del trabajo. Como producto final se obtuvo una aplicacin web que permite registrar al personal mdico, crear, configurar y modificar el formato de las historias clnicas, como tambin de informes y rcipes mdicos, adems de proveer la posibilidad de gestionar citas mdicas.','2010-10-22','Historia clnica, Historia clnica digital, informe, rcipe, cita, Programacin Extrema (XP), base de datos, tecnologas.',2,1,1,1,1,'2013-09-17 08:37:02','2013-09-17 08:37:02','Documento_525.pdf','application/pdf',4657372,'2013-09-17 08:37:02',18,0,115,'COMPLETO'),(520,'SIMULACINN EN COMPUTADORA DEL CRECIMIENTO TUMORAL DE GLIOMAS MEDIANTE ECUACIONES DE REACCINN--DIFUSINN','En este trabajo se crearon dos programas con la finalidad de simular el crecimiento de gliomas usando ecuaciones de reaccin-difusin. Para ello fue necesario crear una imagen segmentada que indicara la distribucin de materia blanca y gris en el cerebro. Luego se defini el tensor de difusin tomando en cuenta que los gliomas difunden ms rpido en materia blanca que en materia gris. As mismo en el programa uno se uso un trmino de proliferacin exponencial (Swanson y Clartz) y para el segundo programa se utilizo un trmino de proliferacin logstico.A continuacin se escogi un par ordenado (x,y) como punto de inicio del tumor; para generar luego: grficas de curvas de nivel de nivel de densidades, grficas de crecimiento del tumor en el cerebro, as como perfiles mes a mes y valores de concentracin promedio, dimetro y concentracin en el punto de origen. Como resultado se obtuvo que el programa 1 no se ajusta a la realidad, ya que su crecimiento supone que el tumor crece y difunde como si hubiese nutrientes y espacio ilimitado; mientras que el programa dos es ms cercano a lo observable clnicamente en crecimiento de tumores. Adems las imgenes que se generaron corroboran el hecho clnico de que el tumor difunde ms all del volumen microscpico.','2010-10-29','Simulacion, glioma, diferencia finitas.',3,1,1,1,1,'2013-09-17 08:37:04','2013-09-17 08:37:04','Documento_526.pdf','application/pdf',1212194,'2013-09-17 08:37:04',17,0,109,'COMPLETO'),(521,'Plataforma para el estudio y desarrollo de mtodos de continuacin','Los mtodos de continuacin son una herramienta til para el estudio de algunas aplicaciones de la industria y las ciencias, son utilizados para resolver sistemas de ecuaciones no lineales que dependen de uno o ms parmetros.Este trabajo presenta una plataforma para el anlisis y desarrollo de mtodos de continuacin, que consiste en un software elaborado en Matlab con una interfaz grfica de usuario diseada para facilitar el trabajo de desarrollo, estudio, anlisis y enseanza del tpico.El entorno propuesto sirve de soporte para realizar diversas actividades; permite a los desarrolladores la creacin y anlisis de mtodos de continuacin al mismo tiempo que facilita la comprensin y la didctica del tema a estudiantes y docentes.La interfaz de usuario, como parte fundamental del software desarrollado, toma encuenta conceptos importantes de usabilidad.','2010-06-15','mtodos de continuacin, sistemas de ecuaciones no lineales, bifurcacin, diagrama de bifurcacin, corrector, predictor, usabilidad, orden uno, oden cero, pseudo-comprimiento de arco, intefaz de usuario, matlab',2,1,1,1,1,'2013-09-17 08:37:08','2013-09-17 08:37:08','Documento_527.pdf','application/pdf',2328051,'2013-09-17 08:37:08',18,0,100,'COMPLETO'),(522,'Topologias sobre conjuntos numerables','En ste trabajo estudiamos la caracterizacin de topologas definidas sobre conjuntosnumerables que S. Todorcevic y C. Uzctegui dan a los conjuntos numerables , estableciendo conexiones entrelas propiedades de la teora descriptiva de conjuntos y propiedades puramente topolgicas.En el captulo 1 presentamos algunos preliminares de topologa que sern de utilidada lo largo del trabajo.','2010-07-07','Topologia, Topologia sobre Conjuntos Numerables, conjuntos sigma-deltas, delta- sigma, Topologia descriptiva de conjuntos',5,1,1,1,1,'2013-09-17 08:37:12','2013-09-17 08:37:12','Documento_528.pdf','application/pdf',421105,'2013-09-17 08:37:12',20,0,83,'COMPLETO'),(523,'Cohomologa Invariante por acciones libres de S1','La cohomologa de De Rham es un funtor de la categora de las variedades diferenciablesen los espacios vectoriales y detecta estructuras geomtricas en variedades, cuando lavariedad esta afectada por la accin de un grupo de Lie compacto podemos determinarla cohomologa de invariante de De Rham, dada por las formas invariantes por la accin.En [2] se demuestra que ambas cohomologas coinciden para cualquier accin. En estetrabajo probaremos este mismo resultado para acciones libres de S1 para ello haremosuso del truco de Bredon.','2010-07-02','Variedades Diferenciales, Fibrados, Fibrado de formas, Cohomologia de De Rham, Sucesion de Mayer-Vietoris, acciones libres,',5,1,1,1,1,'2013-09-17 08:37:13','2013-09-17 08:37:13','Documento_529.pdf','application/pdf',2903035,'2013-09-17 08:37:13',19,0,124,'COMPLETO'),(524,'EN UNA ENCRUCIJADA ENTRE EL ANALISIS DE COMPONENTES PRINCIPALES (ACP) Y EL ANALISIS ENVOLVENTE DE DATOS (AED)','Se realiza un estudio comparativo de dos tcnicas de clasificacin de unidades de produccin, tambin llamadas Unidades de Toma de Decisin (UTD). Las UTD utilizan un conjunto de recursos (Entradas) para generar un conjunto de resultados (Salidas). Las tcnicas antes mencionadas son: El Anlisis de Componentes Principales (ACP), que es una tcnica estadstica de reduccin de dimensin y de clasificacin para las UTD; y El Anlisis Envolvente de Datos (AED), metodologa de Programacin Lineal para medir la eficiencia de las UTD, considerando eficiente una UTD, cuando con una cantidad determinada de Entradas genera ms Salidas o cuando utilizando menos Entradas se generan un mximo de Salidas. Adems de aplicar el ACP y el AED, se aplica un mtodo que los integra, con el fin de clasificar 45 pases de acuerdo con la proporcin de supervivencia al cancer de piel (melanoma)entre hombres y mujeres, teniendo en cuenta la accin de los rayos ultravioletas A y B, la Capa de Ozono y la Latitud de cada pas.','2010-06-10','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; m',5,1,1,1,1,'2013-09-17 08:37:15','2013-09-17 08:37:15','Documento_530.pdf','application/pdf',22340418,'2013-09-17 08:37:15',20,0,200,'COMPLETO'),(525,'Estructuras Combinatorias y Anlisis Asinttico','El Trabajo tiene como propsito el empleo de tcnicas operacionales de la teora de variable compleja en espacios discretos que son el ambito natural del anlisis combinatorio. Se hacen estimaciones asintticas de los coeficientes de series formales que aproximan objetos combinatorios en procesos enumerativos.','2010-06-23','Estructuras Combinatorias',5,1,1,1,1,'2013-09-17 08:37:17','2013-09-17 08:37:17','Documento_531.pdf','application/pdf',2061727,'2013-09-17 08:37:17',20,0,119,'COMPLETO'),(526,'Principio Generalizado de la Versin Homolgica de la Simetra Espejo','La simetra espejo, es una conjetura que proviene de la fsica, especficamente de laidenticacin de modelos relacionados con la teora de cuerdas. Esta conjetura no era deltodo bien entendida, pues se supona que dos tipos de teoras (de tipo A y de tipo B) dabanorigen a invariantes equivalentes, pero en principio la naturaleza de estas teoras era distinta,luego, no estaba clara es qu sentido se considerba la equivalencia.En 1994, Maxim Kontsevich propuso un acercamiento matemtico a la conjetura de lasimetra espejo, el propuso que la simetra espejo consista en una equivalencia de categorastrianguladas construdas desde diferentes aspectos de la geometra de variedades Calabi- Yaudonde se definen las teoras de tipo A y B, stas se denominan variedades espejos. La mtricade Calabi-Yau est determinada por una forma simplctica y una estructura compleja, cadapieza es una rama distinta de las matemticas. En teoras de tipo A, slo nos preocupamos dela estructura compleja y nos trasladaremos a la geometra algebraica, y en las teoras de tipoB, slo discutimos geometra simplctica. Luego, que ambas teoras sean equivalentes quieredecir, que las teoras de deformacin de ambas estructuras, las cuales estn controladas porcategoras trianguladas, son equivalentes.Nuestro objetivo es seguir esta construccion, a n de establecer un principio analogo parael caso de un objeto que posea dos estructuras.','2010-07-06','Categora,Complejos,Variedades,Deformacin,Simetra,Espejo,Homologa,Operad,Mdulos',5,1,1,1,1,'2013-09-17 08:37:21','2013-09-17 08:37:21','Documento_532.pdf','application/pdf',0,'2013-09-17 08:37:21',20,0,0,'INCOMPLETO'),(527,'Anlisis Comparativo del Comportamiento de Alimentacin de dos vectores del Mal de Chagas: Panstrongylus geniculatus y Triatoma infestans (Hemiptera: Reduviidae)','Panstrongylus geniculatus y Triatoma infestans son dos de los principales vectores del Mal de Chagas. La eficiencia de cada una de estas especies como vector de la tripanosomiasis americana depende en gran parte de su comportamiento de alimentacin. Se describi cualitativa y cuantitativamente el comportamiento de alimentacin de ambos vectores, y se propusieron criterios para estimar la eficiencia de cada especie como vector. No se encontraron diferencias significativas en cuanto a tiempo de aproximacin a la presa, tiempo desde que se aproxima a la presa hasta que se alimenta, nmero de intentos de picada y nmero de defecaciones. Triatoma infestans tuvo una mayor longitud de recorrido y un mayor tiempo total de alimentacin que P.. geniculatus, pero requiri un menor tiempo desde la primera alimentacin hasta la primera defecacin y defec a menor distancia de la presa que P.. geniculatus. De ambas especies, Triatoma infestans es potencialmente el vector mas eficiente en la transmisin del mal de Chagas.','2010-04-26','Panstrongylus, Triatoma, chipo, comportamiento, alimentacin, vector, Chagas',1,1,1,1,1,'2013-09-17 08:37:22','2013-09-17 08:37:22','Documento_533.pdf','application/pdf',3457059,'2013-09-17 08:37:22',16,0,162,'COMPLETO'),(528,'Hidroformilacin de 11--hexeno catalizada por el complejo dinuclear gem--ditiolato de rodio((I)) [Rh22((--S22CBn22))((cod))22]//P((OPh))33:: Estudios Cinticos','En el presente trabajo de investigacin se estudi la reaccin de hidroformilacin de 1-hexeno en fase homognea, catalizada por el complejo dinuclear gem-ditiolato de rodio(I) [Rh2(-S2CBn2)(cod)2] (cod = 1,5-ciclooctadieno) (Bn = C6H5-CH2- ) en presencia de P(OPh)3, bajo presin de gas de sntesis (CO/H21:1) utilizando tolueno como solvente. Los productos de reaccin observados fueron: heptanal y 2-metil-hexanal provenientes de la reaccin de hidroformilacin y 2- hexeno proveniente de la reaccin de isomerizacin. Con el propsito de optimizar las condiciones de reaccin; pudindose constituir un aporte al diseo de sistemas catalticos eficientes y estables enfocados al mejoramiento de gasolinas, se estudiaron diferentes parmetros que implican la variacin de presin de gas (CO/H2), temperatura, relacin molar sustrato/catalizador ([S/ C]) y variacin de la cantidad de catalizador ([mM]). Los estudios cinticos involucraron la variacin de presin en el intervalo 100 psi (7atm) - 500 psi (34atm), temperatura comprendida entre60 C (333 K) - 90 C (363 K), la relacin molar sustrato/catalizador en el intervalo 300 - 800 y concentracin del catalizador comprendida entre (1,67 - 5,05)mM.Las condiciones ptimas de reaccin son: presin de CO/H2 (500 psi/34 atm), temperatura (79C/352K), relacin molar [1-hexeno ]/[Rh] en (772) y la [Rh] en 1,68mM.','2010-07-13','Catlisis Homognea, Hidroformilacin, Rodio, gem-ditiolato, Complejo de Rodio, Gas de Sntesis, Estudios Cinticos.',6,1,1,1,1,'2013-09-17 08:37:23','2013-09-17 08:37:23','Documento_534.pdf','application/pdf',2037313,'2013-09-17 08:37:23',17,0,96,'COMPLETO'),(529,'Caractizacion del Hbitat y Composicin de la Dieta del Babo Morichalero (Paleosuchus palpebrosus) en los Llanos Orientales, Estado Anzotegui','El propsito de este trabajo fue caracterizar el hbitat y la composicin de la dieta de Paleosuchus palpebrosus. El estudio se realiz en los llanos orientales, al suroeste del Estado Anzotegui. El clima es biestacional con seis meses de sequa (Noviembre-Abril) y seis meses de lluvia (Mayo-Octubre). La temperatura media anual es 26.2 C, y la precipitacin total media anual es 890 mm. Las capturas de los animales se realizaron en tres ros con bosque ribereo siempre verde. El hbitat se caracteriz utilizando variables como: altura del dosel del bosque, densidad de cobertura del dosel del bosque, profundidad de la lmina de agua, velocidad de la corriente de agua, y ancho del lecho del ro. Los tres ros muestreados fueron muy similares entre s, aunque se encontraron diferencias estadsticamente significativas en cuanto a la altura de dosel entre los ros Negro y Cangilones (Hc = 12,01; gl = 1; P < 0,05), al igual que con las variables \"ancho del cauce del ro\" (Hc = 12,26; gl = 1; P < 0,05) y \"velocidad de la corriente\" (Hc = 9,35; gl = 2; P < 0,05). Se registr la presencia de babos morichaleros en todos los micro hbitats evaluados. Sin embargo, la distribucin espacial de los animales detectados sugiere que stos tienden a utilizar con mayor frecuencia el micro hbitat \"Solapa\". 76,79 % de los animales detectados se encontraron en el micro hbitat \"Solapa\". La composicin de la dieta anual estuvo mayormente representada por crustceos (cangrejos, 25 % y camarones, 6,2 %), insectos (Ortpteros, 24,9%), mamferos (Roedores, 19,4%), peces (caraciformes, 13,8%), y reptiles (serpientes, 2,5%), en trminos de abundancia. En trminos de frecuencia de aparicin, los renglones alimentarios consumidos ms importantes fueron insectos (46,2 %) y cangrejos (35,9 %) y los menos frecuentes araas (10,3 %) y reptiles (2,6 %). La composicin de la dieta fue similar entre sexos (U = 32; P = 0,0636; a = 0,05). La diversidad de la dieta (ndice de Shannon- Wiener) fue similar entre juveniles y sub-adultos (tp = 1,4183 < tc = 1,71; gl = 23; a = 0,05) y diferente entre sub-adultos y adultos (tp = 0,7933 < tc = 1,67; gl = 52; a = 0,05). Los resultados sugieren que P.. palpebrosus es un depredador oportunista que consume principalmente invertebrados terrestres y acuticos.','2010-07-06','Paleosuchus palpebrosus, hbitat, dieta.',1,1,1,1,1,'2013-09-17 08:37:24','2013-09-17 08:37:24','Documento_535.pdf','application/pdf',0,'2013-09-17 08:37:24',16,0,0,'INCOMPLETO'),(530,'AMBIENTE INFORMTTICO DE TRABAJO COLABORATIVO PARA LA ADMINISTRACINN Y CONTROL DE PROYECTOS DE ALFABETIZACINN TECNOLGGICA','El presente trabajo tiene como objetivo principal el estudio y diseo de un sistema para la administracin y control de proyectos para la Alfabetizacin Tecnolgica, con la capacidad de crear, gestionar y administrar estos proyectos de forma tal que puedan ser terminados completamente dentro de las restricciones de alcance, tiempo y costo planteados en su inicio. Dada la naturaleza nica de un proyecto, en contraste con otros procesos u operaciones de una organizacin, administrarlo requiere de una filosofa distinta, as como de habilidades y competencias especficas. La gerencia de proyectos implica ejecutar una serie de actividades, que consumen recursos como tiempo, dinero, gente, materiales, energa, comunicacin, etc. para lograr los objetivos predefinidos. Esta investigacin permitir desarrollar una aplicacin informtica que tiene como principales funcionalidades la creacin y planificacin de proyectos, gestin de tareas, gestin de recursos, gestin de usuarios, gestin de informes y respaldo de informacin.','2010-11-19','Proyectos, Gerencia de Proyectos, Alfabetizacin Tecnolgica',2,1,1,1,1,'2013-09-17 08:37:25','2013-09-17 08:37:25','Documento_536.pdf','application/pdf',3617645,'2013-09-17 08:37:25',17,0,98,'COMPLETO'),(531,'Aceptacinn y Comisionamiento de Colimador Micro Multilminas.. Calibracinn con Cmara de Ionizacinn Lquida de 00,,000022 cc','Los avances tecnolgicos de las ltimas dcadas han permitido el desarrollo de nuevos dispositivos que permiten una mejor conformacin del haz de radiacin, al proporcionar una mayor resolucin espacial. Estos dispositivos son denominados colimadores micro multilminas (mMLC), son colocados como dispositivos accesorios o fijos al acelerador lneal de uso clnico. Paralelamente a esto, se han desarrollados detectores de radiacin que permiten realizar mediciones dosimtricas con una mayor precisin, acorde con las dimensiones de los tamaos de campo proporcionados por los sistemas mMLC. En el presente trabajo se realizan las pruebas de aceptacin del mMLC (m3 BrainLAB), a fin de comprobar que el mismo cumple con las especificaciones de fabricante, y se realizan las pruebas de comisionamiento, a fin de establecer las condiciones de referencia iniciales, para futuras comparaciones luego de pruebas de controles de calidad, reparaciones o sustitucin de partes del acelerador. Las pruebas de aceptacin y comisionamiento se dividieron en pruebas mecnicas, dosimtricas y de seguridad. En las pruebas mecnicas se comprob que las caractersticas en cuanto a isocentros y dems componentes mecnicos del acelerador no son modificadas al instalar el mMLC. En las pruebas dosimtricas se emplearon pelculas radiogrficas de verificacin (para determinas los isocentros de rotacin del gantry y del mMLC, comparacin de tamaos de campos luminosos y de radiacin), cmaras de ionizacin gaseosas (para de determinas los curvas de PDD y perfiles para diferentes tamaos de campos conformados) y por ltimo la cmara de ionizacin liquida 0,002cc (microLion - PTW) (para determinar los factores de salida para campos cuadrados conformados y las diferentes componentes de transmisin y fuga en el mMLC). Se compararon los factores de salida obtenidos con la cmara de ionizacin de 0,015cc (PinPoint - PTW). En las pruebas de seguridad se comprobaron que los diversos sistemas de seguridad del acelerador relacionados con el mMLC funcionan correctamente. Se comprob finalmente, que el mMLC cumple con las especificaciones del fabricante y se recomienda la utilizacin de la cmara de ionizacin lquida microLion para futuras calibraciones e implementacin de protocolo de control de calidad basado en las pruebas de aceptacin y comisionamiento propuestas.','2010-12-10','colimador micro multilminas, cmara de ionizacin lquida',3,1,1,1,1,'2013-09-17 08:37:26','2013-09-17 08:37:26','Documento_537.pdf','application/pdf',1252579,'2013-09-17 08:37:26',20,0,88,'COMPLETO'),(532,'COMPARACIN EN GEOMETRA DE HAZ ESTRECHO DE LA RESPUESTA DEL DETECTOR DE DIAMANTE Y LA CMARA DE IONIZACIN LQUIDA DE 0.002 cc','Tratamientos con radiaciones ionizantes como la radiociruga utilizan haces de fotones estrechos. En este tipo de campos las cmaras de ionizacin con medio de deteccin gaseoso han sido hasta los momentos usadas para realizar la calibracin fsica del equipo. Estas cmaras pueden presentar problemas, debidos a la falta de equilibrio de partculas cargadas (CPE). Los procedimientos de control de calidad asociados a este tipo de tratamientos demandan dosmetros de alta resolucin espacial. Es por ello que existe en el mercado una cmara nueva, la cual consta de un medio de deteccin lquido, esta cmara de ionizacin la MicroLion 31018 posee un volumen sensible a la radiacin de 0,002 cc, el objetivo principal de este Trabajo Especial de grado (T.E.G) fue el caracterizar la cmara de ionizacin liquida MicroLion, comparando las medidas obtenidas con ella contra las medidas obtenidas por el detector de diamante para campos pequeos, desde 5 cm2 hasta 0.5 cm2 para potenciales aceleradores de 6 MV y 18 MV.','2011-02-04','camara de ionizacion liquida, detector de diamantes, haz estrecho, factores de salida, isooctano',3,1,1,1,1,'2013-09-17 08:37:28','2013-09-17 08:37:28','Documento_538.pdf','application/pdf',21702248,'2013-09-17 08:37:28',20,0,68,'COMPLETO'),(533,'Algoritmo trazador de rayos ssmicos en medios heterogneos estratificados istropos usando tcnicas nmericas.','En la prospeccin ssmica, especialmente en la exploracin petrolera, se necesita saber el camino que siguen los rayos ssmicos en el subsuelo, tomando en cuenta las diferentes capas geolgicas presentes. Como cada capa tiene su impedancia caracterstica, la velocidad de propagacin de las ondas vara con la regin del subsuelo en el cual se desplazan. El trazado de rayos ssmico ha sido ampliamente usado como una tcnica de exploracin del subsuelo, produciendo con una explosin (fuente) una onda que luego es recibida por varios sensores repartidos apropiadamente de acuerdo a la mejor configuracin utilizada sobre la superficie del terreno (receptores).Las aplicaciones de esta tcnica van desde la exploracin petrolera y en general toda la minera, as como en sismologa donde se ha usado para el estudio de la corteza, el manto y el ncleo terrestre usando como fuentes el hipocentro de terremotos, hasta otros campos del conocimiento como la Ingeniera Civil, para esclarecer los tipos de suelos donde se van a construir estructuras, en la arqueologa, en estudios de sonares, en la deteccin de objetos tridimensionales con ondas snicas o electromagnticas (GPR), en el diseo de equipos pticos, y en el diseo de redes WAN entre otras.Siendo el problema del trazado de rayo extraordinariamente complejo, su solucin solo puede obtenerse usando tcnicas numricas computacionales. En este sentido, en el presente trabajo, se emularon satisfactoriamente los resultados obtenidos y propuestospor Andrej Bna, Michael Slawinski y Peter Smith en el artculo [5] presentado en el ao 2009, titulado Ray tracing by simulated annealing: Bending method. Adems, se comprob que el mtodo fu capaz de trazar rayos bastantes precisos y se propusieronmejoras para dicho algoritmo.Debido a la fuerte no linealidad del problema de optimizacin descrito, fu necesario buscar la solucin en forma iterativa. Con el fin de evitar posibles mnimos locales y una convergencia prematura, se utiliz el mtodo de optimizacion global conocido como Recocido Simulado y se utilizaron modelos sintticos.Para emular y comprobar el correcto funcionamiento y eficiencia del presente algoritmo, se utilizaron modelos de velocidades existentes en la literatura, como fueron el modelo exponencial linealmente heterogeneo y el modelo de Marmousi. Dicho algoritmo se program en Octave, el cual proporcion una interfaz de lnea de comandos para resolver nmericamente los problemas no lineales encontrados.','2011-01-27','800x600 Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-parent:\"\";',3,1,1,1,1,'2013-09-17 08:37:29','2013-09-17 08:37:29','Documento_539.pdf','application/pdf',3244326,'2013-09-17 08:37:29',20,0,66,'COMPLETO'),(534,'Desarrollo de una metodologa de ensayo mecnico para la determinacinn de los parmetros elsticos en muestras de lutita de nccleos de pozos petroleros','El siguiente trabajo se realiz diferentes ensayos para determinar las propiedades mecnicas en ncleos de lutita. Vale destacar que la lutita es una roca sedimentaria resultante de la compactacin de los sedimentos ricos en arcilla y constituyen el tipo ms frecuente de las rocas encontradas durante la perforacin de petrleo y gas. Para las muestras sometidas a estudios, mediante anlisis de difraccin de rayos \"X\", se aprecia que el contenido de arcilla es lo suficientemente alto y con alto grado de compactacin, correspondiendo a arcillas gravosas compactadas con minerales como caolinita y siderita.Los ensayos mecnicos en muestras de muy baja permeabilidad como la lutita, adems de ser tan complejas desde el punto de vista de estabilidad de hoyo (por su inestabilidad qumica y fsica), se presenta que la variacin de presin de poros (PP) es mucho mayor a la variacin de las presiones externas a la que est sometida la muestra, causando que el rompimiento de la muestra no sea inducido por la carga axial, sino por la variacin de la presin efectiva, ya sea axial = - o radial= - , trayendo como consecuencia medidas errneas en la obtencin de los mdulos elsticos y largos tiempos de ensayo.Los ensayos mecnicos a los que se sometieron las muestras de lutita fueron de dos tipos:  Ensayos dinmicos de propagacin acstica donde se realiza estudios del comportamiento de las velocidades de ondas \"P\", \"S1\" y \"S2\" cuando se propagan a travs de las muestras a distintas presiones de confinamiento. De estos ensayos se obtiene que las velocidades muestran una poca variacin con el aumento del confinamiento, adems de las bajas variaciones de los mdulos elsticos debido a la poca porosidad y alta compactacin de la muestra. Tambin se tiene que para muestras verticales y horizontales existe una diferencia en los mdulos elsticos, donde las muestras horizontales arrojan valores de mdulo de Young (44.81 GPa en promedio) mayores 1.7 veces a los valores de mdulo de Young en muestras verticales (26.35 GPa en promedio). Estos resultados se atribuyen a la disposicin de la laminacin al momento del corte de los tapones, donde en muestras horizontales con laminacin vertical, las llegadas de las ondas son mucho ms rpidas que en las muestras verticales cuya laminacin es horizontal. Las relaciones de Poisson para muestras horizontales estuvieron comprendidas entre 0.24 y 0.26 mientras que para muestras verticales la relacin de Poisson estuvo entre los 0.28 y 0.30.Ensayos estticos triaxiales con presin de poros para determinar las propiedades mecnicas estticas de los ncleos de lutita. En estos se utilizaron los protocolos propuestos por la ASTM (American Society for Testing & Materials) para el acondicionamiento y ensayo de las muestras, donde se persigue controlar la presin de posos (PP) simultneamente con las variaciones de las presiones externas (axial y confinante), y as determinar los mdulos elsticos y los parmetros \"B\" y \"A\" de la Ley de Skempton:D= D+ D- D mediante las curvas de Esfuerzo Vs. Deformacin. Cada ensayo triaxial consto de dos fases, una fase de saturacin, donde la muestras fueron sometidas a confinamiento nicamente para medir la respuesta de la presin de poros con los cambios de las presiones de confinamiento empleando un sistema de drenaje lateral para acelerar las fases de la saturacin, estabilizar la presin de poros y garantizar que no haya una respuesta violenta durante la aplicacin de carga axial; y una fase de fracturamiento donde, mediante presin axial, se procede al fracturamiento de las muestras y la respectiva medicin a travs de las curvas de Esfuerzo Vs. Deformacin de los mdulos de Young y relacin de Poisson. De este ensayo se estim (en promedio) mdulos de Young medio, tangente y secante de 7.88, 9.17 y 3.34 GPa respectivamente, mientras que para muestras verticales se tienen mdulos de Young medio, tangente y secante de 4.12, 2.22 y 3.00 GPa respectivamente (casi 1.7 menor que las muestras horizontales). Estas diferencias, al igual que en los ensayos acsticos, son atribuidas a la disposicin de la laminacin en las muestras. En cuanto a la relacin de Poisson, los valores medidos en estos ensayos no fueron muy representativos debido a que el enchaquetado utilizado absorba parte de la deformacin radial que se inducia en la muestra, arrojando calores en promedio de 0.1 aproximadamente tanto para muestras verticales como horizontales.Todos estos ensayos a los que fueron sometidos las muestras de lutita se realizaron en las instalaciones del Laboratorio de Geomecnica de la empresa PDVSA- INTEVEP, el cual cuenta con equipos de alta tecnologa entre los cuales se encuentra el equipo AutoLab2000, cuyo diseo es el apropiado para medir propiedades acsticas, mecnicas y elctricas en rocas de yacimientos petrolferos.','2011-02-18','Lutita, triaxiales, Presin de poros, Presion confinante, propiedades mecnicas, modulos elsticos.',3,1,1,1,1,'2013-09-17 08:37:31','2013-09-17 08:37:31','Documento_540.pdf','application/pdf',2943455,'2013-09-17 08:37:31',18,0,109,'COMPLETO'),(535,'EMPACADO AL VACIO DEL LOMO DE ATNN ALETA AZUL ((Thunnus sp..))COMO ALTERNATIVA PARA AUMENTAR LA VIDA TTIL EN EL ALMACENAMIENTO CONGELADO A --2200 C','En Venezuela el producto de la pesca del atn (TThunnus sp.) est dirigido principalmente como materia prima para la industria conservera, a la cual se destina el 35 % de la produccin nacional de hojalata. Sin embargo, el proceso de globalizacin ha introducido en Venezuela la modalidad del consumo de pescado crudo, entre ellos el atn, destacndose los atunes aleta azul y ojo grande, los cuales son utilizados principalmente para elaborar sashimi, el cual es un plato de origen japons que consiste en consumir pescados y mariscos crudos. La conservacin del pescado crudo destinado a la preparacin de sashimi consiste en mantenerlo refrigerado de 0 a 5 C o congelado a -40 C para conservar los atributos que definen la calidad del pescado fresco. Esto ltimo ha impulsado a la industria a desarrollar procesos y tecnologas que permitan conservar los atributos que definen la calidad del atn fresco por un perodo de tiempo que favorezca su comercializacin. De ah proviene el inters de conservar el atn fresco, empacado al vaco y congelado a -20 C, usando un laminado polimrico con propiedades de barrera como la impermeabilidad al oxgeno para evitar o minimizar la rancidez de los cidos grasos y la oxidacin de la mioglobina; la impermeabilidad al vapor de agua para evitar o minimizar las prdidas de humedad y compuestos voltiles aromticos; y la opacidad a la luz. Adems deber poseer resistencia mecnica a -20 C. Por todo esto se estableci como objetivo evaluar la estabilidad fsica y qumica de trozos de atn aleta azul (Thunnus sp..))empacados al vaco y a presin atmosfrica, congelados y almacenados a -20 C. Se encontr que el empacado al vaco del atn fresco y su posterior congelacin a -20 C ofrece mayor proteccin a los trozos de lomo de atn y conserv sus atributos de calidad durante los 90 das de almacenamiento a -20 C. En promedio, este tratamiento mostr los valores ms bajos de BVT, TBA, PS, as como los indicadores microbiolgicos y el tejido muscular mantuvo su color rojo caracterstico durante el almacenamiento; seguido por el tratamiento de empacado postproceso de congelacin, el cual ofrece la desventaja de la manipulacin del producto congelado.','2011-02-21','atn, congelacin, empacado, vaco',1,1,1,1,1,'2013-09-17 08:37:35','2013-09-17 08:37:35','Documento_541.pdf','application/pdf',2689715,'2013-09-17 08:37:35',20,0,141,'COMPLETO'),(536,'Creacin de un Plugin para NetBeans que Agilice el Desarrollo de Aplicaciones Web Utilizando el Framework Dinmica','El presente Trabajo Especial de Grado (T.E.G.) comprende la creacin de una herramienta para agilizar el desarrollo de aplicaciones Web usando como base el framework Dinmica. Este framework venezolano posee un repositorio de plantillas que constituyen soluciones pre-construidas para resolver problemas comunes presentes en el desarrollo de aplicaciones web. El objetivo principal de este T.E.G es minimizar la carga de trabajo de los programadores al automatizar las tareas que comprenden el proceso de reutilizacin que trae consigo el uso del framework Dinmica, aumentando as la productividad.La herramienta desarrollada consiste en un plugin para NetBeans IDE formado por diversos mdulos para cubrir cada una de las funcionalidades. Desde la creacin y configuracin de un proyecto base hasta la creacin y configuracin de las plantillas ms importantes, as como una plantilla general y un mdulo para el manejo de la seguridad.Para el desarrollo del plugin se utilizaron diversas tecnologas como son el framework Dinmica, que es la base de la propuesta, NetBeans IDE 6.9 que constituye el entorno integrado de desarrollo (IDE por sus siglas en ingls -Integrated Development Environment-) para el cual se cre la herramienta, Java como lenguaje de programacin y Apache Tomcat versin 6.0.26 como contenedor Web.Se cumpli con los objetivos planteados y se evaluaron los resultados, determinando que la herramienta desarrollada constituye un gran aporte en el incremento de la productividad de los programadores, usuarios del framework Dinmica.','2011-02-17','Aplicaciones Web, framework, framework Dinmica, programacin extrema, plugin, NetBeans',2,1,1,1,1,'2013-09-17 08:37:38','2013-09-17 08:37:38','Documento_542.pdf','application/pdf',2370162,'2013-09-17 08:37:38',20,0,178,'COMPLETO'),(537,'\"\"HIDRODESMETALIZACINN,, ASISTIDA ELECTROQUMMICAMENTE VAA PERMEACINN DE HIDRGGENO,, DE MOLCCULAS MODELO Y EXTRACTOS PORFIRNICOS CONTENIDOS EN CRUDOS\"\"','Se estudi la reactividad del hidrgeno atmico (H), electroqumicamente adsorbido sobre superficies de negro de Pd, en la conversin de metaloporfirnas modelo (VOTPP y NiTPP) y extractos porfirnicos provenientes de un crudo venezolano; bajo condiciones de reaccin ptimas establecidas: densidad de corriente catdica de -1,92 mA.cm-2, presin atmosfrica y 25 C. Estas reacciones se realizaron usando dos (2) medios de reaccin: (i) un medio de reaccin simple o no emulsificado; donde el sustrato a convertir (molculas modelo de vanadilo y nquel, y extracto porfirnico proveniente de un crudo venezolano) se disuelve en cloroformo (CHCl3) como solvente y (ii) un medio de reaccin emulsificado (O/W; emulsin aceite en agua, tipo normal), donde se evaluaron cuatro (4) condiciones diferentes para la fase dispersante (W), favoreciendo as la transferencia de fase del metal liberado durante la reaccin con el H. Los medios emulsificados (O/W) evaluados son: sustrato+CHCl3/agua desionizada, sustrato+CHCl3/HCl 1x10-5 M, sustrato+CHCl3/ HCl 1x10-5 M+EDTA 4x10-4 M y sustrato+CHCl3/EDTA 4x10-4 M. Una vez que ste fue formulado y caracterizado se estudia el efecto del medio emulsificado en las reacciones de desmetalizacin. Los porcentajes de conversin para las metaloporfirnas modelo y el extracto porfirnico fueron mucho mayores al reaccionar empleando un medio emulsificado (mximos de 38% y 24% respectivamente) que un medio de reaccin simple (8,7% y 0% respectivamente). El emplear un medio emulsificado permite fomentar y cuantificar la reaccin de desmetalizacin del complejo porfirnico en el tiempo. Al cuantificar la cantidad de metal libre en la fase dispersante (W), al final de la reaccin, se demostr que la ruptura o clivaje de las metaloporfirnas fue efectivo. Para las molculas modelos evaluadas y el extracto del crudo se reportan porcentajes de desmetalizacin de 73% y 6% respectivamente, para un tiempo mximo de reaccin de seis (6) horas.','2011-02-15','Hidrgeno atmico, reacciones asistidas electroqumicamente, hidrotratamiento, porfirnas',6,1,1,1,1,'2013-09-17 08:37:38','2013-09-17 08:37:38','Documento_543.pdf','application/pdf',1427170,'2013-09-17 08:37:38',20,0,115,'COMPLETO'),(538,'Sntesis y caracterizacinn de la slice mesoporosa SBA--1155 y compuestos relacionados tipoMO..Fe22O33//SBA--1155','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin;} En este trabajo se sintetiz SBA-15 mediante el mtodo sol-gel. Se utilizaron temperaturas de tratamiento hidrotermal de 35 C, 65 C y 100 C. Para la SBA-15/100 se utilizaron dos mtodos de secado: convencional por evaporacin y liofilizacin. A partir de las muestras obtenidas se elaboraron compuestos del tipo MO.Fe2O3/ SBA-15, para lo cual se introdujo la SBA-15 en el proceso de sntesis del xido MO. Fe2O3 en condiciones de atmsfera inerte. La caracterizacin de la estructura porosa de los slidos se realiz por el mtodo Brunauer, Emmet y Teller (BET), a partir de las isotermas de N2 a 77 K. La muestra SBA-15 sintetizada a 100 C present el ciclo de condensacin ms marcado, la mayor _rea superficial y la presencia de microporosidad. Las muestras SBA-15 sintetizadas a 65 C y 35 C, mostraron la ausencia de microporosidad, un aspecto fundamental que caracteriza a la SBA-15. La muestra SBA-15 liofilizada result con un rea superficial y volumen de poros menor a la secada en estufa. Los estudios de difraccin de rayos X a bajo ngulo indicaron la formacin de la SBA-15, con ligeras diferencias estructurales entre las muestras evaporada y liofilizada. La caracterizacin del xido de hierro elaborado previamente a la sntesis de los compuestos MO.Fe2O3/SBA-15 indica que el mtodo usado permiti obtener ferrita de hierro nanomtrica con un tamao de partcula menor a 20 nm. Sin embargo no se logr identificar la fase ferrita en los compuestos a travs de las tcnicas de caracterizacin empleadas. El anlisis magntico por magnetometra de muestra vibrante, dio como resultado un comportamiento superparamagntico para la ferrita y en los compuestos MO.Fe2O3/SBA-15 se verific un comportamiento de tipo paramagntico.','2011-03-10','SBA-15, Mesoporos, Magnetita, Areas BET, VSM, Superparamagnetismo, Ferritas',3,1,1,1,1,'2013-09-17 08:37:41','2013-09-17 08:37:41','Documento_544.pdf','application/pdf',1371838,'2013-09-17 08:37:41',19,0,82,'COMPLETO'),(539,'Sistema para el Control y Seguimiento de la Implementacin de la Metodologa de Gestin de Procesos de Negocio sustentada en el Uso de Patrones','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom: 10.0pt; mso-para-margin-left:0cm; line-height:115%; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin;} En la compaas que desarrollan sofware, bajo el paradigma Gestin de Proceso de Negocio, es necesario un sistema que permita el seguimiento y control de los mtodos, herramientas y tcnicas usados en el Proceso de Desarrollo; a fin de lograr la reutilizacin en otros proyectos de los componentes, a travs, de su adaptacin y la asociacin de un modelo de calidad, permitiendo la trazabilidad de cada proceso. Este Trabajo Especial de Grado busca implementar un Sistema que permita verificar y asumir las hiptesis mencionadas anteriormente. Una solucin capaz de llevar de manera metdica y sistemtica el proceso de desarrollo de software, para que con ello se pueda garantizar la calidad del producto final en cada una de sus fases a travs de la reutilizacin de experiencias exitosas y un modelo de calidad establecido. Como base terica a la situacin planteada, se tom en cuenta una Metodologa de Gestin de Proceso de Negocio sustentada en el uso de Patrones propuesta por el Dr. Pedro Bonillo y para la plataforma de desarrollo se seleccion Intalio BPMS 6.0 y Netbeans IDE con el framework JSF (Java Server Faces). El uso de estas herramientas permiti modelar, disear y colocar en ejecucin el proceso de negocio en una plataforma que permite gestionarlo y adaptarlo a cualquier organizacin en base a las mejores prcticas.','2011-01-31','{}',2,1,1,1,1,'2013-09-17 08:37:42','2013-09-17 08:37:42','Documento_545.pdf','application/pdf',1376652,'2013-09-17 08:37:42',16,0,94,'COMPLETO'),(540,'Sistema para el Control y Seguimiento de la Implementacin de la Metodologa de Gestin de Procesos de Negocio sustentada en el Uso de Patrones','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom: 10.0pt; mso-para-margin-left:0cm; line-height:115%; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin;} En la compaas que desarrollan sofware, bajo el paradigma Gestin de Proceso de Negocio, es necesario un sistema que permita el seguimiento y control de los mtodos, herramientas y tcnicas usados en el Proceso de Desarrollo; a fin de lograr la reutilizacin en otros proyectos de los componentes, a travs, de su adaptacin y la asociacin de un modelo de calidad, permitiendo la trazabilidad de cada proceso. Este Trabajo Especial de Grado busca implementar un Sistema que permita verificar y asumir las hiptesis mencionadas anteriormente. Una solucin capaz de llevar de manera metdica y sistemtica el proceso de desarrollo de software, para que con ello se pueda garantizar la calidad del producto final en cada una de sus fases a travs de la reutilizacin de experiencias exitosas y un modelo de calidad establecido. Como base terica a la situacin planteada, se tom en cuenta una Metodologa de Gestin de Proceso de Negocio sustentada en el uso de Patrones propuesta por el Dr. Pedro Bonillo y para la plataforma de desarrollo se seleccion Intalio BPMS 6.0 y Netbeans IDE con el framework JSF (Java Server Faces). El uso de estas herramientas permiti modelar, disear y colocar en ejecucin el proceso de negocio en una plataforma que permite gestionarlo y adaptarlo a cualquier organizacin en base a las mejores prcticas.','2011-01-31','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',2,1,1,1,1,'2013-09-17 08:37:43','2013-09-17 08:37:43','Documento_546.pdf','application/pdf',1362744,'2013-09-17 08:37:43',16,0,95,'COMPLETO'),(541,'Anlisis de Espectros UV de Estrellas O en las Nubes de Magallanes obtenidos con FUSE','En este trabajo hemos extendido el atlas espectral de estrellas gigantes y supergigantes O de las Nubes de Magallanes observadas con el satlite Far Ultraviolet Spectrosocopic Explorer (FUSE) en el rango de 900-1200  (Walborn et al. 2002, ApJS 141, 443), incorporando los espectros de 20 estrellas muy tempranas de la secuencia principal.Estos espectros han sido procesados y organizados por tipo espectral y clase de luminosidad, recuperando las correlaciones entre los vientos estelares y los parmetros fundamentales de las estrellas O encontradas por Walborn et al. Especficamente, hemos analizado las lneas espectrales de los iones OVI (ll 1032, 1038 ) y CIII (l 1176 ). Adems, hemos confirmado las anomalas en la abundancia de CNO en las estrellas de mayor masa y luminosidad (O2) y cuantificado las relaciones encontradas mediante ndices espectrales definidos para caracterizar los perfiles P Cygni en el doblete OVI y la absorci\'on de CIII.','2011-01-10','Estrellas; estrellas tipo temprano; ndices espectrales; Nubes de Magallanes',3,1,1,1,1,'2013-09-17 08:37:44','2013-09-17 08:37:44','Documento_547.pdf','application/pdf',4604468,'2013-09-17 08:37:44',19,0,146,'COMPLETO'),(542,'Creacin de un plugin para NetBeans que agilice el desarrollo de aplicaciones web utilizando el framework Dinmica.','El presente Trabajo Especial de Grado (T.E.G) comprende la creacin de una herramienta para agilizar el desarrollo de aplicaciones Web usando como base el framework Dinmica. Este framework venezolano posee un repositorio de plantillas que constituyen soluciones pre-construidas para resolver problemas comunes presentes en el desarrollo de aplicaciones web. El objetivo principal de este T.E.G es minimizar la carga de trabajo de los programadores al automatizar las tareas que comprenden el proceso de reutilizacin que trae consigo el uso del framework Dinmica. La herramienta desarrollada consiste en un plugin para NetBeans IDE formado por diversos mdulos para cubrir cada una de las funcionalidades. Desde la creacin y configuracin de un proyecto base hasta la creacin y configuracin de las plantillas ms importantes, as como una plantilla general y un mdulo para el manejo de la seguridad. Para el desarrollo del plugin se utilizaron diversas tecnologas como son el framework Dinmica, que es la base de la propuesta, NetBeans IDE 6.9 que constituye el entorno integrado de desarrollo para el cual se cre la herramienta, Java como lenguaje de programacin y Apache Tomcat versin 6.0.26 como contenedor Web. Se cumpli con los objetivos planteados y se evaluaron los resultados, determinando que la herramienta desarrollada constituye un gran aporte en el incremento de la productividad de los programadores, usuarios del framework Dinmica. Autores: Eduardo A. Carrasquero B. Daniela C. Marfil G. Tutores: Prof. Rhadams Carmona Lic. Armando Vieira','2011-02-17','Normal 0 21 false false false ES-TRAD X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso',2,1,1,1,1,'2013-09-17 08:37:45','2013-09-17 08:37:45','Documento_548.pdf','application/pdf',2036126,'2013-09-17 08:37:45',20,0,117,'COMPLETO'),(543,'EVALUACIN FITOQUMICA DE LOS EXTRACTOS APOLARES DE CROTON PUNGENS','En un primer estudio fitoqumico de los extractos apolares de los tallos y las hojas de Croton pungens se aislarony caracterizaron nueve compuestos, de los cuales cuatro fueron caracterizados como: b-sitosterol (I), fitol (II),nor-ent- kaurano (III) y un ester de cadena larga del b-sitosterol (IV); se identificaron igualmente por CG/EMmezclas complejas de alcoholes y compuestos alifticos de cadenas largas. La evaluacin toxicolgica delextracto acuoso de las hojas de Croton pungens determin que la planta es segura de acuerdo a la OMS para eluso de este extracto en otras pruebas in vivo y el extracto no present actividad analgsica para la dosis de0.5113 g/Kg (1/2 DT50).','2011-02-28','Croton pungens, b-sitosterol, fitol, nor-ent-kaurano, ester de cadena larga del b-sitosterol, evaluacintoxicolgica',6,1,1,1,1,'2013-09-17 08:37:47','2013-09-17 08:37:47','Documento_549.pdf','application/pdf',1792767,'2013-09-17 08:37:47',20,0,99,'COMPLETO'),(544,'ANLISIS COMPARATIVO DE LOS PERFILES PROTEICOS DE UNA VARIEDAD RESISTENTE Y UNA SUSCEPTIBLE DE ZEA MAYSSIN INFECTAR EINFECTADAS CON ASPERGILLUS FLAVUS.','El ataque de patgenos en plantas resulta en numerosas respuestas bioqumicas y la activacin de algunas de ellas determina la habilidad de la planta de combatir enfermedades. El maz es uno de los principales alimentos producidos y consumidos en nuestro pas, y el mejoramiento de este rubro requiere de un manejo agronmico para el cual es importante el desarrollo de diferentes investigaciones. Las investigaciones sobre el ataque de patgenos a este cultivo se han enfocado en el estudio de diversos genes y protenas que posiblemente acten en la resistencia de los granos contra el ataque de los mismos. Sin embargo, la informacin concerniente a las protenas que se encuentran constantemente presentes en estos granos sin alterar su expresin, podra complementar el rol de las rutas metablicas necesarias en este rubro y ser utilizada para futuras investigaciones. En este trabajo se utilizaron herramientas protemicas para identificar protenas constantemente presentes en los perfiles proteicos de granos de una lnea resistente y una susceptible de Zea mays sin inocular e inoculadas con el hongoAspergillus flavus. Los spotsseleccionados fueron sometidos a una digestin iin situ con tripsina seguida de su posterior identificacin por espectrometra de masas de tipo MALDI-TOF. En el presente trabajo se seleccionaron un total de 20 protenas y tras su identificacin la mayor parte de las protenas estn asociadas con el metabolismo (50%) entre las que se encuentran las involucradas con la sntesis de isoprenoides, ruta del mevalonato y el ciclo celular, otra buena parte con condiciones de estrs (40%) como la produccin de especies reactivas de oxgeno, estrs hdrico y patogenicidad, y por ltimo una pequea parte de protenas hipotticas (10%) cuya funcin no ha sido reportada an.','2011-01-28','zea mays, proteomica, aspergillus flavus, respuestas bioquimicas, proteinas',1,1,1,1,1,'2013-09-17 08:37:49','2013-09-17 08:37:49','Documento_550.pdf','application/pdf',5423386,'2013-09-17 08:37:49',20,0,118,'COMPLETO'),(545,'Diagnstico serolgico deferencial de la fase aguda y crnica de la Esquistosomiasis: estudio de las glicoprotenas del glicocalix de la cercaria','La Esquistosomiasis o Bilharziosis es una de las enfermedades parasitarias ms difundida en el mundo que afecta a ms de 200 millones de personas en las zonas tropicales e intertropicales. Es causada por algunas de las especies de gusanos planos del gnero Schistosoma y consiste en una dolencia fundamentalmente crnica, que debilita severamente a quienes la padecen, reduce su capacidad productiva, los incapacita y limita sus perspectivas de progreso econmico y social. Despus de la malaria, esta parasitosis ocupa el segundo lugar en importancia desde un punto de vista socioeconmico y de salud pblica. En Venezuela, la nica especie que infecta al hombre es Schistosoma mansoni el cual se encuentra diseminado en una superficie de 15.000 Km2 de la zona centro- costera del pas (estados Aragua, Carabobo, el norte de Gurico, Miranda y Vargas). Las cercarias del Schistosoma mansoni son estadios larvales constituidos por un cuerpo y una cola bifurcada, los cuales estn recubiertos por un tegumento con un rea de 20.000 mm2. En su parte ms externa, el tegumento est cubierto por una membrana trilaminada limitada por un denso glicocalix altamente antignico que parece jugar un papel importante en la respuesta innata y adaptativa del hospedador y es el responsable de la reaccin antgeno-anticuerpo que ocurre en presencia de sueros de pacientes. Una serie de mtodos parasitolgicos, bioqumicos e inmunoqumicos fueron utilizados para llevar a cabo este estudio. Su aplicacin permiti investigar desde la cercario-reaccin ms sencilla hasta lo ms complejo como la identificacin, aislamiento y caracterizacin de los polipptidos antignicos y sus eptopes en el glicocalix de la cercaria. Un mtodo mecnico sencillo fue diseado para separar las cercarias en cuerpos y colas sin producir prdida del glicocalix y sin afectar su morfologa externa, ni su antigenicidad. La cercario-reaccin fue de utilidad para monitorear la presencia del glicocalix durante la separacin de cercarias en cuerpos y colas. Nuevos antgenos aparecieron en ambas regiones como consecuencia de la separacin. Los antgenos identificados en una u otra regin como consecuencia de la separacin (58,2 y 64 kDa en cuerpos y 35 y 53,6 kDa en cuerpos y colas). Los antgenos identificados en los extractos de cuerpos y de colas no resultaron ser la suma de los identificados en el extracto de cercarias completas. Antgenos de peso molecular entre 16,5- 84,3 kDa fueron reconocidos durante las primeras seis semanas de infeccin (fase aguda) y a las 16 semanas (fase crnica), antgenos adicionales de alto peso molecular fueron detectados (104-109,8 kDa). Esto podra ser consecuencia de eventos inmunitarios producidos durante el progreso de la fase crnica de la infeccin. La oxidacin-reduccin con metaperiodato de sodio/borohidrato de sodio de la glicoprotena antignica dominante de 65 kDa, no alter su reconocimiento por el suero de infeccin aguda y crnica, mientras que las de 97,5-100 y 108,2 kDa fueron reconocidas antes y despus del tratamiento nicamente por el suero de infeccin crnica. Esto sugiere que los anticuerpos producidos durante la infeccin crnica estn dirigidos contra eptopes glicosdicos y peptdicos de estas glicoprotenas, lo que puede explicar la reduccin en intensidad de las bandas del doblete de 97,5-100 kDa reconocidas por el suero de infeccin crnica despus del tratamiento. El hecho de que en la infeccin aguda se produzcan anticuerpos que reconocen eptopes polipeptdicos en la glicoprotena de 65 kDa y en la fase crnica contra otros tres (97,5-100 y 108,2 kDa), podra ser til para la identificacin de su secuencia polipeptdica conducente a la sntesis qumica de eptopes lineales destinados a la discriminacin de estas dos fases de la enfermedad. La evaluacin de reactividad cruzada con otros parsitos relacionados es requerida para determinar la especificidad de estos eptopes de antgenos glicoproticos.','2011-02-16','Esquistosomiasis,Schistosoma mansoni, Glicoprotenas, Diagnstico',1,1,1,1,1,'2013-09-17 08:37:51','2013-09-17 08:37:51','Documento_551.pdf','application/pdf',12473836,'2013-09-17 08:37:51',19,0,269,'COMPLETO'),(546,'Prototipo de sistema automatizado de triaje para la emergencia hospitalaria','El triaje de emergencia persigue desarrollar el proceso de valorizacin clnica preliminar para ordenar los pacientes segn el nivel de urgencia o gravedad, antes de la atencin mdica, de forma que, en una condicin de saturacin del servicio o disminucin de recursos, los pacientes ms graves sean tratados con prioridad. Un proceso de triaje presenta un alto grado de imprecisin o incertidumbre al momento de expresar el estado de salud de un paciente, en consecuencia puede haber dificultad y riesgo en la clasificacin de las urgencias. En los servicios de emergencias de los hospitales pblicos venezolanos, en especial el servicio de emergencia del Hospital Universitario de Caracas (HUC), se ha evidenciado un incremento en el nmero de casos que se atienden, siendo una constante la saturacin del servicio, lo cual imposibilita que los pacientes con prioridad de atencin, sean tratados ms rpidamente de forma oportuna y eficaz. En este Trabajo Especial de Grado se construyo un prototipo Web de triaje sustentado en el modelo conceptual de datos difuso de triaje para el sector salud venezolano, basado en el proceso de triaje hospitalario de la Sociedad Venezolana de Medicina de Emergencia y Desastres (SVMED), ya que ste dara un empuje a la implementacin de un Sistema Clnico de soporte a la toma de decisiones para triaje a nivel nacional tomando como eje el HUC. El sistema consta de cuatro (04) mdulos: el primero es la implementacin del esquema relacional difuso, el segundo es el mdulo Cliente FSQL, el tercero ejecuta las consultas tanto difusas como no difusas y por ltimo, se tiene un mdulo que implementa la captura de los datos de entrada y emite el resultado de la clasificacin de triaje obtenido mediante el mdulo Cliente FSQL.','2010-11-02','Triaje, Base de Datos Difusas, Sistema Clnico de soporte a la toma de decisiones',2,1,1,1,1,'2013-09-17 08:37:54','2013-09-17 08:37:54','Documento_552.pdf','application/pdf',11293721,'2013-09-17 08:37:54',17,0,108,'COMPLETO'),(547,'Estimacinn de Cuantiles en la Medicinn de Riesgo Financiero..','Se desarroll el artculo titulado \"On quantile estimation by bootstrap\" realizado por Erik Brodin que presenta un mtodo alternativo para estimar cuantiles, que a su vez es un mtodo alternativo para estimar la medida de riesgo denominada Valor en Riesgo, VaR por sus siglas en ingls.Se presentan algunas aplicaciones.','2011-04-14','Cuantiles, Valor en Riesgo (VaR), Bootstrap, Bootstrap exacto',5,1,1,1,1,'2013-09-17 08:37:56','2013-09-17 08:37:56','Documento_553.pdf','application/pdf',0,'2013-09-17 08:37:56',20,0,0,'INCOMPLETO'),(548,'ESTUDIO DE LAS PROPIEDADES MAGNTTICAS Y CRISTALOGRFFICAS DEL SULFURO MIXTO DE HIERRO Y TITANIO Fe22TiS44','En el presente Trabajo Especial de Grado se sintetiz el compuesto de Sulfuro Mixto de Hierro y Titanio Fe2TiS4 por medio de la fusin directa de los elementos en proporciones estequiomtricas. Posteriormente, se realizaron los estudios de caracterizacin cristalogrfica y magntica de la muestra a travs de Difraccin de Rayos X y Espectroscopa Mssbauer. Las medidas cristalogrficas del Fe2TiS4 evidencian la presencia de una estructura monoclnica del tipo Cr3S4, con parmetros de red a==5,965, b==3,423, c==11,255, b==91,48. A travs de la Espectroscopa Mssbauer se obtuvieron los siguientes resultados: 1. 1. Por primera vez se evidencia la existencia de dos sitios cristalogrficos independientes del Hierro en la estructura. Estos dos sitios fueron postulados por refinacin de Rayos X de un cristal simple. 2. 2. Por primera vez se determina la Temperatura de Debye para cada sitio cristalogrfico del Hierro con valores de 250K y 550K. El primer valor corresponde al sitio en la capa denominada capa con vacancias y el segundo corresponde al sitio en la capa denominada capa metlica. 3. 3. La evolucin del campo magntico con la temperatura no sigue el modelo del magnetismo localizado a travs de la funcin de Brillouin. 4. 4. La temperatura de transicin magntica con el valor de 290K.','2011-04-11','Sulfuro Mixto de Hierro y Titanio, caracterizacin cristalogrfica y magntica, Difraccin de Rayos X, Espectroscopa Mssbauer, Temperatura de Debye, funcin de Brillouin',3,1,1,1,1,'2013-09-17 08:37:56','2013-09-17 08:37:56','Documento_554.pdf','application/pdf',0,'2013-09-17 08:37:56',20,0,0,'INCOMPLETO'),(549,'DEGRADACION FOTOCATALITICA DE NICOTINA USANDO TiO22//UV','En el presente trabajo se estudi la fotocatlisis heterognea de la nicotina empleando un simulador solar y TiO2 comercial como catalizador, se evalu el proceso variando el pH del medio y la concentracin inicial del sustrato orgnico; donde se determin la constante cintica de pseudo-primer orden de Langmuir-Hinshelwood, cuyo valor disminuye con el aumento de la concentracin inicial del compuesto orgnico. Adems, los datos experimentales se ajustaron a ste modelo cintico. La degradacin slo se llev a cabo a la condicin de pH cido. A partir de estos resultados se realiz la degradacin utilizando un reactor tubular operando en flujo continuo a fin de comparar con los resultados obtenidos en un reactor batch. Estos resultados arrojaron que el reactor tubular de flujo continuo es el ms efectivo entre ambos reactores; habiendo ajustado los parmetros cinticos de la degradacin, se sigui la fotocatlisis midiendo la demanda qumica de oxgeno, a partir del cual se obtuvo la constante cintica de pseudo-primer orden de la mineralizacin (formacin de CO2, H2O y amonaco), cuyo valor es menor que la correspondiente a la degradacin (desaparicin de la nicotina), lo que sugiere la formacin de un intermediario estable en el proceso de mineralizacin, el cual no se logr identificar por cromatografa de gases debido a la baja solubilidad del posible intermediario en el solvente orgnico que se utiliz para la extraccin. Para evaluar la toxicidad de las fracciones de nicotina obtenidas durante la degradacin, se realiz una prueba de toxicidad empleando semillas de lechuga (Lactuca Sativa L), de la cual se obtuvo como resultado que estas fracciones no son txicas, dado que en uno de los parmetros estudiados (elongacin de la radcula y del hipocotilo) se present un aumento en la longitud y en el otro una pequea disminucin, la cual no es indicativo de la toxicidad.','2011-05-13','{}',6,1,1,1,1,'2013-09-17 08:37:58','2013-09-17 08:37:58','Documento_555.pdf','application/pdf',11293721,'2013-09-17 08:37:58',18,0,108,'COMPLETO'),(550,'\"\"Caracterizacin Morfolgica y Qumica del residuo insoluble asociado al Mrmol Dolomtico de Guacuripia, estado Bolvar, mediantes tcnicas de Difraccin de rayos X y Microscopa Electrnica de Barrido\"','En el presente trabajo de investigacin se llev a cabo un estudio sobre la caracterizacin morfolgica y qumica del residuo insoluble asociado al mrmol dolomtico de Guacuripia edo. Bolvar, mediante tcnicas de Difraccin de Rayos X (DRX) y Microscopa Electrnica de Barrido (MEB).Para ello fueron seleccionadas seis muestras de rocas con la ayuda de 4 criterios de seleccin, a partir de dichas rocas se elaboraron secciones finas de las mismas. El tratamiento qumico de las rocas consisti en el ataque cido con HCl 12 M para la disolucin de los componentes carbonaticos y as obtener el residuo no carbontico el cual es el objeto de este estudio. Cabe destacar que este ataque se realiz de dos maneras diferentes, la primera fue una digestin por pasos y el segundo ataque fue una digestin en un solo paso, con la finalidad de evaluar la alteracin del residuo no carbontico por ambas digestiones.Se tomaron fragmentos de las distintas rocas para realizarle un anlisis mineralgico por (DRX), encontrndose en su mayora minerales como calcita y dolomita y en menor proporcin cuarzo, brucita, clinocloro, grafito, tremolita, olivino, cordierita, todorokita, moscovita y montmorillonita.El porcentaje de residuo no carbontico obtenido para las rocas estudiadas vara desde 6% hasta un 64 %, y en cuanto a su anlisis mineralgico por DRX se encontr en su mayora minerales ndices de metamorfismo como se muestran a continuacin: forsterita, dipsido, pirita, cordierita, vesuvianita, clinocrisotilo, grafito, tremolita, moscovita, olivino, cuarzo y tridimita.Los resultados obtenidos por Microscopa Electrnica de Barrido indican que la morfologa presente en los granos minerales estudiados del residuo, presentan caras bien definidas indicando que estos se formaroninsitu producto del metamorfismo, adems se realizaron anlisis qumicos puntuales a dichos granos para identificar a que fase mineral pertenecan apoyndonos en los resultados obtenidos por DRX.','2011-03-02','Morfologia, Minerales Metamorficos, Microscopa Electronica de Barrido',4,1,1,1,1,'2013-09-17 08:37:59','2013-09-17 08:37:59','Documento_556.pdf','application/pdf',1254959,'2013-09-17 08:37:59',20,0,84,'COMPLETO'),(551,'Utilizacin de la cmara de ionizacin lquida en maniqu de tejido equivalente para verificacin de dosimetra clnica','{}','2010-12-10','dosimetra clnica, dosimetra fsica, tejido equivalente.',3,1,1,1,1,'2013-09-17 08:38:01','2013-09-17 08:38:01','Documento_557.pdf','application/pdf',0,'2013-09-17 08:38:01',19,0,0,'INCOMPLETO'),(552,'Sistema de Recoleccinn de Estadsticas y Generacinn de Reportes Web como una extensinn del navegador Mozilla Firefox','Hoy en da, muchos sitios Web carecen de mecanismos que les permitan obtener informacin acerca del comportamiento de los usuarios que navegan por la red. La mayora de los servicios estadsticos ofrecidos, realizan un anlisis del comportamiento de los usuarios que acceder a un sitio Web, de manera global, ya que tienen la necesidad de abarcar la mayor cantidad de sitios Web posibles a quienes puedan ofrecer sus servicios. Sin embargo, dichos sistemas no proporcionan informacin de un usuario en especfico, ni el comportamiento que estos presentan en aspectos relacionadoas a la navegabilidad, funciones utilizadas, tiempo de respuesta del usuario para completar una tarea especfica en un sitio Web, tipos de interaccin,etc. Dada esta situacin, en el presente trabajo se desarrolla un sistema de estadsticas basado en la arquitectura Cliente-Servidor encargado de recolectar estadsticas y mostrar la informacin acerca del comportamiento del usuario mientras navega por la Web, brindando reportes que pueden ser analizados por un ente interesado y lograr mejoras relacionadas a la usabilidad del sitio Web.','2011-05-09','XUL, XPCOM, JavaScript, XPConnect, JSF, extensin, estadsticas',2,1,1,1,1,'2013-09-17 08:38:02','2013-09-17 08:38:02','Documento_558.pdf','application/pdf',11293721,'2013-09-17 08:38:02',20,0,108,'COMPLETO'),(553,'Sistema de Recoleccin de Estadsticas y Generacin de Reportes Web como una extensin del navegador Mozilla Firefox','Hoy en da, muchos sitios Web carecen de mecanismos que les permitan obtener informacin acerca del comportamiento de los usuarios que navegan por la red. La mayora de los servicios estadsticos ofrecidos, realizan un anlisis del comportamiento de los usuarios que acceden a un sitio Web, de manera global, ya que tienen la necesidad de abarcar la mayor cantidad de sitios Web posibles a quienes puedan ofrecer sus servicios. Sin embargo, dichos sistemas no proporcionan informacin de un usuario en especfico, ni el comportamiento que estos presentan en aspectos relacionadoas a la navegabilidad, funciones utilizadas, tiempo de respuesta del usuario para completar una tarea especfica en un sitio Web, tipos de interaccin, etc.Dada esta situacin, en el presente trabajo se desarrolla un sistema de estadsticas basado en la arquitectura Cliente-Servidor encargado de recolectar estadsticas y mostrar la informacin acerca del comportamiento del usuario mientras navega por la Web, brindando reportes que pueden ser analizados por un ente interesado y lograr mejoras relacionadas a la usabilidad del sitio Web.','2011-05-09','XUL, XPCOM, JavaScript, XPConnect, JSF, extensin, estadsticas.',2,1,1,1,1,'2013-09-17 08:38:03','2013-09-17 08:38:03','Documento_559.pdf','application/pdf',2449622,'2013-09-17 08:38:03',20,0,129,'COMPLETO'),(554,'ESTUDIO DE LA FORMACINN DE LOS COMPLEJOS DE NQQUEL((II)) CON LOS AMINOCCIDOS CCIDO ASPRRTICO,, CCIDO GLTTAMICO,, HISTIDINA Y CISTENNA MEDIANTE MEDIDAS DE EMF ((H)) EN NaCl 11,,00 M Y A 2255 C..','El presente Trabajo Especial de Grado se basa en el estudio de la formacin de los complejos formados entre el nquel(II) y los ligandos cido asprtico, cido glutmico, cistena e histidina. Se estudiaron los siguientes sistemas: H+ - cido Asprtico H+ - Ni(II) - cido Asprtico H+ - cido Glutmico H+ - Ni (II) - cido Glutmico H+ - Cistena H+ - Ni(II) - Cistena H+ - Histidina H+ - Ni(II) - Histidina Para el estudio de estos sistemas se emplearon medidas de fuerza electromotriz emf(H) a 25C y en NaCl 1,0 M como medio inico inerte y el anlisis de los datos se emple los programas de mnimos cuadrados LETAGROP y LETAGROP/FONDO, obtenindose as los valores de pKa para los ligandos y los valores de las constantes de formacin (log bpqr), para los complejos hallados en este trabajo. En las tablas I y II se muestran los resultados obtenidos. Tabla 11..Valores de pKa obtenidos para cada uno de los ligandos, medidos en NaCl 1,0 M a 25C. Especies H++-- ccido Asprtico pKa H++-- ccido Glutmico pKa H++-- Cistena pKa H++-- Histidina pKa H33C++// H22C 1,76(3) 2,32(4) 2,05(3) 2,50 (5) H22C // HC-- 3,58(3) 4,15(3) 8,11(3) 8,76(7) HC-- // C22-- 9,47(5) 9,37(4) 9,86(4) 9,06(7) Dispersinn ((s)) 0,031 0,031 0,023 0,035 Tabla 22.. Complejos obtenidos con sus constantes de formacin, log bpqr para los sistemas: H+ - Ni(II)- cido asprtico, H+ - Ni(II)- cido glutmico, H+ - Ni(II)- cistena y H+ - Ni (II)- histidina, en NaCl 1,0 M a 25C. H++-- Ni((II)) -- ccido Asprtico H++-- Ni ((II)) -- ccido Glutmico H++-- Ni((II)) -- Cistena H++-- Ni((II)) -- Histidina Especies log bpqr log bpqr log bpqr log bpqr [NiC] 8,22(5) 5,15(6) 8,57(4) - [NiC22]22-- 13,84(8) 9,45(1) - - [NiHC]++ 12,82(4) - 14,17 mx 14,67 - [Ni((HC))C]-- - - 24,04 (1) - [NiH22C]33++ - - - 17,91(6) [Ni((HC))22]22++ - - - 25,72(3) [NiHC]22++ - - - 13,16 (2) [NiHC22]++ - - - 20,82(1) [NiC]++ - - - 8,75(4) [NiC22] - - - 15,47(5)','2011-04-29','Estudio de formacin de complejos Nquel(II) Medidas de fuerza electromotriz',6,1,1,1,1,'2013-09-17 08:38:06','2013-09-17 08:38:06','Documento_560.pdf','application/pdf',1957480,'2013-09-17 08:38:06',20,0,107,'COMPLETO'),(555,'Caracterizacin qumica inorgnica y orgnica de los lixivados del relleno sanitario \"La Bonanza\"','En este estudio se realiz la caracterizacin qumica de 8 muestras de lixiviados, adems de 2 muestras de agua superficiales pertenecientes al relleno sanitario La Bonanza, ubicado en el Estado Miranda. La caracterizacin fue realizada mediante la determinacin de los parmetros fisicoqumicos pH, conductividad, temperatura, alcalinidad y contenido de materia orgnica. Asimismo, se determinaron las concentraciones de las especies mayoritarias Na+, K+, Ca2+, Mg2+, Cl-, NO3- y NO2- mediante el empleo de las tcnicas de absorcin y emisin atmica de llamas y cromatografa inica. Seguidamente, los resultados fueron validados a travs de un balance inico. Igualmente, se llev a cabo la determinacin de Si y de los elementos traza As, Cd, Cr, Cu, Fe, Mn, Mo, Ni, Pb, Se, Ti, V, Zn, Co, Sr y Sb; mediante la tcnica de emisin atmica con fuente de plasma inductivamente acoplado (ICP-OES). Para el Si expresado como SiO2 se obtuvo un intervalo de concentracin entre 4,0 y 30,0 mg/L; mientras que, los elementos As, Se, Cd y Pb se encontraron por debajo del lmite de deteccin; a su vez el resto de los elementos presentaron concentraciones que oscilaron entre 0,08 y 6,0 mg/L. En general, las mayores concentraciones de los elementos traza fueron detectados en el lixiviado que es sometido a evaporacin y en el lixiviado con mayor edad del relleno. Los resultados indican que los lixiviados del relleno sanitario \"La Bonanza\" que son sometidos a evaporacin resultan con altas concentraciones de Na+ y K+, as como en de Cl- y NO3-, que superan los valores permitidos segn el Decreto 883 del MARN (Gaceta oficial N E-5021). Igualmente, se llev a cabo la identificacin de los compuestos orgnicos voltiles presentes en los lixiviados, mediante la aplicacin de la tcnica de cromatografa gaseosa (GC- MS). Esto permiti identificar 32 compuestos, adems, de los llamados BTEX, compuestos comnmente encontrados en rellenos sanitarios. Los compuestos orgnicos voltiles identificados comprenden: p.cresol, alcanfor, terpineol, fenol, 3-metilindol, difenleter, DEET, difenlsulfona, 7-Acetil-2-hidroxi-2- metl-5-iso-propilbiciclononano, bisfenol A, DEHP, heptacosano, trietilfosfato, pirazina, tiofenol, nicotina, proplfenazona, n-pentano, cido hexanoico, cido dihidroxibutrico, cido ciclohexano dicarboxlico, cido valrico, cido palmtico, cido fenlbutrico, cido heptanoico, cido octanoico, cido linoleco, cido ftlico, cido butrico, cido adpico, cido 2-metl-4- clorofenoxipropinico (MCPP), ibuprofeno y el 2,4-diclorobenceno. Se concluye que es prioritario utilizar un mtodo adecuado para el tratamiento de los lixiviados, con la finalidad de disminuir las concentraciones de los metales alcalinos, Cl-, NO3-. Esto debido a que durante la evaporacin de los lixiviados se genera un residuo con una mayor concentracin de especies contaminantes que los lixiviados originales.','2011-04-29','{}',6,1,1,1,1,'2013-09-17 08:38:11','2013-09-17 08:38:11','Documento_561.pdf','application/pdf',4107489,'2013-09-17 08:38:11',20,0,109,'COMPLETO'),(556,'Ambientes Cunticos','En este trabajo se estudia la definicin de ambiente cuntico y el funtor de teora de campos cunticos QFT sobre ambientes cunticos, introducida por J. Park, J. Terilla y T. Tradler en su artculo \"Quantum backgrounds and QFT\", es decir, dado un ambiente cuntico se define una teora de campos sobre este ambiente, y se demuestra que este funtor es un funtor de deformacin, en el sentido de M. Schlessinger. Adems vamos a revisar ejemplos de teoras de campos cunticos, y plantear la posible relacin entre estas teoras y las teoras homolgicas de campos cunticos definidas en el artculo \"Homological Quantum Field Theory\" por E. Castillo y R. Daz, con el fin de proponer la construccin de un ambiente cuntico homolgico.','2011-05-18','Ambientes cunticos, teoras de campos cunticos (QFT), teoras topolgicas de campos cunticos (TQFT), funtores de deformacin.',5,1,1,1,1,'2013-09-17 08:38:13','2013-09-17 08:38:13','Documento_562.pdf','application/pdf',4991608,'2013-09-17 08:38:13',20,0,71,'COMPLETO'),(557,'DISEO, IMPLEMENTACIN Y ADECUACIN DE UNA HERRAMIENTA EDUCATIVA BASADA EN MINIX PARA CURSOS DE SISTEMAS OPERATIVOS','En el siguiente Trabajo Especial de Grado se plantea la insercin del sistema operativo Minix 3 al curso ofertado por la Escuela de Computacin de la UCV con el objetivo de solventar la poca sincronizacin entre la planificacin terica- prctica existente. Es decir, no existe ninguna metodologa que permita reforzar ambas dinmicas durante la ejecucin del mismo. La solucin propuesta es adecuar el sistema operativo Minix 3 a partir de un conjunto de siete laboratorios que abarcan tpicos asociados a los temas impartidos por el curso de Sistemas Operativos actual. Los laboratorios tienen los siguientes ttulos: Instalacin de Minix y entorno de desarrollo, Introduccin a Minix 3, Estudio del proceso de arranque, Implementacin de un intrprete de comandos, Implementacin de llamadas al sistema, Implementacin de semforos y Modificacin del planificador de procesos. De cada laboratorio se desarrollo la estructura y solucin, dejando una slida documentacin en distintos medios (documentos, implementacin del cdigo necesario y videos tutoriales). Por ltimo, se adecuo una aplicacin para el manejo de proyectos (wiki) la cual apoya al curso y permite integrar toda la informacin recopilada, tanto para el grupo docente como para los estudiantes. Al culminar este Trabajo Especial de Grado se logr completar los objetivos planteados desde el inicio a travs de las soluciones anteriormente descritas, es por ello que se desea que el trabajo realizado sea tomado en consideracin por la Escuela de Computacin para impartir cursos futuros; dndole a mismo la didctica de los cursos de las principales universidades a nivel mundial.','2011-04-08','Palabras Claves: Sistema Operativo Instruccional, Minix 3, Laboratorio, implementacin, documentacin.',2,1,1,1,1,'2013-09-17 08:38:14','2013-09-17 08:38:14','Documento_563.pdf','application/pdf',0,'2013-09-17 08:38:14',20,0,0,'INCOMPLETO'),(558,'Creacin de un Plugin para NetBeans que Agilice el Desarrollo de Aplicaciones Web Utilizando el Framework Dinmica','Normal 0 21 false false false ES-TRAD X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} El presente Trabajo Especial de Grado (T.E.G) comprende la creacin de una herramienta para agilizar el desarrollo de aplicaciones Web usando como base el framework Dinmica. Este framework venezolano posee un repositorio de plantillas que constituyen soluciones pre- construidas para resolver problemas comunes presentes en el desarrollo de aplicaciones web. El objetivo principal de este T.E.G es minimizar la carga de trabajo de los programadores al automatizar las tareas que comprenden el proceso de reutilizacin que trae consigo el uso del framework Dinmica, aumentando as la productividad. La herramienta desarrollada consiste en un plugin para NetBeans IDE formado por diversos mdulos para cubrir cada una de las funcionalidades. Desde la creacin y configuracin de un proyecto base hasta la creacin y configuracin de las plantillas ms importantes, as como una plantilla general y un mdulo para el manejo de la seguridad.','2011-02-17','framework, Dinmica, open source, Netbeans, plugin, aplicaciones web, IDE',2,1,1,1,1,'2013-09-17 08:38:14','2013-09-17 08:38:14','Documento_564.pdf','application/pdf',3553441,'2013-09-17 08:38:14',20,0,124,'COMPLETO'),(559,'USO DE LA ESPECTROSCOPA DE FLUORESCENCIA EN LA DETERMINACINN DE CAMBIOS CONFORMACIONALES DE LA RODOPSINA BOVINA','La rodopsina es la protena fotorreceptora de los bastoncillos de la retina. Esta, en presencia de luz, experimenta cambios conformacionales que se traducen en una serie de fotointermediarios, uno de los cuales es el responsable de transmitir la seal luminosa al resto de las protenas de la cascada visual. De forma interesante, la fosforilacin de la rodopsina fotoactivada constituye parte esencial en el mecanismo de inactivacin o desensibilizacin de la rodopsina. El objetivo del presente trabajo es aplicar la espectroscopa de fluorescencia extrnseca para la deteccin de cambios conformacionales en la rodopsina. Para lograr tal cometido, se procedi en primera instancia, a aislar segmentos externos de los bastoncillos (SEB) a partir de retinas bovinas; los cuales contenan rodopsina con un alto grado de pureza de acuerdo al cociente de absorbancia A280nm/ A500nm. La rodopsina bovina fue purificada mediante cromatografa de afinidad a travs de Concanavalina A sefarosa, evidencindose as que el detergente n- dodecil-b-D- maltsido solubilizaba a esta protena de los SEB. Las cistenas expuestas de la rodopsina fueron entonces marcadas con el fluorforo monobromobimano (mBBr), bajo condiciones de oscuridad o luz, en presencia o ausencia de Mg+2-ATP y rodopsina quinasa. Las muestras resultantes del marcaje, fueron aisladas y analizadas fluorimetricamente. Se pudo evidenciar que el cambio de conformacin que se produce en la rodopsina fotoactivada no ejerci ningn tipo de impedimento para que las cistenas en la regin citoplasmtica quedasen disponibles para el marcaje con mBBr. Adicionalmente, se comprob que los sitios de fosforilacin de la rodopsina se encuentran prximos a las cistenas modificadas con mBBr, puesto que la seal de la fluorescencia, se vio significativamente disminuida en las muestras que contenan rodopsina fosforilada.','2011-05-13','Rodopsina, Pigmento visual, Fotointermediarios, Fluorescencia, Fosforilacin de la rodopsina',6,1,1,1,1,'2013-09-17 08:38:17','2013-09-17 08:38:17','Documento_565.pdf','application/pdf',3551621,'2013-09-17 08:38:17',20,0,124,'COMPLETO'),(560,'Caracterizacin funcional de la comunidad bacteriana cultivable aislada del suelo de la zona de descarga de la fosa petrolera Bare--99.. San Tom.. Edo.. Anzotegui','Mediante el presente estudio enmarcado dentro del proyecto Misin Ciencia \"Desarrollo y Validacin de Nuevas Tecnologas para el Saneamiento Ambiental de Pasivos Generados por la Actividad Petrolera\", dentro del subproyecto \"Caracterizacin del Medio Fsico Natural en reas Impactadas con Hidrocarburos\" se pretende caracterizar funcionalmente la comunidad bacteriana del suelo de la zona de descarga de la fosa petrolera (Bare-9) y as determinar la estructura funcional de la comunidad y grupos funcionales con capacidad de degradar sustratos complejos, crecer sobre hidrocarburos y producir biosurfactantes. Para el estudio se evaluaron dos cuadratas (B9I y B9D) dentro de la zona de descarga, caracterizados por presentar derrame petrolero y la zona con vegetacin (B9V), donde se encontraron valores de abundancia del orden de 109UFC/gr. de suelo en las zonas impactadas, hasta 1012UFC/gr. de suelo en la zona sin impacto. El estudio incluye la caracterizacin fenotpica (macro y micromorfologa de las cepas) y bioqumicamente por su crecimiento en diferentes sustratos, usando una fuente nica de carbono, encontrndose un gran numero de cepas capaces de degradar azucares simples como glucosa (80%), de utilizar fuentes nitrogenadas el nitrato y de hidrolizar la urea y protenas (80%) y un bajo numero de cepas capaces de degradar sustratos complejos como celulosa, lignina, pectina con valores cercanos o menores al 20%. Con los resultados obtenidos y utilizando como herramienta el anlisis multivariado de Cluster se conformaran grupos de cepas con caractersticas similares en sus respuestas frente a diferentes sustratos que conforman los denominados grupos funcionales. Se determin que la diversidad funcional era mayor en la zona impactada (B9I) que en la zona con vegetacin donde se espera, a pesar de encontrar similar numero de grupos funcionales (GF) entre las diferentes comunidades. Los grupos funcionales agruparon en mayor medida a cepas proteolticas, urea, reductoras de nitrato y con capacidad de utilizar el acetato como nica fuente de carbono, caractersticas presentes en todas las localidades evaluadas. Se encontr una mayor similitud entre la comunidad impactada B9D y la zona con vegetacin (B9V). Se destacaron las cepas de inters por su potencial biotecnolgico a ser utilizado en procesos de biorremediacin a los que se les realizaron bioensayos para determinar la produccin de compuestos tenso-activos','2011-02-18','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-',1,1,1,1,1,'2013-09-17 08:38:21','2013-09-17 08:38:21','Documento_566.pdf','application/pdf',1241668,'2013-09-17 08:38:21',17,0,82,'COMPLETO'),(561,'Elaboracin de un producto tipo colado a partir de almidones modificados y harinas de Arracacia xanthorrhiza Bancroft','Los objetivos de este trabajo fueron: aislar, purificar el almidn y elaborar harinas de la parte comestible de apio (Arracacia xanthorrhiza Bancroft) y formular un producto tipo colado a partir de sus harinas y almidones tratados con pulsos de luz U.V. Para ello se extrajeron almidones y elaboraron harinas segn metodologas descritas por Prez 1994 y 2000. La caracterizacin de ambas materias primas (almidn y harina) fu realizada por mtodos oficiales de AACC (2003) y AOAC (1999) y la caracterizacin de los parmetros de calidad de los colados se realiz por mtodos de AOAC (1999). Los resultados sealan alto rendimiento y pureza en el almidn extrado. Los almidones tratados con pulsos de luz U.V solo mostraron diferencias estadsticamente significativas (p <= 0,05) en el color y en los ndices de absorcin de agua, solubilidad y poder de hinchamiento al compararse con el almidn nativo. Por su parte, la harina de apio criollo elaborada se caracteriz por mostrar un alto rendimiento y eficiencia en el proceso; as como, un alto contenido en carbohidratos totales y fibra diettica en los anlisis realizados. Los colados elaborados a partir de harinas y almidones requirieron la adicin de pulpa de apio para acentuar el sabor de los mismos debido a que la harina pierde ciertos elementos que otorgan sabor y aroma al aplicar el mtodo de deshidratacin. Por otra parte, para incrementar las propiedades nutricionales de los colados elaborados, se cont con la adicin de glicomacropeptido (GMP) comercial de suero de leche, el cual permiti obtener un incremento en el contenido de protenas del producto. Adems, esta oligoprotena se caracteriza por presentar niveles muy bajos de fenilalanina, que al ser adicionado en el producto aumenta sus beneficios, el cual podran ser provechosos para nios que padecen de fenilcetonuria. Por ltimo, la evaluacin sensorial aplicada a un panel semi-entrenado, mostr muy buena aceptacin en sus parmetros de color, aroma, sabor y consistencia, siendo mayormente aceptados el color, segudo del sabor y consistencia y por ltimo el aroma.','2011-05-10','Almidn, harinas, colado, Arracacia xanthorrhiza Bancroft, pulsos de luz U.V',1,1,1,1,1,'2013-09-17 08:38:22','2013-09-17 08:38:22','Documento_567.pdf','application/pdf',1361385,'2013-09-17 08:38:22',20,0,79,'COMPLETO'),(562,'DISEO DESARROLLO Y EVALUACIN DE UN SISTEMA DE ABLACIN LSER PARA EL MICROANLISIS DE MUESTRAS SLIDAS..','La espectroscopa de plasma inducido por lser o como se conoce por sus siglas en ingls LIBS (Laser induced breakdown spectroscopy) se ha convertido en una herramienta importante para el anlisis qumico de una gran variedad de materiales. Como un resultado del avance continuo de espectrgrafos, componentes pticos y lseres, se ha permitido el desarrollo de nuevas tcnicas analticas basadas en la espectroscopa de ablacin lser, es por ello que en este trabajo se tiene como objetivo principal el diseo, construccin y evaluacin de un sistema de micro- ablacin lser para el anlisis de muestras slidas, reforzando de esta manera su caracterstica como tcnica de anlisis no destructiva y con potencial para el anlisis superficial de materiales compuestos. El sistema de micro-LIBS consisti en un microscopio acoplado con un lser Nd-YAG en su radiacin fundamental (1064 nm) y una cmara ICCD. Crteres entre 33-68 m de dimetro fueron obtenidos con pulsos de energa lser entre 7,72-46,40 mJ. Con el fin de crear estos crteres se utiliz una lente objetiva de 20X y 0,45 de apertura numrica. En un principio, se estudi la influencia de la intensidad de radiacin del lser con respecto al dimetro del crter producido sobre la muestra, aprecindose una correlacin lineal positiva entre el dimetro del crter y la intensidad de radiacin. Adems, se analiz la influencia de la cantidad de material removido con respecto a la intensidad de emisin, donde se encontr que mientras mayor es el crter mayor es la intensidad de las lneas de emisin arrojando una grfica con una correlacin positiva. Seguidamente, se estudiaron las figuras de mritos como se menciona a continuacin: sensibilidad, reproducibilidad, exactitud, lmites de deteccin y de cuantificacin de los elementos Plomo y Hierro a travs de las curvas de calibracin correspondiente donde se observ una diferencia en la sensibilidad de las curvas de calibracin de ambos elementos de, 65,3 y 59,08 respectivamente; una respuesta para este hecho se debe a la probabilidad de transicin para una emisin espontanea, ya que, si se compara este valor en ambos elementos ,el plomo tiene una mayor probabilidad de transicin que la que tiene el hierro para las respectivas longitudes de ondas de emisin. Los lmites de deteccin obtenidos para el Plomo y el Hierro fueron de 0,21 y 0,13 % respectivamente, lo que nos indica que la tcnica utilizada es capaz de detectar dichos elementos a los niveles de concentracin antes mencionados. Finalmente, es importante acotar que Ms adelante se presentar de manera ms amplia y detallada las discusiones de los resultados obtenidos en este trabajo de investigacin.','2011-05-06','Espectroscopa de plasma inducido por lser; micro-LIBS, Probabilidad de transicin espontnea.',6,1,1,1,1,'2013-09-17 08:38:24','2013-09-17 08:38:24','Documento_568.pdf','application/pdf',6679786,'2013-09-17 08:38:24',19,0,130,'COMPLETO'),(563,'ASOCIACIONES ENTRE EPIBIONTES Y LOS OCTOCORALES PLEXAURA FLEXUOSA Y PLEXAURA HOMOMALLA (CNIDARIA, OCTOCORALLIA) EN DOS LOCALIDADES DEL LITORAL CENTRAL VENEZOLANO','La colonizacin de nuevos sustratos es un fenmeno muy comn en los ambientes marinos. De este proceso se deriva la epibiosis, que se define como la asociacin predominantemente facultativa entre basibionte y epibionte. Las colonias de la mayora de los octocorales desarrollan una superficie tridimensional, en ocasiones muy compleja, que favorece el reclutamiento de larvas presentes en la columna de agua, por lo cual pueden ser potencialmente colonizados por una alta diversidad de organismos epibiontes. La estructura de las comunidades epibiticas asociadas a octocorales es prcticamente desconocida y tampoco se sabe si estas comunidades varan con respecto a la especie de octocoral o la localidad. Por esto el objetivo de este trabajo fue evaluar la estructura y distribucin de las comunidades de epibiontes asociados a los octocorales Plexaura homomalla y P. flexuosa en dos localidades del Litoral Central Venezolano (Ensenada Manare y Playa Los Indios). Se evaluaron un total de 1190 colonias, 422 de Plexaura flexuosa y 5 P. homomalla en Playa Los Indios y 424 colonias de P. homomalla y 339 de P. flexuosa en la Ensenada de Manare. Predominaron colonias con tamaos intermedios en ambas localidades y especies. De las 1185 colonias evaluadas, 776 colonias (65.5%) posean epibiontes los cuales totalizaron 1808 entre individuos y aglomerados de epibiontes. Las colonias de P. flexuosa en Playa Los Indios presentaron una prevalencia de epibiontes del 72% (302 colonias) y de una forma muy similar en la Ensenada Manare el 70% (237 colonias) present epibiontes. P. homomalla present una proporcin de colonias con epibiontes del 55 % (234 colonias), bastante inferior a las de P. flexuosa. Se registr un total de 34 especies de epibiontes pertenecientes a 7 Phyla (Porifera, Cnidaria, Mollusca, Annelida, Arthropoda, Echinodermata y Chordata), de los cuales el 63.9% corresponde a especies ssiles y el 36.1% a especies mviles, adems de 3 grupos funcionales de algas (calcreas, filamentosas y macroalgas). El grupo ms diverso fue el de los porferos con 9 especies y el ms abundante fue el de los moluscos con 836 individuos, correspondiendo al 52.6% de todos los individuos registrados. Ms del 44 % de los epibiontes se ubicaron en la zona media de las colonias, seguido por la zona basal con ms del 17% y la zona apical con ms del 10%. Tambin fueron registrados sobre las colonias de octocorales aglomerados o agregados de epibiontes, conformados mayoritariamente por los bivalvos Dendrostrea frons y Pteria colymbus, a los cuales se asocian a su vez una alta diversidad de otros organismos. Los aglomerados se encontraron predominantemente ubicados en la zona media de las colonias de octocoral, en una frecuencia por encima del 73 % para ambas especies y localidades. Conformando los aglomerados se encontraron 39 taxas divididos en 9 Phyla, y constituidos por 5 especies de porferos, 2 cnidarios, varios grupos de moluscos, 6 grupos de crustceos, algunos poliquetos, sipunclidos, equinodermos, briozoarios y tunicados. Se realiz un experimento para determinar si las lesiones en las que el eje del octocoral queda expuesto favorecen a la colonizacion. Se registr una alta variabilidad en la colonizacin de lesiones entre colonias. El tiempo mnimo de recuperacin fue de 3 a 4 semanas en ambas especies y localidades, mientras que el mximo vari. Se observ que el establecimiento de algunas especies de epibiontes sobre los ejes de gorgonina retrasaba o impeda de algn modo la regeneracin del cennquima del octocoral. Los organismos que colonizaron el eje de gorgonina denudado de los octocorales fueron en su mayora algas, hidrozoarios y cirripedios. Se puede concluir que la comunidad de epibiontes es muy diversa, dominada por organismos filtradores y no presenta especificidad con las dos especies de octocoral.','2011-02-14','EPIBIONTES, OCTOCORALES, LITORAL CENTRAL, AGLOMERADOS, REGENERACIN, COLONIZACIN',1,1,1,1,1,'2013-09-17 08:38:25','2013-09-17 08:38:25','Documento_569.pdf','application/pdf',1589344,'2013-09-17 08:38:25',20,0,87,'COMPLETO'),(564,'DETERMINACION DE ELEMENTOS TRAZA EN CABELLO Y SUERO SANGUINEO DE NIOOS CON SINDROME DE ESPECTRO AUTISTA','Se determin la concentracinn de Zn,, Cu,, Ca,, Mg,, Pb y Hg en muestras de cabello y suero sanguneo en nioos con sndrome de Espectro Autista en edades comprendidas entre los 22 y 1100 aoos,, pertenecientes al Centro de Atencinn Integral para Autistas ((CAIPA)) ubicado en Los Teques Edo -- Miranda.. La determinacinn de Zn,, Cu,, Ca,, Mg y Pb se realiz mediante espectrometra de emisinn atmmica con plasma inductivamente acoplado ((ICP--OES)) y la determinacinn de Hg total se realiz mediante espectrometra de fluorescencia atmmica ((AFS)).. Los resultados obtenidos fueron tratados estadsticamente empleando el programa Statgraphic Plus versinn 55..00.. Los resultados obtenidos de los nioos fueron comparados con intervalos de referencia [4477,,4488].. Para las muestras de cabello,, las concentraciones de Ca y Mg de nioos autistas estuvieron dentro del intervalo de las concentraciones de referencia.. Sin embargo,, el Cu y Zn presentaron niveles por debajo de los valores de referencia.. El anlisis de los elementos txxicos Pb y Hg muestran que el primero se encuentra por encima de los valores de referencia [4477] y el segundo dentro de los valores normales.. Por otro lado,, el anlisis de suero sanguneo indican que los valores de Ca y Mg se encuentran dentro del intervalo de referencia,, mientras que las concentraciones de Zn se ubicaron por encima y la de Cu por debajo de los mismos.. Los elementos txxicos Pb y Hg se ubican dentro del intervalo de referencia.. Finalmente un estudio de la relacinn Cu//Zn en cabello,, suero sanguneo y orina 2244 horas arroj que no existen diferencias significativas entre el grupo autista y el grupo control en el cabello y la orina;; Sin embargo,, las muestras de suero sanguneo si presentan diferencias significativas entre ambos grupos..','2011-03-25','Nios de espectro autista, metales pesados, Muestras clnicas.',6,1,1,1,1,'2013-09-17 08:38:28','2013-09-17 08:38:28','Documento_570.pdf','application/pdf',3547650,'2013-09-17 08:38:28',19,0,134,'COMPLETO'),(565,'Prototipo de Herramienta para el desarrollo de aplicaciones basadas en Lgica Difusa','La creciente popularidad de la lgica difusa se debe a su buena adaptacin a problemas donde existen valores numricos difciles de medir, incertidumbre, o excesiva complejidad, as como tambin a su capacidad de resolver problemas de forma potente y precisa y a la variedad de sus aplicaciones. Actualmente, existen numerosas herramientas para el desarrollo de aplicaciones basadas en lgica difusa, sin embargo, aquellas que cuentan con un mayor nmero de funcionalidades y mejor usabilidad no son de libre distribucin. En este Trabajo Especial de Grado se presenta un prototipo de herramienta que cumple con las funcionalidades necesarias para el desarrollo de sistemas basados en reglas difusas, bajo un ambiente grfico que facilita el trabajo del usuario, con una interfaz agradable e intuitiva que permite guiarlo a travs de todos los pasos necesarios para desarrollar su aplicacin, adems de ser de libre distribucin.','2011-04-05','Lgica difusa, Sistemas basados en reglas difusas, variables lingsticas, conjuntos difusos, reglas difusas, inferencia difusa, aplicaciones.',2,1,1,1,1,'2013-09-17 08:38:29','2013-09-17 08:38:29','Documento_571.pdf','application/pdf',1989901,'2013-09-17 08:38:29',18,0,125,'COMPLETO'),(566,'Estudio comparativo entre dos tcnicas (Captura de Hbridos y RCP) para la deteccin de Virus de Papiloma Humano (VPH) en reas genitales de jvenes con diagnstico clnico sugestivo de infeccin viral.','El Virus de Papiloma Humano (VPH) pertenece a la familia Papillomaviridae. El genoma viral est compuesto por una molcula circular de cido desoxirribonucleico (ADN) de doble cadena, que contiene aproximadamente 7.900 pb. Hasta el momento se han logrado identificar ms de doscientos tipos virales, clasificados de la siguiente forma: bajo riesgo oncognico, como los tipos 6, 11, 32, 42 y 43 y alto riesgo oncognico, que incluye los tipos 16, 18, 31, 33, 34, 35, 39, 45, 56, 59, 66, 68 y 70. Los productos proteicos de los genes E6 y E7 de los tipos de VPH de alto riesgo, son capaces de inactivar las protenas p53 y pRb, desencadenando un proceso que conlleva a la progresin de las lesiones a cncer crvicouterino. La infeccin por VPH es considerada actualmente como la enfermedad de transmisin sexual ms frecuente en el mundo y como el principal factor etiolgico de lesiones intraepiteliales y de cncer cervicouterino. En Venezuela, cada ao 4.116 mujeres son diagnosticadas con cncer cervical y 1853 mueren a causa del cncer crvicouterino, segn la Organizacin Mundial para la Salud. Por este motivo y debido al reciente desarrollo de las vacunas preventivas contra el VPH es de gran importancia el estudio y la comparacin de tcnicas de biologa molecular que permitan el diagnstico y tipificacin de los diferentes tipos virales en la poblacin. En tal sentido, en el presente trabajo se evaluaron muestras citolgicas, tomadas en el rea genital, de 80 mujeres jvenes con diagnstico clnico sugestivo de infeccin por VPH y 20 con diagnstico clnico normal, como pacientes control; con edades promedio de 24,78  5,27 y 21,30  3,96, respectivamente, que acudieron a la consulta de ginecologa de la Organizacin de Bienestar Estudiantil de la Universidad Central de Venezuela (OBE-UCV). La deteccin y tipificacin del VPH se llev a cabo mediante RCP mltiple con el estuche comercial Seeplex HPV4A ACE Sreening de Seegene Inc., y el mtodo de Captura de Hbridos 2 (Digene). Las muestras positivas para VPH fueron: 52,5% con la RCP Seeplex y 58,75% con la CH2. Los controles positivos para VPH correspondieron a: un 55% con RCP Seeplex y 60% con CH2. El tipo de VPH, ms comn, encontrado en las muestras y controles fue el de alto riesgo oncognico. Se encontr un 68,75% de correlacin entre los resultados positivos y negativos de RCP Seeplex y CH2 en las muestras y un 75% en los controles, con asociacin entre estos resultados (p<0,05) y grado de acuerdo moderado k. En cuanto a la tipificacin, se obtuvo un 51,25% de coincidencia en las muestras y un 70% en los controles, con asociacin entre los resultados (p<0,05) y grado de acuerdo moderado k. El mtodo CH2 present mayor sensibilidad que la RCP Seeplex (80% y 79,2%, respectivamente) y la especificidad de la RCP Seeplex fue menor que la de CH2 (19,2% y 20% respectivamente). No se encontr asociacin entre las variables: RCP/DC, CH2/DC, Factores de riesgo/VPH+ y Carga viral/DC. En conclusin, se encontr relacin entre los mtodos estudiados y las pacientes presentaron un alto porcentaje de infeccin por VPH de alto riesgo, diferente a los tipos ms comunes (16 y 18) incluidos en las vacunas. Se sugiere que las pacientes control positivas, se encuentran en una fase latente de la infeccin viral, por presentar diagnstico clnico normal y estar infectadas (en su mayora), por VPH de alto riesgo oncognico.','2011-02-21','VPH, Captura de Hbridos, RCP',1,1,1,1,1,'2013-09-17 08:38:34','2013-09-17 08:38:34','Documento_572.pdf','application/pdf',2137225,'2013-09-17 08:38:34',20,0,54,'COMPLETO'),(567,'DETECCINN DEL POLIMORFISMO g..1100997766G>>A DEL GEN DEL FACTOR VII DE LA COAGULACINN SANGUNNEA Y SU RELACINN CON DISTINTAS PATOLOGAAS TROMBTTICAS..','Las enfermedades trombticas son la primera causa de morbilidad y mortalidad en el mundo, dentro de las cuales las ms frecuentes son el infarto agudo al miocardio (IAM), el accidente cerebro vascular (ACV) y la trombosis venosa profunda (TVP), lo que representa un problema de salud pblica y prdidas humanas. Existen factores tanto ambientales como genticos que predisponen a estados hipercoagulabilidad, lo cual puede generar la activacin de un conjunto de mecanismos que promueven la formacin de una barrera o cogulo. Diversos estudios han sugerido que la presencia de polimorfismos genticos en los genes que codifican para algunos factores de coagulacin pudiera estar relacionada con la ocurrencia de trombosis arterial o venosa. Una de las protenas de la coagulacin que ha sido involucrada con el riesgo de padecer patologas trombticas es el factor VII. Se han detectado distintos polimorfismos asociados a este gen, uno de los cuales es el polimorfismo g.10976 G>A, el cual se ha relacionado con la variacin de los niveles plasmticos de la protena de forma activa. En consecuencia, se ha tratado de relacionar el polimorfismo con distintas patologas trombticas. El objetivo de este trabajo fue determinar el genotipio del polimorfismo g.10976 G>A, en el gen que codifica para el factor VII de la coagulacin, en pacientes que han sufrido infarto agudo al miocardio (IAM), trombosis venosa profunda (TVP) y accidente cerebro vascular (ACV) y establecer s existe una relacin con el desarrollo de estas patologas. El anlisis de genotipos fue realizado mediante la tcnica PCR-RFLP a partir del ADN genmico de 103 pacientes que han sufrido IAM, 101 pacientes que han padecido de TVP y 69 pacientes que han sufrido ACV. Slo se encontr asociacin entre el alelo de riesgo A del polimorfismo y la presencia de IAM (OR=1,92 1,02-3,61,p valor<< 00,,0055). Adems mediante un modelo de regresin de curva logstica, se obtuvo que los factores de riesgo principalmente asociados al IAM fueron el hbito tabquico, la edad y el sexo masculino, mientras que para el desarrollo de TVP, uno de los factores de riesgo ms significativo fue el sexo femenino. Segn los resultados obtenidos en este trabajo, la presencia del alelo A del polimorfismo g.10976 G<A en conjunto de los factores ambientales tales como edad, sexo, hipertensin arterial, en el gen que codifica para el factor VII de la coagulacin sangunea, puede ser considerado como un factor predictivo para la presencia de IAM.','2011-02-24','polimorfismo G>A10976, Gen del factor Vii de la coagulacin, trombosis.',1,1,1,1,1,'2013-09-17 08:38:35','2013-09-17 08:38:35','Documento_573.pdf','application/pdf',5079126,'2013-09-17 08:38:35',20,0,170,'COMPLETO'),(568,'Integracin del Repositorio de Objetos de Aprendizaje de AMBAR con la plataforma MOODLE','AMBAR es un proyecto de investigacin de la Universidad Central de Venezuela, que busca proporcionar herramientas de software que apoyen el proceso de enseanza y aprendizaje. Actualmente, uno de sus principales componentes es el Repositorio de Objetos de Aprendizaje (ROA) de AMBAR, el cual se encuentra integrado con un Repositorio de Metadata, a travs de la Capa de Servicios Web. El objetivo general del presente trabajo fue integrar el ROA de AMBAR con la plataforma MOODLE, el Sistema de Gestin de Aprendizaje (LMS) utilizado por la Universidad Central de Venezuela como plataforma de Educacin a Distancia, a travs de la Capa de Servicios Web. Entre el ROA de AMBAR y MOODLE no exista una conexin transparente para el usuario final, lo que resultaba ineficiente y complicaba el proceso de construccin de un curso particular si se deseaba utilizar Objetos de Aprendizaje (OA) alojados en dicho repositorio. Para ello se emple el Modelado gil (MA) como Mtodo de Desarrollo de Software, en el cual a travs de cuatro iteraciones se cre el tipo de recurso \"Objeto de Aprendizaje (OA) Bsico\", el mdulo de actividades \"Objeto de Aprendizaje (OA) Estandarizado\" y el bloque \"ROA de AMBAR\" en la plataforma MOODLE; y se redise el ROA de AMBAR en cuanto a su interfaz grfica de usuario y sus mtodos internos. Con este trabajo, se est facilitando la gestin de los OA almacenados en el repositorio, desde el mismo entorno de trabajo de MOODLE, lo cual resulta en grandes beneficios para los usuarios de dicha plataforma, debido a que pueden incorporar los OA directamente en su curso y hacerlos disponibles para su uso general. Adems, permite hacer del ROA de AMBAR y de MOODLE sistemas mucho ms completos al incrementar sus usuarios, retroalimentacin, funcionalidades y recursos, respectivamente.','2011-02-18','Objetos de Aprendizaje (OA), AMBAR, MOODLE, Repositorio de Objetos de Aprendizaje (ROA), Servicios Web, e-Learning, LMS.',2,1,1,1,1,'2013-09-17 08:38:57','2013-09-17 08:38:57','Documento_574.pdf','application/pdf',1327087,'2013-09-17 08:38:57',20,0,93,'COMPLETO'),(569,'Gestin Sostenible de Recursos Forestales desde el punto de vista del Control ptimo.','Las ltimas respuestas que nos ha dado la naturaleza en relacion al uso que hemos dado a sus recursos, ha obligado a las ciencias tanto Econmicas, Sociales y puras como La Biologia y en este caso las Matemticas, a encarar con urgencia el problema de su comprensin y ulterior representacin por medio de modelos abstractos para el comportamiento natural de las poblaciones de seres vivos. En el caso de la Biomasa Boscosa se puede representar por modelos logsticos dinmicos y su tratamiento se enmarca en la teora de Control ptimo dentro de la cual se describe un marco teorco econmetrico apropiado, usando elementos del Calculo de Variaciones y potentes teoremas para la optimizacion como el Principio del Mximo de Lev Pontryagin y Euler entre otros. De estos se derivan importantes resultados de alta validez cientfica que pueden ayudar a la planeacin de politicas del Mximo aprovechamiento natural sin poner en riesgo la capacidad propia de regeneracin del medio.','2011-02-23','Bosque, Calculo de Variaciones, Gestin Sostenible, Formula de Faustmann, Principio del Mximo de Lev Pontryagin, Regla de Hotelling, Sistemas Dinamicos, Teoria de Control ptimo y Turno de Rotacin.',5,1,1,1,1,'2013-09-17 08:39:00','2013-09-17 08:39:00','Documento_576.pdf','application/pdf',830298,'2013-09-17 08:39:00',19,0,81,'COMPLETO'),(570,'DESARROLLO DE LMINAS FLEXIBLES DE PARCHITA (Passiflora edulis f. flavicarpa Degener), CON ZANAHORIA (Daucus carota var. Sativus L.), Y PARCHITA CON REMOLACHA (Beta vulgaris L.), ENRIQUECIDAS CON CALCIO.','Las lminas flexibles de frutas constituyen una forma de conservacin de alimentos donde el producto es fabricado por deshidratacin de pulpa acondicionada. En el presente trabajo se desarrollaron lminas de parchita (Passiflora edulis f. flavicarpa Degener) enriquecidas con calcio a partirde combinaciones de azcares,,y mezclas de parchita con zanahoria (Daucus carota var. SativusL..), y parchita con remolacha (Beta vulgaris L..). Ensayando distintas mezclas de azcares se realizaron pruebas para obtener una formulacin base de parchita de 20 Brix, logrndose con 50% de sacarosa y 50% de fructosa muy buenos resultados. Posteriormente se probaron dos formulaciones para elaborar lminas de parchita con zanahoria y dos formulaciones para parchita con remolacha. Las pulpas acondicionadas fueron deshidratadas a 60 C durante 4 horas en funcin de los resultados de las curvas de secado. Las lminas se caracterizaron de forma fsica, qumica, microbiolgica y sensorial. Segn los resultados obtenidos, utilizando pulpa de parchita combinada con 3% de zanahoria y pulpa de parchita con 3% de remolacha, es posible elaborar lminas flexibles enriquecidas con calcio de alrededor de 20,00% de humedad, de bajo pH y baja actividad de agua, adems de bajo contaje de mohos y levaduras, y muy buena aceptacin. Una lmina de parchita con zanahoria de 14 cm de largo por 4 cm de ancho, suministrara del requerimiento diario de calcio (1000 mg/da) el 20,67% y la de parchita con remolacha el 24,38%.','2011-05-23','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',1,1,1,1,1,'2013-09-17 08:39:00','2013-09-17 08:39:00','Documento_577.pdf','application/pdf',493263,'2013-09-17 08:39:00',19,0,61,'COMPLETO'),(571,'Formacin de Partculas mediante el Mtodo de Descarga Pulsada en Alambres','Si por un alambre no pasa un pulso de alta corriente puede ocasionarse una rpida transicin de fase de estado slido a plasma. Dos efectos principales causan la transicin, el calentamiento por efecto Joule y la presin ejercida por el campo magntico originado por el mismo pulso de corriente (efecto Z- pinch). Al enfriarse el plasma, mediante colisiones con un ambiente gaseoso, los tomos se asocian y pueden formarse partculas finas. En este trabajo se realizaron descargas de pulsos de alta corriente a travs de alambres de hierro puro. Para generar los pulsos de corriente se utiliz un generador Marx. Bsicamente el experimento consiste en realizar una descarga, mediante explosores (interruptores de chispa), de una serie de condensadores conectados en paralelo cargados a una diferencia de potencial inicial V0 Se realiz una estimacin de la diferencia de potencial V0 mnima del generador Marx, requerida para separar los tomos del alambre haciendo uso de la energa de cohesin. Fue necesario disear una bobina que detectara la corriente en las descargas mediante induccinmagntica; tal bobina es conocida como bobina de Rogowski. Para el diseo de esta bobina se establecieron parmetros segn un ecuacin de propagacin para la onda de voltaje y corriente en la bobina, utilizando un modelo de parmetros distribuidos. Como un pulso tiene un amplio espectro de frecuencia debi disearse la bobina de forma que su ancho de banda fuese amplio tambin. Los pulsos detectados se midieron con un osciloscopio digital. Las descargas se realizaron en ambiente de aire,en una cmara a presin atmosfrica y tambin en vaco grueso. Para cada prueba realizada se coloc como sustrato una lmina de silicio en el interior de la cmara, para recoger las partculas formadas. Las partculas recogidas en el sustrato fueron analizadas mediante Microscopa Electrnica de Barrido (SEM), Espectroscopa de Electrones Auger (AES) y Microscopa de Fuerza Atmica (AFM). Se obtuvieron micropartculas con forma esfrica y nanopartculas con forma elipsoidal, observando una dependencia entre el tamao y dispersin de las partculas formadas con la presin y energa de la descarga.','2011-03-09','Rogowski, Z-Pinch, Nanopartculas, Descarga Pulsada',3,1,1,1,1,'2013-09-17 08:39:02','2013-09-17 08:39:02','Documento_578.pdf','application/pdf',4370773,'2013-09-17 08:39:02',19,0,82,'COMPLETO'),(572,'DISEOO Y EVALUACINN DE UN SISTEMA COLORIMTRICO PARA ANLLISIS CLNNICO BASADO EN UNA CMMARA DIGITAL Y UNA FUENTE DE ILUMINACINN DIFUSA','En el presente trabajo se dise y evalu un prototipo de lector de absorbancia usando como sistema de deteccin una cmara digital, para el anlisis cuantitativo simultneo de un nmero elevado de muestras sintticas y biolgicas como futura aplicacin al anlisis clnico. Para el sistema de lector de absorbancia se emple una fuente de iluminacin difusa como lmparas fluorescente e incandescente, una cubeta de plstico como compartimiento de muestra y una cmara digital CCD como registrador de la imagen, que permiti digitalizarla, separarla en sus componentes RGB e intensidad. Las imgenes se transformaron en superficies de respuesta de intensidades para cada color al que responde los filtros de la cmara CCD, de esta manera al compararla con una referencia, se pudo calcular la absorbancia de un punto en particular de la imagen y mediante una curva de calibracin se obtuvo la concentracin de una determinada sustancia en ese punto. El sistema diseado se utiliz para medir concentraciones de una solucin sinttica de azul de bromofenol preparada a distintas concentraciones y luego se trabaj con un grupo de muestras de suero sanguneo humano midiendo concentraciones de glucosa, cuyos valores oscilaron de 25 a 250 mg/dl. Obteniendo una alta linealidad y sensibilidad, comparado con equipos comerciales, lo que permite realizar anlisis cuantitativos de un nmero elevado de muestras.','2011-05-20','lector de absorbancia, cmara digital CCD.',6,1,1,1,1,'2013-09-17 08:39:03','2013-09-17 08:39:03','Documento_579.pdf','application/pdf',1680794,'2013-09-17 08:39:03',19,0,91,'COMPLETO'),(573,'Anlisis a travs de tcnicas de imgenes de cambios en prtesis de mama luego de irradiacin con 6400 cGy.','p, li { white-space: pre-wrap; } En los ltimos aos, un 15% de las pacientes con diagnstico de cncer de mama, optan por la reconstruccin de la mama al mismo instante que son sometidas a una mastectoma parcial o total. Generalmente estas pacientes son sometidas a Radioterapia cuyo tratamiento incluye toda la glndula mamaria. Por lo que se ha podido observar aproximadamente el 50% de estas pacientes presentan complicaciones posterior al tratamiento radiante, entre las que se puede nombrar: endurecimiento de la mama, incremento en la incidencia de la contractura capsular, etc. En el presente trabajo se realiz el seguimiento post-tratamiento de 26 pacientes que usaron prtesis mamarias durante el tratamiento con radioterapia. Los resultados muestran que un 27% de estas pacientes desarrollaron contractura capsular en los dos primeros aos de haber culminado el tratamiento de radioterapia. Adems, en una de estas pacientes se realiz un estudio de RM de mama, el cual muestra el engrosamiento del tejido que rodea la prtesis mamaria irradiada sin mostrar cambios en ellas. Por otra parte, para estudiar el efecto de la irradiaci\'on con 6400 cGy en las prtesis mamarias, se adquiri un par de prtesis de silicona y una de estas fue irradiada con 6400 cGy. Los estudios de Microscopa Electrnica de Barrido y Ensayo Ultrasnico muestran que la cubierta de la prtesis mamaria sufre una degradacin a pequea escala sin alterar sus propiedades elsticas.','2011-05-18','prtesis mamarias, silicona, reconstruccin de mama, irradiain',3,1,1,1,1,'2013-09-17 08:39:03','2013-09-17 08:39:03','Documento_580.pdf','application/pdf',6671596,'2013-09-17 08:39:03',20,0,106,'COMPLETO'),(574,'INTEGRACINN DEL REPOSITORIO DE OBJETOS DE APRENDIZAJE DE AMBAR CON LA PLATAFORMA MOODLE','AMBAR es un proyecto de investigacin de la Universidad Central de Venezuela, que busca proporcionar herramientas de software que apoyen el proceso de enseanza y aprendizaje. Actualmente, uno de sus principales componentes es el Repositorio de Objetos de Aprendizaje (ROA) de AMBAR, el cual se encuentra integrado con un Repositorio de Metadata, a travs de la Capa de Servicios Web. El objetivo general del presente trabajo fue integrar el ROA de AMBAR con la plataforma MOODLE, el Sistema de Gestin de Aprendizaje (LMS) utilizado por la Universidad Central de Venezuela como plataforma de Educacin a Distancia, a travs de la Capa de Servicios Web. Entre el ROA de AMBAR y MOODLE no exista una conexin transparente para el usuario final, lo que resultaba ineficiente y complicaba el proceso de construccin de un curso particular si se deseaba utilizar Objetos de Aprendizaje (OA) alojados en dicho repositorio. Para ello se emple el Modelado gil (MA) como Mtodo de Desarrollo de Software, en el cual a travs de cuatro iteraciones se cre el tipo de recurso \"Objeto de Aprendizaje (OA) Bsico\", el mdulo de actividades \"Objeto de Aprendizaje (OA) Estandarizado\" y el bloque \"ROA de AMBAR\" en la plataforma MOODLE; y se redise el ROA de AMBAR en cuanto a su interfaz grfica de usuario y sus mtodos internos. Con este trabajo, se est facilitando la gestin de los OA almacenados en el repositorio, desde el mismo entorno de trabajo de MOODLE, lo cual resulta en grandes beneficios para los usuarios de dicha plataforma, debido a que pueden incorporar los OA directamente en su curso y hacerlos disponibles para su uso general. Adems, permite hacer del ROA de AMBAR y de MOODLE sistemas mucho ms completos al incrementar sus usuarios, retroalimentacin, funcionalidades y recursos, respectivamente.','2011-02-18','Objetos de Aprendizaje (OA), AMBAR, MOODLE, Repositorio de Objetos de Aprendizaje (ROA), Servicios Web, e-Learning, LMS.',2,1,1,1,1,'2013-09-17 08:39:04','2013-09-17 08:39:04','Documento_581.pdf','application/pdf',1916329,'2013-09-17 08:39:04',20,0,135,'COMPLETO'),(575,'DISEO, IMPLEMENTACIN Y ADECUACIN DE UNA HERRAMIENTA EDUCATIVA BASADA ENMINIX PARA CURSOS DE SISTEMAS OPERATIVOS','En el siguiente Trabajo Especial de Grado se plantea la insercin del sistema operativo Minix 3 al cursoofertado por la Escuela de Computacin de la UCV con el objetivo de solventar la poca sincronizacinentre la planificacin terica- prctica existente. Es decir, no existe ninguna metodologa que permitareforzar ambas dinmicas durante la ejecucin del mismo. La solucin propuesta es adecuar el sistemaoperativo Minix 3 a partir de un conjunto de siete laboratorios que abarcan tpicos asociados a los temasimpartidos por el curso de Sistemas Operativos actual. Los laboratorios tienen los siguientes ttulos: Instalacin de Minix y entorno de desarrollo, Introduccin a Minix 3, Estudio del proceso de arranque,Implementacin de un intrprete de comandos, Implementacin de llamadas al sistema, Implementacinde semforos y Modificacin del planificador de procesos. De cada laboratorio se desarrollo la estructuray solucin, dejando una slida documentacin en distintos medios (documentos, implementacin delcdigo necesario y videos tutoriales). Por ltimo, se adecuo una aplicacin para el manejo de proyectos(wiki) la cual apoya al curso y permite integrar toda la informacin recopilada, tanto para el grupo docentecomo para los estudiantes. Al culminar este Trabajo Especial de Grado se logr completar los objetivosplanteados desde el inicio a travs de las soluciones anteriormente descritas, es por ello que se deseaque el trabajo realizado sea tomado en consideracin por la Escuela de Computacin para impartircursos futuros; dndole a mismo la didctica de los cursos de las principales universidades a nivelmundial.','2011-04-08','Sistema Operativo Instruccional, Minix 3, Laboratorio, implementacin, documentacin',2,1,1,1,1,'2013-09-17 08:39:06','2013-09-17 08:39:06','Documento_582.pdf','application/pdf',0,'2013-09-17 08:39:06',20,0,0,'INCOMPLETO'),(576,'Anlisis a travs de tcnicas de imgenes de cambios en prtesis de mama luego de irradiacin con 6400 cGy.','En los ltimos aos, un 15% de las pacientes con diagnostico de cncer de mama, optan por la reconstruccin de la mama al mismo instante que son sometidas a una mastectoma parcial o total. Generalmente estas pacientesson sometidas a Radioterapia cuyo tratamiento incluye toda la glndula mamaria. Por lo que se ha podido observar aproximadamente el 50% de estas pacientes presentan complicaciones posterior al tratamiento radiante, entre las que se puede nombrar: endurecimiento de la mama, incremento en la incidenciade la contractura capsular, etc. En el presente trabajo se realiz el seguimiento post-tratamiento de 26 pacientes que usaron prtesis mamarias durante el tratamiento con radioterapia. Los resultados muestran que un 27% de estas pacientes desarrollaron contractura capsular en los dos primeros aos de haber culminado el tratamiento de radioterapia. Adems, en una de estas pacientes se realiz un estudio de RM de mama, el cual muestra el engrosamiento del tejido que rodea la prtesis mamaria irradiada sin mostrar cambios en ellas.Por otra parte, para estudiar el efecto de la irradiacin con 6400 cGy en las prtesis mamarias, se adquiri un par de prtesis de silicona y una de estas fue irradiada con 6400 cGy. Los estudios de Microscopa Electrnica de Barrido y Ensayo Ultrasnico muestran que la cubierta de la prtesis mamaria sufre una degradacin a pequea escala sin alterar sus propiedades elsticas.','2011-05-18','irradiacin, cncer de mama, prtesis mamarias, silicona, polidimetilsiloxano, reconstruccin de mama',3,1,1,1,1,'2013-09-17 08:39:06','2013-09-17 08:39:06','Documento_583.pdf','application/pdf',4201315,'2013-09-17 08:39:06',20,0,108,'COMPLETO'),(577,'Estimacin del porcentaje de variacin obtenido en ACP usando Bootstrap.','El objetivo del presente trabajo es explicar cmo la combinacin de la tcnica del ACP y la tcnica del Bootstrap resulta util para determinar la precisin del ACP cuando se trabaja con un conjunto pequeo de datos, con lo cual es posible determinar cuan fiables son los resultados obtenidos en el mismo. En particular, se estimar el porcentaje de variacin explicado por la primera componente principal, puesto que sta variable posee la propiedad de minimizar la suma de los cuadrados de las distancias eucldeas entre ella y los datos representados en el nuevo espacio de variables componentes principales. Se aplicar la tcnica del ACP a un conjunto de datos y se calcular el porcentaje de variacin explicado por la primera componente principal. Se aplicar la tcnica del bootstrap para estimar este porcentaje mediante la utilizacin de doscientas rplicas bootstrap y se calcular el promedio de estas doscientas rplicas para ser comparado con el porcentaje de variacin observado.','2011-02-25','Anlisis de Componentes Principales, autovalores, autovectores, matriz de covarianzas, Bootstrap, funcin de distribucin emprica, muestra Bootstrap, rplica Bootstrap, principio Plug-in, estimacin.',5,1,1,1,1,'2013-09-17 08:39:09','2013-09-17 08:39:09','Documento_584.pdf','application/pdf',18401982,'2013-09-17 08:39:09',20,0,131,'COMPLETO'),(578,'Actvidad de catalizadores en base a CoMo y NiMo soportados por oxidos inorganicos modificados con compuestos organicos','En la actualidad los destilados pesados del petrleo presentan un alto contenido de hidrocarburos que poseen heterotomos en su estructura, como azufre, nitrgeno, oxgeno y metales los cuales constituyen agentes contaminantes, principalmente para el medio ambiente, debido a esta problemtica la industria del refino a nivel internacional requiere de tecnologas ms eficientes para eliminar gran parte de estos contaminantes, lo que ha generado un creciente inters en el diseo de catalizadores ms selectivos y activos para procesos de hidrotratamiento (HDT) de crudos. En el presente trabajo de grado se sintetizaron catalizadores en base a Mo, NiMo y CoMo mediante un mtodo de intercambio inico, soportado sobre almina modificada con g-aminopropiltrietoxisilano. Los precursores catalticos fueron activados empleando como agente sulfurante disulfuro de carbono (CS2) con una composicin definida de H2/CS2. El material carbnico generado in situ, proveniente de la descomposicin trmica del agente modificante, actu como soporte, mejorando la dispersin de la fase metlica y minimiz la interaccin directa entre el metal y la g- almina. La modificacin del soporte permiti que aproximadamente un 4% de fase metlica fuera depositada en el soporte, siendo este valor 3 veces menor a la carga metlica que poseen los catalizadores industriales utilizados actualmente por la industria de refinacin. La caracterizacin del soporte y los catalizadores sintetizados fueron realizadas mediante el uso de rea especfica, espectroscopa de infrarrojo y anlisis termogravimetrico. Se determin la conversin de los catalizadores sintetizados en el proceso de hidrotratamiento de gasleos de vacio (HVGO y VGO). Los productos de la reaccin de HDT del HVGO y VGO fueron caracterizados mediante las siguientes tcnicas: densidad, viscosidad, anlisis elemental de azufre y destilacin simulada.Los catalizadores NiMo y CoMo mostraron una mayor actividad por gramo de fase metlica en comparacin con el catalizador comercial. Los catalizadores CoMo mostraron ser mas eficientes y activos para la HDS del HVGO y VGO que los catalizadores NiMo. Los catalizadores sintetizados adems mejoraron notablemente algunas de las propiedades fsicas de los gasleos, obtenindose una disminucin en la viscosidad y densidad, mayor gravedad API y un aumento del porcentaje de destilado para la produccin de nafta, diesel, kerosn y gasleo.','2011-05-16','Catlisis',6,1,1,1,1,'2013-09-17 08:39:11','2013-09-17 08:39:11','Documento_585.pdf','application/pdf',2601835,'2013-09-17 08:39:11',20,0,144,'COMPLETO'),(579,'ACTIVIDAD DE CATALIZADORES EN BASE A Co--Mo y Ni--Mo SOPORTADOS POR OXIDOS INORGANICOS MODIFICADOS CON COMPUESTOS ORGANICOS','En la actualidad los destilados pesados del petrleo presentan un alto contenido de hidrocarburos que poseen heterotomos en su estructura, como azufre, nitrgeno, oxgeno y metales los cuales constituyen agentes contaminantes, principalmente para el medio ambiente, debido a esta problemtica la industria del refino a nivel internacional requiere de tecnologas ms eficientes para eliminar gran parte de estos contaminantes, lo que ha generado un creciente inters en el diseo de catalizadores ms selectivos y activos para procesos de hidrotratamiento (HDT) de crudos. En el presente trabajo de grado se sintetizaron catalizadores en base a Mo, NiMo y CoMo mediante un mtodo de intercambio inico, soportado sobre almina modificada con g-aminopropiltrietoxisilano. Los precursores catalticos fueron activados empleando como agente sulfurante disulfuro de carbono (CS2) con una composicin definida de H2/CS2. El material carbnico generado in situ, proveniente de la descomposicin trmica del agente modificante, actu como soporte, mejorando la dispersin de la fase metlica y minimiz la interaccin directa entre el metal y la g- almina. La modificacin del soporte permiti que aproximadamente un 4% de fase metlica fuera depositada en el soporte, siendo este valor 3 veces menor a la carga metlica que poseen los catalizadores industriales utilizados actualmente por la industria de refinacin. La caracterizacin del soporte y los catalizadores sintetizados fueron realizadas mediante el uso de rea especfica, espectroscopa de infrarrojo y anlisis termogravimetrico. Se determin la conversin de los catalizadores sintetizados en el proceso de hidrotratamiento de gasleos de vacio (HVGO y VGO). Los productos de la reaccin de HDT del HVGO y VGO fueron caracterizados mediante las siguientes tcnicas: densidad, viscosidad, anlisis elemental de azufre y destilacin simulada. Los catalizadores NiMo y CoMo mostraron una mayor actividad por gramo de fase metlica en comparacin con el catalizador comercial. Los catalizadores CoMo mostraron ser mas eficientes y activos para la HDS del HVGO y VGO que los catalizadores NiMo. Los catalizadores sintetizados adems mejoraron notablemente algunas de las propiedades fsicas de los gasleos, obtenindose una disminucin en la viscosidad y densidad, mayor gravedad API y un aumento del porcentaje de destilado para la produccin de nafta, diesel, kerosn y gasleo.','2011-05-16','Catalisis',6,1,1,1,1,'2013-09-17 08:39:12','2013-09-17 08:39:12','Documento_586.pdf','application/pdf',0,'2013-09-17 08:39:12',20,0,0,'INCOMPLETO'),(580,'\"\"Optimizacinn de mtodos analticos que determinan los parmetros de calidad de una toalla sanitaria\"\"..','En este trabajo especial de grado se optimizaron mtodos de laboratorio, para medir parmetros de calidad de una toalla sanitaria. Debido a que las toallas en estudio son de cubierta hidrofbica, para la evaluacin de su desempeo se requiri de un fluido artificial con propiedades fsicas acorde con la naturaleza de la misma. Por lo tanto, se desarroll de un fluido menstrual artificial afn con las necesidades de este nuevo producto. Se desarrollaron una serie de fluidos menstruales artificiales, partiendo de un fluido menstrual original como fluido estndar e incorporndole ciertas cantidades de tensoactivos (Albmina y Triton X - 100). Dichos fluidos se evaluaron mediante la medida de cuatro parmetros relacionados con el proceso de absorcin por capilaridad de una toalla sanitaria, los cuales fueron: Porcentaje de fluido no absorbido sobre un plano inclinado. Velocidad de absorcin. Retorno de fluido. Gradiente de velocidad del fluido sobre la toalla sanitaria. Los anlisis arrojaron que el fluido que ofreci el mejor comportamiento para este tipo de toalla sanitaria, fue el formado por el fluido menstrual original (sangre de ovejo con moco sinttico) y con una mezcla de tensoactivos (Albmina y Triton X - 100) en proporciones conocida. Posteriormente se realizo la caracterizacin de los fluidos y se determin mediante un anlisis de correlacin multivariante la relacin existente entre los parmetros medidos (velocidad de absorcin y retorno de fluido) y las propiedades fsicas de los fluidos afectadas por la adicin de los tensoactivos (tensin superficial y viscosidad). Por ultimo para establecer una relacin de los resultados de laboratorio con la opinin del consumidor, se aplico una regresin no lineal mltiple, donde la variable dependiente fue la opinin del consumidor y las variables independientes velocidad de absorcin y retorno de fluido. As se obtuvo una ecuacin general con la cual en el futuro se puede predecir la opinin del consumidor.','2011-01-28','{}',6,1,1,1,1,'2013-09-17 08:39:12','2013-09-17 08:39:12','Documento_587.pdf','application/pdf',2097081,'2013-09-17 08:39:12',20,0,84,'COMPLETO'),(581,'Construccin del movimiento Browniano, la hoja Browniana y su representacin en Matlab.','El movimiento Browniano o proceso de Wiener es el nombre dado al movimiento irregular que realizan las partculas de polen suspendidas en un lquido. Este movimiento fue observado por el botnico ingls Robert Brown en 1827, cuando investigaba el polen de diversas plantas.A partir de aqu aparecen distintos investigadores, que trataron de explicar ste fenmeno, entre los ms recientes tenemos a: Louis Bachelier quin en 1900 utiliz ste modelo para la descripcin del cambio de los precios de las bolsas de valores. Albert Einstein en 1905 estudi la teora fsica que explicaba ste movimiento, entre otros. Sin embargo. Sin embargo fue en 1923 cuando Nobert Wiener logra dar una construccin matemtica de dicho proceso, sentando las bases del movimiento Browniano, razn por la cual ste proceso se denomina frecuentemente proceso de Wiener. A partir de la formalizacin matemtica dada por Wiener en 1923 al movimiento Browniano, ste convirti en un rea de investigacin muy activa. Desde entonces, se han generado y se siguen generando elegantes e importantes descubrimientos relacionados con ste proceso estocstico, no solo en la matemtica, sino en otras reas como la fsica, qumica, entre otras.Luego de dicha formalizacin, muchos investigadores a nivel mundial se concentraron en extender el movimiento Browniano a una medida en varias variables surgiendo as la llamada hoja Browniana, que fue introducida por el estadstico Kitagawa en 1951, para realizar anlisis de varianza en tiempo continuo.Un conjunto separado de ideas motivan el estudio de la hoja Browniana algunas de ellas provienen del hecho de que es central para la teora de integrales estocsticas multiparamtricas y es el ejemplo bsico de una solucin de una ecuacin diferencial parcial estocstica de tipo hiperblica perturbada por un ruido blanco. La hoja Browniana tambin est conectada con el clculo de Malliavin. Este proceso tambin permite una representacin simple del proceso de Ornstein- Uhlenbeck sobre el espacio de Wiener. Adems la hoja Browniana abre un amplio terreno de estudio en la teora de potenciales.Grandes investigadores como Pruit, Orey, Walsh, entre otros, se encargaron de estudiar el comportamiento de las trayectorias de ste proceso, as como de establecer un mdulo de continuidad y una ley de logaritmo iterado las cuales permiten medir las oscilaciones de las trayectorias de la hoja.','2011-05-20','Procesos estocsticos, procesos gaussianos, movimiento Browniano, hoja Browniana, Wiener, mdulo de continuidad, Incremento doble.',5,1,1,1,1,'2013-09-17 08:39:14','2013-09-17 08:39:14','Documento_588.pdf','application/pdf',0,'2013-09-17 08:39:14',20,0,0,'INCOMPLETO'),(582,'COMPARACINN DE LA EFICIENCIA DE EXTRACCINN CON SOLVENTES DE DIFERENTE POLARIDAD,, PARA UN CRUDO MEDIANO A DOS CONCENTRACIONES EN UN SUELO SOMETIDO A BIORREMEDIACINN','Las actividades que estn envueltas en la exploracin y produccin del petrleo producen impactos potencialmente negativos sobre los ecosistemas naturales; en vista de lo cual el hombre ha desarrollado tcnicas como la biorremediacin. Un aspecto clave dentro del proceso de biorremediacin es conocer los lmites permisibles que deben alcanzarse mediante la aplicacin del tratamiento, siendo el valor lmite permisible de aceites y grasas en suelos, establecido por la legislacin venezolana, de 1% (m/m). Cuando se realizan estudios de biorremediacin de suelos contaminados con crudo es importante considerar el solvente de extraccin, el cual no es especificado en la legislacin. En la presente investigacin se compara la eficiencia de extraccin de dos solventes (n-hexano y diclorometano) para la remocin de un crudo mediano, a concentraciones de 5% y 9%, de un suelo arenoso que est siendo sometido a un proceso de biorremediacin. Se realiz en laboratorio el proceso de contaminacin de un suelo arenoso con concentraciones de 5% y 9% (m/m) del crudo mediano Guafita 10X, obtenindose dos tratamientos: A (5%) y B (9%). Se llev a cabo la extraccin del crudo presente en cada tratamiento a los 1, 15, 30, 45 y 90 das del avance de la biodegradacin, empleando el mtodo de extraccin soxhlet y usando los dos solventes. Luego de la extraccin del crudo, se determin la concentracin de COT en cada residuo de suelo. Los extractos de crudo fueron separados y cuantificados en sus fracciones constituyentes, saturados, aromticos, resinas y asfaltenos y se realiz el anlisis de biomarcadores de la fraccin de hidrocarburos saturados. Los resultados obtenidos en el estudio muestran una disminucin progresiva de la eficiencia de extraccin para ambos solventes, La eficiencia de extraccin del diclorometano result ser mayor que la del n-hexano cuando la concentracin inicial de crudo era de 5%, no obstante, a mayores concentraciones de crudo (9%), las eficiencias de extraccin obtenidas para ambos solventes no presentan diferencias significativas. La variacin en la composicin SARA durante el experimento indica que la remocin de la fraccin de hidrocarburos saturados ocurre ms rpidamente para el tratamiento A, lo cual sugiere que el proceso de biodegradacin en ste result ser ms eficiente. El anlisis de biomarcadores, tambin sugiere que la biodegradacin en el tratamiento A avanza ms rpidamente.','2011-03-01','biorremediacin, eficiencia de extraccin, crudo, concentracin.',4,1,1,1,1,'2013-09-17 08:39:16','2013-09-17 08:39:16','Documento_589.pdf','application/pdf',35714113,'2013-09-17 08:39:16',19,0,212,'COMPLETO'),(583,'Algoritmo trazador de rayos ssmicos en medios heterogneos estratificados istropos usando tcnicas nmericas.','En la prospeccin ssmica, especialmente en la exploracin petrolera, se necesita saber el camino que siguen los rayos ssmicos en el subsuelo, tomando en cuenta las diferentes capas geolgicas presentes. Como cada capa tiene su impedancia caracterstica, la velocidad de propagacin de las ondas vara con la profundidad.El trazado de rayos ssmico ha sido amplia mente usado como una tcnica de exploracin del subsuelo, produciendo con una explosin (fuente) una onda que luego es recibida por varios sensores repartidos apropiadamente de acuerdo a la mejor configuracin utilizada sobre la superficie del terreno.','2011-01-27','Trazado ssmico, anistropos, istropos, estratificado, algoritmo, heterogneo, homogneo, etc.',3,1,1,1,1,'2013-09-17 08:39:18','2013-09-17 08:39:18','Documento_590.pdf','application/pdf',2185695,'2013-09-17 08:39:18',20,0,80,'COMPLETO'),(584,'ESTUDIO GEOQUMICO DE LOS SLIDOS DISUELTOS DE LA CUENCA DEL RO TUY','En este trabajo fue llevado a cabo un estudio geoqumico en las muestras de agua de la Cuenca del Ro Tuy, con el propsito de determinar el grado de contaminacin que presenta este importante cuerpo de agua. Fueron realizadas mediciones en campo de los parmetros fisicoqumicos pH, conductividad, temperatura, alcalinidad y Eh; as como las determinaciones en el laboratorio de las concentraciones de Na, K, Ca, Mg, Cl-, SO42- y NO3-;adems de los metales traza Al, Fe, Mn, Co, Ni, Cu, Zn y Pb; y los elementos Si y P. Las muestras recolectadas en campo fueron filtradas a travs de un filtro con tamao de poro de 0,45 m para trabajar con la fraccin de slidos disueltos. Los resultados obtenidos indican que las zonas que presentan mayor contaminacin corresponden a Guayas, Ocumare, Lagartijo y Boca de Cagua, y as como los afluentes pertenecientes a la Quebrada Ca, Quebrada Charallave y Quebrada Guayas, y los ros Caucagua y Guaire, evidenciado por los altos valores de conductividad y los mayores valores de concentraciones de las especies Na, K, Ca, Mg, Cl-, SO42- y HCO3-, no obstante que en las zonas aguas arriba en el ro desde la Colonia Tovar hasta El Consejo, las concentraciones fueron similares a las de afluentes considerados como no contaminados. En cuanto a los aniones, el NO3- present sus mximos en Boca de Paparo, Hacienda Buen Paso Hacienda Santa Teresa y Tcata, atribuido este a las actividades agropecuarias. El P resalt en Araguita, Taguacita-Tuy, Guayas y Ocumare y en los afluentes de Quebrada Ca, Quebrada Charallave, Ro Caucagua y Ro Guaire, motivado tanto a las actividades agrcolas como a la entrada de aguas residuales de origen domstico. El SiO2 no present variaciones significativas. Por otro lado, los metales traza en su mayora presentaron las concentraciones ms altas en el Ro Guaire, Quebrada Charallave y Ro Caucagua, lo que corrobora la alta contaminacin que estos afluentes presentan..Las concentraciones de elementos como Al, Fe y Mn presentaron los mayores valores en Guayas y las quebradas Guayas y Ca, probablemente atribuido a las actividades industriales y domsticas.','2011-03-11','Ro Tuy; slidos disueltos; contaminacin',4,1,1,1,1,'2013-09-17 08:39:19','2013-09-17 08:39:19','Documento_591.pdf','application/pdf',6757230,'2013-09-17 08:39:19',19,0,189,'COMPLETO'),(585,'SNNTESIS Y CARACTERIZACINN QUMMICA DE 2233--piperidin--22--il--55--colen--33b--ol y 2233-- piperidin--33--il--55--colen--33b--ol','La sntesis de azasteroles como posibles inhibidores de la biosntesis del ergosterol, esterol fundamental presente en microorganismos como hongos y parsitos, principales causantes de numerosas enfermedades que ocasionan gran nmero de defunciones a nivel mundial, se ha convertido en los ltimos aos en un rea de investigacin importante ya que conforman una novedosa serie de compuestos con los que se podra obtener una mayor especificidad en la inhibicin de la enzima D24(25) Esterol Metil Transferasa (EMT). Bajo este concepto en el siguiente trabajo de investigacin se plante como objetivo principal la sntesis y caracterizacin qumica de los compuestos 2233-- piperidin--22--il--55--colen--33b--ol ((99)) y 2233--piperidin--33--il--55--colen--33b--ol ((1100)), como posibles inhibidores de la D24(25) EMT, enzima encargada de la alquilacin en el carbono C-24 en la biosntesis del ergosterol. Con este fin se realizaron transformaciones estructurales, especficamente en la cadena lateral, tomando en cuenta los compuestos sintetizados anteriormente, 22,26 azasterol (AZA 1) [13][14], AZA 2 y AZA 3 [12]. Las modificaciones realizadas se basaron en la elongacin de la cadena lateral en un tomo de carbono, para ello las estrategias sintticas de estos productos se fundamentaron en reacciones de sustitucin nucleoflica del tipo SN2 y reacciones de eliminacin principalmente.','2011-05-20','Azasterol, Esterol Metil Transferasa, olefinacin de Peterson',6,1,1,1,1,'2013-09-17 08:39:22','2013-09-17 08:39:22','Documento_592.pdf','application/pdf',711484,'2013-09-17 08:39:22',20,0,91,'COMPLETO'),(586,'\"\"ESTUDIO DEL EFECTO DE LA TEMPERATURA Y TIEMPO DE CRISTALIZACINN SOBRE LA FORMACINN DE LA MESOESTRUCTURA Al--MCM--4411\"\"','El presente trabajo est enfocado en la obtencin de un material mesoporoso tipo Al-MCM-41 variando las condiciones de sntesis; temperatura, tiempo de cristalizacin y fuente de silicio, con la finalidad de estudiar el efecto de estos parmetros sobre la formacin de la mesoestructura.En este estudio se sintetizaron 48 slidos con una relacin fija de SiO2/Al2O3= 70, a temperaturas entre 150 y 190C y tiempos de cristalizacin entre 6 y 72 horas con tetraetilortosilicato (TEOS) y silicato de sodio como fuentes de silicio. La obtencin de los mismos de realiz empleando un reactor tipo Parr bajo presin autgena siguiendo la metodologa experimental propuesta en ste trabajo. Los slidos fueron caracterizados por distintas tcnicas: Difraccin de rayos X (DRX), fisisorcin de nitrgeno, TGA-DTA y microscopa electrnica de transmisin.Para las fuentes de silicio estudiadas se observa que los difractogramas de rayos X a bajo ngulo del Al-MCM-41 sin calcinar, obtenidos a 150 y 170C y tiempos cortos de cristalizacin, revelan la presencia del pico principal a ngulos 2th = 2 caracterstico de ste de slido mesoporoso. En los difractogramas de rayos X a alto ngulo del Al-MCM-41 sin calcinar, obtenidos a 190C y tiempos largos de cristalizacin se observa un patrn de difraccin correspondientes a slidos cristalinos con ambas fuentes de silicio.Los patrones de difraccin de rayos X a bajo ngulo de los slidos calcinados muestran que a temperaturas bajas se evidencia una disminucin notable en el pico principal a ngulos 2th=2 de stos materiales con TEOS, sin embargo con silicato de sodio el patrn de DRX no muestra la presencia de un ordenamiento hexagonal; el efecto de la calcinacin sobre el ordenamiento del slido es ms drstico cuando la fuente de silicio fu silicato de sodio. A ngulos altos a partir de 2th = 5 y temperaturas de 150 y 170C se observa un patrn de difraccin correspondiente a una fase amorfa, en cambio a 190C se obtiene un patrn de difraccin correspondiente a una combinacin de fases.Los resultados de estabilidad hidrotrmica muestran que los slidos obtenidos no mantienen el ordenamiento hexagonal luego del tratamiento.Las isotermas de adsorcin de nitrgeno para los slidos sintetizados entre 150 y 190C y tiempos cortos de cristalizacin son tpicas de materiales mesoporosos (isotermas de tipo IV). A tiempos intermedios de cristalizacin se observan unas isotermas que combinan la tipo I y tipo IV y a tiempos largos se observa unas isotermas tpicas de materiales microporosos (tipo I). Una distribucin de poros estrecha es observada para bajos tiempos de cristalizacin, que luego se hace ms heterognea y se pierde a medida que aumenta la temperatura y el tiempo de cristalizacin con ambas fuentes de silicio.Con respecto al rea superficial de estos slidos, los materiales sintetizados con silicato de sodio presentaron reas superiores (1253 m2/g) a los sintetizados con TEOS como fuente de silicio (941 m2/g), todos los valores tienden a disminuir con el aumento en la temperatura y tiempo de cristalizacin.Al emplear silicato de sodio como fuente de silicio se obtienen slidos ms hidroflicos en comparacin con TEOS. Adicionalmente, las imgenes obtenidas mediante microscopa electrnica de transmisin confirman la obtencin de un material mesoporoso y se observa una transicin de fase: mezcla de fase hexagonal- laminar a una fase netamente hexagonal. La temperatura ptima que se eligi fue 150C y tiempos de cristalizacin entre 12 y 72 horas empleando Silicato de Sodio como fuente de silicio ya que era la fuente de inters por su economa.Se logr observar y verificar que ocurren las transiciones de fase con el incremento de la temperatura y tiempo de cristalizacin para las dos fuentes de silicio adems de identificarlas mediante la tcnica de Microscopa electrnica de transmisin.','2011-02-01','EFECTO DE LA TEMPERATURA Y TIEMPO DE CRISTALIZACINN SOBRE LA FORMACINN DE LA MESOESTRUCTURA Al--MCM--4411\"\"',6,1,1,1,1,'2013-09-17 08:39:23','2013-09-17 08:39:23','Documento_593.pdf','application/pdf',1476102,'2013-09-17 08:39:23',20,0,93,'COMPLETO'),(587,'Modificacinn del almidnn de yuca ((Manihot esculenta Crantz)) por metilacinn para aplicaciones en alimentos y biomedicina..','El objetivo de este trabajo fue modificar el almidn de yuca qumicamente (metilacin) para su uso en un empaque tipo comercial y con aplicaciones biomdicas. La metodologa empleada permiti la caracterizacin fsica, qumica, funcional y reolgica del almidn nativo y modificado. Se realiz un estudio de biocompatibilidad in vitrodel almidn modificado, as como la identificacin por microscopia (MLP) de los grnulos de ambos almidones. Los almidones modificados mostraron marcadas diferencias (p<<==00,,0055)) con el nativo, respecto a los anlisis proximales, fsicos y fisicoqumicos evaluados. El tratamiento de estos almidones con dimetil sulfato (DMSO4) result ser una tcnica con potencial para la obtencin de material de empaque orgnico. Los resultados indican que la formulacin de 6g almidn nativo/1mL de DMSO4/3,3g hidrxido de bario Ba (OH)2 fue efectiva para la elaboracin de pelculas rgidas; y la incorporacin de glicerol les confiri un carcter flexible. Se puede tambin indicar en funcin a los resultados obtenidos en los experimentos antes mencionados, y adems de las pruebas de citotoxicidad (MTT), que puede ser empleado como material de empaque terciario. Por otra parte, este estudio tiende a representar un aporte innovador en el empleo de almidones modificados para la produccin o formulacin de material de empaques (rgidos, y flexibles con glicerol) biodegradables de impacto en el rea de alimentos y de la biomedicina debido a que se pueden obtener hidrogeles, a base de este polmero con quitosano y glutaraldehido (agente entrecruzante) que mostraron ser excelente material de soporte que permite la adhesin, proliferacin y estimulacin considerable de la actividad celular.','2011-02-17','Metilacin,Yuca, Dimetil sulfato.',1,1,1,1,1,'2013-09-17 08:39:26','2013-09-17 08:39:26','Documento_594.pdf','application/pdf',2909979,'2013-09-17 08:39:26',20,0,180,'COMPLETO'),(588,'CARACTERIZACIN DE BIOMARCADORES EN CRUDOS Y EN RESINAS TIPO I, CO-PRECIPITADAS CON LA FRACCIN DE ASFALTENOS','Este trabajo de investigacin tuvo como objetivo general caracterizar y comparar los biomarcadores que se encuentran en la fraccin de maltenos y aquellos asociados a la fraccin denominada resinas tipo I, en seis muestras de crudo provenientes de los campos Boscn y Alturitas (Cuenca de Maracaibo), Guafita y Silvestre (Cuenca Barinas-Apure), y Junn y Ayacucho (Cuenca oriental de Venezuela), estas dos ltimas muestras correspondientes a crudos biodegradados. La fraccin de resinas I comprende a aquellas resinas que co- precipitan con los asfaltenos y que son obtenidas mediante extraccin soxhlet con n-heptano; la retencin de estos compuestos y de otras molculas orgnicas como hidrocarburos saturados y aromticos es posible debido a la existencia de estructuras de microporos en los asfaltenos. Para extraer la fraccin de hidrocarburos saturados de maltenos y de resinas I, se aplic la metodologa de separacin SARA; posteriormente se obtuvo la distribucin de n-alcanos e isoprenoides mediante Cromatografa de Gases con Detector de Ionizacin a la Llama (CG-FID), en tanto que los compuestos del tipo terpanos y esteranos se analizaron empleando Cromatografa de Gases - Espectrometra de Masas (CG-EM), adquirindose los iones m/z 191 (terpanos), m/z 177 (25-norhopanos) y m/z 217 y 218 (esteranos). Los cromatogramas y fragmentogramas de la fraccin de hidrocarburos saturados en resinas I, mostraron como caracterstica general tanto para crudos no biodegradados como para crudos con biodegradacin, una respuesta o abundancia relativa menor a la generada por los hidrocarburos saturados de la fraccin de maltenos, como reflejo de la menor concentracin de estos compuestos en la fraccin de resinas I. Se observ tambin que los n- alcanos retenidos en la estructura de los asfaltenos poseen una distribucin en el rango de n-C14 a n-C34 con un predominio de los n-alcanos de mayor masa molecular y que se tiene una retencin preferencial del isoprenoide fitano sobre el isoprenoide pristano. En los cromatogramas de saturados de la fraccin de resinas I para los crudos biodegradados, se evidenci la distribucin de n- alcanos del tipo unimodal desde n-C16 hasta n-C34con una tendencia hacia los n- alcanos > a n-C25. La forma, distribucin y relaciones de las seales de los fragmentogramas de terpanos se conserva tanto para la fraccin de hidrocarburos saturados de maltenos como para la de resinas I en todas las muestras. En las muestras sin biodegradacin se mantuvo la proporcin de los ismeros abb y aaa y de los ismeros S y R del esterano C29 en la fraccin de hidrocarburos saturados de maltenos y en la fraccin de hidrocarburos saturados de resinas I, mientras que para las muestras de crudos biodegradados no fue posible establecer un comportamiento o tendencia general de los esteranos en la fraccin de resinas I.','2011-03-01','biomarcadores, asfaltenos, resinas I, biodegradacin.',4,1,1,1,1,'2013-09-17 08:39:29','2013-09-17 08:39:29','Documento_595.pdf','application/pdf',5031810,'2013-09-17 08:39:29',20,0,116,'COMPLETO'),(589,'CARACTERIZACINN GEOQUMMICA Y RADIOACTIVA DE LA FORMACINN SAN ANTONIO,, ESTADO ANZOTTEGUI,, VENEZUELA','En el presente trabajo se estudiaron las relaciones existentes entre las medidas de radioactividad natural total (GRtotal) y discriminada por elementos (U, Th y K) y los resultados de los anlisis geoqumicos (Ctotal, Cinorgnico, COT y concentracin de bitumen) realizados en las muestras de la seccin tipo de la Formacin San Antonio ubicada en el Ro Querecual, Anzotegui, Venezuela, con objeto de conocer su utilidad en la determinacin de las variaciones ocurridas en las condiciones redox del ambiente de sedimentacin de la formacin, y para el determinar su efectividad en la identificacin de rocas madres. Los resultados obtenidos en la Formacin San Antonio, demuestran que s existe una relacin entre los resultados geoqumicos y los radioactivos, ya que aquellas muestran que presentan altas concentraciones de COT, presentan altos valores de GRtotal y de los elementos (especialmente U). A su vez, ambas variables estn relacionadas con la litologa, quedando que la mayora de las lutitas, lutitas calcreas, margas, calizas y calizas margosas (rocas madre), se encuentran en el intervalo alto de GRtotal (1000 - 2000cps), bajos - medios de U (25 - 75cps), medios - excelentes de COT (1,5 - 5,4) y altos de bitumen (140 - 405ppm); mientras que las areniscas calcreas en su mayora presentan valores bajos de GRtotal (<700cps), muy bajos - bajos de U (<50cps), bajos de COT (~1,7%) y bajos de bitumen (~64ppm), pudiendo relacionarse con la baja eficiencia de expulsin de hidrocarburos en la formacin. Lo que demuestra la efectividad de la tcnica en la determinacin de materia orgnica y por tanto en la identificacin de rocas madre.La relacin Th/U permiti determinar que si bien las condiciones redox de sedimentacin del Grupo Guayuta (Fm. Querecual y San Antonio) fueron anxicas, existen diferencias entre ellas, ya que las de San Antonio fueron anxicas en los sedimentos, donde esta presenta una interfase O2-H2S, mientras que las de Querecual fueron anxicas euxnicas. Con la relacin Th/K y los valores tan altos de torio se pudo determinar que durante la sedimentacin de la Formacin San Antonio, el aporte de clastos a la cuenca fue mayor al ocurrido durante la sedimentacin de Querecual, razn por la cual existe tanta diferencia entre ambas en cuanto a los valores de GRtotal y la litolgica.','2011-03-01','Formacin San Antonio, Uranio, Torio, Potasio, Radioactividad, Rayos Gamma, COT, Bitumen.',4,1,1,1,1,'2013-09-17 08:39:30','2013-09-17 08:39:30','Documento_596.pdf','application/pdf',1333537,'2013-09-17 08:39:30',20,0,82,'COMPLETO'),(590,'CARACTERIZACIN GEOQUMICA DE LOS SUELOS ASOCIADOS A DISTINTAS ESPECIES DE MANGLE DE LA ZONA OESTE DEL GOLFETE DE CORO Y NORESTE DE LA PENNSULA DE PARAGUAN, ESTADO FALCN','Fue realizado un estudio de los suelos asociados a distintas especies de mangle en Laguna de Boca de Cao (mangles de 3 a 8 metros de altura), al noreste de la Pennsula de Paraguan, y en Punta Caimn (mangles no superan los 2 metros de altura), al Oeste del Golfete de Coro, estado Falcn, determinando la concentracin de Fe, Al, Ni, Mn, Ca, Cu, Pb, Hg, Zn, Cr, Cd, C, N y P, adems de los parmetros fisicoqumicos pH, Eh y salinidad. Para ello, fueron captadas muestras de suelo en 13 puntos de muestreo a profundidades de 30 cm, 60 cm y 90 cm, a las cuales le fue realizada una extraccin secuencial con HCl 1 M y HNO3 concentrado, para determinar los elementos Fe, Al, Ni, Mn, Ca, Cu, Pb, Zn, Cr y Cd por espectroscopia de emisin atmica acoplado a fuente de plasma (ICP), y P por fotocolorimetra (Murphy y Riley). Adems, el C total fue determinado por medio de un analizador directo de carbono (LECO) y por el mtodo Walkley-Black para determinar C orgnico. Por otra parte, el N se determin por el mtodo de Kjeldahl modificado de Jackson, y el Hg fue determinado mediante un equipo analizador directo de mercurio (DMA-80). Los resultados indican que en ambas zonas el Eh tiende a disminuir con la profundidad, y que los suelos de Boca de Cao son ms cidos que los presentados en Punta Caimn. Por otra parte, la principal diferencia entre la zonacin de las especies es la salinidad, pues suelos dominados por Avicennia germinans presentan mayor salinidad que los dominados por Rizophora mangle. Tambin se encontr que en los suelos asociados a los manglares de las zonas de la Laguna de Boca de Cao existe mayor acumulacin de materia orgnica en comparacin con los suelos de manglar de Punta Caimn, debido a que en este ltimo existe una removilizacin de materia orgnica por efecto de las mareas y como consecuencia el nitrgeno queda fijado en el suelo. Entre las diferencias ms importantes encontradas entre las dos zonas estudiadas fueron que las concentraciones de Al, Fe, Mn, Ni, Cu, Cr, Zn, P y Pb asociado al extracto de HNO3(c), las concentraciones de Cu, Zn, Pb y Cd asociado al extracto HCl 1M, y la concentracin de Hg son mayores en los suelos de manglar de Punta Caimn que en los suelos de manglar de Boca de Cao, debido a un aporte litolgico principalmente. Por otra parte, los mangles de Punta Caimn son enanos debido a una deficiencia de P biodisponible.','2011-03-04','Suelos, Manglares, Geoqumica Ambiental, Ecologa, Metales pesados y nutrientes.',4,1,1,1,1,'2013-09-17 08:39:31','2013-09-17 08:39:31','Documento_597.pdf','application/pdf',3763781,'2013-09-17 08:39:31',20,0,87,'COMPLETO'),(591,'ESTUDIO GEOFISICO INTEGRADO CON FINES DE EXPLORACION DIAMANTIFERA EN LA ZONA DE SANTA ELENA DE UAIREN, EDO. BOLIVAR','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} A nivel mundial se ha encontrado que las pipas kimberlitas pueden generar anomalas magnticas y/o electromagnticas siendo posible la utilizacin de estos mtodos geofsicos para la deteccin de su ubicacin. En este trabajo se realiz el levantamiento y verificacin en tierra de 12 perfiles obtenidos en un levantamiento aerogeofsico (magntico, electromagntico y radiomtrico) realizado por INGEOMIN entre los aos 2007 y 2008, con la finalidad de determinar posible presencia de pipas kimberliticas. De estos doce perfiles verificados en tierra se pudo evidenciar la anomala (magntica, electromagntica y/o radiomtrica) en siete de ellos. Estos fueron propuestos para realizarles perfiles paralelos o cruzados a fin de delimitar la anomala en forma y tamao. De los siete perfiles seleccionados, se realiz el modelaje directo de pipas kimberlitas a tres perfiles con anomalas magnticas negativas. Las pipas kimberlitas obtenidas en estos modelos se encuentran a profundidades superiores a 150m con respecto a la superficie, con dimetros cercanos a los 300m y una extensin en profundidad mayor a los 450m. A partir del modelaje directo se determin el espesor de la Provincia de Roraima al Nor- Este de la zona de estudio, el espesor mximo obtenido fue de 277m el cual disminuye en forma de cua hacia el Sur-Oeste hasta llegar al borde del dique, ya que a partir del dique solo se afloran rocas de la Provincia Geolgica de Cuchivero.','2011-05-18','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',3,1,1,1,1,'2013-09-17 08:39:36','2013-09-17 08:39:36','Documento_598.pdf','application/pdf',12554441,'2013-09-17 08:39:36',20,0,268,'COMPLETO'),(592,'Anlisis de los Procesos Electorales de Venezuela entrelos aos 1830 a 1860 y Mtodos MatemticosElectorales.','El objetivo principal de esta tesis de grado es el estudio y aplicacin de mtodos de reparto que permita convertir los votos en una decisin final que sea ms justa y coherente con los deseos del electorado y as minimizar la injusticia electoral.Se da una breve resea histrica de la evolucin del Sistema Electoral Venezolano en la poca de 1830 - 1860, y una descripcin general del Sistema Electoral y el Sistema Electoral venezolano usando conceptos elementales, proporcionando defniciones claras.Para conocer los escaos que corresponden a cada uno de los distintos partidos o movimientos polticos existen varios mtodos de reparto que se han ido modificando a medida que se han conocido sus ventajas y sus inconvenientes en la prctica poltica.Se hace una descripcin matemtica de los mtodos de reparto ms utilizados: El mtodo de Hamilton, la regla de D\'Hontd, el mtodo de Hare/ Niemeyer los cuales se ilustran con varios ejemplos que ayuda a comprender su funcionamiento y a sealar, al mismo tiempo, los diversos problemas que les son inherentes y los resultados paradjicos que pueden producir. Posteriormente, en la bsqueda de un criterio para decidir cul de estos mtodos es ms adecuado, se propone la definicin del concepto de injusticia introducida por Huntington. Se describen las principales caractersticas del sistema electoral venezolano en los aos de 1830 y 1860 y se analizan los resultados obtenidos por estos mtodos para esa fecha.Se estudia el problema de la construccin de la funcin de decisin social, se enuncian teoremas y definiciones necesarias para esta construccin.','2011-05-19','Mtodo matemticos electorales.Sistema electoral',5,1,1,1,1,'2013-09-17 08:39:37','2013-09-17 08:39:37','Documento_599.pdf','application/pdf',2880983,'2013-09-17 08:39:37',20,0,97,'COMPLETO'),(593,'Anlisis Anlisis de los Procesos Electorales Entre los Aos1870 a 1935, Caso Venezuela y MtodosMatemticos Aplicados a Sistemas Electorales','En este trabajo especial de grado tenemos dos grandes vertientes en la parte metodolgica, como lo es parte histrica y la moderacin electoral matemtica. Como el proceso histrico estudiado corresponde a finales del siglo XIX y principios del siglo XX, la data estadstica de los participantes en los eventos electorales, as como los resultados de este proceso no son de fcil obtencin, es por ello que en este trabajo no hacemos uso del modelo matemtico electoral para comprender el proceso histrico estudiado. Sin embargo en particular en este trabajo se puede hacer una investigacin minuciosa de estos datos y aplicarlo a los modelos correspondientes y obtener algunas informaciones relevantes. Otra observacin es que hay algunas mtodos electorales o herramientas electorales que se crean a mediado del siglo XX, como por ejemplo el teorema de Arrow, la nocin de injusticia electoral y la poca histrica estudiada es la del siglo anterior.','2011-05-19','Mtodos Matemticos Aplicados a Sistemas Electorales (1870 a 1935)',5,1,1,1,1,'2013-09-17 08:39:38','2013-09-17 08:39:38','Documento_600.pdf','application/pdf',2291953,'2013-09-17 08:39:38',20,0,150,'COMPLETO'),(594,'Interacciones Puntuales: Condiciones de Frontera o Potenciales Singulares que Usan la delta de Dirac','Estudiamos el problema de una partcula cuntica no-relativista sobre la lnea real conuna interaccin puntual en x= 0. Este tipo de sistema se puede describir de dos formas:quitando explcitamente el punto x= 0; en cuyo caso la interaccin puntual queda determinada exclusivamente por condiciones de frontera, o bien, considerando explcitamente lainteraccin singular por medio de un potencial singular distribucional. Determinamos lascondiciones de frontera que caracterizan a cada una de las interacciones puntuales e identificamoslos respectivos potenciales singulares que las definen. Nos concentramos en algunosejemplos representativos de interacciones puntuales y estudiamos sus correspondientes estadosligados.','2011-05-25','Interacciones Puntuales, Mecnica Cuntica No-relativista, Condiciones de Frontera, Delta de Dirac, Potencial Singular Distribucional, Estados Ligados.',3,1,1,1,1,'2013-09-17 08:39:45','2013-09-17 08:39:45','Documento_601.pdf','application/pdf',0,'2013-09-17 08:39:45',20,0,0,'INCOMPLETO'),(595,'Funciones de H-Variacin Acotada en un intervalo y un Teorema de Representacin de Korenblum.','Este trabajo de grado consiste en presentar el uso de las Funciones de Variacin Acotada al igual que ciertas propiedades de este espacio de funciones, las cuales permiten presentar y definir de manera explcita las Funciones de H-Variacin Acotada en un intervalo y desarrollar de manera explcita el Teorema de Representacin de Korenblum.','2011-05-19','H-Variacin Acotada, Teorema de Representacin de Korenblum',5,1,1,1,1,'2013-09-17 08:39:46','2013-09-17 08:39:46','Documento_602.pdf','application/pdf',1351088,'2013-09-17 08:39:46',20,0,150,'COMPLETO'),(596,'CARACTERIZACINN GEOQUMMICA DE LOS SEDIMENTOS DISTALES HOLOCENOS DEL VALLE GLACIAL DE LA CANOA,, REGINN DE PUEBLO LLANO,, ESTADO MRRIDA','El presente trabajo muestra un estudio geoqumico realizado en sedimentos distales de un paleolago ubicado en el Valle Glacial de La Canoa, cerca de Pueblo Llano, donde las fluctuaciones climticas y la actividad sismotectnica juegan un papel influyente sobre los mismos. Los objetivos fueron determinar la influencia paleoclimtica y paleossmica durante la sedimentacin lacustre, con la finalidad de generar un aporte en la comprensin de los procesos que han influido y siguen influyendo dentro de la regin andina. Para llevar a cabo los objetivos planteados se emplearon herramientas quimioestratigrficas, las muestras fueron disueltas utilizando una mezcla de boratos como fundentes y para cuantificar los elementos mayoritarios, minoritarios y traza las soluciones fueron analizadas por medio de espectrometra de emisin ptica inductivamente acoplado a plasma (EEO-IAP) y emisin atmica con fuente de llama. Del tratamiento estadstico multivariado surgieron dos asociaciones elementales, relacionadas a las diferencias granulomtricas en los sedimentos y de cada asociacin dos quimiofacies distintivas, determinando una influencia completamente climtica dividida en dos procesos. Un proceso general, que conlleva fluctuaciones climticas en el orden de las decenas a centenas de aos, relacionadas a la relacin interelemental K/Al, con valores desde 0,28 a 0,43, revelando meteorizacin de tipo mecnica prevaleciente y que de acuerdo a los perodos de ciclicidad que mostraron los dendrogramas de agrupamiento restringido posiblemente se deban a variaciones en la intensidad de radiacin solar incidente y un proceso distinto, ubicado desde la profundidad de 19 cm hasta el tope de la secuencia que se relaciona a un perodo climtico ms intenso que gener probablemente el cierre de la cuenca, lo que desde el punto de vista estratigrfico est representado por el aumento del tamao de grano en esa seccin e intercalaciones de sedimentos.','2011-05-05','Geoqumica, quimioestratigrafa, paleoclimatologa, paleosismoloa, Andes Venezolanos.',4,1,1,1,1,'2013-09-17 08:39:47','2013-09-17 08:39:47','Documento_603.pdf','application/pdf',565620,'2013-09-17 08:39:47',20,0,101,'COMPLETO'),(597,'Descripcinn ultraestructural y molecular del proceso de la muerte celular en Trypanosoma evansi','La tripanosomosis equina produce importantes prdidas econmicas en Venezuela por cuanto los caballos son ampliamente utilizados en las actividades de la ganadera bovina extensiva. Esta afeccin est asociada a la presencia de Trypanosoma evansi en equinos y es denominada derrengadera en los llanos de nuestro pas. Las alteraciones ultraestructurales que sufren diferentes tejidos (corazn, hgado, medula espinal, musculo esqueltico, pncreas entre otros) asociados a la patologa de esta enfermedad han sido descritos en la ltima dcada, no obstante la descripcin de los eventuales cambios que pudieran sufrir los tripomastigotes sanguneos de Trypanosoma evansi durante el proceso de muerte celular se desconocen tanto ultraestructuralmente como molecularmente. En los tejidos de mamferos se han descrito con bastante exactitud los procesos de necrosis y/o muerte celular programa, sin embargo es difcil discernir entre estos procesos en el caso de organismos unicelulares. Por ello el objetivo de este trabajo es describir a nivel ultraestructural y molecular los procesos de muerte celular que sufren estos microorganismos durante infecciones experimentales de murinos. Para ello se inocul 1 tripomastigote/gr de peso corporal por va intradrmica proveniente de una infeccin natural en Equus cabalus(Estado Gurico)en ratones NMRI, nterdiariamente y hasta la muerte de los ratones se extrajo sangre de la vena caudal. Se proceso mediante tcnicas rutinarias de microscopa electrnica de transmisin, los cortes se obtuvieron en un ultramicrotomo Porter-Blum MT2-B y se contrastaron con sales pesadas. Posteriormente stos fueron examinados con un microscopio electrnico de transmisin Philips CM-10 (80 kV) y registrados permanente en negativos Kodak (8,310,2 cm; # 4489). La sangre colectada, adems, se proces para obtener la respuesta parasitolgica de la infeccin, por medio de una adaptacin del mtodo original de Brener, y tambin se determinaron las variables morfolgicas de los tripomastigotes por medio del protocolo de extendidos de sangre. Adicionalmente de los tripomastigotes fueron purificados por una columna de DEAE-celulosa y su ADN genmico fue aislado mediante la utilizacin de un estuche comercial. Por ltimo tanto el ADN genmico fue separados en geles de agarosa y visualizados a travs de un analizador de geles. Los resultados mostraron una heterogeneidad de alteraciones en los tripomastigotes que evidenciaban procesos de muerte celular activos, tanto a nivel morfolgico como gentico los tratamientos con droga y altas densidades poblacionales resultaron en daos asociables a diferentes tipos de muerte celular.','2011-05-20','Muerte celular, Trypanosoma evansi',1,1,1,1,1,'2013-09-17 08:39:49','2013-09-17 08:39:49','Documento_604.pdf','application/pdf',349553,'2013-09-17 08:39:49',20,0,51,'COMPLETO'),(598,'\"\"Ultraestructura del mssculo esqueltico en pacientes con Tiroiditis\"\"','La presente investigacin evalu la relacin entre patologas de tipo autoinmune, como lo es la tiroiditis y analizar los efectos ultraestructurales de esta enfermedad sobre la musculatura esqueltica de humanos. Para ello se estudiaron diez pacientes con diagnstico de Tiroiditis Linfoctica Crnica, diagnosticada previamente por biopsia de la glndula tiroidea. A estos pacientes a nivel mdico se les efectuaron distintos estudios, haciendo nfasis en la bsqueda de los sntomas y signos de afeccin muscular; as mismo se explorar la condicin de funcin tiroidea por T3 y T4 libres y TSH, gammagrama tiroideo y captacin de I131 a fin de evaluar su estado tiroideo en cada uno de los pacientes. Se determinarn anticuerpos antitiroideos y enzimas musculares a nivel plasmtico, as como evaluacin electromiogrfica, a fin de comprobar la existencia de miopata. Muestras (biopsias) del msculo quadriceps femoral, se utilizaron para efectuar estudios de microscopa ptica, histoqumica, inmunofluorescencia y microscopa electrnica de transmisin. La revisin bibliogrfica, el diagnstico, el seguimiento clnico de pacientes y la evaluacin de las biopsias musculares, se orientaron a determinar la relacin entre la tiroiditis y daos a nivel del msculo esqueltico, a travs de los hallazgos y anlisis en la ultraestructura muscular de las biopsias, a fin de contribuir al conocimiento de los procesos celulares que se encuentran involucrados en las alteraciones que tienen lugar en las fibras musculares esquelticas y que cursan con diversas patologas autoinmunes. Entre los resultados obtenidos en la presente investigacin, a nivel ultraestructural se pueden destacar atrofia, hipertrofia, autofagia y necrosis segmentaria.','2011-02-17','Tiroiditis, Msculo Esqueltico, Enfermedades Endocrinas Autoinmunes, Atrofia muscular, Hipertrofia muscular, necrosis segmentaria, autofagia.',1,1,1,1,1,'2013-09-17 08:39:50','2013-09-17 08:39:50','Documento_605.pdf','application/pdf',3381138,'2013-09-17 08:39:50',20,0,140,'COMPLETO'),(599,'Evaluacinn de las posibles alteraciones en la ultraestructura muscular esqueltica de la Tilapia((Oreochromis mossamlicus))delLago de Valencia ((Edos.. Aragua y Carabobo))como efecto de los impactos antrppicos','El Lago de Valencia es un cuerpo de agua expuesto a un fuerte proceso de contaminacin como consecuencia a las actividades humanas e industriales desarrolladas en sus mrgenes y del dbil recambio de agua. A pesar de este proceso y la prohibicin por parte de Ministerio de Ambiente de la pesca, se observa que del Lago de Valencia se capturan, no obstante, de manera sistemtica y se venden grandes cantidades de pescado para consumo humano. Se estima que en la ultraestructura muscular esqueltica de la tilapia (Oreochromis mossamlicus)),, perteneciente a la familia Cichlidae,, especie que result dominante en el Lago de Valencia, se pueda comprobar efectos de la contaminacin. Por su parte, los desechos que contienen metales pesados y que son descargados en sistemas acuticos o llegan eventualmente a ellos, se distribuyen en el agua y se acumulan en los peces y los sedimentos. Es de suma importancia, determinar los efectos que tienen los metales pesados sobre la musculatura esqueltica de peces comestibles del lago de Valencia, para lo cual se realiz anlisis de la ultraestructura esqueltica de la tilapia, como pez comestible del lago Valencia, ya que sta es adems consumida por la poblacin humana de los sectores aledaos. Entre los elementos evaluados en los estudios ambientales y toxicolgicos se encuentran el cadmio (Cd), mercurio (Hg), plomo (Pb), nquel (Ni) y cromo (Cr), elementos cuyo efecto txico sobre la salud humana est bien caracterizado (Storelli & Marcotrigiano, 2004). Este trabajo de investigacin evalu los cambios en la ultraestructura muscular esqueltica de la Tilapia proveniente del Lago de valencia y su relacin con factores de contaminacin. .....................','2011-02-25','Tilapia(Oreochromis mossamlicus), Lago de Valencia, Contaminacin por metales pesados, musculatura esqueltica en peces, daos en fibra muscular de peces comestibles.',1,1,1,1,1,'2013-09-17 08:39:51','2013-09-17 08:39:51','Documento_606.pdf','application/pdf',3331808,'2013-09-17 08:39:51',19,0,147,'COMPLETO'),(600,'CARACTERIZACIN GEOQUMICA DE LOS SEDIMENTOS DISTALES HOLOCENOS DEL VALLE GLACIAL DE LA CANOA, REGIN DE PUEBLO LLANO, ESTADO MRIDA','El presente trabajo muestra un estudio geoqumico realizado en sedimentos distales de un paleolago ubicado en el Valle Glacial de La Canoa, cerca de Pueblo Llano, donde las fluctuaciones climticas y la actividad sismotectnica juegan un papel influyente sobre los mismos. Los objetivos fueron determinar la influencia paleoclimtica y paleossmica durante la sedimentacin lacustre, con la finalidad de generar un aporte en la comprensin de los procesos que han influido y siguen influyendo dentro de la regin andina. Para llevar a cabo los objetivos planteados se emplearon herramientas quimioestratigrficas, las muestras fueron disueltas utilizando una mezcla de boratos como fundentes y para cuantificar los elementos mayoritarios, minoritarios y traza las soluciones fueron analizadas por medio de espectrometra de emisin ptica inductivamente acoplado a plasma (EEO-IAP) y emisin atmica con fuente de llama. Del tratamiento estadstico multivariado surgieron dos asociaciones elementales, relacionadas a las diferencias granulomtricas en los sedimentos y de cada asociacin dos quimiofacies distintivas, determinando una influencia completamente climtica dividida en dos procesos. Un proceso general, que conlleva fluctuaciones climticas en el orden de las decenas a centenas de aos, relacionadas a la relacin interelemental K/Al, con valores desde 0,28 a 0,43, revelando meteorizacin de tipo mecnica prevaleciente y que de acuerdo a los perodos de ciclicidad que mostraron los dendrogramas de agrupamiento restringido posiblemente se deban a variaciones en la intensidad de radiacin solar incidente y un proceso distinto, ubicado desde la profundidad de 19 cm hasta el tope de la secuencia que se relaciona a un perodo climtico ms intenso que gener probablemente el cierre de la cuenca, lo que desde el punto de vista estratigrfico est representado por el aumento del tamao de grano en esa seccin e intercalaciones de sedimentos.','2011-05-05','Geoqumica, quimioestratigrafa, paleoclimatologa, paleosismologa, Andes Venezolanos.',4,1,1,1,1,'2013-09-17 08:39:54','2013-09-17 08:39:54','Documento_607.pdf','application/pdf',1746485,'2013-09-17 08:39:54',20,0,129,'COMPLETO'),(601,'Anlisis y procesos electorales entre los aos 1935 a2009, caso Venezuela y mtodos matemticos aplicadosa sistemas electorales.','En democracia, se realizan procesos de eleccin de diversos puestos de representacin pblica,tales como presidente, gobernadores, alcaldes, diputados, concejales, entre otros. Estos procesos sonconocidos como procesos electorales. En ellos intervienen diferentes actores como lo son: los electores,los candidatos, los partidos, los medios de comunicacin y las autoridades que organizan el proceso.Teniendo un rol de gran magnitud las autoridades, ya que ellos deben regir los procedimientos parala conformacin de la lista de electores, las normas para la realizacin de las campaas, la instalacinde los lugares de votacin, la emisin y conteo de los sufragios, la resolucin de los conflictos quese presenten antes y despus del acto electoral. Cuando se efectan elecciones para la reparticinde uno o ms cargos, la conversin de votos en escaos se puede hacer utilizando un mtodo dereparto. Dicho mtodo se encargara de distribuir un nmero de escaos a cada partido de maneraproporcional, es decir, a cada partido se le asignara un porcentaje de los cargos dependiendo de lacantidad de votos que haya obtenido en el acto.','2011-05-19','Mtododos electorales',5,1,1,1,1,'2013-09-17 08:39:56','2013-09-17 08:39:56','Documento_608.pdf','application/pdf',3692576,'2013-09-17 08:39:56',20,0,98,'COMPLETO'),(602,'Estudio geoqumico exploratorio de los sedimentos superficiales del delta del ro Mitare, estado Falcn','El presente trabajo se realiz con el objetivo de conocer las caractersticas geoqumicas de los sedimentos superficiales del delta del ro Mitare. El mismo se define como un estudio exploratorio que permiti, de manera general, conocer los procesos geoqumicos que condicionan la abundancia, distribucin y migracin de distintos elementos en este ambiente, dar un aporte a la interpretacin de la evolucin geolgica reciente del rea y obtener una visin del posible efecto que tienen las actividades humanas sobre el sistema. Para lograr el objetivo propuesto se le aplic un tratamiento fsico (secado y tamizado en seco) y qumico a un conjunto de 30 muestras de sedimentos tamao lodo (<62,5m), que consisti en: fusin alcalina con boratos y extraccin secuencial cida en dos etapas (HCl 1M y HNO3concentrado). Se determinaron fases qumicas (Al, Ca, Fe, Mg, Si, Na, K, Ti, Mn, Ba, Pb, Zr, Co y Cr) a travs de las tcnicas EEO-IAP y EEA-Llama, fases mineralgicas por medio de DRX y la concentracin de mercurio total. Mediante el empleo de herramientas de la estadstica paramtrica (bivariada y multivariada), se obtuvo que los procesos clsticos, carbonticos y evaporticos son los que controlan la distribucin geoqumica global en el sistema, y que existen diferencias estadsticamente significativas entre el rea de influencia del delta (planicie costera) y el ambiente fluviodeltaico, enmarcadas por el efecto dominante de los procesos evaporticos en el rea de influencia. A partir de la interpretacin de resultados y grficos relacionados con la geoqumica sedimentaria, se propone que los principales procesos sedimentolgicos, que determinan las propiedades tanto granulomtricas como geoqumicas de este sistema son los fluviales y elicos y se obtuvo que las secciones de grano fino de la Cuenca Central de Falcn (material candidato a referencia MCAF) renen las mismas caractersticas composicionales que las muestras de estudio. Adicionalmente se obtuvo que las concentraciones de la mayora de los metales estudiados, se encuentran por debajo de las correspondientes a sistemas poco contaminados, muy contaminados y materiales de referencia internacional, sin embargo, las concentraciones de mercurio se presentan en una relacin tres veces superior a la correspondiente a MCAF, como referencia de la fuente de sedimentos, por lo que se plantea como recomendaciones hacer un estudio detallado de la distribucin de mercurio en esta zona, que involucre un muestreo sistemtico y que se considere la escala temporal y por otro lado, que se evale el efecto que tienen sobre el sistema las actividades industriales que se desarrollan en zonas aledaas.','2011-03-02','Geoqumica, sedimentos, geoqumica sedimentaria, geoqumica ambiental, delta del ro Mitare, Falcn',4,1,1,1,1,'2013-09-17 08:39:58','2013-09-17 08:39:58','Documento_609.pdf','application/pdf',5221680,'2013-09-17 08:39:58',19,0,91,'COMPLETO'),(603,'Caracterizacin estructural y magntica del sistema Nd((11-- y))SmyMn((11--x))FexO33 sintetizado por el mtodo Sol--Gel','Se sintetizaron muestras nanocristalinas del tipo perovskita pertenecientes al sistema Nd(1-y)SmyMn(1- x)FexO3 por medio del mtodo sol-gel de polimeracin de nitratos-cido ctrico para las siguientes concentraciones (x=0; y=0), (x=1; y=1), (x=0; y=1), (x=1; y=0), (x=0,25; y=0,5), calcinadas en un horno tubular convencional a temperaturas de 600 oC, 900 oC y 1200 oC. La caracterizacin estructural, en las diferentes muestras, fue realizada a travs de la tcnica de difraccin de Rayos X (DRX) en polvo, encontrndose que el compuesto Nd0,75Sm0,25Mn0,5Fe0,5O3 present una mezcla de fases de las especies precursoras en forma de ferritas y manganitas aproximndose a una estructura ortorrmbica tipo Pbnm. Mientras que en el resto de las concentraciones crecidas a temperaturas de 900 oC y 1200 oC se encontr una nica fase correspondiente a una estructura ortorrmbica. Micrografas realizadas al sistema Nd(1-y)SmyMn(1-x)FexO3por medio de la microscopa electrnica de transmisin (MET), presentaron la formacin de nanopartculas de dimensiones menores a 80nm, especialmente en ferritas calcinadas a altas temperaturas (900 oC y 1200 oC), adems de presentar una morfologa bien definida y homognea. Las medidas de resonancia paramagntica electrnica (RPE) mostraron que el sistema Nd(1-y)SmyMn(1-x)FexO3 en todas las concentraciones presenta un factor giromagntico alrededor de 2 a temperatura ambiente. Los anlisis realizados del comportamiento del ancho de linea DHpp en los espectros de RPE como funcin de la temperatura se determin el parmetro de la temperatura de Curie-Weiss y de la temperatura de congelamiento de transiciones de fase paramagntica a la fase de vidrio espn. Los resultados de la magnetometra de muestra vibrante (MMV) realizados a temperatura ambiente mostraron que el sistema Nd(1-y)SmyMn(1-x)FexO3 en todas las concentraciones presenta un campo coercitivo bajo y poca magnetizacin remanente lo cual es caracterstico de sistemas nanomtricos .','2010-12-08','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',3,1,1,1,1,'2013-09-17 08:40:00','2013-09-17 08:40:00','Documento_610.pdf','application/pdf',1758411,'2013-09-17 08:40:00',19,0,48,'COMPLETO'),(604,'ESTUDIO DE MICOBACTERIAS ATPICAS Y SU RELACIN CON LA SUSCEPTIBILIDAD A LOS DESINFECTANTES DE AMONIO CUATERNARIO','Las micobacterias atpicas son todas aquellas que no pertenecen al Complejo M.. tuberculosis o M.. leprae. Estas micobacterias se encuentran ampliamente distribuidas en el medio ambiente, fundamentalmente en el agua y la tierra, por lo tanto pueden llegar a ser causantes de infecciones oportunistas asociados principalmente a pacientes inmunocompetentes e inmunocomprometidos. Las micobacterias son reconocidas por su alta resistencia a la desinfeccin, siendo esta propiedad consecuencia de la presencia de una pared celular compuesta por un alto contenido lipdico y de cidos miclicos que actan como barrera de proteccin frente a agentes qumicos. Diferentes publicaciones indican que una desinfeccin inefectiva o el uso de desinfectantes inadecuados pueden ser una posible explicacin para infecciones producidas por micobacterias en procedimientos quirrgicos o cosmticos, debido al uso comn de estos en hospitales y consultorios en Venezuela para la desinfeccin de materiales, ya que se encuentran registrados como productos esterilizantes y/ o tuberculicidas.Debido a que las micobacterias ocasionan un verdadero problema de salud pblica, este trabajo tuvo como objetivos la confirmacin de las identidades de las micobacterias atpicas: M.. simiae,, M.. abscessus C,, M.. chelonae,, M.. fortuitum,, M.. kansasii,, M.. gordonae,, M.. mucogenicum,, M.. cosmeticum,, M.. scrofulaceum,, M.. peregrinum,, M.. phlei,, M.. lentiflavum,, M.. flavescens,, M.. massiliense,, M.. intracellulare,, M.. sherrisii,, M.. marinum, M.. bovis BCG y M.. abscessus, mediante la tcnica de PRA hsp6655. Los resultados obtenidos indican que con esta tcnica de identificacin no fue posible confirmar las identidades de las muestras suministradas por el Laboratorio de Tuberculosis de Biomedicina, debido a las diferencias entre los patrones de restriccin obtenidos y los asignados a esas especies en la base de datos del PRAsite, razn por la cual se procedi a la secuenciacin de los genes 16S ARNr y rpoB..Por otro lado, se determin la frecuencia de seleccin de sobrevivientes a dos compuestos de amonio cuaternario (BLDBA y CTAB) a travs del mtodo de dilucin - neutralizacin. Los resultados indican que las especies pertenecientes al complejo M.. abscessus - chelonae,resultaron tener una alta frecuencia de seleccin de sobrevivientes al estar en contacto con estos compuestos. Tambin se obtuvo una alta frecuencia de seleccin de sobrevivientes en las siguientes especies de micobacterias: M.. timonense (colonia resistente 1 y 2), M.. senegalense, M.. abscessus C, M.. massiliense, M.. marinum, M.. abscessus (colonia resistente 1 y 2), M.. bovis BCG, a los 20 minutos y a las 1 hora de exposicin, sin encontrar algn sobreviviente despus de 24 horas de exposicin a excepcin de M.. bovis BCG. Estos resultados sealan que la susceptibilidad de las micobacterias atpicas a los compuestos de amonio cuaternario BLDBA y CTAP vara entre especies, as como tambin dentro de la misma especie.','2011-05-25','Micobacteria atpicas, compuestos de amonio cuaternario, identificacin de micobacterias atpicas, resistencia.',1,1,1,1,1,'2013-09-17 08:40:01','2013-09-17 08:40:01','Documento_611.pdf','application/pdf',756767,'2013-09-17 08:40:01',19,0,68,'COMPLETO'),(605,'Sistema de Gestion de Incidentes y de Problemas para los servicios prestados por la Corporacion Suiche 77B','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} El presente trabajo expone fundamentos conceptuales, metodolgicos y de implementacin que resumen la investigacin del Trabajo Especial de Grado realizado con el objetivo de desarrollar una aplicacin Web para la Corporacin Suiche 7B C.A. que permita a las diferentes instituciones bancarias registrar cualquier tipo de incidente o problema que se haya presentado en algunos de los servicios prestados por la corporacin. El sistema en cuestin permitir el registro y manejo de incidentes y problemas, todo bajo la filosofa de registro de eventos y tickets respectivamente, pero a parte de ello tambin se tendr la posibilidad de crear una base de conocimientos de incidentes y problemas recurrentes, lo cual es primordial para casos futuros con las mismas caractersticas. Por otra parte se ayudara a tener estadsticas de todos los problemas e incidencias presentadas, as como tambin indicadores acerca de la eficacia con respecto al tiempo de atencin de los problemas. Para alcanzar estos objetivos se aplic un mtodo basado en el MA (Modelado gil), detallando las etapas de problema o especificacin de requerimientos, anlisis, diseo, implementacin y verificacin / pruebas. Se obtuvo como resultado una aplicacin Web para el manejo del personal de las diferentes bancos clientes, para el personal de la Gerencia de Operaciones de la Corporacin Suiche 7B, y para los operadores de IBM; convirtindose as, en la aplicacin fundamental para determinar los niveles de eficiencia de los servicios prestados por la empresa.','2011-05-26','v:* {behavior:url(#default#VML);} o:* {behavior:url(#default#VML);} w:* {behavior:url(#default#VML);} .shape {behavior:url(#default#VML);} Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-nam',2,1,1,1,1,'2013-09-17 08:40:02','2013-09-17 08:40:02','Documento_612.pdf','application/pdf',744058,'2013-09-17 08:40:02',20,0,50,'COMPLETO'),(606,'Distribucin y acumulacin de carbono en clases de tamaos contrastantes de partculas de sedimentos provenientes del Glaciar Collins, Isla Rey Jorge, continente Antrtico','El presente trabajo plantea como objetivo general, estudiar la distribucin y acumulacin de carbono en clases de tamaos de partculas de sedimentos provenientes del glaciar Collins, Isla Rey Jorge en el continente Antrtico. Para esto fueron recolectadas 12 muestras de sedimentos, separadas posteriormente en 9 clases de tamaos de partculas: grava, arena muy gruesa, arena gruesa, arena media, arena fina, arena muy fina, limo grueso, limo fino y arcilla.Cada una de las clases de tamaos de partculas fueron sometidas a un anlisis termogravimtrico (105 , 450, 550 y 750) y luego se procedi a realizar la determinacin de carbono orgnico mediante el mtodo de titulacin de Walkley-Black.Los resultados obtenidos indican que existen diferencias en cuanto a la granulometra de cada una de las muestras por lo cual se observan dos tendencias claras: una con un tamao promedio de partculas correspondiente a arenas (6 muestras) y otro con tamao promedio de gravas (6 muestras). Al comparar las clases de tamaos contrastantes de partculas para cada una de las muestras, se observa un mayor contenido de carbono en las fracciones ms finas.En general para la zona de estudio, se tiene una concentracin mxima de carbono orgnico de 0,61%, de carbono inorgnico de 0,22% y de carbono total de 0,78%. Estos valores pertenecen a la muestra AM7, la cual fue recolectada en la parte superior de la morrena adyacente al glaciar Collins.','2011-05-23','Glaciar Collins, Antrtida, carbono, clases de tamaos contrastantes de partculas',6,1,1,1,1,'2013-09-17 08:40:03','2013-09-17 08:40:03','Documento_613.pdf','application/pdf',736185,'2013-09-17 08:40:03',20,0,56,'COMPLETO'),(607,'Automatizacin de un Sistema de Control de Temperatura para un Horno de Microondas','Se dise un sistema electrnico-computacional, para el control del calentamiento de muestras dentro de un horno de microondas domstico. El sistema consta de un circuito electrnico que cumple la funcin de un control de accin ON-OFF en lazo cerrado. Al aplicarle el programa diseado para su automatizacin, se le agreg un control de accin proporcional derivativo, mejorando as el control sobre la temperatura. Se cre una interfaz grfica que permite la interaccin entre el usuario y el sistema electrnico, facilitando el registro de la temperatura en el tiempo, as como el trabajo al operador del equipo. Este programa tambin es capaz de crear una curva terica de calentamiento y visualizar grficamente las temperaturas medidas durante el transcurso de un experimento. El sistema de control automatizado, fue sometido a diferentes pruebas en dos tipos de sistema fsico diferentes, en las cuales se muestra que efectivamente el sistema desarrollado cumple la funcin de controlar la temperatura. Observando, grficamente el comportamiento de la temperatura en el tiempo hallamos que, tanto la inercia trmica de las muestras como la del sistema fsico, son factores que deben tomarse en cuenta para poder disear una curva terica que pueda ser seguida por el control del sistema fsico, lo cual ayuda a obtener los resultados que se espera, en cada experimento.','2011-05-24','Horno de Microondas, Sistema de Control de Temperatura.',3,1,1,1,1,'2013-09-17 08:40:04','2013-09-17 08:40:04','Documento_614.pdf','application/pdf',493064,'2013-09-17 08:40:04',18,0,98,'COMPLETO'),(608,'Sobre perspectiva y homologa de imgenes','Estudio y aplicaciones de la perspectiva lineal y la homologa sobre imgenes digitales.','2010-12-09','Homolgia, perspectiva lineal, imgenes digitales',5,1,1,1,1,'2013-09-17 08:40:05','2013-09-17 08:40:05','Documento_615.pdf','application/pdf',421486,'2013-09-17 08:40:05',19,0,57,'COMPLETO'),(609,'Cuantizacion a la Dirac de una Teoria Topologica Abeliana','Partiendo de una teoria topologica Abeliana se estudia sus propiedades (ecuaciones de movimiento , invariancia de calibre , invariantes de nudos generados). Se introduce una accion de tipo B-F para eliminar la no-localidad existente en la accion inicial y se realiza la cuantizacion canonica siguiendo el metodo de Dirac para la cuantizacion de lagrangianos singulares.Se procede a cuantizar la teoria B-F. Se introducen ciertas corrientes geometricas asociadas a los campos y se calcula el Hamiltoniano on-shell de manera de obtener ciertos invariantes de curvas que son interpretados geometricamente.','2011-05-26','Cuantizacion de Dirac, lagrangianos Singulares, Invariantes de Nudo, teorias de Chern-Simons, Modelos tipo B-F.',3,1,1,1,1,'2013-09-17 08:40:07','2013-09-17 08:40:07','Documento_616.pdf','application/pdf',8075144,'2013-09-17 08:40:07',19,0,62,'COMPLETO'),(610,'Estudio in vitro de la actividad anti-inflamatoria y citotxica de fracciones derivadas de hojas de Jacaranda copaia.','El cncer es una enfermedad fundamentalmente caracterizada por el crecimiento incontrolado de las clulas debido a varios factores. Su fisiopatologa bsica comprende aberraciones en cualquier punto de la maquinaria molecular que gobierna el ciclo celular, causando mutaciones que les confieren a la clula ciertas caractersticas como ser autosuficientes en seales de crecimiento, ser insensibles a seales inhibitorias de crecimiento, evadir la apoptosis, replicarse ilimitadamente, generar angiognesis y ser capaz de invadir otros rganos generando metstasis. Hoy da se sabe que existe una relacin funcional entre la inflamacin crnica y el cncer, ya que ciertas clulas del sistema inmunitario tales como macrfagos, clulas NK, linfocitos T, granulocitos y mastocitos, son componentes prominentes del tejido maligno y contribuyen funcionalmente al desarrollo del cncer debido a la produccin de potentes mediadores solubles que regulan la proliferacin, migracin celular, angiognesis, etc. Se ha demostrado que drogas anti- inflamatorias pueden ejercer un efecto anti-tumoral, y estas drogas pueden ser derivadas de plantas naturales. Por esta razn, nos hemos planteado el objetivo de evaluar la actividad citotxica y anti-inflamatoria del extracto crudo, fracciones, subfracciones y compuestos derivados de hojas de Jacaranda copaia. Existen resultados que indican que un extracto de J.. copaia puede inhibir el crecimiento tumoral en un modelo de cncer en ratn. Se realizaron ensayos in vitro de citotoxicidad mediante la tcnica de Sulforodamina B y por MTS/PMS. Debido a la posibilidad de que la planta pueda ejercer un efecto anti-tumoral a travs de un efecto anti-inflamatorio, se midieron mediante ensayos in vitro el efecto de J.. copaia sobre dos mediadores pro-inflamatorios como los son el xido Ntrico (NO) y el Factor de Necrosis Tumoral alfa (TNF-a), y tambin sobre el Factor Nuclear kappa Beta (NF-kB). Los resultados obtenidos en este estudio reflejan que la fraccin E2 derivada de hojas de J.. copaia fue citotxica a altas concentraciones en las lneas celulares tumorales HT-29, 4T1, y en clulas macrofgicas RAW 264.7. No obstante, el extracto crudo, la fraccin E2 y los compuestos aislados de hojas de J.. copaia mostraron efecto citosttico sobre las clulas HT-29, 4T1, HeLa y RAW. En cuanto al estudio de la actividad anti-inflamatoria de J.. copia, se observ que el extracto crudo, la fraccin E2, la subfraccin E2II y el compuesto A aislado de hojas de J.. copaia mostraron un ligero efecto inhibitorio sobre la produccin de la citocina TNF-a en macrfagos RAW 264.7. Por otro lado, J.. copaia mostr un mayor efecto inhibitorio dosis dependiente a partir de 0,3 g/mL sobre la produccin de NO en presencia del extracto crudo, fraccin E2, subfraccin E2II y compuesto A. Sin embargo, slo se observ efecto inhibitorio de la activacin de NF-kB en presencia del extracto crudo y la fraccin E2 a partir de 30 g/mL. Estos resultados no son atribuibles a un efecto citotxico directo sobre las clulas macrofgicas. Adems de evaluar el efecto citotxico y anti- inflamatorio de J.. copaia se determin que los compuestos aislados en este estudio son derivados de cido cafeico, y se ha demostrado en diferentes investigaciones que el cido cafeico y sus derivados poseen actividad anti- inflamatoria entre otras. Los resultados sugieren que compuestos activos de la planta J.. copaia pudieran ejercer un efecto anti-tumoral, no directamente sobre las clulas tumorales, sino indirectamente a travs de un efecto inhibitorio sobre el componente inflamatorio que apoya el crecimiento tumoral.','2011-05-19','Jacaranda copaia, anti-inflamatorio, citotxico, TNF-a, NO, NF-kB',1,1,1,1,1,'2013-09-17 08:40:08','2013-09-17 08:40:08','Documento_617.pdf','application/pdf',971638,'2013-09-17 08:40:08',19,0,94,'COMPLETO'),(611,'Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom: 10.0pt; mso-para-margin-left:0cm; line-height:115%; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin;} Comparacin de mtodos para el aislamiento de Micobacterias No Tuberculosas (MNT) a partir de muestras de agua de Venezuela.','Normal 0 21 false false false ES-VE X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin;} Las micobacterias (del gnero Mycobacterium) son un grupo de organismos muy heterogneos en trminos de metabolismo, tiempo de crecimiento, nicho ambiental, epidemiologa, patogenicidad y distribucin geogrfica. Son bacterias cido resistentes que presentan una pared celular rica en lpidos y cidos miclicos que les otorgan gran hidrofobicidad, adherencia superficial, capacidad de formar biopelculas, adherencia superficial, as como resistencia a ciertos desinfectantes y antibiticos. Desde el punto de vista clnico las micobacterias se dividen en patgenos estrictos, patgenos oportunistas y saprfitas. Actualmente se han descrito ms de 140 especies de micobacterias de las cuales la mayora pertenecen al grupo de las denominadas Micobacterias No Tuberculosas (MNT) o micobacterias atpicas, trmino que fue propuesto para hacer referencia a aquellas micobacterias que no pertenecen al complejo M.. tuberculosis o M.. leprae. Las MNT han sido reportadas en los ltimos aos como patgenos emergentes y causantes de cuadros clnicos diferentes en sntomas y tratamiento a la tuberculosis (TB) que en conjunto se denominan \"micobacteriosis\" y que en la gran mayora se encuentran condicionadas al virus del SIDA y asociadas a pacientes inmunocomprometidos. Se ha aceptado que la fuente de transmisin es el ambiente (fundamentalmente el agua y el suelo) debido a que la transmisin persona persona es rara. El aislamiento de MNT requiere del uso de mtodos de descontaminacin y de medios selectivos que por lo general derivan de los empleados en el diagnstico de la TB. En este sentido comparamos un grupo de agentes qumicos descontaminantes (Cloruro de Hexadecil Piridinium  HPC al 0.05% y 0.75%, NaOH al 2% y 4%, cido oxlico al 5% y cido sulfrico 6%) para evaluar el porcentaje de recuperacin frente a aislados clnicos de especies representativas de MNT (M.. abscessus,, M.. fortuitum,, M.. mucogenicum,, M.. kansasii,, M.. marinum.. M..avium y M.. simiae) y as determinar el mejor mtodo de descontaminacin que luego se emple en el procesamiento de muestras de agua recolectadas en diversas regiones de Venezuela. Posteriormente los aislados fueron identificados con la tcnica molecular PRA-hsp6655. Los resultados obtenidos en nuestro estudio demuestran que existe una variable sensibilidad de las MNT utilizadas ante los agentes qumicos descontaminantes y que al parecer depende del tiempo de crecimiento (rpido o lento) de las especies. Sin embargo HPC al 0.05% demostr ser el que obtuvo un mayor porcentaje de recuperacin para todas las especies evaluadas; mientras que NaOH al 2% y 4% y cido sulfrico al 6% demostraron ser los agentes con menores porcentajes de recuperacin comprometiendo seriamente la viabilidad de las MNT ensayadas. En cuanto al procesamiento de las muestras de agua se obtuvo una mayor tasa de muestras positivas, menor tasa de contaminacin y mayor diversidad de especies de MNT cuando se empleo el mtodo de HPC al 0.05% que cuando se uso el mtodo de cido oxlico al 5% lo cual fue demostrado significativamente mediante un anlisis de Chi-Cuadrado (c2). Sin embargo con el mtodo de cido oxlico al 5% se obtuvo en promedio un mayor nmero de unidades formadoras de colonias (UFC) que con HPC al 0.05%. Con la tcnica de PRA-hsp6655se identificaron correctamente a nivel de especie todos los aislados obtenidos de las muestras de agua a excepcin de uno que probablemente se trate de una nueva especie. De igual forma encontramos una gran diversidad de especies de MNT en nuestro estudio siendo M.. fortuitum,, M.. peregrinum y M..abscessuslas ms abundantes. Nosotros concluimos que este trabajo aporta valiosa informacin de aspecto clnico que puede ser utilizada para determinar la fuente de infeccin de micobacteriosis cuyos casos han aumentado en la poblacin de nuestro pas.','2011-02-24','Micobacterias, Aislamiento, Descontaminacin, PRA-hsp65, Ambiente',1,1,1,1,1,'2013-09-17 08:40:10','2013-09-17 08:40:10','Documento_618.pdf','application/pdf',3884717,'2013-09-17 08:40:10',19,0,99,'COMPLETO'),(612,'Comparacin de mtodos para el aislamiento de Micobacterias No Tuberculosas (MNT) a partir de muestras de agua de Venezuela.','Normal 0 21 false false false ES-VE X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin;} Las micobacterias (del gnero Mycobacterium) son un grupo de organismos muy heterogneos en trminos de metabolismo, tiempo de crecimiento, nicho ambiental, epidemiologa, patogenicidad y distribucin geogrfica. Son bacterias cido resistentes que presentan una pared celular rica en lpidos y cidos miclicos que les otorgan gran hidrofobicidad, adherencia superficial, capacidad de forma