crecimiento (rpido o lento) de las especies. Sin embargo HPC al 0.05% demostr ser el que obtuvo un mayor porcentaje de recuperacin para todas las especies evaluadas; mientras que NaOH al 2% y 4% y cido sulfrico al 6% demostraron ser los agentes con menores porcentajes de recuperacin comprometiendo seriamente la viabilidad de las MNT ensayadas. En cuanto al procesamiento de las muestras de agua se obtuvo una mayor tasa de muestras positivas, menor tasa de contaminacin y mayor diversidad de especies de MNT cuando se empleo el mtodo de HPC al 0.05% que cuando se uso el mtodo de cido oxlico al 5% lo cual fue demostrado significativamente mediante un anlisis de Chi-Cuadrado (c2). Sin embargo con el mtodo de cido oxlico al 5% se obtuvo en promedio un mayor nmero de unidades formadoras de colonias (UFC) que con HPC al 0.05%. Con la tcnica de PRA-hsp6655se identificaron correctamente a nivel de especie todos los aislados obtenidos de las muestras de agua a excepcin de uno que probablemente se trate de una nueva especie. De igual forma encontramos una gran diversidad de especies de MNT en nuestro estudio siendo M.. fortuitum,, M.. peregrinum y M..abscessuslas ms abundantes. Nosotros concluimos que este trabajo aporta valiosa informacin de aspecto clnico que puede ser utilizada para determinar la fuente de infeccin de micobacteriosis cuyos casos han aumentado en la poblacin de nuestro pas.','2011-02-24','Micobacterias, Aislamiento, Descontaminacin, PRA-hsp65, Ambiente.',1,1,1,1,1,'2013-09-17 08:40:13','2013-09-17 08:40:13','Documento_619.pdf','application/pdf',2112257,'2013-09-17 08:40:13',19,0,97,'COMPLETO'),(613,'Sistema de Control de Estudios y Administrativos ((SCEA)) para una unidad de Educacinn Bsica y//o Media funcionando desde Windows Azure','Cloud Computing es un paradigma de cmputo que trata de ocultar la infraestructura de hardware y software detrs de un ambiente de servicio, usando la plataforma de Internet. Windows Azure es una plataforma de servicios basada en Cloud Computing, entr en produccin el 1 de enero de 2010. El Sistema de Control de Estudios y Administrativos (SCEA) desarrollado para la administracin de los diferentes procesos involucrados en una institucin de educacin bsica y/o media. Permitir el manejo de los siguientes procesos: Gestionar Ao Escolar, Personal, Materias, Inscripciones, Secciones, Notas, Personalizacin, Grados y Menciones y Reportes. Adems de la autenticacin de diferentes tipos de usuario. El Sistema fue desarrollado en Microsoft Visual Studio 2010 en lenguaje ASP .NET 4.0, con una Base de Datos desarrollada en Microsoft SQL SERVER 2008, un Web Role desarrollado en Microsoft Visual Studio que permite la traduccin del proyecto para poder ser migrado a la plataforma Windows Azure.','2011-05-30',' Cloud Computing  Windows Azure  SCEA  SQL Azure  Microsoft Visual Studio 2010  ASP .NET  Web Role  SQL Server 2008  IIS 7.0  Educacin Bsica  Educacin Media  Instituci',2,1,1,1,1,'2013-09-17 08:40:14','2013-09-17 08:40:14','Documento_620.pdf','application/pdf',3543972,'2013-09-17 08:40:14',20,0,0,'INCOMPLETO'),(614,'Diseo y Desarrollo de una Fuente de Corriente de Alta Tensin para fines Geoeltricos','En este trabajo se desarrollo una fuente de corriente continua de alto voltaje para fines geoelctricos. sta es capaz de suministrar una corriente mxima de 1,1A y un voltaje de salida variable, que depende de la corriente, pudiendo llegar hasta 1100V. Para el diseo del prototipo, se realiz un estudio detallado de la fuente desarrollada por el profesor Alfonso Benavides, la cual presentaba algunas deficiencias referentes a seguridad y a la medicin de la corriente de salida. Con la finalidad de mejorar estas deficiencias se desarroll un sistema de encendido/apagado y cambio de polaridad controlado de manera remota desde un computador y un sistema de descarga de los condensadores de la etapa de filtrado evitando as posibles descargas elctricas al usuario, de manera que su manipulacin es realizada en un ambiente seguridad. En relacin a la medicin, se desorroll un sistema de adquisicin de datos digitales y se sustituyo el sensor inductivo utilizado para medir la corriente de salida de la fuente, por un sensor de basado en el Efecto Hall, cuyo comportamiento es lineal y que facilita el proceso de calibracin del sistema. Se incorpor adems un sistema limitador de corriente, que funciona como proteccin de la fuente y evita el ajuste manual del voltaje de salida.','2011-05-26','Fuente, metodos geoelctricos, instrumentacin',3,1,1,1,1,'2013-09-17 08:40:18','2013-09-17 08:40:18','Documento_621.pdf','application/pdf',2280480,'2013-09-17 08:40:18',18,0,128,'COMPLETO'),(615,'Leishmaniasis Cutnea Experimental: Efecto del Antibitico Catinico Esteroideo CSA-13 sobre la evolucin de las lesiones.','La Leishmaniasis es una enfermedad parasitaria de alta incidencia en los pases tropicales. En los ltimos aos se ha evidenciado una disminucin en la eficacia de las drogas empleadas para su tratamiento, debido al desarrollo de resistencia por parte del parsito a estas drogas y a la elevada toxicidad que estas inducen en el paciente. Por lo tanto, es necesario trabajar en la bsqueda de nuevos agentes teraputicos con actividad leishmanicida, contra los cuales el parsito no desarrolle resistencia, que sean de bajo costo y que no produzcan efectos secundarios severos en el paciente. En este sentido, se plante evaluar en un modelo mrido experimental susceptible a la leishmaniasis cutnea, el efecto del CSA-13 sobre la evolucin de las lesiones. Para ello se procedi a infectar ratones hembras BALB/c de 6 semanas de edad con 103 amastigotes de Leishmania (L.) mexicana (MHOM/BZ/BEL21) aislados de lesiones cutneas de hmster. A la semana 3 post-infeccin se aplic el CSA-13 (4, 8, 16, 32, 54, 72, 5x103 y 10x103ng/gr peso/da) subcutneamente, intralesional. Se emple como tratamiento control Miltefosina (2x104 ng/gr peso/da) durante 21 das consecutivos. La respuesta al tratamiento se evalu midiendo semanalmente el tamao de la lesin cutnea mediante morfometra digital y estimacin de la carga parasitaria a travs de la tcnica de diluciones limitantes, adicionalmente se evalu la Influencia de los tratamientos sobre el peso de los ratones BALB/c infectados con L..(L..) mexicana y se realizaron anlisis de qumica sangunea. Se observ disminucin en el tamao de las lesiones cutneas en el grupo de ratones infectados y tratados con 4, 8, 16 y 32 ng/gr peso/da; mientras que en los grupos infectados y tratados con 54, 72, 5x103 y 10x103ng/gr peso/da, se observ incremento en el tamao de las lesiones. El CSA-13 increment el tamao de la almohadilla plantar en los ratones no infectados. Los efectos observados del CSA-13 a 54 y 5x103ng/gr peso/da, sobre el tamao de la lesin y la carga parasitaria, en los ratones infectados con L..(L.)mexicana son debido al DMSO. El DMSO no increment el tamao de la almohadilla plantar de los ratones no infectados con L.. (L..)mexicana..El CSA-13 no tiene influencia sobre el peso de los ratones BALB/ c y altera los niveles sanguneos de transaminasas, amilasa y glicemia de los ratones BALB/c, lo que compromete la funcin heptica y pancretica de estos animales experimentales.','2011-05-26','Leishmaniasis Cutnea, CSA-13',1,1,1,1,1,'2013-09-17 08:40:21','2013-09-17 08:40:21','Documento_622.pdf','application/pdf',1093166,'2013-09-17 08:40:21',20,0,128,'COMPLETO'),(616,'ALTERACIONES ULTRAESTRUCTURALES DE PULMN EN RATONES INFECTADOS EXPERIMENTALMENTE CON DOS AISLADOS VENEZOLANOS DE T.. evansi','Trypanosoma evansi,,es un protozoario hemoflagelado, causante de la tripanosomosis equina. El parsito es transmitido mecnicamente por dpteros hematfagos de un mamfero a otro a travs de su picadura. Una vez en el vertebrado, el tripanosoma se reproduce por fisin binaria, entrando al torrente sanguneo. Ha sido descrito en Asia, frica y Suramrica. En Venezuela, incide principalmente en los llanos, teniendo cierto impacto en las actividades agropecuarias. Se sabe, que la patogenicidad del parsito vara de un rea geogrfica a otra. En este sentido, se han realizado investigaciones con aislados venezolanos, reportando alteraciones ultraestructurales en rin e hgado a travs de infecciones experimentales de modelos murinos, con el fin de ahondar en la patologa de la enfermedad. Sin embargo, no se encuentran registros de investigaciones realizadas en pulmn, siendo este un rgano tan vinculado al sistema vascular, cabe preguntarse acerca de los cambios submicroscpicos de este tejido debido al T.. evansi. Por esta razn, se plantea como objetivo, describir las alteraciones ultraestructurales del pulmn en ratones infectados experimentalmente con dos aislados venezolanos de T.. evansi. Para ello, lotes de ratones hembras de 20 gramos de peso corporal fueron infectados con 1 tripomastigote/gramo de peso corporal correspondientes a dos aislados diferentes de T.. evansi, los animales fueron sacrificados interdiariamente para extraer muestras del pulmn, por ablacin quirrgica, las muestras se procesaron por Microscopia Electrnica de Transmisin. Los cortes finos (60-90nm) se obtuvieron en un ultramicrotomo Porter-Blum MT2-B. Las secciones obtenidas se contrastaron con acetato de uranilo y citrato de plomo. Finalmente las rejillas se examinaron en un Microscopio marca JEOL JEM-1011, efectuando registro permanente en negativos de 8,3 x 10,2cm para su posterior revelado y anlisis. Los resultados obtenidos evidencian, para ambos aislados daos capilares como el engrosamiento de la membrana basal, prolongaciones endoteliales hacia la luz y disminucin de caveolas. Asimismo se observa un aumento en el infiltrado celular, vinculado a un proceso inflamatorio causado por la presencia del parsito, que conlleva a la ruptura de los espacios alveolares. Los estudios morfomtricos confirman cambios significativos en el grosor de la membrana basal en el transcurso de la infeccin experimental para ambos aislados (p=0,002) y un aumento en los espacios alveolares (p=0,000). Estos hallazgos sugieren efectos de T.. evansi en el lecho capilar pulmonar y colapso alveolar debido a desarrollo inflamatorio, causando lesiones en el pulmn.','2011-05-24','Ultraestructura, Pulmn, Trypanosoma',1,1,1,1,1,'2013-09-17 08:40:21','2013-09-17 08:40:21','Documento_623.pdf','application/pdf',4773302,'2013-09-17 08:40:21',17,0,152,'COMPLETO'),(617,'Efectos de la contaminacin por petrleo pesado en el suelo sobre la germinacin de semillas y sobrevivencia de plntulas en Mauritia flexuosa','Los individuos adultos de Mauritia flexuosa, conforman el elemento ms representativo de las comunidades de morichal. La distribucin de gran parte de los morichales, en la Faja del Orinoco, regin con importantes reservas de petrleo, y su ubicacin en el relieve mas bajo del paisaje de valle, en intima asociacin con los ejes fluviales, los hace potencialmente susceptibles a ser afectados por derrames de crudo. Razn por la cual el presente estudio tiene como objetivo determinar el efecto de diferentes concentraciones de petrleo pesado en el suelo, sobre la germinacin de semillas y sobrevivencia de plntulas en Mauritia flexuosa, con la finalidad de establecer el intervalo de contaminacin del suelo, que permita una propagacin efectiva del moriche en actividades de repoblacin vegetal, como estrategia de restauracin ecolgica, en morichales degradados por derrames de petrleo, considerando adems diversos tratamientos y condiciones para favorecer la germinacin y establecimiento del moriche, que permitan aumentar las probabilidades de xito en los procesos de reforestacin. Para llevar a cabo este estudio, se realizaron ensayos de toxicidad aguda, establecidos en microcosmos, que permitieron simular \"a escala\" e \"in situ\" la descarga de petrleo sobre suelos de morichal en condiciones naturales. Adems fueron evaluados diversos tratamientos destinados a mejorar la germinacin, considerando los requerimientos e inconvenientes asociados al establecimiento y desarrollo de Mauritia flexuosa. Los resultados demuestran que Mauritia flexuosa, mantuvo su capacidad germinativa en suelos contaminados con petrleo pesado en dosis de 0% a 8% y la concentracin que gener el 50% de inhibicin sobre la germinacin (CE50) fue de 5,01%. Las dosis empleadas no repercutieron significativamente sobre el tiempo de germinacin. La dosis letal (CE50) en plntulas fue de 39,81% de petrleo pesado. La contaminacin no afect la longitud y biomasa radical, sin embargo, la longitud del vstago fue afectada a partir de 16% de crudo en el suelo. Respecto a los tratamientos en semillas, la escarificacin en la zona del oprculo, favoreci significativamente la germinacin. La escarificacin por abrasin en toda la testa mejor significativamente el tiempo de germinacin pero promovi el ataque por fitopatgenos, generando una mayor mortalidad de brotes, con relacin al resto de los tratamientos. La escarificacin qumica con H2SO4 concentrado provoc la perforacin de semillas y destruccin del embrin, con un incremento progresivo de incidencia en relacin al tiempo de exposicin. Las condiciones de siembra demuestran la importancia de la temperatura en la germinacin de las semillas de moriche, donde altas temperaturas con amplias fluctuaciones peridicas, favorecieron la germinacin. A temperatura constante de 35C ocurri el ms alto porcentaje de abortos entre tratamientos y condiciones. Por su parte en semillas sembradas directamente en el suelo, las limitaciones hdricas propiciaron un aumento de la mortalidad de vstagos.Los resultados obtenidos permitieron establecer un conjunto de recomendaciones para la repoblacin de Mauritia flexuosa en morichales afectados por derrame de crudo.','2011-05-23','Mauritia flexuosa;;Moriche; Morichales; Restauracon ecolgica; Fitotoxicidad; Hidrocarburos; Petrleo pesado.',1,1,1,1,1,'2013-09-17 08:40:23','2013-09-17 08:40:23','Documento_624.pdf','application/pdf',843272,'2013-09-17 08:40:23',20,0,72,'COMPLETO'),(618,'Evaluacinn del dimorfismo sexual en crneos de bquiros de Venezuela ((Tayassu pecari y Pecari tajacu))','El dimorfismo sexual, diferencias en tamao y forma entre individuos de diferentes sexos, es comn en prcticamente todo el reino animal. Actualmente, entendemos que el dimorfismo sexual es el resultado de la seleccin sexual, la divergencia y la competencia por nichos entre sexos (Slatkin, 1984; Shine, 1989; Moore, 1990; Isaac, 2005). Poco se conoce sobre la sistemtica, la ecologa, y la biologa reproductiva en la naturaleza de las especies de la familia Tayassuidae, bquiros o pecares, como se les conoce popularmente. Diferentes autores han argumentado sobre la existencia de dimorfismo sexual en las especies de esta familia y los resultados de los pocos trabajos disponibles parecen ser contradictorios a este respecto. En este estudio, se analiz la forma de los crneos (vistas dorsal, lateral y ventral) en muestras de las especies Tayassu pecari y Pecari tajacu utilizando tcnicas de morfometra geomtrica en 2D. Se analizaron un total de 41 craneos de T.. pecari(21 machos y 21 hembras) y 46 crneos de P.. tajacu (23 hembras y 23 machos). Nuestros resultados demuestran que, si bien existe una variabilidad en la forma de los arcos zigomticos, crestas sagitales, cndilos occipitales, posicin de los colmillos y del diastema post-canino, no se encontraron diferencias significativas de tamao (talla del centroide) y de forma en ninguna de las vistas entre grupos pertenecientes a diferentes sexos, dentro de cada especie. Se especula que la ausencia de dimorfismo sexual en estas dos especies podra ser el resultado de un sistema de apareamiento promiscuo. Resultados publicados previamente sugieren que las especies de Tayassuidae han ido perdiendo el dimorfismo sexual gradualmente a lo largo de su evolucin. Esta afirmacin constituye la hiptesis alternativa de este estudio y por lo tanto, deber ser sometida a prueba en futuros estudios. Para ellos, se recomienda considerar un tamao muestral mayor al utilizado por nosotros, incluir la variabilidad ontogentica, e identificar y analizar por separados grupos de diferentes regiones geogrficas.','2011-05-30','Dimorfismo sexual, Tayassuidae',1,1,1,1,1,'2013-09-17 08:40:25','2013-09-17 08:40:25','Documento_625.pdf','application/pdf',18268740,'2013-09-17 08:40:25',19,0,214,'COMPLETO'),(619,'Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} ESTRUCTURA POBLACIONAL DE LAS ESPECIES PLANCTNNICAS DE OSTRCCODOS Y CLADCCEROS ((CRUSTACEA)) EN LA COSTA NOROESTE DE PARAGUAN ((FALCNN,, VENEZUELA))','Normal 0 false false false EN-US X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Los ostrcodos y cladceros planctnicos, son pequeos crustceos que juegan un papel importante en las cadenas alimentarias de los ecosistemas pelgicos. Los primeros destacan por su dieta basada en el detrito, recurso que suele ser abundante en la columna de agua. Los cladceros, por su parte, son consumidores primarios y se encuentran distribuidos en el estrato superficial de los ocanos. A su vez, ambos grupos forman parte de la dieta de numerosos organismos marinos con elevado valor ecolgico y comercial. Sin embargo, en aguas venezolanas, es llamativa la escasez de estudios realizados sobre la taxonoma de los ostrcodos y datos de la estructura poblacional en ambos grupos. Con el propsito de ampliar el conocimiento de la taxonoma y ecologa de ostrcodos y cladceros, se estudi la composicin, abundancia, biomasa y estructura poblacional de las especies planctnicos presentes en la costa nertica al noroeste de Paraguan, estado Falcn. El anlisis de 38 estaciones por triplicado (n=114), dio por resultado un total de 13 especies de ostrcodos y 3 de cladceros. La abundancia de los ostrcodos fue alta (media de 1088,1  723,2 Ind./m3) y vari entre 263,2 y 3544,2 Ind./m3. Por su parte, los cladceros presentaron baja abundancia (media de 56,0  91,1 Ind./m3) que vari entre 1,3 y 465,6 Ind./m3. El ostrcodo Euconchoecia chierchiae y el cladcero Penilia avirostris fueron las especies ms frecuentes, siendo halladas en todas las estaciones y dominando la abundancia en sus respectivos grupos con 96,94% y 94,82%. Por otro lado, la biomasa media estimada para los ostrcodos y cladceros fue de 43,71  40,54 mg/m3 y 4,76  7,72 mg/m3, lo que represent respectivamente el 11,49 y el 1,03% de la biomasa total del zooplancton. nicamente la abundancia de los cladceros, juveniles de Euconchoecia aspicula y la biomasa de ambos grupos, mostraron diferencias significativas entre las estaciones cercanas y lejanas de la costa. En 10 especies de ostrcodos se determin la presencia de adultos, determinado valores de edad media poblacional altos en la mayora de estas (S >= 6), mientras que la proporcin de sexos se encontr desviada hacia las hembras y slo para dos especies el porcentaje de hembras grvidas fue mayor de 50%. En los cladceros todos los ejemplares hallados fueron hembras correspondientes a clases de tallas adultas y slo en una especie el nmero de hembras no reproductivas superaron a las grvidas. Estas poblaciones estuvieron compuestas casi exclusivamente por hembras partenogenticas. Adicionalmente, se destaca el primer registro para aguas venezolanas del huevo de resistencia en Penilia avirostris. Estos resultados confirman la elevada importancia de los ostrcodos en el ambiente e indican que las poblaciones de las especies de cladceros se encontraban deprimidas durante el perodo de estudio.','2011-05-27','Ostrcodos, Euconchoecia chierchiae, Cladceros, Penilia avirostris, Estructura poblacional, Biomasa, Pennsula de Paraguan',1,1,1,1,1,'2013-09-17 08:40:27','2013-09-17 08:40:27','Documento_626.pdf','application/pdf',3459261,'2013-09-17 08:40:27',20,0,104,'COMPLETO'),(620,'Estimacin de los niveles de Albmina en la orina y correlacin con los niveles de mercurio.','El rin es uno de los rganos susceptibles a la intoxicacin con el mercurio. La principal manifestacin de una nefropata mercurial crnica es la presencia de albuminura. Para la determinacin de los niveles de albmina se emple como tcnica analtica la Cromatografa Liquida de Alta Eficiencia. Se probaron dos mtodos de separacin de la albmina para su posterior cuantificacin. El primer mtodo de separacin, fue un cartucho de extraccin en fase slida de Azul de Sefarosa. El segundo procedimiento de separacin consista en la precipitacin de las protenas empleando el cido tricloroactico. Con ambos procedimientos no se obtuvieron resultados satisfactorios, por lo tanto, se procedi a determinar los niveles de protenas totales empleando el procedimiento descrito por Pesce y col, el cual utiliza la Espectroscopa de Absorcin Molecular UV-Visible, como tcnica de anlisis. Con sta tcnica se obtuvo un lmite de deteccin de 19mg/L, una precisin de 1,7% y un porcentaje de recuperacin de 92-99%. Se analizaron un total de 95 muestras de orina de nios que estudian en diferentes centros educativos en El Callao, Estado Bolvar, de los cuales, solo el 5 % presentaron protenas en la orina, en un rango de concentracin de 6 - 66 mg/da, inferior al lmite de referencia (>150mg/da), para diagnosticar proteinuria, sin embargo, la presencia de protena en la orina, es un indicador de la aparicin de dao a nivel renal.','2011-05-24','Protenas, Albmina, Orina, Mercurio, Rin, Espectroscopia.',6,1,1,1,1,'2013-09-17 08:40:28','2013-09-17 08:40:28','Documento_627.pdf','application/pdf',7735745,'2013-09-17 08:40:28',20,0,94,'COMPLETO'),(621,'Estimacin de los niveles Albmina en la orina y su correlacin con los niveles de mercurio.','El rin es uno de los rganos susceptibles a la intoxicacin con el mercurio. La principal manifestacin de una nefropata mercurial crnica es la presencia de albuminura. Para la determinacin de los niveles de albmina se emple como tcnica analtica la Cromatografa Liquida de Alta Eficiencia. Se probaron dos mtodos de separacin de la albmina para su posterior cuantificacin. El primer mtodo de separacin, fue un cartucho de extraccin en fase slida de Azul de Sefarosa. El segundo procedimiento de separacin consista en la precipitacin de las protenas empleando el cido tricloroactico. Con ambos procedimientos no se obtuvieron resultados satisfactorios, por lo tanto, se procedi a determinar los niveles de protenas totales empleando el procedimiento descrito por Pesce y col, el cual utiliza la Espectroscopa de Absorcin Molecular UV-Visible, como tcnica de anlisis. Con sta tcnica se obtuvo un lmite de deteccin de 19mg/L, una precisin de 1,7% y un porcentaje de recuperacin de 92-99%. Se analizaron un total de 95 muestras de orina de nios que estudian en diferentes centros educativos en el Callao, Estado Bolvar, de los cuales, solo el 5% presentaron protenas en la orina, en un rango de concentracin de 6-66mg/da, inferior al lmite de referencia (>150mg/da), para diagnosticar protenuria, sin embargo, la presencia de protena en la orina, es un indicador de la aparicin de dao a nivel renal.','2011-05-24','Protenas, albmina, orina, rin, mercurio, espectroscopia.',6,1,1,1,1,'2013-09-17 08:40:29','2013-09-17 08:40:29','Documento_628.pdf','application/pdf',6154980,'2013-09-17 08:40:29',20,0,203,'COMPLETO'),(622,'Determinacin de factores de riesgo para la transmisin de dengue en zonas altas mediante anlisis geoespaciales. Estado Mrida, Venezuela, 2001-2009','El dengue es la enfermedad viral transmitida por artrpodos ms comn a nivel mundial; cada ao, presenta una morbilidad de 50 millones de personas, 500.000 deben ser hospitalizadas, el 60% de ellos son nios y la tasa de mortalidad anual es del 2,5 %. En una estadstica realizada por la OMS en el 2001, en 100 pases fallecen ms de 24.000 personas por esta enfermedad que es endmica en amplios territorios. El objetivo general de este trabajo es determinar los factores de riesgo para la transmisin del dengue en el Edo. Mrida, Venezuela, mediante anlisis espacial retrospectivo de la transmisin de dengue, anlisis de series de tiempo entre las variables climticas y la epidemiolgica, anlisis de regresin lineal mltiple entre las variables socioeconmica y la variables epidemiolgica y finalmente utilizando anlisis de correlacin lineal simple entre la variable epidemiolgica y la entomolgica. Los anlisis temporales muestran que existe una transmisin endmica establecida con un nmero de casos de 19 por semana, mientras que se muestran tres picos epidmicos de importancia en 2005, todo 2007 y 2009. Los anlisis de regresin mltiple muestran la asociacin entre el dengue y la densidad poblacional evidenciando focos constantes (mayor prevalencia) en el tiempo en las principales zonas urbanas (El Viga, Ejido y Ciudad de Mrida). Se concluye que la variacin de la precipitacin (aumento en 200mm), temperatura media (aumento en 7 C) e intervalo diario de temperatura (disminucin en 8 C) representan los factores a considerar como valores predictivos en posibles prximas epidemias.','2011-05-27','Dengue, Prevalencia, Incidencia, Modelado retrospectivo, Edo. Mrida',1,1,1,1,1,'2013-09-17 08:40:31','2013-09-17 08:40:31','Documento_629.pdf','application/pdf',6154980,'2013-09-17 08:40:31',20,0,203,'COMPLETO'),(623,'Avalanchas de actividad en redes neuronales de Morris-Lecar','En este trabajo de tesis se busca estudiar la aparicion de un comportamiento caracterizado por leyes de potencia en redes de neuronas que obedecen las ecuaciones de Morris-Lecar y su relacion con la topologia de la red. Se introducen varias maneras de cuantificar la actividad de la red, emulando el proceso de medicion experimental. Identificamos que para un tipo especifico de topologia, el mundo pequeno economico, el sistema se ubica en un estado critico en el cual las distribuciones de tamano de avalancha y de tiempo de vida de avalancha obedecen leyes de potencias. En esta situacion se observa una mayor aproximacion de la tasa de ramificacion s al valor critico. Estos resultados sugieren que la topologia es un factor determinante para la aparicion de condiciones de operatividad critica en la red neuronal.','2011-05-27','Mundo pequeno, comportamiento critico, leyes de potencias, redes neuronales',3,1,1,1,1,'2013-09-17 08:40:33','2013-09-17 08:40:33','Documento_630.pdf','application/pdf',4610499,'2013-09-17 08:40:33',20,0,103,'COMPLETO'),(624,'Estudio de los niveles de isoleucina en orina como un biomarcador de cncer de prsstata','El cncer de prstata se considera un problema de salud a nivel mundial y representa la segunda causa de muerte por cncer en hombres. Actualmente, en un esfuerzo por reducir estas cifras, se han realizado trabajos de investigacin enfocados en el estudio de los niveles de aminocidos como potenciales biomarcadores para el diagnstico precoz del carcinoma prosttico. En este sentido, se plante como objetivo, determinar los niveles del aminocido Isoleucina (ILE) en orina de pacientes con cncer de prstata y sujetos sanos. Las muestras de orina fueron donadas por pacientes voluntarios del servicio de Urologa del Hospital Universitario de Caracas (HUC) de la Universidad Central de Venezuela (UCV), antes de realizarse la biopsia prosttica. El grupo de sujetos sanos o grupo control, corresponde a individuos con un valor srico de Antgeno Prosttico Especifico (PSA) menor a 4,0 ng/ml, y con un diagnstico de prstata sana de acuerdo con el examen de tacto rectal. Se analizaron treinta y cinco (35) muestras de orina: once (11) pacientes con cncer (Grupo 1), diecisiete (17) pacientes sin cncer y que pueden presentar alguna patologa en la prstata (hiperplasia prosttica o prostatitis), por lo cual se deben realizar una nueva biopsia en un perodo de seis meses (Grupo 2) y siete (7) individuos sanos o grupo control (Grupo 3). Para la determinacin de ILE en la orina, se emple como tcnica de anlisis la Cromatografa de lquidos de Alta Eficiencia (HPLC), con deteccin UV y derivacin precolumna con o- ftaldialdehido (OPA) -cido-2-mercaptoetanonico. El mtodo result sensible para un lmite de deteccin y cuantificacin de 17 y 57 mol/L, respectivamente. El porcentaje de recuperacin obtenido fue de 97  1%, y se considera aceptable para el rango establecido en muestras de fluidos biolgicos (80-120) %. La curva de calibracin empleada para la determinacin del aminocido ILE fue lineal para un rango de 101,8 - 600,8 M, obtenindose que ILE es excretado en orina por el 57,1 % de los pacientes sometidos a la biopsia prosttica, en un rango de 17 - 1541 mol/L. Mientras que en el grupo de pacientes sin afecciones en la prstata, no se detect ILE en la orina.','2011-05-24','Isoleucina, prstata, cncer, orina, HPLC',6,1,1,1,1,'2013-09-17 08:40:34','2013-09-17 08:40:34','Documento_631.pdf','application/pdf',33991939,'2013-09-17 08:40:34',19,0,214,'COMPLETO'),(625,'Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Distribucinn espacial de Carbono y Nitrggeno en los sedimentos superficiales del Lago de Valencia,, Venezuela','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} En el siguiente trabajo fueron establecidas las distribuciones espaciales del carbono orgnico, inorgnico, carbono total y nitrgeno en 41 puntos de muestreo de sedimentos superficiales del Lago de Valencia, recolectadas durante la campaa de mayo de 2008. Por otro lado fue establecida la diferenciacin de estas variables en funcin de su granulometra, utilizando la escala Udden Wentworth para la separacin granulomtrica. La concentracin de nitrgeno fue determinada a travs del mtodo Kjeldahl modificado de Jackson (1976), mientras que el carbono orgnico fue determinado mediante el mtodo de titulacin por retroceso propuesto por walkley-Black (1934), as mismo el carbono inorgnico fue calculado a travs de su relacin con la prdida a 750C y el carbono total fue calculado por la adicin de estos dos ltimos. Se estableci que la perdida a 450C est relacionada con la concentracin de carbono orgnico en un porcentaje aproximado de 50%, este carbono orgnico a su vez est relacionado con la concentracin de nitrgeno en un porcentaje aproximado de 10%. Seguidamente se estim el contenido de materia orgnica (450C) y carbonatos (750C) en los distintos sedimentos estudiados por medio de termogravimetra, obtenindose que la materia orgnica, carbono orgnico y nitrgeno estn distribuidos hacia el centro del lago asocindose a las fracciones de grano fino; mientras que el carbono inorgnico se encuentra hacia la periferia del mismo, asociado a las fracciones de grano grueso.','2011-05-25','carbono,nitrogeno,sedimentos superficiales, lago de valencia, distribucion espacial.',4,1,1,1,1,'2013-09-17 08:40:39','2013-09-17 08:40:39','Documento_632.pdf','application/pdf',113864,'2013-09-17 08:40:39',20,0,2,'COMPLETO'),(626,'Avalanchas de actividad en redes neuronales de Morris-Lecar','En este trabajo de tesis se busca estudiar la aparicion de un comportamiento caracterizado por leyes de potencia en redes de neuronas que obedecen las ecuaciones de Morris-Lecar y su relacion con la topologia de la red. Se introducen varias maneras de cuantificar la actividad de la red, emulando el proceso de medicion experimental. Identificamos que para un tipo especifico de topologia, el mundo pequeno economico, el sistema se ubica en un estado critico en el cual las distribuciones de tamano de avalancha y de tiempo de vida de avalancha obedecen leyes de potencias. En esta situacion se observa una mayor aproximacion de la tasa de ramificacion s al valor critico. Estos resultados sugieren que la topologia es un factor determinante para la aparicion de condiciones de operatividad critica en la red neuronal.','2011-05-27','comportamiento critico, redes de neuronas, mundo pequeno',3,1,1,1,1,'2013-09-17 08:40:39','2013-09-17 08:40:39','Documento_633.pdf','application/pdf',1787306,'2013-09-17 08:40:39',20,0,68,'COMPLETO'),(627,'Normal 0 21 false false false /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband- size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination: widow-orphan; font-size:10.0pt; font-family:\"Times New Roman\"; mso-ansi- language:#0400; mso-fareast-language:#0400; mso-bidi-language:#0400;} Estudio de los lixiviados del lodo rojo usando yeso para su neutralizacinn y la evaluacinn de su toxicidad mediante la germinacinn de la semillaLycopersicon esculentum ((Tomate))','Normal 0 21 false false false /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband- size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination: widow-orphan; font-size:10.0pt; font-family:\"Times New Roman\"; mso-ansi- language:#0400; mso-fareast-language:#0400; mso-bidi-language:#0400;} El proceso de obtencin de almina genera un desecho conocido como lodo rojo, este residuo es almacenado en grandes extensiones de terreno generando un problema ambiental. Para obtener una mejora de estos remanentes y disminuir el impacto que generan en el ecosistema, se evalu la enmienda del lodo rojo con yeso determinando el grado de modificacin de las condiciones de pH, conductividad, la concentraciones de cationes, y como influencian el crecimiento de la semilla Lycopersicon esculentum (tomate). Para este trabajo se utiliz un 10 % de lodo rojo y yeso en proporciones variables y 90% de arena, simulando un proceso de pluviosidad para obtener los lixiviados de las distintas mezclas; seguidamente se analizaron las variaciones de las propiedades qumicas de los lixiviados para determinar los factores inhibidores de la germinacin de las semillas y el desarrollo de las plntulas. El lodo rojo sin modificaciones se caracteriza por tener alto pH, sodicidad y salinidad. Estas caractersticas afectaron negativamente la germinacin y elongacin de las semillas. En los casos que se modific el lodo rojo con yeso se observ un cambio en las propiedades qumicas, caracterizado principalmente por la disminucin del pH, y sodicidad, y aumento en los niveles de calcio, lo cual favoreci el crecimiento y germinacin de las semillas de tomate. En los casos donde solo se utiliz yeso se obtuvo un alto contenido de calcio, sin presencia de sodio teniendo una germinacin regular; pero se determin que el exceso de sulfato es txico para el crecimiento de las semillas. Las mezclas de 75% lodo rojo con 25%yeso y 50%lodo rojo y 50% yeso resultaron ser las ms adecuadas para el crecimiento de las semillas de tomate.','2011-05-25','lodo rojo; yeso;lixiviacion; Indice de Germinacin; Lycopersicon esculentum',4,1,1,1,1,'2013-09-17 08:40:41','2013-09-17 08:40:41','Documento_634.pdf','application/pdf',2075414,'2013-09-17 08:40:41',19,0,109,'COMPLETO'),(628,'Diseo e implementacin de un datawarehouse para la consolidacin y consulta de eventos sismolgicos y desastres naturales','La Fundacin Venezolana de Investigaciones Sismolgicas (FUNVISIS), maneja varios departamentos donde los datos son cargados de diversas formas mediante el uso de aplicaciones: desde archivos de texto, Microsoft Excel e incluso sistemas, lo cual conlleva a que la fundacin no posea los datos integrados en un solo repositorio.El presente Trabajo Especial de Grado se realiz con la finalidad de desarrollar un repositorio de datos para FUNVISIS, adems de realizar un middleware que permita comunicar las aplicaciones ya existentes con dicho repositorio para unificar de esta manera la informacin; para luego proponer una aplicacin web orientada hacia un administrador de base de datos, en la cual los usuarios puedan visualizar las consultas que se deseen hacer sobre la base de datos. El desarrollo del sistema fue guiado por el mtodo gil \"Programacin Extrema\" (XP), el cual se enfoca en reforzar la simplicidad, comunicacin, retroalimentacin y refactorizacin de cdigo. Entre las tecnologas usadas se destaca el lenguaje de programacin Ruby 1.9.2, su framework de desarrollo web Rails 3.0.6 y el sistema manejador de base de datos columnares Monet DB.El resultado es el desarrollo del repositorio de datos para FUNVISIS, donde se encuentra unificada la informacin generada por la aplicacin SEISAN (Seismic Analysis System), as como tambin de los datos correspondientes con la aplicacin estudios y desastres. De igual forma se obtuvo un mdulo de carga de datos, el cual permite llevar los archivos en formato SEISAN y los datos de la aplicacin de estudios y desastres al repositorio de datos, representando dicho modulo el proceso de extraccin, transformacin y carga de los datos (ETL). Finalmente el ltimo producto obtenido es una aplicacin web, mediante la cual los usuarios de FUNVISIS pueden realizar consultas sobre el repositorio desarrollado.La creacin de este repositorio y dems aplicaciones aporta un agregado significativo al manejo de la informacin, tanto tcnica como social dentro de FUNVISIS al unificar los datos y permitir la consulta sobre la misma.El presente trabajo est enmarcado dentro del proyecto de investigacin \"programa integral de capacitacin y adiestramiento de talento humano de Funvisis y actualizacin tecnologa\".','2011-05-27','datawarehouse, FUNVISIS, SEISAN, Eventos sismolgicos, Estudios y Desastre.',2,1,1,1,1,'2013-09-17 08:40:43','2013-09-17 08:40:43','Documento_635.pdf','application/pdf',1476577,'2013-09-17 08:40:43',20,0,86,'COMPLETO'),(629,'Sistema de recoleccin de datos estadsticos en el Servicio de Pediatra Integral \"Nio Sano\" del Hospital de Nios \"J. M. de los Ros\" de Caracas','En el Servicio de Pediatra Integral \"Nio Sano\" del Hospital de Nios \"J. M. de los Ros\" la situacin actual de los procesos de control de vacunas y generacin de estadsticas, sumado a la complejidad de la informacin que estos manejan, afectan en forma directa la realizacin efectiva de los diversos trmites internos y externos relacionados con este servicio de salud. Este Trabajo Especial de Grado tiene como objetivo desarrollar una aplicacin que permita sistematizar los procesos anteriormente mencionados, disminuyendo las indeterminaciones y tiempos de respuesta en los reportes que deben ser entregados a los entes a los que se encuentra adscrito el Servicio. Por esa razn debe estar enfocada en adaptarse a las necesidades y dar soporte a las rotaciones continuas del personal. El proceso de desarrollo utilizado para la gestin de esta aplicacin se bas en una adaptacin de la proceso de desarrollo Scrum, facilitando la realizacin de la parte prctica del presente trabajo de investigacin de manera rpida, sencilla, eficiente y documentada. Dentro de los requerimientos contemplados en la aplicacin se tienen los siguientes: gestin de los procesos de registro, asistencia y vacunacin de pacientes, creacin y mantenimiento del inventario de vacunas, generacin de reportes destinados a los entes a los que se encuentra adscrito al Servicio. La investigacin contempl el estudio del proceso manual que se lleva a cabo en el Servicio para el registro y atencin de pacientes, la administracin de vacunas, el estudio de esquemas de inmunizacin y trminos asociados a las rea de pediatra y puericultura, todo ello con el objetivo de familiarizarnos con los esquemas de trabajo y requerimientos del Servicio de Pediatra. A partir del estudio de estos procesos manuales, se dise el modelo de datos y los lineamientos generales a considerar en el anlisis y diseo del sistema propuesto como solucin en este Trabajo Especial de Grado.','2011-05-27','Servicio de Nio Sano, Hospital J. M. de los Ros, estadsticas de morbilidad, estadsticas de salud, sistema de control de vacunas, informtica mdica.',2,1,1,1,1,'2013-09-17 08:40:45','2013-09-17 08:40:45','Documento_636.pdf','application/pdf',3380597,'2013-09-17 08:40:45',19,0,84,'COMPLETO'),(630,'Comparacin de difrentes agentes descontaminantes para la recuperacin de micobacterias previamente aisladas de muestras clnicas','En el diagnstico de las infecciones producidas por micobacterias, el cultivo de las muestras es necesario, ya que permite identificar la especie que est causando el cuadro clnico; por esta razn el agente descontaminante empleado es fundamental en la eliminacin de la flora bacteriana asociada a las micobacterias. Tradicionalmente, la susceptibilidad de las micobacterias a desinfectantes y antispticos ha sido objeto de estudio con base en su estructura celular, composicin y fisiologa, caracterizndose principalmente por su resistencia a compuestos de amonio cuaternario. Hoy en da se conoce que algunos agentes descontaminantes tienen efectos txicos sobre las micobacterias por lo que puede verse alterada su recuperacin. Es por ello que en el presente trabajo se evaluaron diferentes descontaminantes con el fin de estimar cual agente proporciona el mayor porcentaje de recuperacin (HPC al 0.75%, NaOH al 2% y 4%, cido oxlico al 5% y cido sulfrico 6%), comparando un grupo de aislados clnicos de especies representativas del gnero Mycobacterium (M.. fortuitum,, M.. chelonae,, M.. tuberculosis H3377Ra..,, M..abscessus)).. Para tal fin fueron comparadas la metodologa de siembra en placas de agar, citometra de flujo y fluorimetra, estas dos ltimas tcnicas se fundamentaron en la hidrlisis del FDA a fluorescena. Los resultados obtenidos por la metodologa de siembra en placas de agar demuestran que existe una variable sensibilidad de las micobacterias estudiadas ante los agentes qumicos descontaminantes, siendo el HPC al 0.75% el agente qumico que mostr un mayor porcentaje de recuperacin para todas las especies evaluadas; mientras que el NaOH 2% y 4%, y el cido sulfrico al 6% demostraron ser los agentes con menores porcentajes de recuperacin, comprometiendo seriamente la viabilidad de las micobacterias ensayadas. Por otra parte, la metodologa de fluorimetra sumado a la tincin con FDA se presenta como una alternativa rpida para la estimacin de la viabilidad celular en micobacterias, ya que permite reducir el tiempo de diagnstico a tan solo 4 horas, no siendo estadsticamente significativo la diferencia entre los valores obtenidos por siembra en placas de agar y anlisis de fluorimetra, lo que constituye un gran avance sobre la investigacin de estos microorganismos. En contraste, la citometra de flujo revelo grandes discrepancias con la metodologa de siembra en placas de agar, por tanto el uso de esta tcnica no se presenta como una herramienta til para la estimacin de viabilidad celular.','2011-05-26','agentes descontaminantes, micobacterias',1,1,1,1,1,'2013-09-17 08:40:46','2013-09-17 08:40:46','Documento_637.pdf','application/pdf',5211032,'2013-09-17 08:40:46',19,0,88,'COMPLETO'),(631,'Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} HIDRODESMETALIZACINN,, ASISTIDA ELECTROQUMMICAMENTE VAA PERMEACINN DE HIDRGGENO,, DE MOLCCULAS MODELO Y EXTRACTOS PORFIRNICOS CONTENIDOS EN CRUDOS','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband- size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii- theme-font:minor-latin; mso-fareast-font-family:\"Times New Roman\"; mso-fareast- theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font: minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor- bidi;} Se estudi la reactividad del hidrgeno atmico (H), electroqumicamente adsorbido sobre superficies de negro de Pd, en la conversin de metaloporfirnas modelo (VOTPP y NiTPP) y extractos porfirnicos provenientes de un crudo venezolano; bajo condiciones de reaccin ptimas establecidas: densidad de corriente catdica de -1,92 mA.cm-2, presin atmosfrica y 25 C. Estas reacciones se realizaron usando dos (2) medios de reaccin: (i) un medio de reaccin simple o no emulsificado; donde el sustrato a convertir (molculas modelo de vanadilo y nquel, y extracto porfirnico proveniente de un crudo venezolano) se disuelve en cloroformo (CHCl3) como solvente y (ii) un medio de reaccin emulsificado (O/W; emulsin aceite en agua, tipo normal), donde se evaluaron cuatro (4) condiciones diferentes para la fase dispersante (W), favoreciendo as la transferencia de fase del metal liberado durante la reaccin con el H. Los medios emulsificados (O/W) evaluados son: sustrato+CHCl3/agua desionizada, sustrato+CHCl3/HCl 1x10-5 M, sustrato+CHCl3/HCl 1x10-5 M+EDTA 4x10-4 M y sustrato+CHCl3/EDTA 4x10-4 M. Una vez que ste fue formulado y caracterizado se estudia el efecto del medio emulsificado en las reacciones de desmetalizacin. Los porcentajes de conversin para las metaloporfirnas modelo y el extracto porfirnico fueron mucho mayores al reaccionar empleando un medio emulsificado (mximos de 38% y 24% respectivamente) que un medio de reaccin simple (8,7% y 0% respectivamente). El emplear un medio emulsificado permite fomentar y cuantificar la reaccin de desmetalizacin del complejo porfirnico en el tiempo. Al cuantificar la cantidad de metal libre en la fase dispersante (W), al final de la reaccin, se demostr que la ruptura o clivaje de las metaloporfirnas fue efectivo. Para las molculas modelos evaluadas y el extracto del crudo se reportan porcentajes de desmetalizacin de 73% y 6% respectivamente, para un tiempo mximo de reaccin de seis (6) horas.','2011-02-15','Hidrotratamiento, hidrodesmetalizacin, hidrgeno atmico, reacciones asistidas electroqumicamente',6,1,1,1,1,'2013-09-17 08:40:47','2013-09-17 08:40:47','Documento_638.pdf','application/pdf',1960868,'2013-09-17 08:40:47',20,0,85,'COMPLETO'),(632,'Anlisis de los Procesos Electorales de Venezuela entrelos aos 1830 a 1860 y Mtodos MatemticosElectorales.','El objetivo principal de esta tesis de grado es el estudio y aplicacin de mtodos de reparto quepermita convertir los votos en una decisin final que sea ms justa y coherente con los deseos delelectorado y as minimizar la injusticia electoral.Se da una breve resea histrica de la evolucin del Sistema Electoral Venezolano en la poca de1830 - 1860, y una descripcion general del Sistema Electoral y el Sistema Electoral venezolano usandoconceptos elementales, proporcionando deniciones claras.Para conocer los escaos que corresponden a cada uno de los distintos partidos o movimientospolticos existen varios mtodos de reparto que se han ido modificando a medida que se han conocidosus ventajas y sus inconvenientes en la prctica poltica.Se hace una descripcin matemtica de los mtodos de reparto ms utilizados: El mtodo deHamilton, la regla de D\'Hontd, el mtodo de Hare/Niemeyer los cuales se ilustran con varios ejem-plos que ayudan a comprender su funcionamiento y a se~nalar, al mismo tiempo, los diversos proble-mas que les son inherentes y los resultados paradjicos que pueden producir. Posteriormente, en labsqueda de un criterio para decidir cul de estos mtodos es ms adecuado, se propone la definicindel concepto de injusticia introducida por Huntington. Se describen las principales caractersticasdel sistema electoral venezolano en los aos de 1830 y 1860 y se analizan los resultados obtenidos porestos mtodos para esa fecha.Se estudia el problema de la construccin de la funcin de decisin social, se enuncian teoremasy definiciones necesarias para esta construccin.','2011-05-19','Mtodos electorales',5,1,1,1,1,'2013-09-17 08:40:49','2013-09-17 08:40:49','Documento_639.pdf','application/pdf',2802365,'2013-09-17 08:40:49',20,0,101,'COMPLETO'),(633,'Desarrollo de un Sistema de Informacin Geogrfica (SIG) para la Direccin de Catastro de la Alcalda del Municipio Bolivariano Libertador','En el presente Trabajo Especial de Grado se determin que en la Direccin de Catastro de la Alcalda del Municipio Bolivariano Libertador intervienen un determinado nmero de procesos; que implican una complejidad en el flujo constante de informacin, afectando el tiempo de respuesta de los trmites all demandados. Y como solucin, se propuso y desarroll un Sistema de Informacin Geogrfica (SIG) que facilita y optimiza el registro, control y administracin de la informacin catastral (datos del solicitante, ocupante o/y propietario, documentos consignados, registro pblico, direccin, cdigo catastral, linderos, inspeccin y avalo del inmueble) asociada a los diferentes tipos de solicitudes que puede realizar un ciudadano (Cdula Catastral, Certificado de Empadronamiento, Desglose de la Propiedad Horizontal, Titularidad de Terreno, Certificacin de Linderos, Valor Metro Cuadrado). Para lograrlo se aplic una metodologa de desarrollo de software probada RUP (RationalUnifiedProcess) y se utilizaronherramientas de software libre (Servidor Web Apache, Base de Datos MySQL, Lenguaje de Programacin PHP y Navegador Web Mozilla Firefox). Esto genera importantes beneficios: facilita el mantenimiento de la informacin catastral, la distribucin de actividades y la comunicacin entre las diversas coordinaciones de la alcalda (Atencin al Contribuyente, Informacin Catastral Urbana, Inspeccin y Clculo, Inmuebles Municipales, Procesamiento de Datos), incrementa la productividad del personal, reduce el tiempo de respuesta y mejora la atencin al ciudadano. En el documento se plantean las bases tericas necesarias para emprender el proyecto: Catastro Municipal, Sistema de Informacin Geogrfica (SIG), Metodologas de Desarrollo de Software, entre otros. Estableciendo la posibilidad de extender el mismo; incorporando mdulos que permitan realizar citas por internet, facilitar el registro de los datos bsicos de una solicitud por parte del ciudadano, optimizar el registro, control y administracin de los asentamientos urbanos populares.','2011-05-27','Alcalda del Municipio Bolivariano Libertador, Direccin de Catastro, Catastro Municipal, Sistema de Informacin Geogrfica, Metodologas de Desarrollo de Software, Modelo Vista Controlador.',2,1,1,1,1,'2013-09-17 08:40:51','2013-09-17 08:40:51','Documento_640.pdf','application/pdf',3485960,'2013-09-17 08:40:51',19,0,72,'COMPLETO'),(634,'Sistema de Informacin para la Gestin de Problemas en una Gerencia de Programas de Soluciones de Tecnologas de Informacin','El proyecto est centrado en la construccin de un Sistema de Informacin para la Gestin de Problemas de la Librera de Infraestructura de Tecnologa de Informacin v3 (ITIL, Information Technology Infrastructure Library,,en ingls), enfocado en la prevencin y control de problemas, manipularlos a errores conocidos o ms manejables, obteniendo soluciones a las incidencias recurrentes mediante un monitoreo preventivo. La Compaa Annima de Telfonos de Venezuela (CANTV) actualmente no posee un mtodo adecuado para la Gestin de sus Problemas, siendo estos administrados por un mdulo Gestin de Incidentes, sin realizar una investigacin de la causa raz que los origin, dejando la posibilidad de que los incidentes se repitan, afectando de forma negativa a la empresa. El objetivo principal de este Trabajo Especial de Grado es desarrollar un sistema automatizado que permita el seguimiento, control y resolucin a los Problemas haciendo uso de herramientas de Software Abiertos. Para lograrlo se utiliz un Sistema de Informacin para la Gestin de Procesos de Negocio (BPMS, Business Process Management System,,en ingls) de Software Abierto denominado Intalio Community, que trabaja bajo la Metodologa de Procesos de Negocio (BPM, Business Process Management,,en ingls), esta permiti modelar, analizar, monitorear y mejorar el proceso de Gestin de Problemas. La interfaz del proyecto se adapt a un sitio Web, orientado a los procesos de solicitudes de informacin detallada sobre los avances de las incidencias, problemas o errores, enfocados a la investigacin y evaluaciones correspondientes del rea.','2011-05-30','Sistemas de Informacin, Librera de Infraestructura de Tecnologa de Informacin, Proceso de Negocio, Gestin de Problemas.',2,1,1,1,1,'2013-09-17 08:40:53','2013-09-17 08:40:53','Documento_641.pdf','application/pdf',2352012,'2013-09-17 08:40:53',18,0,137,'COMPLETO'),(635,'ADRIANA GORRI 12.00 Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso- style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size: 0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso- style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom:10.0pt; mso-para-margin-left: 0cm;