 Metro Cuadrado). Para lograrlo se aplic una metodologa de desarrollo de software probada RUP (Rational Unified Process) y se utilizaron herramientas de software libre (Servidor Web Apache, Base de Datos MySQL, Lenguaje de Programacin PHP y Navegador Web Mozilla Firefox). Esto genera importantes beneficios: facilita el mantenimiento de la informacin catastral, la distribucin de actividades y la comunicacin entre las diversas coordinaciones de la alcalda (Atencin al Contribuyente, Informacin Catastral Urbana, Inspeccin y Clculo, Inmuebles Municipales, Procesamiento de Datos), incrementa la productividad del personal, reduce el tiempo de respuesta y mejora la atencin al ciudadano. En el documento se plantean las bases tericas necesarias para emprender el proyecto: Catastro Municipal, Sistema de Informacin Geogrfica (SIG), Metodologas de Desarrollo de Software, entre otros. Estableciendo la posibilidad de extender el mismo; incorporando mdulos que permitan realizar citas por internet, facilitar el registro de los datos bsicos de una solicitud por parte del ciudadano, optimizar el registro, control y administracin de los asentamientos urbanos populares.','2011-05-27','ADRIANA GORRI 12.00 Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso- style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size: 0; mso-style-noshow:yes; mso-st',2,1,1,1,1,'2013-09-17 08:40:54','2013-09-17 08:40:54','Documento_642.pdf','application/pdf',2352012,'2013-09-17 08:40:54',19,0,137,'COMPLETO'),(636,'PROTOTIPO DE APLICACIN PARA LA AUTOMATIZACION DE UNA FUERZA DE VENTAS','El prototipo de aplicacin para la automatizacin de una fuerza de ventas, se realizo un anlisis,diseo y se desarrollo para facilitar el proceso de toma de pedidos, inventario del cliente, lagestin de cobranzas y la devolucin de productos, de tal forma que permita evaluar yretroalimentar la informacin para la eficaz y oportuna toma de decisiones mejorando el procesode ventas que se ve afectado en el tiempo por la ejecucin manual y en papel de la recoleccin dedatos, obteniendo una mayor velocidad de respuesta a los clientes.Se realizo una descripcin de las herramientas utilizadas para el desarrollo de los diferentesmdulos.Se implemento un mdulo web; que permita la administracin de las operaciones financieras,productos, clientes, vendedores, ventas y usuarios del sistema. Un mdulo mvil; el cual serutilizado por los vendedores para realizar las visitas a los clientes donde se toma los pedidos de losproductos, devoluciones, inventarios o cobranzas, enviando la informacin a la compaa enmenor tiempo. Y un mdulo para la comunicacin entre las aplicaciones web y mvil, a travs delos servicios web.','2011-05-30','Desarrollo Web, Sistemas Mviles, Fuerza de Ventas.',2,1,1,1,1,'2013-09-17 08:40:54','2013-09-17 08:40:54','Documento_643.pdf','application/pdf',2489848,'2013-09-17 08:40:54',20,0,120,'COMPLETO'),(637,'Prototipo de Aplicacinn para la Automatizacinn de una Fuerza de Ventas','El prototipo de aplicacin para la automatizacin de una fuerza de ventas, se realizo un anlisis,diseo y se desarrollo para facilitar el proceso de toma de pedidos, inventario del cliente, lagestin de cobranzas y la devolucin de productos, de tal forma que permita evaluar yretroalimentar la informacin para la eficaz y oportuna toma de decisiones mejorando el procesode ventas que se ve afectado en el tiempo por la ejecucin manual y en papel de la recoleccin dedatos, obteniendo una mayor velocidad de respuesta a los clientes.Se realizo una descripcin de las herramientas utilizadas para el desarrollo de los diferentesmdulos.Se implemento un mdulo web; que permita la administracin de las operaciones financieras,productos, clientes, vendedores, ventas y usuarios del sistema. Un mdulo mvil; el cual serutilizado por los vendedores para realizar las visitas a los clientes donde se toma los pedidos de losproductos, devoluciones, inventarios o cobranzas, enviando la informacin a la compaa enmenor tiempo. Y un mdulo para la comunicacin entre las aplicaciones web y mvil, a travs delos servicios web.','2011-05-30','Sistemas de Informacin, Desarrollo Web, Sistemas Mviles, Fuerza de Ventas.',2,1,1,1,1,'2013-09-17 08:41:01','2013-09-17 08:41:01','Documento_644.pdf','application/pdf',3421341,'2013-09-17 08:41:01',20,0,122,'COMPLETO'),(638,'Simulacin microscpica de trfico vehicular basada en agentes inteligentes','La demanda de transporte, movida principalmente por las necesidadesy deseos de movilizacin de las personas, y la oferta requerida parapoder suplir esa demanda es un tema importante de estudio en ingenieracivil y planificacin urbanstica. El presente Trabajo Especial de Grado proponela utilizacin de un conjunto de herramientas para la construccinde estudios de trfico sobre desarrollos urbansticos actuales y afuturo apoyados en el toolkit MATSim, un simulador microscpicode trfico basado en agentes inteligentes. Para probar la eficacia de estetoolkit se realizaron un conjunto de pruebas con datos reales de la zona de Caracas de Los Cortijos de Lourdes y Los Ruices. Los resultadosobtenidos develan que esta herramienta provee resultados utilizables y adaptables a las necesidades del analista de trfico, generando resultadosrealistas con respecto a la dinmica vehicular de una zona particular.','2011-05-30','Simulacin, trfico vehicular, simulacin de trfico, agentes inteligentes, anlisis de demanda de transporte',2,1,1,1,1,'2013-09-17 08:41:04','2013-09-17 08:41:04','Documento_645.pdf','application/pdf',281167,'2013-09-17 08:41:04',20,0,36,'COMPLETO'),(639,'Desarrollo de una aplicacinn Web orientada a la administracinn de documentos y declaracinn de siniestros en el rea de Seguros..','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Universidad Central de Venezuela Facultad de Ciencias Escuela de Computacinn Titulo::Desarrollo de una Aplicacin Orientada a la Administracin de Documentos y Declaracin de Siniestros en el rea de Seguros. Autor:: Br. Milady Rosmar Snchez Plaza. Unidad de Investigacinn::Aplicaciones con Tecnologa Internet Optimizacin de Procesos en el rea de Seguros. Tutora::Profa. Yusneyi Yasmira Carballo Barrera. Fecha de Presentacinn::24 y 26 de mayo de 2011 Resumen El presente Trabajo Especial de Grado tiene como objetivo general, desarrollar una aplicacin Web para gestionar la declaracin de siniestro y la administracin efectiva de documentos asociados, tomando en cuenta los parmetros y requerimientos inherentes al sector de seguros, de la empresa de Seguros Carabobo. Dicha aplicacin permite automatizar parte del proceso de declaracin de siniestros que se lleva a cabo en dicho departamento. Para el caso de estudio se desarroll un sistema en el que intervienen los clientes del seguro y parte del personal que en l labora. La idea del sistema es permitir que un cliente pueda informar va Web un incidente con su vehculo, dicha informacin es gestionada por parte del personal del seguro quien se encarga de generar una respuesta asociada a la informacin dada por el cliente a travs del sistema. Para el desarrollo del sistema fueron utilizadas algunas tecnologas de desarrollo Web como: JavaScript, Ajax, jQuery, Apache, PHP, MySql y el Framework CakePHP. El sistema fue implementado siguiendo el patrn de diseo MVC (Modelo- Vista- Controlador) y guiado con la metodologa de trabajo XP (programacin extrema). El desarrollo de este sistema permite ofrecer a sus clientes mejoras en el servicio de declaracin de siniestro y la gestin de documentos, generando beneficios internos como la automatizacin de los procesos y mejoras en la calidad de servicio a los clientes.','2011-05-27','Palabras Claves:: Declaracin de Siniestros, Gestin de Documentos y Aplicacin Web en el rea de Seguros.',2,1,1,1,1,'2013-09-17 08:41:05','2013-09-17 08:41:05','Documento_646.pdf','application/pdf',2392652,'2013-09-17 08:41:05',19,0,181,'COMPLETO'),(640,'Algunos Mtodos Numricos para la Descomposicin en Valores Singulares de Matrices Reales','En este trabajo se presentan diversos mtodos numricos para la obtencin de la Descomposicin en Valores Singulares (SVD) de Matrices Reales. Todos son basados en el problema simtrico de autovalores. Para cada uno de ellos se describe detalladamente su estructura y correspondiente algoritmo en lenguaje pseudoformal. Adems, se muestran teoremas que avalan la convergencia de algunos de estos mtodos. Posteriormente, se exhiben ciertos resultados numricos para el anlisis de la eficiencia en tiempo de ejecucin y alta precisin. Finalmente, se muestra una aplicacin de este tipo de descomposicin para la compresin digital de imgenes.','2011-05-24','Descomposicin en Valores Singulares (SVD). Valores singulares. Autovalores. Matriz Tridiagonal Simtrica. Bidiagonalizacin.',5,1,1,1,1,'2013-09-17 08:41:08','2013-09-17 08:41:08','Documento_647.pdf','application/pdf',18268740,'2013-09-17 08:41:08',20,0,214,'COMPLETO'),(641,'ESTUDIO HIDROGEOQUMICO DE LA CUENCA DEL RO CAUCAGUA, ESTADO MIRANDA','El presente trabajo fue realizado en la cuenca del ro Caucagua, estado Miranda, con el propsito de realizar un estudio hidrogeoqumico que permite tener una visin acerca de los procesos que controlan la composicin qumica de los cuerpos de aguas superficiales. Para ello fue llevada a cabo la determinacin de las concentraciones de las especies mayoritarias Na, K, Ca, Mg, HCO, Cl, SO y Si y P; as como tambin la medicin de los parmetros fisicoqumicos pH, conductividad elctrica y temperatura. Igualmente fue llevada a cabo la estimacin de la tasa de meteorizacin y el grado de contaminacin en dicha cuenca. El plan de muestreo comprendi 16 puntos en total, 6 correspondientes al canal principal del ro Caucagua y 10 a lo largo de los afluentes ms importantes. Las determinaciones realizadas involucraron la alcalinidad mediante titulacin cido-base. Posteriormente, las muestras fueron filtradas en el laboratorio a travs de un sistema Millipore, empleando un papel de filtro de 0,45mm para luego determinar las especies Si y P por fotocolorimetra empleando un equipo Spectronic 20. Por su parte, la concentracin de los cationes fueron conocidas mediante la tcnica de ICP-AES y la concentracin de sulfato y cloruro por cromatografa inica. Los resultados obtenidos indican que las concentraciones ms elevadas de las especies mayoritarias analizadas estn ubicadas en los afluentes no contaminados del noreste de la cuenca, tal es el caso de Araira, Cupo y Chuspita por drenar en mayor proporcin la Formacin Las Mercedes; mientras que las menores concentraciones son ubicadas al noroeste de la misma, especficamente en Izcaragua, Curupao, Ingenio y Churca por drenar la Formacin Las Brisas. Por otra parte, fue posible asociar que las variaciones de las tasas de disolucin encontradas en este estudio hacia el noroeste de la cuenca son debidas principalmente a la distribucin de precipitacin-escorrenta; mientras que en los afluentes del noreste son producto de la combinacin precipitacin-escorrenta y litologa. Por ltimo fueron establecidas las proporciones asociadas a la tasa de disolucin global de la cuenca para cada mineral, as como el aporte antrpico (ambas en Ton/Km-ao).','2011-05-24','Hidrogeoqumica, contaminacin de ros, tasa de meteorizacin',4,1,1,1,1,'2013-09-17 08:41:09','2013-09-17 08:41:09','Documento_648.pdf','application/pdf',3496687,'2013-09-17 08:41:09',19,0,119,'COMPLETO'),(642,'v:* {behavior:url(#default#VML);} o:* {behavior:url(#default#VML);} w:* {behavior:url(#default#VML);} .shape {behavior:url(#default#VML);} Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; text-align:center; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} CICLACINN DE ACRILATOS PROMOVIDA POR EL SISTEMA POCl33//D COMO UNA POSIBLE RUTA SINTTTICA PARA LA OBTENCINN DE QUINOLINAS SUSTITUIDAS','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; text-align:center; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} En este trabajo se presenta la sntesis de una serie de quinolinas sustituidas en las posiciones: 6, 7 y 8 con grupos dadores y atractores de electrones.La Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style- name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso- style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style- parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para- margin-bottom:.0001pt; text-align:center; mso-pagination:widow-orphan; font- size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi- theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme- font:minor-bidi;} ruta sinttica consisti en obtener primero los acrilatos correpondientes, haciendo reaccionar el etoximetilenmalonato de dietilo y un grupo de anilinas sustituidas. Su posterior ciclacin con el sistema POCl3/ D gener las 4-cloroquinolinas respectivas, intermediarios claves en la obtencin de 4-aminoquinolinas. Se obtuvieron compuestos quinolnicos con los sustituyentes (Z): 8-CH3;8-COOH; 7-CH3;6-CH3; 6-COCH3; 6-F; 6-Cl; los cuales se purificaron mediante cromatografa de columna y cuyas estructuras se verificaron por IR, RMN1H y EM.Los resultados obtenidos complementan un estudio ms amplio donde se sintetizan quinolinas sustituidas en la posicin 6, 7 y 8 con grupos dadores y atractores de electrones, para realizar pruebas de citotoxicidad y de actividad contra parsitos as como tambin clculos de modelaje molecular.','2011-05-26','Sntesis Orgnica; Quinolinas; 4-Cloroquinolinas',6,1,1,1,1,'2013-09-17 08:41:12','2013-09-17 08:41:12','Documento_649.pdf','application/pdf',2565594,'2013-09-17 08:41:12',20,0,87,'COMPLETO'),(643,'Simulacin microscpica de trfico vehicular basada en agentes inteligentes','La demanda de transporte, movida principalmente por las necesidadesy deseos de movilizacin de las personas, y la oferta requerida parapoder suplir esa demanda es un tema importante de estudio en ingenieracivil y planificacin urbanstica. El presente Trabajo Especial de Grado proponela utilizacin de un conjunto de herramientas para la construccinde estudios de trfico sobre desarrollos urbansticos actuales y afuturo apoyados en el toolkit MATSim, un simulador microscpicode trfico basado en agentes inteligentes. Para probar la eficacia de estetoolkit se realizaron un conjunto de pruebas con datos reales de la zona de Caracas de Los Cortijos de Lourdes y Los Ruices. Los resultadosobtenidos develan que esta herramienta provee resultados utilizables y adaptables a las necesidades del analista de trfico, generando resultadosrealistas con respecto a la dinmica vehicular de una zona particular.','2011-05-30','Simulacin, trfico vehicular, simulacin de trfico, agentes inteligentes, demanda de transporte',2,1,1,1,1,'2013-09-17 08:41:13','2013-09-17 08:41:13','Documento_650.pdf','application/pdf',1433719,'2013-09-17 08:41:13',20,0,133,'COMPLETO'),(644,'ESTUDIO DE FORMACINN DE COMPLEJOS TERNARIOS DE NQQUEL ((II)) CON ACIDO DIPICOLINICO Y LOS AMINOCCIDOS:: CCIDO ASPARTICO,, CCIDO GLTTAMICO,, HISTIDINA Y CISTENNA MEDIANTE MEDIDAS DE fem((H)) EN NaCl 11,,00 M A 2255 C','En el presente trabajo fueron estudiados los siguientes sistemas: H+ - acido dipicolnico H+ - cido asprtico H+ - cido glutmico H+ - cistena H+ - histidina H+ - Ni(II) - cido dipicolnico - acido asprtico H+ - Ni(II) - cido dipicolnico - acido glutmico H+ - Ni(II) - cido dipicolnico - cistena H+ - Ni(II) - cido dipicolnico - histidina por medio de medidas de fuerza electromotriz fem(H) a 25C y en NaCl 1,0 M como medio inico inerte. El anlisis de los datos experimentales de cada sistema se realiz mediante el programa de mnimos cuadrados LETAGROP y LETAGROP/FONDO. Las siguientes tablas muestran los resultados obtenidos. Tabla a..Valores de log bp