e-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast- font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} p H+ + q VO2+ + r C5- ------ --->[Hp(VO2)qCr]p+q-5r Normal 0 21 false false false ES-VE X-NONE X-NONE / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Y en base a ese esquema se calcularon las constante de estabilidad para los complejos propuestos, los valores de las constantes de estabilidad se expresan trminos de log bpqr como se muestra en la siguiente tabla: Especies (p,q,r) log bpqr [HVO2C]-3 (1,1,1) 20.39(8) [H2VO2C]-2 (2,1,1) 25.49(5) [H3VO2C]- (3,1,1) 28.72(5) [H4VO2C] (4,1,1) 30.78(5) [H(VO2)2C]-2 (1,2,1) 27.33(5) [H2(VO2)2C]- (2,2,1) 30.67(4) [H3(VO2)2C] (3,2,1) 32.56(8) sqC 0.048','2011-05-27','Formacion de complejos, qumica de vanadio, acido dietilentriaminopentacetico, DTPA, constante de estabilidad, medio inico',6,1,1,1,1,'2013-09-17 08:41:16','2013-09-17 08:41:16','Documento_652.pdf','application/pdf',5349720,'2013-09-17 08:41:16',20,0,97,'COMPLETO'),(646,'Desarrollo del Proceso de Gestin Empresarial \"Time Report\" mediante la implementacin de metodologa BPM y la utilizacin de Oracle BPM Studio','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} El siguiente Trabajo Especial de Grado consiste en la creacin de un Proceso de Gestin Empresarial automatizado, que facilite la vigilancia de todos los departamentos de la organizacin SSoftware Associates International, controlando las actividades y las horas laboradas por parte del talento humano de la misma. Dicho proceso funcionar sobre la herramienta Oracle BPM Studio, para aprovechar las ventajas de las nuevas metodologas empresariales que dotan a este proceso de interactividad entre los recursos involucrados, y nutre del control del comportamiento y el desempeo del talento humano de la organizacin; siendo capaz de cumplir con las tareas que actualmente se genera en la organizacin de forma manual generando desgaste en el talento humano. Este proceso tiene por definicin el nombre de \"Time Report\", ste tiene como objetivo principal mejorar la productividad de la organizacin, desarrollando una excelente gestin a travs de la automatizacin de la actividad manual. El \"Time Report\", tiene como finalidad controlar el tiempo invertido por parte del talento humano de la organizacin, en los proyectos asignados por sta. Para desarrollar el Proceso de Gestin Empresarial \"Time Report\", utilizamos la Metodologa de Gestin de los Procesos del Negocio sustentada en el uso de Patrones.','2011-05-30','Proceso, Gestin, Gestin Empresarial, Time Report, BPM.',2,1,1,1,1,'2013-09-17 08:41:21','2013-09-17 08:41:21','Documento_653.pdf','application/pdf',1296575,'2013-09-17 08:41:21',18,0,102,'COMPLETO'),(647,'Estudio del fenomeno de sorcion de fenol por la turba de la Laguna Paso Real localizada en el Estado Mrida.','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} Como aporte para la eliminacin o depuracin de agentes contaminantes en medios acuticos, el presente estudio tiene como objetivo principal evaluar la capacidad de adsorcin y desorcin de fenol por la turba de la Laguna Paso Real, estado Mrida, con variacin de temperatura y pH, mediante isotermas de adsorcion. Los ensayos de adsorcin se realizaron a pH 4,6 y 8 con temperatura de 25C constante; y a temperaturas 15,25 y 60C con pH=6 constante, para esto se prepararon soluciones de diferentes concentraciones conocidas de fenol y se colocaron en agitacin con la turba. Una vez culminadas las adsorciones se realizaron ensayos de desorcin al slido remanente, llevndose a cabo el mismo proceso que en los ensayos de adsorcin. La mayora de los datos obtenidos experimentalmente, se ajustaron al modelo propuesto por Langmuir, sugiriendo la adsorcin en monocapa. Para pH=4 y T=15C los resultados se ajustaron mejor al modelo de Freundlich, indicando un posible cambio en el mecanismo de adsorcin, sugiriendo adsorcin en multicapa. Se observ mayor capacidad de adsorcin con el incremento de pH, de igual forma con el incremento de temperatura. La fisicoqumica del proceso indica interacciones de tipo fsica; la energa de activacin del orden de 22 KJ/mol confirma enlaces de hidrogeno y que la reaccin es endotrmica De acuerdo a los resultados obtenidos, se confirma la gran capacidad de adsorcin que tiene la turba, lo que implica que juega un papel importante como bioflitro en los sistemas naturales para la remocin de especies orgnicas que se consideran contaminantes.','2011-05-27','Adsorcin, fisisorcin, quimisorcin, fenol, contaminacion, turba.',6,1,1,1,1,'2013-09-17 08:41:23','2013-09-17 08:41:23','Documento_654.pdf','application/pdf',2525056,'2013-09-17 08:41:23',19,0,100,'COMPLETO'),(648,'\"\"ESTUDIO DE LA INFLUENCIA DEL ACIDO CITRICO EN LA REACCION DE ENTRECRUZAMIENTO DE POLIACRILAMIDA,, PARCIALMENTE HIDROLIZADA,, CON FENOL--FORMALDEHDDO\"\"','Los geles de poliacrilamida son de gran importancia en diversos sectores de la industria, como es el caso de la industria petrolera en donde son empleados para control de agua en pozos tanto productores como inyectores. Esto hace que la industria ste en una constante bsqueda de sistemas ms eficientes que los actualmente empleados para el control de agua. Es por ellos que se propuso la sntesis de geles de poliacrilamida por entrecruzamiento con mezcla fenol- formaldehdo (MFF) incorporando cido ctrico (AC) a pH 7, 8 y 9, a una temperatura de 80C, determinando la influencia del cido ctrico en la modificacin de las propiedades mecnicas, trmicas y de hinchamiento de los geles sintetizados. La determinacin de las propiedades mecnicas de estos sistemas se efectu en el rango de viscoelasticidad lineal empleando una frecuencia de 5 Hz ante una deformacin constante de 10%, determinando que el mdulo elstico (G) de los geles sintetizados disminua a medida que aumentaba la concentracin de cido ctrico. Tambin se pudo determinar que al incorporar cido ctrico, no se generaron cambios significativos en cuanto a la estabilidad trmica de los geles. En cuanto a la morfologa se pudo constatar que los sistemas sin cido ctrico presentan una textura rugosa la cual se va perdiendo a medida que se incorpora este aditivo. Se comprob que el cido ctrico para estos sistemas no acta como un agente entrecruzador, su funcin es permitir la obtencin de geles hbridos ya que este se dispone sobre la superficie del gel formando aglomerados de citrato los cuales contribuyen a la modificacin de las propiedades mecnicas y de hinchamiento de estos geles. En cuanto al grado de hinchamiento se constat que a medida que incrementa la concentracin de cido ctrico disminua la capacidad de hinchamiento de los geles con respecto a los que fueron sintetizados sin el aditivo, esto se debe a las variaciones de los potenciales qumicos dentro y fuera del gel luego de que este se ha hinchado, adems de la presencia de aglomerados de cido ctrico los cuales posiblemente puedan estar apantallando los grupos ionizables presentes en el gel por lo que disminuye el nmero de interacciones con el disolvente y en consecuencia disminuye el grado de hinchamiento. Por otro lado se estudi la cintica de hinchamiento de los geles sintetizados a pH 8 en agua desionizada obteniendo resultados que se ajustan satisfactoriamente al modelo propuesto por Schott (segundo orden) lo que permiti determinar los parmetros cinticos K y Woo los cuales corresponden a la constante de difusin de hinchamiento y al hinchamiento mximo en el equilibrio.','2011-05-18','Reaccin de entrecruzamiento, Poliacrilamida, Geles, cido Ctrico, Grado de hinchamiento, Cintica de Hinchamiento.',6,1,1,1,1,'2013-09-17 08:41:25','2013-09-17 08:41:25','Documento_655.pdf','application/pdf',1507193,'2013-09-17 08:41:25',20,0,125,'COMPLETO'),(649,'Desarrollo del Proceso de Gestin Empresarial \"Time Report\" mediante la implementacin de metodologa BPM y la utilizacin de Oracle BPM Studio','El siguiente trabajo especial de grado consiste en la creacin de un proceso de gestin empresarial automatizado, que facilite la vigilancia de todos los departamentos de la organizacin , controlando las actividades y las horas laboradas por parte del talento humano de la misma. Dicho proceso funcionara sobre la herramienta Oracle BPM Studio, para aprovechar las ventajas de las nuevas metodologas empresariales que dotan a este proceso de interactividad entre los recursos involucardos, y nutre del control del departamento y el desempeo del talento humano de la organizacin.','2011-05-30','Gestin, Gestin Empresarial, Time Report, BPM, Proceso',2,1,1,1,1,'2013-09-17 08:41:27','2013-09-17 08:41:27','Documento_656.pdf','application/pdf',1703116,'2013-09-17 08:41:27',18,0,96,'COMPLETO'),(650,'ESTUDIO DE LA FORMACINN DE LOS Complejos de Vanadio ((V)) CON AMINOCCIDOS..SISTEMA H++--VO22++--LEUCINA ((KCl 33..00 M a 2255 C))..','RESUMEN En el presente trabajo experimental, se estudiaron los siguientes sistemas: H+- Leu H+ - V(v) - Leu mediante medidas de fuerzas electromotrices emf (H), empleando como medio inico KCl 3,0M a una temperatura de 25,0(5) C, a fin de determinar las constantes de acidez (pKa) del ligando leucina y las constantes de equilibrio bpqr de los complejos formados. Los datos experimentales [H, B, C, Eo, J, (v, E)np]ns fueron tratados mediante el programa computacional de mnimos cuadrados generalizados LETAGROP, arrojando los siguientes resultados: Sistema H++ -- Leucina H2C+ HC + H+ HC C- + H+ Especies pKa H22C++ 2.49(2) HC 9.89(2) s((thc)) 0,02458 Sistema H++ --VO22++-- Leucina p H+ + q VO2+ + r C- Hp+1 (VO2)qCrp+3q-r Especies Pqr Log bPqr de la forma- Hp+1 (VO2)q(C)rp+3q-r [HVO2C]+ 111 14.42(7) 14.5(9) VO2C 011 11.70(7) 11.6 (1) [OHVO2C]- -111 7.1(<7.3) Max 7.0 [VO2C2]- 012 18.8(2) 19.1(1) s(thc) 0.01678 s(thB) 0.1534','2011-05-27','Qumica del vanadio, Qumica de vanadio (v), Qumica de Aminocidos, la leucina, Formacin de complejos, determinacin de la constante de acidez de la leucina,',6,1,1,1,1,'2013-09-17 08:41:29','2013-09-17 08:41:29','Documento_658.pdf','application/pdf',7735745,'2013-09-17 08:41:29',18,0,94,'COMPLETO'),(651,'ESTUDIO INICIAL DE GESTINN DE RESIDUOS.. COMPARACINN DE EFECTIVIDAD Y COSTO DE MATERIALES SORBENTES DE ORIGEN RESIDUAL,, NATURAL Y SINTTTICO EN DERRAMES DE ESPECIES QUMMICAS','El presente trabajo estuvo enfocado en la evaluacin de diferentes materiales de origen residual y natural con potencialidad de uso en derrame de hidrocarburos a su vez de ser una alternativa viable en la mitigacin de residuos. Se evalu la capacidad de sorcin de trece biomateriales: arena lavada, arena fina, concha de guacuco, germen de maz desgrasado, impureza de maz, tusa de maz, concha de caf, concha de coco marrn (endocarpo), concha de coco verde (mesocarpo), bagazo de caa de azcar, ceniza de caa de azcar, cascarilla de arroz y dos materiales sintticos con tres tipos de hidrocarburo: gasolina, gasoil y aceite de motor; Utilizando la metodologa propuesta en la norma ASTM f.726-06: \"Standard Test Method for Sorbent Performance of Adsorbents\" y el protocolo canadiense: \"Oil Spill Sorbents: Testing Protocol and Certification Listing Program. Los resultados obtenidos mostraron que el bagazo de caa de azcar present una capacidad de sorcin superior a los dems biomateriales e igual o superior en algunos casos a los materiales sintticos con los cuales fueron comparados; se encontr que la capacidad de sorcin depende del tamao de partcula, la viscosidad y la volatilidad del hidrocarburo. Finalmente todas las muestras fueron evaluadas mediante microcopia electrnica de barrido.','2011-05-26','Sorbentes, biomateriales, capacidad de sorcin, hidrocarburos, derrames de hicrocarburos',6,1,1,1,1,'2013-09-17 08:41:30','2013-09-17 08:41:30','Documento_659.pdf','application/pdf',1121221,'2013-09-17 08:41:30',20,0,171,'COMPLETO'),(652,'Aportes taxonmicos al conocimiento del gnero HypneaJ. V. Lamouroux (Cyatocloniaceae, Rhodophyta) en la Costa de Venezuela','Normal 0 21 false false false ES-VE X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} El gnero HypneaJ.V. Lamouroux se caracteriza principalmente por presentar talos teretes o comprimidos, ramas determinadas generalmente espiniformes, estructura interna compacta y uniaxial, tetrasporangios zonados, formando soros en las ramas determinadas y por la produccin de k-carragenina. A nivel mundial existen 54 especies. Estudios florsticos previos realizados en Venezuela informaban de la presencia de cuatro especies: Hypneacornuta (Ktzing) J. Agardh, Hypneamusciformis (Wulfen) J.V. Lamouroux, Hypneaspinella (C. Agardh) Ktzing y Hypneavalentiae (Turner) Montagne. El objetivo de este estudio es dar un primer aporte al conocimiento taxonmico del gnero Hypnea para la costa de Venezuela, sobre la base de caracteres morfoanatmicos y reproductivos. Las colecciones de muestras botnicas fueron realizadas en localidades representativas de cinco entidades federales y considerando diferentes ambientes y sustratos: Litorales rocosos, arrecifes coralinos, races de Rhizophora mangle, y praderas de angiospermas marinas, hasta una profundidad de 4 m. Adicionalmente se realiz la revisin de exsiccatae en tres herbarios nacionales. Los resultados obtenidos determinan la presencia de siete especies, de las cuales tres son nuevos registros para la ficoflora marina de Venezuela, estas son: H..charoides J.V. Lamouroux, H..flexicaulis Yamagishi & Masuda y H..pannosa J. Agardh, las mismas fueron identificadas con base en los siguientes caracteres diagnstico: hbito, forma del talo, forma y tamao de las ramas determinadas y forma de la clula axial. Se espera a futuro comparar dichos resultados con estudios moleculares.','2011-05-27','Cystocloniaceae, Rhodophyta, Hypnea, Taxnomia',1,1,1,1,1,'2013-09-17 08:41:31','2013-09-17 08:41:31','Documento_660.pdf','application/pdf',1982302,'2013-09-17 08:41:31',19,0,91,'COMPLETO'),(653,'PROTOTIPO PARA LA GESTINN Y CLASIFICACINN DE COLECCIONES DE DOCUMENTOS DIGITALES','El objetivo del presente Trabajo Especial de Grado consiste en el desarrollo de una aplicacin Web que permita apoyar los procesos de digitalizacin de documentos, clasificacin y visualizacin de documentos digitales basados en una taxonoma. Dentro de las necesidades contempladas en la aplicacin se tiene lo siguiente: contar con una aplicacin generalizada que le permita a los usuarios de forma rpida y eficiente realizar una estructura jerrquica de los documentos digitalizados y as mismo se pueda manejar la data de los mismos de una forma eficiente. Para cumplir con los objetivos de la aplicacin se utiliz el mtodo gil XP (Programacin Extrema), la cual se basa fundamentalmente, en la construccin progresiva del software sin hacer nfasis en la etapa de diseo.','2011-05-27','Digitalizacin, documentos digitales, clasificacin, taxonomas',2,1,1,1,1,'2013-09-17 08:41:33','2013-09-17 08:41:33','Documento_661.pdf','application/pdf',16045164,'2013-09-17 08:41:33',20,0,101,'COMPLETO'),(654,'Desarrollo de una aplicacinn Web para manejar los procesos administrativos de reservacinn de las Salas de Ensayo y Estudios de Grabacinn.. Caso de Estudio:: Rock && Folk','Los estudios de ensayo y grabacin se enfrentan a diario con una alta concurrencia de clientes, en especial la empresa Rock & Folk por su gran popularidad. La gestin de la mayora de sus actividades se lleva a cabo sobre una simple agenda o block de papel, lo que convierte a sus procesos ineficientes y poco confiables, siendo la reserva de salas de ensayo la ms afectada. El presente Trabajo Especial de Grado tiene como objetivo desarrollar un sistema que permita mejorar la atencin de los clientes del estudio Rock & Folk, brindndoles la oportunidad de consultar la disponibilidad de las salas desde sus hogares, ahorrando tiempo y otorgando confiabilidad en los procesos de reservacin. Adems de automatizar las actividades de los empleados que son realizadas de forma manual, como el registro de clientes, reservaciones de salas, y la gestin administrativa de estos procesos. El mtodo gil de desarrollo utilizado para la construccin de esta aplicacin fue una adaptacin de la Programacin Extrema (XP), la cual permite guiar la elaboracin de la parte prctica del presente trabajo de investigacin. Dentro de las necesidades contempladas en la aplicacin se encuentra lo siguiente: Mantener informado a los actores involucrados del flujo de trabajo con la informacin pertinente dependiente del tipo de proceso que se estuviese llevando a cabo en determinado momento.','2011-05-27','Estudios de Grabacin, Salas de Ensayo, Automatizacin, Reservaciones, Ruby On Rails, Rock & Folk',2,1,1,1,1,'2013-09-17 08:41:34','2013-09-17 08:41:34','Documento_662.pdf','application/pdf',1075771,'2013-09-17 08:41:34',20,0,68,'COMPLETO'),(655,'ESTUDIOS DE FORMACINN DE COMPLEJOS TERNARIOS ENTRE EL SISTEMA VANADIO ((III)) -- CISTENNA Y LOS AMINOCCIDOS HISTIDINA,, CCIDO ASPRRTICO Y CCIDO GLUTMMICO MEDIANTE MEDIDAS DE EMF ((H)) EN KCl 33,,00M A 2255C..','Se estudi la formacin de complejos ternarios entre el sistema vanadio (III)-cistena y los aminocidos: cido asprtico, cido glutmico e histidina en medio acuoso, a 25C y utilizando KCl 3,0M como medio inico, con la finalidad de conocer las diferentes especies que coexisten en el equilibrio a las distintas relaciones molares. El anlisis de los datos experimentales de cada sistema se realiz mediante el programa de mnimos cuadrados LETAGROP y LETAGROP/FONDO obtenindose los siguientes valores de pKa para los ligandos y las constantes de estabilidad log b de los complejos segn las siguientes reacciones generales: Tabla a..Valores de log bp0r, para el sistema H+ - cido asprtico, en KCl 3,0 M a 25C. REACCIN log b H2C + H+ H3C+ 2,60(4) H2C HC- + H+ -4,08(2) H2C C2- + 2H+ -13,86(3) Dispersion (s) 0,022 Tabla b..Valores de log bp0r, para el sistema H+ - cido glutmico, en KCl 3,0 M a 25C. REACCIN log b H2C + H+ H3C+ 2,72(4) H2C HC- + H+ -4,58(2) H2C C2- + 2H+ -14,23(3) Dispersion (s) 0,028 Tabla c..Valores de log bp0r, para el sistema H+ - cistena, en KCl 3,0 M a 25C. REACCIN log b H2C + H+ H3C+ 2,56(4) H2C HC- + H+ -8,22(3) H2C C2- + 2H+ -17,94(4) Dispersion (s) 0,024 Tabla d..Valores de log bp0r, para el sistema H+ - histidina, en KCl 3,0 M a 25C. REACCIN log b HC + H+ H2C+ 6,67(4) HC + 2H+ H3C+2 9,32(7) HC C- + H+ -9,40(5) Dispersion (s) 0,035 Tabla e. Valores de log bpqrs, para el sistema ternario V(III)-cistena- cido asprtico estudiados en KCl 3,0M como medio inico a 25 C. Reaccin log bpqrs ZB log bpqrs ZC log bpqrs ZB fondo log bpqrs ZC f ondo V3+ + H2Cis + H2Asp [V(H2Cis)(HAsp)]2+ +H+ 14,41(9) 14,43(9) 14,40(9) 14,41(9) V3+ + H2Cis + H2Asp [V(Hcis)(Hasp)]+ + 2H+ 11,7(2) 11,6(2) 11,7 (2) 11,6(2) V3+ + H2Cis + H2Asp [V(Hcis)(Asp)] + 3H+ 9,03(8) 9,04(9) 9,03(8) 9,06(9) V3+ + H2Cis + H2Asp [V(Cis)(Asp)]- + 4H+ 5,1(1) 5,2(1) 5,1(1) 5,2(2) V3+ + H2Cis + H2Asp [V(Cis)(Asp) (OH)]2- + 5 H+ 0,7(1) 0,9(1) 0,7(1) 0,9(1) Dispersin (s) 0,094 0,059 0,094 0,068 Tabla f. Valores de log bpqrs, para el sistema ternario V (III)-cistena -cido glutmico estudiados en KCl 3,0M a 25 C. Reaccin log bpqrs ZB log bpqrs ZC V3+ + H2Cis + H2Glu [V(H2Cis)(HGlu)]2+ + H+ 14,55(6) 14,59(6) V3+ + H2Cis + H2Glu [ V(HCis)(HGlu)]+ + 2H+ 11,79(8) 11,78(9) V3+ + H2Cis + H2Glu [V(Cis)(HGlu)] + 3H+ 8,49(6) 8,58 (6) V3+ + H2Cis + H2Glu [V(Cis)(HGlu)(OH)]- + 4H+ 3,96(7) 4,11(7) Dispersin (s) 0,090 0,058 Tabla g. Valores de log bpqrs, para el sistema ternario V (III)-cistena -histidina estudiados en KCl 3,0M a 25 C. Reaccin log bpqrs ZB log bpqrs ZC log bpqrs ZB fondo log bpqrs ZC fondo V3+ + H2Cis + HHis [V(HCis)(HHis)]2+ + H+ 17,87(7) 17,93(6) 17,87(7) 17,88(7) V3+ + H2Cis + HHis [V(HCis)(His)]+ + 2H+ 14,44(5) 14,39(5) 14,44(5) 14,39(6) V3+ + H2Cis + HHis [V(Cis)(His)] + 3H+ 9,87(8) 9,88(7) 9,88(8) 9,86(8) V3+ + H2Cis + HHis [V(Cis) (His)(OH)]- + 4H+ 5,05(6) 5,03(5) 5,05(6) 5,04(6) Dispersin (s) 0,090 0,055 0,089 0,061','2011-05-27','COMPLEJOS TERNARIOS AMINOCCIDOS MEDIANTE MEDIDAS DE EMF CONSTANTE DE ACIDEZ',6,1,1,1,1,'2013-09-17 08:41:37','2013-09-17 08:41:37','Documento_663.pdf','application/pdf',41436343,'2013-09-17 08:41:37',18,0,106,'COMPLETO'),(656,'Evaluacin de la presencia de cuasiespecies del virus de hepatitis C en suero, saliva y fluido crevicular gingival de pacientes infectados.','El virus de la hepatitis C (VHC) es el agente etiolgico de la hepatitis C, una enfermedad viral que afecta principalmente al hgado en humanos y chimpancs. Aproximadamente el 3% de la poblacin mundial humana, est infectada con este virus. Es un virus que contiene ARN como material gentico. Su genoma es de cadena lineal, y contiene unos 9500 nucletidos. Posee una alta tasa de error en la incorporacin de nucletidos al momento de la replicacin, ya que su ARN polimerasa dependiente de ARN carece de un sistema de actividad correctora, se dan mutaciones al azar constantemente, que influyen directamente en el genotipo y fenotipo del virin, y se seleccionan mutantes (variantes) de resistencia a distintas presiones selectivas, como la que ejercen los frmacos antivirales, o la presin del sistema inmune del hospedador. Las distintas variantes genmicas de este virus, que infectan a un mismo individuo, se denominan cuasiespecies. El objetivo principal de este estudio, fue determinar la presencia de cuasiespecies en suero y saliva de pacientes infectados en la fase crnica de la hepatitis C. La amplificacin de dos regiones del genoma del VHC (5\'-NC y NS5B), la secuenciacin de los amplicones, y la clonacin, junto con el uso de programas de bioinformtica para su anlisis, permiti caracterizar al virus molecularmente, tanto en genotipo, como en subtipos, a nivel poblacional. A nivel individual, se determin la presencia de cuasiespecies en las distintas regiones del VHC en muestras de suero y saliva de pacientes infectados en fase crnica de la hepatitis C. La carga viral que circula en suero con respecto a saliva, es mayor, y esto le da mayor probabilidad de amplificacin en el primero. Adems, la regin 5\'-NC es ms sensible a la amplificacin, por ser ms conservada que la NS5B. La regin 5\'- NC es suficiente para la asignacin de genotipos. Sin embargo, la regin NS5B da una mayor discriminacin, y permite asignar subtipos y genotipos. El alineamiento de secuencias consenso de las regiones del VHC que circula en suero y saliva, mostr un alto grado de identidad, lo cual indic que tanto la muestra de saliva como la de suero, pueden ser usadas para caracterizacin molecular. A nivel poblacional, la caracterizacin molecular mostr que los genotipos predominantes en Venezuela, siguen siendo el genotipo 1 y el genotipo 2, con una prevalencia del 67% (10/15) y 33% (5/15), respectivamente. Por otro lado, la caracterizacin molecular a nivel individual, demostr la presencia de cuasiespecies del VHC en las muestras de suero y saliva de dos pacientes, en el cual no se observ mayor distancia gentica entre las variantes de la cuasiespecie que circula en suero, con respecto a las variantes de la cuasiespecie que circula en saliva, puesto que no formaron clados distintos entre ellas. El realizar estudios de cuasiespecies es de suma importancia para la vigilancia, patogenicidad, epidemiologa y evolucin del virus en un individuo, y muchas veces es pasado por alto.Aunque se han llevado a cabo numerosos trabajos de distribucin de cuasiespecies en distintos rganos, tejidos y/o fluidos corporales, como suero, PBMCs, tejido heptico, entre otros; este es el primer trabajo que pone en evidencia la presencia de cuasiespecies del VHC en la saliva de pacientes infectados, a pesar de que ya ha sido reportada la presencia del VHC en este fluido.','2011-02-18','cuasiespecies, virus, virus de hepatitis C, virus de ARN, evolucin viral.',1,1,1,1,1,'2013-09-17 08:41:40','2013-09-17 08:41:40','Documento_664.pdf','application/pdf',4860669,'2013-09-17 08:41:40',19,0,138,'COMPLETO'),(657,'Formacin de nanotubos de carbono mediante microondas.','En este Trabajo Especial de Grado se sintetizaron estructuras de carbono mediante la exposicin de muestras de grafito con platino (catalizador) a las microondas de un horno domstico comercial cuya potencia es de 600 Watts y su frecuencia es 2,45GHz. Se variaron las condiciones de presin y tipo de gas contenido en el reactor de cristal de cuarzo donde se realiz el experimento, el tiempo de exposicin a las microondas y la cantidad de grafito en la muestra. Se caracteriz\'o morfolgicamente las muestras obtenidas, en el Laboratorio de Nanomateriales del Departamento de Ingeniera y Ciencias de los Materiales del Instituto Venezolano de Investigaciones Cientficas (IVIC) con un equipo AFM Agilent 5500 (AFM, STM) con modulo Mac III. Se observaron distintas morfologas asociadas a carbono. Estas morfolgicas dependieron de las condiciones experimentales bajo las cuales se produjeron las muestras. El efecto de las condiciones estudiadas sobre las muestras es el siguiente: Alto vacio (10-6 atm), pelcula Pt/C, pelcula extra de grafito: favorece la formacin de anillos de carbono. Alto vacio (10-6 atm), pelcula Pt/C: favorece la formacin de nanotubos de carbono en bundles pequeos. Gas Helio (0,5 atm), pelcula Pt/C, pelcula extra de grafito: favorece la formacin de bundles nanotubos de carbono en forma de araas.','2011-05-30','Sntesis, Microondas, Nanotubos, Carbono, AFM, Bundles.',3,1,1,1,1,'2013-09-17 08:41:41','2013-09-17 08:41:41','Documento_665.pdf','application/pdf',2673561,'2013-09-17 08:41:41',20,0,181,'COMPLETO'),(658,'Anlisis de Espectros UV de Estrellas O en las Nubes de Magallanes obtenidos con FUSE','En este trabajo hemos extendido el atlas espectral de estrellas gigantes y supergigantes O de las Nubes de Magallanes observadas con el satlite Far Ultraviolet Spectrosocopic Explorer (FUSE) en el rango de 900-1200  (Walborn et al. 2002, ApJS 141, 443), incorporando los espectros de 20 estrellas muy tempranas de la secuencia principal. Estos espectros han sido procesados y organizados por tipo espectral y clase de luminosidad, recuperando las correlaciones entre los vientos estelares y los parmetros fundamentales delas estrellas O encontradas por Walborn et al. Especficamente, hemos analizado las lneas espectrales de los iones OVI (ll 1032, 1038 )y CIII (l 1176 ). Adems, hemos confirmado las anomalas en la abundancia de CNO en las estrellas de mayor masa y luminosidad (O2) y cuantificado las relaciones encontradas mediante ndices espectrales definidos para caracterizar los perfiles P Cygni en el doblete OVI y la absorcin de CIII','2011-01-10','Estrellas, estrellas tipo temprano, espectros UV, FUSE',3,1,1,1,1,'2013-09-17 08:41:44','2013-09-17 08:41:44','Documento_666.pdf','application/pdf',41436343,'2013-09-17 08:41:44',19,0,106,'COMPLETO'),(659,'Portal Web para el Repositorio de Objetos de Aprendizaje de AMBAR','AMBAR es un proyecto de investigacin de la Universidad Central de Venezuela (UCV), que busca proporcionar herramientas de software que apoyen el proceso de enseanza y aprendizaje. Actualmente posee un Repositorio de Objetos de Aprendizaje (ROA), el cual se encuentra relacionado con un Repositorio de Metadata; stos a su vez pueden ser utilizados desde la plataforma Moodle , todo integrado a travs de la Capa de Servicios Web. El Objetivo general del presente trabajo fue la realizacin de un Portal Web que permitiera la entrada a las diferentes Aplicaciones de AMBAR, hacindolo transparente al usuario para su utilizacin, ya que el mismo proporciona la reunin entre el ROA y el Moodle de AMBAR, a travs del uso de tecnologas como Joomla un sistema de administracin de contenidos, por sus siglas en ingles C.M.S o Content ManagementSystem, Joomdle un paquete de componentes, mdulos y plugins para integrar Joomla! y Moodle y los servicios web para la comunicacin con el ROA de AMBAR. Para ello se emple el Modelado gil (MA) como Mtodo de Desarrollo del Software, en el cual a travs de cuatro iteraciones se instal el CMS y Joomdle, tanto desde la aplicacin de Joomla como desde Moodle, se modificaron las interfaces del ROA de AMBAR para que se vieran desde el portal, y se llen el mismo de informacin relacionada con el proyecto AMBAR, tambin se realiz el visualizador SCORM del ROA. Con este trabajo, se est facilitando la integracin y la entrada a los recursos de AMBAR ayudando a la gestin de los OA almacenados en el ROA, potenciando as la posibilidad de incrementar el nmero de usuarios, la retroalimentacin, las funcionalidades del sistema completo y los recursos puestos a disposicin de los usuarios.','2011-05-27','Objetos de Aprendizaje (OA), Repositorio de Objetos de Aprendizaje (ROA), AMBAR, Moodle, Joomla!, Portal Web, SCORM.',2,1,1,1,1,'2013-09-17 08:41:46','2013-09-17 08:41:46','Documento_667.pdf','application/pdf',620705,'2013-09-17 08:41:46',20,0,54,'COMPLETO'),(660,'Mtodos Iterativos Precondicionados para Resolver Problemas de Mnimos Cuadrados Lineales','En este trabajo se estudian y comparan diferentes tcnicas de precondicionamientopara resolver problemas de mnimos cuadrados lineales grandes y dispersos mediantemtodos iterativos como LSQR (least square with QR factorization) y CGLS (conjugategradient for least square). Las tcnicas de precondicionamiento usadas son basadasen factorizaciones incompletas de Cholesky, LU, LQ, entre otras. Se presentan tablasy grficos que muestran los resultados obtenidos de aplicar estas tcnicas de precondicionamientopara resolver diversos problemas de mnimos cuadrados lineales provenientesdel arte de medir tierras y de discretizar la ecuacin de difusin-conveccin notransistoria mediante el mtodo de Reciprocidad Dual en Multi-Dominios (DRM- MD).','2011-05-23','Mnimos cuadrados, Mtodos iterativos, Precondicionamiento, Matrices dispersas',5,1,1,1,1,'2013-09-17 08:41:46','2013-09-17 08:41:46','Documento_668.pdf','application/pdf',1610881,'2013-09-17 08:41:46',20,0,107,'COMPLETO'),(661,'PROTOTIPO PARA UN ARCHIVO DE DOCUMENTOS DIGITALES PROVENIENTES DE LA WEB.MODULO DE CONTROL, ALMACENAMIENTO ESTRUCTURADO, SPIDERS Y PLATAFORMA CLOUD COMPUTING','Un documento digital o impreso tienen ambos un origen comn: son el resultado directa o indirectamente del intelecto humano. Varios son los esfuerzos para preservar documentos, libros, entre otros, para su consulta pblica y para las generaciones futuras. Cada da mas la informacin se encuentra en formato digital, las noticias se generan y se publican en la World Wide Web. Preservar este tipo de informacin es una necesidad para la Venezuela de hoy.El proyecto cubre el desarrollo de un prototipo para la construccin del Archivo de Documentos Digitales provenientes de la Web. El proyecto consta de los siguientes componentes: Portal, Panel de Control (Cpanel), el Modulo de Control, Manejador de Trabajos en Background (Robot); Analizador de Documentos, Generacin de Vistas Previas en varios formatos y Spiders, estos tres ltimos soportados por una plataforma de Cloud Computing. Finalmente los componentes para el almacenamiento y gestin dedatos soportado por un repositorio de documentos siguiendo el enfoque no-sql, y un Datawarehouse para la consulta y gestin de versiones histricas.Nuestro trabajo tiene como objetivo aportar al proyecto lo siguiente: 1) Desarrollo del modulo de control, 2) Instalacin y desarrollo de interfaces para el uso del repositorio no-sql. 3) Desarrollo de interfaces para el uso de una plataforma de Cloud Computing. 4) Librera para implementar las polticas de uso de los URI (Uniform Resource Indentifier) requeridas para el proyecto. 5) Programacin en la \"nube\" de los spiders y exportacin de documentos a varios formatos (Ej: PDF)','2011-05-27','Cloud Computing, Web Archiving, Datawarehouse, Almacenamiento Estructurado',2,1,1,1,1,'2013-09-17 08:41:47','2013-09-17 08:41:47','Documento_669.pdf','application/pdf',1610881,'2013-09-17 08:41:47',20,0,107,'COMPLETO'),(662,'\"\"SNNTESIS DE LA POLIACRILAMIDA,, VAA RADICAL LIBRE Y ESTUDIO DE SU APLICACINN COMO AGENTE DE INVERSINN EN EMULSIONES DE AGUA EN CRUDO,, PROVENIENTES DE FOSAS PETROLERAS\"\"','RESUMENEn el siguiente trabajo se procedi a realizar la sntesis de la poliacrilamida va radical libre, partiendo del monmero acrilamida y el iniciador persulfato de sodio, a fin de probar su aplicacin como agente de inversin en emulsiones de agua en crudo (W/O) proveniente de fosas petroleras. Para ello se sintetiz tres poliacrilamidas, variando la relacin de masa iniciador/monmero (PAA 0,2%, PAA 0,5% y PAA 1%), con el fin de obtener polmeros con diferentes pesos moleculares, los cuales fueron determinados por viscosimetra, comprobando que un aumento en la relacin de masa iniciador/ monmero causa una disminucin en el peso molecular del polmero. Los tres polmeros sintetizados fueron caracterizados por espectroscopia de IR, DCS y TGA, observando que los resultados obtenidos por estas tcnicas no arrojaron diferencias significativas para cada polmero. En los espectros de IR se observ la ausencia de las bandas caractersticas de las olefinas (C=C), as como la presencia de las bandas caractersticas de los alcanos (Csp3) y de los enlaces NH2, C=O y C-N. Tambin se pudo determinar que las poliacrilamidas sintetizadas son polmeros con gran estabilidad a temperatura ambiente y altamente amorfos, segn los resultados obtenidos por TGA y DSC respectivamente. Una vez caracterizados las poliacrilamidas sintetizadas, se procedi a realizar los ensayos de inversin de fase de la emulsin W/ O proveniente de las fosas petroleras, variando algunas condiciones de formacin como: relacin de volumen entre las fases, tipo de surfactante, concentracin de surfactante, peso molecular del polmero, pH y temperatura; observando que al emplear dicho polmero como surfactante si se logr invertir la emulsin de W/O a O/W, alcanzando la mayor estabilidad segn las condiciones trabajadas, cuando se utiliza una concentracin de 1,5%m/V de poliacrilamida en solucin acuosa, a pH neutro y temperatura ambiente. Tambin se pudo evidenciar que el peso del molecular de las poliacrilamidas sintetizadas no es un factor que genere una variacin importante en la estabilidad de la emulsin formada. A fines comparativos y utilizando las mismas condiciones experimentales establecidas para los ensayos de inversin con la poliacrilamida, se empleo otro surfactante formado por una mezcla de polmeros (PAA-PVA), observando que dicha mezcla tambin logra mantener la emulsin O/W, alcanzando la mayor estabilidad (segn las condiciones trabajadas) cuando se utiliza una mezcla del 10%m/m de PVA/PAA, a una concentracin de 1,5%m/V en solucin acuosa, a pH neutro y temperatura ambiente. Tambin, se pudo observar que la emulsin estabilizada con la mezcla es ms estable que la estabilizada con poliacrilamida, lo cual se pudo comprobar por el tamao de las gotas de la fase dispersa y el tiempo que transcurre para que ocurra la coalescencia de las mismas. Por lo que se puede asegurar que la mezcla PAA-PVA acta como mejor surfactante que la PAA para estabilizar emulsiones de crudo en agua, en las condiciones trabajadas.','2011-05-31','poliacrilamida, emulsin de agua en crudo, inversin',6,1,1,1,1,'2013-09-17 08:41:48','2013-09-17 08:41:48','Documento_670.pdf','application/pdf',5350902,'2013-09-17 08:41:48',20,0,85,'COMPLETO'),(663,'ESTUDIOS DE FORMACION DE COMPLEJOS TERNARIOS DE Ni(II),CON EL ACIDO DIPICOLINICO Y LOS AMINOACIDOS a-ALANINA,b-ALANINA,PROLINA Y GLICINA MEDIANTE MEDIDAS DE EMF(H) EN NaCl 1,0M A 25C','En el siguiente trabajo mediante medidas de Fuerza Electromotriz emf (H),empleando como medio inico NaCl 1,0 M, y a una temperatura de 25,0 C sedeterminaron las constantes de acidez (pKa) y las constantes de equilibrio de loscomplejos formados (log b) del acido dipicolinico y los aminocidos: a- alanina, b-alanina,prolina y glicinaLos datos experimentales [H, B, C, Eo, J, (v, E) np]ns fueron tratados mediante elprograma computacional de mnimos cuadrados generalizados LETAGROP.Las constantes de acidez para estos sistemas se determinaron mediante los siguientesequilibrios:HL +H+ H2LAcido dipicolinico:Especies pKaH2C-2,395(2)C2- 4,51(2)s(Zc) 0,010 a- alanina:H2L+2,66 (3)HL9,68(3)s(Zc)0,043 b- alanita:H2L+3,69 (3)HL9,74 (2)s(Zc)0,025Prolina: EspeciesH2L+1,88(1)HL10,57 (1)s(Zc)0,011GlicinaEspecies PkaH2L+2,65 (3)HL 9,60 (2)s(Zc) 0,025Los Sistemas H+ - Ni(II) -acido dipicolinico- a-alanina, H+ - Ni (II) -acido dipicolinico- b-alanina, H+ - Ni(II)-acido dipicolinico-prolina y H+ - Ni(II) -acido dipicolinico- glicina,fueron determinados empleando el nivel de reaccin pH2O + qNi2+ + r HC [Niq(OH)pCr]2q-p +pH+ ,obtenindose Reaccin log bpqrsZBlog bpqrsZCNi2+ + H2C + HL Ni(C)HL + 2H+ 3,5(2) 3,6(2)Ni2+ + H2C + HL Ni[(C)L]- + 3H+ -2,59(8) -2,52(7)Ni2+ + H2C + HL Ni[(C)L(OH)]2- + 4H+ -11,84 (8) -11,73(9)Dispersin (Z) 0,065 0,062','2011-05-27','complejos ternarios,constantes de equilibrio,medio ionico,a-alanina,b-alanina, prolina , glicina, acido dipicolinico,medidas de fuerza electromotriz',6,1,1,1,1,'2013-09-17 08:41:49','2013-09-17 08:41:49','Documento_671.pdf','application/pdf',446054,'2013-09-17 08:41:49',19,0,76,'COMPLETO'),(664,'Normal 0 21 false false false ES X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-or