 matriz de leche, peropara efectos de estudios de contaminacin, fue suficientemente satisfactoria.El valor mnimo reportado de contaminacin corresponde a 139 mg/kg, sin embargopor esta metodologa es posible determinar hasta 30 mg/Kg en la leche cruda. Las muestras de leche deproveedores locales no arrojaron concentraciones considerables de melamina, locual sugiere que al menos para las muestras en estudio, no presentaronadulteracin, con el fin de aumentar el contenido proteico.','2011-05-27','Melamina Esun compuesto orgnico que se obtiene de la urea, con frmula qumica C3H6N6y cuyo nombre IUPAC es 2,4,6-triamino-1,3,5-triazina, vase figura 2. Es un trmero(est constituida por tres molculas iguales) de cianamida,formando un heteroci',6,1,1,1,1,'2013-09-17 08:41:52','2013-09-17 08:41:52','Documento_673.pdf','application/pdf',1093166,'2013-09-17 08:41:52',18,0,128,'COMPLETO'),(666,'Estudio de la formacinn de los complejos de Vanadio ((IV))..Sistema VO22++ -- Triptffano ((Trp))((KCl 33..00 M,, 2255C))','En el presente trabajo se estudiaron los sistemas: H+ - triptfano (Trp, HC) H+ - VO2+ - HC por medio de medidas de fuerzas electromotrices emf(H) a 25C y en KCl 3.0 M como medio inico inerte. El anlisis de los datos experimentales de cada sistema se realiz mediante el programa de mnimos cuadrados LETAGROP, obtenindose los siguientes valores de pKa para el triptfano y las constantes de estabilidad bpqr de los complejos , segn las siguientes reacciones generales: Sistema H++ -- triptffano H+ + HC H2C+ HC C-+ H+ EspeciespKa Log bp00rH2C+2.71(2)2.71(2)HC9.57(2)-9.57(2)s (thc)0.0200.010  Sistema H++ -- VO22++ -- triptffanop H++ q VO2++ r C- Hp(VO)q (C)rp+2q-r Especies Log bpqr [HVOC]2+11.73(4)[VOC]+ 7.74(3)s(thc)0.010','2011-05-27','Estudio de la formacinn de los complejos de Vanadio ((IV))..Sistema VO22++ -- Triptffano ((Trp))((KCl 33..00 M,, 2255C))',6,1,1,1,1,'2013-09-17 08:41:52','2013-09-17 08:41:52','Documento_674.pdf','application/pdf',3069644,'2013-09-17 08:41:52',20,0,133,'COMPLETO'),(667,'Simulacin microscpica de trfico vehicular basada en agentes inteligentes','La demanda de transporte, movida principalmente por las necesidades y deseos de movilizacin de las personas, y la oferta requerida para poder suplir esa demanda es un tema importante de estudio en ingeniera civil y planificacin urbanstica. El presente Trabajo Especial de Grado propone la utilizacin de un conjunto de herramientas para la construccin de estudios de trfico sobre desarrollos urbansticos actuales y a futuro apoyados en el toolkitMATSim, un simulador microscpico de trfico basado en agentes inteligentes. Para probar la eficacia de este toolkitse realizaron un conjunto de pruebas con datos reales de la zona de Caracas de Los Cortijos de Lourdes y Los Ruices. Los resultados obtenidos develan que esta herramienta provee resultados utilizables y adaptables a las necesidades del analista de trfico, generando resultados realistas con respecto a la dinmica vehicular de una zona particular.','2011-05-30','simulacin, agentes inteligentes, trfico vehicular, anlisis de demanda de transporte',2,1,1,1,1,'2013-09-17 08:41:54','2013-09-17 08:41:54','Documento_675.pdf','application/pdf',2159134,'2013-09-17 08:41:54',20,0,94,'COMPLETO'),(668,'Normal 0 21 false false false ES-VE X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom:10.0pt; mso-para-margin-left:0cm; line-height:115%; mso- pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso-hansi- font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family: \"Times New Roman\"; mso-bidi-theme-font:minor-bidi; mso-fareast-language:EN-US;} DOSIMETRAA CON CMMARA DE IONIZACINN EN CAMPOS DE MEGAVOLTAJE UTILIZANDO LA TCCNICA DE ARCOS DINMMICOS.. PROPUESTA DE PROTOCOLO EN TRATAMIENTOS DE CNNCER DE PRSSTATA','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin-top:0cm; mso-para-margin-right:0cm; mso-para-margin-bottom: 10.0pt; mso-para-margin-left:0cm; line-height:115%; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi; mso-fareast-language:EN-US;} En los ltimos aos se han observado avances importantes en el tratamiento de radioterapia externa en pacientes con cncer de prstata, surgiendo desde la Radioterapia Conformada 3D hasta la Radioterapia con Intensidad Modulada, ambas tcnicas proponen una excelente distribucin de dosis a nivel del lecho prosttico evitando as la irradiacin de los tejidos sanos adyacentes; sin embargo haciendo uso de la tcnica de Arcos Dinmicos le ofrecemos al paciente con cncer de prstata un tratamiento de calidad exponindolo por menos tiempo a la irradiacin. La tcnica de Arcos Dinmicos nos ofrece un tratamiento isocentrico en el que se observa el movimiento tanto del brazo del acelerador (gantry), como del MLC, el cual cambia su configuracin tomando la forma de cada proyeccin angular de la lesin. El tratamiento de Arcos Dinmicos que presento una mejor distribucin de dosis, verificado por medio de un maniqu plvico, fue el plan constituido por tres (3) arcos; la distribucin fue la siguiente: Arco11 (Start: 285.0, Stop: 83.0), Arco 22 (Start:125.0, Stop:90.0) y Arco 33 (Start: 235.0, Stop:270.0).','2010-12-16','Normal 0 21 false false false ES-VE X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-s',3,1,1,1,1,'2013-09-17 08:41:55','2013-09-17 08:41:55','Documento_677.pdf','application/pdf',2156214,'2013-09-17 08:41:55',20,0,156,'COMPLETO'),(669,'Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin- bottom:.0001pt; mso-pagination:widow-orphan; font-size:10.0pt; font-family: \"Times New Roman\"; mso-ansi-language:#0400; mso-fareast-language:#0400; mso- bidi-language:#0400;} Evaluar algunos Mtodos de extraccinn que se emplean en la determinacinn del Fssforo en muestras de sedimentos con las tcnicas de ICP-- AES y Colorimetra..','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} Este trabajo de investigacin consisti en la determinacin y cuantificacin de Fsforo en muestras de referencia y de sedimento. Para la extraccin se emplearon los mtodos cido- base, secuencial e ignicin y para el anlisis se usaron las tcnicas de ICP y Colorimetra. Los mtodos propuestos estuvieron basados en la digestin cido-base empleando HNO3. Para la extraccin secuencial se emple con HCl 1M, seguido de HNO3 concentrado en caliente y el mtodo por ignicin, se calcin la muestra a 550 C por dos horas, seguido de HCl 1M. La exactitud de los anlisis fue alta, ya que la concentracin de P total determinada en la muestra con concentracin de P conocida es de 0,16  0,01 % P2O5; intervalo en el cual se encuentra el valor real. La cantidad de fsforo extrado con las tres digestiones fue considerada del 100 %. De acuerdo a estos resultados fue posible establecer que el mtodo que incluye la tercera digestin con HF(c)/HNO3(c) es ms efectivo que aquel que solo utiliz HCl 1 M y HNO3(c) para la extraccin.','2011-05-26','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',6,1,1,1,1,'2013-09-17 08:41:56','2013-09-17 08:41:56','Documento_678.pdf','application/pdf',3121406,'2013-09-17 08:41:56',19,0,100,'COMPLETO'),(670,'DESARROLLO DE UN SISTEMA DE ALQUILER DE CANCHAS DE TENIS USANDO ELEMENTOS DE APLICACIONES WEB ENRIQUECIDAS','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} Para el desarrollo del Sistema de alquiler de canchas de Tenis de la F.V.T es indispensable el uso de herramientas que ayuden de manera verstil y eficaz en la construccin de esta aplicacin. Adicionalmente, se quiere que esta aplicacin tenga una interaccin con el usuario de la forma mas fluida posible, para ello se utilizaron elementos de Aplicaciones Web Enriquecidas ms especficamente el enfoque AJAX y todas las bondades que este ofrece.','2011-05-31','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',2,1,1,1,1,'2013-09-17 08:41:57','2013-09-17 08:41:57','Documento_679.pdf','application/pdf',1929425,'2013-09-17 08:41:57',18,0,82,'COMPLETO'),(671,'Prototipo para un Archivo de Documentos Digitales provenientes de la Web. Modulo de Control, Almacenamiento Estructurado Spiders y Plataforma Cloud Computing','Un documento digital o impreso tienen ambos un origen comn: son el resultado directa o indirectamente del intelecto humano. Varios son los esfuerzos para preservar documentos, libros, entre otros, para su consulta pblica y para las generaciones futuras. Cada da mas la informacin se encuentra en formato digital, las noticias se generan y se publican en la World Wide Web. Preservar este tipo de informacin es una necesidad para la Venezuela de hoy.El proyecto cubre el desarrollo de un prototipo para la construccin del Archivo de Documentos Digitales provenientes de la Web. El proyecto consta de los siguientes componentes: Portal, Panel de Control (Cpanel), el Modulo de Control, Manejador de Trabajos en Background (Robot); Analizador de Documentos, Generacin de Vistas Previas en varios formatos y Spiders, estos tres ltimos soportados por una plataforma de Cloud Computing. Finalmente los componentes para el almacenamiento y gestin de datos soportado por un repositorio de documentos siguiendo el enfoque no-sql, y un Datawarehouse para la consulta y gestin de versiones histricas.Nuestro trabajo tiene como objetivo aportar al proyecto lo siguiente: 1) Desarrollo del modulo de control, 2) Instalacin y desarrollo de interfaces para el uso del repositorio no-sql. 3) Desarrollo de interfaces para el uso de una plataforma de Cloud Computing. 4) Librera para implementar las polticas de uso de los URI (Uniform Resource Indentifier) requeridas para el proyecto. 5) Programacin en la \"nube\" de los spiders y exportacin de documentos a varios formatos (Ej: PDF)','2011-06-10','Cloud Computing, Web Archiving, Datawarehouse, Almacenamiento Estructurado',2,1,1,1,1,'2013-09-17 08:41:59','2013-09-17 08:41:59','Documento_680.pdf','application/pdf',3484267,'2013-09-17 08:41:59',20,0,132,'COMPLETO'),(672,'ALTERACIONES ULTRAESTRUCTURALES DE PULMN EN RATONES INFECTADOS EXPERIMENTALMENTE CON DOS AISLADOS DE T.. evansi DE VENEZUELA','Trypanosoma evansi,,es un protozoario hemoflagelado, causante de la tripanosomosis equina. El parsito es transmitido mecnicamente por dpteros hematfagos de un mamfero a otro a travs de su picadura. Una vez en el vertebrado, el tripanosoma se reproduce por fisin binaria, entrando al torrente sanguneo. Ha sido descrito en Asia, frica y Suramrica. En Venezuela, incide principalmente en los llanos, teniendo cierto impacto en las actividades agropecuarias. Se sabe, que la patogenicidad del parsito vara de un rea geogrfica a otra. En este sentido, se han realizado investigaciones con aislados venezolanos, reportando alteraciones ultraestructurales en rin e hgado a travs de infecciones experimentales de modelos murinos, con el fin de ahondar en la patologa de la enfermedad. Sin embargo, no se encuentran registros de investigaciones realizadas en pulmn, siendo este un rgano tan vinculado al sistema vascular, cabe preguntarse acerca de los cambios submicroscpicos de este tejido debido al T.. evansi. Por esta razn, se plantea como objetivo, describir las alteraciones ultraestructurales del pulmn en ratones infectados experimentalmente. Para ello, lotes de ratones hembras de 20 gramos de peso corporal fueron infectados con 1 tripomastigote/gramo de peso corporal con dos aislado de T.. evanside Venezuela; al alcanzar una parasitemia del orden de 107, los animales fueron sacrificados interdiariamente para extraer muestras del pulmn, por ablacin quirrgica, las muestras se fraccionaron en porciones de 2 mm3 que se fijaron en solucin Karnovsky (glutaraldehido al 2,5% y formaldehido al 37% en buffer fosfato de Millonig a pH 7, 4 y 320 mOsm), seguidamente fueron lavados en buffer Millonig y post- fijadas con tetrxido de osmio al 1%. Luego, se deshidrataron en una batera de etanol de concentraciones crecientes, dos cambios con xido de propileno y otro en xido de propileno-epn (1:1). Finalmente, las muestras fueron incluidas en resina epxica (48 horas; 60C). Los cortes finos (60-90nm) se obtuvieron en un ultramicrotomo Porter-Blum MT2-B. Las secciones obtenidas se contrastaron con acetato de uranilo y citrato de plomo. Finalmente las rejillas fueron examinadas en un Microscopio marca JEOL JEM-1011, efectuando registro permanente en negativos de 8,3 x 10,2cm para su posterior revelado y anlisis. Los resultados revelan daos en la microvasculatura que incluyen engrosamiento de la membrana basal de los capilares, disminucin del numero de caveolas y prolongaciones endoteliales; asi mismo se presenta un aumento en el infiltrado celular, esto sugiere un dao importante causado por la presencia del parasito en el lecho capilar pulmonar.','2011-05-24','pulmn, Trypanosoma, ultraestructura',1,1,1,1,1,'2013-09-17 08:42:01','2013-09-17 08:42:01','Documento_681.pdf','application/pdf',11247315,'2013-09-17 08:42:01',17,0,162,'COMPLETO'),(673,'Diagnstico serolgico diferencial de la fase aguda y crnica de la Esquistosomiasis: estudio de las glicoprotenas del glicocalix de la cercaria.','La Esquistosomiasis o Bilharziosis es una de las enfermedades parasitarias ms difundida en el mundo que afecta a ms de 200 millones de personas en las zonas tropicales e intertropicales. Es causada por algunas de las especies de gusanos planos del gnero Schistosoma y consiste en una dolencia fundamentalmente crnica, que debilita severamente a quienes la padecen, reduce su capacidad productiva, los incapacita y limita sus perspectivas de progreso econmico y social. Despus de la malaria, esta parasitosis ocupa el segundo lugar en importancia desde un punto de vista socioeconmico y de salud pblica. En Venezuela, la nica especie que infecta al hombre es Schistosoma mansoni el cual se encuentra diseminado en una superficie de 15.000 Km2 de la zona centro- costera del pas (estados Aragua, Carabobo, el norte de Gurico, Miranda y Vargas). Las cercarias del Schistosoma mansoni son estadios larvales constituidos por un cuerpo y una cola bifurcada, los cuales estn recubiertos por un tegumento con un rea de 20.000 mm2. En su parte ms externa, el tegumento est cubierto por una membrana trilaminada limitada por un denso glicocalix altamente antignico que parece jugar un papel importante en la respuesta innata y adaptativa del hospedador y es el responsable de la reaccin antgeno-anticuerpo que ocurre en presencia de sueros de pacientes. Una serie de mtodos parasitolgicos, bioqumicos e inmunoqumicos fueron utilizados para llevar a cabo este estudio. Su aplicacin permiti investigar desde la cercario-reaccin ms sencilla hasta lo ms complejo como la identificacin, aislamiento y caracterizacin de los polipptidos antignicos y sus eptopes en el glicocalix de la cercaria. Un mtodo mecnico sencillo fue diseado para separar las cercarias en cuerpos y colas sin producir prdida del glicocalix y sin afectar su morfologa externa, ni su antigenicidad. La cercario-reaccin fue de utilidad para monitorear la presencia del glicocalix durante la separacin de cercarias en cuerpos y colas. Nuevos antgenos aparecieron en ambas regiones como consecuencia de la separacin. Los antgenos identificados en una u otra regin como consecuencia de la separacin (58,2 y 64 kDa en cuerpos y 35 y 53,6 kDa en cuerpos y colas). Los antgenos identificados en los extractos de cuerpos y de colas no resultaron ser la suma de los identificados en el extracto de cercarias completas. Antgenos de peso molecular entre 16,5- 84,3 kDa fueron reconocidos durante las primeras seis semanas de infeccin (fase aguda) y a las 16 semanas (fase crnica), antgenos adicionales de alto peso molecular fueron detectados (104-109,8 kDa). Esto podra ser consecuencia de eventos inmunitarios producidos durante el progreso de la fase crnica de la infeccin. La oxidacin-reduccin con metaperiodato de sodio/borohidrato de sodio de la glicoprotena antignica dominante de 65 kDa, no alter su reconocimiento por el suero de infeccin aguda y crnica, mientras que las de 97,5-100 y 108,2 kDa fueron reconocidas antes y despus del tratamiento nicamente por el suero de infeccin crnica. Esto sugiere que los anticuerpos producidos durante la infeccin crnica estn dirigidos contra eptopes glicosdicos y peptdicos de estas glicoprotenas, lo que puede explicar la reduccin en intensidad de las bandas del doblete de 97,5-100 kDa reconocidas por el suero de infeccin crnica despus del tratamiento. El hecho de que en la infeccin aguda se produzcan anticuerpos que reconocen eptopes polipeptdicos en la glicoprotena de 65 kDa y en la fase crnica contra otros tres (97,5-100 y 108,2 kDa), podra ser til para la identificacin de su secuencia polipeptdica conducente a la sntesis qumica de eptopes lineales destinados a la discriminacin de estas dos fases de la enfermedad. La evaluacin de reactividad cruzada con otros parsitos relacionados es requerida para determinar la especificidad de estos eptopes de antgenos glicoproticos.','2011-02-16','Esquistosomiasis, Schistosoma mansoni, Cercarias, Glicocalix, Glicoprotenas, Diagnstico',1,1,1,1,1,'2013-09-17 08:42:02','2013-09-17 08:42:02','Documento_682.pdf','application/pdf',405758,'2013-09-17 08:42:02',19,0,99,'COMPLETO'),(674,'Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Blattella germanicaLINNAEUS,, 11776677 ((BLATTARIA:: BLATTELLIDAE)),, BASES PARA UN MODELO EXPERIMENTAL DE ANLLISIS DEL CRECIMIENTO POBLACIONAL DE PLAGAS:: SU RELACINN CON LA EDAD Y EL VALOR REPRODUCTIVO..','Normal 0 21 false false false ES X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Las cucarachas constituyen tanto a nivel de salud pblica como para la industria agroalimentaria, un elemento de gran importancia debido a que estas contaminan a los alimentos y el agua de consumo con sus excretas, restos de exoesqueleto, mal olor y organismos patgenos causantes de enfermedades al hombre. Las cucarachas desarrollan resistencia a los insecticidas qumicos con rapidez, por lo que se dificulta su control. Blatella germanicaes conocida mundialmente como \"cucaracha alemana\", en nuestro pas se le llama \"chiripa\" y entre las cucarachas que son plagas domsticas es la ms importante debido a su amplia distribucin geogrfica. El conocimiento de los aspectos de la biologa de Blattella germanicay su relacin con las variables ambientales en los cuales habita, su desarrollo embrionario y su fecundidad, son de elevado inters en el momento de planificar y ejecutar acciones de control. En esta investigacin analizamos en condiciones de laboratorio la relacin entre la edad de los progenitores, la reproduccin de Blattella germanica y el ciclo de vida ninfal, as como estas caractersticas afectan el crecimiento poblacional de este bltido. Para ello utilizamos una colonia de Blattella germanica criada en el laboratorio y originaria de la Urb. La Candelaria, Maracay, estado Aragua. Ninfas de esta colonia se desarrollaron de manera individual hasta adultos, en frascos de vidrio de 500 ml de capacidad, con soporte de cartulina plegada a temperatura y humedad ambiental del laboratorio (23,79  0,98C y 65,12  8,81% de HR). A partir, de los adultos resultantes, se conformaron 45 parejas distribuidas equitativamente en 9 tratamientos. En estos, variamos las edades de la hembra y del macho, pudiendo ser  no similares entre s. Se realizaron observaciones diarias con el propsito de determinar el nmero de das previos a la observacin de las ootecas en la abertura genital, nmero de das transcurridos entre la observacin y la liberacin de las ootecas, nmero de das que le tom a las ninfas emerger, nmero de ootecas viables y nmero de ninfas emergidas por cada ooteca de Blattella germanica..Se realizaron observaciones semanales sobre las ninfas obtenidas de cada ooteca viable, para as estimar el tiempo de desarrollo ninfal, el nmero de individuos promedio emergidos por ooteca  fertilidad (Fx), supervivencia de las ninfas (lx) y la proporcin de sexos. Con estos datos se elaboraron tablas de vida dinmicas considerando como unidad de tiempo, el tiempo promedio de la duracin del ciclo ootecal, siendo este determinado por dos fases, la primera que corresponde al nmero de das transcurridos hasta la observacin de una ooteca en la abertura genital y la segunda fase que corresponde al nmero de das que transcurren luego que la ooteca se observ en la abertura genital hasta que es liberada. El ciclo ootecal tiene una duracin promedio de 35,46  5,03 das, donde la primera fase abarca 9,24  2,23 das y la segunda fase 26,78  2,66 das. B.. germanicacoloc un mximo de 6 ootecas viables (OV), estas se observaron durante los 7 primeros ciclos ootecales. El nmero de ootecas viables vari segn los tratamientos, relacionndose muy probablemente con las caractersticas del macho, de all que se proponen: machos Tipo I  los recin emergidos y los machos Tipo II de edad similar a la hembra. Tanto la supervivencia (lx) como la fecundidad (mx) se vieron reducidos en las secuencias ootecales sucesivas y no fueron independientes de la estructuracin de los tratamientos; en consecuencia, estos afectaron a los parmetros poblacionales relacionados: valor reproductivo (Vx), tasa neta de reproduccin (Ro), la tasa intrnseca de crecimiento (r), tiempo generacional (T) y tasa finita de multiplicacin (l). El nmero promedio de septos que se observ en las ootecas fue de 34,48, y el nmero promedio de ninfas que emergieron por ooteca fue de 31,42 individuos. La proporcin de sexos fue de 1,06 hembras por cada macho. El mximo valor reproductivo (vx) se obtuvo en aquellas edades donde se produjo la primera ooteca viable (OV) de cada tratamiento. La reproduccin en B.. germanica se ve afectada principalmente por las caractersticas del macho al momento de la copula y por la edad de la hembra lo cual guarda una relacin con la viabilidad de la ooteca. El mximo valor reproductivo (vx) se observ asociado a la produccin de la primera ooteca viable, particularmente en los casos donde las hembras y los machos tenan edades similares, disminuyendo en las ootecas subsiguientes.','2011-05-18','Blattella germanica, Ciclo Ootecal, Tablas de vida, Blattaria, Blattellidae, anlisis de crecimiento poblacional de plagas.',1,1,1,1,1,'2013-09-17 08:42:03','2013-09-17 08:42:03','Documento_683.pdf','application/pdf',539514,'2013-09-17 08:42:03',17,0,114,'COMPLETO'),(675,'Normal 0 21 false false false ES X-NONE X-NONE /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso- style-qformat:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow- orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans-serif\"; mso-ascii-font- family:Calibri; mso-ascii-theme-font:minor-latin; mso-fareast-font-family: \"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family: Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font-family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Blattella germanicaLINNAEUS,, 11776677 ((BLATTARIA:: BLATTELLIDAE)),, BASES PARA UN MODELO EXPERIMENTAL DE ANLLISIS DEL CRECIMIENTO POBLACIONAL DE PLAGAS:: SU RELACINN CON LA EDAD Y EL VALOR REPRODUCTIVO..','Normal 0 21 false false false ES X-NONE X-NONE st1:*{behavior:url(#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} Las c