ger, nmero de ootecas viables y nmero de ninfas emergidas por cada ooteca de Blattella germanica..Se realizaron observaciones semanales sobre las ninfas obtenidas de cada ooteca viable, para as estimar el tiempo de desarrollo ninfal, el nmero de individuos promedio emergidos por ooteca  fertilidad (Fx), supervivencia de las ninfas (lx) y la proporcin de sexos. Con estos datos se elaboraron tablas de vida dinmicas considerando como unidad de tiempo, el tiempo promedio de la duracin del ciclo ootecal, siendo este determinado por dos fases, la primera que corresponde al nmero de das transcurridos hasta la observacin de una ooteca en la abertura genital y la segunda fase que corresponde al nmero de das que transcurren luego que la ooteca se observ en la abertura genital hasta que es liberada. El ciclo ootecal tiene una duracin promedio de 35,46  5,03 das, donde la primera fase abarca 9,24  2,23 das y la segunda fase 26,78  2,66 das. B.. germanicacoloc un mximo de 6 ootecas viables (OV), estas se observaron durante los 7 primeros ciclos ootecales. El nmero de ootecas viables vari segn los tratamientos, relacionndose muy probablemente con las caractersticas del macho, de all que se proponen: machos Tipo I  los recin emergidos y los machos Tipo II de edad similar a la hembra. Tanto la supervivencia (lx) como la fecundidad (mx) se vieron reducidos en las secuencias ootecales sucesivas y no fueron independientes de la estructuracin de los tratamientos; en consecuencia, estos afectaron a los parmetros poblacionales relacionados: valor reproductivo (Vx), tasa neta de reproduccin (Ro), la tasa intrnseca de crecimiento (r), tiempo generacional (T) y tasa finita de multiplicacin (l). El nmero promedio de septos que se observ en las ootecas fue de 34,48, y el nmero promedio de ninfas que emergieron por ooteca fue de 31,42 individuos. La proporcin de sexos fue de 1,06 hembras por cada macho. El mximo valor reproductivo (vx) se obtuvo en aquellas edades donde se produjo la primera ooteca viable (OV) de cada tratamiento. La reproduccin en B.. germanica se ve afectada principalmente por las caractersticas del macho al momento de la copula y por la edad de la hembra lo cual guarda una relacin con la viabilidad de la ooteca. El mximo valor reproductivo (vx) se observ asociado a la produccin de la primera ooteca viable, particularmente en los casos donde las hembras y los machos tenan edades similares, disminuyendo en las ootecas subsiguientes.','2011-05-18','Blattela germanica,,Blattaria,,Blattellidae, Ciclo Ootecal, Tablas de Vida',1,1,1,1,1,'2013-09-17 08:42:04','2013-09-17 08:42:04','Documento_684.pdf','application/pdf',1035063,'2013-09-17 08:42:04',17,0,45,'COMPLETO'),(676,'Estudio de la respuesta especifica de anticuerpos de tipo IgE contra Ascaris lumbricoides en comunidades rurrales del Estado Miranda.','La ascaridiasis es una infeccin cuyo agente etiolgico es el parsito llamado Ascaris lumbricoides,, el cual es el ms grande de los nemtodos que parasita el intestino humano. En Venezuela la infeccin por A.. lumbricoides es la geohelmintiasis de mayor importancia en salud pblica, por su alta frecuencia, morbilidad, la determinacin de complicaciones graves y la produccin de altos niveles de la Inmunoglobulina E. En este trabajo se estudi la respuesta especfica de anticuerpos de tipo IgG e IgE contra extractos de vermes adultos de A.. lumbricoides en el suero de 117 individuos, de los cuales el 95% fueron nios de comunidades rurales del Edo. Miranda y 2 hospitales de la ciudad de Caracas. De los 117 individuos estudiados, 74 resultaron ser positivos paraAscaris lumbricoides, de los cuales 40 individuos posean a la par otra (as) parasitosis, y segn su porcentaje de incidencia se presentaron en las siguientes proporciones : 28 % presenta Trichuris trichiura, 23 % present BBlastocystis hominis, 19 % present GGiardia duodenalis, con un 13 % que presentan las parasitosis Entamoeba histolitica//dispar y Entamoeba coli y finalmente en un 2% se presentan individuos parasitados a la par con Strongyloides stercolaris y huevos de anquilostomidio. Se report en el perfil proteico un total de 16 bandas proteicas con masas moleculares de 148,48; 101,24; 95,19; 75,95; 67,26; 60,60; 56,29; 53,24; 51,10; 44,77; 41,15; 39,68; 34,77; 32,53; 31,51 y 26,3 kDa. Los resultados de los ensayos de ELISA a partir de los antgenos del extracto soluble de Ascaris lumbricoides, indican que diferentes protenas como la de 41 kDa presentes en este extracto podran estimular la produccin de IgE en los nios estudiados.','2010-10-27','Helminto, IgE, Ascaris lumbricoides, perfil proteico',1,1,1,1,1,'2013-09-17 08:42:05','2013-09-17 08:42:05','Documento_685.pdf','application/pdf',361469,'2013-09-17 08:42:05',18,0,75,'COMPLETO'),(677,'Estudio de FORMACION DE complejos de valencia mixta de V((IV,,V)) CON el aminocidob --ALANINA','En el presente trabajo fueron estudiados los siguientes sistemas: H+- BETA ALANINA Y H+- V(IV,V)-BETA ALANINA, POR MEDIO DE MEDIDAS DE FUERZA ELECTROMOTRIZ A 25C USANDI KCl COMO MEDIO INICO INERTE.EL ANLISIS DE LOS DATOS EXPERIMENTALES DE CADA SISTEMA SE REALIZ MEDIANTE EL PROGRAMA DE MNIMOS CUADRADOS LETAGROP.LAS SIGUIENTES TABLAS MUESTRAN LOS RESULTADOS OBTENIDOS. Tabla A. Constantes de estabilidad bp00r y valores de pKa del sistema H+-b-alanina (HL) (KCl 3.0 M, 25 C) obtenidas en este trabajo. especies reaccinn log bpor reaccinn pKa L-- HL  L-- ++ H++ 1100--99..8888((33)) H22L++  HL ++ H++ 44..0055((33)) H22L++ HL ++ H++  H22L++ 110044..0055((33)) HL  L-- ++ H++ 99..8888((33)) s((thc)) 00..0022661100 Tabla B. Constantes de estabilidad bpqrdel sistema H+-V(IV,V)-b-alanina obtenidas en KCl 3.0 M y a 25 C. Especies log bpqrs [H2V2O3C2]3+ 52.59(7) 52.70(7) 52.75(7) 52.82(6) [HV2O3C]3+ 39.64(8) 39.8(1) 39.8(1) 39.8(1) [V2O3C]2+ 35.4<35.9 Mx 36.1 Mx 36.1 Mx 36.0 [OHV2O3C]+ 32.76(6) 32.77(9) 32.8(9) 32.84(8) (OH)2 V2O3C 28.30(5) 28.34(8) 28.38(8) 28.39(6) s(thL) 0.03054 s(thB) 0.14954 s(thC) 0.14661 s(thLf) 0.10143','2011-05-27','COMPLEJOS DE VALENCIA MIXTA DE V(IV,V) CON  -ALANINA',6,1,1,1,1,'2013-09-17 08:42:06','2013-09-17 08:42:06','Documento_686.pdf','application/pdf',5784351,'2013-09-17 08:42:06',19,0,137,'COMPLETO'),(678,'CARACTERIZACIN GEOQMICA DE METALES PESADOS EN LOS SEDIMENTOS DE FONDO DE LA CUENCA DE RO TUY, VENEZUELA','Normal 0 21 false false false ES X-NONE X-NONE MicrosoftInternetExplorer4 / * Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-priority:99; mso-style-qformat:yes; mso-style-parent:\"\"; mso-padding- alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font-size:11.0pt; font-family:\"Calibri\",\"sans- serif\"; mso-ascii-font-family:Calibri; mso-ascii-theme-font:minor-latin; mso- fareast-font-family:\"Times New Roman\"; mso-fareast-theme-font:minor-fareast; mso-hansi-font-family:Calibri; mso-hansi-theme-font:minor-latin; mso-bidi-font- family:\"Times New Roman\"; mso-bidi-theme-font:minor-bidi;} En el presente trabajo fue llevado a cabo una caracterizacin geoqumica de los sedimentos de fondo de la cuenca del Ro Tuy, con el propsito de establecer la composicin granulomtrica de los sedimentos de fondo, la distribucin de los metales pesados analizados en las distintas fracciones granulomtricas del sedimento y al mismo tiempo determinar la concentracin de metales pesados en los puntos de muestreo establecidos en la fraccin <230 mallas. Desde el punto de vista qumico, los sedimentos fueron sometidos a un proceso de extraccin cida secuencial, empleando HCl (1M) en fro y HNO3concentrado en caliente, para posteriormente realizar la determinacin de todos los elementos de inters mediante la tcnica de espectroscopia de emisin atmica con fuente de plasma inductivamente acoplado, a excepcin del Hg, el cual fue determinado por un equipo DMA-80. Los resultados indicaron que aguas arriba del Ro Tuy predominan las fracciones ms gruesas del sedimento atribuida a la morfologa de la pendiente la cual es abrupta, adems de la alta energa del ro, mientras que aguas abajo de la cuenca predominan las fracciones de arenas medias a finas del sedimento, atribuyndolo a la poca energa del Ro y a las menores pendientes, lo que trae como consecuencia, que dominen procesos de floculacin y sedimentacin. Por otro lado los elementos analizados fueron extrados mayormente con el HNO3concentrado, que con el HCl diluido. Esto indic que los elementos estn ms asociados a la materia orgnica, arcillas y oxihidrxidos cristalinos; a excepcin del Cd y Mn que no presentan diferencia en la concentracin obtenida con ambos cidos, A su vez, lo elementos Al, Cr, Ni, Hg, Cu, Pb, Mn, Fe y Zn, tienden a acumularse preferiblemente en la fraccin <230 mallas, corroborando la escogencia de este tamao de grano para el anlisis de estos elementos, mientras que en los elementos As y Cd, no existe una fraccin del sedimento preferencial en la que tiendan a acumularse. Adicional a esto, la distribucin geoqumica de los elementos Al, Mn, Fe y Co son atribuidos principalmente a factores litolgicos, mientras que la concentracin de los elementos Zn, Cu, Pb, Cr, Ni, As, Hg y Cd estn asociados a las actividades domsticas, agropecuarias e industriales. Las zonas de mayor alteracin ambiental en el Ro Tuy fueron Guayas, Santa Teresa, Los Galpones, Araguita y Panaquire, por su parte, los ros Scuta, Taguaza, Tarma, Qda Yaguapo, Qda Sapo, Ro Panaquirito y Qda Urba, son afluentes que no presentan alteracin ambiental y que mejoran la calidad del Ro Tuy, mientras que los ros Guaire y Caucagua, son afluentes de mayor alteracin ambiental que desestabilizan y deterioran al Ro Tuy.','2011-05-25','Ro Tuy, Metales Pesados, Sedimentos de fondo, Alteracion ambiental',4,1,1,1,1,'2013-09-17 08:42:09','2013-09-17 08:42:09','Documento_687.pdf','application/pdf',9520721,'2013-09-17 08:42:09',20,0,124,'COMPLETO'),(679,'Paralelizacinn del modelo hiodrodinmico y de transporte de sedimentos Shal22D..','El Modelo Shal2D es un modelo hidrodinmico y de transporte de sedimentosbidimensional desarrollado por los ingenieros del Instituto de Mecnica de Fluidos dela facultad de Ingeniera de la Universidad Central de Venezuela. Este modelo se encargade estudiar la dinmica de fluidos incompresibles y el transporte de sedimentosen esos fluidos. El software permite obtener ciertas caractersticas de los ros comovelocidades, profundidad y elevacin de varios puntos sobre un caudal. Adems deesto, dependiendo de la cantidad de sedimentos y el tipo de material, se estudia comoestas son trasladadas, segn la velocidad horizontal en ese punto.Para reducir los tiempos de ejecucin de este modelo secuencial en este trabajo sepresenta el desarrollo de una aplicacin Shal2D paralela que permite dar resultados enun tiempo menor, y un refinamiento de la malla de entrada como preprocesamientode datos utilizando el software triangle para la generacin de ms nodos y por lo tantoobtener resultados ms precisos. Adems se presentan conocimientos bsicos en elrea de ingeniera sobre los modelos hidrodinmicos, como definiciones de fluidos-, hidrodinmica y mecnica de fluidos, hasta transporte de sedimentos, tipos desedimentos y mtodos matemticos aplicables a los modelos dependiendo del material.Tambin encontrar informacin base para el desarrollo de una aplicacin paralela trminoscomo cluster, libreras MPI y su implementacin en este proyecto.El simulador paralelo hidrodinmico y de transporte de sedimentos Shal2D tienecomo finalidad reducir los grandes tiempos de ejecucin del modelo en secuencial, estocon el objeto de obtener mejores tiempos de cmputo y resultados ms precisosmediante libreras para paralelizacin como MPI (Message Passing Interface) y el usodel software triangles para la triangulacin y refinamiento de la malla.','2011-05-30','Modelo Hidrodinmico, Shal2D, Transporte de sedimentos, MPI, Sistemas en paralelo,Paralelizacin, Malla.',2,1,1,1,1,'2013-09-17 08:42:11','2013-09-17 08:42:11','Documento_688.pdf','application/pdf',7247281,'2013-09-17 08:42:11',20,0,84,'COMPLETO'),(680,'DESARROLLO DE UNA MESA INTERACTIVA DE BAJO COSTO USANDO WEBCAMS.','Este trabajo especial de grado de grado consiste en la elaboracin de una mesa interactiva multitouch de bajo costo utilizando libreras multitouch open- source que soporten el procesamiento digital de imgenes por parte de una webcam infrarroja que constantemente verifica los cambios de estado del tope de la mesa con la que el usuario interacta. Esto impulsa el desarrollo de software intuitivo, orientado a la manipulacin directa de la mesa usando gestos naturales con las manos, sin el uso de un teclado ni ratn.','2011-05-30','Tecnologia, Multitouch, Touchlib, Procesamiento Digital de Imagenes, Tabletop, Infrarrojo, Vision por Computador',2,1,1,1,1,'2013-09-17 08:42:12','2013-09-17 08:42:12','Documento_689.pdf','application/pdf',2819163,'2013-09-17 08:42:12',20,0,60,'COMPLETO'),(681,'actividad y selectividad en la reaccion de HDT,para catalizadores W,Ni-W,Co-Mo y NiMo depositados sobre oxidos inorganicos modificados','se estudiaron reacciones de hidrotramiento empleando catalizadores en base a sulfuros de CoMo,NiMo y NiW y como fracciones de HVGO y VGO de crudos pesados de origen venezolano.A partir de la modificacin de los soportes emplendo aminopropiltrietoxisilano hace posible la formacin de un material carbnico in situ,la cual permite obtener catalizadores con alta dispersin y tambien minimizar las interacciones metal-soporte.Los catalizadores sintetizados posee una carga metlica de 4 % peso/peso','2011-07-06','actividad en reacciones de hidrodesulfuracin empleando catalizadores en base a CoMo,NiMo y NiW',6,1,1,1,1,'2013-09-17 08:42:13','2013-09-17 08:42:13','Documento_690.pdf','application/pdf',5778936,'2013-09-17 08:42:13',20,0,137,'COMPLETO'),(682,'Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para-margin:0cm; mso-para-margin- bottom:.0001pt; mso-pagination:widow-orphan; font-size:10.0pt; font-family: \"Times New Roman\"; mso-ansi-language:#0400; mso-fareast-language:#0400; mso- bidi-language:#0400;} Minera de textos para la asignacinn automtica de jurados a Trabajos Especiales de Grado','Normal 0 21 false false false MicrosoftInternetExplorer4 st1:*{behavior:url (#ieooui) } /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband-size:0; mso-tstyle-colband-size:0; mso-style- noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4pt 0cm 5.4pt; mso-para- margin:0cm; mso-para-margin-bottom:.0001pt; mso-pagination:widow-orphan; font- size:10.0pt; font-family:\"Times New Roman\"; mso-ansi-language:#0400; mso- fareast-language:#0400; mso-bidi-language:#0400;} Este trabajo tiene como objetivo el desarrollo de un prototipo basado en minera de textos para la asignacin automtica de jurados a Trabajos Especiales de Grado (TEG), a travs de la clasificacin de los documentos dentro de las reas profesionales de la Escuela de Computacin. Para la creacin del clasificador se aplic el proceso de minera de textos sobre una recopilacin de documentos de TEG, lo cuales fueron preprocesados, eliminando signos de puntuacin, palabras no informativas y aplicando word stemming, y representados mediante el modelo de espacio vectorial con diferentes tcnicas de indexacin. Asimismo, se probaron diferentes medidas de relevancia para la reduccin de la dimensionalidad del espacio de atributos. Para la estimacin del modelo de clasificacin se realizaron pruebas aplicando el algoritmo k vecinos ms cercanos con diferentes parmetros, alcanzando un 82% de clasificaciones correctas. A travs de la recomendacin de hasta dos reas, se logr incrementar el porcentaje de clasificaciones correctas a 95%. Este mdulo de recomendacin de reas se integr con el mdulo de asignacin, con el fin de realizar la asignacin de los jurados, considerando a los profesores pertenecientes al o las reas recomendadas, en base a criterios de eleccin previamente definidos. En conclusin, fue posible obtener un buen rendimiento de clasificacin de documentos de TEG aplicando minera de textos y se logr automatizar el proceso de asignacin de jurados a TEG, lo que a su vez permite llevar un registro histrico de las asignaciones, contribuyendo adems con la automatizacin de procesos de la Escuela de Computacin.','2011-06-03','Normal 0 21 false false false MicrosoftInternetExplorer4 /* Style Definitions */ table.MsoNormalTable {mso-style-name:\"Tabla normal\"; mso-tstyle-rowband- size:0; mso-tstyle-colband-size:0; mso-style-noshow:yes; mso-style-parent:\"\"; mso-padding-alt:0cm 5.4',2,1,1,1,1,'2013-09-17 08:42:17','2013-09-17 08:42:17','Documento_691.pdf','application/pdf',770590,'2013-09-17 08:42:17',20,0,111,'COMPLETO'),(683,'Desarrollo de una solucinn analtica para la administracinn de las relaciones con los clientes','Es importante para las organizaciones generar relaciones rentables con los clientes. La Administracin de las Relaciones con los Clientes (CRM, por sus siglas en ingls) es una estrategia que busca entender y anticipar las necesidades de los clientes, es decir, es una estrategia de negocio basada en el negocio. Los sistemas CRM, se dividen en tres tipos segn sus funciones, el primero es el operacional que cumple con la automatizacin de las ventas, servicios y mercadeo; el segundo es el colaborativo que administra una comunicacin ms directa y de retroalimentacin con los clientes y por ltimo el analtico que hace un estudio del comportamiento del cliente segn los datos generados por los dos tipos de CRM anteriores. El presente trabajo especial de grado (TEG) consiste en el desarrollo de una solucin analtica para la administracin de las relaciones con los clientes, es decir un Sistema CRM Analtico, usando la metodologa Lifecyclepropuesta por Ralph Kimball (Kimball, Ross, Thornthwaite, Mundy, Becker 2008) para la implementacin de soluciones de inteligencia de negocios. El sistema se sustenta de los datos de la solucin AADempiere, la cual cuenta con un proceso de CRM operacional basado en software libre y desarrollado bajo la licencia pblica general de GNU. Para el desarrollo del CRM Analtico se utiliza una plataforma de inteligencia de negocio Pentaho, tambin software libre. Con ella se construyen funcionalidades para el estudio y comportamiento del cliente, empezando por su segmentacin geogrfica y demogrfica, descubriendo sus preferencias entre los diferentes productos, los representantes de ventas ms destacados y el efecto que tienen las campaas en su comportamiento. Todo esto haciendo un estudio de las ventas de una empresa de venta al detal cargada en el sistema transaccional.','2011-07-22','Palabras Claves: Administracin de Relaciones con los Clientes, Planificacin de Recursos Empresariales, Inteligencia de Negocio, Software Libre.',2,1,1,1,1,'2013-09-17 08:42:18','2013-09-17 08:42:18','Documento_692.pdf','application/pdf',4067585,'2013-09-17 08:42:18',18,0,128,'COMPLETO'),(684,'Adecuacin de la modelacin gil reutilizando componentes en construccin de interfaces de usuario. Caso de estudio: Registro de publicaciones peridicas.','Una de las problemticas abordada por la Ingeniera de software es el incumplimiento en los tiempos de entrega de los productos de software, algunos esfuerzos estn dirigidos a introducir en el desarrollo el reuso de componentes que, en experiencias previas, han resultado exitosos. Estos componentes estn expresados como patrones (diseo, arquitectura, interaccin, entre otros) o como piezas de software disponibles en libreras y/o la web (repositorios y/ o pginas especializadas). El presente Trabajo Especial de Grado muestra una experiencia de desarrollo de software, donde se incorpora el reuso de componentes en la construccin y puesta en marcha de una interfaz para el \"Registro Digital de Publicaciones Peridicas\" del Banco Central de Venezuela. El objetivo del Trabajo Especial de Grado es desarrollar la interfaz de usuario, adecuando el modelado gil con tcnicas de usabilidad, que faciliten la reutilizacin de componentes tanto a nivel de especificacin como de cdigo en el dominio de las bibliotecas virtuales, a fin de obtener un producto usable.En la experiencia se obtuvo como producto desde la perspectiva metodolgica, la adecuacin del mtodo de desarrollo gil propuesto por Ambler (2002) y el lenguaje de patrones de interaccin propuesto por Acosta (2004), identificando el patrn de dominio y de algunas tareas cuyas especificaciones y cdigo fueron reusadas en el desarrollo. Algunas adaptaciones entre los elementos fueron realizadas a fin de lograr la coherencia y consistencia en la interfaz de usuario. Las entregas fueron realizadas en tiempos aceptables para el cliente. Desde la perspectiva del producto software, se logra migrar el modelo conceptual del usuario de las aplicaciones exitosas al nuevo producto, garantizando que los aspectos de usabilidad tambin fueran migrados. Para constatar la usabilidad lograda y en concordancia con el modelado gil, se aplicaron inspecciones y evaluaciones heursticas al final de cada una de las iteraciones propuestas.','2011-07-15','Reutilizacin, Usabilidad, Mtodo gil, Lenguaje de Patrones, Pruebas de Usabilidad',2,1,1,1,1,'2013-09-17 08:42:23','2013-09-17 08:42:23','Documento_693.pdf','application/pdf',11019838,'2013-09-17 08:42:23',20,0,100,'COMPLETO'),(685,'{}','{}','2011-09-26','{}',6,1,1,1,1,'2013-09-17 08:42:24','2013-09-17 08:42:24','Documento_694.pdf','application/pdf',6341234,'2013-09-17 08:42:24',18,0,138,'COMPLETO'),(686,'{}','{}','2011-09-22','{}',1,1,1,1,1,'2013-09-17 08:42:29','2013-09-17 08:42:29','Documento_695.pdf','application/pdf',2918001,'2013-09-17 08:42:29',20,0,112,'COMPLETO'),(687,'{}','{}','2011-10-27','{}',5,1,1,1,1,'2013-09-17 0